INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 42, 'La La Land: Cantando Estações', 'La La Land', 'Estados Unidos', 'Romance', 'Damien Chazelle', '15351329325b80450483852.jpeg', 128, 2017, 'uGOaZezEi4Q', 'Emma Stone, Ryan Gosling, John Legend, J. K. Simmons, Rosemarie DeWitt, Sonoya Mizuno, Jessica Rothe, Callie Hernandez, Josh Pence', 'Ao chegar em Los Angeles o pianista de jazz Sebastian (Ryan Gosling) conhece a atriz iniciante Mia (Emma Stone) e os dois se apaixonam perdidamente. Em busca de oportunidades para suas carreiras na competitiva cidade, os jovens tentam fazer o relacionamento amoroso dar certo enquanto perseguem fama e sucesso.', 0, NULL, NULL, NULL),
(NULL, 43, 'Corra!', 'Get Out', 'Estados Unidos', 'Suspense', 'Jordan Peele', '15351329745b80452e8f9be.jpg', 104, 2017, 'mDGV5UucTu8', 'Daniel Kaluuya, Allison Williams, Catherine Keener, Bradley Whitford, Lil Rel Howery, Betty Gabriel, Caleb Landry Jones', 'Chris (Daniel Kaluuya) é jovem negro que está prestes a conhecer a família de sua namorada caucasiana Rose (Allison Williams). A princípio, ele acredita que o comportamento excessivamente amoroso por parte da família dela é uma tentativa de lidar com o relacionamento de Rose com um rapaz negro, mas, com o tempo, Chris percebe que a família esconde algo muito mais perturbador.', 0, NULL, NULL, NULL),
(NULL, 44, 'Divertida Mente', 'Inside Out', 'Estados Unidos', 'Animação', 'Pete Docter', '15351330185b80455a7c37d.jpg', 102, 2015, 'VBtuhyFddnk', 'Amy Poehler, Phyllis Smith, Richard Kind, Bill Hader', 'Riley é uma garota de 11 anos de idade, que enfrenta mudanças importantes em sua vida quando seus pais decidem deixar a sua cidade natal, no estado de Minnesota, para viver em San Francisco. Dentro do cérebro de Riley, convivem várias emoções diferentes, como a Alegria, o Medo, a Raiva, o Nojinho e a Tristeza. A líder deles é Alegria, que se esforça bastante para fazer com que a vida de Riley seja sempre feliz. Entretanto, uma confusão na sala de controle faz com que ela e Tristeza sejam expelidas para fora do local. Agora, elas precisam percorrer as várias ilhas existentes nos pensamentos de Riley para que possam retornar à sala de controle - e, enquanto isto não acontece, a vida da garota muda radicalmente.', 0, NULL, NULL, NULL),
(NULL, 46, 'Vingadores: Guerra Infinita', 'Avengers: Infinity War', 'Estados Unidos', 'Herói, Ação, Aventura, Drama, Ficção Científica', 'Joe Russo, Anthony Russo', '15351330655b804589db536.jpg', 160, 2018, 't_ULBP6V9bg', 'Robert Downey Jr., Chris Hemsworth, Mark Ruffalo, Chris Evans, Scarlet Johansson, Benedict Cumberbatch, Tom Holland, Chadwick Boseman, Zoe Saldana', 'Thanos (Josh Brolin) enfim chega à Terra, disposto a reunir as Joias do Infinito. Para enfrentá-lo, os Vingadores precisam unir forças com os Guardiões da Galáxia, ao mesmo tempo em que lidam com desavenças entre alguns de seus integrantes.', 0, NULL, NULL, NULL),
(NULL, 47, 'It: A Coisa', 'It', 'Estados Unidos', 'Terror', 'Andy Muschietti', '15351331305b8045ca6c5ef.jpg', 135, 2017, 'dD264ZjfKlk ', 'Jaeden Lieberher, Jeremy Ray Taylor, Sophia Lillis, Finn Wolfhard', 'Um grupo de sete adolescentes de Derry, uma cidade no Maine, formam o auto-intitulado \"Losers Club\" - o clube dos perdedores. A pacata rotina da cidade é abalada quando crianças começam a desaparecer e tudo o que pode ser encontrado delas são partes de seus corpos. Logo, os integrantes do \"Losers Club\" acabam ficando face a face com o responsável pelos crimes: o palhaço Pennywise.', 0, NULL, NULL, NULL),
(NULL, 48, 'Mãe!', 'Mother!', 'Estados Unidos', 'Suspense', 'Darren Aronofsky', '15351331675b8045efb482a.jpg', 121, 2017, '33q04vOTi3k', 'Jennifer Lawrence, Javier Bardem, Ed Harris, Michelle Pfeiffer', 'Enquanto a jovem esposa (Jennifer Lawrence) passa os dias restaurando o casarï¿½o que vive, afetado por um incï¿½ndio no passado, o marido mais velho (Javier Bardem) tenta desesperadamente recuperar a inspiraï¿½ï¿½o para voltar a escrever os poemas que o tornaram famoso. Os dias pacï¿½ficos se transformam com a chegada de uma sï¿½rie de visitantes que se impï¿½em ï¿½ rotina do casal e escondem suas verdadeiras intenï¿½ï¿½es.', 0, NULL, NULL, NULL),
(NULL, 49, 'Me Chame Pelo Seu Nome', 'Call Me By Your Name', 'Estados Unidos', 'Romance, LGBT, Coming of Age, Drama', 'Luca Guadagnino', '15351332185b804622492de.jpg', 132, 2018, 'ah3kGJ7TSNQ', 'Timothée Chalamet, Armie Hammer, Michael Stuhlbarg, Amira Casar, Esther Garrel, Victoire Du Bois, Vanda Capriolo', 'O sensível e único filho da família americana com ascendência italiana e francesa Perlman, Elio (Timothée Chalamet), está enfrentando outro verão preguiçoso na casa de seus pais na bela e lânguida paisagem italiana. Mas tudo muda quando Oliver (Armie Hammer), um acadêmico que veio ajudar a pesquisa de seu pai, chega.', 0, NULL, NULL, 1),
(NULL, 50, 'Moonlight: Sob a Luz do Luar', 'Moonlight', 'Estados Unidos', 'Drama, LGBT', 'Barry Jenkins', '15352971265b82c666864da.jpg', 115, 2016, 'I9Si4dQw9-E', 'Mahershala Ali, Trevante Rhodes, Naomie Harris, Ashton Sanders, Janelle Monáe, André Holland, Jaden Piner, Shariff Earp, Patrick Decile', 'Três momentos da vida de Chiron, um jovem negro morador de uma comunidade pobre de Miami. Do bullying na infância, passando pela crise de identidade da adolescência e a tentação do universo do crime e das drogas, este é um político estudo de personagem. Encontrando amor em locais surpreendentes, ele sonha com um futuro maravilhoso.', 0, NULL, NULL, NULL),
(NULL, 51, 'Três Anúncios Para Um Crime', 'Three Billboards Outside Ebbing, Missouri', 'Estados Unidos', 'Drama', 'Martin McDonagh', '15351367105b8053c63c669.jpg', 115, 2018, 'DaG5ICpyGDM', ' Frances McDormand, Woody Harrelson, Sam Rockwell, Peter Dinklage, Abbie Cornish, Caleb Landry Jones, Lucas Hedges, Samara Weaving, John Hawkes', ' Inconformada com a ineficácia da polícia em encontrar o culpado pelo brutal assassinato de sua filha, Mildred Hayes (Frances McDormand) decide chamar atenção para o caso não solucionado alugando três outdoors em uma estrada raramente usada. A inesperada atitude repercute em toda a cidade e suas consequências afetam várias pessoas, especialmente a própria Mildred e o Delegado Willoughby (Woody Harrelson), responsável pela investigação.', 0, NULL, NULL, NULL),
(NULL, 52, 'Cisne Negro', 'Black Swan', 'Estados Unidos', 'Suspense', 'Darren Aronofsky', '15351369115b80548f60e85.jpg', 108, 2011, 't-weIgpXS6g', 'Natalie Portman, Vincent Cassel, Winona Ryder, Mila Kunis, Barbara Hershey, Janet Montgomery, Benjamin Millepied', 'Beth MacIntyre (Winona Ryder), a primeira bailarina de uma companhia, está prestes a se aposentar. O posto fica com Nina (Natalie Portman), mas ela possui sérios problemas pessoais, especialmente com sua mãe (Barbara Hershey). Pressionada por Thomas Leroy (Vincent Cassel), um exigente diretor artístico, ela passa a enxergar uma concorrência desleal vindo de suas colegas, em especial Lilly (Mila Kunis). Em meio a tudo isso, busca a perfeição nos ensaios para o maior desafio de sua carreira: interpretar a Rainha Cisne em uma adaptação de \"O Lago dos Cisnes\".', 0, NULL, NULL, NULL),
(NULL, 55, 'A Cor Púrpura', 'The Color Purple', 'Estados Unidos', 'Drama', 'Steven Spielberg', '15353805975b840c7508862.jpg', 154, 1986, 'RsGG6YhEh2s', NULL, 'Em uma pequena cidade, Celie (Whoopi Goldberg), uma jovem com apenas 14 anos que foi violentada pelo pai, se torna mãe de duas crianças. Além de perder a capacidade de procriar, Celie imediatamente é separada dos filhos e da única pessoa no mundo que a ama, sua irmã, e é doada a \"Mister\" (Danny Glover), que a trata simultaneamente como escrava e companheira. Grande parte da brutalidade de Mister provêm por alimentar uma forte paixão por Shug Avery (Margaret Avery), uma sensual cantora de blues. Celie fica muito solitária e compartilha sua tristeza em cartas (a única forma de manter a sanidade em um mundo onde poucos a ouvem), primeiramente com Deus e depois com a irmã Nettie (Akosua Busia), missionária na África. Mas quando Shug, aliada à forte Sofia (Oprah Winfrey), esposa de Harpo (Willard E. Pugh), filho de Mister, entram na sua vida, Celie revela seu espírito brilhante, ganhando consciência do seu valor e das possibilidades que o mundo lhe oferece. ', 0, NULL, NULL, NULL),
(NULL, 56, 'Quanto Vale ou É por Quilo?', 'Quanto Vale ou É por Quilo?', 'Brasil', 'Drama', 'Sérgio Bianchi', '15353807605b840d18e5526.jpg', 110, 2005, 'pRjhvfQtGig', NULL, 'Uma analogia entre o antigo comércio de escravos e a atual exploração da miséria pelo marketing social, que forma uma solidariedade de fachada. No século XVII um capitão-do-mato captura um escrava fugitiva, que está grávida. Após entregá-la ao seu dono e receber sua recompensa, a escrava aborta o filho que espera. Nos dias atuais uma ONG implanta o projeto Informática na Periferia em uma comunidade carente. Arminda, que trabalha no projeto, descobre que os computadores comprados foram superfaturados e, por causa disto, precisa agora ser eliminada. Candinho, um jovem desempregado cuja esposa está grávida, torna-se matador de aluguel para conseguir dinheiro para sobreviver.', 0, NULL, NULL, NULL),
(NULL, 57, 'Uma Mente Brilhante', 'A Beautiful Mind', 'Estados Unidos', 'Drama', 'Ron Howard ', '15353808885b840d988f442.jpg', 134, 2002, 'q8vUMD1f0ss', 'Ron Howard, John Nash', 'John Nash (Russell Crowe) é um gênio da matemática que, aos 21 anos, formulou um teorema que provou sua genialidade e o tornou aclamado no meio onde atuava. Mas aos poucos o belo e arrogante Nash se transforma em um sofrido e atormentado homem, que chega até mesmo a ser diagnosticado como esquizofrênico pelos médicos que o tratam. Porém, após anos de luta para se recuperar, ele consegue retornar à sociedade e acaba sendo premiado com o Nobel.', 0, NULL, NULL, NULL),
(NULL, 58, 'Simplesmente Acontece', 'Love, Rosie', 'Reino Unido', 'Romance', 'Christian Ditter', '15353810095b840e1186703.jpg', 102, 2015, 'qdK-H_E-gXA', 'Lily Collins, Sam Claflin, Christian Cooke, Suki Waterhouse, Jaime Winston, Tamsin Egerton ', 'Os jovens britânicos Rosie (Lily Collins) e Alex (Sam Claflin) são amigos inseparáveis desde a infância, experimentando juntos as dificuldades amorosas, familiares e escolares. Embora exista uma atração entre eles, os dois mantêm a amizade acima de tudo. Um dia, Alex decide aceitar um convite para estudar medicina em Harvard, nos Estados Unidos. A distância entre eles faz com que nasçam os primeiros segredos, enquanto cada um encontra outros namorados e namoradas. Mas o destino continua atraindo Rosie e Alex um ao outro.', 0, NULL, NULL, NULL),
(NULL, 59, 'Confiar', 'Trust', 'Estados Unidos', 'Drama', 'David Schwimmer', '15353811185b840e7e4904e.jpg', 106, 2011, 'vsGxpqQGhrE ', 'Florence Bebic-Veruni, Ralph Fellows, Nika Kushnir, Uriel Jaouen Zrehen', 'Will (Clive Owen) e Lynn (Catherine Keener) têm três filhos. Enquanto um está prestes a entrar para a faculdade, a filha do meio, Annie (Liana Liberato), começa a apresentar os sintomas comuns das adolescentes que querem se parecer mais velhas e ser aceitas entre seus pares. Publicitário bem sucedido e super envolvido com a profissão, Will procura ter uma relação de confiança com os filhos, mas Annie inicia um relacionamento no computador com um jovem de 16 anos e dá continuidade através do telefone. Sem que seus pais soubessem, ela aceita o convite dele para um encontro, mas a surpresa que ela tem no primeiro momento é só o começo de um pesadelo que marcará para sempre a sua vida e a de sua família.', 0, NULL, NULL, NULL),
(NULL, 60, 'A Culpa é das Estrelas', 'The Fault in Our Stars', 'Estados Unidos', 'Drama', 'Josh Boone ', '15353812845b840f24ce256.jpg', 133, 2014, 'lFOOZJ1UChg', 'Shailene Woodley, Ansel Elgort, Nat Wolff, Laura Dern, Willem Dalfoe', 'Hazel Grace Lancaster e Augustus Waters são dois adolescentes que se conhecem em um grupo de apoio para pacientes com câncer. Por causa da doença, Hazel sempre descartou a ideia de se envolver amorosamente, mas acaba cedendo ao se apaixonar por Augustus. Juntos, eles viajam para Amsterdã, onde embarcam em uma jornada inesquecível.', 0, NULL, NULL, NULL),
(NULL, 61, 'Sr. Ninguém', 'Mr. Nobody', 'Bélgica', 'Ficção Científica', 'Jaco Van Dormael', '15353873765b8426f0ab22c.jpg', 141, 2009, 'Fwoe6yHy0AI ', 'Jared Leto, Sarah Polley, Diane Kruger, Linh Dan Pham', 'Marido de Elise (Sarah Polley) e pai de três filhos, Nemo Nobody (Jared Leto) leva uma vida comum ao lado de sua família. Ele acorda no ano de 2092 e agora, com 118 anos, é o último mortal em um planeta de seres humanos imortais. As suas preocupações, contudo, envolvem outras questões, como o que aconteceu durante a passagem de tempo e se viveu sua vida como gostaria.', 0, NULL, NULL, NULL),
(NULL, 62, 'O Menino do Pijama Listrado', 'The Boy in the Striped Pyjamas', 'Reino Unido', 'Drama', 'Mark Herman ', '15353875195b84277f18370.jpg', 94, 2008, 'Shypz2_NshM', NULL, 'Alemanha, Segunda Guerra Mundial. O menino Bruno (Asa Butterfield), de 8 anos, é filho de um oficial nazista (David Tewlis) que assume um cargo importante em um campo de concentração. Sem saber realmente o que seu pai faz, ele deixa Berlim e se muda com ele e a mãe (Vera Farmiga) para uma área isolada, onde não há muito o que fazer para uma criança com a idade dele. Os problemas começam quando ele decide explorar o local e acaba conhecendo Shmuel (Jack Scanlon), um garoto de idade parecida, que vive usando um pijama listrado e está sempre do outro lado de uma cerca eletrificada. A amizade cresce entre os dois e Bruno passa, cada vez mais, a visitá-lo, tornando essa relação mais perigosa do que eles imaginam.', 0, NULL, NULL, NULL),
(NULL, 63, 'Donnie Darko', 'Donnie Darko', 'Estados Unidos', 'Ficção Científica', 'Richard Kelly', '15353876945b84282e9db9f.jpg', 104, 2000, 'FZZqcmaALJs', NULL, 'Donnie (Jake Gyllenhaal) é um jovem brilhante e excêntrico, que cursa o colegial mas despreza a grande maioria dos seus colegas de escola. Donnie tem visões, em especial de um coelho monstruoso o qual apenas ele consegue ver, que o encorajam a realizar brincadeiras destrutivas e humilhantes com quem o cerca. Até que um dia uma de suas visões o atrai para fora de casa e lhe diz que o mundo acabará dentro de um mês. Donnie inicialmente não acredita na profecia, mas momentos depois um avião cai bem no telhado de sua casa, quase matando-o. É quando ele começa a se perguntar qual o fundo de verdade da sua previsão.', 0, NULL, NULL, NULL),
(NULL, 64, 'Os Delírios de Consumo de Becky Bloom', 'Confessions of a Shopaholic', 'Estados Unidos', 'Comédia', '	P.J. Hogan', '15353879425b842926d6f77.jpg', 106, 2009, 'LjQ7hMbfEDw ', 'Isla Fisher, Hugh Dancy, Krysten Ritter, Joan Cusack', 'Nova York. Rebecca Bloomwood (Isla Fisher) é uma garota que adora fazer compras e seu vício a leva à falência. Seu grande sonho é um dia trabalhar em sua revista de moda preferida, mas o máximo que ela consegue é um emprego como colunista na revista de finanças publicada pela mesma editora. Quando enfim seu sonho está prestes a ser realizado, ela repensa suas ambições.', 0, NULL, NULL, NULL),
(NULL, 65, 'O Quarto de Jack', 'Room', 'Canadá', 'Drama', 'Lenny Abrahamson', '15353881295b8429e176657.jpg', 118, 2016, 'Ri_eUI7UI8I ', 'Brie Larson, Jacob Tremblay, Joan Allen, William H. Macy, Sean Bridgers, Amanda Brugel, Cas Anvar, Joe Pingue', 'Joy (Brie Larson) e seu filho Jack (Jacob Tremblay) vivem isolados em um quarto. O único contato que ambos têm com o mundo exterior é a visita periódica do Velho Nick (Sean Bridgers), que os mantém em cativeiro. Joy faz o possível para tornar suportável a vida no local, mas não vê a hora de deixá-lo. Para tanto, elabora um plano em que, com a ajuda do filho, poderá enganar Nick e retornar à realidade.', 0, NULL, NULL, NULL),
(NULL, 66, 'Um Contratempo', 'Contratiempo', 'Espanha', 'Policial', 'Oriol Paulo', '15353882885b842a80299d9.jpg', 110, 2016, '4DTjlmNYMEo ', NULL, 'Tudo está indo muito bem para Adrian Doria (Mario Casas). Seu negócio é um sucesso e lhe trouxe riqueza, sua bela esposa teve a criança perfeita, e sua amante está bem com o caso dos dois escondido. Tudo está ótimo até que Doria desperta num quarto de hotel, depois de ser atingido na cabeça, e encontra sua amante morta no banheiro, coberta com um monte de notas em euros. Pior, o quarto é trancado por dentro e não tem nenhuma maneira de entrar ou sair. Com tudo o que construiu desmoronando aos seus pés, Doria recorre a melhor advogada de defesa da Espanha, Virginia Goodman (Ana Wagener), e eles tentam descobrir o que realmente aconteceu na noite anterior.', 0, NULL, NULL, NULL),
(NULL, 68, 'Malévola ', 'Maleficent ', 'Estados Unidos', 'Fantasia', 'Robert Stromberg', '15353886245b842bd0bbae1.png', 97, 2014, 'Uqg12lAsydY', 'Angelina Jolie, Elle Fanning, Sharlto Copley, Lesley Manville', 'Baseado no conto da Bela Adormecida, o filme conta a história de Malévola (Angelina Jolie), a protetora do reino dos Moors. Desde pequena, esta garota com chifres e asas mantém a paz entre dois reinos diferentes, até se apaixonar pelo garoto Stefan (Sharlto Copley). Os dois iniciam um romance, mas Stefan tem a ambição de se tornar líder do reino vizinho, e abandona Malévola para conquistar seus planos. A garota torna-se uma mulher vingativa e amarga, que decide amaldiçoar a filha recém-nascida de Stefan, Aurora (Elle Fanning). Aos poucos, no entanto, Malévola começa a desenvolver sentimentos de amizade em relação à jovem e pura Aurora.', 0, NULL, NULL, NULL),
(NULL, 69, 'Um Limite Entre Nós', 'Fences', 'Estados Unidos', 'Drama', 'Denzel Washington', '15353887415b842c4554e03.jpg', 139, 2016, 'vaKqv0pEEf4', 'Denzel Washington, Viola Davis, Stephen McKinley Henderson, Jovan Adepo', 'Anos 1950. Troy Maxson (Denzel Washington) tem 53 anos e mora com a esposa, Rose (Viola Davis), e o filho mais novo, Cory (Jovan Adepo). Ele trabalha recolhendo lixo das ruas e batalha na empresa para que consiga migrar para o posto de motorista do caminhão de lixo. Troy sente um profundo rancor por não ter conseguido se tornar jogador profissional de baseball, devido à cor de sua pele, e por causa disto não quer que o filho siga como esportista. Isto faz com que o jovem bata de frente com o pai, já que um recrutador está prestes a ser enviado para observá-lo em jogos de futebol americano.', 0, NULL, NULL, NULL),
(NULL, 70, 'Pais & Filhos', 'Soshite Chichi ni Naru', 'Japão', 'Drama', 'Hirokazu Koreed', '15353889345b842d060e00d.jpg', 121, 2013, 'QjUcAgsddf8 ', NULL, 'Esta é a história de um grande homem de negócios, obcecado pelo dinheiro e pelo sucesso. Sua vida sofre uma grande transformação quando ele descobre que está criando o filho de outro homem há seis anos, já que seu filho biológico foi trocado por engano na maternidade.', 0, NULL, NULL, NULL),
(NULL, 71, 'Submarino', 'Submarine', 'Reino Unido', 'Drama', 'Richard Ayoade', '15353890475b842d7741207.jpg', 107, 2011, 'x2KDpduWPMc', NULL, 'Oliver Tate (Craig Roberts) é um menino de 15 anos que tem dois objetivos na vida: perder a virgindade antes do seu aniversário com a sua nova namorada Jordana (Yasmin Paige), e tentar afastar a mãe do ex-namorado que se mudou para a casa ao lado. Além disso, para salvar o casamento de seus pais, Oliver tem a ideia de controlar a vida sexual deles e de forjar cartas românticas sugestivas de sua mãe para seu pai.', 0, NULL, NULL, NULL),
(NULL, 72, 'Watchmen - O Filme', 'Watchmen', 'Estados Unidos', 'Ficção Científica', 'Zack Snyder ', '15353892825b842e623e266.jpg', 162, 2009, 'nwrSgao6I4w', 'Malin Akerman, Billy Crudup, Matthew Goode, Jackie Earle Haley', 'Em 1977 foi aprovada pelo congresso norte-americano a Lei Keene, que proibia as atividades de mascarados no combate ao crime. Isto fez com que vários super-heróis deixassem a carreira, como o Coruja (Patrick Wilson) e Espectral (Malin Akerman). Outros, como o Comediante (Jeffrey Dean Morgan) e o Dr. Manhattan (Billy Crudup), passaram a trabalhar para o governo. Dois anos antes da implementação desta lei Adrian Veidt (Matthew Goode) decidiu revelar sua identidade como Ozymandias, dedicando-se a partir de então na construção de um império econômico. Em 1985 o mundo vive o clima da Guerra Fria, no qual um ataque nuclear pode acontecer a qualquer momento, vindo dos Estados Unidos ou da União Soviética. Neste clima de tensão política Edward Blake, o Comediante, é assassinado. Em seu funeral comparecem, em momentos diversos, seus antigos companheiros. Entre eles está Rorschach (Jackie Earle Haley), que acredita que sua morte seja o indício da existência de um assassino de mascarados.', 0, NULL, NULL, NULL),
(NULL, 73, 'As Branquelas', 'White Chicks ', 'Estados Unidos', 'Comédia', ' Keenen Ivory Wayans', '15353893985b842ed6974db.jpg', 109, 2004, 'y5nr345eBQ0 ', 'Shawn Wayans, Marlon Wayans, Jaime King, Frankie Faison', 'Os irmãos Marcus (Marlon Wayans) e Kevin Copeland (Shawn Wayans) são detetives do FBI que estão com problemas no trabalho. A última investigação da dupla foi um grande fracasso e eles estão sob a ameaça de serem demitidos. Quando um plano para sequestrar as mimadas irmãs Brittany (Maitland Ward) e Tiffany Wilson (Anne Dudek) é descoberto, o caso é entregue aos principais rivais dos irmãos Copeland, os agentes Vincent Gomez (Eddie Velez) e Jack Harper (Lochlyn Munro). Para aumentar ainda mais a humilhação da dupla, eles são escalados para escoltar as jovens mimadas do aeroporto até o local de um evento pelo qual elas esperaram por meses. Porém no trajeto um acidente de carro provoca um verdadeiro desastre: enquanto uma das irmãs arranha o nariz, a outra corta o lábio. Desesperadas, elas se recusam a ir ao evento. É quando,para salvar o emprego, Marcus e Kevin decidem por assumir as identidades das irmãs.', 0, NULL, NULL, NULL),
(NULL, 74, 'Guardiões da Galáxia ', 'Guardians of the Galaxy ', 'Estados Unidos', 'Fantasia', ' James Gunn ', '15353895245b842f541d1ce.jpg', 121, 2014, 'XdWyeT1VZrY', 'Chris Pratt, Zoe Saldana, Dave Bautista, Vin Diesel', 'Peter Quill (Chris Pratt) foi abduzido da Terra quando ainda era criança. Adulto, fez carreira como saqueador e ganhou o nome de Senhor das Estrelas. Quando rouba uma esfera, na qual o poderoso vilão Ronan, da raça kree, está interessado, passa a ser procurado por vários caçadores de recompensas. Para escapar do perigo, Quill une forças com quatro personagens fora do sistema: Groot, uma árvore humanóide (Vin Diesel), a sombria e perigosa Gamora (Zoe Saldana), o guaxinim rápido no gatilho Rocket Racoon (Bradley Cooper) e o vingativo Drax, o Destruidor (Dave Bautista). Mas o Senhor das Estrelas descobre que a esfera roubada possui um poder capaz de mudar os rumos do universo, e logo o grupo deverá proteger o objeto para salvar o futuro da galáxia.', 0, NULL, NULL, NULL),
(NULL, 75, 'Your Name', 'Kimi no na wa', 'Japão', 'Anime, Drama, Fantasia', 'Makoto Shinkai', '15353896155b842fafdfbaa.jpg', 110, 2017, 'nLhKXh6sJtk ', 'Ryûnosuke Kamiki, Mone Kamishiraishi, Ryô Narita, Aoi Yûki, Nobunaga Shimazaki, Kaito Ishikawa, Kanon Tani', 'Mitsuha Miyamizu (Mone Kamishiraishi) é uma jovem que mora no interior do Japão e que deseja deixar sua pequena cidade para trás para tentar a sorte em Tóquio. Enquanto isso, Taki Tachibana (Ryûnosuke Kamiki), um jovem que trabalha em um restaurante italiano em Tóquio, deseja largar o seu emprego para tentar se tornar um arquiteto. Os dois não se conhecem, mas estão direta e misteriosamente conectados pelas imagens de seus sonhos.', 0, NULL, NULL, NULL),
(NULL, 76, 'Um Amor para Recordar', 'A Walk to Remember', 'Estados Unidos', 'Romance', 'Adam Shankman ', '15353897745b84304e0c4c3.jpg', 112, 2003, 'Htx2kPU_1ZQ ', NULL, 'Em plenos anos 90, Landon Carter (Shane West) é punido por ter feito uma brincadeira de mal gosto em sua escola. Como punição ele é encarregado de participar de uma peça teatral, que está sendo montada na escola. É quando ele conhece Jamie Sullivan (Mandy Moore), uma jovem estudante de uma escola pobre. Com o tempo Landon acaba se apaixonando por Jamie que, por razões pessoais, faz de tudo para escapar de seu assédio.', 0, NULL, NULL, NULL),
(NULL, 77, 'Projeto X - Uma Festa Fora de Controle', 'Project X', 'Estados Unidos', 'Comédia', 'Nima Nourizadeh', '15353898765b8430b482f38.jpg', 87, 2012, 'kFwGmQIe-rU ', 'Thomas Mann, Oliver Cooper, Jonathan Daniel Brown, Dax Flame', 'Thomas (Thomas Mann), Costa (Oliver Cooper) e JB (Jonathan Daniel Brown) são grandes amigos. Eles não são populares no colégio nem têm namorada. Sonhando dar uma virada na situação, eles planejam transformar o aniversário de Thomas em um acontecimento épico. Para tanto realizam uma grande festa na casa do aniversariante, aproveitando o fato que os pais dele estarão viajando no fim de semana.', 0, NULL, NULL, NULL),
(NULL, 78, 'Avatar', 'Avatar', 'Estados Unidos', 'Fantasia', 'James Cameron', '15356265155b87cd13900d8.jpg', 162, 2009, 'PlYSIJ04bvo', 'Sam Worthington, Zoe Saldana, Sigourney Weaver, Stephen Lang', 'Jake Sully (Sam Worthington) ficou paraplégico após um combate na Terra. Ele é selecionado para participar do programa Avatar em substituição ao seu irmão gêmeo, falecido. Jake viaja a Pandora, uma lua extraterrestre, onde encontra diversas e estranhas formas de vida. O local é também o lar dos Na\'Vi, seres humanóides que, apesar de primitivos, possuem maior capacidade física que os humanos. Os Na\'Vi têm três metros de altura, pele azulada e vivem em paz com a natureza de Pandora. Os humanos desejam explorar a lua, de forma a encontrar metais valiosos, o que faz com que os Na\'Vi aperfeiçoem suas habilidades guerreiras. Como são incapazes de respirar o ar de Pandora, os humanos criam seres híbridos chamados de Avatar. Eles são controlados por seres humanos, através de uma tecnologia que permite que seus pensamentos sejam aplicados no corpo do Avatar. Desta forma Jake pode novamente voltar à ativa, com seu Avatar percorrendo as florestas de Pandora e liderando soldados. Até conhecer Neytiri (Zoe Saldana), uma feroz Na\'Vi que conhece acidentalmente e que serve de tutora para sua ambientação na civilização alienígena.', 0, NULL, NULL, NULL),
(NULL, 79, 'Pantera Negra', 'Black Panther', 'Estados Unidos', 'Fantasia', 'Ryan Coogler', '15356268005b87ce30c574e.jpg', 135, 2018, 'Q9EiB8w24zM', 'Chadwick Boseman, Michael B. Jordan, Lupita Nyong\'o, Danai Gurira, Martin Freeman, Daniel Kaluuya, Letitia Wright, Winston Duke, Angela Bassett', 'Após a morte do rei T\'Chaka (John Kani), o príncipe T\'Challa (Chadwick Boseman) retorna a Wakanda para a cerimônia de coroação. Nela são reunidas as cinco tribos que compõem o reino, sendo que uma delas, os Jabari, não apoia o atual governo. T\'Challa logo recebe o apoio de Okoye (Danai Gurira), a chefe da guarda de Wakanda, da irmã Shuri (Letitia Wright), que coordena a área tecnológica do reino, e também de Nakia (Lupita Nyong\'o), a grande paixão do atual Pantera Negra, que não quer se tornar rainha. Juntos, eles estão à procura de Ulysses Klaue (Andy Serkis), que roubou de Wakanda um punhado de vibranium, alguns anos atrás.', 0, NULL, NULL, NULL),
(NULL, 80, 'Querido John', 'Dear John', 'Estados Unidos', 'Drama', 'Lasse Hallström', '15356269585b87cece6d42f.jpg', 105, 2010, '_99xWg_Fesw', 'Channing Tatum, Amanda Seyfried, Richard Jenkins, Henry Thomas', 'John Tyree (Channing Tatum) é um jovem soldado que está em casa, licenciado. Um dia ele conhece Savannah Curtis (Amanda Seyfried), uma universitária idealista em férias, por quem se apaixona. Eles iniciam um relacionamento, só que logo John precisará retornar ao trabalho. Dentro de um ano ele terminará o serviço militar, quando poderão enfim ficar juntos. Neste período eles trocam diversas cartas, onde cada um conta o que lhe acontece a cada dia.', 0, NULL, NULL, NULL),
(NULL, 81, 'Millennium - Os Homens Que Não Amavam as Mulheres', ' The Girl with the Dragon Tattoo', 'Estados Unidos', 'Suspense', ' David Fincher', '15356271225b87cf7251b23.jpg', 158, 2012, 'PKA39HIgMHI ', 'Steven Berkoff, Daniel Craig, David Fincher, Rooney Mara', ' Harriet Vanger (Moa Garpendal) desapareceu há 36 anos, sem deixar pistas, em uma ilha no norte da Suécia. O local é de propriedade exclusiva da família Vanger, que o torna inacessível para a grande maioria das pessoas. A polícia jamais conseguiu descobrir o que aconteceu com a jovem, que tinha 16 anos na época do sumiço. Mesmo após tanto tempo, seu tio Henrik Vanger (Christopher Plummer) ainda está à procura e decide contratar Mikael Bomkvist (Daniel Craig), um jornalista investigativo que trabalha na revista Millennium. Bomkvist, que não está em um bom momento por enfrentar um processo por calúnia e difamação, resolve aceita a proposta e começa a trabalhar no caso. Para isso, ele vai contar com a ajuda de Lisbeth Salander (Rooney Mara), uma investigadora particular, incontrolável e antissocial.', 0, NULL, NULL, NULL),
(NULL, 82, 'Mãos Talentosas - A História de Ben Carson', 'Gifted Hands: The Ben Carson Story', 'Estados Unidos', 'Drama', 'Thomas Carter ', '15356272845b87d0145a636.jpg', 86, 2009, '8MnI1_kxGqo', 'Cuba Gooding Jr., Kimberly Elise, Aunjanue Ellis, Harron Atkins', 'Ben Carson (Cuba Gooding Jr.), menino pobre de Detroit, sempre levou uma vida desmotivada, já que tirava notas baixas e não tinha perspectivas de um grande futuro. O que ele e os que estavam ao redor não esperavam era que ele se tornaria um neurocirurgião de fama mundial.', 0, NULL, NULL, NULL),
(NULL, 83, 'Hoje Eu Quero Voltar Sozinho', 'Hoje Eu Quero Voltar Sozinho', 'Brasil', 'LGBT, Romance, Drama, Coming of Age', 'Daniel Ribeiro', '15356274885b87d0e0bb099.jpg', 96, 2014, 'nLlvQ7sbUTY', '', ' Leonardo (Ghilherme Lobo), um adolescente cego, tenta lidar com a mãe superprotetora ao mesmo tempo em que busca sua independência. Quando Gabriel (Fabio Audi) chega na cidade, novos sentimentos começam a surgir em Leonardo, fazendo com que ele descubra mais sobre si mesmo e sua sexualidade.', 0, NULL, NULL, NULL),
(NULL, 85, 'Orações para Bobby', 'Prayers for Bobby', 'Estados Unidos', 'LGBT', 'Russell Mulcahy', '15356309835b87de87f1c00.jpg', 120, 2009, 'dSg4VNrrhp0', 'Sigourney Weaver, Henry Czerny, Ryan Kelley, Austin Nichols', 'Mary Griffith (Sigourney Weaver) é uma devota cristã que crios seus filhos com os ensinamentos conservadores da Igreja Presbiteriana. Bobby (Ryan Kelley), um dos seus filhos, confidencia ao irmão mais velho que talvez seja gay, o que muda a vida da família inteira quando Mary descobre. Todos da família lentamente entram em acordo com a homossexualidade de Bobby, menos Mary que acredita que Deus pode curar o filho. Querendo agradá-la, ele faz tudo que a mãe o pede, mas fica cada vez mais depressivo e então decide sair de casa.', 0, NULL, NULL, NULL),
(NULL, 86, 'Brooklin', 'Brooklyn', 'Irlanda', 'Drama', 'John Crowley', '15356312145b87df6eead2f.jpg', 113, 2015, 'omOilvNNCRI', 'Saoirse Ronan, Hugh Gormley, Brid Brennan, Maeve McGrath', 'A jovem irlandesa Ellis Lacey (Saoirse Ronan) se muda de sua terra natal e vai morar em Brooklyn para tentar realizar seus sonhos. No ínicio de sua jornada nos Estados Unidos, ela sente falta de sua casa, mas ela vai tentando se ajustar aos poucos até que conhece e se apaixona por Tony (Emory Cohen), um bombeiro italiano. Logo, ela se encontra dividida entre dois países, entre o amor e o dever.', 0, NULL, NULL, NULL),
(NULL, 87, 'Dude - A Vida é Assim', 'Dude', 'Estados Unidos', 'Comédia', 'Olivia Milch ', '15356313575b87dffd37567.jpg', 97, 2018, 'mzJnaJQ7qTA', 'Lucy Hale, Kathryn Prescott, Alexandra Shipp, Awkwafina', 'Lily (Lucy Hale), Chloe (Kathryn Prescott), Amelia (Alexandra Shipp) e Rebecca (Awkwafina) são quatro amigas que depois de anos do ensino médio, precisam lidar com responsabilidades, problemas e os desafios da vida como jovens adultas.', 0, NULL, NULL, NULL),
(NULL, 88, 'Demônio de Neon', 'The Neon Demon', 'França', 'Terror', ' Nicolas Winding Ref', '15356315865b87e0e20b71e.jpg', 118, 2016, 'yz7RJOqgkVw', 'Elle Fanning, Karl Glusman, Jena Malone, Bella Heathcote', 'Jesse (Elle Fannng) é uma jovem de 18 anos que acaba de chegar a Los Angeles. Dona de uma beleza natural impressionante, ela tenta a sorte como modelo profissional. Após tirar algumas fotos mórbidas para um jovem fotógrafo, é contratada por uma conceituada agência de modelos. Bastante ingênua, ela passa a lidar com o ego sempre inflado das demais modelos e também com a maquiadora Ruby (Jena Malone), que possui intenções ocultas com a jovem.', 0, NULL, NULL, NULL),
(NULL, 89, 'Dirty Dancing - Ritmo Quente', 'Dirty Dancing', 'Estados Unidos', 'Musical', 'Emile Ardolino', '15356316995b87e153773b6.jpg', 100, 1987, 'U1tw7CJHYJQ', 'Jennifer Grey, Patrick Swayze, Jerry Orbach, Cynthia Rhodes', 'Em 1963, Frances Houseman (Jennifer Grey), ou \"Baby\", como é chamada pela família, uma jovem de 17 anos, viajou com seus pais, Marjorie (Kelly Bishop) e Jake Houseman (Jerry Orbach) e sua irmã Lisa (Jane Brucker) para um resort em Catskills. Frances é idealista e quer estar no próximo verão no Corpo da Paz estudando a economia dos países do Terceiro Mundo. Assim, ela espera que este seja o último verão como uma adolescente despreocupada, mas Baby não se dá muito bem com sua irmã mais velha e está entediada em tentar distrair os hóspedes mais velhos. Numa noite Baby ouve algo que parece ser um som de festa no alojamento dos funcionários. Ela consegue entrar na festa graças a um empregado e descobre que ali o pessoal realmente se diverte. Baby chega a dançar com Johnny Castle (Patrick Swayze), um professor de dança, e logo fica apaixonada por ele. Quando Penny Johnson (Cynthia Rhodes), a parceira de dança de Johnny, fica grávida por ter se envolvido com Robbie Gould (Max Cantor), um dos garçons, Baby se oferece para aprender a dançar e substituir Penny, mas o pai de Baby, quando descobre, não gosta disto, pois considera que Johnny é de outra classe social e Baby é jovem demais para entender seus sentimentos.', 0, NULL, NULL, NULL),
(NULL, 90, 'Whiplash - Em Busca da Perfeição', 'Whiplash', 'Estados Unidos', 'Drama', 'Damien Chazelle', '15356326915b87e533ad491.jpg', 107, 2015, 'iTgk3WbTErk', 'Katrina Begin', 'O solitário Andrew (Miles Teller) é um jovem baterista que sonha em ser o melhor de sua geração e marcar seu nome na música americana como fez Buddy Rich, seu maior ídolo na bateria. Após chamar a atenção do reverenciado e impiedoso mestre do jazz Terence Fletcher (JK Simmons), Andrew entra para a orquestra principal do conservatório de Shaffer, a melhor escola de música dos Estados Unidos. Entretanto, a convivência com o abusivo maestro fará Andrew transformar seu sonho em obsessão, fazendo de tudo para chegar a um novo nível como músico, mesmo que isso coloque em risco seus relacionamentos com sua namorada e sua saúde física e mental.', 0, NULL, NULL, NULL),
(NULL, 91, 'Um Sonho de Liberdade', 'The Shawshank Redemption', 'Estados Unidos', 'Drama', 'Frank Darabont', '15356329375b87e6292fc35.jpg', 140, 1995, '3n82KaVLSn8 ', NULL, 'Em 1946, Andy Dufresne (Tim Robbins), um jovem e bem sucedido banqueiro, tem a sua vida radicalmente modificada ao ser condenado por um crime que nunca cometeu, o homicídio de sua esposa e do amante dela. Ele é mandado para uma prisão que é o pesadelo de qualquer detento, a Penitenciária Estadual de Shawshank, no Maine. Lá ele irá cumprir a pena perpétua. Andy logo será apresentado a Warden Norton (Bob Gunton), o corrupto e cruel agente penitenciário, que usa a Bíblia como arma de controle e ao Capitão Byron Hadley (Clancy Brown) que trata os internos como animais. Andy faz amizade com Ellis Boyd Redding (Morgan Freeman), um prisioneiro que cumpre pena há 20 anos e controla o mercado negro da instituição.', 0, NULL, NULL, NULL),
(NULL, 92, 'Ligados pelo Amor', 'Stuck in Love', 'Estados Unidos', 'Romance', 'Josh Boone ', '15356330385b87e68e02570.jpg', 97, 2014, 'JVGIBLVT8UE', NULL, ' Esta comédia dramática apresenta um escritor de sucesso (Greg Kinnear) que se torna cada vez mais obcecado por sua ex-esposa (Jennifer Connelly), a ponto de criar problemas em sua nova família.', 0, NULL, NULL, NULL),
(NULL, 93, 'Stardust - O Mistério da Estrela', 'Stardust', 'Estados Unidos', 'Fantasia', 'Matthew Vaughn', '15356331385b87e6f2cad85.jpg', 122, 2007, 'DbfLk8tfkQQ ', 'Ian McKellen, Bimbo Hart, Alastair MacIntosh, David Kelly', 'O jovem Tristan (Charlie Cox) tenta conquistar o amor da bela e fria Victoria (Sienna Miller) indo em busca de uma estrela cadente. A jornada o leva a uma terra esquecida e misteriosa, além dos muros da cidade. Porém Tristan não é o único atrás da estrela cadente. Os quatro filhos do rei de Stormhold (Peter O\'Toole) e os espíritos de seus três filhos já falecidos também estão atrás dela, assim como a feiticeira Lamia (Michelle Pfeiffer), que deseja usá-la para recuperar a juventude. Para enfrentar todos estes concorrentes Tristan precisará ganhar o amor da estrela, que se transformou em uma garota chamada Yvaine (Claire Danes).', 0, NULL, NULL, NULL),
(NULL, 94, 'Truque de Mestre', 'Now You See Me', 'França', 'Suspense', 'Louis Leterrier ', '15356332495b87e761c7a48.jpg', 116, 2013, 'BqXnvWADHdo ', 'Jesse Eisenberg, Mark Ruffalo, Woody Harrelson, Isla Fisher', 'Daniel Atlas (Jesse Eisenberg) é o carismático líder do grupo de ilusionistas chamado The Four Horsemen. O que poucos sabem é que, enquanto encanta o público com suas mágicas sob o palco, o grupo também rouba bancos em outro continente e ainda por cima distribui a quantia roubada nas contas dos próprios espectadores. Estes crimes fazem com que o agente do FBI Dylan Hobbs (Mark Ruffalo) esteja determinado a capturá-los de qualquer jeito, ainda mais após o grupo anunciar que em breve fará seu assalto mais audacioso. Para tanto ele conta com a ajuda de Alma Vargas (Melanie Laurent), uma detetive da Interpol, e também de Thaddeus Bradley (Morgan Freeman), um veterano desmistificador de mágicos que insiste que os assaltos são realizados a partir de disfarces e jogos envolvendo vídeos.', 0, NULL, NULL, NULL),
(NULL, 95, 'Sem Reservas', 'No Reservations', 'Estados Unidos', 'Comédia', 'Scott Hicks', '15356333665b87e7d6da057.jpg', 103, 2007, '1fZmNoLdrAQ', 'Catherine Zeta-Jones, Aaron Eckhart, Abigail Breslin, Patricia Clarkson', 'Kate Armstrong (Catherine Zeta-Jones) é a chef de um sofisticado restaurante de Manhattan. Ela leva seu trabalho com muita seriedade, o que faz com que as pessoas ao seu redor se intimidem com seu jeito. Sua natureza perfeccionista é colocada à prova quando é contratado Nick (Aaron Eckhart), um animado subchef que tenta alegrar a todos na cozinha e gosta de ouvir ópera enquanto trabalha. Ao mesmo tempo Kate precisa lidar com a súbita chegada de Zoe (Abigail Breslin), sua sobrinha de 9 anos, que se sente deslocada na rotina da tia.', 0, NULL, NULL, NULL),
(NULL, 96, 'Pompeia', 'Pompeii', 'Estados Unidos', 'Ação', 'Paul W.S. Anderson', '15357368115b897beb373ce.jpg', 104, 2014, 'e2Xq9DcdxIo', 'Kit Harington, Carrie-Anne Moss, Emily Browning, Adewale Akinnuoye-Agbaje', 'Alguns dias antes da lendária erupção do monte Vesúvio, o escravo Milo (Kit Harrington) está preso dentro de um navio, em direção à Nápoles. Ele vai fazer de tudo para escapar e salvar a mulher que ama, além de ajudar o seu melhor amigo, um gladiador que está em dificuldades no interior do Coliseu.', 0, NULL, NULL, NULL),
(NULL, 97, 'Orgulho e Preconceito', 'Pride and Prejudice', 'França', 'Romance', 'Joe Wright', '15357369635b897c835b424.jpg', 135, 2006, 'Y6XneqkfD3c', NULL, 'Inglaterra, 1797. As cinco irmãs Bennet - Elizabeth (Keira Knightley), Jane (Rosamund Pike), Lydia (Jena Malone), Mary (Talulah Riley) e Kitty (Carey Mulligan) - foram criadas por uma mãe (Brenda Blethyn) que tinha fixação em lhes encontrar maridos que garantissem seu futuro. Porém Elizabeth deseja ter uma vida mais ampla do que apenas se dedicar ao marido, sendo apoiada pelo pai (Donald Sutherland). Quando o sr. Bingley (Simon Woods), um solteiro rico, passa a morar em uma mansão vizinha, as irmãs logo ficam agitadas. Jane logo parece que conquistará o coração do novo vizinho, enquanto que Elizabeth conhece o bonito e esnobe sr. Darcy (Matthew Macfadyen). Os encontros entre Elizabeth e Darcy passam a ser cada vez mais constantes, apesar deles sempre discutirem.', 0, NULL, NULL, NULL),
(NULL, 98, 'Ela Dança, Eu Danço', 'Ela Dança, Eu Danço', 'Estados Unidos', 'Musical', 'Anne Fletcher', '15357371965b897d6c6cf52.jpg', 103, 2006, 'RtMh5XmTDnk', NULL, 'Após depredar um colégio, Tyler Gage (Channing Tatum) é enviado para fazer serviços comunitários em uma escola de artes. Lá ele conhece Nora Clark (Jenna Dewan), uma bela aluna de dança moderna que precisa urgentemente de um novo parceiro. Tyler está acostumado com as danças de rua, mas reluta à idéia de ser o novo parceiro de Nora. Aos poucos ele aceita a idéia e passa a se envolver com Nora.', 0, NULL, NULL, NULL),
(NULL, 101, 'Animais Noturnos', 'Nocturnal Animals', 'Estados Unidos', 'Drama, Suspense', 'Tom Ford', '15357377915b897fbfc856a.jpg', 117, 2016, 'SfftJECZVpA', '', ' Susan (Amy Adams) é uma negociante de arte que se sente cada vez mais isolada do parceiro (Armie Hammer). Um dia, ela recebe um manuscrito de autoria de Edward (Jake Gylenhaal), seu primeiro marido. Por sua vez, o trágico livro acompanha o personagem Tony Hastings, um homem que leva sua esposa (Isla Fisher) e filha (Ellie Bamber) para tirar férias, mas o passeio toma um rumo violento ao cruzar o caminho de uma gangue. Durante a tensa leitura, Susan pensa sobre as razões de ter recebido o texto, descobre verdades dolorosas sobre si mesma e relembra traumas de seu relacionamento fracassado.', 0, NULL, NULL, NULL),
(NULL, 102, 'Doce Vingança', 'I Spit on Your Grave', 'Estados Unidos', 'Terror', 'Steven R. Monroe', '15357379705b898072a07c0.jpg', 107, 2011, 'Y2YRY35WMc4', NULL, ' Jennifer Hills (Sarah Butler) é uma jovem escritora, que resolveu ir para uma sossegada cabana na mata com o objetivo de escrever seu novo livro. Sua presença logo é notada em um pequeno vilarejo próximo, o que faz com que alguns moradoras resolvam lhe pregar um susto. A brincadeira vai mais longe do que deveria e faz com que Jennifer passe por atos de humilhação, incluindo tortura física e psicológica. Ela consegue escapar e, a partir de então, concentra todo seu tempo e forças para planejar sua vingança.', 0, NULL, NULL, NULL),
(NULL, 103, 'Django Livre', 'Django Unchained', 'Estados Unidos', 'Faroeste', 'Quentin Tarantino ', '15357382685b89819c3847b.jpg', 164, 2013, '9vO2pd_y6s8', NULL, ' No sul dos Estados Unidos, anos antes da Guerra Civil, um ex-escravo Django faz uma aliança inesperada com o caçador de recompensas Schultz para caçar os criminosos mais procurados do país e resgatar sua esposa de um fazendeiro que força seus escravos a participarem de competições mortais.', 0, NULL, NULL, NULL),
(NULL, 104, 'Sem Limites', 'Limitless', 'Estados Unidos', 'Suspense', 'Neil Burger', '15357397665b898776d325a.jpg', 105, 2011, 'JMU_ksS3fq4', 'Bradley Cooper, Robert De Niro, Abbie Cornish, Andrew Howard', 'Eddie Morra (Bradley Cooper) sofre de bloqueio de escritor. Um dia, ele reencontra na rua seu ex-cunhado, Vernon (Johnny Whitworth), que lhe apresenta um remédio revolucionário que permite o uso de 100% da capacidade cerebral. O efeito é imediato em Eddie, pois ele passa a se lembrar de tudo que já leu, ouviu ou viu em sua vida. A partir de então ele consegue aprender outras línguas, fazer cálculos complicados e escrever muito rapidamente, mas para manter este ritmo precisa tomar o remédio todo dia. Seu desempenho chama a atenção do empresário Carl Van Loon (Robert De Niro), que resolve contar com sua ajuda para fechar um dos maiores negócios da história.', 0, NULL, NULL, NULL),
(NULL, 105, 'O Código da Vinci ', 'The Da Vinci Code', 'Estados Unidos', 'Suspense', 'Ron Howard ', '15357400835b8988b31586f.jpg', 152, 2006, 'Z9xqc77eIhI', 'Tom Hanks, Audrey Tautou, Ian McKellen, Jean Reno', ' Robert Langdon (Tom Hanks) é um famoso simbologista, que foi convocado a comparecer no Museu do Louvre após o assassinato de um curador. A morte deixou uma série de pistas e símbolos estranhos, os quais Langdon precisa decifrar. Em seu trabalho ele conta com a ajuda de Sophie Neveu (Audrey Tautou), criptógrafa da polícia. Porém o que Langdon não esperava era que suas investigações o levassem a uma série de mensagens ocultas nas obras de Leonardo Da Vinci, que indicam a existência de uma sociedade secreta que tem por missão guardar um segredo que já dura mais de 2 mil anos.', 0, NULL, NULL, NULL),
(NULL, 106, 'O Fabuloso Destino de Amélie Poulain', 'Le Fabuleux destin d', 'França', 'Comédia', ' Jean-Pierre Jeunet', '15357402985b89898a16199.jpg', 120, 2002, 'tiHCTfo96Aw', NULL, ' Após deixar a vida de subúrbio que levava com a família, a inocente Amélie (Audrey Tautou) muda-se para o bairro parisiense de Montmartre, onde começa a trabalhar como garçonete. Certo dia encontra uma caixa escondida no banheiro de sua casa e, pensando que pertencesse ao antigo morador, decide procurá-lo ­ e é assim que encontra Dominique (Maurice Bénichou). Ao ver que ele chora de alegria ao reaver o seu objeto, a moça fica impressionada e adquire uma nova visão do mundo. Então, a partir de pequenos gestos, ela passa a ajudar as pessoas que a rodeiam, vendo nisto um novo sentido para sua existência. Contudo, ainda sente falta de um grande amor.', 0, NULL, NULL, NULL),
(NULL, 107, 'O Melhor de Mim', 'The Best of Me', 'Estados Unidos', 'Romance', 'Michael Hoffman', '15357407835b898b6f5eac7.jpg', 118, 2014, 'VuFWFLKA8fA', 'Michelle Monaghan, James Marsden, Luke Bracey, Liana Liberato', 'Adolescentes, Amanda (Liana Liberato) e Dawson (Luke Bracey) se apaixonam. O pai da garota não aprova o relacionamento e, com o passar do tempo, os jovens acabam se afastando e tomando rumos diferentes. Duas décadas mais tarde um funeral faz com que os dois (Michelle Monaghan e James Marsden) voltem à cidade natal e se reencontrem. É o momento de ver se os sentimentos persistem e avaliar as decisões que tomaram na vida.', 0, NULL, NULL, NULL),
(NULL, 108, 'Interestelar', 'Interstellar ', 'Estados Unidos', 'Ficção Científica', 'Christopher Nolan', '15357409655b898c251e73a.jpg', 169, 2014, 'BYUZhddDbdc', 'Ellen Burstyn, Matthew McConaughey, Mackenzie Foy, John Lithgow', ' Após ver a Terra consumindo boa parte de suas reservas naturais, um grupo de astronautas recebe a missão de verificar possíveis planetas para receberem a população mundial, possibilitando a continuação da espécie. Cooper (Matthew McConaughey) é chamado para liderar o grupo e aceita a missão sabendo que pode nunca mais ver os filhos. Ao lado de Brand (Anne Hathaway), Jenkins (Marlon Sanders) e Doyle (Wes Bentley), ele seguirá em busca de uma nova casa. Com o passar dos anos, sua filha Murph (Mackenzie Foy e Jessica Chastain) investirá numa própria jornada para também tentar salvar a população do planeta.', 0, NULL, 1, NULL),
(NULL, 109, 'Veludo Azul', 'Blue Velvet', 'Estados Unidos', 'Policial, Neo Noir, Drama, Suspense', 'David Lynch ', '15357412335b898d311e074.jpg', 120, 1987, 'SwoL6vqSwGM ', 'Isabella Rossellini\r\nKyle MacLachlan\r\nDennis Hopper\r\nHope Lange\r\nDean Stockwell', 'Jeffrey Beaumont (Kyle MacLachlan), um rapaz simplório que acaba de voltar à cidade, envolve-se em uma perigosa investigação sobre os negócios de um traficante de drogas (Dennis Hopper) que mantém uma sádica relação com a bela cantora de cabaré Dorothy Vallens (Isabella Rossellini).', 0, NULL, NULL, NULL),
(NULL, 110, 'Blade Runner 2049', 'Blade Runner 2049', 'Estados Unidos', 'Ficção Científica, Neo Noir', 'Denis Villeneuve', '15357413965b898dd464233.jpg', 164, 2017, 'dLIbiA19rEg', 'Ryan Gosling, Dave Bautista, Robin Wright, Mark Arnold', 'California, 2049. Após os problemas enfrentados com os Nexus 8, uma nova espécie de replicantes é desenvolvida, de forma que seja mais obediente aos humanos. Um deles é K (Ryan Gosling), um blade runner que caça replicantes foragidos para a polícia de Los Angeles. Após encontrar Sapper Morton (Dave Bautista), K descobre um fascinante segredo: a replicante Rachel (Sean Young) teve um filho, mantido em sigilo até então. A possibilidade de que replicantes se reproduzam pode desencadear uma guerra deles com os humanos, o que faz com que a tenente Joshi (Robin Wright), chefe de K, o envie para encontrar e eliminar a criança.', 0, NULL, 1, NULL),
(NULL, 111, 'Até o Último Homem', 'Hacksaw Ridge', 'Estados Unidos', 'Guerra', 'Mel Gibson', '15357415755b898e876d9ff.jpg', 140, 2017, 'zCzcZD65neE', 'Andrew Garfield, Mel Gibson, Hugo Weaving', 'Durante a Segunda Guerra Mundial, o médico do exército Desmond T. Doss (Abdrew Garfield) se recusa a pegar em uma arma e matar pessoas, porém, durante a Batalha de Okinawa ele trabalha na ala médica e salva mais de 75 homens, sendo condecorado. O que faz de Doss o primeiro Opositor Consciente da história norte-americana a receber a Medalha de Honra do Congresso.', 0, NULL, NULL, NULL),
(NULL, 112, 'As Vantagens de Ser Invisível', 'The Perks of Being a Wallflower', 'Estados Unidos', 'Coming of age, Comédia Dramática, Romance, LGBT', 'Stephen Chbosky', '15357417975b898f651b007.jpg', 103, 2012, '5yynWK4TX3o', 'Logan Lerman, Emma Watson, Ezra Miller, Nina Dobrev, Mae Whitman, Johnny Simmons, Paul Rudd, Kate Walsh, Dylan McDermott', 'Charlie (Logan Lerman) é um jovem que tem dificuldades para interagir em sua nova escola. Com os nervos à flor da pele, ele se sente deslocado no ambiente. Seu professor de literatura, no entanto, acredita nele e o vê como um gênio. Mas Charlie continua a pensar pouco de si... até o dia em que dois amigos, Patrick (Ezra Miller) e Sam (Emma Watson), passam a andar com ele.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 113, 'Alice no País das Maravilhas ', 'Alice in Wonderland', 'Estados Unidos', 'Fantasia', 'Tim Burton ', '15357419665b89900e7c956.jpg', 108, 2010, 'R7ygoQRaWYY', 'Johnny Depp, Mia Wasikowska, Helena Bonham Carter, Anne Hathaway', 'Alice (Mia Wasikowska) é uma jovem de 17 anos que passa a seguir um coelho branco apressado, que sempre olha no relógio. Ela entra em um buraco que a leva ao País das Maravilhas, um local onde esteve há dez anos apesar de nada se lembrar dele. Lá ela é recepcionada pelo Chapeleiro Maluco (Johnny Depp) e passa a lidar com seres fantásticos e mágicos, além da ira da poderosa Rainha de Copas (Helena Bonham Carter).', 0, NULL, NULL, NULL),
(NULL, 120, 'A Chegada', 'Arrival', 'Estados Unidos', 'Ficção Científica', 'Denis Villeneuve', '15360014585b8d85b200642.jpg', 118, 2016, 'rNciXGzYZms', 'Amy Adams, Jeremy Renner, Forest Whitaker, Michael Stuhlbarg', 'Quando seres interplanetários deixam marcas na Terra, a Dra. Louise Banks (Amy Adams), uma linguista especialista no assunto, é procurada por militares para traduzir os sinais e desvendar se os alienígenas representam uma ameaça ou não. No entanto, a resposta para todas as perguntas e mistérios pode ameaçar a vida de Louise e a existência de toda a humanidade.', 0, NULL, NULL, NULL),
(NULL, 121, 'A Garota Dinamarquesa', ' The Danish Girl', 'Estados Unidos', 'Drama', ' Tom Hooper', '15362301275b9102ef8895b.jpg', 120, 2016, 'vjq2FgjpXow', 'Lucinda Coxon, Paco Delgado, David Ebershoff, Lili Elber', 'Cinebiografia de Lili Elbe (Eddie Redmayne), que nasceu Einar Mogens Wegener e foi a primeira pessoa a se submeter a uma cirurgia de mudança de gênero. Em foco o relacionamento amoroso do pintor dinamarquês com Gerda (Alicia Vikander) e sua descoberta como mulher.', 0, NULL, NULL, NULL),
(NULL, 122, 'A Maldição da Casa Winchester', ' Winchester', 'Estados Unidos', 'Terror', 'Michael Spierig', '15362308815b9105e1d61b6.jpg', 100, 2018, '3ljvvh45RDA', 'Helen Mirren, Sarah Snook, Finn Scicluna-O\'Prey, Jason Clarke', ' Herdeira de uma empresa de armas de fogo, Sarah Winchester (Helen Mirren) está convicta de que é assombrada pelas almas mortas através do rifle da família Winchester. Após as repentinas mortes do marido e do filho, ela decide construir uma mansão para afastar os espíritos e ao avaliá-la o psiquiatra Eric Price (Jason Clarke) percebe que talvez sua obsessão não seja tão insana quanto parece.', 0, NULL, NULL, NULL),
(NULL, 123, 'A Invenção de Hugo Cabret', 'Hugo ', 'Estados Unidos', 'Aventura', 'Martin Scorsese', '15362311915b910717be4f2.jpg', 128, 2012, 'hck5n28AuMU', 'Asa Butterfield, Chlöe Moretz, Sacha Baron Cohen, Ben Kingsley, Jude Law, Emily Mortimer, Christopher Lee, Ray Winstone, Helen McCroy', ' Paris, anos 30. Hugo Cabret (Asa Butterfield) é um órfão que vive escondido nas paredes da estação de trem. Ele guarda consigo um robô quebrado, deixado por seu pai (Jude Law). Um dia, ao fugir do inspetor (Sacha Baron Cohen), ele conhece Isabelle (Chloe Moretz), uma jovem com quem faz amizade. Logo, Hugo descobre que ela tem uma chave com o fecho em forma de coração, exatamente do mesmo tamanho da fechadura existente no robô. O robô volta então a funcionar, levando a dupla a tentar resolver um mistério mágico.', 0, NULL, NULL, NULL),
(NULL, 124, 'À Prova de Fogo', 'Fireproof', 'Estados Unidos', 'Drama', ' Alex Kendrick', '15362323495b910b9da74ea.jpg', 122, 2008, 'uudbvxx9rn0', 'Kirk Cameron, Erin Bethea, Ken Bevel, Stephen Dervan', 'No trabalho, o bombeiro Caleb Holt (Kirk Cameron) é um profissional que cumpre com todos os princípios, sendo um deles nunca deixar um companheiro para trás numa situação de perigo. Já em sua casa, ao lado da esposa Catherine (Erin Bethea), as coisa são bem diferentes. Caleb é um marido ausente e depois de sete anos de união o relacionamento está chegando ao fim. O pai de Caleb pede então que ele inicie uma experiência de 40 dias, denominada \"O desafio do amor\", na tentativa de salvar o casamento.', 0, NULL, NULL, NULL),
(NULL, 125, 'A Viagem de Chihiro', 'Sen to Chihiro no Kamikakushi', 'Japão', 'Anime', 'Hayao Miyazaki', '15362329795b910e13e67c0.jpg', 125, 2003, 'SgZI655GgHk', NULL, 'Chihiro é uma garota de 10 anos que acredita que todo o universo deve atender aos seus caprichos. Ao descobrir que vai se mudar, ela fica furiosa. Na viagem, Chihiro percebe que seu pai se perdeu no caminho para a nova cidade, indo parar defronte um túnel aparentemente sem fim, guardado por uma estranha estátua. Curiosos, os pais de Chihiro decidem entrar no túnel e Chihiro vai com eles. Chegam numa cidade sem nenhum habitante e os pais de Chihiro decidem comer a comida de uma das casas, enquanto a menina passeia. Ela encontra com Haku, garoto que lhe diz para ir embora o mais rápido possível e ao reencontrar seus pais, Chihiro fica surpresa ao ver que eles se transformaram em gigantescos porcos. É o início da jornada de Chihiro por um mundo fantasma, povoado por seres fantásticos, no qual humanos não são bem-vindos.', 0, NULL, NULL, NULL),
(NULL, 126, 'Alice no País das Maravilhas', 'Alice in Wonderland', 'Estados Unidos', 'Animação', ' Hamilton Luske', '15362332935b910f4d16eb6.jpg', 75, 1951, 'v-myBq9UYIY', 'Kathryn Beaumont, Ed Wynn, Richard Haydn, Sterling Holloway', ' Alice (Kathryn Beaumont/ Therezinha) é uma garota curiosa e cansada da monotonia de sua vida. Um dia, ao seguir o apressado Coelho Branco (Bill Thompson), ela entra no País das Maravilhas. Lá ela conhece diversos seres incríveis, como o Chapeleiro Louco (Ed Wynn/ Otávio França), o Mestre Gato (Sterling Holloway/ José Vasconcellos), a Lagarta (Richard Haydn/ Wellington Botelho) e a Rainha de Copas (Verna Felton/ Sara Nobre).', 0, NULL, NULL, NULL),
(NULL, 127, 'Anjos da Noite: O Despertar ', 'Underworld: Awakening', 'Estados Unidos', 'Ação', ' Måns Mårlind', '15362334775b911005defc6.jpg', 90, 2012, 'bS-BMp0-v-0', 'Kate Beckinsale, Stephen Rea, Michael Ealy, Theo James', ' o despertar - Após acordar de um coma de mais de 10 anos, Selene vê que o mundo mudou muito desde que \"apagou\". Os humanos descobriram a existência dos vampiros e lobisomens e passaram a caçar essas raças. No meio da enterna disputa, descobre que possui uma filha adolescente que é metade vampira e metade lobisomem, que precisará de sua ajuda.', 0, NULL, NULL, NULL),
(NULL, 128, 'Cavalo de Guerra', 'War Horse', 'Estados Unidos', 'Drama', 'Steven Spielberg', '15362336725b9110c8a329c.jpg', 147, 2012, 'FS3Waptur6g', 'Russell Boulter', 'Ted Narracot (Peter Mullan) é um camponês destemido e ex-herói de guerra. Com problemas de saúde e bebedeiras, batalha junto com a esposa Rose (Emily Watson) e o filho Albert (Jeremy Irvine) para sobreviver numa fazenda alugada, propriedade de um milionário sem escrúpulos (David Tewlis). Cansado da arrogância do senhorio, decide enfrentá-lo em um leilão e acaba comprando um cavalo inadequado para os serviços de aragem nas suas terras. O que ele não sabia era que seu filho estabeleceria com o animal um conexão jamais imaginada. Batizado de Joey pelo jovem, os dois começam seus treinamentos e desenvolvem aptidões, mas a 1ª Guerra Mundial chegou e a cavalaria britânica o leva embora, sem que Albert possa se alistar por não ter idade suficiente. Já nos campos de batalha e durante anos, Joey mostra toda a sua força e determinação, passando por diversas situações de perigo e donos diferentes, mas o destino reservava para ele um final surpreendente.', 0, NULL, NULL, NULL),
(NULL, 129, 'Como Treinar o Seu Dragão 2 ', 'How To Train Your Dragon 2', 'Estados Unidos', 'Animação', 'Dean DeBlois', '15362338915b9111a3ededc.png', 103, 2014, 'aw3_mMB3Cc0', 'Jay Baruchel, Cate Blanchett, Gerard Butler, Craig Ferguson', ' Cinco anos após convencer os habitantes de seu vilarejo que os dragões não devem ser combatidos, Soluço (voz de Jay Baruchel) convive com seu dragão Fúria da Noite, e estes animais integraram pacificamente a rotina dos moradores da ilha de Berk. Entre viagens pelos céus e corridas de dragões, Soluço descobre uma caverna secreta, onde centenas de novos dragões vivem. O local é protegido por Valka (voz de Cate Blanchett), mãe de Soluço, que foi afastada do filho quando ele ainda era um bebê. Juntos, eles precisarão proteger o mundo que conhecem do perigoso Drago Bludvist (Djimon Hounson), que deseja controlar todos os dragões existentes.', 0, NULL, NULL, NULL),
(NULL, 130, 'Coraline e o Mundo Secreto', 'Coraline', 'Estados Unidos', 'Animação', 'Henry Selick', '15362340675b911253cf723.jpg', 100, 2009, 'xDTOPd5F_hg', 'Dakota Fanning, Teri Hatcher, Jennifer Saunders, Dawn French', 'Entediada em sua nova casa, Caroline Jones (Dakota Fanning) um dia encontra uma porta secreta. Através dela tem acesso a uma outra versão de sua própria vida, a qual aparentemente é bem parecida com a que leva. A diferença é que neste outro lado tudo parece ser melhor, inclusive as pessoas com quem convive. Caroline se empolga com a descoberta, mas logo descobre que há algo de errado quando seus pais alternativos tentam aprisioná-la neste novo mundo.', 0, NULL, NULL, NULL),
(NULL, 131, 'A Lagoa Azul ', 'The Blue Lagoon', 'Estados Unidos', 'Aventura', 'Randal Kleiser', '15362343035b91133f1a8f2.png', 104, 1980, 'Dwm8A9qPk1g', 'Brooke Shields, Christopher Atkins, Leo McKern, William Daniels', 'Emmeline (Brooke Shields) e Richard (Christopher Atkins), duas crianças, juntamente com Paddy Button (Leo McKern), um velho marinheiro, são os únicos sobreviventes de um naufrágio numa época em que navegar era a única forma de viajar. Após ficarem à deriva por várias horas eles vão parar em uma ilha tropical que é um verdadeiro paraíso.', 0, NULL, NULL, NULL),
(NULL, 132, 'Gaijin - Caminhos da Liberdade', 'Gaijin - Caminhos da Liberdade', 'Brasil', 'Drama', 'Tizuka Yamasaki', '15362345255b91141d66b2b.jpg', 105, 1981, 'uQaHmw0IOrM', NULL, 'Japão, 1908. Em virtude de haver muita miséria no país e poucas perspectivas de trabalho, muitos japoneses emigravam em busca de oportunidades. Como a companhia de emigração só aceitava grupos familiares que tivesse pelo menos um casal, assim Yamada (Jiro Kawarazaki) e Kobayashi (Keniti Kaneko), que eram irmãos, vêem como solução que Yamada se casasse com Titoe (Kyoko Tsukamoto), que tinha apenas 16 anos. Yamada e Titoe tinham acabado de se conhecer e, juntamente com um primo, partem para o Brasil. Após 52 dias de viagem chegam ao Brasil e vão trabalhar na Fazenda Santa Rosa, em São Paulo, pois a expansão cafeeira era intensa. Porém eles se deparam com um capataz que trata os colonos hostilmente, exigindo sempre que trabalhem até a exaustão. Além disso são roubados pelos donos da fazenda, apenas sendo tratados com respeito por outros colonos e por Tonho (Antônio Fagundes), o contador da fazenda.', 0, NULL, NULL, NULL),
(NULL, 133, 'Histórias Cruzadas', 'The Help', 'Estados Unidos', 'Drama', 'Tate Taylor', '15362346995b9114cb5796c.jpg', 146, 2012, 'Cqn4XN21O1g', 'Viola Davis, Emma Stone, Octavia Spencer, Jessica Chastain, Bryce Dallas Howard, Chris Lowell, Allison Janney, Mike Vogel, Sissy Spacek, Cicely Tyson', 'Jackson, pequena cidade no estado do Mississipi, anos 60. Skeeter (Emma Stone) é uma garota da sociedade que retorna determinada a se tornar escritora. Ela começa a entrevistar as mulheres negras da cidade, que deixaram suas vidas para trabalhar na criação dos filhos da elite branca, da qual a própria Skeeter faz parte. Aibileen Clark (Viola Davis), a emprega da melhor amiga de Skeeter, é a primeira a conceder uma entrevista, o que desagrada a sociedade como um todo. Apesar das críticas, Skeeter e Aibileen continuam trabalhando juntas e, aos poucos, conseguem novas adesões.', 0, NULL, NULL, NULL),
(NULL, 134, 'Túmulo dos Vagalumes', 'Hotaru No Haka', 'Japão', 'Animação', 'Isao Takahata', '15362349365b9115b8631d8.jpg', 90, 1988, 'tC0Ug7sY0wE', NULL, 'Os irmão Setsuko e Seita vivem no Japão em meio a Segunda Guerra Mundial. Após a morte da mãe num bombardeio americano e a convocação do pai para a Guerra, eles vão morar com alguns parentes. Insatisfeitos, saem da cidade e acabam num abrigo isolado na floresta, onde lutam contra a fome e as doenças e se divertem com as luzes dos vaga-lumes.', 0, NULL, NULL, NULL),
(NULL, 135, 'Jogos Mortais ', 'Saw', 'Estados Unidos', 'Terror', 'James Wan', '15362353775b911771ec569.jpg', 104, 2005, '4cjXhMqNRjg&has_verified=1', 'Tobin Bell, Shawnee Smith, Donnie Wahlberg, Erik Knudsen', 'Jigsaw é um assassino que possui uma marca registrada: ele deixa em suas vítimas uma cicatriz em forma de quebra-cabeças, que faz com que elas cometam atos igonizantes para se salvar. O detetive David Tapp (Danny Glover) é designado para investigar os assassinatos, bem como a capturar seu autor. Porém o caminho evasivo seguido por Jigsaw leva o detetive a desenvolver uma obsessão por capturá-lo.', 0, NULL, NULL, NULL),
(NULL, 136, 'Kingsman - Serviço Secreto', 'Kingsman - The Secret Service', 'Reino Unido', 'Ação', 'Matthew Vaughn', '15362356105b91185a2befc.jpg', 129, 2015, 'yzMtm3XqsLc', 'Geoff Bell, Sofia Boutella, Michael Caine, David Cheesman', 'Eggsy (Taron Egerton) é um jovem com problemas de disciplina que parece perto de se tornar um criminoso. Determinado dia, ele entra em contato com Harry (Colin Firth), que lhe apresenta à agência de espionagem Kingsman. O jovem se une a um time de recrutas em busca de uma vaga na agência. Ao mesmo tempo, Harry tenta impedir a ascensão do vilão Valentine (Samuel L. Jackson). Adaptação da série de quadrinhos criada por Mark Millar e Dave Gibbons.', 0, NULL, NULL, NULL),
(NULL, 137, 'Mar de Fogo', 'Hidalgo', 'Estados Unidos', 'Aventura', 'Joe Johnston', '15362360945b911a3ec96ad.jpg', 136, 2004, 'l6xvvDmCqBg', 'Viggo Mortensen, Zuleikha Robinson, Omar Sharif, Louise Lombard', 'Frank Hopkins (Viggo Mortensen) é um conhecido campeão de corridas a cavalo que é convidado pelo sheiq Riyash (Omar Sharif) a participar de uma competição contra os melhores cavalos árabes. Frank e seu cavalo, Hidalgo, precisam então enfrentar os perigos do chamado \"mar de fogo\", como é conhecido o deserto árabe.', 0, NULL, NULL, NULL),
(NULL, 138, 'Maze Runner: Prova de Fogo ', 'Maze Runner: The Scorch Trials', 'Estados Unidos', 'Aventura', ' Wes Ball', '15362363545b911b4282507.jpg', 133, 2015, 'e8CYt6pw4Gg', 'Dylan O\'Brien, Ki Hong Lee, Kaya Scodelario, Thomas Brodie-Sangster', 'Após escapar do labirinto, Thomas (Dylan O\'Brien) e os garotos que o acompanharam em sua fuga da Clareira precisam agora lidar com uma realidade bem diferente: a superfície da Terra foi queimada pelo sol e eles precisam lidar com criaturas disformes chamadas Cranks, que desejam devorá-los vivos.', 0, NULL, NULL, NULL),
(NULL, 139, 'Maze Runner - Correr ou Morrer', 'The Maze Runner', 'Estados Unidos', 'Ação', ' Wes Ball', '15362365105b911bde8d77b.jpg', 113, 2014, 'uriiz3G8ALw', 'Dylan O\'Brien, Aml Ameen, Ki Hong Lee, Blake Cooper', 'Em um mundo pós-apocalíptico, o jovem Thomas (Dylan O\'Brien) é abandonado em uma comunidade isolada formada por garotos após toda sua memória ter sido apagada. Logo ele se vê preso em um labirinto, onde será preciso unir forças com outros jovens para que consiga escapar.', 0, NULL, NULL, NULL),
(NULL, 140, 'Maze Runner: A Cura Mortal', 'Maze Runner: The Death Cure', 'Estados Unidos', 'Ficção Científica', ' Wes Ball', '15362366135b911c45063d9.jpg', 142, 2018, 'mqUnRDKkRWI', 'Dylan O\'Brien, Ki Hong Lee, Kaya Scodelario, Thomas Brodie-Sangster', 'No terceiro filme da saga, Thomas (Dylan O\' Brien) embarca em uma missão para encontrar a cura para uma doença mortal e descobre que os planos da C.R.U.E.L podem trazer consequências catastróficas para a humanidade. Agora, ele tem que decidir se vai se entregar para a C.R.U.E.L e confiar na promessa da organização de que esse será seu último experimento.', 0, NULL, NULL, NULL),
(NULL, 141, 'Os Mercenários 2 - De Volta À Ação', 'The Expendables 2', 'Estados Unidos', 'Ação', 'Simon West', '15362368555b911d3795aac.jpg', 102, 2012, '1rkgmiz3MLw', 'Sylvester Stallone, Jason Statham, Jet Li, Dolph Lundgren', 'O grupo de mercenários liderado por Barney Ross (Sylvester Stallone) se une para uma nova empreitada. Após perderem um amigo assassinado pelo temido Vilain (Jean-Claude Van Damme), a turma embarca em uma jornada em busca de vingança. Ao mesmo tempo, recebem a missão de Church (Bruce Willis) de evitar que Vilain coloque as mãos em uma quantidade impressionante de plutônio enriquecido, que possibilitaria a produção de armas nucleares. Ross contará com a ajuda de Christmas (Jason Statham), Gunner (Dolph Lundgren), Hale (Terry Crews), Toll (Randy Couture) e Trench (Arnold Schwarzenegger), isso sem falar no misterioso Booker (Chuck Norris).', 0, NULL, NULL, NULL),
(NULL, 142, 'Os Mercenários ', 'The Expendables', 'Estados Unidos', 'Ação', 'Sylvester Stallone', '15362370445b911df407961.jpg', 105, 2010, 'R1msbXFcStI', 'Sylvester Stallone, Jason Statham, Jet Li, Dolph Lundgren', 'Barney Ross (Sylvester Stallone) é o líder de um grupo de mercenários, que realiza qualquer missão desde que ela seja bem paga. Entre seus companheiros usuais estão o especialista em facas Lee Christmas (Jason Statham), Bao Thao (Jet Li) e Gunnar Jensen (Dolph Lundgren), que têm demonstrado instabilidade emocional durante as missões. Um dia, Barney e sua trupe são contratados para derrubar o general Garza (David Zayas), ditador da ilha de Vilena. Barney e Lee vão ao local e encontram Sandra (Gisele Itiê), que deseja derrubar o governo. Só que logo eles são atacados pelas forças de Garza e de Monroe (Eric Roberts), um empresário americano que financia o governo local. Barney e Lee deixam Vilena e abandonam a missão, mas a persistência de Sandra, que deseja ficar para lutar pela liberdade, mexe com os até então inexistentes princípios de Barney.', 0, NULL, NULL, NULL),
(NULL, 143, 'Os Mercenários 3 ', 'The Expendables 3', 'França', 'Ação', 'Simon West', '15362371335b911e4d2df42.jpg', 131, 2014, '_PP435A4lLg', 'Sylvester Stallone, Jason Statham, Harrison Ford, Arnold Schwarzenegger', '- Barney (Sylvester Stallone) e sua trupe de mercenários resgatam Doc (Wesley Snipes), um dos integrantes originais do grupo, que estava preso há oito anos. Logo em seguida eles partem para cumprir uma missão, onde têm uma grande surpresa: o reencontro com Conrad Stonebanks (Mel Gibson), que Barney acreditava ter matado. Antigos colegas que se tornaram inimigos, Barney e Conrad agora se enfrentam em um grande duelo.', 0, NULL, NULL, NULL),
(NULL, 145, 'Monstros S.A.', 'Monsters Inc.', 'Estados Unidos', 'Animação', 'Pete Docter', '15362377255b91209d467e2.jpg', 92, 2013, 'bdmRtnQTjaE', NULL, 'Monstros S.A. é a maior fábrica de sustos existente. Localizada em uma dimensão paralela, a fábrica constrói portais que levam os monstros para os quartos das crianças, onde eles poderão lhes dar sustos e gerar a fonte de energia necessária para a sobrevivência da fábrica. Entre todos os monstros que lá trabalham o mais assustador de todos é James P. Sullivan (John Goodman), um grande e intimidador monstro de pêlo azul e chifres, que é chamado de Sully por seus amigos. Seu assistente é Mike Wazowski (Billy Crystal), um pequeno ser de um olho só com quem tem por missão assustar as crianças, que são consideradas tóxicas pelos monstros e cujo contato com eles seria catastrófico para seu mundo. Porém, ao visitar o mundo dos humanos a trabalho, Mike e Sully conhecem a garota Boo (Mary Gibbs), que acaba sem querer indo parar no mundo dos monstros.', 0, NULL, NULL, NULL),
(NULL, 146, 'Motoqueiros Selvagens', 'Wild Hogs', 'Estados Unidos', 'Comédia', 'Walt Becker', '15362379035b91214f186cc.jpg', 100, 2007, 'gtGazOWnfzM', 'Tim Allen, John Travolta, Martin Lawrence, William H. Macy', 'Doug Madsen (Tim Allen) é um dentista com complexo de inferioridade tão grande que sempre se apresenta como médico. Woody Stevens (John Travolta) é um executivo rico e carismático que parece ser um grande vencedor, mas sofre com seus problemas pessoais. Bobby Davis (Martin Lawrence) é um encanador desempregado dominado pela esposa, Karen (Tichina Arnold), que decidiu ficar sem trabalhar por um ano para tentar, sem sucesso, tornar-se um escritor. Dudley Frank (William H. Macy) é um solteirão que é também um gênio da informática, tendo o incrível dom de se meter em situações constrangedores. Cada um leva sua vida durante a semana, mas nos fins de semana eles se reúnem para andar de moto. O grupo decide agitar suas vidas monótonas com a realização de uma viagem de moto, sem destino definido. Eles conseguem tirar uma folga de seus trabalhos e se preparam para a viagem, sendo que ao iniciá-la não têm a menor idéia do que está por vir. Com o tempo eles começam a dividir segredos, até que enfrentam uma gangue de motoqueiros chamada Del Fuegos, liderada por Jack (Ray Liotta).', 0, NULL, NULL, NULL),
(NULL, 147, 'A Noiva-Cadáver', 'Corpse Bride', 'Estados Unidos', 'Animação', 'Mike Johnson', '15362380405b9121d8173fc.jpg', 75, 2005, 'ZE5CbXVheJk', 'Johnny Depp, Helena Bonham Carter, Emily Watson, Tracey Ullman', 'Em um vilarejo europeu do século XIX, vive Victor Van Dorst (Johnny Depp), um jovem que está prestes a se casar com Victoria Everglot (Emily Watson). Porém acidentalmente Victor se casa com a Noiva-Cadáver (Helena Bonham Carter), que o leva para conhecer a Terra dos Mortos. Desejando desfazer o ocorrido para poder enfim se casar com Victoria, aos poucos Victor percebe que a Terra dos Mortos é bem mais animada do que o meio vitoriano em que nasceu e cresceu.', 0, NULL, NULL, NULL),
(NULL, 148, 'O Espaço Entre Nós', 'The Space Between Us', 'Estados Unidos', 'Romance', 'Peter Chelsom', '15362381645b9122544d0c0.jpg', 121, 2017, 'k-uAkldkHVI', 'Gary Oldman, Janet Montgomery, Trey Tucker, Scott Takeda', 'O adolescente Gardner Elliot (Asa Butterfield) é o primeiro humano nascido em solo marciano. Mas ele deseja fazer uma viagem à Terra para conhecer a verdade sobre seu pai biológico, e sobre seu nascimento. Nesta jornada, ele tem o apoio de Tulsa (Britt Robertson).', 0, NULL, NULL, NULL),
(NULL, 149, 'O Jogo da Imitação', 'The Imitation Game', 'Estados Unidos', 'Drama', 'Morten Tyldum', '15362397575b91288d61d92.jpg', 114, 2015, 'YIkKbMcJL_4', 'Benedict Cumberbatch, Keira Knightley, Matthew Goode, Mark Strong, Alex Lawther, Charles Dance', 'Durante a Segunda Guerra Mundial, o governo britânico monta uma equipe que tem por objetivo quebrar o Enigma, o famoso código que os alemães usam para enviar mensagens aos submarinos. Um de seus integrantes é Alan Turing (Benedict Cumberbatch), um matemático de 27 anos estritamente lógico e focado no trabalho, que tem problemas de relacionamento com praticamente todos à sua volta. Não demora muito para que Turing, apesar de sua intransigência, lidere a equipe. Seu grande projeto é construir uma máquina que permita analisar todas as possibilidades de codificação do Enigma em apenas 18 horas, de forma que os ingleses conheçam as ordens enviadas antes que elas sejam executadas. Entretanto, para que o projeto dê certo, Turing terá que aprender a trabalhar em equipe e tem Joan Clarke (Keira Knightley) sua grande incentivadora.', 0, NULL, NULL, NULL),
(NULL, 150, 'O Livro de Eli', 'The Book of Eli', 'Estados Unidos', 'Ação', 'Albert Hughes', '15362399165b91292c8ca47.jpg', 109, 2010, 't3qJj_ljctE', 'Denzel Washington, Gary Oldman, Mila Kunis, Ray Stevenson', 'Em um futuro não muito distante, 30 anos após o término da última guerra. Eli (Denzel Washington) é um homem solitário, que percorre a América do Norte devastada. Ele apenas deseja paz, mas ao ser desafiado não foge à luta. Seu principal objetivo é proteger a esperança da humanidade, a qual guarda consigo há 30 anos, sendo que para tanto faz o que for preciso para sobreviver. O único que compreende seu intento é Carnegie (Gary Oldman), o autoproclamado déspota de uma cidade repleta de ladrões. Ao mesmo tempo Solara (Mila Kunis), a filha da companheira de Carnegie (Jennifer Beals), fica fascinada com Eli pela possibilidade de que ele lhe mostre o que há além dos domínios que conhece. Só que Carnegie está disposto a impedir sua cruzada, para recuperar Solara e também conseguir o valioso objeto que Eli protege.', 0, NULL, NULL, NULL),
(NULL, 151, 'O Pianista', 'The Pianist', 'França', 'Drama', 'Roman Polanski', '15362400495b9129b118d24.jpg', 150, 2003, '6NXjPxA_z0Q', 'Roman Polanski, Adrien Brody, Gene Gutowski, Robert Benmussa', ' O pianista polonês Wladyslaw Szpilman (Adrien Brody) interpretava peças clássicas em uma rádio de Varsóvia quando as primeiras bombas caíram sobre a cidade, em 1939. Com a invasão alemã e o início da 2ª Guerra Mundial, começaram também restrições aos judeus poloneses pelos nazistas. Inspirado nas memórias do pianista, o filme mostra o surgimento do Gueto de Varsóvia, quando os alemães construíram muros para encerrar os judeus em algumas áreas, e acompanha a perseguição que levou à captura e envio da família de Szpilman para os campos de concentração. Wladyslaw é o único que consegue fugir e é obrigado a se refugiar em prédios abandonados espalhados pela cidade, até que o pesadelo da guerra acabe.', 0, NULL, NULL, NULL),
(NULL, 152, 'O Silêncio dos Inocentes', 'The Silence of the Lambs', 'Estados Unidos', 'Suspense', 'Jonathan Demme', '15362402055b912a4d23aff.jpg', 138, 1991, '8Qsq6DrYDxE', 'Jodie Foster, Lawrence A. Bonney, Kasi Lemmons, Lawrence T. Wrentz', ' A agente do FBI, Clarice Starling (Jodie Foster) é ordenada a encontrar um assassino que arranca a pele de suas vítimas. Para entender como ele pensa, ela procura o periogoso psicopata, Hannibal Lecter (Anthony Hopkins), encarcerado sob a acusação de canibalismo.', 0, NULL, NULL, NULL),
(NULL, 153, 'Operação Big Hero', 'Big Hero 6', 'Estados Unidos', 'Aventura', 'Don Hall', '15362403815b912afdbd215.jpg', 108, 2014, '20jQ11j-sIU', 'Scott Adsit, Ryan Potter, Daniel Henney, T.J. Miller', 'Cidade de San Fransokyo, Estados Unidos. Hiro Hamada (voz de Ryan Potter) é um garoto prodígio que, aos 13 anos, criou um poderoso robô para participar de lutas clandestinas, onde tenta ganhar um bom dinheiro. Seu irmão, Tadashi (voz de Daniel Henney), deseja atraí-lo para algo mais útil e resolve levá-lo até o laboratório onde trabalha, que está repleto de invenções. Hiro conhece os amigos de Tadashi e logo se interessa em estudar ali. Para tanto ele precisa fazer a apresentação de uma grande invenção, de forma a convencer o professor Callahan (James Cromwell) a matriculá-lo. Entretanto, as coisas não saem como ele imaginava e Hiro, deprimido, encontra auxílio inesperado através do robô inflável Baymax (voz Scott Adsit), criado pelo irmão.', 0, NULL, NULL, NULL),
(NULL, 154, 'O Serviço de Entregas da Kiki', 'Majo no takkyubin', 'Japão', 'Animação', 'Hayao Miyazaki', '15362407295b912c590aba5.jpg', 103, 1990, '4bG17OYs-GA&t=53s', NULL, ' Kiki é uma jovem bruxa que acabou de completar 13 anos. Segundo a tradição, quando atingem essa idade, todas as bruxas devem sair de casa por um ano para aprender a viver por conta própria. Ela se muda para a cidade de Korico, junto com Jiji, seu gato falante. Lá ela aprende a seguir em frente com sua vida, apesar de todas as dificuldades que possam surgir.', 0, NULL, NULL, NULL),
(NULL, 155, 'Os Croods', 'The Croods', 'Estados Unidos', 'Animação', 'Chris Sanders', '15362409385b912d2a8dc5f.jpg', 98, 2013, '3TWjsu5grs4', 'Nicolas Cage, Emma Stone, Ryan Reynolds, Catherine Keener', 'Em plena era pré-histórica, escondidos na maior parte do tempo dentro de uma caverna, vivem Grug (Nicolas Cage / Hércules Franco), a esposa Ugga (Catherine Keener / Bárbara Monteiro), a vovó (Cloris Leachman / Mariângela Cantú), o garoto Thunk (Clark Duke / Fred Mascarenhas), a pequena e feroz Sandy (Randy Thom / Pâmela Rodrigues) e a jovem Eep (Emma Stone / Luísa Palomanes). Eles são os Croods, uma família liderada por um pai que morre de medo do mundo exterior. Só que grandes transformações estão para acontecer, pois a adolescente Eep acaba conhecendo o também jovem Guy (Ryan Reynolds / Raphael Rossatto) e ele vai apresentar um incrível mundo novo, para o desespero do paizão protetor. Agora, juntos, eles vão enfrentar grandes desafios e se adaptar a uma nova e divertida era.', 0, NULL, NULL, NULL),
(NULL, 156, 'Os Últimos Cavaleiros', 'Last Knights', 'Coreia do Sul', 'Aventura', 'Kazuaki Kiriya', '15362411545b912e02c724b.jpg', 115, 2015, 'vaFRY6Tji1g', 'Clive Owen, Morgan Freeman, Cliff Curtis, Aksel Hennie', 'Um grupo de guerreiros perde seu mestre após o assassinato cometido por um imperador tirânico. Juntos, eles partem em busca de vingança.', 0, NULL, NULL, NULL),
(NULL, 157, 'Pais e Filhas', 'Fathers And Daughters', 'Estados Unidos', 'Drama', 'Gabriele Muccino', '15362412905b912e8ae3d70.jpg', 106, 2016, 'bTUCFpGc_4I', NULL, 'Nova York, 1988. Novelista mentalmente instável (Russell Crowe) tenta criar sozinho a filha de cinco anos após a morte da esposa. Vinte anos depois, a garota, já adulta (Amanda Seyfried), cuida de crianças com problemas psicológicos e ainda tenta entender sua complicada infância.', 0, NULL, NULL, NULL),
(NULL, 158, 'Paixão Sem Limites', 'Asylum', 'Reino Unido', 'Suspense', 'David Mackenzie', '15362417795b913073c7979.jpg', 90, 2005, 'NmgimnEOygQ', 'Natasha Richardson, Hugh Bonneville, Gus Lewis, Ian McKellen', 'Inglaterra, anos 50. Quando Max Raphael (Hugh Bonneville) é nomeado supervisor num remoto hospital psiquiátrico, vai viver lá e é acompanhado pela esposa, Stella (Natasha Richardson), e o filho, Charlie (Gus Lewis). Stella sente-se entediada de participar de \"importantes reuniões\" com as mulheres de outros funcionários do asilo. Logo isto muda, pois ela começa a se sentir atraída por um interno, Edgar Stark (Marton Csokas), que matou a esposa (foi diagnosticado como tendo distúrbio de personalidade severo, com traços de ciúme mórbido). Ela se envolve fortemente com Edgar, sem se preocupar se está arriscando sua família, sua sanidade e até mesmo sua própria vida.', 0, NULL, NULL, NULL),
(NULL, 159, 'Sempre ao Seu Lado', 'Hachi: A Dog', 'Estados Unidos', 'Drama', 'Lasse Hallström', '15362419545b9131227e6cf.jpg', 93, 2009, 'UFY8vW5IedY', NULL, 'Parker Wilson (Richard Gere) é um professor universitário que, ao retornar do trabalho, encontra na estação de trem um filhote de cachorro da raça akita, conhecido por sua lealdade. Sem ter como deixá-lo na estação, Parker o leva para casa mesmo sabendo que Cate (Joan Allen), sua esposa, é contra a presença de um cachorro. Aos poucos Parker se afeiçoa ao filhote, que tem o nome Hachi escrito na coleira, em japonês. Cate cede e aceita sua permanência. Hachi cresce e passa a acompanhar Parker até a estação de trem, retornando ao local no horário em que o professor está de volta. Até que um acontecimento inesperado altera sua vida.', 0, NULL, NULL, NULL),
(NULL, 160, 'Quando Te Conheci', 'Equals', 'Estados Unidos', 'Ficção Científica', 'Drake Doremus', '15362421075b9131bbba58a.jpg', 101, 2016, 'q5-3uoxTw5k', 'Anusha, Saqlain, Skanda', 'No futuro, existe uma nova raça de seres humanos: os Equals, indivíduos pacíficos, justos e que não possuem mais emoções. Até que uma doença passa a ameaçar todos, ativando sentimentos em suas vítimas, que são excluídas do resto da sociedade. Silas (Nicholas Hoult) é infectado, mas percebe que Nia (Kristen Stewart) também possui sentimentos, sendo capaz de escondê-los. Sentindo pela primeira vez algum tipo de intimidade em suas vidas, eles decidem fugir.', 0, NULL, NULL, NULL),
(NULL, 161, 'RED - Aposentados e Perigosos', 'Red', 'Estados Unidos', 'Ação', 'Robert Schwentke', '15362422675b91325b39d6e.jpg', 111, 2010, '-FqOxSB2wso', 'Bruce Willis, Mary-Louise Parker, Heidi von Palleske, Karl Urban', 'Frank Moses (Bruce Willis) é um ex-agente da CIA, hoje aposentado, que tenta levar uma vida normal. Ele está interessado por Sarah (Mary-Louise Parker), com quem volta e meia conversa ao telefone, apesar de ainda não conhecer pessoalmente. Um dia, a casa de Frank é atacada por agentes da CIA. Sem saber o que está acontecendo, ele deduz que logo perceberão sua ligação com Sarah e parte para protegê-la. Para entender o porquê de ter sido atacado, Frank precisará da ajuda de seus antigos companheiros Joe (Morgan Freeman), Marvin (John Malkovich) e Victoria (Helen Mirren), todos também aposentados.', 0, NULL, NULL, NULL),
(NULL, 162, 'RED - Aposentados e ainda mais perigosos', 'Red 2', 'Estados Unidos', 'Ação', 'Dean Parisot', '15362423905b9132d6afc0c.jpg', 117, 2013, 'QoHhYrUk79A', 'Bruce Willis, John Malkovich, Mary-Louise Parker, Helen Mirren', 'Tudo o que Frank Moses (Bruce Willis) queria era levar uma vida normal ao lado da namorada Sarah (Mary-Louise Parker), mas seu sonho vira um pesadelo quando seu parceiro Marvin Boggs (John Malkovich) aparece com uma novidade: suas vidas estão em perigo. Frank não dá muito crédito para as palavas do amigo, mas logo se vê forçado a acreditar que algo está acontecendo quando acaba sendo levado para um interrogatório e quase é morto. Agora, ele tem certeza de que sua cabeça e a de seu melhor amigo estão a prêmio. A questão é descobrir porque e como evitar que isso aconteça, nem que para isso eles tenham que correr o mundo, reeconcontrar velhos parceiros, na figura de Victoria (Helen Mirren) e enfrentar antigos inimigos, como o poderoso Han (Byung-Hun Lee). A caçada está só começando.', 0, NULL, NULL, NULL),
(NULL, 163, 'Piratas do Caribe - A Maldição do Pérola Negra ', 'Pirates of the Caribbean: The Curse of the Black Pearl', 'Estados Unidos', 'Aventura', 'Gore Verbinski', '15365896535b967f55a65b0.jpg', 143, 2003, '21WvXGt_t_o ', 'Johnny Depp, Geoffrey Rush, Orlando Bloom, Keira Knightley', 'Em pleno século XVII, o pirata Jack Sparrow (Johnny Depp) tem seu navio saqueado e roubado pelo capitão Barbossa (Geoffrey Rush) e sua tripulação. Com o navio de Sparrow, Barbossa invade e saqueia a cidade de Port Royal, levando consigo Elizabeth Swann (Keira Knightley), a filha do governador (Jonathan Pryce). Decidido a recuperar sua embarcação, Sparrow recebe a ajuda de Will Turner (Orlando Bloom), um grande amigo de Elizabeth que parte em seu encalço. Porém, o que ambos não sabem é que o Pérola Negra, navio de Barbossa, foi atingido por uma terrível maldição que faz com que eles naveguem eternamente pelos oceanos e se transformem em esqueletos à noite.', 0, NULL, NULL, NULL),
(NULL, 164, 'Piratas do Caribe - O Baú da Morte ', 'Pirates of the Caribbean: Dead Man', 'Estados Unidos', 'Aventura', 'Gore Verbinski', '15365899605b968088411c5.jpg', 151, 2006, 'ZHZu8DHWO3Q', NULL, 'Elizabeth Swann (Keira Knightley), a filha do governador Weatherby (Jonathan Pryce), está prestes a se casar com o ferreiro Will Turner (Orlando Bloom). Porém o evento é atrapalhado pela ameaça de Davy Jones (Bill Nighy), o capitão do assombrado navio Flying Dutchman, que tem uma dívida de sangue com o capitão Jack Sparrow (Johnny Depp), amigo do casal. Temendo ser amaldiçoado a uma vida após a morte como escravo de Jones, Sparrow precisa encontrar o misterioso baú da morte para escapar da ameaça.', 0, NULL, NULL, NULL),
(NULL, 165, 'Piratas do Caribe - No Fim do Mundo', 'Pirates of the Caribbean: At World', 'Estados Unidos', 'Aventura', 'Gore Verbinski', '15365900985b968112ca22c.jpg', 169, 2007, 'Y9pLK1-_cFE', NULL, 'O lorde Cuttler Beckett (Tom Hollander), da Companhia das Índias Orientais, detém o comando do navio-fantasma Flying Dutchman. O navio, agora sob o comando do almirante James Norrington (Jack Davenport), tem por missão vagar pelos sete mares em busca de piratas e matá-los sem piedade. Na intenção de deter Beckett, Will Turner (Orlando Bloom), Elizabeth Swann (Keira Knightley) e o capitão Barbossa (Geoffrey Rush) precisam reunir os Nove Lordes da Corte da Irmandade. Porém falta um dos Lordes, o capitão Jack Sparrow (Johnny Depp). O trio parte para Cingapura, na intenção de conseguir o mapa que os conduzirá ao fim do mundo, o que possibilitará que Jack seja resgatado. Porém para conseguir o mapa eles precisarão enfrentar um pirata chinês, o capitão Sao Feng (Chow Yun-Fat).', 0, NULL, NULL, NULL),
(NULL, 166, 'Piratas do Caribe - Navegando em Águas Misteriosas', 'Pirates of the Caribbean: On Stranger Tides', 'Estados Unidos', 'Aventura', 'Rob Marshall', '15365902375b96819dc3b44.jpg', 136, 2011, 'jyKdKEzlGyo', 'Johnny Depp, Penélope Cruz, Geoffrey Rush, Ian McShane', 'O capitão Jack Sparrow (Johnny Depp) vai até Londres para resgatar Gibbs (Kevin McNally), integrante de sua tripulação no Pérola Negra. Lá ele descobre que alguém está usando seu nome para conseguir marujos em uma viagem rumo à Fonte da Juventude. Sparrow investiga e logo percebe que Angelica (Penélope Cruz), um antigo caso que balançou seu coração, é a responsável pela farsa. Ela é filha do lendário pirata Barba Negra (Ian McShane), que está com os dias contados. Desta forma, Angelica quer encontrar a Fonte da Juventude para que seu pai tenha mais alguns anos de vida. No encalço deles está o capitão Barbossa (Geoffrey Rush), que agora trabalha para o império britânico.', 0, NULL, NULL, NULL),
(NULL, 167, 'Piratas do Caribe - A Vingança de Salazar', 'Pirates of the Caribbean: Dead Men Tell No Tales', 'Estados Unidos', 'Aventura', 'Joachim Rønning', '15365904525b96827469117.jpg', 129, 2017, 'H8d1pD49JOk', 'Johnny Depp, Javier Bardem, Geoffrey Rush, Brenton Thwaites', 'O capitão Salazar (Javier Bardem) é a nova pedra no sapato do capitão Jack Sparrow (Johnny Depp). Ele lidera um exército de piratas fantasmas assassinos e está disposto a matar todos os piratas existentes na face da Terra. Para escapar, Sparrow precisa encontrar o Tridente de Poseidon, que dá ao seu dono o poder de controlar o mar.', 0, NULL, NULL, NULL),
(NULL, 168, 'Sobrenatural', 'Insidious', 'Estados Unidos', 'Terror', 'James Wan', '15365906505b96833a2f723.jpg', 102, 2011, '0AHVW_yenRs', NULL, 'A família Lambert, formada por Josh (Patrick Wilson), Renai (Rose Byrne) e os filhos Dalton (Ty Simpkins) e Foster (Andrew Astor), acaba de se mudar. Logo, uma das crianças entra em coma de forma inexplicável, o que faz os pais pensarem que a nova casa abriga algum tipo de espírito do mal. Mas eles logo se mudam do local e nos dias seguintes acabam descobrindo que o problema não estava na casa e sim no próprio filho.', 0, NULL, NULL, NULL),
(NULL, 169, 'Viva - A Vida é uma Festa', 'Coco', 'Estados Unidos', 'Animação', 'Lee Unkrich', '15365908215b9683e522cfd.jpg', 105, 2017, 'ifWuCDkYnW0', 'Anthony Gonzalez, Gael García Bernal, Benjamin Bratt, Alanna Ubach', 'Miguel Ã© um menino de 12 anos que quer muito ser um mï¿½sico famoso, mas ele precisa lidar com sua famï¿½lia que desaprova seu sonho. Determinado a virar o jogo, ele acaba desencadeando uma sï¿½rie de eventos ligados a um mistï¿½rio de 100 anos. A aventura, com inspiraï¿½ï¿½o no feriado mexicano do Dia dos Mortos, acaba gerando uma extraordinï¿½ria reuniï¿½o familiar.', 0, NULL, NULL, NULL),
(NULL, 170, 'Up - Altas Aventuras', 'Up', 'Estados Unidos', 'Animação', 'Pete Docter', '15365971775b969cb96d9e3.jpg', 95, 2009, 'S8GVQ0Sihxw', 'Edward Asner, Christopher Plummer, Jordan Nagai, Bob Peterson', 'Carl Fredricksen (Edward Asner) é um vendedor de balões que, aos 78 anos, está prestes a perder a casa em que sempre viveu com sua esposa, a falecida Ellie. O terreno onde a casa fica localizada interessa a um empresário, que deseja construir no local um edifício. Após um incidente em que acerta um homem com sua bengala, Carl é considerado uma ameaça pública e forçado a ser internado em um asilo. Para evitar que isto aconteça, ele enche milhares de balões em sua casa, fazendo com que ela levante vôo. O objetivo de Carl é viajar para uma floresta na América do Sul, um local onde ele e Ellie sempre desejaram morar. Só que, após o início da aventura, ele descobre que seu pior pesadelo embarcou junto: Russell (Jordan Nagai), um menino de 8 anos.', 0, NULL, NULL, NULL),
(NULL, 171, 'Yu-Gi-Oh!: Vínculos Além do Tempo', '劇場版 遊☆戯☆王 〜超融合!時空を越えた絆〜', 'Japão', 'Anime', 'Kenichi Takeshita', '15365974695b969ddd1e403.jpg', 60, 2010, 'CDouyXjsP6Q', NULL, 'No futuro, a civilização humana foi destruída. Paradox viaja para o passado para prevenir seu futuro eliminando a causa dessa destruição: Monstros de Duelo e seu criador. Os heróis das três gerações da série Yu-Gi-Oh!: Yugi Muto, Jaden Yuki e Yusei Fudo se reúnem para um duelo final contra Paradox.', 0, NULL, NULL, NULL),
(NULL, 172, 'Spirit - O Corcel Indomável ', 'Spirit: Stallion of the Cimarron', 'Estados Unidos', 'Animação', 'Kelly Asbury', '15365977945b969f226eac7.jpg', 84, 2002, '0FhmY0ZgHec', 'Matt Damon, James Cromwell, Daniel Studi, Chopper Bernet', 'No final do século XVII em pleno Oeste norte-americano vive Spirit, um cavalo que resiste a ser domado pelo homem. Ele se apaixona por uma égua local, chamada Chuva, e desenvolve uma grande amizade com um jovem índio Lakota chamado Pequeno Rio. Juntos eles acompanham a colonização do local onde vivem, percebendo as mudanças que a chegada da civilização fazem em seu dia-a-dia.', 0, NULL, NULL, NULL),
(NULL, 173, 'Harry Potter e as Relíquias da Morte - Parte 2', 'Harry Potter and the Deathly Hallows - Part 2', 'Estados Unidos', 'Fantasia', 'David Yates', '15365980705b96a0362886f.jpg', 130, 2011, 'E79fa8bLfPA', 'Ralph Fiennes, Michael Gambon, Alan Rickman, Daniel Radcliffe', 'Harry Potter (Daniel Radcliffe) e seus amigos Rony Weasley (Rupert Grint) e Hermione Granger (Emma Watson) seguem à procura das horcruxes. O objetivo do trio é encontrá-las e, em seguida, destruí-las, de forma a eliminar lorde Voldemort (Ralph Fiennes) de uma vez por todas. Com a ajuda do duende Grampo (Warwick Davis), eles entram no banco Gringotes de forma a invadir o cofre de Bellatrix Lestrange (Helena Bonham Carter). De lá retornam ao castelo de Hogwarts, onde precisam encontrar mais uma horcrux. Paralelamente, Voldemort prepara o ataque definitivo ao castelo.', 0, NULL, NULL, NULL),
(NULL, 174, 'Harry Potter e as Relíquias da Morte - Parte 1', 'Harry Potter and the Deathly Hallows - Part 1', 'Estados Unidos', 'Fantasia', 'David Yates', '15365981315b96a0730465e.jpg', 145, 2010, '-_GftUTRWHM', 'Bill Nighy, Emma Watson, Richard Griffiths, Harry Melling', 'Prestes a completar 17 anos, Harry Potter (Daniel Radcliffe) precisa ser transportado da casa dos seus tios, os Dursley, até um local seguro. Lorde Voldemort (Ralph Fiennes) e seus comensais da morte sabem que a transferência está prestes a acontecer e aguardam sua realização para atacar. Para que ela ocorra vários amigos de Harry, como Rony Weasley (Rupert Grint), Hermione Granger (Emma Watson), Remo Lupin (David Thewlis), Hagrid (Robbie Coltrane) e \"Olho-Tonto\" Moody (Brendan Gleeson), tomam a Poção Polissuco e assumem a forma física de Harry. A intenção é despistar Voldemort sobre quem é o Harry verdadeiro, de forma que ele possa chegar seguro à Toca, casa dos Weasley. A missão é bem sucedida, mas logo a situação se torna ainda mais perigosa. O Ministro da Magia Rufus Scrimgeour (Bill Nighy) é morto e, em seu lugar, assume um dos asseclas de Voldemort. Harry e seus amigos passam a ser caçados impiedosamente, obrigando que ele, Rony e Hermione fujam. Precisando mudar constantemente de lugar, eles elaboram um plano para encontrar e destruir as horcruxes que podem eliminar Voldemort de uma vez por todas.', 0, NULL, NULL, NULL),
(NULL, 175, 'Harry Potter e o Enigma do Príncipe', 'Harry Potter and the Half-Blood Prince', 'Estados Unidos', 'Fantasia', 'David Yates', '15365982425b96a0e20a1dd.jpg', 152, 2009, 'wgkHfUaG1nI', 'Daniel Radcliffe, Michael Gambon, Dave Legeno, Elarica Johnson', 'Lorde Voldemort (Ralph Fiennes) é uma ameaça real, tanto para o mundo dos bruxos quanto o dos trouxas. Harry Potter (Daniel Radcliffe) suspeita que o perigo esteja dentro da Escola de Artes e Bruxaria de Hogwarts, mas Alvo Dumbledore (Michael Gambon) está mais preocupado em prepará-lo para o confronto final com o Lorde das Trevas. Dumbledore convida seu colega Horácio Slughorn (Jim Broadbent) para ser o novo professor de Poções, já que Severo Snape (Alan Rickman) enfim alcançou o sonho de ministrar as aulas de Defesa Contra as Artes das Trevas. Paralelamente Harry começa a ter um interesse cada vez maior por Gina Weasley (Bonnie Wright), irmã de seu melhor amigo Rony (Rupert Grint), que também é alvo de interesse de Dino Thomas (Alfie Enoch).', 0, NULL, NULL, NULL),
(NULL, 176, 'Harry Potter e a Ordem da Fênix', 'Harry Potter and the Order of the Phoenix', 'Estados Unidos', 'Fantasia', 'David Yates', '15365983285b96a138c7169.jpg', 138, 2007, 'Tbv2Al6LGW8', 'Daniel Radcliffe, Harry Melling, Jason Boyd, Richard Macklin', ' Harry Potter (Daniel Radcliffe) retorna à Escola de Magia e Bruxaria de Hogwarts, para cursar o 5º ano letivo. Logo ele descobre que boa parte da comunidade bruxa foi levada a acreditar que o retorno de Voldemort (Ralph Fiennes) foi uma mentira inventada por Harry, o que põe sua credibilidade em dúvida. Além disto, o Ministro da Magia Cornélio Fudge (Robert Hardy) impõe à escola a presença de Dolores Umbridge (Imelda Staunton), que torna-se a nova professora de Defesa Contra as Artes das Trevas. Acontece que as aulas de Umbridge, apesar de aprovadas pelo ministério, abrangem apenas temas amenos, deixando os alunos despreparados para os perigos dos dias atuais. Incentivado por seus amigos Rony (Rupert Grint) e Hermione (Emma Watson), Harry decide encontrar-se em segredo com um grupo de estudantes, visando a prática de magia. O grupo se autodenomina como a \"Armada de Dumbledore\", mas logo passa a ser vista como uma ameaça ao próprio Ministério da Magia.', 0, NULL, NULL, NULL),
(NULL, 177, 'Harry Potter e o Cálice de Fogo ', 'Harry Potter and the Goblet of Fire', 'Estados Unidos', 'Fantasia', 'Mike Newell', '15365984205b96a19410b02.jpg', 155, 2005, 'RwJlOdtoHRE', 'Eric Sykes, Timothy Spall, David Tennant, Daniel Radcliffe', ' Em seu 4º ano na Escola de Magia e Bruxaria de Hogwarts, Harry Potter (Daniel Radcliffe) é misteriosamente selecionado para participar do Torneio Tribruxo, uma competição internacional em que precisará enfrentar alunos mais velhos e experientes de Hogwards e também de outras escolas de magia. Além disso a aparição da marca negra de Voldemort (Ralph Fiennes) ao término da Copa do Mundo de Quadribol põe a comunidade de bruxos em pânico, já que sinaliza que o temido bruxo está prestes a retornar.', 0, NULL, NULL, NULL),
(NULL, 178, 'Harry Potter e o Prisioneiro de Azkaban', 'Harry Potter and the Prisoner of Azkaban', 'Estados Unidos', 'Fantasia', ' Alfonso Cuarón', '15365986275b96a263c5952.jpg', 140, 2004, 'V_JtCbmkPA0', 'Daniel Radcliffe, Richard Griffiths, Pam Ferris, Fiona Shaw', 'O 3º ano de ensino na Escola de Magia e Bruxaria de Hogwarts se aproxima. Porém um grande perigo ronda a escola: o assassino Sirius Black (Gary Oldman) fugiu da prisão de Azkaban, considerada até então como à prova de fugas. Para proteger a escola são enviados os Dementadores, estranhos seres que sugam a energia vital de quem se aproxima deles, que tanto podem defender a escola como piorar ainda mais a situação.', 0, NULL, NULL, NULL),
(NULL, 179, 'Harry Potter e a Câmara Secreta', 'Harry Potter and The Chamber of Secrets', 'Estados Unidos', 'Fantasia', 'Chris Columbus', '15365987395b96a2d3cdc0e.jpg', 150, 2002, 'K2jg9uiT1q8', 'Daniel Radcliffe, Rupert Grint, Emma Watson, Richard Griffiths', ' De férias na casa de seus tios Dursley, Harry Potter (Daniel Radcliffe) recebe a inesperada visita de Dobby, um elfo doméstico, que veio avisá-lo para não retornar à Escola de Magia de Hogwarts, pois lá correrá um grande perigo. Harry não lhe dá ouvidos e decide retornar aos estudos, enfrentando um 2º ano recheado de novidades. Uma delas é a contratação do novo Professor de Defesa Contra as Artes das Trevas, Gilderoy Lockhart (Kenneth Branagh), que é considerado um grande galã e não perde uma oportunidade de fazer marketing pessoal. Porém, o aviso de Dobby se confirma e logo toda Hogwarts está envolvida em um mistério que resulta no aparecimento de alunos petrificados.', 0, NULL, NULL, NULL),
(NULL, 180, 'Harry Potter e a Pedra Filosofal ', 'Harry Potter and the Philosopher', 'Estados Unidos', 'Fantasia', 'Chris Columbus', '15365988845b96a36485731.jpg', 152, 2001, '772UlkDZSPY', NULL, ' Harry Potter (Daniel Radcliffe) é um garoto órfão de 10 anos que vive infeliz com seus tios, os Dursley. Até que, repentinamente, ele recebe uma carta contendo um convite para ingressar em Hogwarts, uma famosa escola especializada em formar jovens bruxos. Inicialmente Harry é impedido de ler a carta por seu tio Válter (Richard Griffiths), mas logo ele recebe a visita de Hagrid (Robbie Coltrane), o guarda-caça de Hogwarts, que chega em sua casa para levá-lo até a escola. A partir de então Harry passa a conhecer um mundo mágico que jamais imaginara, vivendo as mais diversas aventuras com seus mais novos amigos, Rony Weasley (Rupert Grint) e Hermione Granger (Emma Watson).', 0, NULL, NULL, NULL),
(NULL, 181, 'Jogos Vorazes', 'The Hunger Games', 'Estados Unidos', 'Ação', 'Gary Ross', '15365991385b96a46278665.jpg', 142, 2012, 'SUyLvbbm0pk', 'Jennifer Lawrence, Josh Hutcherson, Liam Hemsworth, Woody Harrelson, Elizabeth Banks, Lenny Kravitz, Donald Sutherland, Stanley Tucci', 'Num futuro distante, boa parte da população é controlada por um regime totalitário, que relembra esse domínio realizando um evento anual - e mortal - entre os 12 distritos sob sua tutela. Para salvar sua irmã caçula, a jovem Katniss Everdeen (Jennifer Lawrence) se oferece como voluntária para representar seu distrito na competição e acaba contando com a companhia de Peeta Melark (Josh Hutcherson), desafiando não só o sistema dominante, mas também a força dos outros oponentes.', 0, NULL, 1, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 182, 'Jogos Vorazes - Em Chamas ', 'The Hunger Games - Catching Fire', 'Estados Unidos', 'Ação', 'Francis Lawrence', '15365992625b96a4ded8a87.jpg', 146, 2013, '8kAC_E0H5nc', 'Jennifer Lawrence, Josh Hutcherson, Liam Hemsworth, Woody Harrelson, Elizabeth Banks, Lenny Kravitz, Willow Shields, Jena Malone, Sam Claflin', 'Este é o segundo volume da trilogia Jogos Vorazes, baseada nos romances de Suzanne Collins. A saga relata a aventura de Katniss (Jennifer Lawrence), jovem escolhida para participar aos \"jogos vorazes\", espécie de reality show em que um adolescente de cada distrito de Panem, considerado como \"tributo\", deve lutar com os demais até que apenas um saia vivo. Neste segundo episódio da série, após a afronta de Katniss à organização dos jogos, ela deverá enfrentar a forte represália do governo local, lutando não apenas por sua vida, mas por toda a população de Panem.', 0, NULL, NULL, NULL),
(NULL, 183, 'Jogos Vorazes: A Esperança - Parte 1', 'The Hunger Games - Mockingjay : Part 1', 'Estados Unidos', 'Ação', 'Francis Lawrence', '15365993705b96a54aaeaee.jpeg', 123, 2014, 'QRSRNmLtoLY', 'Jennifer Lawrence, Josh Hutcherson, Liam Hemsworth, Woody Harrelson', 'Ainda se recuperando do choque de ver Peeta (Josh Hutcherson) contra si, Katniss Everdeen (Jennifer Lawrence) é enviada ao Distrito 2 pela presidente Coin (Julianne Moore). Lá ela ajuda a convencer os moradores locais a se rebelarem contra a Capital. Com todos os distritos unidos, tem início o ataque decisivo contra o presidente Snow (Donald Sutherland). Só que Katniss tem seus próprios planos para o combate e, para levá-los adiante, precisa da ajuda de Gale (Liam Hemsworth), Finnick (Sam Claflin), Cressida (Natalie Dormer), Pollux (Elder Henson) e do próprio Peeta, enviado para compôr sua equipe.', 0, NULL, NULL, NULL),
(NULL, 186, 'Jogos Vorazes: A Esperança - O Final', 'The Hunger Games - Mockingjay: Part 2', 'Estados Unidos', 'Ação', 'Francis Lawrence', '15365997785b96a6e27365a.jpg', 137, 2015, 'YhiL90_-y2w', 'Jennifer Lawrence, Josh Hutcherson, Liam Hemsworth, Woody Harrelson', 'Ainda se recuperando do choque de ver Peeta (Josh Hutcherson) contra si, Katniss Everdeen (Jennifer Lawrence) é enviada ao Distrito 2 pela presidente Coin (Julianne Moore). Lá ela ajuda a convencer os moradores locais a se rebelarem contra a Capital. Com todos os distritos unidos, tem início o ataque decisivo contra o presidente Snow (Donald Sutherland). Só que Katniss tem seus próprios planos para o combate e, para levá-los adiante, precisa da ajuda de Gale (Liam Hemsworth), Finnick (Sam Claflin), Cressida (Natalie Dormer), Pollux (Elder Henson) e do próprio Peeta, enviado para compôr sua equipe.', 0, NULL, NULL, NULL),
(NULL, 187, 'Spotlight - Segredos Revelados', 'Spotlight', 'Estados Unidos', 'Drama', 'Tom McCarthy', '15366002875b96a8dfe14cd.jpg', 128, 2016, 'zgicIR5Skwc', 'Rachel McAdams, Mark Ruffalo, Michael Keaton, Liev Schreiber, John Slattery, Brian d\'Arcy James, Stanley Tucci, Billy Crudup, Jamey Sheridan', 'Baseado em uma história real, o drama mostra um grupo de jornalistas em Boston que reúne milhares de documentos capazes de provar diversos casos de abuso de crianças, causados por padres católicos. Durante anos, líderes religiosos ocultaram o caso transferindo os padres de região, ao invés de puni-los pelo caso.', 0, NULL, NULL, NULL),
(NULL, 188, 'Okja', 'Okja', 'Coreia do Sul', 'Drama', 'Joon-Ho Bong', '15366005085b96a9bc20437.jpg', 118, 2017, 'rdIkbd9yEXY', 'Tilda Swinton, Sheena Kamal, Michael Mitton, Colm Hill', ' Nova York, 2007. Lucy Mirando (Tilda Swinton), a CEO de uma poderosa empresa, apresenta ao mundo que uma nova espécie animal foi descoberta no Chile. Apelidada de \"super porco\", ela é cuidada em laboratório e tem 26 animais enviados para países distintos, de forma que cada fazenda que o receba possa apresentá-lo à sua própria cultura local. A ideia é que os animais permaneçam espalhados ao redor do planeta por 10 anos, sendo que após este período participarão de um concurso que escolherá o melhor super porco. Uma década depois, a jovem Mija (Seo-Hyun Ahn) convive desde a infância com Okja, o super porco fêmea criado pelo avô. Prestes a perdê-la devido à proximidade do concurso, Mija decide lutar para ficar ao lado dela, custe o que custar.', 0, NULL, NULL, NULL),
(NULL, 189, 'A Barraca do Beijo', 'The Kissing Booth', 'Reino Unido', 'Romance', 'Vince Marcello', '15366008715b96ab279d9e0.jpg', 110, 2018, 'qelSQce80i8', ' Joey King, Joel Courtney, Jacob Elordi, Molly Ringwald, Meganne Young, Morne Visser', 'Melhores amigos desde sempre, Elle (Joey King) e Lee (Joel Courtney) têm a inventiva ideia de gerenciar uma barraca do beijo durante um evento da escola. Para fazer da proposta um sucesso, a garota tenta convencer o galã Noah (Jacob Elordi), seu crush e irmão mais velho de Lee, a participar da brincadeira. Ele mostra-se irredutível, mas os dois acabam se aproximando como nunca, o que estremece a amizade de Elle e Lee.', 0, NULL, NULL, NULL),
(NULL, 190, 'Acrimônia', 'Acrimony', 'Estados Unidos', 'Suspense', 'Tyler Perry', '15366010345b96abca9393f.jpg', 120, 2018, 'bwFfJGXiKJo', 'Taraji P. Henson, Lyriq Bent, Crystle Stewart, Jazmyn Simon', 'Melinda (Taraji P. Henson) sempre foi uma esposa fiel, porém, cansada de ficar ao lado de seu marido preguiçoso, Robert (Lyriq Bent), se divorcia quando ele faz com que ela perca a casa de sua família. Meses depois, Melinda descobre que seu ex-marido ficou rico e está noivo de outra mulher. Sentindo que ele deve a ela todo o tempo e dinheiro que ela investiu quando estavam juntos, ela perde o controle e vai atrás de vingança.', 0, NULL, NULL, NULL),
(NULL, 191, 'Carol', 'Carol ', 'Reino Unido', 'Drama, LGBT, Romance', 'Todd Haynes', '15366011615b96ac490eccd.jpg', 118, 2015, 'pBPUVa8BEm8', 'Cate Blanchett, Rooney Mara, Kyle Chandler, Sarah Paulson', ' A jovem Therese Belivet (Rooney Mara) tem um emprego entediante na seção de brinquedos de uma loja de departamentos. Um dia, ela conhece a elegante Carol Aird (Cate Blanchett), uma cliente que busca um presente de Natal para a sua filha. Carol, que está se divorciando de Harge (Kyle Chandler), também não está contente com a sua vida. As duas se aproximam cada vez mais e, quando Harge a impede de passar o Natal com a filha, Carol convida Therese a fazer uma viagem pelos Estados Unidos.', 0, NULL, NULL, NULL),
(NULL, 192, 'Extraordinário', 'Wonder', 'Estados Unidos', 'Drama', 'Stephen Chbosky', '15366025055b96b18975b69.png', 111, 2017, 'GtdzuOle5kc', 'Jacob Tremblay, Owen Wilson, Izabela Vidovic, Julia Roberts', 'Auggie Pullman (Jacob Tremblay) é um garoto que nasceu com uma deformação facial, o que fez com que passasse por 27 cirurgias plásticas. Aos 10 anos, ele pela primeira vez frequentará uma escola regular, como qualquer outra criança. Lá, precisa lidar com a sensação constante de ser sempre observado e avaliado por todos à sua volta.', 0, NULL, NULL, NULL),
(NULL, 193, 'Ferrugem', 'Ferrugem', 'Brasil', 'Drama', 'Aly Muritiba', '15366040165b96b77032959.jpg', 105, 2018, 'iaiFy9lvEEw', 'Giovanni de Lorenzi, Tifanny Dopke, Enrique Diaz, Clarissa Kiste', 'Assim como a maioria dos adolescentes, a jovem Tati (Tiffanny Dopke) ama compartilhar sua vida nas redes sociais e registrar todos os momentos. Porém, após perder o inseparável celular, ela se vê vítima da criminosa divulgação de seus registros íntimos no grupo de WhatsApp da turma do colégio, o que gera terríveis consequências.', 0, NULL, NULL, NULL),
(NULL, 194, 'Doentes de Amor', 'The Big Sick', 'Estados Unidos', 'Romance', 'Michael Showalter', '15366045285b96b97010d0c.jpg', 120, 2017, 'jcD0Daqc3Yw', 'Kumail Nanjiani, Zoe Kazan, Holly Hunter, Ray Romano', ' O comediante e motorista de Uber paquistanês Kumail (Kumail Nanjiani) e a estudante de psicologia Emily (Zoe Kazan) se apaixonam em Chicago, mas encontram dificuldades no momento em que suas culturas entram em conflito. Quando Emily contrai uma doença misteriosa e é colocada em coma, Kumail tenta enfim resolver o conflito emocional entre sua família e seu coração.', 0, NULL, NULL, NULL),
(NULL, 195, 'Joy: O Nome do Sucesso', 'Joy', 'Estados Unidos', 'Biografia', 'David O. Russell', '15366046865b96ba0e1259f.jpg', 124, 2015, 'jbiMQqKGTxY', 'Jennifer Lawrence, Robert De Niro, Bradley Cooper, Edgar Ramírez', 'Criativa desde a infância, Joy Mangano (Jennifer Lawrence) entrou na vida adulta conciliando a jornada de mãe solteira com a de inventora e tanto fez que tornou-se uma das empreendedoras de maior sucesso dos Estados Unidos.', 0, NULL, NULL, NULL),
(NULL, 196, 'Deadpool', 'Deadpool', 'Estados Unidos', 'Comédia', 'Tim Miller', '15366048565b96bab81164d.jpg', 108, 2016, 'Q9X-bAE8KTc', 'Ryan Reynolds, Karan Soni, Ed Skrein, Michael Benyaer', 'Ex-militar e mercenário, Wade Wilson (Ryan Reynolds) é diagnosticado com câncer em estado terminal, porém encontra uma possibilidade de cura em uma sinistra experiência científica. Recuperado, com poderes e um incomum senso de humor, ele torna-se Deadpool e busca vingança contra o homem que destruiu sua vida.', 0, NULL, NULL, NULL),
(NULL, 197, 'Fala Sério, Mãe! ', 'Fala Sério, Mãe! ', 'Brasil', 'Comédia', 'Pedro Vasconcelos', '15366049755b96bb2f0672e.jpg', 79, 2017, 'kKlUY2CN1PI', 'Ingrid Guimarães, Marcelo Laham, Larissa Manoela, Vitória Magalhães', 'Ângela Cristina (Ingrid Guimarães), mãe da adolescente Maria de Lourdes (Larissa Manoela), está tendo a experiência de guiar sua filha durante uma das fases mais complicadas da vida. Ela vive uma montanha-russa de emoções, com medos, frustrações e um caminhão de queixas para descarregar. Por outro lado, Malu, como prefere ser chamada, também tem suas insatisfações. Teimosa, sofre com os cuidados excessivos e com o jeito conservador da mãe.', 0, NULL, NULL, NULL),
(NULL, 198, 'Lugares Escuros', 'Dark Places', 'Estados Unidos', 'Suspense', 'Gilles Paquet-Brenne', '15366051965b96bc0cbf75d.jpg', 113, 2015, 'l6Wy_8Xkp9s', 'Charlize Theron, Sterling Jerins, Nicholas Hoult, Christina Hendricks', 'Libby Day (Charlize Theron) é uma mulher traumatizada pelo assassinato de toda a sua família, quando ela ainda era uma criança. Quando é abordada por uma sociedade secreta, especializada em investigar crimes não resolvidos, Libby é obrigada a relembrar sua tragédia familiar.', 0, NULL, NULL, NULL),
(NULL, 199, 'A Freira', 'The Nun', 'Estados Unidos', 'Terror', 'Corin Hardy', '15366053535b96bca9886e3.jpg', 96, 2018, 'lqiQKemWZhU', 'Demián Bichir, Taissa Farmiga, Jonas Bloquet, Bonnie Aarons', ' Presa em um convento na Romênia, uma freira comete suicídio. Para investigar o caso, o Vaticano envia um padre atormentado e uma noviça prestes a se tornar freira. Arriscando suas vidas, a fé e até suas almas, os dois descobrem um segredo profano e se confrontam com uma força do mal que toma a forma de uma freira demoníaca e transforma o convento num campo de batalha.', 0, NULL, NULL, NULL),
(NULL, 200, 'Boyhood: Da Infância à Juventude', 'Boyhood', 'Estados Unidos', 'Coming of age, Drama', 'Richard Linklater', '15366055615b96bd7928cc4.jpg', 165, 2014, 'vsv0HsiZzMw', 'Ellar Coltrane, Patricia Arquette, Elijah Smith, Lorelei Linklater', 'O filme conta a história de um casal de pais divorciados (Ethan Hawke e Patricia Arquette) que tenta criar seu filho Mason (Ellar Coltrane). A narrativa percorre a vida do menino durante um período de doze anos, da infância à juventude, e analisa sua relação com os pais conforme ele vai amadurecendo.', 0, NULL, NULL, NULL),
(NULL, 201, 'Alice Através do Espelho', 'Alice Through the Looking Glass', 'Estados Unidos', 'Fantasia', 'James Bobin', '15366056825b96bdf2a8273.jpg', 110, 2016, '8cHqI-m4l28', 'Johnny Depp, Mia Wasikowska, Helena Bonham Carter, Anne Hathaway', 'Alice (Mia Wasikowska) retorna após uma longa viagem pelo mundo, e reencontra a mãe. No casarão de uma grande festa, ela percebe a presença de um espelho mágico. A jovem atravessa o objeto e retorna ao País das Maravilhas, onde descobre que o Chapeleiro Maluco (Johnny Depp) corre risco de morte após fazer uma descoberta sobre seu passado. Para salvar o amigo, Alice deve conversar com o Tempo (Sacha Baron Cohen) para voltar às vésperas de um evento traumático e mudar o destino do Chapeleiro. Nesta aventura, também descobre um trauma que separou as irmãs Rainha Branca (Anne Hathaway) e Rainha Vermelha (Helena Bonham Carter).', 0, NULL, NULL, NULL),
(NULL, 202, 'A Forma da Água', 'The Shape of Water', 'Estados Unidos', 'Fantasia', 'Guillermo del Toro', '15366059285b96bee8207e2.jpg', 123, 2017, '-DTVuQTZr3E', 'Sally Hawkins, Michael Shannon, Richard Jenkins, Octavia Spencer', ' Década de 60. Em meio aos grandes conflitos políticos e transformações sociais dos Estados Unidos da Guerra Fria, a muda Elisa (Sally Hawkins), zeladora em um laboratório experimental secreto do governo, se afeiçoa a uma criatura fantástica mantida presa e maltratada no local. Para executar um arriscado e apaixonado resgate ela recorre ao melhor amigo Giles (Richard Jenkins) e à colega de turno Zelda (Octavia Spencer).', 0, NULL, NULL, NULL),
(NULL, 203, 'Lucy', 'Lucy', 'França', 'Ficção Científica', ' Luc Besson', '15366060875b96bf87dee1d.jpg', 79, 2014, '1oJR6Di0Eck', 'Scarlett Johansson, Morgan Freeman, Min-sik Choi, Amr Waked', 'Quando a inocente jovem Lucy (Scarlett Johansson) aceita transportar drogas dentro do seu estômago, ela não conhece muito bem os riscos que corre. Por acaso, ela acaba absorvendo as drogas, e um efeito inesperado acontece: Lucy ganha poderes sobre-humanos, incluindo a telecinesia, a ausência de dor e a capacidade de adquirir conhecimento instantaneamente.', 0, NULL, NULL, NULL),
(NULL, 204, 'Lady Bird - A Hora de Voar', 'Lady Bird', 'Estados Unidos', 'Coming of age, Comédia Dramática', 'Greta Gerwig ', '15366061925b96bff064729.jpg', 95, 2017, 'FX_ZHgdyD4s', 'Saoirse Ronan, Laurie Metcalf, Tracy Letts, Lucas Hedges, Timothée Chalamet', ' Christine McPherson (Saoirse Ronan) está no último ano do ensino médio e o que mais deseja é ir fazer faculdade longe de Sacramento, Califórnia, ideia firmemente rejeitada por sua mãe (Laurie Metcalf). Lady Bird, como a garota de forte personalidade exige ser chamada, não se dá por vencida e leva o plano de ir embora adiante mesmo assim. Enquanto sua hora não chega, no entanto, ela se divide entre as obrigações estudantis no colégio católico, o primeiro namoro, típicos rituais de passagem para a vida adulta e inúmeros desentendimentos com a progenitora.', 0, NULL, NULL, NULL),
(NULL, 205, 'Marvin', 'Marvin ou la belle éducation', 'França', 'Drama', 'Anne Fontaine', '15366063545b96c0921182c.jpg', 114, 2018, '5zZPOXA4DgA', NULL, 'Martin Clement (Finnegan Oldfield), nascido Marvin Bijou, escapou da aldeia onde morava com o pai tirano e a mãe que o renunciava. Apaixonado por teatro, ele junta aliados para conseguir fazer com que seus sonhos virem realidade. Desde a diretora de sua escola até Isabelle Huppert, ele arrisca tudo para conseguir produzir seu show e alcançar o sucesso.', 0, NULL, NULL, NULL),
(NULL, 206, 'De Volta à Lagoa Azul', 'Return to the Blue Lagoon', 'Estados Unidos', 'Aventura', ' William A. Graham', '15380517195bacce8724030.jpg', 98, 1991, 'OQ5M6JFl0ig ', 'Milla Jovovich, Brian Krause, Lisa Pelikan, Courtney Barilla', ' Em virtude da cólera, Sarah (Lisa Pelikan), uma viúva, é deixada em um barco com um marinheiro e dois bebês: Lilli, sua filha, e Richard, filho de Emmeline, que tinha sido resgatado há poucos dias de um barco à deriva, onde seus pais foram encontrados mortos. Depois de vários dias o marinheiro pensa em matar os bebês para economizar água, mas Sarah não aceita tal atitude e mata o marujo. Depois de muitos dias ela chega com os bebês em uma bela ilha. Ela educa as crianças e quando elas têm quase 8 anos, ela morre. Quando Lilli e Richard se tornam jovens, se apaixonam e se \"casam\". Quando um navio chega na ilha alguns problemas acontecem, mas o principal é que um dos marujos tenta estuprar Lilli. O casal então questiona se quer ou não voltar para a civilização.', 0, NULL, NULL, NULL),
(NULL, 207, 'Em Ritmo De Fuga', 'Baby Driver', 'Estados Unidos', 'Ação', 'Edgar Wright', '15380518995baccf3b91954.jpg', 113, 2017, 'TJrKYWPBTrc ', 'Ansel Elgort, Jon Bernthal, Jon Hamm, Eiza González', 'O jovem Baby (Ansel Elgort) tem uma mania curiosa: precisa ouvir músicas o tempo todo para silenciar o zumbido que perturba seus ouvidos desde um acidente na infância. Excelente motorista, ele é o piloto de fuga oficial dos assaltos de Doc (Kevin Spacey), mas não vê a hora de deixar o cargo, principalmente depois que se vê apaixonado pela garçonete Debora (Lily James).', 0, NULL, NULL, NULL),
(NULL, 208, 'Forrest Gump - O Contador de Histórias', 'Forrest Gump', 'Estados Unidos', 'Comédia', 'Robert Zemeckis', '15380520605baccfdc7f7e5.jpg', 140, 1994, 'p0p5CQUjTxI ', 'Tom Hanks, Rebecca Williams, Sally Field, Michael Conner Humphreys', 'Quarenta anos da história dos Estados Unidos, vistos pelos olhos de Forrest Gump (Tom Hanks), um rapaz com QI abaixo da média e boas intenções. Por obra do acaso, ele consegue participar de momentos cruciais, como a Guerra do Vietnã e Watergate, mas continua pensando no seu amor de infância, Jenny Curran.', 0, NULL, NULL, NULL),
(NULL, 209, 'A Comédia Divina', 'A Comédia Divina', 'Brasil', 'Comédia', 'Toni Venturi', '15404671905bd1a9f6c5e00.jpg', 98, 2017, 'ilkcJobsqR8', NULL, 'Em crise, um programa jornalístico demite uma repórter e em seu lugar contrata Raquel (Mônica Iozzi), jornalista recém-formada, caso do âncora garanhão, Mateus (Dalton Vigh). Incomodada pela convivência com Lucas (Thiago Mendonça), um inconformado ex-namorado que trabalha na produção, ela vê sua carreira decolar graças a um furo: o Diabo (Murilo Rosa) acaba de abrir sua própria igreja na Terra.', 0, NULL, NULL, NULL),
(NULL, 210, 'Sierra Burgess É Uma Loser', 'Sierra Burgess Is a Loser', 'Estados Unidos', 'Comédia', 'Ian Samuels', '15404673495bd1aa958b01c.jpg', 105, 2018, 'QdzZTG7Pxa4', 'Shannon Purser, Kristine Froseth, RJ Cyler, Noah Centineo, Chrissy Metz, Lea Thompson, Alan Ruck, William Peltz, Loretta Devine, Alice Lee', 'Sierra (Shannon Purser) é uma adolescente inteligente, mas que não se encaixa exatamente nos padrões de beleza impostos no ensino médio. Quando um incidente de confusão de identidade resulta em um romance inexperado em sua vida, ela se vê precisando se juntar a garota mais popular da escola para poder ficar com o menino que gosta.', 0, NULL, NULL, NULL),
(NULL, 211, 'Grave', 'Raw', 'França', 'Terror', 'Julia Ducournau', '15404675985bd1ab8e7c657.jpg', 99, 2016, 'ViE8qDVPjQw', 'Garance Marillier, Ella Rumpf, Rabah Nait Oufella, Laurent Lucas', 'Justine (Garance Marillier) é uma jovem tímida e vegetariana, caloura na mesma faculdade de veterinária em que estuda sua irmã, Alexia (Ella Rumpf). Durante o trote, a menina é forçada a comer carne animal pela primeira vez e a ação provoca mudanças extremas em sua vida.', 0, NULL, NULL, NULL),
(NULL, 212, 'Sete Minutos Depois da Meia-Noite', 'A Monster Calls', 'Reino Unido', 'Fantasia', 'J.A. Bayona', '15404677585bd1ac2e1a488.jpg', 108, 2016, 'Ps4U8ReQgRI', 'Lewis MacDougall, Sigourney Weaver, Felicity Jones, Toby Kebbell', 'Conor é um garoto de 13 anos de idade, com muitos problemas na vida. Seu pai é muito ausente, a mãe sofre um um câncer em fase terminal, a avó é uma megera, e ele é maltratado na escola pelos colegas. No entanto, todas as noites Conor tem o mesmo sonho, com uma gigantesca árvore que decide contar histórias para ele, em troca de escutar as histórias do garoto. Embora as conversas com a árvore tenham consequências negativas na vida real, elas ajudam Conor a escapar das dificuldades através do mundo da fantasia.', 0, NULL, NULL, NULL),
(NULL, 213, 'Foi Apenas um Sonho', 'Revolutionary Road', 'Estados Unidos', 'Drama, Romance', 'Sam Mendes', '15404678915bd1acb3a30fd.jpg', 119, 2008, 'zq5S2vOLmM8', 'Kate Winslet, Leonardo DiCaprio, Christopher Fitzgerald, Jonathan Roumie', 'Anos 50. Frank (Leonardo DiCaprio) e April (Kate Winslet) formam um casal feliz. Eles sempre se consideraram especiais e prontos para levar uma vida seguindo ideais. Ao se mudarem para uma casa na Revolutionary Road eles ficam orgulhosos por declarar independência da inércia suburbana que os rodeava. Porém logo eles percebem que estão se tornando justamente aquilo que não queriam ser. Frank está em um trabalho insignificante e tem medo de tudo, enquanto que April é uma dona de casa infeliz. Decidida a mudar a situação, April propõe que comecem tudo de novo, deixando de lado o conforto da atual casa e recomeçando em Paris. Só que, para executar este plano, eles chegam aos seus extremos.', 0, NULL, NULL, NULL),
(NULL, 214, 'Ratatouille', 'Ratatouille', 'Estados Unidos', 'Animação', 'Brad Bird', '15404681075bd1ad8b4b532.jpg', 111, 2007, 'iryIGZlE5B4', 'Patton Oswalt, Ian Holm, Lou Romano, Brian Dennehy', 'Remy (Patton Oswalt) é um rato que sonha se tornar um grande chef. Só que sua família é contra a idéia, além do fato de que, por ser um rato, ele sempre é expulso das cozinhas que visita. Um dia, enquanto estava nos esgotos, ele fica bem embaixo do famoso restaurante de seu herói culinário, Auguste Gusteau (Brad Garrett). Ele decide visitar a cozinha do lugar e lá conhece Linguini (Lou Romano), um atrapalhado ajudante que não sabe cozinhar e precisa manter o emprego a qualquer custo. Remy e Linguini realizam uma parceria, em que Remy fica escondido sob o chapéu de Linguini e indica o que ele deve fazer ao cozinhar.', 0, NULL, NULL, NULL),
(NULL, 215, 'Rainha de Katwe', 'Queen of Katwe', 'Estados Unidos', 'Biografia', 'Mira Nair', '15404682735bd1ae3193d29.jpg', 124, 2016, 'LgBOmczxnTc', 'Madina Nalwanga, David Oyelowo, Lupita Nyong\'o, Martin Kabanza', 'Phiona Mutesi é uma jovem de Uganda que faz de tudo para alcançar o seu objetivo de se tornar uma das melhores jogadoras de xadrez do mundo. Órfã de pai e moradora de uma região bem pobre, Mutesi foi obrigada a largar a escola por falta de dinheiro, mas agora está decidida a enfrentar todos os obstáculos para tornar seu sonho realidade.', 0, NULL, NULL, NULL),
(NULL, 216, 'Thor: Ragnarok', 'Thor: Ragnarok', 'Estados Unidos', 'Ação', 'Taika Waititi', '15404686945bd1afd62a1c4.jpg', 130, 2017, 'q5h0gVEilz8', 'Chris Hemsworth, Tom Hiddleston, Cate Blanchett, Idris Elba', 'Thor (Chris Hemsworth) está preso do outro lado do universo. Ele precisa correr contra o tempo para voltar a Asgard e parar Ragnarok, a destruição de seu mundo, que está nas mãos da poderosa e implacável vilã Hela (Cate Blanchett).', 0, NULL, NULL, NULL),
(NULL, 217, 'Thelma & Louise', 'Thelma and Louise', 'França', 'Comédia dramática', 'Chris Mack', '15404688715bd1b087104cc.jpg', 129, 2015, 'bzzr0KpCLVk', 'Lora Dekova, Aida Loutfi', 'Louise Sawyer (Susan Sarandon) é uma garçonete quarentona e Thelma (Geena Davis) é uma jovem dona-de-casa. Cansadas da vida monótona que levam, as amigas resolvem deixar tudo para trás e pegar a estrada. Durante a viagem, elas se envolvem em um crime e decidem fugir para o México, mas acabam sendo perseguidas pela polícia americana.', 0, NULL, NULL, 1),
(NULL, 218, 'Janela Indiscreta', 'Rear Window', 'Estados Unidos', 'Suspense', 'Alfred Hitchcock', '15404689885bd1b0fcdad3d.jpg', 112, 1954, 'fOVcjz-1aJM', 'James Stewart, Grace Kelly, Wendell Corey, Thelma Ritter', 'Em Greenwich Village, Nova York, L.B. Jeffries (James Stewart), um fotógrafo profissional, está confinado em seu apartamento por ter quebrado a perna enquanto trabalhava. Como não tem muitas opções de lazer, vasculha a vida dos seus vizinhos com um binóculo, quando vê alguns acontecimentos que o fazem suspeitar que um assassinato foi cometido.', 0, NULL, NULL, NULL),
(NULL, 219, 'O Golpista do Ano', 'I Love You Phillip Morris', 'França', 'Comédia', 'Glenn Ficarra', '15404691075bd1b17358cfe.jpg', 98, 2009, 'JZAFj-_bP9U', 'Jim Carrey, Ewan McGregor, Leslie Mann, Rodrigo Santoro', 'Steven Russell (Jim Carrey) é um policial texano que decide assumir sua homossexualidade. Porém logo descobre que, para ser gay, é preciso ter muito dinheiro. Ele passa a realizar diversas trapaças e fraudes, de forma a manter seu alto padrão de vida. Ao ser preso, Steven é levado a uma penitenciária estadual. Lá conhece Phillip Morris (Ewan McGregor), seu companheiro de cela, por quem se apaixona. A partir de então Steven passa a fugir e ser preso diversas vezes, sempre agindo em nome de seu amor.', 0, NULL, NULL, NULL),
(NULL, 220, 'Sociedade dos Poetas Mortos', 'Dead Poets Society', 'Estados Unidos', 'Drama', 'Peter Weir', '15404693045bd1b23806e79.jpg', 128, 1989, 'bOukvR5ZydQ', 'Robin Williams, Robert Sean Leonard, Ethan Hawke, Josh Charles', 'Em 1959 na Welton Academy, uma tradicional escola preparatória, um ex-aluno (Robin Williams) se torna o novo professor de literatura, mas logo seus métodos de incentivar os alunos a pensarem por si mesmos cria um choque com a ortodoxa direção do colégio, principalmente quando ele fala aos seus alunos sobre a \"Sociedade dos Poetas Mortos\".', 0, NULL, NULL, NULL),
(NULL, 221, 'Una ', 'Una', 'Reino Unido', 'Drama', 'Benedict Andrews', '15404694245bd1b2b090171.jpg', 94, 2016, 'UgiN35SC-hM', 'Ruby Stokes, Rooney Mara, David Shields, Ben Mendelsohn', 'Ray (Ben Mendelsohn) e Una (Rooney Mara) já tiveram um complicado relacionamento quando ela tinha apenas 12 anos. Quinze anos depois eles se reencontram. Ray é confrontado com o passado quando Una chega sem avisar em seu escritório buscando respostas sobre o abuso que sofreu. Ray fez uma nova vida para ele, mas os dois vão precisar revisitar sua relação e escavar um inabalável amor danificado.', 0, NULL, NULL, NULL),
(NULL, 222, 'Vidas à Deriva', 'Adrift', 'Estados Unidos', 'Drama', 'Baltasar Kormákur', '15404695505bd1b32e47abf.jpg', 96, 2018, '4cf-ZK6yJ58', 'Shailene Woodley, Sam Claflin, Jeffrey Thomas, Elizabeth Hawthorne', 'Apaixonados, os noivos Tami Oldham (Shailene Woodley) e Richard Sharp (Sam Claflin) velejam em mar aberto quando são atingidos por uma terrível tempestade. Passada a tormenta, ela se vê sozinha na embarcação em ruínas e tenta encontrar uma maneira de salvar a própria vida e a do parceiro debilitado.', 0, NULL, NULL, NULL),
(NULL, 223, 'Praia do Futuro', 'Praia do Futuro', 'Brasil', 'Drama', 'Karim Aïnouz', '15404697085bd1b3cce99f8.jpg', 106, 2014, 'g7VNJdb2ZoA', NULL, 'Praia do Futuro, Ceará. Donato (Wagner Moura) trabalha como salva-vidas. Seu irmão caçula, Ayrton (Jesuita Barbosa), tem grande admiração por ele, devido à coragem demonstrada ao se atirar no mar para resgatar desconhecidos. Um deles é Konrad (Clemens Schick), um alemão de olhos azuis que muda por completo a vida de Donato após ser salvo por ele. É quando Ayrton, querendo reencontrar o irmão, parte em sua busca na fria Berlim.', 0, NULL, NULL, NULL),
(NULL, 224, 'Dope: Um Deslize Perigoso', 'Dope', 'Estados Unidos', 'Comédia', 'Rick Famuyiwa', '15404698115bd1b43384f27.jpg', 103, 2015, 'clbIQKalEME', 'ASAP Rocky, Blake Anderson, Bruce Beatty, De\'aundre Bonds', 'Malcolm Adecombi (Shameik Moore) é um nerd que vive em um bairro violento em Los Angeles e se desdobra entre provas finais, admissões acadêmicas, audições de clássicos do hip-hop e ensaios de sua banda de rock. Certa noite comparece a uma festa e, após uma confusão, volta para casa com a mochila cheia de drogas, o que o leva a arriscar novas maneiras de se dar bem.', 0, NULL, NULL, NULL),
(NULL, 225, 'Elis', 'Elis', 'Brasil', 'Biografia', 'Hugo Prata', '15404699055bd1b491bce22.jpg', 110, 2016, 'GbgVYW8pZmg', 'Andréia Horta, Gustavo Machado, Caco Ciocler, Zécarlos Machado', 'Cantora desde a infância, Elis Regina Carvalho Costa (Andreia Horta) entra na vida adulta deixando o Rio Grande do Sul para espalhar seu talento pelo Brasil a partir do Rio de Janeiro. Em rápida ascensão, ela logo conquista uma legião de fãs, entre eles o famoso compositor e produtor Ronaldo Bôscoli (Gustavo Machado), com quem acaba se casando. Estrela de TV, polêmica, intensa e briguenta, a \"Pimentinha\" não tarda a ser reconhecida como a maior voz do Brasil, em carreira marcada por altos e baixos.', 0, NULL, NULL, NULL),
(NULL, 226, 'Frank', 'Frank', 'Reino Unido', 'Comédia', 'Lenny Abrahamson', '15404701575bd1b58d4ba02.jpg', 95, 2014, 'CYdKf3hXTcI', 'Domhnall Gleeson, Moira Brooker, Paul Butterworth, Phil Kingston', 'John Burroughs (Domhnall Gleeson) sonha em ser tecladista e compositor de uma grande banda. Um dia, um acidente lhe fornece a oportunidade de tocar em um grupo, liderado por Frank (Michael Fassbender). John fica fascinado com este vocalista, ao mesmo tempo generoso e estranho, e marcado por uma peculiaridade: ele nunca retira a sua gigantesca cabeça artificial, nem mesmo para comer, tomar banho ou dormir. Logo, John, Frank e os outros membros do The Soronprfbs se isolam em uma cabana para experimentar novos sons, se conhecer e produzir o melhor álbum musical possível.', 0, NULL, NULL, NULL),
(NULL, 227, 'A Proposta', 'The Proposal', 'Estados Unidos', 'Comédia', 'Anne Fletcher', '15404703045bd1b6200e6d8.jpg', 108, 2009, 'hHXOiaRtnzk', 'Sandra Bullock, Ryan Reynolds, Mary Steenburgen, Craig T. Nelson', 'Margaret Tate (Sandra Bullock) é uma poderosa editora de livros, que se vê em apuros ao ser comunicada de sua deportação para o país-natal, o Canadá. Para evitar que isto ocorra ela declara estar noiva de Andrew Paxton (Ryan Reynolds), seu assistente. Perseguido por Margaret há anos, ele aceita participar da farsa mas impõe algumas condições.', 0, NULL, NULL, NULL),
(NULL, 228, 'O Banquete', 'O Banquete', 'Brasil', 'Drama', 'Daniela Thomas', '15404705125bd1b6f0ee7bd.jpg', 104, 2018, 'dAq8uflqZNU', 'Rodrigo Bolzan, Caco Ciocler, Georgette Fadel, Fabiana Gugli', 'Fim da década de 80, Brasil. Apesar de ter retornado à democracia, o país ainda vive uma época de extrema instabilidade política e incerteza geral. Em meio a este clima de desconfiança, uma jornalista descobre segredos podres sobre o presidente do país, que ameaçarão ainda mais o frágil equilíbrio da nação.', 0, NULL, NULL, NULL),
(NULL, 230, 'A Primeira Vez', 'The First Time', 'Estados Unidos', 'Comédia', 'Jonathan Kasdan', '15404709885bd1b8cc4a1c1.jpg', 95, 2012, 'VgIaUDlNztM&t=8s', 'Britt Robertson, Dylan O\'Brien, Craig Roberts, Joshua Malina', 'Dave (Dylan O\'Brien) é platonicamente apaixonado pela melhor amiga Jane (Victoria Justice). Já Aubrey (Britt Robertson) namora Ronny (James Frecheville), um músico que não a compreende. Em uma sexta à noite, os caminhos de Dave e Aubrey se entrelaçarão, e ao longo do fim de semana muitas descobertas serão feitas pelo casal.', 0, NULL, NULL, NULL),
(NULL, 231, 'Hereditário', 'Hereditary', 'Estados Unidos', 'Terror', 'Ari Aster', '15404711105bd1b946ee7d0.jpg', 127, 2018, 'aVqszEgRYsc', 'Alex Wolff, Gabriel Byrne, Toni Collette, Milly Shapiro', 'Após a morte da reclusa avó, a família Graham começa a desvendar algumas coisas. Mesmo após a partida da matriarca, ela permanece como se fosse um sombra sobre a família, especialmente sobre a solitária neta adolescente, Charlie, por quem ela sempre manteve uma fascinação não usual. Com um crescente terror tomando conta da casa, a família explora lugares mais escuros para escapar do infeliz destino que herdaram.', 0, NULL, NULL, NULL),
(NULL, 232, 'Grace de Mônaco', 'Grace of Monaco', 'França', 'Biografia', 'Olivier Dahan', '15404713335bd1ba25456bf.jpg', 103, 2014, 'nrG_KWGHFd4', 'Nicole Kidman, Tim Roth, Frank Langella, Paz Vega', 'O casamento de Grace Kelly (Nicole Kidman) e o príncipe Rainier III (Tim Roth) foi considerado um conto de fadas na vida real quando aconteceu, em 1956. Entretanto, cinco anos mais tarde e com dois filhos, a verdade é que Grace está insatisfeita com a vida no palácio e o distanciamento do marido. A chance de novamente sentir-se útil surge quando seu velho amigo, o diretor Alfred Hitchcock (Roger Ashton-Griffiths), a convida para retornar ao cinema como protagonista de seu próximo filme: \"Marnie - Confissões de uma Ladra\". O problema é que Rainier é terminantemente contra e, ainda por cima, está envolvido com uma ameaça vinda do presidente francês Charles de Gaule (André Penvern): caso Mônaco não pague impostos à França e acabe com o paraíso fiscal existente, o principado será invadido em s', 0, NULL, NULL, NULL),
(NULL, 233, 'Gauguin - Viagem ao Taiti ', 'Gauguin - Voyage de Tahit', 'França', 'Drama', 'Edouard Deluc', '15404715025bd1bace36998.jpg', 101, 2018, 'fCBsE2G5Kcc', NULL, '1891. O artista Paul Gauguin decide, por conta própria, se exilar no Taiti. Lá, ele espera reencontrar sua pintura livre, selvagem, longe dos códigos morais, políticos e estéticos da Europa civilizada. Mas, no local, acaba se afundando na selva, enfrentando a solidão, pobreza e a doença. E deve se reunir com Tehura, que se tornou sua esposa e o tema de suas maiores pinturas.', 0, NULL, NULL, NULL),
(NULL, 234, 'Divinas Divas', 'Divinas Divas', 'Brasil', 'Documentário', 'Leandra Leal', '15404716905bd1bb8a73765.jpg', 110, 2017, '0_fqrLzureo', NULL, 'Rogéria, Valéria, Jane Di Castro, Camille K, Fujika de Holliday, Eloína dos Leopardos, Marquesa e Brigitte de Búzios formaram, na década de 1970, o grupo que testemunhou o auge de uma Cinelândia repleta de cinemas e teatros. O documentário acompanha o reencontro das artistas para a a montagem de um espetáculo, trazendo para a cena as histórias e memórias de uma geração que revolucionou o comportamento sexual e desafiou a moral de uma época.', 0, NULL, NULL, NULL),
(NULL, 235, 'O Lobo de Wall Street', 'The Wolf of Wall Street', 'Estados Unidos', 'Biografia', 'Martin Scorsese', '15404727945bd1bfda504e7.jpg', 180, 2013, 'C0FSv6yMzls', 'Leonardo DiCaprio, Jonah Hill, Margot Robbie, Matthew McConaughey', 'Durante seis meses, Jordan Belfort (Leonardo DiCaprio) trabalhou duro em uma corretora de Wall Street, seguindo os ensinamentos de seu mentor Mark Hanna (Matthew McConaughey). Quando finalmente consegue ser contratado como corretor da firma, acontece o Black Monday, que faz com que as bolsas de vários países caiam repentinamente. Sem emprego e bastante ambicioso, ele acaba trabalhando para uma empresa de fundo de quintal que lida com papéis de baixo valor, que não estão na bolsa de valores. É lá que Belfort tem a ideia de montar uma empresa focada neste tipo de negócio, cujas vendas são de valores mais baixos mas, em compensação, o retorno para o corretor é bem mais vantajoso. Ao lado de Donnie (Jonah Hill) e outros amigos dos velhos tempos, ele cria a Stratton Oakmont, uma empresa que faz com que todos enriqueçam rapidamente e, também, levem uma vida dedicada ao prazer.', 0, NULL, NULL, NULL),
(NULL, 236, 'O Mínimo para Viver', 'To the Bone', 'Estados Unidos', 'Drama', 'Marti Noxon', '15404738975bd1c429d75ce.jpg', 107, 2017, 'QTLGDdMocwI', 'Rebekah Kennedy, Lily Collins, Dana L. Wilson, Ziah Colon', 'Uma jovem (Lily Collins) está lidando com um problema que afeta muitos jovens no mundo: a anorexia. Sem perspectivas de se livrar da doença e ter uma vida feliz e saudável, a moça passa os dias sem esperança. Porém, quando ela encontra um médico (Keanu Reeves) não convencional que a desafia a enfrentar sua condição e abraçar a vida, tudo pode mudar.', 0, NULL, NULL, NULL),
(NULL, 238, '10 Coisas que Eu Odeio em Você', '10 Things I Hate About You', 'Estados Unidos', 'Romance', 'Gil Junger', '15404741265bd1c50e6f1b0.jpg', 97, 1999, 'vH4aMfk6GLo', 'Heath Ledger, Julia Styles, Joseph Gordon-Levitt, Larisa Oleynik, David Krumholtz, Andrew Keegan, Larry Miller, Gabrielle Union, Allisson Janney', 'A situação está tensa na casa dos Stratford. Bianca (Larisa Oleynik) não vê a hora de arranjar um namorado, mas seu pai (Larry Miller) não permite que ela saia com garotos. Após muita insistência, o pai toma uma resolução: Bianca pode namorar, desde que sua irmã, Katharina (Julia Stiles), namore também. Só que Katharina é uma verdadeira megera, que não tem amigos na escola nem em lugar algum. Para resolver a questão, Cameron (Joseph Gordon-Levitt), apaixonado por Bianca, resolve contratar o misterioso Patrick Verona (Heath Ledger) para seduzir a futura cunhada.', 0, NULL, NULL, NULL),
(NULL, 239, '12 Anos de Escravidão', '12 Years a Slave', 'Estados Unidos', 'Drama', 'Steve McQueen', '15404742505bd1c58a94fbf.jpg', 134, 2013, 'a7c5ReE70tI', 'Chiwetel Ejiofor, Michael Fassbender, Lupita Nyong\'o, Brad Pitt, Benedict Cumberbatch, Sarah Paulson, Alfre Woodard, Paul Dano, Michael K. Williams', 'Solomon Northup (Chiwetel Ejiofor) é um escravo liberto, que vive em paz ao lado da esposa e filhos. Um dia, após aceitar um trabalho que o leva a outra cidade, ele é sequestrado e acorrentado. Vendido como se fosse um escravo, Solomon precisa superar humilhações físicas e emocionais para sobreviver. Ao longo de doze anos ele passa por dois senhores, Ford (Benedict Cumberbatch) e Edwin Epps (Michael Fassbender), que, cada um à sua maneira, exploram seus serviços.', 0, NULL, NULL, NULL),
(NULL, 240, '12 Horas para Sobreviver - O Ano da Eleição', 'The Purge: Election Year', 'Estados Unidos', 'Suspense', 'James DeMonaco', '15404743945bd1c61a13cbf.jpg', 108, 2016, 'jlkY_dpz7qQ', 'Frank Grillo, Elizabeth Mitchell, Mykelti Williamson, Joseph Julian Soria', 'O policial Barnes (Frank Grillo) agora é o principal responsável pela segurança da senadora Charlene Roan (Elizabeth Mitchell), que planeja acabar de uma vez por todas a noite de crime. Em plena época de eleições, ela é uma das melhores posicionadas nas pesquisas e nova inimiga número um dos criminosos, que se armam para eliminá-la de qualquer jeito.', 0, NULL, NULL, NULL),
(NULL, 241, '45 Anos', '45 Years', 'Reino Unido', 'Drama', 'Andrew Haigh', '15404745925bd1c6e0b4a61.png', 91, 2015, 'Nck9thDEfK0', 'Charlotte Rampling, Tom Courtenay, Geraldine James, Dolly Wells', 'Kate Mercer (Charlotte Rampling) está planejando a festa de comemoração dos 45 anos de casada. Porém, cinco dias antes do evento, o marido recebe uma carta: o corpo de seu primeiro amor foi encontrado congelado no meio dos Alpes Suíços. A estrutura emocional dele é seriamente abalada e Kate já não sabe se vai ter o que comemorar durante a festa.', 0, NULL, NULL, NULL),
(NULL, 242, 'Sombras da Vida', 'A Ghost Story', 'Estados Unidos', 'Drama', 'David Lowery', '15404747215bd1c7614794b.jpg', 92, 2017, 'ACKzdvWBCbA', 'Casey Affleck, Rooney Mara, McColm Cephas Jr., Kenneisha Thompson', 'Um homem recém-falecido (Casey Affleck) retorna como fantasma para sua casa no subúrbio com a intenção de consolar sua esposa (Rooney Mara). Em sua nova forma espectral, invisível para os mortais, ele percebe que não é afetado pelo tempo, sendo condenado a ser um mero espectador da vida que antes lhe pertencia, ao lado da mulher que amava. O fantasma inicia uma jornada pelas memórias e histórias, enfrentando perguntas eternas sobre a vida e a existência.', 0, NULL, NULL, NULL),
(NULL, 243, 'A Fuga das Galinhas', 'Chicken Run', 'Reino Unido', 'Animação', 'Peter Lord', '15404748445bd1c7dccaa9b.jpg', 84, 2000, 'aO_ao9cX_To', 'Phil Daniels, Lynn Ferguson, Mel Gibson, Tony Haygarth', 'A Sra. Tweedy (Miranda Richardson/Nádia Carvalho) é a dona de um galinheiro no interior da Inglaterra, onde a maior parte das aves vive uma vida curta e monótona, limitada a produzir ovos e terminar na panela. Mas quando Rocky (Mel Gibson/ Dário de Castro), um galo vindo dos Estados Unidos surge voando por cima da cerca da Granja, as coisas começam a mudar. Rocky se apaixona por Ginger (Julia Sawalha/Miriam Ficher), que sonha com uma vida melhor e já há algum tempo deseja fugir da granja. Juntos os dois arquitetam um plano para conseguir liberdade. No entanto, Rocky e Ginger logo se vêem correndo contra o tempo quando a Sra. Tweedy decide que é hora de mandar a granja inteira para a o forno.', 0, NULL, NULL, NULL),
(NULL, 244, 'Logan', 'Logan', 'Estados Unidos', 'Ação, Drama, Herói', 'James Mangold', '15404750405bd1c8a05d5ef.jpg', 137, 2017, 'KPND6SgkN7Q', '', 'Em 2029, Logan (Hugh Jackman) ganha a vida como chofer de limousine para cuidar do nonagenário Charles Xavier (Patrick Stewart). Debilitado fisicamente e esgotado emocionalmente, ele é procurado por Gabriela (Elizabeth Rodriguez), uma mexicana que precisa da ajuda do ex-X-Men para defender a pequena Laura Kinney / X-23 (Dafne Keen). Ao mesmo tempo em que se recusa a voltar à ativa, Logan é perseguido pelo mercenário Donald Pierce (Boyd Holbrook), interessado na menina.', 0, NULL, 1, NULL),
(NULL, 245, 'A Hospedeira', 'The Host', 'Estados Unidos', 'Ficção Científica', 'Andrew Niccol', '15404751365bd1c900b87af.jpg', 125, 2013, '1QpwqBH4GAE', 'Rachel Roberts, Shyaam Karra, Brent Wendell Williams, Jhil McEntyre', 'A fome e a violência foram erradicadas da Terra, bem como os problemas climáticos do planeta foram resolvidos. Estes feitos foram conquistados graças aos seres alienígenas conhecidos como almas, que ocupam corpos humanos como se fossem parasitas. Pregando uma sociedade baseada na paz, as almas perseguem os poucos humanos que ainda não foram dominados. Um deles é Melanie Stryder (Saoirse Ronan), que se sacrifica para que o irmão caçula, Jamie (Chandler Canterbury), possa escapar. Melanie passa a ser dominada por uma alma chamada Peregrina, que tem por missão vasculhar suas memórias para encontrar rastros de outros humanos. Entretanto, a consciência de Melanie ainda está viva dentro do corpo, o que faz com que Peregrina tenha que lidar com ela constantemente. Com o tempo, a alma fica cada vez mais fascinada com a vida e os sentimentos que Melanie tinha e passa a protegê-la de Buscadora (Diane Kruger), que deseja capturar seus amigos humanos o quanto antes. ', 0, NULL, NULL, NULL),
(NULL, 246, 'A Grande Aposta', 'The Big Short', 'Estados Unidos', 'Drama', 'Adam McKay', '15404753045bd1c9a8daaf8.jpg', 130, 2015, 'SLDImPR03BI', 'Ryan Gosling, Rudy Eisenzopf, Casey Groves, Charlie Talbert', 'Michael Burry (Christian Bale) é o dono de uma empresa de médio porte, que decide investir muito dinheiro do fundo que coordena ao apostar que o sistema imobiliário nos Estados Unidos irá quebrar em breve. Tal decisão gera complicações junto aos investidores, já que nunca antes alguém havia apostado contra o sistema e levado vantagem. Ao saber destes investimentos, o corretor Jared Vennett (Ryan Gosling) percebe a oportunidade e passa a oferecê-la a seus clientes. Um deles é Mark Baum (Steve Carell), o dono de uma corretora que enfrenta problemas pessoais desde que seu irmão se suicidou. Paralelamente, dois iniciantes na Bolsa de Valores percebem que podem ganhar muito dinheiro ao apostar na crise imobiliária e, para tanto, pedem ajuda a um guru de Wall Street, Ben Rickert (Brad Pitt), que vive recluso.', 0, NULL, NULL, NULL),
(NULL, 247, 'A Lista de Honra', 'The Honor List', 'Estados Unidos', 'Drama', 'Elissa Down', '15404754445bd1ca3433616.jpg', 103, 2018, 'jeIl2zHsOY8', 'Meghan Rienks, Sasha Pieterse, Karrueche Tran, Arden Cho', 'Quatro amigas jogam uma capsula do tempo em um lago, com uma lista de desejos do que querem fazer antes de se formar, mas elas acabam se afastando antes disso. Até que uma tragédia acontece, as fazendo se reunir para achar a capsula do tempo e realizar todos os desejos da lista.', 0, NULL, NULL, NULL),
(NULL, 248, 'A Origem', 'Inception', 'Estados Unidos', 'Ficção Científica', 'Christopher Nolan', '15404755565bd1caa4a0da7.jpg', 148, 2010, 'HiixbtN-O24', 'Leonardo DiCaprio, Joseph Gordon-Levitt, Ellen Page, Tom Hardy', 'Em um mundo onde é possível entrar na mente humana, Cobb (Leonardo DiCaprio) está entre os melhores na arte de roubar segredos valiosos do inconsciente, durante o estado de sono. Além disto ele é um fugitivo, pois está impedido de retornar aos Estados Unidos devido à morte de Mal (Marion Cotillard). Desesperado para rever seus filhos, Cobb aceita a ousada missão proposta por Saito (Ken Watanabe), um empresário japonês: entrar na mente de Richard Fischer (Cillian Murphy), o herdeiro de um império econômico, e plantar a ideia de desmembrá-lo. Para realizar este feito ele conta com a ajuda do parceiro Arthur (Joseph Gordon-Levitt), a inexperiente arquiteta de sonhos Ariadne (Ellen Page) e Eames (Tom Hardy), que consegue se disfarçar de forma precisa no mundo dos sonhos.', 0, NULL, NULL, NULL),
(NULL, 249, 'A Torre Negra', 'The Dark Tower', 'Estados Unidos', 'Fantasia', 'Nikolaj Arcel', '15404757265bd1cb4e88c6b.jpg', 95, 2017, 'E0fpZ8S1eWQ', 'Matthew McConaughey, Idris Elba, Tom Taylor, Dennis Haysbert', 'Um pistoleiro chamado Roland Deschain (Idris Elba) percorre o mundo em busca da famosa Torre Negra, prédio mágico que está prestes a desaparecer. Essa busca envolve uma intensa perseguição ao poderoso Homem de Preto (Matthew McConaughey), passagens entre tempos diferentes, encontros intensos e confusões entre o real e o imaginário. Baseado na obra literária homônima de Stephen King.', 0, NULL, NULL, NULL),
(NULL, 250, 'A Vida É Bela', 'La vita e bella', 'Itália', 'Drama', 'Roberto Benigni', '15404758735bd1cbe1ca2c1.jpg', 116, 1997, '8beVLRzEqD0', NULL, 'Durante a Segunda Guerra Mundial na Itália, o judeu Guido (Roberto Benigni) e seu filho Giosué são levados para um campo de concentração nazista. Afastado da mulher, ele tem que usar sua imaginação para fazer o menino acreditar que estão participando de uma grande brincadeira, com o intuito de protegê-lo do terror e da violência que os cercam.', 0, NULL, NULL, NULL),
(NULL, 251, 'O Primeiro Homem', 'First Man', 'Estados Unidos', 'Biografia, Drama', 'Damien Chazelle', '15481146555c465adf1b327.jpg', 141, 2018, 'F2z2w0aZ_9o', 'Ryan Gosling, Claire Foy, Jason Clarke, Kyle Chandler', 'A vida do astronauta norte-americano Neil Armstrong (Ryan Gosling) e sua jornada para se tornar o primeiro homem a andar na Lua. Os sacrifícios e custos de Neil e toda uma nação durante uma das mais perigosas missões na história das viagens espaciais.', 0, NULL, NULL, NULL),
(NULL, 252, 'Bohemian Rhapsody', 'Bohemian Rhapsody', 'Estados Unidos', 'Biografia', 'Bryan Singer', '15408154635bd6fa672fa86.jpg', 135, 2018, 'GryRsVhOvxo', 'Rami Malek, Lucy Boynton, Gwilym Lee, Ben Hardy', 'Freddie Mercury (Rami Malek) e seus companheiros, Brian May, Roger Taylor e John Deacon mudam o mundo da mÃºsica para sempre ao formar a banda Queen durante a dÃ©cada de 1970. PorÃ©m, quando o estilo de vida extravagante de Mercury comeÃ§a a sair do controle, a banda tem que enfrentar o desafio de conciliar a fama e o sucesso com suas vidas pessoais cada vez mais complicadas.', 0, NULL, NULL, NULL),
(NULL, 253, 'Halloween', 'Halloween', 'Estados Unidos', 'Terror', 'David Gordon Green', '15408163335bd6fdcd64d01.jpg', 109, 2018, 'o7KMfkiZYaQ', 'Jamie Lee Curtis, Judy Greer, Andi Matichak, James Jude Courtney', 'Quatro décadas depois de ter escapado do ataque de Michael Myers em uma noite de Halloween, Laurie Strode (Jamie Lee Curtis) terá que confrontar o assassino mascarado pela última vez. Ela foi perseguida pela memória de ter sua vida por um triz, mas dessa vez, quando Myers retorna para a cidade de Haddonfield, ela está preparada.', 0, NULL, NULL, NULL),
(NULL, 255, 'Nasce Uma Estrela', 'A Star Is Born', 'Estados Unidos', 'Drama', 'Bradley Cooper', '15480091545c44bec2835c7.jpg', 136, 2018, 'jF2nWaWqVaQ', 'Lady Gaga, Bradley Cooper, Sam Elliott, Andrew Dice Clay', 'Jackson Maine (Bradley Cooper) é um cantor no auge da fama. Um dia, após deixar uma apresentação, ele para em um bar para beber algo. É quando conhece Ally (Lady Gaga), uma insegura cantora que ganha a vida trabalhando em um restaurante. Jackson se encanta pela mulher e seu talento, decidindo acolhê-la debaixo de suas asas. Ao mesmo tempo em que Ally ascende ao estrelato, Jackson vive uma crise pessoal e profissional devido aos problemas com o Álcool.', 0, NULL, NULL, NULL),
(NULL, 256, 'A Árvore da Vida', 'The Tree of Life', 'Estados Unidos', 'Drama', 'Terrence Malick', '15408356035bd749138b801.jpg', 139, 2011, 'PlxZOOEHK4o', 'Brad Pitt, Sean Penn, Jessica Chastain, Hunter McCracken', 'Os O\'Brien (Brad Pitt e Jessica Chastain) tiveram três filhos, criados com grande rigidez pelo pai. O mais velho deles, Jack (Sean Penn), sempre teve atritos com o pai, em parte por reconhecer em si mesmo um pouco dele. Além disto, já adulto, Jack enfrenta um forte sentimento de culpa devido à morte de seu irmão.', 0, NULL, NULL, NULL),
(NULL, 257, 'A Bela e a Fera', 'Beauty and the Beast', 'Estados Unidos', 'Fantasia', 'Bill Condon', '15408357435bd7499f10bd0.jpg', 129, 2017, 'yzHuQPgO3Gs', 'Emma Watson, Dan Stevens, Luke Evans, Josh Gad', 'Moradora de uma pequena aldeia francesa, Bela (Emma Watson) tem o pai capturado pela Fera (Dan Stevens) e decide entregar sua vida ao estranho ser em troca da liberdade dele. No castelo, ela conhece objetos mágicos e descobre que a Fera é, na verdade, um príncipe que precisa de amor para voltar à forma humana.', 0, NULL, NULL, NULL),
(NULL, 259, 'Alfa', 'Alpha', 'Estados Unidos', 'Aventura', 'Albert Hughes', '15408359895bd74a9502fa5.jpg', 96, 2018, 'GDqNF_PUkaQ', 'Kodi Smit-McPhee, Jóhannes Haukur Jóhannesson, Marcin Kowalczyk, Jens Hultén', 'Após cair de um penhasco e se perder do seu grupo, o jovem Keda (Kodi Smit-McPhee) precisa sobreviver em meio a paisagens selvagens e encontrar o caminho de casa. Atacado por uma matilha, ele consegue ferir um dos lobos, mas decide não matar o animal. O jovem cuida dele e os dois começam uma relação de amizade.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 260, 'Amnésia', 'Memento', 'Estados Unidos', 'Suspense', 'Christopher Nolan', '15408361105bd74b0e1996c.jpg', 113, 2000, 'sHRiMXd5fos', 'Guy Pearce, Carrie-Anne Moss, Joe Pantoliano, Mark Boone Junior', 'Um ladrão ataca um casal, terminando por matar a mulher e deixando o homem à beira da morte. Porém, ele sobrevive e a partir de então passa a sofrer de uma doença que o impede de gravar na memória fatos recentes, o que faz com que ele esqueça por completo algo que acontece poucos instantes antes. A partir de então ele parte em uma jornada pessoal a fim de descobrir o assassino de sua mulher para poder vingá-la.', 0, NULL, NULL, NULL),
(NULL, 261, 'Ana e Vitória ', 'Ana e Vitória', 'Brasil', 'Comédia', 'Matheus Souza', '15408375205bd75090d312e.jpg', 105, 2018, 'fGQtuyUF8II', 'Ana Caetano, Vitória Falcão, Victor Lamoglia, Thati Lopes, Erika Mader, Clarissa Müller', 'Rio de Janeiro. Ana (Ana Caetano) e Vitória (Vitória Falcão) já haviam até mesmo estudado juntas, mas apenas se aproximam de fato em uma festa realizada muito longe de sua cidade natal, a pequena Araguaína, no Tocantins. Após se apresentar na festa, Ana fica impressionanda com a informal cantoria de Vitória, em uma rodinha de violão. Logo surge a ideia de gravarem algo juntos, que rapidamente explode na internet e chama a atenção do produtor Felipe Simas (Bruce Gomlevsky). A fama repentina as traz de volta ao Rio de Janeiro, para um show transmitido pela internet e a produção de seu primeiro CD.', 0, NULL, NULL, NULL),
(NULL, 262, 'Assassinato no Expresso do Oriente', 'Murder on the Orient Express', 'Estados Unidos', 'Suspense', 'Kenneth Branagh', '15408376455bd7510de96a2.jpg', 114, 2017, '1LqXLJEq4sw', 'Paapa Essiedu, Yassine Zeroual, Asan N\'Jie, Michael Rouse', 'O detetive Hercule Poirot (Kenneth Branagh) embarca de última hora no trem Expresso do Oriente, graças à amizade que possui com Bouc (Tom Bateman), que coordena a viagem. Já a bordo, ele conhece os demais passageiros e resiste à insistente aproximação de Edward Ratchett (Johnny Depp), que deseja contratá-lo para ser seu segurança particular. Na noite seguinte, Ratchett é morto em seu vagão. Com a viagem momentaneamente interrompida devido a uma nevasca que fez com que o trem descarrilhasse, Bouc convence Poirot para que use suas habilidades dedutivas de forma a desvendar o crime cometido.', 0, NULL, NULL, NULL),
(NULL, 263, 'Clube da Luta', 'Fight Club', 'Estados Unidos', 'Drama', 'David Fincher', '15408377395bd7516bdde77.jpg', 139, 1999, 'Fs0-4NLSO2Y', 'Edward Norton, Brad Pitt, Helena Bonham Carter, Zach Grenier, Jared Leto, Meat Loaf', 'Jack (Edward Norton) é um executivo jovem, trabalha como investigador de seguros, mora confortavelmente, mas ele está ficando cada vez mais insatisfeito com sua vida medíocre. Para piorar ele está enfrentando uma terrível crise de insônia, até que encontra uma cura inusitada para o sua falta de sono ao frequentar grupos de auto-ajuda. Nesses encontros ele passa a conviver com pessoas problemáticas como a viciada Marla Singer (Helena Bonham Carter) e a conhecer estranhos como Tyler Durden (Brad Pitt). Misterioso e cheio de ideias, Tyler apresenta para Jack um grupo secreto que se encontra para extravasar suas angústias e tensões através de violentos combates corporais.', 0, NULL, NULL, NULL),
(NULL, 264, 'Clube dos Cinco ', 'The Breakfast Club', 'Estados Unidos', 'Comédia, Coming of Age', 'John Hughes', '15408378455bd751d5dbb6d.jpg', 97, 1985, 'EmqkaxOw6_o', 'Molly Ringwald, Judd Nelson, Ally Sheedy, Anthony Michael Hall, Emilio Estevez, John Kapelos', 'Em virtude de terem cometido pequenos delitos, cinco adolescentes são confinados no colégio em um sábado, com a tarefa de escrever uma redação de mil palavras sobre o que pensam de si mesmos. Apesar de serem pessoas completamente diferentes, enquanto o dia transcorre eles passam a aceitar uns aos outros, fazem várias confissões e tornam-se amigos.', 0, NULL, NULL, NULL),
(NULL, 265, 'De Volta para casa', 'Home Again', 'Estados Unidos', 'Comédia', 'Hallie Meyers-Shyer', '15408379475bd7523ba94ed.jpg', 97, 2017, 'sGGkCD8ENHM', 'Reese Witherspoon, Michael Sheen, Candice Bergen, Pico Alexander', 'Recém-separada do marido, Alice Kinney (Reese Witherspoon) decide recomeçar a sua via se mudando para sua cidade natal, Los Angeles, com as duas filhas. Durante uma comemoração do seu aniversário de 40 anos, ela conhece três cineastas que precisam de um lugar para morar e acaba deixando os rapazes permanecerem em seu quarto de hóspede temporariamente, mas o acordo gera situações inesperadas.', 0, NULL, NULL, NULL),
(NULL, 266, 'Edward Mãos de Tesoura', 'Edward Scissorhands', 'Estados Unidos', 'Fantasia', 'Tim Burton', '15408380255bd7528943ec0.jpg', 105, 1990, '__dB7t0853U', 'Johnny Depp, Winona Ryder, Dianne Wiest, Anthony Michael Hall', 'Peg Boggs (Dianne Wiest) é uma vendedora da Avon que acidentalmente descobre Edward (Johnny Depp), jovem que mora sozinho em um castelo no topo de uma montanha, criado por um inventor (Vincent Price) que morreu antes de dar mãos ao estranho ser, que possui apenas enormes lâminas no lugar delas. Isto o impede de poder se aproximar dos humanos, a não ser para criar revolucionários cortes de cabelos, mas ele dá vazão à sua solidão interior ao podar a vegetação em forma de figuras ou esculpir lindas imagens no gelo. No entanto, Edward é vítima da sua inocência e, se é amado por uns, é perseguido e usado por outros.', 0, NULL, NULL, NULL),
(NULL, 267, 'Enrolados', 'Tangled', 'Estados Unidos', 'Animação', ' Byron Howard', '15408381605bd75310e741b.jpg', 100, 2010, '5yfbBP9LNHs', 'Mandy Moore, Zachary Levi, Donna Murphy, Ron Perlman', 'Flynn Ryder (Zachary Levi/Luciano Huck) é o bandido mais procurado e sedutor do reino. Um dia, em plena fuga, ele se esconde em uma torre. Lá conhece Rapunzel (Mandy Moore), uma jovem prestes a completar 18 anos que tem um enorme cabelo dourado, de 21 metros de comprimento. Rapunzel deseja deixar seu confinamento na torre para ver as luzes que sempre surgem no dia de seu aniversário. Para tanto, faz um acordo com Flynn. Ele a ajuda a fugir e ela lhe devolve a valiosa tiara que tinha roubado. Só que a mamãe Gothel (Donna Murphy), que manteve Rapunzel na torre durante toda a sua vida, não quer que ela deixe o local de jeito nenhum.', 0, NULL, NULL, NULL),
(NULL, 268, 'Operação Red Sparrow', 'Red Sparrow', 'Estados Unidos', 'Suspense', 'Francis Lawrence', '15408383785bd753ea97873.jpg', 140, 2018, 'b2CRirgAqf8', 'Jennifer Lawrence, Joel Edgerton, Matthias Schoenaerts, Charlotte Rampling', 'Outrora talentosa bailarina, Dominika Egorova (Jennifer Lawrence) encontra-se em maus bocados quando é convencida a se tornar uma Sparrow, ou seja, uma sedudora treinada na melhor escola de espionagem russa. Após passar pelo árduo processo de aprendizagem, ela se torna a mais talentosa espiã do país e precisa lidar com o agente da CIA Nathaniel Nash (Joel Edgerton). Os dois, no entanto, acabam desenvolvendo uma paixão proibida que ameaça não só suas vidas, mas também as de outras pessoas.', 0, NULL, NULL, NULL),
(NULL, 269, 'O Abutre', 'Nightcrawler', 'Estados Unidos', 'Suspense, Drama, Neo Noir', 'Dan Gilroy', '15408384685bd75444d1120.jpg', 117, 2014, 'GSBjOblQCIc', 'Jake Gyllenhaal, Michael Papajohn, Marco Rodríguez, Bill Paxton', 'Enfrentando dificuldades para conseguir um emprego formal, o jovem Louis Bloom (Jake Gyllenhaal) decide entrar no agitado submundo do jornalismo criminal independente de Los Angeles. A fórmula é correr atrás de crimes e acidentes chocantes, registrar tudo e vender a história para veículos interessados.', 0, NULL, NULL, NULL),
(NULL, 270, 'Nerve - Um Jogo Sem Regras', 'Nerve', 'Estados Unidos', 'Ação', 'Ariel Schulman', '15408387575bd755654a9f2.jpg', 96, 2016, 'NGKDZKqtoKw', 'Emma Roberts, Dave Franco, Emily Meade, Miles Heizer, Machine Gun Kelly, Juliette Lewis, Kimiko Glenn, Samira Wiley, Brian Marc', 'A tímida Vee DeMarco (Emma Roberts) é uma garota comum, prestes a sair do ensino médio e sonhando em ir para a faculdade. Após uma discussão com sua até então amiga Sydney (Emily Meade), ela resolve provar que tem atitude e decide se inscrever no Nerve, um jogo online onde as pessoas precisam executar tarefas ordenadas pelos próprios participantes. O Nerve é dividido entre observadores e jogadores, sendo que os primeiros decidem as tarefas a serem realizadas e os demais as executam (ou não). Logo em seu primeiro desafio Vee conhece Ian (Dave Franco), um jogador de passado obscuro. Juntos, eles logo caem nas graças dos observadores, que passam a enviar cada vez mais tarefas para o casal em potencial.', 0, NULL, NULL, NULL),
(NULL, 271, 'Mulher-Maravilha', 'Wonder Woman', 'Estados Unidos', 'Ação', 'Patty Jenkins', '15408388705bd755d62a4ee.jpg', 141, 2017, 'Eg8qFkwUmOw', 'Gal Gadot, Chris Pine, Connie Nielsen, Robin Wright', 'Treinada desde cedo para ser uma guerreira imbatível, Diana Prince (Gal Gadot) nunca saiu da paradisíaca ilha em que é reconhecida como princesa das Amazonas. Quando o piloto Steve Trevor (Chris Pine) se acidenta e cai numa praia do local, ela descobre que uma guerra sem precedentes está se espalhando pelo mundo e decide deixar seu lar certa de que pode parar o conflito. Lutando para acabar com todas as lutas, Diana percebe o alcance de seus poderes e sua verdadeira missão na Terra.', 0, NULL, NULL, NULL),
(NULL, 272, 'Mama', 'Mamá', 'Espanha', 'Terror', 'Andy Muschietti', '15408389845bd7564846bec.jpg', 100, 2008, 'q_ulcuPJNWk', 'Victoria Harris, Berta Ros, Irma Monroig', 'Quando o pai de Victoria e Lilly mata a mãe das garotas, as crianças fogem assustadas para uma floresta. Durante cinco anos, ninguém tem notícia do paradeiro delas, até o dia em que elas reaparecerem, sem explicarem como sobreviveram sozinhas. Os tios das duas, Lucas (Nikolaj Coster-Waldau) e Annabel (Jessica Chastain) adotam Victoria e Lilly e tentam dar uma vida tranquila às duas, mas logo eles percebem que existe algo errado. As duas conversam frequentemente com uma entidade invisível, que chamam de \"Mama\". Lucas e Annabel não sabem se acreditam nas meninas, ou se devem culpá-las pelos estranhos acontecimentos na casa.', 0, NULL, NULL, NULL),
(NULL, 273, 'Little Boy - Além do Impossível ', 'Little Boy', 'Estados Unidos', 'Drama', 'Alejandro Monteverde', '15408390825bd756aac672b.jpg', 106, 2015, 'hok_xMTaPcQ', 'Jakob Salvati, Emily Watson, David Henrie, Michael Rapaport', 'O\'Hare, Califórnia. O pequeno Pepper (Jakob Salvati) tem uma forte ligação com o pai, James Busbee (Michael Rapaport), com quem vive aventuras fantasiosas. Quando seu irmão London (David Henrie) é convocado para lutar na Segunda Guerra Mundial, James se oferece para ir no lugar dele. A situação deixa Pepper desolado, sendo que ele ainda precisa lidar com as constantes provocações dos demais garotos por ser pequeno demais - daí o apelido jocoso Little Boy. Disposto a trazer o pai de volta da guerra, Pepper resolve seguir uma lista de boas ações entregue pelo padre Oliver (Tom Wilkinson).', 0, NULL, NULL, NULL),
(NULL, 274, 'Beleza Americana ', 'American Beauty', 'Estados Unidos', 'Drama', 'Sam Mendes', '15408391735bd7570576fd2.jpg', 122, 1999, 'xObt077FdMM', 'Kevin Spacey, Annette Bening, Thora Birch, Wes Bentley', 'Lester Burham (Kevin Spacey) não aguenta mais o emprego e se sente impotente perante sua vida. Casado com Carolyn (Annette Bening) e pai da \"aborrecente\" Jane (Tora Birch), o melhor momento de seu dia quando se masturba no chuveiro. Até que conhece Angela Hayes (Mena Suvari), amiga de Jane. Encantado com sua beleza e disposto a dar a volta por cima, Lester pede demissão e começa a reconstruir sua vida, com a ajuda de seu vizinho Ricky (Wes Bentley).', 0, NULL, NULL, NULL),
(NULL, 275, 'Abrindo o Armário', 'Abrindo o Armário', 'Brasil', 'Documentário', 'Dario Menezes', '15408392635bd7575fb85fb.jpg', 87, 2016, '2AT4Ev2rKxg', 'N/A', 'O documentário entrevista dezenas de homens gays e mulheres transexuais para conhecer a experiência do indivíduo LGBT, tanto nos centros quanto na periferia, tanto nos dias de hoje quanto décadas atrás, durante a ditadura militar. Figuras icônicas como o escritor João Silvério Trevisan, as artistas Linn da Quebrada e Jup do Bairro e o gamer Gabriel Kami compartilham suas experiências pessoais de autoaceitação e preconceito.', 0, NULL, NULL, NULL),
(NULL, 276, 'Atômica ', 'Atomic Blonde', 'Estados Unidos', 'Ação', 'David Leitch', '15408393945bd757e2f1dca.jpg', 115, 2017, 'Z6JGn3Zg27U', 'Charlize Theron, James McAvoy, Eddie Marsan, John Goodman', 'Lorraine Broughton (Charlize Theron), uma agente disfarçada do MI6, é enviada para Berlim durante a Guerra Fria para investigar o assassinato de um oficial e recuperar uma lista perdida de agentes duplos. Ao lado de David Percival (James McAvoy), chefe da localidade, a assassina brutal usará todas as suas habilidades nesse confronto de espiões.', 0, NULL, NULL, NULL),
(NULL, 277, 'Com Amor, Van Gogh', 'Loving Vincent', 'Reino Unido', 'Animação', 'Dorota Kobiela', '15408395475bd7587ba5429.jpg', 94, 2017, '3tslxWf9t5w', 'Douglas Booth, Josh Burdett, Holly Earl, Robin Hodges', 'Um ano após o suicídio de Vincent Van Gogh, Armand Roulin (Douglas Booth) encontra uma carta por ele enviada ao irmão Theo, que jamais chegou ao seu destino. Após conversar com o pai, carteiro que era amigo pessoal de Van Gogh, Armand é incentivado a entregar ele mesmo a correspondência. Desta forma, ele parte para a cidade francesa de Arles na esperança de encontrar algum contato com a família do pintor falecido. Lá, inicia uma investigação junto às pessoas que conheceram Van Gogh, no intuito de decifrar se ele realmente se matou.', 0, NULL, NULL, NULL),
(NULL, 278, 'Como Eu Era Antes de Você', 'Me Before You', 'Reino Unido', 'Romance', 'Thea Sharrock', '15408396665bd758f2d023e.jpg', 106, 2016, 'PnqUs3xiAVI', 'Sam Claflin, Vanessa Kirby, Emilia Clarke, Eileen Dunwoodie', 'Rico e bem sucedido, Will (Sam Claflin) leva uma vida repleta de conquistas, viagens e esportes radicais até ser atingido por uma moto, ao atravessar a rua em um dia chuvoso. O acidente o torna tetraplégico, obrigando-o a permanecer em uma cadeira de rodas. A situação o torna depressivo e extremamente cínico, para a preocupação de seus pais (Janet McTeer e Charles Dance). É neste contexto que Louisa Clark (Emilia Clarke) é contratada para cuidar de Will. De origem modesta, com dificuldades financeiras e sem grandes aspirações na vida, ela faz o possível para melhorar o estado de espírito de Will e, aos poucos, acaba se envolvendo com ele.', 0, NULL, NULL, NULL),
(NULL, 279, 'Benzinho', 'Benzinho', 'Brasil', 'Drama', 'Gustavo Pizzi', '15408397615bd7595140c41.jpg', 95, 2017, 'uOjeD6K469Y', 'Karine Teles, Otávio Muller', 'O primogênito de uma família de classe média é convidado para jogar handebol na Alemanha e lança sua mãe (Karine Teles) em uma espiral de sentimentos pois, além de ajudar a problemática irmã (Adriana Esteves), lidar com as instabilidades do marido (Otávio Müller) e se desdobrar para dar atenção ao seus outros filhos, ela terá de enfrentar sua partida antes de estar preparada para tal.', 0, NULL, NULL, NULL),
(NULL, 280, 'Branca de Neve e o Caçador', 'Snow White and the Huntsman', 'Estados Unidos', 'Fantasia', 'Rupert Sanders', '15408398445bd759a4d43f8.jpg', 127, 2012, 'zeaFgcEKa04', 'Kristen Stewart, Chris Hemsworth, Charlize Theron, Sam Claflin', 'Um rei viúvo caiu de amores por Ravenna (Charlize Theron) sem saber de seus terríveis planos de conquista e acaba morrendo, deixando para ela todo o seu reino. Para piorar a situação, a filha dele foi jogada em uma masmorra e lá ficou até se tornar uma bela jovem. Obcecada pela beleza e pela juventude, a Rainha não se cansa de perguntar ao seu oráculo para saber de existe alguém mais bela do que ela, até o dia em que a resposta não a agradou. Felizmente, Branca de Neve (Kristen Stewart) consegue fugir sem que seu coração seja arrancado e Ravenna se torne poderosa para sempre. Mas a malvada não desiste fácil e além da ajuda do irmão, um fiel escudeiro, ela contrata Eric (Chris Hemsworth), um exímio caçador para trazer sua presa de volta. Só que ele acaba descobrindo que a missão era um gran', 0, NULL, NULL, NULL),
(NULL, 281, 'Bastardos Inglórios', 'Inglourious Basterds', 'Estados Unidos', 'Guerra', 'Quentin Tarantino ', '15408399285bd759f8e1bd2.jpg', 153, 2009, 'w1O5LThfp7w', 'Brad Pitt, Mélanie Laurent, Christoph Waltz, Eli Roth', 'Durante a Segunda Guerra Mundial, na França, um grupo de judeus americanos conhecidos como Bastardos espalha o terror entre o terceiro Reich. Ao mesmo tempo, Shosanna, uma judia que fugiu dos nazistas, planeja vingança quando um evento em seu cinema reunirá os líderes do partido.', 0, NULL, NULL, NULL),
(NULL, 283, 'Aniquilação', 'Annihilation', 'Estados Unidos', 'Suspense', 'Alex Garland', '15409026775bd84f155fece.jpg', 115, 2018, 'gSMCCHYGpf8', 'Natalie Portman, Benedict Wong, Sonoya Mizuno, David Gyasi', 'Uma bióloga (Natalie Portman) se junta a uma expediçãÃ£o secreta com outras trÃªs mulheres em uma regiÃ£o conhecida como Ãrea X, um local isolado da civilizaÃ§Ã£o onde as leis da natureza nÃ£o se aplicam. LÃ¡, ela precisa lidar com uma misteriosa contaminaÃ§Ã£o, um animal mortal e ainda procura por pistas de colegas que desaparecem, incluindo seu marido (Oscar Isaac).', 0, NULL, NULL, NULL),
(NULL, 285, 'O Profissional ', 'Léon: The Professional', 'França', 'Crime, Drama, Neo Noir', 'Luc Besson', '15415533255be23cadb3e66.jpg', 110, 1994, 'HPIZKvK5-jM', 'Jean Reno, Gary Oldman, Natalie Portman, Danny Aiello', 'Em Nova York o assassino profissional Leon (Jean Reno) não vê sentido na vida. Quando a família vizinha é morta por policiais envolvidos com drogas ele decide proteger Mathilda (Natalie Portman), uma menina de 12 anos que é a única sobrevivente da família. Ela deseja se tornar uma assassina, para poder vingar a morte do seu irmão de 4 anos. Enquanto ela cuida da casa e ensina o pistoleiro a ler e a escrever, ele lhe ensina o básico de como manejar uma arma.', 0, NULL, NULL, NULL),
(NULL, 286, 'Star Wars: Episódio VIII - Os Últimos Jedi', 'Star Wars: The Last Jedi', 'Estados Unidos', 'Aventura', 'Rian Johnson', '15415832925be2b1bc4c8d3.jpg', 152, 2017, '4JB3tHn2S5A', 'Mark Hamill, Carrie Fisher, Adam Driver, Daisy Ridley', 'Após encontrar o mítico e recluso Luke Skywalker (Mark Hammil) em uma ilha isolada, a jovem Rey (Daisy Ridley) busca entender o balanço da Força a partir dos ensinamentos do mestre jedi. Paralelamente, o Primeiro Império de Kylo Ren (Adam Driver) se reorganiza para enfrentar a Aliança Rebelde.', 0, NULL, NULL, NULL),
(NULL, 288, 'Wall-E', 'WALL·E', 'Estados Unidos', 'Animação', 'Andrew Stanton', '15415835695be2b2d119d93.jpg', 98, 2008, 'DgC6HGwxvLM', 'Ben Burtt, Elissa Knight, Jeff Garlin, Fred Willard', 'Após entulhar a Terra de lixo e poluir a atmosfera com gases tóxicos, a humanidade deixou o planeta e passou a viver em uma gigantesca nave. O plano era que o retiro durasse alguns poucos anos, com robôs sendo deixados para limpar o planeta. Wall-E é o último destes robôs, que se mantém em funcionamento graças ao auto-conserto de suas peças. Sua vida consiste em compactar o lixo existente no planeta, que forma torres maiores que arranha-céus, e colecionar objetos curiosos que encontra ao realizar seu trabalho. Até que um dia surge repentinamente uma nave, que traz um novo e moderno robô: Eva. A princípio curioso, Wall-E logo se apaixona pela recém-chegada.', 0, NULL, 1, NULL),
(NULL, 289, 'O Discurso do Rei ', 'The King', 'Estados Unidos', 'Biografia', 'Tom Hooper', '15416701845be405281bb88.jpg', 118, 2010, 'MBw-pEMr4Wo', 'Theo Zaballos', 'Desde os 4 anos, George (Colin Firth) é gago. Este é um sério problema para um integrante da realiza britânica, que frequentemente precisa fazer discursos. George procurou diversos médicos, mas nenhum deles trouxe resultados eficazes. Quando sua esposa, Elizabeth (Helena Bonham Carter), o leva até Lionel Logue (Geoffrey Rush), um terapeuta de fala de método pouco convencional, George está desesperançoso. Lionel se coloca de igual para igual com George e atua também como seu psicólogo, de forma a tornar-se seu amigo. Seus exercícios e métodos fazem com que George adquira autoconfiança para cumprir o maior de seus desafios: assumir a coroa, após a abdicação de seu irmão David (Guy Pearce).', 0, NULL, NULL, NULL),
(NULL, 290, 'Oito Mulheres e um Segredo', 'Ocean\'s 8', 'Estados Unidos', 'Policial', 'Gary Ross', '15416710625be40896a0abb.jpg', 110, 2018, 'ItMzVb1K6Wk', NULL, 'Recém-saída da prisão, Debbie Ocean (Sandra Bullock) logo procura sua ex-parceira Lou (Cate Blanchett) para realizar um elaborado assalto: roubar um colar de diamantes no valor de US$ 150 milhões, que a Cartier mantém sempre em um cofre. O plano é convencer a empresa a emprestá-lo para que a estrela Daphne Kluger (Anne Hathaway) use a joia no badalado Met Gala, um dos eventos mais chiques e vistosos de Nova York. Para tanto, Debbie e Lou reúnem uma equipe composta apenas por mulheres: Nine Ball (Rihanna), Amita (Mindy Kaling), Constance (Awkwafina), Rose (Helena Bonham Carter) e Tammy (Sarah Paulson).', 0, NULL, NULL, NULL),
(NULL, 293, 'Uma Noite de Crimes', 'The Purge', 'Estados Unidos', 'Terror', 'James DeMonaco', '15416715785be40a9a723ba.jpg', 85, 2013, 'Nw8F_SUeYRU', 'Ethan Hawke, Lena Headey, Max Burkholder, Adelaide Kane', 'Quando o governo norte-americano constata que suas prisões estão cheias demais para receberem novos detentos, uma nova lei é criada, permitindo todas as atividades ilegais durante 12 horas. Este período, chamado de Noite do Crime, é marcado por milhares de assassinatos, linchamentos e outros atos de violência por todo o país. O intuito, segundo o governo, é permitir que todos os cidadãos libertem seus impulsos violentos, garantindo a paz nos outros dias do ano. Neste contexto vive a família de James Sandin (Ethan Hawke), um vendedor de sistemas de segurança que prospera graças à Noite do Crime. Quando o evento ocorre, no entanto, o filho de James aceita abrigar um homem perseguido por psicopatas.', 0, NULL, 1, NULL),
(NULL, 294, 'Brilho Eterno de Uma Mente Sem Lembranças', 'Eternal Sunshine of the Spotless Mind', 'Estados Unidos', 'Drama', 'Michel Gondry', '15416715985be40aae23132.jpg', 108, 2004, '6_mAFE70feA', 'Jim Carrey, Kate Winslet, Gerry Robert Byrne, Elijah Wood', 'Joel (Jim Carrey) e Clementine (Kate Winslet) formavam um casal que durante anos tentaram fazer com que o relacionamento desse certo. Desiludida com o fracasso, Clementine decide esquecer Joel para sempre e, para tanto, aceita se submeter a um tratamento experimental, que retira de sua memória os momentos vividos com ele. Após saber de sua atitude Joel entra em depressão, frustrado por ainda estar apaixonado por alguém que quer esquecê-lo. Decidido a superar a questão, Joel também se submete ao tratamento experimental. Porém ele acaba desistindo de tentar esquecê-la e começa a encaixar Clementine em momentos de sua memória os quais ela não participa.', 0, NULL, NULL, NULL),
(NULL, 295, 'Uma Noite de Crimes: Anarquia', 'The Purge: Anarchy', 'Estados Unidos', 'Terror', 'James DeMonaco', '15416717445be40b401023d.jpg', 103, 2014, 'I_0nuvAnxTM', 'Frank Grillo, Carmen Ejogo, Zach Gilford, Kiele Sanchez', 'Num futuro próximo, o governo dos Estados Unidos instituem a Noite de Crime, um evento onde os assassinatos são permitidos, para que os cidadãos liberem os seus instintos violentos. Faltando poucas horas para o início deste feriado sangrento, cinco pessoas se encontram nas ruas: o jovem casal Shane e Liz, que não pode voltar para casa já que o carro parou de funcionar; a garçonete Eva e sua filha adolescente, sequestradas dentro de seu próprio apartamento por vizinhos selvagens, e o Sargento, um homem misterioso que vai às ruas em busca de vingança. Apesar de serem muito diferentes, eles tentam sobreviver juntos a doze horas de barbárie.', 0, NULL, NULL, NULL),
(NULL, 296, 'Chamada de Emergência', 'The Call', 'Estados Unidos', 'Crime', 'Brad Anderson', '15416717935be40b7150eaa.jpg', 94, 2013, 'UrIdF-z2CTQ', 'Halle Berry, Abigail Breslin, Morris Chestnut, Michael Eklund', 'Jordan (Halle Berry) é atendente do sistema de emergência da polícia americana. Determinado dia, atende uma ligação de uma jovem assustada com o fato de que existe um homem tentando invadir sua casa. O caso acaba com o pior final possível e Jordan fica traumatizada. Anos mais tarde, ela se vê diante do mesmo criminoso, que agora ameaça outra garota, Casey (Abigail Breslin).', 0, NULL, NULL, NULL),
(NULL, 297, 'Doce Lar', 'Sweet Home Alabama', 'Estados Unidos', 'Romance', 'Andy Tennant', '15416720345be40c6206ea1.jpg', 108, 2002, 'BM89EgWx_Gs', 'Reese Witherspoon, Josh Lucas, Patrick Dempsey, Candice Bergen', 'Decidida a fugir de Jake (Josh Lucas), seu marido, Melanie (Reese Whiterspoon) deixa o Alabama e passa a viver secretamente em Nova York. Lá ela conhece Andrew (Patrick Dempsey), filho da atual prefeita Kate Hennings (Candice Bergen), com quem começa a namorar. Tudo corre bem na vida de Melanie, até que Andrew decide pedi-la em casamento. Ela aceita o pedido, mas precisa retornar ao Alabama o mais rápido possível para conseguir o divórcio com seu atual marido. Mas ao voltar Melanie precisará mais uma vez confrontar seu passado, do qual buscava tanto fugir.', 0, NULL, NULL, NULL),
(NULL, 298, 'Thor: O Mundo Sombrio', 'Thor: The Dark World', 'Estados Unidos', 'Aventura', 'Alan Taylor', '15416721035be40ca70a31b.jpg', 112, 2013, '5sUfuOj7zOw', 'Chris Hemsworth, Natalie Portman, Tom Hiddleston, Anthony Hopkins', 'Enquanto Thor (Chris Hemsworth) liderava as últimas batalhas para conquistar a paz entre os Nove Reinos, o maldito elfo negro Malekith (Christopher Eccleston) acordava de um longo sono, sedento de vingança e louco para levar todos para a escuridão eterna. Alertado do perigo por Odin (Anthony Hopkins), o herói precisa contar com a ajuda dos companheiros Volstagg (Ray Stevenson), Sif (Jaimie Alexander), entre outros, e até de seu irmão, o traiçoeiro Loki (Tom Hiddleston), em um plano audacioso para salvar o universo do grande mal. Mas os caminhos de Thor e da amada Jane Foster (Natalie Portman) se cruzam novamente e, dessa vez, a vida dela está realmente em perigo.', 0, NULL, NULL, NULL),
(NULL, 299, 'Ela', 'Her', 'Estados Unidos', 'Drama', 'Spike Jonze', '15416722655be40d4918ac4.jpg', 126, 2013, 'hX09Kz7BAlU', 'Joaquin Phoenix, Lynn Adrianna, Lisa Renee Pitts, Gabe Gomez', 'Theodore (Joaquin Phoenix) é um escritor solitário, que acaba de comprar um novo sistema operacional para seu computador. Para a sua surpresa, ele acaba se apaixonando pela voz deste programa informático, dando início a uma relação amorosa entre ambos. Esta história de amor incomum explora a relação entre o homem contemporâneo e a tecnologia.', 0, NULL, NULL, NULL),
(NULL, 300, 'Thor', 'Thor', 'Estados Unidos', 'Aventura', 'Kenneth Branagh', '15416724165be40de00c2f5.jpg', 115, 2011, 'TyJIwpnqdsc', 'Chris Hemsworth, Natalie Portman, Tom Hiddleston, Anthony Hopkins', 'Thor (Chris Hemsworth) estava prestes a receber o comando de Asgard das mãos de seu pai Odin (Anthony Hopkins) quando forças inimigas quebraram um acordo de paz. Disposto a se vingar do ocorrido, o jovem guerreiro desobedece as ordens do rei e quase dá início a uma nova guerra entre os reinos. Enfurecido com a atitude do filho e herdeiro, Odin retira seus poderes e o expulsa para a Terra. Lá, Thor acaba conhecendo a cientista Jane Foster (Natalie Portman) e precisa recuperar seu martelo, enquanto seu irmão Loki (Tom Hiddleston) elabora um plano para assumir o poder. Mas os guerreiros do Deus do Trovão fazem a mesma viagem para buscar o amigo e impedir que isso aconteça. Só que eles não vieram sozinhos e o inimigo está presente para uma batalha que está apenas começando.', 0, NULL, NULL, NULL),
(NULL, 302, 'Top Model', 'The Model', 'Dinamarca', 'Drama', 'Mads Matthiesen', '15416727505be40f2eb55a1.jpg', 108, 2017, 'Hdyp_pf4L-U', NULL, 'Emma (Maria Palm) é uma modelo emergente no meio artístico que está lutando para conseguir um espaço no cenário da moda parisiense. Em meio a sua batalha por espaço, ela desenvolve uma obssessão pelo fotógrafo de moda masculina Shane White (Ed Skrein).', 0, NULL, NULL, NULL),
(NULL, 303, 'Karatê Kid', 'Karate Kid', 'Estados Unidos', 'Ação', 'Harald Zwart', '15416732475be4111fdb42e.jpg', 140, 2010, 'CTzw0QV8R3g', 'Jaden Smith, Jackie Chan, Taraji P. Henson, Wenwen Han', 'Dre Parker (Jaden Smith) se mudou com a mãe (Taraji P. Henson) para Pequim, devido ao trabalho dela. Logo ao chegar ele se interessa por Meiying (Han Wenwen), uma garota que conhece praticando violino na praça. A aproximação deles provoca a irritação de Cheng (Zhenwei Wang), que lhe dá uma surra usando a técnica do kung fu. A partir de então a vida de Dre se torna um inferno, já que passa a ser perseguido na escola por Cheng e seus colegas. Um dia, ao escapar deles, Dre é auxiliado pelo sr. Han (Jackie Chan), o zelador de seu prédio, que é também um mestre de kung fu.', 0, NULL, NULL, NULL),
(NULL, 304, 'Star Wars: Episódio IV - Uma Nova Esperança', 'Star Wars: Episode IV - A New Hope', 'Estados Unidos', 'Aventura', 'George Lucas', '15416733115be4115f924e3.jpg', 121, 1977, 'jVrf_bKTjo4', 'Mark Hamill, Harrison Ford, Carrie Fisher, Peter Cushing', 'Luke Skywalker (Mark Hammil) sonha ir para a Academia como seus amigos, mas se vê envolvido em uma guerra intergalática quando seu tio compra dois robôs e com eles encontra uma mensagem da princesa Leia Organa (Carrie Fisher) para o jedi Obi-Wan Kenobi (Alec Guiness) sobre os planos da construção da Estrela da Morte, uma gigantesca estação espacial com capacidade para destruir um planeta. Luke então se junta aos cavaleiros jedi e a Hans Solo (Harrison Ford), um mercenário, para tentar destruir esta terrível ameaça ao lado dos membros da resistência.', 0, NULL, NULL, NULL),
(NULL, 305, 'Me Comer', 'Eat Me', 'Estados Unidos', 'Drama', 'Adrian Cruz', '15416735635be4125b39a12.jpg', 95, 2018, 'NG3q2UVl8-c', 'Brad Carter, Michael Shamus Wiles, Jacqueline Wright', 'Ao longo da noite tortuosa, uma mulher suicida e a casa violenta.', 0, NULL, NULL, NULL),
(NULL, 306, 'Star Wars: Episódio V - O Império Contra-Ataca', 'Star Wars: Episode V - The Empire Strikes Back', 'Estados Unidos', 'Aventura', 'Irvin Kershner', '15416736485be412b0d92fc.jpg', 124, 1980, '4KnAyxgZ3Vo', 'Mark Hamill, Harrison Ford, Carrie Fisher, Billy Dee Williams', 'As forças imperais comandadas por Darth Vader (David Prowse) lançam um ataque contra os membros da resistência, que são obrigados a fugir. Enquanto isso Luke Skywalker (Mark Hamill) tenta encontrar o Mestre Yoda, que poderá ensiná-lo a dominar a \"Força\" e torná-lo um cavaleiro jedi. No entanto, Darth Vader planeja levá-lo para o lado negro da \"Força\".', 0, NULL, NULL, NULL),
(NULL, 307, 'Star Wars: Episódio VI - O Retorno do Jedi', 'Star Wars: Episode VI - Return of the Jedi', 'Estados Unidos', 'Aventura', 'Richard Marquand', '15416739365be413d0d76f6.jpg', 131, 1983, 'BT-fVW24-q4', 'Mark Hamill, Harrison Ford, Carrie Fisher, Billy Dee Williams', 'O imperador (Ian McDiarmid) está supervisionando a construção de uma nova Estrela da Morte. Enquanto isso Luke Skywalker (Mark Hamill) liberta Han Solo (Harrison Ford) e a Princesa Leia (Carrie Fisher) das mãos de Jaba, o pior bandido das galáxias. Luke só se tornará um cavaleiro jedi quando destruir Darth Vader, que ainda pretende atraí-lo para o lado negro da \"Força\". No entanto a luta entre os dois vai revelar um inesperado segredo.', 0, NULL, NULL, NULL),
(NULL, 309, 'Tomb Raider - A Origem', 'Tomb Raider', 'Estados Unidos', 'Ação', 'Roar Uthaug', '15416741535be414a9d2327.jpg', 118, 2018, 'X3Dr5HLDvPM', 'Alicia Vikander, Dominic West, Walton Goggins, Daniel Wu', 'Aos 21 anos, Lara Croft (Alicia Vikander) leva a vida fazendo entregas de bicicleta pelas ruas de Londres, se recusando a assumir a companhia global do seu pai desaparecido (Dominic West) há sete anos, ideia que ela se recusa a aceitar. Tentando desvendar o sumiço do pai, ela decide largar tudo para ir até o último lugar onde ele esteve e inicia uma perigosa aventura numa ilha japonesa.', 0, NULL, NULL, NULL),
(NULL, 310, 'Star Wars: Episódio I - A Ameaça Fantasma', 'Star Wars: Episode I - The Phantom Menace', 'Estados Unidos', 'Aventura', 'George Lucas', '15416742345be414fac9739.jpg', 136, 1999, 'TgnyVyIXcWU', 'Liam Neeson, Ewan McGregor, Natalie Portman, Jake Lloyd', 'Quando a maquiavélica Federação Comercial planeja invadir o pacífico planeta Naboo, o guerreiro Jedi Qui-Gon Jinn (Liam Neeson) e seu aprendiz Obi-Wan Kenobi (Ewan McGregor) embarcam em uma aventura para tentar salvar o planeta. Viajam com eles a jovem Rainha Amidala (Natalie Portman), que é visada pela Federação pois querem forçá-la a assinar um tratado político. Eles têm de viajar para os distantes planetas Tatooine e Coruscant em uma desesperada tentativa de salvar o mundo de Darth Sidious (Ian McDiarmid), o demoníaco líder da Federação que sempre surge em imagens tridimensionais (a ameaça fantasma). Durante a viagem, Qui-Gon Jinn conhece um garoto de nove anos que deseja treiná-lo para ser tornar um Jedi, pois o menino tem todas as qualidades para isto.', 0, NULL, NULL, NULL),
(NULL, 311, 'RipTide', 'Rip Tide', 'Austrália', 'Família, Drama', 'Rhiannon Bannenberg', '15416743295be4155944685.jpg', 85, 2017, 'qlejfjJNdJM', 'Debby Ryan, Genevieve Hegney, Andrew Creer, Naomi Sequeira, Georgina Symes, Aaron Jeffery, Jeremy Lindsay Taylor, Danielle Carter, Valerie Bader', 'A jovem modelo Cora (Debby Ryan) é filha da chefe da melhor agência de modelo, e sempre trabalhou duro para atender as expectativas das mãe (Danielle Carter). Quando um vídeo caindo se torna um viral, Cora vai passar um tempo na Austrália com sua tia Margot (Genevieve Hegney). Margot também está passando por suas próprias dificuldades, e juntas elas terão uma experiência de aprendizado.', 0, NULL, NULL, NULL),
(NULL, 312, 'Star Wars: Episódio II - Ataque dos Clones', 'Star Wars: Episode II - Attack of the Clones', 'Estados Unidos', 'Aventura', 'George Lucas', '15416744145be415ae89a45.jpg', 142, 2002, 'n7DQ9SdjUmg', 'Ewan McGregor, Natalie Portman, Hayden Christensen, Christopher Lee', 'Dez anos após a tentativa frustrada de invasão do planeta Naboo, Obi-Wan Kenobi (Ewan McGregor), Anakin Skywalker (Hayden Christensen) e Padmé Amidala (Natalie Portman) estão juntos novamente. Neste período de tempo Obi-Wan passou de aprendiz a professor dos ensinamentos jedi para Anakin, sendo que ambos foram destacados para proteger a agora senadora Amidala, que tem sua vida ameaçada por facções separatistas da República, que ameaçam desencadear uma guerra civil intergalática. Com o passar do tempo surge um romance proibido entre Anakin e Amidala, pois os cavaleiros jedi não têm permissão para se apaixonarem.', 0, NULL, NULL, NULL),
(NULL, 314, 'Estômago', 'Estômago', 'Brasil', 'Drama', 'Marcos Jorge', '15416746645be416a85c20b.jpg', 113, 2007, 'Awq6P5Bjvgg', 'João Miguel, Fabiula Nascimento, Babu Santana, Carlo Briani', 'Raimundo Nonato (João Miguel) foi para a cidade grande na esperança de ter uma vida melhor. Contratado como faxineiro em um bar, logo ele descobre que possui um talento nato para a cozinha. Com suas coxinhas Raimundo transforma o bar num sucesso. Giovanni (Carlo Briani), o dono de um conhecido restaurante italiano da região, o contrata como assistente de cozinheiro. A cozinha italiana é uma grande descoberta para Raimundo, que passa também a ter uma casa, roupas melhores, relacionamentos sociais e um amor: a prostituta Iria (Fabiula Nascimento).', 0, NULL, NULL, NULL),
(NULL, 315, 'JOBS', 'Jobs', 'Estados Unidos', 'Biografia', 'Joshua Michael Stern', '15416747395be416f364f4d.jpg', 128, 2013, 'pT2Rp7c9Qok', 'Ashton Kutcher, Dermot Mulroney, Josh Gad, Lukas Haas', 'De hippie sem foco nos estudos a líder de uma das maiores empresas de tecnologia do mundo. Este é Steve Jobs (Ashton Kutcher), um sujeito de personalidade forte e dedicado, que não se incomoda de passar por cima dos outros para atingir suas metas, o que faz com que tenha dificuldades em manter relações amorosas e de amizade.', 0, NULL, NULL, NULL),
(NULL, 317, 'Star Wars: Episódio III - A Vingança dos Sith', 'Star Wars: Episode III - Revenge of the Sith', 'Estados Unidos', 'Aventura', 'George Lucas', '15416749715be417dbbbe8c.jpg', 140, 2005, 'znpliCR0_Kw', 'Ewan McGregor, Natalie Portman, Hayden Christensen, Ian McDiarmid', 'As Guerras Clônicas estão em pleno andamento e as diferenças entre o Conselho Jedi e o Chanceler Palpatine (Ian McDiarmid) aumentam cada vez mais. Anakin Skywalker (Hayden Christensen) mantém um elo de lealdade com Palpatine, ao mesmo tempo em que luta para que seu casamento com Padmé Amidala (Natalie Portman) não seja afetado por esta situação. Seduzido por promessas de poder, Anakin se aproxima cada vez mais de Darth Sidious (Ian McDiarmid) até se tornar o temível Darth Vader. Juntos eles tramam um plano para aniquilar de uma vez por todas com os cavaleiros jedi.', 0, NULL, NULL, NULL),
(NULL, 318, 'Titãs da Idade do Gelo', 'Titans of the Ice Age', 'Estados Unidos', 'Documentário', 'David Clark', '15416749875be417eb19490.jpg', 40, 2013, 'EzzTX3DYMNs', 'Christopher Plummer, Trevor S. Valle, Christoph Walter', 'Um tempo em que poderosos mamutes, gatos com dentes de sabre, lobos medonhos, preguiças-preguiça e ursos-das-cavernas governaram a Terra por dezenas de milhares de anos. Agora, esteja pronto para assistir aos Titãs da Era Glacial como você nunca viu antes, e os Titãs da Idade do Gelo irão levá-lo de volta ao tempo 5.000 anos antes da civilização moderna, mas também explorar a paisagem agreste e bela do Pleistoceno e aprender sobre criaturas que não mais viva hoje e descubra como nossos ancestrais viveram lado a lado com alguns dos animais mais originais, temidos e majestosos que já andaram pelo planeta!', 0, NULL, NULL, NULL),
(NULL, 319, 'Tangerine', 'Tangerine', 'Estados Unidos', 'Comédia dramática', 'Sean Baker', '15416750795be4184767415.jpg', 88, 2015, 'nuKC-5PQ3lc', 'Kitana Kiki Rodriguez, Mya Taylor, Karren Karagulian, Mickey O\'Hagan', 'Assim que sai da prisão, a prostituta transexual Sin-Dee (Kitana Kiki Rodriguez) descobre através de sua melhor amiga (Mya Taylor) que o namorado Chester (James Ransone) está saindo com outra pessoa, uma mulher cisgênero. Sin-Dee decide encontrar os dois e puni-los pela traição.', 0, NULL, NULL, NULL),
(NULL, 320, 'Sol da Meia-Noite', 'Midnight Sun', 'Estados Unidos', 'Drama', 'Scott Speer', '15416751985be418be4a88c.jpg', 91, 2018, 'bc1WWuC8WiE', 'Bella Thorne, Patrick Schwarzenegger, Rob Riggle, Quinn Shephard', 'Katie (Bella Thorne) é uma jovem de 17 anos que vive protegida dentro de sua casa desde a sua infância. Confinada no local durante os dias, ela possui uma rara doença que faz com que a menor quantidade de luz solar seja mortal. Sua situação muda quando seu destino se cruza com o de Charlie (Patrick Schwarzenegger) e eles iniciam um romance de verão.', 0, NULL, NULL, NULL),
(NULL, 321, 'Somos Tão Jovens', 'Somos Tão Jovens', 'Brasil', 'Biografia', 'Antonio Carlos da Fontoura', '15416753595be4195f03eb7.jpg', 104, 2013, 'JWDRvRxHM1I', 'Thiago Mendonça, Laila Zaid, Bruno Torres, Daniel Passi', 'Renato (Thiago Mendonça) acabou de se mudar com a família para a cidade, vindo do Rio de Janeiro. Na época ele sofria de uma doença óssea rara, a epifisiólise, que o deixou numa cadeira de rodas após passar por uma cirurgia. Obrigado a permanecer em casa, aos poucos ele passou a se interessar por música. Fã do punk rock, Renato começa a se envolver com o cenário musical de Brasília após melhorar dos problemas de saúde. É quando ajuda a fundar a banda Aborto Elétrico e, posteriormente, a Legião Urbana.', 0, NULL, NULL, NULL),
(NULL, 322, 'The Post - A Guerra Secreta', 'The Post', 'Estados Unidos', 'Drama', 'Steven Spielberg', '15416754575be419c1e4c4f.jpg', 117, 2018, 'HKfV41DcmmA', NULL, 'Quando o New York Times inicia uma série de matérias denunciando que vários governos norte-americanos mentiram acerca da atuação do país na Guerra do Vietnã, com base em documentos sigilosos do Pentágono, o presidente Richard Nixon decide processar o jornal com base na Lei de Espionagem, de forma que nada mais seja divulgado. A proibição é concedida por um juiz, o que faz com que os documentos cheguem às mãos de Bradlee e sua equipe, que precisa agora convencer Kat e os demais responsáveis pelo The Post sobre a importância da publicação de forma a defender a liberdade de imprensa.', 0, NULL, NULL, NULL),
(NULL, 323, 'Otherlife', 'OtherLife', 'Austrália', 'Ficção Científica', 'Ben C. Lucas', '15416755415be41a1545b3d.jpg', 96, 2017, 'qav2Z0TgYMA', 'Jessica De Gouw, Thomas Cocquerel, T.J. Power, Daniielle Alexis', 'Ren Amari é a inventora de uma nova droga revolucionária. OtherLIfe expande a sensação de tempo do cérebro e cria uma realidade virtual diretamente na mente do usuário. Com OtherLife, meros segundos na vida real são como horas ou dias de emocionantes aventuras.', 0, NULL, NULL, NULL),
(NULL, 324, 'Star Wars: Episódio VII - O Despertar da Força', 'Star Wars: Episode VII - The Force Awakens', 'Estados Unidos', 'Aventura', 'J.J. Abrams', '15416755935be41a499d7e2.jpg', 105, 2016, '4r0287tUEgk', 'J.J. Abrams, John Boyega, Chris Clarke, Adam Driver', 'Décadas após a queda de Darth Vader e do Império, surge uma nova ameaça: a Primeira Ordem, uma organização sombria que busca minar o poder da República e que tem Kylo Ren (Adam Driver), o General Hux (Domhnall Gleeson) e o Líder Supremo Snoke (Andy Serkis) como principais expoentes. Eles conseguem capturar Poe Dameron (Oscar Isaac), um dos principais pilotos da Resistência, que antes de ser preso envia através do pequeno robô BB-8 o mapa de onde vive o mitológico Luke Skywalker (Mark Hamill). Ao fugir pelo deserto, BB-8 encontra a jovem Rey (Daisy Ridley), que vive sozinha catando destroços de naves antigas. Paralelamente, Poe recebe a ajuda de Finn (John Boyega), um stormtrooper que decide abandonar o posto repentinamente. Juntos, eles escapam do domínio da Primeira Ordem.', 0, NULL, NULL, NULL),
(NULL, 325, '2 Coelhos', '2 Coelhos', 'Brasil', 'Suspense', 'Afonso Poyart', '15416758395be41b3fb3380.jpg', 108, 2012, 'A-0IBXgeMfU', NULL, 'Após se envolver em um grave acidente automobilístico, no qual uma mulher e seu filho são mortos, Edgar (Fernando Alves Pinto) é indiciado, mas consegue escapar da prisão graças à influência de um deputado estadual. Logo em seguida ele parte para uma temporada em Miami, onde retorna com um elaborado plano em que pretende atingir tanto o deputado que o ajudou, símbolo da corrupção política, quanto Maicon (Marat Descartes), um criminoso que consegue escapar da justiça graças ao suborno de políticos influentes.', 0, NULL, NULL, NULL),
(NULL, 327, 'As Sufragistas', 'Suffragette', 'Reino Unido', 'Drama', 'Sarah Gavron', '15416759795be41bcb5f5ac.jpg', 106, 2015, 'R8le4sZHRdE', 'Anne-Marie Duff, Grace Stottor, Geoff Bell, Carey Mulligan', 'No início do século XX, após décadas de manifestações pacíficas, as mulheres ainda não possuem o direito de voto no Reino Unido. Um grupo militante decide coordenar atos de insubordinação, quebrando vidraças e explodindo caixas de correio, para chamar a atenção dos políticos locais à causa. Maud Watts (Carey Mulligan), sem formação política, descobre o movimento e passa a cooperar com as novas feministas. Ela enfrenta grande pressão da polícia e dos familiares para voltar ao lar e se sujeitar à opressão masculina, mas decide que o combate pela igualdade de direitos merece alguns sacrifícios.', 0, NULL, NULL, NULL),
(NULL, 328, 'Um Lugar Onde Nada É Impossível', 'Tomorrowland', 'Estados Unidos', 'Ficção Científica', 'Brad Bird', '15416760075be41be7df9d7.jpg', 130, 2015, 'guk91lSCyto', 'George Clooney, Hugh Laurie, Britt Robertson, Raffey Cassidy', 'Casey Newton (Britt Robertson) é uma adolescente com enorme curiosidade pela ciência. Um dia, ela encontra um pequeno broche que permite que se transporte automaticamente para uma realidade paralela chamada Tomorrowland, repleta de invenções futuristas visando o bem da humanidade. Ela logo busca um meio de chegar ao lugar e, no caminho, conta com a ajuda da misteriosa Athena (Raffey Cassidy) e de Frank Walker (George Clooney), que esteve em Tomorrowland quando garoto mas hoje leva uma vida amargurada.', 0, NULL, NULL, NULL),
(NULL, 329, 'Rogue One - Uma História de Star Wars', 'Rogue One: A Star Wars Story', 'Estados Unidos', 'Aventura', 'Gareth Edwards', '15416762295be41cc5aff9e.jpg', 133, 2016, 'R74QIAaRuEg', 'Felicity Jones, Diego Luna, Alan Tudyk, Donnie Yen', 'Ainda criança, Jyn Erso (Felicity Jones) foi afastada de seu pai, Galen (Mads Mikkelsen), devido à exigência do diretor Krennic (Ben Mendelsohn) que ele trabalhasse na construção da arma mais poderosa do Império, a Estrela da Morte. Criada por Saw Gerrera (Forest Whitaker), ela teve que aprender a sobreviver por conta própria ao completar 16 anos. Já adulta, Jyn é resgatada da prisão pela Aliança Rebelde, que deseja ter acesso a uma mensagem enviada por seu pai a Gerrera. Com a promessa de liberdade ao término da missão, ela aceita trabalhar ao lado do capitão Cassian Andor (Diego Luna) e do robô K-2SO.', 0, NULL, NULL, NULL),
(NULL, 330, 'Juventudes Roubadas', 'Testament of Youth', 'Reino Unido', 'Drama', 'James Kent', '15416762505be41cda5db52.jpg', 130, 2015, 'aYq274XkUE8&has_verified=1', 'Rosie Alison, Mark Bostridge, Kit Harington, James Kent', 'Vera Brittain (Alicia Vikander) relembra sua dura juventude durante a Primeira Guerra Mundial, quando, aos 17 anos, vivenciou a perda e o luto de seus amigos em seu ofício voluntário de enfermeira.', 0, NULL, NULL, NULL),
(NULL, 331, 'Cássia Eller', 'Cássia Eller', 'Brasil', 'Biografia', ' Paulo Henrique Fontenelle', '15416763135be41d1901115.jpg', 120, 2014, 'HWKbKrrUZnU', NULL, 'Uma poderosa força inquieta no palco, a timidez em pessoa fora dele. Um dos grandes nomes da música brasileira, Cássia Eller marcou a década de 1990 e chocou o país com sua morte precoce, em 2001. Um filme sobre a cantora, a mãe, a mulher que expôs sua vida pessoal e rompeu barreiras, deixando um belo legado social e artístico.', 0, NULL, NULL, NULL),
(NULL, 332, 'Coração Valente', 'Braveheart', 'Estados Unidos', 'Biografia', 'Mel Gibson', '15416764265be41d8adc66c.jpg', 178, 1995, '0HJKpGxnAKM', 'James Robinson, Sean Lawlor, Sandy Nelson, James Cosmo', 'No século XIII, soldados ingleses matam a mulher do escocês William Wallace (Mel Gibson), bem na sua noite de núpcias. Para vingar a amada, ele resolve liderar seu povo em uma luta contra o cruel Rei inglês Edward I (Patrick McGoohan). Com a ajuda de Robert e Bruce, ele vai deflagrar uma violenta batalha com o objetivo de libertar a Escócia de uma vez por todas.', 0, NULL, NULL, NULL),
(NULL, 333, 'Crô: O Filme', 'Crô: O Filme', 'Brasil', 'Comédia', 'Bruno Barreto', '15416764965be41dd075b0e.jpg', 110, 2013, 'EgFYUzbKpOI', 'Marcelo Serrado, Carolina Ferraz, Alexandre Nero, Katia Moraes', 'Após herdar a fortuna de Tereza Cristina, Crodoalvo Valério, mais conhecido como \"Crô\" (Marcelo Serrado), está cansado da vida de milionário. Decidido a encontrar uma nova musa a quem possa dedicar sua vida, ele inicia uma busca pessoal que faz com que entreviste diversas peruas. Seu objetivo é encontrar aquela que seja melhor qualificada para que ele próprio possa servir como mordomo, assim como fez com sua antiga patroa. Entretanto, após muito avaliar, acaba percebendo que sua musa ideal é justamente aquela que jamais havia imaginado.', 0, NULL, NULL, NULL),
(NULL, 335, 'Han Solo - Uma História de Star Wars', 'Solo: A Star Wars Story', 'Estados Unidos', 'Aventura', 'Ron Howard', '15416765835be41e2788ba2.jpg', 135, 2018, 'EQpr5HXTvmg', 'Alden Ehrenreich, Joonas Suotamo, Woody Harrelson, Emilia Clarke, Donald Glover', 'Em dificuldade financeira, o piloto Han Solo (Alden Ehrenreich) e sua namorada Qi\'ra (Emilia Clarke) buscam algum trabalho. Eles conseguem pôr as mãos em uma substância valiosa, mas perigosa, que acaba levando à perseguição do Império e à separação entre os dois. Preocupado, Han usa toda a sua esperteza para se infiltrar num plano arriscado, mas que pode render a oportunidade de voltar à terra natal e reencontrar a sua amada. Caso ele falhe, vai ter que prestar contas ao perigoso Dryden Vos (Paul Bettany). No caminho, o piloto encontra parceiros importantes, como Chewbacca (Joonas Suotamo) e Lando Calrissian (Donald Glover), o proprietário original da Millennium Falcon.', 0, NULL, NULL, NULL),
(NULL, 336, 'Elena ', 'Elena', 'Rússia', 'Drama', 'Andrey Zvyagintsev', '15416767895be41ef5e9bd6.jpg', 109, 2011, 'drDu9Ta1JWc', 'Nadezhda Markina, Andrey Smirnov, Elena Lyadova, Aleksey Rozin', 'Elena e Vladimir são um casal idoso, vindo de classes sociais diferentes: ele é um homem rico e frio, já ela é uma esposa dócil, de origem humilde. Eles se apaixonaram quando cada um já tinha um filho de casamentos anteriores. O filho de Elena passa por graves dificuldades financeiras e pede dinheiro à mãe o tempo inteiro, enquanto a filha de Vladimir é uma garota boêmia de quem ele não é muito próximo. Um dia, por causa de um problema cardíaco, Vlamidir é hospitalizado, e descobre que pode morrer em breve. Elena fica desesperada, pois contava com esta herança para ajudar o filho. Aos poucos, ela começa a armar um plano para conseguir dar ao seu filho e seu neto uma vida que sempre mereceram.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 337, 'Garotas Perigosas', 'Spring Breakers', 'Estados Unidos', 'Drama', 'Harmony Korine', '15416768645be41f404d5d6.jpg', 92, 2012, '2GHiXiD1-AQ', 'James Franco, Selena Gomez, Vanessa Hudgens, Ashley Benson, Rachel Korine, Gucci Mane, Heather Morris ', 'Candy (Vanessa Hudgens), Faith (Selena Gomez), Brit (Ashley Benson) e Cotty (Rachel Korine) são quatro jovens inconsequentes que assaltam um restaurante para poderem juntar dinheiro e tirar férias na praia durante a primavera norte-americana, num período conhecido como \"spring break\". No local, elas se envolvem em confusões e acabam presas. Na delegacia, conhecem um criminoso barra pesada (James Franco) que se encanta por elas e tenta convencê-las a integrar seu grupo.', 0, NULL, NULL, 1),
(NULL, 338, 'Elena', 'Elena', 'Brasil', 'Documentário', 'Petra Costa ', '15416769375be41f89b90d9.jpg', 82, 2013, 'HUYsE29ufuM', 'N/A', 'Ao viajar para Nova York, Elena segue o sonho de se tornar atriz de cinema e deixa no Brasil uma infância vivida na clandestinidade, devido à ditadura militar implantada no país, e também a irmã mais nova, Petra, de apenas sete anos. Duas décadas depois, Petra, já atriz, embarca para Nova York atrás da irmã. Em sua busca Petra apenas tem algumas pistas, como cartas, diários e filmes caseiros. Ela acaba percorrendo os passos da irmã até encontrá-la em um lugar inesperado.', 0, NULL, NULL, NULL),
(NULL, 339, 'Fome de Poder', 'The Founder', 'Estados Unidos', 'Biografia', 'John Lee Hancock', '15416770285be41fe4d6a8f.jpg', 115, 2016, '8LvMLEZZGZs', 'Michael Keaton, Nick Offerman, John Carroll Lynch, Linda Cardellini', 'A história da ascensão do McDonald\'s. Após receber uma demanda sem precedentes e notar uma movimentação de consumidores fora do normal, o vendedor de Illinois Ray Kroc (Michael Keaton) adquire uma participação nos negócios da lanchonete dos irmãos Richard e Maurice \"Mac\" McDonald no sul da Califórnia e, pouco a pouco eliminando os dois da rede, transforma a marca em um gigantesco império alimentício.', 0, NULL, NULL, NULL),
(NULL, 340, 'Tempos Obscuros', 'Super Dark Times', 'Estados Unidos', 'Drama', 'Kevin Phillips', '15416771225be4204275cea.jpg', 92, 2017, 'qG0af8nliCE', 'Owen Campbell, Charlie Tahan, Elizabeth Cappuccino, Amy Hargreaves', 'Zach (Owen Campbell) e Josh (Charlie Tahan) se consideram melhores amigos desde a infância, por toda as suas vidas. Quando um acidente horrível acontece e surge a necessidade de um encobrir o outro, o segredo faz com que a amizade dos dois seja posta no limite, gerando uma crescente paranóia e violência.', 0, NULL, NULL, NULL),
(NULL, 341, 'Old Boy', 'Oldeuboi', 'Coreia do Sul', 'Suspense', 'Park Chan-Wook', '15416772605be420cc926e4.jpg', 119, 2003, 'Vw5aOQcKBIo', NULL, 'Oh Dae-su (Choi Min-sik) é um homem comum, bem casado e pai de uma garota de 3 anos, que é levado a uma delegacia por estar alcoolizado. Ao sair ele liga para casa de uma cabine telefônica, para logo em seguida desaparecer, dexando como pista apenas o presente de aniversário que havia comprado para a filha. Pouco depois ele percebe estar em uma estranha prisão, onde há apenas uma TV ligada, no qual ele recebe pouca comida e respira um gás que o faz dormir diariamente. Através do noticiário da TV ele descobre que é o principal suspeito do assassinato brutal de sua esposa e sem ter outra opção, ele passa a se adaptar à escuridão de seu quarto e a preparar seu corpo e sua mente para sobreviver à pena que está sendo obrigado a cumprir sem saber o porquê.', 0, NULL, NULL, NULL),
(NULL, 342, 'Millennium: A Garota na Teia de Aranha', 'The Girl in the Spider', 'Reino Unido', 'Ação', 'Fede Alvarez', '15416772855be420e582e19.jpg', 117, 2018, 'XadO4HoUNqs', NULL, 'Estocolmo, Suécia. Graças às matérias escritas por Mikael Blomkvist (Sverrir Gudnason) para a revista Millennium, Lisbeth Salander (Claire Foy) ficou conhecida como uma espécie de anti-heroína, que ataca homens que agridem mulheres. Apesar da fama repentina, ela se mantém distante da mídia em geral e levando uma vida às escondidas. Um dia, Lisbeth é contratada por Balder (Stephen Merchant) para recuperar um programa de computador chamado Firefall, que dá ao usuário acesso a um imenso arsenal bélico. Balder criou o programa para o governo dos Estados Unidos, mas agora deseja deletá-lo por considerá-lo perigoso demais. Lisbeth aceita a tarefa e consegue roubá-lo da Agência de Segurança Nacional, mas não esperava que um outro grupo, os Aranhas, também estivesse interessado nele.', 0, NULL, NULL, NULL),
(NULL, 343, 'Os Miseráveis', 'Les Misérables', 'Reino Unido', 'Musical', 'Tom Hooper', '15416773965be42154debf9.jpg', 158, 2012, 'cy_-hUz9yjs', 'Hugh Jackman, Russell Crowe, Anne Hathaway, Amanda Seyfried', 'Adaptação de musical da Broadway, que por sua vez foi inspirado em clássica obra do escritor Victor Hugo. A história se passa em plena Revolução Francesa do século XIX. Jean Valjean (Hugh Jackman) rouba um pão para alimentar a irmã mais nova e acaba sendo preso por isso. Solto tempos depois, ele tentará recomeçar sua vida e se redimir. Ao mesmo tempo em que tenta fugir da perseguição do inspetor Javert (Russell Crowe).', 0, NULL, NULL, NULL),
(NULL, 344, 'Crepúsculo', 'Twilight', 'Estados Unidos', 'Drama', 'Catherine Hardwicke', '15416777215be42299685ff.jpg', 122, 2008, 'Z0eXNZAgMIo', 'Kristen Stewart, Robert Pattinson, Taylor Lautner, Nikki Reed, Ashley Greene, Anna Kendrick, Jackson Rathbone, Peter Facinelli, Billy Burke', 'Isabella Swan (Kristen Stewart) e seu pai, Charlie (Billy Burke), mudaram-se recentemente. No novo colégio ela logo conhece Edward Cullen (Robert Pattinson), um jovem admirado por todas as garotas locais e que mantém uma aura de mistério em torno de si. Eles aos poucos se apaixonam, mas Edward sabe que isto põe a vida de Isabella em risco.', 0, NULL, NULL, NULL),
(NULL, 345, 'A Saga Crepúsculo: Eclipse', 'The Twilight Saga: Eclipse', 'Estados Unidos', 'Drama', 'David Slade', '15416788195be426e3771ca.jpg', 124, 2010, 'l9abS7dODnA', 'Kristen Stewart, Robert Pattinson, Taylor Lautner, Billy Burke, Bryce Dallas Howard, Ashley Greene, Jackson Rathbone, Dakota Fanning, Nikki Reed', 'Bella Swan (Kristen Stewart) enfim está reunida a seu grande amor, Edward Cullen (Robert Pattinson). Eles planejam se casar assim que chegar a formatura, o que marcará também a transformação de Bella em vampira. Apesar da vontade dela, Edward ainda é reticente em relação à transformação. Paralelamente, Jacob Black (Taylor Lautner), apaixonado por Bella, decide lutar pelo seu amor. Só que a vida do trio está em perigo quando uma legião de vampiros recém criados começa a atacar em Seattle, cidade próxima ao local em que vivem.', 0, NULL, NULL, NULL),
(NULL, 346, 'A Saga Crepúsculo: Amanhecer - Parte 1', 'The Twilight Saga: Breaking Dawn - Part 1', 'Estados Unidos', 'Fantasia', 'Bill Condon', '15416800105be42b8a16df3.jpg', 117, 2011, 'gLiDfunWKmc', 'Taylor Lautner, Kristen Stewart, Robert Pattinson, Kellan Lutz, Ashley Greene, Anna Kendrick, Dakota Fanning, Mackenzie Foy, Nikki Reed', 'Bella Swan (Kristen Stewart) e Edward Cullen (Robert Pattinson) enfim se casam, em cerimônia com a presença de amigos e familiares. O casal resolve passar a lua de mel no Rio de Janeiro e, logo em seguida, Bella engravida. O que eles não esperavam era que a gravidez seria tão complicada, colocando em risco a vida do bebê e da própria mãe.', 0, NULL, NULL, NULL),
(NULL, 347, 'A Saga Crepúsculo: Amanhecer - Parte 2', 'The Twilight Saga: Breaking Dawn - Part 2', 'Estados Unidos', 'Fantasia', 'Bill Condon', '15416802395be42c6f89a21.jpg', 115, 2012, 'iYrRoZwlxRQ', 'Kristen Stewart, Robert Pattinson, Taylor Lautner, Peter Facinelli, Kellan Lutz, Mackenzie Foy, Ashley Greene, Elizabeth Reaser, Jackson Rathbone', 'Após dar a luz a Renesmee (Mackenzie Foy), Bella Swan (Kristen Stewart) desperta já vampira. Ela agora precisa aprender a lidar com seus novos poderes, assim como absorver a ideia de que Jake (Taylor Lautner), seu melhor amigo, teve um imprinting com a filha. Devido ao elo existente entre eles, Jake passa a acompanhar com bastante atenção o rápido desenvolvimento de Renesmee, o que faz com que se aproxime cada vez mais dos Cullen. Paralelamente, Aro (Michael Sheen) é informado por Irina (Maggie Grace) da existência de Renesmee e de seus raros poderes. Acreditando que ela seja uma ameaça em potencial para o futuro dos Volturi, ele passa a elaborar um plano para atacar os Cullen e eliminar a garota de uma vez por todas.', 0, NULL, NULL, NULL),
(NULL, 348, 'Os Vingadores', 'The Avengers', 'Estados Unidos', 'Ação', 'Joss Whedon', '15416807085be42e44a2457.jpg', 143, 2012, '6Y6zOSn8ff4', 'Robert Downey Jr., Chris Evans, Mark Ruffalo, Chris Hemsworth', 'Loki retorna à Terra enviado pelos chitauri, uma raça alienígena que pretende dominar os humanos. Com a promessa de que será o soberano do planeta, ele rouba o cubo cósmico dentro de instalações da S.H.I.E.L.D. e, com isso, adquire grandes poderes. Loki os usa para controlar o dr. Erik Selvig e Clint Barton/Gavião Arqueiro, que passam a trabalhar para ele. No intuito de contê-los, Nick Fury convoca um grupo de pessoas com grandes habilidades, mas que jamais haviam trabalhado juntas: Tony Stark/Homem de Ferro, Steve Rogers/Capitão América, Thor, Bruce Banner/Hulk e Natasha Romanoff/Viúva Negra. Só que, apesar do grande perigo que a Terra corre, não é tão simples assim conter o ego e os interesses de cada um deles para que possam agir em grupo.', 0, NULL, NULL, NULL),
(NULL, 349, 'Vingadores: Era de Ultron', 'Avengers: Age of Ultron', 'Estados Unidos', 'Ação', 'Joss Whedon', '15416809115be42f0f5a0ea.jpg', 141, 2015, 'lGO6FcnZ0ek', 'Robert Downey Jr., Chris Hemsworth, Mark Ruffalo, Chris Evans', 'Tentanto proteger o planeta de ameaças como as vistas no primeiro \"Os Vingadores\", Tony Stark busca construir um sistema de inteligência artifical que cuidaria da paz mundial. O projeto acaba dando errado e gera o nascimento do Ultron (voz de James Spader). Capitão América (Chris Evans), Homem de Ferro (Robert Downey Jr.), Thor (Chris Hemsworth), Hulk (Mark Ruffalo), Viúva Negra (Scarlett Johansson) e Gavião Arqueiro (Jeremy Renner) terão que se unir para mais uma vez salvar o dia.', 0, NULL, NULL, NULL),
(NULL, 350, 'Diário de Uma Camareira', 'Journal d’une femme de chambre', 'França', 'Drama', 'Barry Jenkins', '15416811975be4302d0e67e.jpg', 95, 2015, 'h5qUHK90TFs', NULL, ' Célestine (Léa Seydoux), uma jovem camareira que é muito cobiçada por sua beleza, acaba de chegar de Paris para trabalhar para a família Lanlaire. Enquanto foge dos flertes de seu patrão, ela deve lidar com a rigorosa personalidade de Madame Lanlaire (Clotilde Mollet), que governa o lar com punho de ferro. Ao mesmo tempo, Célestine conhece Joseph, um misterioso jardineiro com ideias políticas subversivas.', 0, NULL, NULL, NULL),
(NULL, 351, 'Homem de Ferro', 'Iron Man', 'Estados Unidos', 'Ação', 'Jon Favreau', '15416812015be43031973e4.jpg', 126, 2008, 'rFKv3WRgSUs', 'Robert Downey Jr., Terrence Howard, Jeff Bridges, Gwyneth Paltrow', 'Tony Stark (Robert Downey Jr.) é um industrial bilionário, que também é um brilhante inventor. Ao ser sequestrado ele é obrigado por terroristas a construir uma arma devastadora mas, ao invés disto, constrói uma armadura de alta tecnologia que permite que fuja de seu cativeiro. A partir de então ele passa a usá-la para combater o crime, sob o alter-ego do Homem de Ferro.', 0, NULL, NULL, NULL),
(NULL, 352, 'Dunkirk ', 'Dunkirk', 'Reino Unido', 'Guerra', 'Christopher Nolan', '15416813615be430d1a2666.jpg', 106, 2017, 'iWRIcoJtfwg', 'Fionn Whitehead, Damien Bonnard, Aneurin Barnard, Lee Armstrong', 'Na Operação Dínamo, mais conhecida como a Evacuação de Dunquerque, soldados aliados da Bélgica, do Império Britânico e da França são rodeados pelo exército alemão e devem ser resgatados durante uma feroz batalha no início da Segunda Guerra Mundial. A história acompanha três momentos distintos: uma hora de confronto no céu, onde o piloto Farrier (Tom Hardy) precisa destruir um avião inimigo, um dia inteiro em alto mar, onde o civil britânico Dawson (Mark Rylance) leva seu barco de passeio para ajudar a resgatar o exército de seu país, e uma semana na praia, onde o jovem soldado Tommy (Fionn Whitehead) busca escapar a qualquer preço.', 0, NULL, NULL, NULL),
(NULL, 353, 'Madame Bovary', 'Madame Bovary', 'Reino Unido', 'Drama', 'Sophie Barthes', '15416814655be43139c3fd8.jpg', 118, 2014, 'y2EkH5ksAf0', 'Mia Wasikowska, Rhys Ifans, Ezra Miller, Logan Marshall-Green', 'Na França do século XIX, Emma Bovary (Mia Wasikowska) é a jovem e bela esposa de um tradicional médico de uma pacata cidade. Ela dá início a uma relação extraconjugal para tentar se promover na sociedade e melhorar seu status social. Porém, suas atitudes levam-na ao oposto deu seus objetivos. Adaptação de obra homônima de Gustave Flaubert.', 0, NULL, NULL, NULL),
(NULL, 354, 'Homem de Ferro 2', 'Iron Man 2', 'Estados Unidos', 'Ação', 'Jon Favreau', '15416815275be43177ed604.jpg', 124, 2010, 'BoohRoVA9WQ', 'Robert Downey Jr., Gwyneth Paltrow, Don Cheadle, Scarlett Johansson', 'Após confessar ao mundo ser o Homem de Ferro, Tony Stark (Robert Downey Jr.) passa a ser alvo do governo dos Estados Unidos, que deseja que ele entregue seu poderoso traje. Com a negativa, o governo passa a desenvolver um novo traje com o maior rival de Stark, Justin Hammer (Sam Rockwell). Jim Rhodes (Don Cheadle), o braço direito de Tony, é colocado no centro deste conflito, o que faz com que assuma a identidade de Máquina de Combate. Paralelamente, Ivan Vanko (Mickey Rourke) cria o alter-ego de Whiplash para se vingar dos atos da família Stark no passado. Para combater Whiplash e a perseguição do governo, Stark conta com o apoio de sua nova assistente, Natasha Romanoff (Scarlett Johansson), e de Nick Fury (Samuel L. Jackson), o diretor da S.H.I.E.L.D.', 0, NULL, NULL, NULL),
(NULL, 355, 'Pixels: O Filme', 'Pixels', 'Estados Unidos', 'Comédia', 'Chris Columbus', '15416816305be431dea683e.jpg', 105, 2015, 'R7N1Y5RlXeQ', 'Adam Sandler, Kevin James, Michelle Monaghan, Peter Dinklage, Ashley Benson', 'A humanidade sempre buscou vida fora da Terra e, em busca de algum contato, enviou imagens e sons variados sobre a cultura terrestre nos mais diversos satélites já lançados no universo. Um dia, um deles foi encontrado. Disposta a conquistar o planeta, a raça alienígena resolveu criar monstros digitais inspirados em videogames clássicos dos anos 1980. Para combatê-los, a única alternativa é chamar especialistas nos jogos: Sam Brenner (Adam Sandler), Eddie Plant (Peter Dinklage), Ludlow Lamonsoff (Josh Gad) e a tenente-coronel Violet Van Patten (Michelle Monaghan).', 0, NULL, NULL, NULL),
(NULL, 356, 'Homem de Ferro 3', 'Iron Man 3', 'Estados Unidos', 'Ação', 'Shane Black', '15416817115be4322f79de5.jpg', 130, 2013, 's7MHXDEdjS0', 'Robert Downey Jr., Gwyneth Paltrow, Don Cheadle, Guy Pearce', 'Desde o ataque dos chitauri a Nova York, Tony Stark (Robert Downey Jr.) vem enfrentando dificuldades para dormir e, quando consegue, tem terríveis pesadelos. Ele teme não conseguir proteger sua namorada Pepper Potts (Gwyneth Paltrow) dos vários inimigos que passou a ter após vestir a armadura do Homem de Ferro. Um deles, o Mandarim (Ben Kingsley), decide atacá-lo com força total, destruindo sua mansão e colocando a vida de Pepper em risco. Para enfrentá-lo Stark precisará ressurgir do fundo do mar, para onde foi levado junto com os destroços da mansão, e superar seu maior medo: o de fracassar.', 0, NULL, NULL, NULL),
(NULL, 357, 'Prenda-me Se For Capaz', 'Catch Me If You Can', 'Estados Unidos', 'Drama', 'Steven Spielberg', '15416817185be43236d7fd5.jpg', 141, 2002, '3dti4k4olys', 'Leonardo DiCaprio, Tom Hanks, Christopher Walken, Martin Sheen', 'Frank Abagnale Jr. (Leonardo DiCaprio) já foi médico, advogado e co-piloto, tudo isso com apenas 18 anos. Mestre na arte do disfarce, ele aproveita suas habilidades para viver a vida como quer e praticar golpes milionários, que fazem com que se torne o ladrão de banco mais bem-sucedido da história dos Estados Unidos com apenas 17 anos. Mas em seu encalço está o agente do FBI Carl Hanratty (Tom Hanks), que usa todos os meios que tem ao seu dispor para encontrá-lo e capturá-lo.', 0, NULL, NULL, NULL),
(NULL, 358, 'O Incrível Hulk', 'The Incredible Hulk', 'Estados Unidos', 'Ação', 'Louis Leterrier', '15416819435be4331707959.jpg', 112, 2008, 'xbqNb2PFKKA', 'Edward Norton, Liv Tyler, Tim Roth, William Hurt', 'Vivendo escondido e longe de Betty Ross (Liv Tyler), a mulher que ama, o cientista Bruce Banner (Edward Norton) busca um meio de retirar a radiação gama que está em seu sangue. Ao mesmo tempo ele precisa fugir da perseguição do general Ross (William Hurt), seu grande inimigo, e da máquina militar que tenta capturá-lo, na intenção de explorar o poder que faz com que Banner se transforme no Hulk.', 0, NULL, NULL, NULL),
(NULL, 359, 'Capitão América: O Primeiro Vingador', 'Captain America: The First Avenger', 'Estados Unidos', 'Ação', 'Joe Johnston', '15417056875be48fd719976.jpg', 124, 2011, 'TYziZe-2UOk', 'Chris Evans, Hayley Atwell, Sebastian Stan, Tommy Lee Jones', '2ª Guerra Mundial. Steve Rogers (Chris Evans) é um jovem que aceitou ser voluntário em uma série de experiências que visam criar o supersoldado americano. Os militares conseguem transformá-lo em uma arma humana, mas logo percebem que o supersoldado é valioso demais para pôr em risco na luta contra os nazistas. Desta forma, Rogers é usado como uma celebridade do exército, marcando presença em paradas realizadas pela Europa no intuito de levantar a estima dos combatentes. Para tanto passa a usar uma vestimenta com as cores da bandeira dos Estados Unidos, azul, branca e vermelha. Só que um plano nazista faz com que Rogers entre em ação e assuma a alcunha de Capitão América, usando seus dons para combatê-los em plenas trincheiras da guerra.', 0, NULL, NULL, NULL),
(NULL, 360, 'Capitão América: O Soldado Invernal', 'Captain America: The Winter Soldier', 'Estados Unidos', 'Ação', 'Irmãos Russo', '15417067825be4941e51172.jpg', 136, 2014, 'Fl89Ym_fQJc', 'Chris Evans, Samuel L. Jackson, Scarlett Johansson, Robert Redford', 'Dois anos após os acontecimentos em Nova York (Os Vingadores - The Avengers), Steve Rogers (Chris Evans) continua seu dedicado trabalho com a agência S.H.I.E.L.D. e também segue tentando se acostumar com o fato de que foi descongelado e acordou décadas depois de seu tempo. Em parceria com Natasha Romanoff (Scarlett Johansson), também conhecida como Viúva Negra, ele é obrigado a enfrentar um poderoso e misterioso inimigo chamado Soldado Invernal, que visita Washington e abala o dia a dia da S.H.I.E.L.D., ainda liderada por Nick Fury (Samuel L. Jackson).', 0, NULL, NULL, NULL),
(NULL, 361, 'Capitão América: Guerra Civil', 'Captain America: Civil War', 'Estados Unidos', 'Ação', 'Irmãos Russo', '15417073695be4966954947.jpg', 147, 2016, 'FRLYZn5PGuA', 'Chris Evans, Robert Downey Jr., Scarlett Johansson, Sebastian Stan', 'Steve Rogers (Chris Evans) é o atual líder dos Vingadores, super-grupo de heróis formado por Viúva Negra (Scarlett Johansson), Feiticeira Escarlate (Elizabeth Olsen), Visão (Paul Bettany), Falcão (Anthony Mackie) e Máquina de Combate (Don Cheadle). O ataque de Ultron fez com que os políticos buscassem algum meio de controlar os super-heróis, já que seus atos afetam toda a humanidade. Tal decisão coloca o Capitão América em rota de colisão com Tony Stark (Robert Downey Jr.), o Homem de Ferro.', 0, NULL, NULL, NULL),
(NULL, 363, 'Guardiões da Galáxia Vol.2', 'Guardians of the Galaxy Vol. 2', 'Estados Unidos', 'Aventura', 'James Gunn', '15417155345be4b64e22bcc.jpg', 136, 2017, 'i8nTNSQFI', 'Chris Pratt, Zoe Saldana, Dave Bautista, Vin Diesel', 'Agora já conhecidos como os Guardiões da Galáxia, os guerreiros viajam ao longo do cosmos e lutam para manter sua nova família unida. Enquanto isso tentam desvendar os mistérios da verdadeira paternidade de Peter Quill (Chris Pratt).', 0, NULL, NULL, NULL),
(NULL, 364, 'Homem-Formiga', 'Ant-Man', 'Estados Unidos', 'Ação', 'Peyton Reed', '15417161135be4b8915e66a.jpg', 117, 2015, 'wITUolzfkwI', 'Paul Rudd, Michael Douglas, Evangeline Lilly, Corey Stoll', 'Dr. Hank Pym (Michael Douglas) é o inventor da fórmula/ traje que permite o encolhimento. Anos depois da descoberta, precisa impedir que seu ex-pupilo Darren Cross (Corey Stoll) consiga replicar o feito e vender a tecnologia para HYDRA. Dr. Pym escolhe o trambiqueiro Scott Lang (Paul Rudd) à usar o traje do Homem-Formiga. Lang, que acabou de sair da prisão e está com dificuldade de achar um trabalho honesto, aceita.', 0, NULL, NULL, NULL),
(NULL, 365, 'Homem-Formiga e a Vespa', 'Ant-Man and the Wasp', 'Estados Unidos', 'Ação', 'Peyton Reed', '15417169125be4bbb04ca1c.jpg', 118, 2018, 'FarmFahNwK4', 'Paul Rudd, Evangeline Lilly, Michael Peña, Walton Goggins', 'Após ter ajudado o Capitão América na batalha contra o Homem de Ferro na Alemanha, Scott Lang (Paul Rudd) é condenado a dois anos de prisão domiciliar, por ter quebrado o Tratado de Sokovia. Diante desta situação, ele foi obrigado a se aposentar temporariamente do posto de super-herói. Restando apenas três dias para o término deste prazo, ele tem um estranho sonho com Janet Van Dyne (Michelle Pfeiffer), que desapareceu 30 anos atrás ao entrar no mundo quântico em um ato de heroísmo. Ao procurar o dr. Hank Pym (Michael Douglas) e sua filha Hope (Evangeline Lilly) em busca de explicações, Scott é rapidamente cooptado pela dupla para que possa ajudá-los em sua nova missão: construir um túnel quântico, com o objetivo de resgatar Janet de seu limbo.', 0, NULL, NULL, NULL),
(NULL, 366, 'Doutor Estranho', 'Doctor Strange', 'Estados Unidos', 'Aventura', 'Scott Derrickson', '15417173175be4bd454b7f5.jpg', 115, 2016, 'YUfWrIcX4zw', 'Benedict Cumberbatch, Chiwetel Ejiofor, Rachel McAdams, Benedict Wong, Tilda Swinton, Mads Mikkelsen, Michael Stuhlbarg, Benjamin Bratt', 'Stephen Strange (Benedict Cumberbatch) leva uma vida bem sucedida como neurocirurgião. Sua vida muda completamente quando sofre um acidente de carro e fica com as mãos debilitadas. Devido a falhas da medicina tradicional, ele parte para um lugar inesperado em busca de cura e esperança, um misterioso enclave chamado Kamar-Taj, localizado em Katmandu. Lá descobre que o local não é apenas um centro medicinal, mas também a linha de frente contra forças malignas místicas que desejam destruir nossa realidade. Ele passa a treinar e adquire poderes mágicos, mas precisa decidir se vai voltar para sua vida comum ou defender o mundo.', 0, NULL, NULL, NULL),
(NULL, 367, 'Homem-Aranha: De Volta Ao Lar', 'Spider-Man: Homecoming', 'Estados Unidos', 'Aventura', 'Jon Watts', '15417175275be4be17e7498.jpg', 133, 2017, 'x5Q0AzHr3FM', 'Tom Holland, Michael Keaton, Robert Downey Jr., Marisa Tomei', 'Depois de atuar ao lado dos Vingadores, chegou a hora do pequeno Peter Parker (Tom Holland) voltar para casa e para a sua vida, já não mais tão normal. Lutando diariamente contra pequenos crimes nas redondezas, ele pensa ter encontrado a missão de sua vida quando o terrível vilão Abutre (Michael Keaton) surge amedrontando a cidade. O problema é que a tarefa não será tão fácil como ele imaginava.', 0, NULL, NULL, NULL),
(NULL, 368, 'Homem-Aranha', 'Spider-Man', 'Estados Unidos', 'Aventura', 'Sam Raimi', '15417183345be4c13e905a6.jpg', 121, 2002, 'O7zvehDxttM', 'Tobey Maguire, Willem Dafoe, Kirsten Dunst, James Franco', 'Peter Parker (Tobey Maguire) é um jovem estudioso que vive com seus tios, Ben (Cliff Robertson) e May (Rosemary Harris), desde que seus pais faleceram. Inteligente e com um grande interesse pela ciência, Peter tem dificuldade em se relacionar com seus colegas, por ser tímido e por eles o considerarem um nerd. Até que, em uma demonstração científica, um acidente inesperado faz com que aranha modificada geneticamente Peter Peter.', 0, NULL, NULL, NULL),
(NULL, 369, 'Homem-Aranha 2', 'Spider-Man 2', 'Estados Unidos', 'Aventura', 'Sam Raimi', '15417189195be4c3878231e.jpg', 127, 2004, '1UAzz8ncM68', 'Tobey Maguire, Kirsten Dunst, James Franco, Alfred Molina', 'Após derrotar o Duende Verde a vida de Peter Parker (Tobey Maguire) muda por completo. Temendo que Mary Jane (Kirsten Dunst) sofra algum risco por ser ele o Homem-Aranha, Peter continua escondendo o amor que sente e se mantém longe dela. Ao mesmo tempo precisa lidar com Harry (James Franco), seu melhor amigo, cuja raiva pelo Homem-Aranha aumenta cada vez mais por considerá-lo como sendo o assassino de seu pai. Além disso sua tia May (Rosemary Harris) passa por uma fase difícil após a morte de seu tio Ben, estranhando também o comportamento do sobrinho. Enquanto precisa lidar com seus problemas particulares Peter recebe ainda uma má notícia: o surgimento do Dr. Octopus (Alfred Molina), um homem que possui tentáculos presos ao corpo.', 0, NULL, NULL, NULL),
(NULL, 370, 'Homem-Aranha 3', 'Spider-Man 3', 'Estados Unidos', 'Aventura', 'Sam Raimi', '15417192535be4c4d56052f.jpg', 139, 2007, '8_Urw-3ESIA', 'Tobey Maguire, Kirsten Dunst, James Franco, Thomas Haden Church', 'Peter Parker (Tobey Maguire) conseguiu encontrar um meio-termo entre seus deveres como o Homem-Aranha e seu relacionamento com Mary Jane (Kirsten Dunst). Porém o sucesso como herói e a bajulação dos fãs, entre eles Gwen Stacy (Bryce Dallas Howard), faz com que Peter se torne auto-confiante demais e passe a negligenciar as pessoas que se importam com ele. Porém a situação muda quando ele precisa enfrentar Flint Marko (Thomas Haden Church), mais conhecido como o Homem-Areia, que possui ligações com a morte do seu tio Ben. Tendo que lidar com o sentimento de vingança, Peter passa a usar um estranho uniforme negro, que se adapta ao seu corpo.', 0, NULL, NULL, NULL),
(NULL, 372, 'O Espetacular Homem-Aranha', 'The Amazing Spider-Man', 'Estados Unidos', 'Aventura', 'Marc Webb', '15417194935be4c5c5e4f19.jpg', 136, 2012, 'VW51Q_YBsNk', 'Andrew Garfield, Emma Stone, Rhys Ifans, Denis Leary, Stan Lee, Sally Field, Campbell Scott, Martin Sheen, Embeth Davidtz, Irrfan Khan', 'Peter Parker (Andrew Garfield) é um rapaz tímido e estudioso, que inicou há pouco tempo um namoro com a bela Gwen Stacy (Emma Stone), sua colega de colégio. Ele vive com os tios, May (Sally Field) e Ben (Martin Sheen), desde que foi deixado pelos pais, Richard (Campbell Scott) e Mary (Embeth Davidtz). Certo dia, o jovem encontra uma misteriosa maleta que pertenceu a seu pai. O artefato faz com que visite o laboratório do dr. Curt Connors (Rhys Ifans) na Oscorp. Parker está em busca de respostas sobre o que aconteceu com os pais, só que acaba entrando em rota de colisão com o perigoso alter-ego de Connors, o vilão Lagarto.', 0, NULL, NULL, NULL),
(NULL, 373, 'O Espetacular Homem-Aranha 2 - A Ameaça de Electro', 'The Amazing Spider-Man 2', 'Estados Unidos', 'Aventura', 'Marc Webb', '15417198845be4c74cccb6b.jpg', 142, 2014, 'XH7tR6yae48', 'Andrew Garfield, Emma Stone, Jamie Foxx, Dane DeHaan, Paul Giamatti, Shailene Woodley, Sally Field, Campbell Scott, Felicity Jones, Embeth Davidtz', 'Peter Parker (Andrew Garfield) adora ser o Homem-Aranha, por mais que ser o herói aracnídeo o coloque em situações bem complicadas, especialmente com sua namorada Gwen Stacy (Emma Stone) e sua tia May (Sally Field). Apesar disto, ele equilibra suas várias facetas da forma que pode. No momento, Peter está mais preocupado é com o fantasma da promessa feita ao pai de Gwen, de que se afastaria dela para protegê-la. Ao mesmo tempo ele precisa lidar com o retorno de um velho amigo, Harry Osborn (Dane DeHaan), e o surgimento de um vilão poderoso: Electro (Jamie Foxx).', 0, NULL, NULL, NULL),
(NULL, 374, 'Atividade Paranormal', 'Paranormal Activity', 'Estados Unidos', 'Terror', 'Oren Peli', '15417203615be4c929193b8.jpg', 86, 2007, 'u8wp9gDrcuE', 'Katie Featherston, Micah Sloat, Mark Fredrichs, Amber Armstrong', 'Desde criança Katie (Katie Featherston) ouve ruídos estranhos, sussurros e sente sensações inesperadas. Já adulta, ela mora com seu namorado Micah (Micah Sloat), que, meio cético quanto aos depoimentos, resolve usar uma câmera para gravar tudo o que acontece enquanto eles dormem e vivem dentro da casa. O que era para ser apenas uma forma de esclarecer o mistério torna-se uma experiência intrigante e assustadora.', 0, NULL, NULL, NULL),
(NULL, 375, 'Atividade Paranormal 2', 'Paranormal Activity 2', 'Estados Unidos', 'Terror', 'Tod Williams', '15417205985be4ca1616e7d.jpg', 91, 2010, 'Fsbtu9fIYO4', 'David Bierend, Brian Boland, Molly Ephraim, Katie Featherston', 'Kristi (Sprague Grayden), irmã de Katie (Katie Featherston), teve recentemente um filho com Daniel (Brian Boland), que já era pai de uma adolescente. Um dia, ao chegarem em casa, a encontram completamente revirada. Tentando evitar que a situação se repita, Daniel compra um sistema de segurança que instala câmeras em diversos cômodos e no lado de fora da casa. Ao mesmo tempo o casal e a adolescente têm por costume filmar tudo o que acontece ao seu redor. Até que um dia situações estranhas começam a acontecer, o que faz com que o trio acredite que a casa é mal assombrada.', 0, NULL, NULL, NULL),
(NULL, 376, 'Atividade Paranormal 3', 'Paranormal Activity 3', 'Estados Unidos', 'Terror', 'Henry Joost', '15417208495be4cb1199143.jpg', 83, 2011, 'f4XrdUXxOE', 'Lauren Bittner, Christopher Nicholas Smith, Chloe Csengery, Jessica Tyler Brown', 'Dennis (Christopher Nicholas Smith) adora filmar e possuí até uma ilha de edição em casa, montada na garagem. Casado com Julie (Lauren Bittner), com quem tem duas lindas filhas Katie (Chloe Csengery) e Kristi (Jessica Tyler Brown), ele resolve propor a ela que seja feita uma filmagem de uma transa dos dois. O que ele não contava é que um terremoto iria atrapalhar o momento de fetiche, mas também revelaria uma estranha imagem em sua gravação. Curioso com o fato, ele mostra para a esposa que não liga e também para um amigo (Dustin Ingram), que fica igualmente intrigado. Os dois acabam instalando mais de uma câmera na casa e o que eles passam a ver marcará para sempre o futuro de todos.', 0, NULL, NULL, NULL),
(NULL, 377, 'Atividade Paranormal 4', 'Paranormal Activity 4', 'Estados Unidos', 'Terror', 'Henry Joost', '15417210215be4cbbdec0c3.jpg', 88, 2012, 'gXTXhtgsv04', 'Katie Featherston, Kathryn Newton, Matt Shively, Aiden Lovekamp', 'Cinco anos após Katie (Kathie Featherston) matar a irmã Kristi (Sprague Grayden) e o cunhado Daniel (Brian Boland) e levar consigo o sobrinho Hunter, ela vive com o pequeno Robbie (Brady Allen) em uma casa. Do outro lado da rua mora a adolescente Alice (Kathryn Newton), que acompanha os passos do garoto juntamente com o amigo Alex (Matt Shively). Ambos acham Robbie bastante estranho, principalmente quando ele fica alguns dias na casa de Alice após Katie ter um problema e ir parar no hospital. Aos poucos Robbie se torna amigo de Wyatt, o irmão caçula de Alice, atraindo-o para um universo perigoso.', 0, NULL, NULL, NULL),
(NULL, 378, 'Atividade Paranormal: Marcados Pelo Mal', 'Paranormal Activity: The Marked Ones', 'Estados Unidos', 'Terror', 'Christopher Landon', '15417211615be4cc49b3a8f.jpg', 84, 2014, 'v9JflFySYlc', 'Andrew Jacobs, Jorge Diaz, Gabrielle Walsh, Renee Victor', 'Jesse (Andrew Jacobs) e Hector (Jorge Diaz) são grandes amigos, que acabaram de se formar no ensino médio. Fascinados em filmar com uma câmera portátil tudo o que acontece à sua volta, eles ficam intrigados ao ouvir sons estranhos vindos do apartamento de baixo da casa de Jesse. Lá vive Anna (Gloria Sandoval), uma senhora que tem fama de ser uma bruxa. Não demora muito para que os amigos passem a atormentá-la, o que faz com que Jesse seja ameaçado por ela. A súbita morte de Anna faz com que aumente ainda mais a curiosidade dos amigos, que decidem invadir a casa dela, mesmo estando lacrada pela polícia. É quando percebem que Anna pertencia a uma estranha seita, que tinha Jesse entre seus alvos.', 0, NULL, NULL, NULL),
(NULL, 379, 'Atividade Paranormal: Dimensão Fantasma', 'Paranormal Activity: The Ghost Dimension', 'Estados Unidos', 'Terror', 'Gregory Plotkin', '15417215275be4cdb715add.jpg', 88, 2015, '8Oi57l1AYTo', 'Chris J. Murray, Brit Shaw, Ivy George, Dan Gill', 'Quando se muda para uma nova casa com a família, Ryan Fleege (Chris J. Murray) descobre uma caixa com dezenas de fitas cassetes de décadas atrás. Estranhamente, as imagens parecem se comunicar com os vivos. Procurando mais, Ryan encontra uma câmera diferente, capaz de registrar atividades paranormais. Com a ajuda da esposa, do irmão e da filha, ele passa a gravar fenômenos malignos que ameaçam seus entes queridos.', 0, NULL, NULL, NULL),
(NULL, 380, 'O Quebra-Nozes e os Quatro Reinos', 'The Nutcracker and the Four Realms', 'Estados Unidos', 'Aventura', 'Lasse Hallström, Joe Johnston', '15417219735be4cf7542fb0.jpg', 99, 2018, 'IkoVX2FhZPw', 'Mackenzie Foy, Tom Sweet, Meera Syal, Ellie Bamber', 'Clara (Mackenzie Foy), jovem esperta e independente, perde a única chave mágica capaz de abrir um presente de valor incalculável dado por seu padrinho (Morgan Freeman). Safa na solução de problemas, ela decide então iniciar uma jornada de resgate que a leva pelo Reino dos Doces, o Reino das Neves, o Reino das Flores e o sinistro Quarto Reino.', 0, NULL, NULL, NULL),
(NULL, 381, 'Venom', 'Venom', 'Estados Unidos', 'Ação', 'Ruben Fleischer', '15417222035be4d05bcdd5a.jpg', 112, 2018, 'NuYgCOvs4eU', 'Tom Hardy, Michelle Williams, Riz Ahmed, Scott Haze', 'San Francisco, Estados Unidos. Eddie Brock (Tom Hardy) é um jornalista investigativo, que tem um quadro próprio em uma emissora local. Um dia, ele é escalado para entrevistar Carlton Drake (Riz Ahmed), o criador da Fundação Vida, que tem investido bastante em missões espaciais de forma a encontrar possíveis usos medicinais para a humanidade. Após acessar um documento sigiloso enviado à sua namorada, a advogada Anne Weying (Michelle Williams), Brock descobre que Drake tem feito experimentos científicos em humanos. Ele resolve denunciar esta situação durante a entrevista, o que faz com que seja demitido. Seis meses depois, o ainda desempregado Brock é procurado pela dra. Dora Skirth (Jenny Slate) com uma denúncia: Drake estaria usando simbiontes alienígenas em testes com humanos, muitos dele', 0, NULL, NULL, NULL),
(NULL, 382, 'Deadpool 2', 'Deadpool 2', 'Estados Unidos', 'Comédia', 'David Leitch', '15417226045be4d1ec34bff.jpg', 119, 2018, '1P9OzWX6nzE', 'Ryan Reynolds, Josh Brolin, Morena Baccarin, Julian Dennison', 'Quando o super soldado Cable (Josh Brolin) chega em uma missão para assassinar o jovem mutante Russel (Julian Dennison), o mercenário Deadpool (Ryan Reynolds) precisa aprender o que é ser herói de verdade para salvá-lo. Para isso, ele recruta seu velho amigo Colossus e forma o novo grupo X-Force, sempre com o apoio do fiel escudeiro Dopinder (Karan Soni).', 0, NULL, NULL, NULL),
(NULL, 383, 'A 13ª Emenda', '13th', 'Estados Unidos', 'Documentário', 'Ava DuVernay', '15417228815be4d301afcf6.jpg', 100, 2016, 'h4uGff8OScM', 'Melina Abdullah, Michelle Alexander, Cory Booker, Dolores Canales', 'Documentário que discute a décima terceira emenda à Constituição dos Estados Unidos - \"Não haverá, nos Estados Unidos ou em qualquer lugar sujeito a sua jurisdição, nem escravidão, nem trabalhos forçados, salvo como punição de um crime pelo qual o réu tenha sido devidamente condenado\" - e seu terrível impacto na vida dos afro-americanos.', 0, NULL, NULL, NULL),
(NULL, 384, 'Death Note', 'Death Note', 'Estados Unidos', 'Suspense', 'Adam Wingard', '15417234115be4d5132bbf2.jpg', 101, 2017, 'qkw_l9RXOPU', 'Nat Wolff, Lakeith Stanfield, Margaret Qualley, Shea Whigham', 'Seattle, Estados Unidos. Light Turner (Nat Wolff) é um estudante brilhante que, um dia, encontra um caderno que repentinamente cai do céu. Trata-se do Death Note, que permite ao seu portador matar qualquer pessoa que conheça a partir da mera anotação do nome do alvo numa de suas páginas. Sob a influência de Ruyk (Willem Dafoe), o dono do caderno, Light passa a usá-lo para eliminar criminosos e pessoas que escaparam da justiça. A súbita onda de assassinatos faz com que ele seja endeusado por muitos, que o apelidaram de Kira, mas também atrai a atenção de um enigmático e também brilhante detetive, chamado L (Lakeith Stanfield).', 0, NULL, NULL, NULL),
(NULL, 385, 'Bright', 'Bright', 'Estados Unidos', 'Ação', 'David Ayer', '15417236885be4d628d0a35.jpg', 117, 2017, '2kd0lX8Y8kg', 'Will Smith, Joel Edgerton, Noomi Rapace, Edgar Ramírez', 'Em um mundo futurista, seres humanos convivem em harmônia com seres fantásticos, como fadas e ogros. Mesmo nesse cenário infrações da lei acontecem e um policial humano (Will Smith) especializado em crimes mágicos é obrigado a trabalhar junto com um orc (Joel Edgerton) para evitar que uma poderosa arma caia nas mãos erradas.', 0, NULL, NULL, NULL),
(NULL, 386, 'A Bruxa', 'The Witch', 'Estados Unidos', 'Terror', 'Robert Eggers', '15417241635be4d803407fe.jpg', 92, 2015, 'J8540hrMAf4', 'Anya Taylor-Joy, Ralph Ineson, Kate Dickie, Harvey Scrimshaw', 'O casal William e Katherine leva uma vida cristã com suas cinco crianças em uma comunidade extremamente religiosa, até serem expulsos do local por sua fé diferente daquela permitida pelas autoridades. A família passa a morar num local isolado, à beira do bosque, sofrendo com a escassez de comida. Um dia, o bebê recém-nascido desaparece. Teria sido devorado por um lobo? Sequestrado por uma bruxa? Enquanto buscam respostas à pergunta, cada membro da família enfrenta seus piores medos e seu lado mais condenável.', 0, NULL, NULL, NULL),
(NULL, 387, 'Comer Rezar Amar', 'Eat Pray Love', 'Estados Unidos', 'Drama', 'Ryan Murphy', '15417242775be4d87596226.jpg', 133, 2010, 'cji7pUWhBi8', 'Julia Roberts, I. Gusti Ayu Puspawati, Hadi Subiyanto, Billy Crudup', 'Elizabeth (Julia Roberts) descobre que sempre teve problemas nos seus relacionamentos amorosos. Um dia, ela larga tudo, marido, trabalho, amigos, decidida a viver novas experiências em lugares diferentes por um ano inteiro. E parte para a Índia, Itália e Bali, para se reencontrar numa grande viagem de auto conhecimento.', 0, NULL, NULL, NULL),
(NULL, 389, 'O Bom Dinossauro', 'The Good Dinosaur', 'Estados Unidos', 'Animação', 'Peter Sohn', '15417244135be4d8fdadaca.jpg', 93, 2015, 'A6z79w5fdDU', 'Jeffrey Wright, Frances McDormand, Maleah Nipay-Padilla, Ryan Teeple', 'Os dinossauros foram extintos após a colisão de um gigantesco asteróide com o planeta Terra. E se este evento não tivesse ocorrido? O filme parte desta premissa para trazer a história de dinossauros que ainda hoje controlam o planeta. E mostra a amizade de Arlo, um dinossauro adolescente, com um jovem menino humano, Spot.', 0, NULL, NULL, NULL),
(NULL, 390, 'O Segredo de Brokeback Mountain', 'Brokeback Mountain', 'Estados Unidos', 'Drama, Romance, LGBT', 'Ang Lee', '15417245855be4d9a9bec0e.jpg', 134, 2005, 'ysuEta5MolY', '', 'Jack Twist (Jake Gyllenhaal) e Ennie Del Mar (Heath Ledger) são dois jovens que se conhecem no verão de 1963, após serem contratados para cuidar das ovelhas de Joe Aguirre (Randy Quaid) em Brokeback Mountain. Jack deseja ser cowboy e está trabalhando no local pelo 2º ano seguido, enquanto que Ennie pretende se casar com Alma (Michelle Williams) tão logo o verão acabe. Vivendo isolados por semanas, eles se tornam cada vez mais amigos e iniciam um relacionamento amoroso. Ao término do verão cada um segue sua vida, mas o período vivido naquele verão irá marcar suas vidas para sempre.', 0, NULL, NULL, NULL),
(NULL, 391, 'Que Horas Ela Volta?', 'Que Horas Ela Volta?', 'Brasil', 'Drama', 'Anna Muylaert', '15417247695be4da6132abe.jpg', 112, 2015, 'Dffs46VCJ_g', NULL, 'A pernambucana Val (Regina Casé) se mudou para São Paulo a fim de dar melhores condições de vida para sua filha Jéssica. Com muito receio, ela deixou a menina no interior de Pernambuco para ser babá de Fabinho, morando integralmente na casa de seus patrões. Treze anos depois, quando o menino (Michel Joelsas) vai prestar vestibular, Jéssica (Camila Márdila) lhe telefona, pedindo ajuda para ir à São Paulo, no intuito de prestar a mesma prova. Os chefes de Val recebem a menina de braços abertos, só que quando ela deixa de seguir certo protocolo, circulando livremente, como não deveria, a situação se complica.', 0, NULL, NULL, NULL),
(NULL, 392, 'Uma Dobra no Tempo ', 'A Wrinkle in Time', 'Estados Unidos', 'Fantasia', 'Ava DuVernay', '15417248705be4dac67a445.jpg', 109, 2018, 'eSX_4Zj8YLE', 'Storm Reid, Oprah Winfrey, Reese Witherspoon, Mindy Kaling', 'Os irmãos Meg (Storm Reid) e Charles (Deric McCabe) decidem reencontrar o pai (Chris Pine), um cientista que trabalha para o governo e está desaparecido desde que se envolveu em um misterioso projeto. Eles contarão com a ajuda do colega Calvin (Levi Miller) e de três excêntricas mulheres em uma ousada jornada por diferentes lugares do universo.', 0, NULL, NULL, NULL),
(NULL, 393, 'Zodíaco ', 'Zodiac', 'Estados Unidos', 'Suspense', 'David Fincher', '15417250245be4db60d86a7.jpg', 157, 2007, 'JAoIo0dq_Bs', 'Jake Gyllenhaal, Mark Ruffalo, Anthony Edwards, Robert Downey Jr.', 'Três cartas diferentes chegam aos jornais San Francisco Chronicle, San Francisco Examiner e Vallejo Times-Herald, enviadas pelo mesmo remetente. A carta enviada ao Chronicle trazia a confissão de um assassino e as três juntas formavam um código que supostamente revelaria a identidade do criminoso. O assassino exigia que as cartas fossem publicadas, caso contrário mais pessoas morreriam. Um casal de Salinas consegue decodificar a mensagem, mas é Robert Graysmith (Jake Gyllenhaal), um tímido cartunista, quem descobre sua intenção oculta: uma referência ao filme \"Zaroff, o Caçador de Vidas\" (1932). Os assassinatos e as cartas se sucedem, provocando pânico na população de San Francisco.', 0, NULL, NULL, NULL),
(NULL, 394, 'Já Estou com Saudades', 'Miss You Already', 'Reino Unido', 'Comédia dramática', 'Catherine Hardwicke', '15417635065be571b232356.jpg', 112, 2015, '5hhWKe-hqtU', 'Drew Barrymore, Shola Adewusi, Toni Collette, Grace Schneider', 'Jess (Drew Barrymore) e Milly (Toni Collette) são melhores amigas desde a infância. Enquanto Milly se casou, teve dois filhos e construiu uma carreira de sucesso, Jess decidiu levar uma vida pacata ao lado do marido Jago (Paddy Considine). Após se submeter a um tratamento, Jess enfim consegue engravidar. Mas a notícia vem justamente quando Milly descobre ter câncer de mama e precisa passar por quimioterapia, o que necessitará do apoio não apenas da amiga, mas de toda a família.', 0, NULL, NULL, NULL),
(NULL, 395, 'Mad Max: Estrada da Fúria', 'Mad Max: Fury Road', 'Austrália', 'Ação', 'George Miller', '15417636465be5723e39aec.jpg', 120, 2015, 'NH5TpcVaqCQ', 'Tom Hardy, Charlize Theron, Nicholas Hoult, Hugh Keays-Byrne', 'Após ser capturado por Immortan Joe, um guerreiro das estradas chamado Max (Tom Hardy) se vê no meio de uma guerra mortal, iniciada pela Imperatriz Furiosa (Charlize Theron) na tentativa se salvar um grupo de garotas. Também tentanto fugir, Max aceita ajudar Furiosa em sua luta contra Joe e se vê dividido entre mais uma vez seguir sozinho seu caminho ou ficar com o grupo.', 0, NULL, NULL, NULL),
(NULL, 396, 'Meu Passado Me Condena - O Filme', 'Meu Passado Me Condena - O Filme', 'Brasil', 'Comédia', 'Julia Rezende', '15417637845be572c8939ce.jpg', 102, 2012, 'Vspkm43x0Ec', NULL, 'Quando Fábio (Fábio Porchat) e Miá (Miá Mello) se encontram, é amor à primeira vista. Eles se casam um mês depois de se conhecerem e decidem viajar à Europa em um cruzeiro em lua de mel. Só que, durante a viagem, eles encontram seus antigos namorados, Beto (Alejandro Claveaux) e Laura (Juliana Didone), que hoje estão juntos e também passam sua lua de mel.', 0, NULL, NULL, NULL),
(NULL, 397, 'Meu Passado Me Condena 2', 'Meu Passado Me Condena 2: O Filme', 'Brasil', 'Comédia', 'Julia Rezende', '15417639375be57361bc21c.jpg', 105, 2015, '4MZY1kQgP8w', 'Fábio Porchat, Miá Mello, Inez Viana, Marcelo Valle', 'A vida de casado dos apaixonado Fábio (Fábio Porchat) e Miá (Miá Mello) cai na rotina quando, as diferenças, que não são poucas, precisam ser enfrentadas. Após Fábio esquecer o terceiro aniversário de casamento, Miá decide pedir um tempo. Quando o avô de Fábio, que mora em Portugal, o comunica que ficou viúvo, ele enxerga nesta viagem para o funeral uma oportunidade de salvar seu casamento.', 0, NULL, NULL, NULL),
(NULL, 398, 'O Que te Faz Mais Forte', 'Stronger', 'Estados Unidos', 'Drama', 'David Gordon Green', '15417641365be57428b1c08.jpg', 119, 2017, 'fvqzzwbeWM8', 'Jake Gyllenhaal, Tatiana Maslany, Miranda Richardson, Richard Lane Jr.', 'As memórias de Jeff Bauman (Jake Gyllenhaal) sobre o dia mais impactante de sua vida, 15 de abril de 2013. Enquanto esperava seu grande amor, Erin (Tatiana Maslany), finalizar a participação na Maratona de Boston, ele foi atingido por uma das bombas do atentado terrorista e perdeu as duas pernas.', 0, NULL, NULL, NULL),
(NULL, 399, 'O Sexto Sentido ', 'The Sixth Sense', 'Estados Unidos', 'Suspense', 'M. Night Shyamalan', '15417659555be57b439e9cc.jpg', 107, 1999, 'tYhThPMB7zU', 'Bruce Willis, Haley Joel Osment, Toni Collette, Olivia Williams', 'O psicólogo infantil Malcolm Crowe (Bruce Willis) abraça com dedicação o caso de Cole Sear (Haley Joel Osment). O garoto, de 8 anos, tem dificuldades de entrosamento no colégio e vive paralisado de medo. Malcolm, por sua vez, busca se recuperar de um trauma sofrido anos antes, quando um de seus pacientes se suicidou na sua frente.', 0, NULL, NULL, NULL),
(NULL, 400, 'O Show de Truman - O Show da Vida', 'The Truman Show', 'Estados Unidos', 'Drama', 'Peter Weir', '15417661125be57be0cafbe.jpg', 103, 1998, '7O7phwapT3k', 'Jim Carrey, Laura Linney, Noah Emmerich, Natascha McElhone', 'Truman Burbank (Jim Carrey) é um pacato vendedor de seguros que leva um vida simples com sua esposa Meryl Burbank (Laura Linney). Porém algumas coisas ao seu redor fazem com que ele passe a estranhar sua cidade, seus supostos amigos e até sua mulher. Após conhecer a misteriosa Lauren (Natascha McElhone), ele fica intrigado e acaba descobrindo que toda sua vida foi monitorada por câmeras e transmitida em rede nacional.', 0, NULL, NULL, NULL),
(NULL, 401, 'Os Estagiários', 'The Internship', 'Estados Unidos', 'Comédia', 'Shawn Levy', '15417661995be57c37c8f50.jpg', 119, 2013, 'iJNvxWemhI4', 'Vince Vaughn, Owen Wilson, Rose Byrne, Aasif Mandvi', 'Billy (Vince Vaughn) e Nick (Owen Wilson) são grandes amigos e trabalham juntos como vendedores de relógios. Eles são pegos de surpresa quando seu chefe (John Goodman) fecha a empresa, por acreditar que o negócio esteja ultrapassado. Com problemas financeiros, eles conseguem a inscrição em uma seleção de estágio no Google. Mesmo sem terem a garantia que serão contratados, eles partem para a sede da empresa e lá precisam lidar com a diferença de idade entre eles e os demais competidores.', 0, NULL, NULL, NULL),
(NULL, 402, 'Uma Beleza Fantástica', 'This Beautiful Fantastic', 'Reino Unido', 'Comédia dramática', 'Simon Aboud', '15417663235be57cb3723e7.jpg', 100, 2016, '41aY9JsFMO8', 'Mia Farkasovska, Jessica Brown Findlay, Anna Chancellor, Jeremy Irvine', 'Sonhando em uma dia ser uma respeita escritora de contos infantis, a jovem Bella Brown (Jessica Brown Findlay) vai cruzar com alguém que representa o oposto do que pretende ser: um velho rabugento, viúvo e de poucos amigos. Incrivelmente, ela vai criar um forte laço de amizade com ele, iniciando uma relação curiosa e inspiradora.', 0, NULL, NULL, NULL),
(NULL, 403, 'Velozes & Furiosos 7', 'Furious 7', 'Estados Unidos', 'Ação', 'James Wan', '15417664365be57d24db9e9.jpg', 137, 2015, 'jrVIS0ZSxow', 'Vin Diesel, Paul Walker, Jason Statham, Michelle Rodriguez', 'Após os acontecimentos em Londres, Dom (Vin Diesel), Brian (Paul Walker), Letty (Michelle Rodriguez) e o resto da equipe tiveram a chance de voltar para os Estados Unidos e recomeçarem suas vidas. Mas a tranquilidade do grupo é destruída quando Deckard Shaw (Jason Statham), um assassino profissional, quer vingança pela morte de seu irmão. Agora, a equipe tem que se reunir para impedir este novo vilão. Mas dessa vez, não é só sobre ser veloz. A luta é pela sobrevivência.', 0, NULL, NULL, NULL),
(NULL, 404, 'Velozes & Furiosos - Desafio em Tóquio', 'The Fast and the Furious: Tokyo Drift', 'Estados Unidos', 'Ação', 'Justin Lin', '15417665965be57dc4a7740.jpg', 104, 2006, 'HVQWZkd8cDk', 'Lucas Black, Damien Marzette, Trula M. Marcus, Zachery Ty Bryan', 'Sean Boswell (Lucas Black) é um adolescente superficial e infeliz, que usa as corridas de rua como válvula de escape. Seu envolvimento irresponsável nas corridas fez com que Sean tivesse problemas com a polícia anteriormente. Após bater com o carro, e como forma de evitar a prisão, Sean é enviado para Tóquio, onde passa a morar com seu pai (Brian Goodman). Em sua nova cidade Sean fica inteiramente deslocado até conhecer Twinkie (Bow Wow), que lhe apresenta as corridas de drift. O drift é uma mistura de derrapagem e velocidade, que corre em circuitos bastante perigosos. Sean logo se empolga com a novidade, o que faz com que se envolva com os corredores locais.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 405, 'Velozes & Furiosos ', 'The Fast and the Furious', 'Estados Unidos', 'Ação', 'Rob Cohen', '15417667355be57e4f3ebe2.jpg', 106, 2001, 'L-97D6aySKM', 'Paul Walker, Vin Diesel, Michelle Rodriguez, Jordana Brewster', 'Dominic Toretto (Vin Diesel) é o líder de uma gangue de corridas de ruas em Los Angeles que está sendo investigado pela polícia por roubo de equipamentos eletrônicos. Para investigá-lo é enviado Brian O\'Conner (Paul Walker), que se infiltra na gangue na intenção de descobrir se Toretto é realmente o autor dos crimes ou se há alguém mais por trás deles.', 0, NULL, NULL, NULL),
(NULL, 406, 'Velozes & Furiosos 8', 'The Fate of the Furious', 'Estados Unidos', 'Ação', 'F. Gary Gray', '15417668395be57eb7d9269.jpg', 136, 2017, 'KvSlvtPnZTo', 'Vin Diesel, Jason Statham, Dwayne Johnson, Michelle Rodriguez', 'Dom (Vin Diesel) e Letty (Michelle Rodriguez) estão curtindo a lua de mel em Havana, mas a súbita aparição de Cipher (Charlize Theron) atrapalha os planos do casal. Ela logo arma um plano para chantagear Dom, de forma que ele traia seus amigos e passe a ajudá-la a obter ogivas nucleares. Tal situação faz com Letty reúna os velhos amigos, que agora precisam enfrentar Cipher e, consequentemente, Dom.', 0, NULL, NULL, NULL),
(NULL, 407, 'Velozes & Furiosos 6', 'Fast & Furious 6', 'Estados Unidos', 'Ação', 'Justin Lin', '15417669355be57f175c6ba.jpg', 130, 2013, 'KkzzyAUJqkY', 'Vera Miao, Adam Barnhardt, Tierney Deaton, Angie Evans', 'Desde que o golpe de Dom (Vin Diesel) e Brian (Paul Walker) no Rio de Janeiro deixou o grupo com US$100 milhões, os heróis se espalharam pelo globo. Mas a incapacidade de voltar para casa e viver em um lar tornou suas vidas incompletas. Enquanto isso, Hobbs (Dwayne Johnson) esteve perseguindo uma organização de mercenários sobre rodas, um grupo de homens cruéis divididos em 12 países, cujo mentor (Luke Evans) tem ajuda da destemida Letty (Michelle Rodriguez), a antiga namorada de Dom, que ele acreditava estar morta. A única maneira de parar este grupo de criminosos é superá-los nas ruas, por isso Hobbs pede a Dom para reunir um grupo de elite em Londres. A recompensa? Perdão a todos eles, para poderem voltar para as suas casas e tornarem suas famílias completas novamente.', 0, NULL, NULL, NULL),
(NULL, 408, 'Velozes & Furiosos 5 - Operação Rio ', 'Fast Five', 'Estados Unidos', 'Ação', 'Justin Lin', '15417670265be57f72f19c4.jpg', 130, 2011, 'FCN-B8SZVlo', 'Vin Diesel, Paul Walker, Jordana Brewster, Tyrese Gibson', 'Dominic Toretto (Vin Diesel) foi resgatado da prisão por sua irmã Mia (Jordana Brewster) e Brian O\'Conner (Paul Walker), que realizam um ousado resgate sobre rodas. Logo em seguida, ele desaparece. Brian e Mia vão até o Rio de Janeiro, onde encontram Vince (Matt Schulze). Ele propõe ao casal o roubo de carros que estão sendo levados em um trem, algo que, segundo ele, será uma operação simples que renderá um bom lucro. Durante a operação, Dominic reaparece e diz à irmã que os planos mudaram. Ela então leva um dos carros a um esconderijo em plena favela carioca, deixando Dominic e Brian enfrentando policiais e bandidos. Ao desmontar o carro, o trio descobre que ele contém um chip com todas as operações ilegais de Hernan Reis (Joaquim de Almeida), incluindo onde guarda o dinheiro arrecadado.', 0, NULL, NULL, NULL),
(NULL, 409, 'Velozes & Furiosos 4', 'Fast & Furious ', 'Estados Unidos', 'Ação', 'Justin Lin', '15417672275be5803b5b5ae.jpg', 100, 2009, 'yAr404wj--Y', 'Chin Yu, DaYoung \'Dada\' Kim, Sou Chang, Jimmy York', 'Depois de ser visto rumo ao México no filme que deu origem a série, Dominic \"Dom\" Toretto (Vin Diesel) reaparece na República Dominicana praticando seus golpes ao lado de sua namorada Letty (Michelle Rodriguez) e sua gangue. Com o FBI na sua cola, Dom decide fugir para não comprometer seus comparsas. Contudo, um assassinato cometido por um traficante de drogas acende nele uma sede de vingança que o faz cruzar novamente com o agente Brian O\'Conner (Paul Walker) numa perigosa missão.', 0, NULL, NULL, NULL),
(NULL, 410, '+ Velozes + Furiosos', '2 Fast 2 Furious', 'Estados Unidos', 'Ação', 'John Singleton', '15417673305be580a2a1d66.jpg', 107, 2003, 'ONs4_PtakGc', 'Paul Walker, Tyrese Gibson, Eva Mendes, Cole Hauser, Vin Diesel, Ludacris, Devon Aoki, Neal H. Moritz, Amaury Nolasco, Michael Ealy, James Remar', 'Após deixar a polícia, Brian O\'Conner (Paul Walker) é forçado a participar de uma nova missão: se infiltrar no crime organizado de Miami de forma a investigar sobre o transporte de dinheiro sujo para Carter Verone (Cole Hauser), o chefe do tráfico local. Para tanto ele recebe a ajuda de seu ex-colega Roman Pearce (Tyrese) e da agente secreta Monica Clemente (Eva Mendes).', 0, NULL, NULL, NULL),
(NULL, 411, 'Paris Pode Esperar', 'Paris Can Wait', 'Estados Unidos', 'Comédia', 'Eleanor Coppola', '15417674775be581350e154.jpg', 92, 2016, 'Dklz3v8bx9o', 'Diane Lane, Arnaud Viard, Alec Baldwin, Elise Tielrooy', 'Anne (Diane Lane) está casada com o produtor de cinema Michael (Alec Baldwin). Ele a ama muito, mas não tem tempo para dedicar à esposa. Por isso, no trajeto de Cannes até Paris, Anne é acompanhada pelo sócio de seu marido (Arnaud Viard). O trajeto deveria demorar sete horas, mas ao longo de várias paradas, eles passam a se conhecer melhor enquanto apreciam as paisagens francesas.', 0, NULL, NULL, NULL),
(NULL, 412, 'O Corvo', 'The Crow', 'Estados Unidos', 'Ação', 'Alex Proyas', '15417676095be581b9643c4.jpg', 102, 1994, 'ySI0q7Fcvig', 'Brandon Lee, Rochelle Davis, Ernie Hudson, Michael Wincott', 'Um ano após ter sido assassinado juntamente com sua noiva por uma gangue, Eric Draven (Brandon Lee), um músico de rock, retorna da sepultura com a ajuda de um misterioso corvo, com a intenção de se vingar de seus assassinos.', 0, NULL, NULL, NULL),
(NULL, 413, 'Jessabelle - O Passado Nunca Morre', 'Jessabelle', 'Estados Unidos', 'Terror', 'Kevin Greutert', '15417677605be582502e210.jpg', 90, 2014, 'GCT11921e_c', 'Sarah Snook, Joelle Carter, Mark Webber, David Andrews', 'Após sofrer um acidente automobilístico, Jessie (Sarah Snook) é forçada a retornar para a casa do pai, onde tenta lidar com suas pernas imobilizadas. Ela ainda terá de enfrentar a fúria de um espírito, chamado Jessabelle, que pode ter relação com as circunstâncias misteriosas de seu nascimento.', 0, NULL, NULL, NULL),
(NULL, 414, 'Guerra Mundial Z', 'World War Z', 'Estados Unidos', 'Ficção Científica', 'Marc Forster', '15417678865be582cecc1ea.jpg', 116, 2013, 'h58irlFbTz0', 'Brad Pitt, Mireille Enos, Daniella Kertesz, James Badge Dale', 'Uma terrível e misteriosa doença se espalha pelo mundo, transformando as pessoas em uma espécie de zumbis. A velocidade do contágio é impressionante e logo o Governo americano recruta um ex-investigador da ONU (Organização das Nações Unidas) para investigar o que pode estar acontecendo e assim salvar a humanidade, tendo em vista que as previsões são as mais catastróficas possíveis. Gerry Lane (Brad Pitt) tinha optado por dedicar mais tempo a sua esposa Karen (Mireille Enos) e as filhas, mas seu amor a pátria e o desejo de salvar sua família acabam contribuindo para que ele tope a missão. Agora, ele precisa percorrer o caminho inverso da contaminação para tentar entender as causas ou, ao menos, indentificar uma maneira de conter o contágio até que se descubra uma cura antes do apocalipse.', 0, NULL, NULL, NULL),
(NULL, 415, 'Curtindo a Vida Adoidado', 'Ferris Bueller', 'Estados Unidos', 'Comédia', 'John Hughes', '15417680005be58340f1d4d.jpg', 103, 1986, 'WpO5V0FyByc', NULL, 'No último semestre do curso do colégio, Ferris Bueller (Matthew Broderick) sente um incontrolável desejo de matar a aula e planeja um grande programa na cidade com sua namorada (Mia Sara), seu melhor amigo (Alan Ruck) e uma Ferrari. Só que para poder realizar seu desejo ele precisa escapar do diretor do colégio (Jeffrey Jones) e de sua irmã (Jennifer Grey).', 0, NULL, NULL, NULL),
(NULL, 416, 'Elle', 'Elle', 'França', 'Suspense', 'Paul Verhoeven', '15417895575be5d775a2360.jpg', 130, 2016, 'LiIexR_lL4k', 'Isabelle Huppert, Laurent Lafitte, Anne Consigny, Charles Berling', 'Michèle (Isabelle Huppert) é a executiva-chefe de uma empresa de videogames, a qual administra do mesmo jeito que administra sua vida amorosa e sentimental: com mão de ferro, organizando tudo de maneira precisa e ordenada. Sua rotina é quebrada quando ela é atacada por um desconhecido, dentro de sua própria casa. No entanto, ela decide não deixar que isso a abale. O problema é que o agressor misterioso ainda não desistiu dela.', 0, NULL, NULL, NULL),
(NULL, 417, 'Kill Bill: Volume 1', 'Kill Bill: Volume 1', 'Estados Unidos', 'Ação', 'Quentin Tarantino', '15417898055be5d86d69117.jpg', 111, 2003, '7kSuas6mRpk', 'Uma Thurman, Sonny Chiba, Lucy Liu, Daryl Hannah, David Carradine, Michael Madsen, Chiaki Kuriyama', 'A Noiva (Uma Thurman) é uma perigosa assassina que trabalhava em um grupo, liderado por Bill (David Carradine), composto principalmente por mulheres. Grávida, ela decide escapar dessa vida de violência e decide se casar, mas no dia da cerimônia seus companheiros de trabalho se voltam contra ela, quase a matando. Após cinco anos em coma, ela desperta sem um bebê e com um único desejo: vingança. A Noiva decide procurar, e matar, as cinco pessoas que destruiram o seu futuro, começando pelas perigosas assassinas Vernita Green (Vivica A. Fox) e O-Ren Ishii (Lucy Liu).', 0, NULL, NULL, NULL),
(NULL, 418, 'Kill Bill: Volume 2', 'Kill Bill: Volume 2', 'Estados Unidos', 'Ação', 'Quentin Tarantino', '15417899615be5d909d9d1c.jpg', 137, 2004, 'WTt8cCIvGYI', 'Uma Thurman, Daryl Hannah, David Carradine, Michael Madsen, Gordon Liu, Michael Parks, Bo Svenson, Samuel L. Jackson', 'Após ser traída por Bill (David Carradine) e seu antigo grupo, a Noiva assassina (Uma Thurman) fica à beira da morte por 4 anos. Após despertar do coma, ela vai atrás de cada um dos seus antigos companheiros para matá-los. Na segunda parte dessa busca por vingança, a noiva vai continuar sua procura por Bill, atacando os últimos dois sobreviventes do grupo: Budd (Michael Madsen) e Elle Driver (Daryl Hannah). O confronto com seu antigo mestre, e mandante da sua morte, vai revelar novas surpresas para a assassina.', 0, NULL, NULL, NULL),
(NULL, 420, 'Pulp Fiction - Tempos de Violência', 'Pulp Fiction', 'Estados Unidos', 'Crime, Neo Noir', 'Quentin Tarantino', '15417902535be5da2d543b0.jpg', 154, 1994, 's7EdQ4FqbhY', 'John Travolta, Samuel L. Jackson, Uma Thurman, Bruce Willis, Harvey Keitel, Ving Rhames Rosanna Arquette, Tim Roth', 'Vincent Vega (John Travolta) e Jules Winnfield (Samuel L. Jackson) são dois assassinos profissionais trabalham fazendo cobranças para Marsellus Wallace (Ving Rhames), um poderosos gângster. Vega é forçado a sair com a garota do chefe, temendo passar dos limites; enquanto isso, o pugilista Butch Coolidge (Bruce Willis) se mete em apuros por ganhar luta que deveria perder.', 0, NULL, NULL, NULL),
(NULL, 421, 'Os Oito Odiados', 'The Hateful Eight', 'Estados Unidos', 'Crime', 'Quentin Tarantino', '15417904495be5daf14e209.jpg', 187, 2015, 'QPvuptLl_H8', 'Samuel L. Jackson, Kurt Russell, Jennifer Jason Leigh, Walton Goggins', 'Durante uma nevasca, o carrasco John Ruth (Kurt Russell) está transportando uma prisioneira, a famosa Daisy Domergue (Jennifer Jason Leigh), que ele espera trocar por grande quantia de dinheiro. No caminho, os viajantes aceitam transportar o caçador de recompensas Marquis Warren (Samuel L. Jackson), que está de olho em outro tesouro, e o xerife Chris Mannix (Walton Goggins), prestes a ser empossado em sua cidade. Como as condições climáticas pioram, eles buscam abrigo no Armazém da Minnie, onde quatro outros desconhecidos estão abrigados. Aos poucos, os oito viajantes no local começam a descobrir os segredos sangrentos uns dos outros, levando a um inevitável confronto entre eles.', 0, NULL, NULL, NULL),
(NULL, 422, 'Cães de Aluguel', 'Reservoir Dogs', 'Estados Unidos', 'Crime, Suspense, Neo Noir', 'Quentin Tarantino', '15417907195be5dbfff14ce.jpg', 99, 1992, '3SfljD-TwJA', 'Harvey Keitel, Tim Roth, Michael Madsen, Chris Penn', 'Joe Cabot (Lawrence Tierney), um experiente criminoso, reuniu seis bandidos para um grande roubo de diamantes, mas estes seis homens não sabem nada um sobre os outros e cada um utiliza uma cor como codinome. Porém durante o assalto algo saiu errado, pois diversos policiais esperavam no local. Mr. White (Harvey Keitel) levou Mr. Orange (Tim Roth), que na fuga levou um tiro na barriga e morrerá se não tiver logo atendimento médico, para o armazém onde tinha sido combinado que todos se encontrassem. Logo depois chegou Mr. Pink (Steve Buscemi), que está certo que um deles é um policial disfarçado e eles precisam descobrir quem os traiu. Em um clima de acusações mútuas a situação fica cada vez mais insustentável.', 0, NULL, NULL, NULL),
(NULL, 424, 'Jackie Brown', 'Jackie Brown', 'Estados Unidos', 'Crime', 'Quentin Tarantino', '15417909105be5dcbe4f231.jpg', 154, 1997, 'G7HkBDNZV7s', 'Pam Grier, Samuel L. Jackson, Robert Forster, Bridget Fonda', 'Comissária de bordo (Pam Grier) trafica dinheiro para os Estados Unidos, a mando de um vendedor de armas. Quando dois policiais oferecem um acordo para que ela entregue o bandido, a mulher decide dar a volta em todos os envolvidos, com um olho na liberdade e outro numa mala cheia de dinheiro.', 0, NULL, NULL, NULL),
(NULL, 425, 'À Prova de Morte', 'Death Proof', 'Estados Unidos', 'Ação', 'Quentin Tarantino', '15417911835be5ddcf69830.jpg', 113, 2007, '2ubfvdZhYS4', 'Kurt Russell, Zoë Bell, Rosario Dawson, Vanessa Ferlito', 'Ao cair da noite, Jungle Julia (Sydney Tamiia Poitier), a DJ mais sexy de Austin, pode enfim se divertir com as suas duas melhores amigas. As três garotas saem noite adentro, atraindo a atenção de todos os freqüentadores masculinos dos bares e boates do Texas. Mas nem toda a atenção é inocente. Cobrindo de perto seus movimentos está Stuntman Mike (Kurt Russell), um rebelde inquieto e temperamental que se esconde atrás do volante do seu carro indestrutível.', 0, NULL, NULL, NULL),
(NULL, 426, 'X-Men - O Filme', 'X-Men', 'Estados Unidos', 'Fantasia, Herói, Ação, Aventura, Ficção Científica', 'Bryan Singer', '15417919485be5e0cc954bb.jpg', 104, 2000, '4FO_Awhd9IQ', 'Hugh Jackman, Patrick Stewart, Ian McKellen, Famke Janssen, Halle Berry, James Marsden, Anna Paquin, Tyler Mane, Ray Park, Rebecca Romjin, Stan Lee', 'Em um futuro próximo há pessoas que são o próximo degrau na escada evolucionária humana, os mutantes. Dotados de um fator X em sua carga genética, cada mutante desenvolve um tipo diferente de poder e muitas vezes precisam aprender a controlá-lo, pois só se manifesta na adolescência ou mesmo quando se tornam adultos. Os mutantes sofrem um grande preconceito, pois os humanos em geral não entendem os poderes deles e temem que os mutantes, por serem superiores às pessoas comuns, irão perseguir a raça humana. Do lado dos mutantes, o combate a esse preconceito não acontece de modo uniforme.', 0, NULL, NULL, NULL),
(NULL, 427, 'X-Men: O Confronto Final', 'X-Men: The Last Stand', 'Estados Unidos', 'Fantasia, Ação, Herói, Aventura, Ficção Científica', 'Brett Ratner', '15417925455be5e321c3b5c.jpg', 104, 2006, '_yM5h9Cbwzg', 'Hugh Jackman, Halle Berry, Ian McKellen, Patrick Stewart, Rebecca Romijn, Anna Paquin, Vinnie Jones, Kelsey Grammer, Ben Foster, Shawn Ashmore', 'É descoberta uma cura para os mutantes, que agora podem optar por manter seus poderes ou se tornarem seres humanos normais. A descoberta põe em campos opostos Magneto (Ian McKellen), que acredita que esta cura se tornará uma arma contra os mutantes, e os X-Men, liderados pelo professor Charles Xavier (Patrick Stewart).', 0, NULL, NULL, NULL),
(NULL, 428, 'X-Men Origens: Wolverine', 'X-Men Origins: Wolverine', 'Estados Unidos', 'Fantasia, Herói, Ação, Aventura', 'Gavin Hood', '15417927385be5e3e2ed586.jpg', 107, 2009, 's5GD3FCE4So', 'Hugh Jackman, Liev Schreiber, Danny Huston, Lynn Collins, Aaron Jeffery, Taylor Kitsch, Ryan Reynolds, Dominic Monaghan, Patrick Stewart, Troye Sivan', 'A Equipe X é formada apenas por mutantes, tendo fins militares. Entre seus integrantes estão Logan (Hugh Jackman), o selvagem Victor Creed (Liev Schreiber), o especialista em esgrima Wade Wilson (Ryan Reynolds), o teleportador John Wraith (Will i Am), o atirador David North (Daniel Henney), o extremamente forte Fred J. Dunes (Kevin Durand) e ainda Bradley (Dominic Monaghan), que manipula eletricidade. No comando está William Stryker (Danny Huston), que envolve alguns componentes do grupo no projeto Arma X, um experimento ultra-secreto. Entre eles está Logan, que precisa ainda lidar com o desfecho de seu romance com Raposa Prateada (Lynn Collins).', 0, NULL, NULL, NULL),
(NULL, 429, 'X-Men: Primeira Classe', 'X-Men: First Class', 'Estados Unidos', 'Fantasia, Ação, Herói, Aventura, Ficção Científica', 'Matthew Vaughn', '15417932755be5e5fb1464a.jpg', 131, 2011, 'G_DHMCsBZzg', 'James McAvoy, Jennifer Laurence, Michael Fassbender, Bill Milner, Kevin Bacon, Rose Byrne, Oliver Platt, Zoë Kravitz, Jason Flemyng, Nocholas Hoult', 'No início dos anos 1960, durante o auge da Guerra Fria, um mutante chamado Charles Xavier conhece um mutante chamado Erik Lehnsherr. Apesar de suas origens muito diferentes - Charles cresceu em uma família rica enquanto Erik perdeu seus pais em Auschwitz -, os dois se tornam grandes amigos. Enquanto o mundo oscila à beira de uma guerra nuclear, Charles e Erik unem forças com outros mutantes para salvar a humanidade. No entanto, um acontecimento separa os dois amigos.', 0, NULL, NULL, NULL),
(NULL, 431, 'X-Men: Dias de Um Futuro Esquecido', 'X-Men: Days of Future Past', 'Estados Unidos', 'Fantasia, Ação, Herói, Aventura, Ficção Científica', 'Bryan Singer', '15417936965be5e7a00b63b.jpg', 132, 2014, 'w1dIkYegWuQ', 'Hugh Jackman, James McAvoy, Michael Fassbender, Jennifer Lawrence, Patrick Stewart, Ian Mckellen, Hallem Berry, Ellen Page, Nicholas Hoult, Omar Sy', 'No futuro, os mutantes são caçados impiedosamente pelos Sentinelas, gigantescos robôs criados por Bolívar Trask (Peter Dinklage). Os poucos sobreviventes precisam viver escondidos, caso contrário serão também mortos. Entre eles estão o professor Charles Xavier (Patrick Stewart), Magneto (Ian McKellen), Tempestade (Halle Berry), Kitty Pryde (Ellen Page) e Wolverine (Hugh Jackman), que buscam um meio de evitar que os mutantes sejam aniquilados. O meio encontrado é enviar a consciência de Wolverine em uma viagem no tempo, rumo aos anos 1970. Lá ela ocupa o corpo do Wolverine da época, que procura os ainda jovens Xavier (James McAvoy) e Magneto (Michael Fassbender) para que, juntos, impeçam que este futuro trágico para os mutantes se torne realidade.', 0, NULL, NULL, NULL),
(NULL, 432, 'X-Men: Apocalipse', 'X-Men: Apocalypse', 'Estados Unidos', 'Fantasia, Ação, Herói, Aventura, Ficção Científica', 'Bryan Singer', '15417938635be5e8470a3e7.jpg', 144, 2016, '3vYpPwBKJ28', 'James McAvoy, Michael Fassbender, Jennifer Lawrence, Nicholas Hoult, Oscar Isaac, Rose Byrne, Evan Peters, Sophie Turner, Josh Helman, Tye Sheridan', 'Também conhecido como Apocalipse, En Sabah Nur (Oscar Isaac) é o mutante original. Após milhares da anos, ele volta a vida disposto a garantir sua supremacia e acabar com a humanidade. Ele seleciona quatro Cavaleiros nas figuras de Magneto (Michael Fassbender), Psylocke (Olivia Munn), Anjo (Ben Hardy) e Tempestade (Alexandra Shipp). Do outro lado, o professor Charles Xavier (James McAvoy) conta com uma série de novos alunos, como Jean Grey (Sophie Turner), Ciclope (Tye Sheridan) e Noturno (Kodi Smit-McPhee), além de caras conhecidas como Mística (Jennifer Lawrence), Fera (Nicholas Hoult) e Mercúrio (Evan Peters), para tentar impedir o vilão.', 0, NULL, NULL, NULL),
(NULL, 433, 'Wolverine: Imortal', 'The Wolverine', 'Estados Unidos', 'Fantasia', 'James Mangold', '15417943255be5ea150bf9d.jpg', 126, 2013, 'SQfzvZsI7qk', 'Hugh Jackman, Tao Okamoto, Rila Fukushima, Hiroyuki Sanada', 'Após matar Jean Grey para salvar a humanidade, Logan passou a viver sozinho na selva. Deprimido, ele é encontrado por uma jovem que foi enviada pelo seu pai adotivo Yashida, salvo por Logan anos atrás. Yashima deseja transferir seu fator de cura para Logan para que ele possa viver uma vida normal como mortal. Logan se recusa e acaba infectado por Víbora, uma mutante que é imune a qualquer veneno. Fragilizado, Logan acaba envolvido em um conflito que o obriga a enfrentar seus próprios demônios.', 0, NULL, NULL, NULL),
(NULL, 435, 'Mulheres do Século 20', '20th Century Women', 'Estados Unidos', 'Comédia dramática', 'Mike Mills', '15418918035be766db4578a.jpg', 119, 2016, 'EVL3AYkDqQg', 'Annette Bening, Elle Fanning, Greta Gerwig, Billy Crudup', 'Na Califórnia dos anos 70, uma mãe (Annette Bening) tenta cuidar de sua família da melhor forma possível enquanto também procura respostas para as vidas de suas duas jovens amigas - uma fotógrafa aficcionada pela cultura punk (Greta Gerwig), e uma amiga de seu filho (Elle Fanning).', 0, NULL, NULL, NULL),
(NULL, 436, 'Clube de Compras Dallas', 'Dallas Buyers Club', 'Estados Unidos', 'Biography, Drama', 'Jean-Marc Vallée', '15418920015be767a1da04e.jpg', 117, 2013, 'UZaQpgB9ZHg', 'Matthew McConaughey, Jennifer Garner, Jared Leto, Denis O\'Hare', 'Em 1986, o eletricista texano Ron Woodroof (Matthew McConaughey) é diagnosticado com AIDS e logo começa uma batalha contra a indústria farmacêutica. Procurando tratamentos alternativos, ele passa a contrabandear drogas ilegais do México.', 0, NULL, NULL, NULL),
(NULL, 437, 'O Sorriso de Monalisa', 'Mona Lisa Smile', 'Estados Unidos', 'Drama', 'Mike Newell', '15418921595be7683f45616.jpg', 117, 2003, 'l-JiWYt6T0s', 'Julia Roberts, Kirsten Dunst, Julia Stiles, Maggie Gyllenhaal', 'Katharine Watson (Julia Roberts) é uma recém-graduada professora que consegue emprego no conceituado colégio Wellesley, para lecionar aulas de História da Arte. Incomodada com o conservadorismo da sociedade e do próprio colégio em que trabalha, Katharine decide lutar contra estas normas e acaba inspirando suas alunas a enfrentarem os desafios da vida.', 0, NULL, NULL, NULL),
(NULL, 438, 'Estrelas Além do Tempo ', 'Hidden Figures', 'Estados Unidos', 'Biografia', 'Theodore Melfi', '15418924055be7693542090.jpg', 127, 2016, 'wx3PVtrU-Os', 'Taraji P. Henson, Octavia Spencer, Janelle Monáe, Kevin Costner', ' Em plena Guerra Fria, Estados Unidos e União Soviética disputam a supremacia na corrida espacial ao mesmo tempo em que a sociedade norte-americana lida com uma profunda cisão racial, entre brancos e negros. Tal situação é refletida também na NASA, onde um grupo de funcionárias negras é obrigada a trabalhar a parte. É lá que estão Katherine Johnson (Taraji P. Henson), Dorothy Vaughn (Octavia Spencer) e Mary Jackson (Janelle Monáe), grandes amigas que, além de provar sua competência dia após dia, precisam lidar com o preconceito arraigado para que consigam ascender na hierarquia da NASA.', 0, NULL, NULL, NULL),
(NULL, 439, 'Na Natureza Selvagem ', 'Into the Wild', 'Estados Unidos', 'Aventura', 'Sean Penn', '15418925105be7699e2784b.jpg', 148, 2007, '0YBDpPIhEYo', 'Emile Hirsch, Marcia Gay Harden, William Hurt, Jena Malone', 'Christopher McCandless (Emile Hirsch) é um jovem recém-formado, que decide viajar sem rumo pelos Estados Unidos em busca da liberdade. Durante sua jornada pela Dakota do Sul, Arizona e Califórnia ele conhece pessoas que mudam sua vida, assim como sua presença também modifica as delas. Até que, após dois anos na estrada, Christopher decide fazer a maior das viagens e partir rumo ao Alasca.', 0, NULL, NULL, NULL),
(NULL, 440, 'O Auto da Compadecida', 'O Auto da Compadecida', 'Brasil', 'Comédia', 'Guel Arraes', '15418926365be76a1c4b697.jpg', 95, 1999, 'XPuMu_ENzlg', 'Fernanda Montenegro, Matheus Nachtergaele, Selton Mello, Lima Duarte', 'As aventuras dos nordestinos João Grilo (Matheus Natchergaele), um sertanejo pobre e mentiroso, e Chicó (Selton Mello), o mais covarde dos homens. Ambos lutam pelo pão de cada dia e atravessam por vários episódios enganando a todos do pequeno vilarejo de Taperoá, no sertão da Paraíba. A salvação da dupla acontece com a aparição da Nossa Senhora (Fernanda Montenegro). Adaptação da obra de Ariano Suassuna.', 0, NULL, NULL, NULL),
(NULL, 441, 'O Predestinado ', 'Predestination', 'Austrália', 'Suspense', 'Irmãos Spierig', '15418928245be76ad8824eb.jpg', 97, 2014, 'ikOlvl3Xhx0', 'Ethan Hawke, Sarah Snook, Christopher Kirby, Christopher Sommers', 'Um agente temporal (Ethan Hawke) encara sua última missão após anos de viagens no tempo caçando criminosos e executando a lei. O desafio final será finalmente capturar seu inimigo mais desafiador, o homem que há muito o intriga e ludibria.', 0, NULL, NULL, NULL),
(NULL, 442, 'Meninas Malvadas', 'Mean Girls', 'Estados Unidos', 'Comédia', 'Mark Waters', '15418930695be76bcd38bd1.jpg', 97, 2004, 's5muZmb_9wA', 'Lindsay Lohan, Rachel McAdams, Tina Fey, Tim Meadows', 'Cady Heron (Lindsay Lohan) é uma garota que cresceu na África e sempre estudou em casa, nunca tendo ido a uma escola. Após retornar aos Estados Unidos com seus pais, ela se prepara para iniciar sua vida de estudante, se matriculando em uma escola pública. Logo Cady percebe como a língua venenosa de suas novas colegas pode prejudicar sua vida e, para piorar ainda mais sua situação, Cady se apaixona pelo garoto errado.', 0, NULL, NULL, NULL),
(NULL, 443, 'V de Vingança ', 'V for Vendetta', 'Estados Unidos', 'Ação', 'James McTeigue', '15418932075be76c57b4072.jpg', 132, 2005, 'fKbgJMoIjPU', 'Natalie Portman, Hugo Weaving, Stephen Rea, Stephen Fry', 'Em uma Inglaterra do futuro, onde está em vigor um regime totalitário, vive Evey Hammond (Natalie Portman). Ela é salva de uma situação de vida ou morte por um homem mascarado, conhecido apenas pelo codinome V (Hugo Weaving), que é extremamente carismático e habilidoso na arte do combate e da destruição. Ao convocar seus compatriotas a se rebelar contra a tirania e a opressão do governo inglês, V provoca uma verdadeira revolução. Enquanto Evey tenta saber mais sobre o passado de V, ela termina por descobrir quem é e seu papel no plano de seu salvador para trazer liberdade e justiça ao país.', 0, NULL, 1, NULL),
(NULL, 444, 'Os Goonies ', 'The Goonies', 'Estados Unidos', 'Aventura', 'Richard Donner', '15418933135be76cc132dca.jpg', 114, 1985, 'hJ2j4oWdQtU', 'Sean Astin, Josh Brolin, Jeff Cohen, Corey Feldman', 'Mikey Walsh and Brandon Walsh are brothers whose family is preparing to move because developers want to build a golf course in the place of their neighborhood -- unless enough money is raised to stop the construction of the golf course, and that', 0, NULL, NULL, NULL),
(NULL, 445, 'A Pele que Habito', 'La Piel que Habito', 'Espanha', 'Suspense', 'Pedro Almodóvar', '15418935625be76dbaa23ad.jpg', 117, 2011, '3BuZzfGWMV4', NULL, 'Roberto Ledgard (Antonio Banderas) é um conceituado cirurgião plástico, que vive com a filha Norma (Blanca Suárez). Ela possui problemas psicológicos causados pela morte da mãe, que teve o corpo inteiramente queimado após um acidente de carro e, ao ver sua imagem refletida na janela, se suicidou. O médico de Norma acredita que esteja na hora dela tentar a socialização com outras pessoas e, com isso, incentiva que Roberto a leve para sair.  O cirurgião pensa que a filha foi estuprada e elabora um plano para se vingar do suposto estuprador.', 0, NULL, NULL, NULL),
(NULL, 446, 'Um Lugar Silencioso', 'A Quiet Place', 'Estados Unidos', 'Suspense', 'John Krasinski', '15418938115be76eb31d3d6.jpg', 90, 2018, '8W6iMmhVDgE', 'Emily Blunt, John Krasinski, Millicent Simmonds, Noah Jupe', 'Em uma fazenda dos Estados Unidos, uma família do meio-oeste é perseguida por uma entidade fantasmagórica assustadora. Para se protegerem, eles devem permanecer em silêncio absoluto, a qualquer custo, pois o perigo é ativado pela percepção do som.', 0, NULL, NULL, NULL),
(NULL, 447, 'Eu, Tonya', 'I, Tonya', 'Estados Unidos', 'Biografia', 'Craig Gillespie', '15418940345be76f9280d3b.jpg', 120, 2017, '_YSP-ADogMA', 'Margot Robbie, Sebastian Stan, Allison Janney, Julianne Nicholson', 'Desde muito pequena exibindo talento para patinação artística no gelo, Tonya Harding (Margot Robbie) cresce se destacando no esporte e aguentando maus-tratos e humilhações por parte da agressiva mãe (Allison Janney). Entre altos e baixos na carreira e idas e vindas num relacionamento abusivo com Jeff Gillooly (Sebastian Stan), a atleta acaba envolvida num plano bizarro durante a preparação para os Jogos Olímpicos de Inverno de 1994. Baseado em fatos reais.', 0, NULL, NULL, NULL),
(NULL, 448, 'Corpo Fechado', 'Unbreakable', 'Estados Unidos', 'Suspense', 'M. Night Shyamalan', '15418943275be770b71bf10.jpg', 106, 2000, '2XDmYwIJuHM', 'Bruce Willis, Samuel L. Jackson, Robin Wright, Spencer Treat Clark', 'Um espantoso desastre de trem choca os Estados Unidos. Todos os passageiros morrem, com exceção de David Dunne (Bruce Willis), que sai completamente ileso do acidente, para espanto dos médicos e de si mesmo. Buscando explicações sobre o ocorrido, ele encontra Elijah Price (Samuel L. Jackson), um estranho que apresenta uma explicação bizarra para o fato.', 0, NULL, NULL, NULL),
(NULL, 449, 'Z - A Cidade Perdida', 'The Lost City of Z', 'Estados Unidos', 'Aventura', 'James Gray', '15418944815be77151a8943.jpg', 141, 2016, 'usx2MlwsNOc', 'Charlie Hunnam, Robert Pattinson, Sienna Miller, Tom Holland', 'A incrível história real do explorador britânico Percy Fawcett (Charlie Hunnam), que viaja para a Amazônia no século XX e descobre evidências de uma civilização avançada desconhecida que pode ter habitado a região. Depois de ter sido ridicularizado pelo corpo científico que considera as populações indígenas como \"selvagens\", Fawcett está determinado a retornar à sua amada selva e provar seu caso.', 0, NULL, NULL, NULL),
(NULL, 450, 'Precisamos Falar Sobre o Kevin ', 'We Need to Talk About Kevin', 'Estados Unidos', 'Drama', 'Lynne Ramsay', '15418950705be7739e6447c.jpg', 112, 2011, '37Hwj5j6z3Y', 'Tilda Swinton, John C. Reilly, Ezra Miller, Jasper Newell', 'Eva (Tilda Swinton) mora sozinha e teve sua casa e carro pintados de vermelho. Maltratada nas ruas, ela tenta recomeçar a vida com um novo emprego e vive temorosa, evitando as pessoas. O motivo desta situação vem de seu passado, da época em que era casada com Franklin (John C. Reilly), com quem teve dois filhos: Kevin (Jasper Newell/Ezra Miller) e Lucy (Ursula Parker). Seu relacionamento com o primogênito, Kevin, sempre foi complicado, desde quando ele era bebê. Com o tempo a situação foi se agravando mas, mesmo conhecendo o filho muito bem, Eva jamais imaginaria do que ele seria capaz de fazer.', 0, NULL, NULL, NULL),
(NULL, 451, 'Um Olhar do Paraíso ', 'The Lovely Bones', 'Estados Unidos', 'Drama', 'Peter Jackson', '15418957915be7766faf165.jpg', 135, 2009, 'u-aFYIfHoY8', 'Mark Wahlberg, Rachel Weisz, Susan Sarandon, Stanley Tucci', 'Susie Salmon (Saoirse Ronan) está voltando para casa quando é abordada por George Harvey (Stanley Tucci), um vizinho que mora sozinho. George a convence a entrar em um retiro, por ele construído. Lá dentro, Susie é assassinada. Os pais de Susie, Jack (Mark Wahlberg) e Abigail (Rachel Weisz), inicialmente se recusam a acreditar na morte da filha, mas precisam aceitar a situação quando seu gorro é encontrado em meio a um milharal, junto a destroços do retiro que estão repletos de sangue. Em meio às investigações, a polícia conversa com George mas não o coloca entre os suspeitos. Com o tempo Jack e Lindsey (Rose McIver), a irmã de Susie, passam a desconfiar de George. Toda esta situação é observada por Susie, que agora está em um local entre o paraíso e o inferno.', 0, NULL, NULL, NULL),
(NULL, 452, 'Jogo Perigoso', 'Gerald\'s Game', 'Estados Unidos', 'Suspense', 'Mike Flanagan', '15418961435be777cf7ed20.jpg', 103, 2017, 'gbFnj9GPSms', 'Carla Gugino, Bruce Greenwood, Chiara Aurelia, Carel Struycken', 'Jessie (Carla Gugino) e Gerald (Bruce Greenwood) formam um casal em crise. Para salvar o casamento, eles decidem viajar a uma casa isolada, na intenção de passar um fim de semana romântico. O marido leva algemas e decide prender a esposa a cama. Ela hesita a participar do jogo erótico, mas aceita. No entanto, uma vez presa, o marido sofre um ataque cardíaco e morre. Presa à cama, sem ter a quem pedir socorro, Jessie luta pela sobrevivência enquanto se recorda de traumas na infância.', 0, NULL, NULL, NULL),
(NULL, 453, 'A Visita', 'The Visit', 'Estados Unidos', 'Terror', 'M. Night Shyamalan', '15418962335be77829f12c0.jpg', 94, 2015, 'N152Ki1fzYM', 'Olivia DeJonge, Ed Oxenbould, Deanna Dunagan, Peter McRobbie', 'Um garoto (Ed Oxenbould) e sua irmã (Olivia DeJonge) são mandados pela mãe (Kathryn Hahn) para visitar seus avós que moram em uma remota fazenda. Não demora muito até que os irmãos descubram que os idosos estão envolvidos com coisas profundamente pertubadoras que colocam a vida dos netos em perigo.', 0, NULL, NULL, NULL),
(NULL, 454, 'Fragmentado', 'Split', 'Estados Unidos', 'Suspense', 'M. Night Shyamalan', '15418963305be7788aced28.jpg', 117, 2016, '7l4SzfMstLE', 'James McAvoy, Anya Taylor-Joy, Betty Buckley, Haley Lu Richardson', 'Kevin (James McAvoy) possui 23 personalidades distintas e consegue alterná-las quimicamente em seu organismo apenas com a força do pensamento. Um dia, ele sequestra três adolescentes que encontra em um estacionamento. Vivendo em cativeiro, elas passam a conhecer as diferentes facetas de Kevin e precisam encontrar algum meio de escapar.', 0, NULL, NULL, NULL),
(NULL, 455, 'The Fundamentals of Caring', 'The Fundamentals of Caring', 'Estados Unidos', 'Drama', 'Rob Burnett', '15418965215be77949c3096.jpg', 93, 2016, '35KUstvQxOU', 'Alex Huff, Donna Biscoe, Paul Rudd, Julia Denton', 'The Fundamentals of Caring acompanha a história de Ben, um escritor que decide ser cuidador após sofrer uma tragédia pessoal. Seu primeiro cliente, Trevor, é um jovem boca-suja de 18 anos com distrofia muscular. Juntos, eles embarcam em uma viagem por todos os lugares com os quais Trevor ficou obcecado assistindo ao noticiário de TV, incluindo seu Santo Graal: o buraco mais profundo do mundo. No caminho, uma garota sem rumo e uma futura mãe fazem a dupla encarar diversos problemas, nenhum simples. Aventurando-se pela primeira vez além das fronteiras de seu mundo milimetricamente calculado, eles descobrem o que é ter esperança e amigos de verdade.', 0, NULL, NULL, NULL),
(NULL, 456, 'Ex_Machina: Instinto Artificial ', 'Ex Machina', 'Reino Unido', 'Ficção Científica', 'Alex Garland', '15418967075be77a031f837.jpg', 108, 2014, '-mMcv-yWme8', 'Domhnall Gleeson, Alicia Vikander, Oscar Isaac, Sonoya Mizuno', 'Caleb (Domhnall Gleeson), um jovem programador de computadores, ganha um concurso na empresa onde trabalha para passar uma semana na casa de Nathan Bateman (Oscar Isaac), o brilhante e recluso presidente da companhia. Após sua chegada, Caleb percebe que foi o escolhido para participar de um teste com a última criação de Nathan: Ava (Alicia Vikander), uma robô com inteligência artificial. Mas essa criatura se apresenta sofisticada e sedutora de uma forma que ninguém poderia prever, complicando a situação ao ponto que Caleb não sabe mais em quem confiar.', 0, NULL, NULL, NULL),
(NULL, 457, 'Bonequinha de Luxo', 'Breakfast at Tiffany', 'Estados Unidos', 'Comédia', 'Blake Edwards', '15418971525be77bc0a5f10.jpg', 115, 1961, 'yrfYQDwC_I8', NULL, 'Holly Golightly (Audrey Hepburn) é uma garota de programa nova-iorquina que está decidida a casar-se com um milionário. Perdida entre a inocência, ambição e futilidade, ela toma seus cafés da manhã em frente à famosa joalheria Tiffany`s, na intenção de fugir dos problemas. Seus planos mudam quando conhece Paul Varjak (George Peppard), um jovem escritor bancado pela amante que se torna seu vizinho, com quem se envolve. Apesar do interesse em Paul, Holly reluta em se entregar a um amor que contraria seus objetivos de tornar-se rica.', 0, NULL, NULL, NULL),
(NULL, 458, 'Os Outros', 'The Others', 'Estados Unidos', 'Suspense', 'Alejandro Amenábar', '15418973715be77c9b89719.jpg', 104, 2001, 'BDhrr0frOJ0', 'Nicole Kidman, Fionnula Flanagan, Christopher Eccleston, Alakina Mann', 'Durante a 2ª Guerra Mundial, Grace (Nicole Kidman) decide por se mudar, juntamente com seus dois filhos, para uma mansão isolada na ilha de Jersey, a fim de esperar que seu marido retorne da guerra. Como seus filhos possuem uma estranha doença que os impedem de receber diretamente a luz do sol, a casa onde vivem está sempre em total escuridão. Eles vivem sozinhos seguindo religiosamente certas regras, como nunca abrir uma porta sem fechar a anterior, mas quando eles contratam empregados para a casa eles terminam quebrando estas regras, fazendo com que imprevisíveis consequências ocorram.', 0, NULL, NULL, NULL),
(NULL, 459, 'Gatinhas e Gatões', 'Sixteen Candles', 'Estados Unidos', 'Comédia', 'John Hughes', '15418975755be77d67788ce.png', 93, 1984, 'eDvDy9aiCak', 'Molly Ringwald, Justin Henry, Michael Schoeffling, Haviland Morris', 'Samantha Baker (Molly Ringwald) jamais imaginou que seu 16º aniversário seria um dos piores dias de sua vida. Sua família se esqueceu de seu aniversário, sua paixão platônica continua sendo platônica, o garoto mais esquisito da escola resolveu ficar no pé dela, e para completar, sua irmã vai casar, atraindo todas as atenções da família para sí. Será que Samantha vai conseguir se manter calma diante de tudo isto?', 0, NULL, NULL, NULL),
(NULL, 460, 'A Ganha-Pão', 'The Breadwinner', 'Irlanda', 'Animação', 'Nora Twomey ', '15418978005be77e48c8d63.jpg', 94, 2017, 'SrT-EgPgSSQ', 'Saara Chaudry, Soma Chhaya, Noorin Gulamgaus, Laara Sadiq', 'Parvana (Saara Chaudry) é uma jovem que vive em um Afeganistão governado pelas forças do Talibã. Quando seu pai é preso de maneira injusta, ela precisa se disfarçar como um menino para trabalhar e garantir o sustento de sua família.', 0, NULL, NULL, NULL),
(NULL, 461, '1922', '1922', 'Estados Unidos', 'Suspense', 'Zak Hilditch', '15419006495be78969d9807.jpg', 102, 2017, 'DnnopEAaIls', 'Thomas Jane, Molly Parker, Dylan Schmid, Kaitlyn Bernard', 'Wilfred James (Thomas Jane), até então um pacato fazendeiro, bola um plano macabro para solucionar o seu problema financeiro. Ele decide assassinar Arlette (Molly Parker), sua mulher. Mas, para conseguir fazer tudo direito, Wilfred precisa convencer Henry (Dylan Schmid), eu filho, a ajudá-lo.', 0, NULL, NULL, NULL),
(NULL, 462, 'Amy', 'Amy', 'Reino Unido', 'Documentário', 'Asif Kapadia', '15419011675be78b6fb4223.jpg', 128, 2015, 'HiMb_hj1fTw', 'Amy Winehouse, Lauren Gilbert, Juliette Ashby, Nick Shymansky', 'Ainda adolescente, Amy Winehouse já demonstrava para a família o talento vocal que possuía. Aos 18 anos ela já fazia shows na Inglaterra e, com o tempo, passou a ganhar fama. O sucesso do álbum \"Back to Black\" a tornou uma celebridade mundial, mas também fez com que seus problemas com álcool e drogas aumentassem exponencialmente.', 0, NULL, NULL, NULL),
(NULL, 463, 'Trama Fantasma', 'Phantom Thread', 'Estados Unidos', 'Drama', 'Paul Thomas Anderson', '15419016775be78d6da592d.jpg', 130, 2017, 'i4GjaTnbhiY', 'Vicky Krieps, Daniel Day-Lewis, Lesley Manville, Julie Vollono', 'Nos anos 1950, Reynolds Woodcock é um renomado e confiante estilista que trabalha ao lado da irmã, Cyril, para vestir grandes nomes da realeza e da elite britânica. Sua inspiração surge através das mulheres que, constantemente, entram e saem de sua vida. Mas tudo muda quando ele conhece a forte e inteligente Alma, que vira sua musa e amante.', 0, NULL, NULL, NULL),
(NULL, 464, 'Batman vs Superman: A Origem da Justiça', 'Batman v Superman: Dawn of Justice', 'Estados Unidos', 'Herói', 'Zack Snyder', '15419020265be78ecab53ee.jpg', 151, 2016, 'IHDgrNxO-5I', 'Ben Affleck, Henry Cavill, Amy Adams, Jesse Eisenberg', 'O confronto entre Superman e Zod em Metrópolis fez com que a população mundial se dividisse acerca da existência de extraterrestres na Terra. Enquanto muitos consideram o Superman como um novo deus, há aqueles que consideram extremamente perigoso que haja um ser tão poderoso sem qualquer tipo de controle. Bruce Wayne é um dos que acreditam nesta segunda hipótese. Com isso, sob o manto de um Batman violento e obcecado, eles se enfrentam enquanto o mundo se pergunta que tipo de herói precisa.', 0, NULL, NULL, NULL),
(NULL, 465, 'Gravidade', 'Gravity', 'Estados Unidos', 'Suspense', 'Alfonso Cuarón', '15419022585be78fb2f3617.jpg', 91, 2013, 'kC3rHl_US4Q', 'Sandra Bullock, George Clooney, Ed Harris, Orto Ignatiussen', 'Dra. Ryan Stone e o astronauta Matt Kowalsky trabalham juntos para sobreviver depois que um acidente os deixa completamente à deriva no espaço, sem ligação com a Terra e sem esperança de resgate.', 0, NULL, NULL, NULL),
(NULL, 466, 'Garota Exemplar', 'Gone Girl', 'Estados Unidos', 'Suspense', 'David Fincher', '15419025905be790fee87f7.jpg', 149, 2014, '8qrbA8WjJJo', 'Ben Affleck, Rosamund Pike, Neil Patrick Harris, Tyler Perry', 'No dia de seu quinto aniversário de casamento, Amy desaparece. Quando as aparências de uma união feliz começam a desmoronar, Nick, seu marido, torna-se o principal suspeito. Com a ajuda de sua irmã gêmea, ele tenta provar sua inocência, ao mesmo tempo em que investiga o que realmente aconteceu com a mulher.', 0, NULL, NULL, NULL),
(NULL, 467, 'Akira', 'Akira', 'Japão', 'Anime', 'Katsuhiro Ôtomo', '15419026965be7916891e78.jpg', 124, 1988, 'OLFZQhVOgYc', 'Mitsuo Iwata, Nozomu Sasaki, Mami Koyama, Tesshô Genda', 'Uma grande explosão fez com que Tóquio fosse destruída em 1988. Em seu lugar foi construída Neo Tóquio, que, em 2019, sofre com atentados terroristas por toda a cidade. Kaneda (Mitsuo Iwata) e Tetsuo (Nozomu Sasaki) são amigos que integram uma gangue de motoqueiros. Eles disputam rachas violentos com uma gangue rival, os Palhaços, até que um dia Tetsuo encontra Takashi (Tatsuhiko Nakamura), uma estranha criança com poderes que fugiu do hospital onde era mantido como cobaia. Tetsuo é ferido no encontro e antes de receber a ajuda dos amigos é levado por integrantes do exército, liderados pelo coronel Shikishima (Tarô Ishida). A partir de então Tetsuo passa a desenvolver poderes inimagináveis, o que faz com que seja comparado ao lendário Akira, responsável pela explosão de 1988. Paralelamente', 0, NULL, NULL, NULL),
(NULL, 468, 'Bom Comportamento', 'Good Time', 'Estados Unidos', 'Crime', 'Safdie', '15419027885be791c4f2f10.jpg', 101, 2017, '4UQYwPHXOUk', 'Robert Pattinson, Benny Safdie, Buddy Duress, Taliah Webster', 'O plano de Constantine Nikas era assaltar um banco e descolar uma boa quantia em dinheiro, mas nada sai como o planejado e seu irmão mais novo acaba sendo preso. Decidido a resgatá-lo, Constantine embarca em uma perigosa corrida contra o relógio, onde ele mesmo é o próximo alvo da polícia.', 0, NULL, NULL, NULL),
(NULL, 469, 'Projeto Flórida', 'The Florida Project', 'Estados Unidos', 'Drama', 'Sean Baker', '15419028775be7921d8ab4f.jpg', 111, 2017, 'iAgSk43ejuM', 'Brooklynn Prince, Christopher Rivera, Aiden Malik, Josie Olivo', 'Moonee, uma agitada garotinha, faz novas amizades nas redondezas dos parques Disney. Ela vive com a mãe em uma hospedagem de beira de estrada e as duas contam com a proteção do gerente Bobby na batalha diária pela sobrevivência.', 0, NULL, NULL, 1),
(NULL, 470, 'Com Amor, Simon', 'Love, Simon', 'Estados Unidos', 'LGBT', 'Greg Berlanti', '15419030225be792ae09d1e.jpg', 110, 2018, 'H0ByZNE6LQ4', 'Nick Robinson, Jennifer Garner, Josh Duhamel, Katherine Langford', 'Aos 17 anos, Simon Spier (Nick Robinson) aparentemente leva uma vida comum, mas sofre por esconder um grande segredo: nunca revelou ser gay para sua família e amigos. E tudo fica mais complicado quando ele se apaixona por um dos colegas de escola, anônimo, com quem troca confidências diariamente via internet.', 0, NULL, NULL, NULL),
(NULL, 472, 'Toy Story 3', 'Toy Story 3', 'Estados Unidos', 'Animação', 'Lee Unkrich', '15419033455be793f199dd7.jpg', 103, 2010, 'CHA3Kss72Ro', 'Tom Hanks, Tim Allen, Joan Cusack, Ned Beatty', 'Andy se prepara para ir para a faculdade e, inesperadamente, seus leais brinquedos acabando sendo enviados para uma creche. As crianças e seus dedinhos pegajosos não têm cuidado ao brincar, de modo que os brinquedos decidem unir forças e planejar uma grande fuga. Algumas carinhas novas, umas de plástico e outras de pelúcia, juntam-se a essa incrível aventura: Ken, o namorado de Barbie, um ouriço-ator chamado Espeto e um ursinho de pelúcia rosa e com cheirinho de morango chamado Lotso.', 0, NULL, NULL, NULL),
(NULL, 473, 'A Onda', 'Die Welle', 'Alemanha', 'Drama', 'Dennis Gansel', '15419033975be794259b275.jpg', 107, 2008, 'brnEKSEvtZg', NULL, 'Em uma escola da Alemanha, alunos tem de escolher entre duas disciplinas eletivas, uma sobre anarquia e a outra sobre autocracia. O professor Rainer Wenger (Jürgen Vogel) é colocado para dar aulas sobre autocracia, mesmo sendo contra sua vontade. Após alguns minutos da primeira aula, ele decide, para exemplificar melhor aos alunos, formar um governo fascista dentro da sala de aula. Eles dão o nome de \"A Onda\" ao movimento, e escolhem um uniforme e até mesmo uma saudação. Só que o professor acaba perdendo o controle da situação, e os alunos começam a propagar \"A Onda\" pela cidade, tornando o projeto da escola um movimento real. Quando as coisas começam a ficar sérias e fanáticas demais, Wenger tenta acabar com \"A Onda\", mas aí já é tarde demais.', 0, NULL, NULL, NULL),
(NULL, 474, 'Jogador Nº 1', 'Ready Player One', 'Estados Unidos', 'Ficção Científica', 'Steven Spielberg', '15419038565be795f09acae.jpg', 140, 2018, 'KmaD-PPHD3M', 'Tye Sheridan, Olivia Cooke, Ben Mendelsohn, Lena Waithe', 'Num futuro distópico, em 2044, Wade Watts (Tye Sheridan), como o resto da humanidade, prefere a realidade virtual do jogo OASIS ao mundo real. Quando o criador do jogo, o excêntrico James Halliday (Mark Rylance) morre, os jogadores devem descobrir a chave de um quebra-cabeça diabólico para conquistar sua fortuna inestimável. Para vencer, porém, Watts terá de abandonar a existência virtual e ceder a uma vida de amor e realidade da qual sempre tentou fugir.', 0, NULL, NULL, NULL),
(NULL, 475, 'Rua Cloverfield, 10', '10 Cloverfield Lane', 'Estados Unidos', 'Suspense', 'Dan Trachtenberg', '15419039525be79650c9de1.jpg', 103, 2016, 'wsy1dhbAyRI', 'John Goodman, Mary Elizabeth Winstead, John Gallagher Jr., Douglas M. Griffin', 'Uma jovem acorda presa em um porão subterrâneo e teme ser vítima de um sequestro. Um homem explica que salvou a sua vida, mas não sabendo se pode confiar nele, ela tenta se libertar o quanto antes.', 0, NULL, NULL, NULL),
(NULL, 476, 'Divergente', 'Divergent', 'Estados Unidos', 'Aventura', 'Neil Burger', '15419043705be797f2c377c.jpg', 139, 2014, 'B_fty0k6SNI', 'Shailene Woodley, Theo James, Miles Teller, Ansel Elgort, Zoë Kravitz, Jai Courtney, Kate Winslet, Ashley Judd', 'Na futurística Chicago, quando a adolescente Beatrice (Shailene Woodley) completa 16 anos ela tem que escolher entre as diferentes facções que a cidade está dividida. Elas são cinco e cada uma representa um valor diferente, como honestidade, generosidade e coragem. Beatrice surpreende a todos e até a si mesma quando decide pela facção dos destemidos, diferente da família. Ao entrar para a Audácia ela torna-se Tris e entra numa jornada para afastar seus medos e descobrir quem é de verdade. Além disso conhece Quatro (Theo James), rapaz experiente que consegue intrigá-la e encantá-la ao mesmo tempo.', 0, NULL, NULL, NULL),
(NULL, 477, 'Invocação do Mal', 'The Conjuring', 'Estados Unidos', 'Terror', 'James Wan', '15419043775be797f9c3b3b.jpg', 112, 2013, 'GQrrXceHn2E', 'Vera Farmiga, Patrick Wilson, Lili Taylor, Ron Livingston', 'Os investigadores paranormais Ed e Lorraine Warren trabalham para ajudar a família aterrorizada por uma entidade demoníaca em sua fazenda.', 0, NULL, NULL, NULL),
(NULL, 478, 'A Série Divergente: Insurgente', 'Insurgent', 'Estados Unidos', 'Aventura', 'Robert Schwentke', '15419045965be798d4c3c61.jpg', 119, 2015, 'VT5jA8z-a-4', 'Kate Winslet, Jai Courtney, Mekhi Phifer, Shailene Woodley', 'Tris (Shailene Woodley) e Quatro (Theo James) agora são fugitivos e procurados por Jeanine Matthews (Kate Winslet), líder da Erudição. Em busca de respostas e assombrados por prévias escolhas, o casal enfrentará inimagináveis desafios enquanto tentam descobrir a verdade sobre o mundo em que vivem.', 0, NULL, NULL, NULL),
(NULL, 479, 'Rio', 'Rio', 'Estados Unidos', 'Animação', 'Carlos Saldanha', '15419048705be799e6927fa.jpg', 96, 2011, '02ksrSBAlGE', 'Karen Disher, Jason Fricchione, Sofia Scarpa Saldanha, Leslie Mann', 'Capturada por contrabandistas de animais quando tinha acabado de nascer, a arara de nome Blu nunca aprendeu a voar e vive uma vida domesticada feliz em Minnesota, nos Estados Unidos, com sua dona, Linda. Blu pensa que é a última arara de sua espécie, porém quando descobrem que Jewel, uma fêmea, vive no Rio de Janeiro, Blu e Linda vão ao seu encontro. Os contrabandistas capturam Blu e Jewel, mas as aves escapam e começam uma aventura arriscada rumo à liberdade.', 0, NULL, NULL, 1);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 480, 'A Série Divergente: Convergente', 'Allegiant', 'Estados Unidos', 'Aventura', 'Robert Schwentke', '15419049475be79a339ec44.jpg', 120, 2016, 'ttdRr-Hw01g', 'Shailene Woodley, Theo James, Naomi Watts, Octavia Spencer', 'Após a mensagem de Edith Prior ser revelada, Tris (Shailene Woodley), Quatro (Theo James), Caleb (Ansel Elgort), Peter (Miles Teller), Christina (Zoë Kravitz) e Tori (Maggie Q) deixam Chicago para descobrir o que há além da cerca. Ao chegarem lá, eles descobrem a existência de uma nova sociedade.', 0, NULL, NULL, NULL),
(NULL, 481, 'A Rede Social', 'The Social Network', 'Estados Unidos', 'Biografia', 'David Fincher', '15419050515be79a9b742ee.jpg', 120, 2010, 'kAwIKMYN6UU', 'Jesse Eisenberg, Rooney Mara, Bryan Barter, Dustin Fitzsimons, Brenda Song', 'Em 2003, o estudante de Harvard e gênio da computação Mark Zuckerberg começa a trabalhar em um novo conceito que acaba se transformando em uma rede social global, o Facebook. Seis anos mais tarde, ele é um dos bilionários mais jovens do planeta. Mas seu sucesso sem precedentes traz complicações legais e pessoais.', 0, NULL, NULL, NULL),
(NULL, 482, 'Invocação do Mal 2', 'The Conjuring 2', 'Estados Unidos', 'Terror', 'James Wan', '15419733315be8a5533f932.jpg', 134, 2016, '5gN2uH3EJFU', 'Patrick Wilson, Vera Farmiga, Madison Wolfe, Frances O\'Connor', '1977. Os investigadores paranormais Ed (Patrick Wilson) e Lorraine (Vera Farmiga) desembarcam em Londres, Inglaterra, para ajudar uma família atormentada. Peggy (Frances O\'Connor), uma mãe solteira, acredita que tenha algo maligno em sua casa.', 0, NULL, NULL, NULL),
(NULL, 483, 'Annabelle', 'Annabelle', 'Estados Unidos', 'Terror', 'John R. Leonetti', '15419737815be8a7159eb21.jpg', 99, 2014, 't1NfWSEO5FE', 'Annabelle Wallis, Ward Horton, Tony Amendola, Alfre Woodard', 'Um casal se prepara para a chegada de sua primeira filha e compra para ela uma boneca. Quando sua casa é invadida por membros de uma seita, o casal é violentamente atacado e a boneca, Anabelle, se torna recipiente de uma entidade do mal.', 0, NULL, NULL, NULL),
(NULL, 484, 'Annabelle 2: A Criação do Mal', 'Annabelle: Creation', 'Estados Unidos', 'Terror', 'David F. Sandberg', '15419746335be8aa69c6993.jpg', 109, 2017, 'pYdgJAaHSUY', 'Anthony LaPaglia, Samara Lee, Miranda Otto, Brad Greenquist', 'Anos após a trágica morte de sua filha, um habilidoso artesão de bonecas e sua esposa decidem, por caridade, acolher em sua casa uma freira e dezenas de meninas desalojadas de um orfanato. Atormentado pelas lembranças traumáticas, o casal ainda precisa lidar com um amendrontador demônio do passado: Annabelle, criação do artesão.', 0, NULL, NULL, NULL),
(NULL, 485, 'Sobrenatural: Capítulo 2', 'Insidious: Chapter 2', 'Estados Unidos', 'Terror', 'James Wan', '15419754405be8ad901338f.jpg', 106, 2013, 'f5M2o4fYwCQ', 'Patrick Wilson, Rose Byrne, Ty Simpkins, Lin Shaye', 'A família Lambert, formada por Josh (Patrick Wilson), Renai (Rose Byrne) e Dalton (Ty Simpkins), volta a lidar com uma série de problemas sobrenaturais e precisa enfrentar as consequências dos eventos do primeiro filme. Enquanto a polícia investiga a residência do trio, eles são abrigados por Lorraine Lambert (Barbara Hershey), mas até no novo lar Josh apresenta um comportamento irreconhecível e Renai é assombrada por uma estranha figura feminina.', 0, NULL, NULL, NULL),
(NULL, 486, 'Sobrenatural: A Origem', 'Insidious: Chapter 3', 'Estados Unidos', 'Terror', 'Leigh Whannell', '15419761285be8b040dd800.jpg', 97, 2015, 'DX3PwNRAHck', 'Dermot Mulroney, Stefanie Scott, Angus Sampson, Leigh Whannell', 'Em eventos anteriores aos apresentados em Sobrenatural, Sean Brenner (Dermot Mulroney) e a filha, Quinn (Stefanie Scott), são aterrorizados por entidades misteriosas. A especialista em fenômenos paranormais Elise Rainier (Lin Shaye) se envolve no caso e busca uma forma de livrar a família do demônio.', 0, NULL, NULL, NULL),
(NULL, 487, 'O Diário da Princesa', 'The Princess Diaries', 'Estados Unidos', 'Comédia', 'Garry Marshall', '15420167665be94efe739df.jpg', 111, 2001, '2CkcwPi20ms', 'Julie Andrews, Anne Hathaway, Hector Elizondo, Heather Matarazzo', 'Mia (Anne Hathaway) é uma garota de 15 anos que vive com sua mãe (Caroline Goodall) em Manhattan e repentinamente descobre que seu pai é na verdade o Príncipe de Genovia, um pequeno país europeu. Ela recebe então a visita de sua avó recém-descoberta (Julie Andrews), que passa a lhe dar aulas de etiqueta, ensinando-a como se deve portar uma princesa. Mas quando se aproxima a data de seu aniversário ela precisa definir que caminho pretende tomar em sua vida: tornar-se uma princesa e se mudar para Genovia ou permencer em Manhattan morando com sua mãe.', 0, NULL, NULL, NULL),
(NULL, 488, 'O Diário da Princesa 2', 'The Princess Diaries 2: Royal Engagement', 'Estados Unidos', 'Comédia', 'Garry Marshall', '15420169195be94f97d2fa7.jpg', 113, 2004, 'DVuUaPEvOBI', 'Anne Hathaway, Julie Andrews, Hector Elizondo, John Rhys-Davies', 'Cinco anos após Mia (Anne Hathaway) decidir por se tornar a princesa de Genóvia, ela se muda para o palácio real de sua avó, Clarisse (Julie Andrews). Logo ela é informada que não permanecerá como princesa por muito tempo, já que em breve terá que ser coroada rainha. Como a legislação genoviana estabelece que as futuras rainhas devem se casar antes de serem empossadas ao cargo, uma legião de pretendentes surge repentinamente na vida de Mia.', 0, NULL, NULL, NULL),
(NULL, 489, 'Sobrenatural: A Última Chave', 'Insidious: The Last Key', 'Estados Unidos', 'Terror', 'Adam Robitel', '15420171045be95050a4d28.jpg', 103, 2018, 'WLl3RrjCkrQ', 'Lin Shaye, Leigh Whannell, Angus Sampson, Kirk Acevedo', 'Elise Rainier (Lin Shaye) é chamada para resolver o caso de uma assombração no Novo México. O que seria apenas mais um caso ganha ares especiais quando Elise descobre que a atividade sobrenatural está acontecendo justamente na casa em que ela passou a infância. Enquanto tenta resolver o caso do morador de sua antiga casa, ela será obrigada a confrontar vários fantasmas e demônios de sua infância, alguns literais. Ao lado de Specs (Leigh Whannell) e Tucker (Angus Sampson), Elise se depara com seu caso mais pessoal.', 0, NULL, NULL, NULL),
(NULL, 490, 'Tróia', 'Troy', 'Estados Unidos', 'Épico', 'Wolfgang Petersen', '15420174995be951dbce69d.jpg', 163, 2004, '', 'Julian Glover, Brian Cox, Nathan Jones, Adoni Maropis', 'Em 1193 A.C., Paris (Orlando Bloom) é um príncipe que provoca uma guerra da Messência contra Tróia, ao afastar Helena (Diane Kruger) de seu marido, Menelaus (Brendan Gleeson). Tem início então uma sangrenta batalha, que dura por mais de uma década. A esperança do Priam (Peter O\'Toole), rei de Tróia, em vencer a guerra está nas mãos de Aquiles (Brad Pitt), o maior herói da Grécia, e seu filho Hector (Eric Bana).', 0, NULL, NULL, NULL),
(NULL, 491, 'Toy Story', 'Toy Story', 'Estados Unidos', 'Animação', 'John Lasseter', '15420178865be9535edfd2a.jpg', 81, 1995, '_8vw4UikKhg', 'Tom Hanks, Tim Allen, Don Rickles, Jim Varney', 'O aniversário de Andy está chegando e os brinquedos estão nervosos. Afinal de contas, eles temem que um novo brinquedo possa substituí-los. Liderados por Woody, um caubói que é também o brinquedo predileto de Andy, eles montam uma escuta que lhes permite saber dos presentes ganhos. Entre eles está Buzz Lightyear, o boneco de um patrulheiro espacial, que logo passa a receber mais atenção do garoto. Isto aos poucos gera ciúmes em Woody, que tenta fazer com que ele caia atrás da cama. Só que o plano dá errado e Buzz cai pela janela. É o início da aventura de Woody, que precisa resgatar Buzz também para limpar sua barra com os outros brinquedos.', 0, NULL, NULL, NULL),
(NULL, 492, 'Toy Story 2', 'Toy Story 2', 'Estados Unidos', 'Animação', 'John Lasseter', '15420180675be9541370360.jpg', 92, 1999, 'K4yg3bE3Eqg', 'Tom Hanks, Tim Allen, Joan Cusack, Kelsey Grammer', 'Desta vez, Woody (Tom Hanks) tenta salvar um brinquedo que acaba indo parar num bazar de usados e termina por ser sequestrado por um colecionador de brinquedos, que pretende vendê-lo a um museu japonês. Na casa do sequestrador, descobre que foi o protagonista de um famoso seriado da TV de décadas atrás e conhece os demais integrantes de sua coleção. Enquanto isso, os demais brinquedos, liderador por Buzz Lightyear (Tim Allen), partem numa atrapalhada operação de resgate.', 0, NULL, NULL, NULL),
(NULL, 493, 'E o Vento Levou', 'Gone with the Wind', 'Estados Unidos', 'Drama', 'Victor Fleming', '15420184525be9559487995.jpg', 238, 1940, 'FBaiPef5PUM', NULL, 'Scarlett O\'Hara é uma jovem mimada que consegue tudo o que quer. No entanto, algo falta em sua vida: o amor de Ashley Wilkes, um nobre sulista que deve se casar com a sua prima Melanie. Tudo muda quando a Guerra Civil americana explode e Scarlett precisa lutar para sobreviver e manter a fazenda da família.', 0, NULL, NULL, NULL),
(NULL, 494, 'Um Crime Americano', 'An American Crime', 'Estados Unidos', 'Crime', 'Tommy O', '15420186855be9567deede1.jpg', 98, 2007, 'oEWsP3twsjk', 'Ellen Page, Hayley McFarland, Nick Searcy, Romy Rosemont', '1965. Sylvia (Ellen Page) e Jennie Likens (Hayley McFarland) são irmãs deixadas na casa de Gertrude Baniszweski (Catherine Keener) por uma longa temporada, já que seus pais trabalham em um circo. Gertrude é uma mãe solteira com 7 crianças e que, devido a dificuldades financeiras, aceita cuidar das garotas. Só que ela não esperava o quanto presença delas afetaria sua natureza instável.', 0, NULL, NULL, NULL),
(NULL, 495, 'Caminhos da Floresta', 'Into the Woods', 'Estados Unidos', 'Fantasia', 'Rob Marshall', '15420188785be9573eb2231.jpg', 125, 2014, '3pRaqZ2hoNk', 'Anna Kendrick, Daniel Huttlestone, James Corden, Emily Blunt', 'Um padeiro e sua mulher (James Corden e Emily Blunt) vivem em um vilarejo, onde lidam com vários personagens famosos dos contos de fadas, como Chapeuzinho Vermelho (Lila Crawford). Um dia, eles recebem a visita da bruxa (Meryl Streep), que é sua vizinha. Ela avisa que lançou um feitiço sobre o casal para que não tenha filhos, como castigo por algo feito pelo pai do padeiro, décadas atrás. Ao mesmo tempo, a bruxa avisa que o feitiço pode ser desfeito caso eles lhe tragam quatro objetos: um capuz vermelho como sangue, cabelo amarelo como espiga de milho, um sapato dourado como ouro e um cavalo branco como o leite. Eles têm apenas três dias para encontrar tudo, caso contrário o feitiço será eterno. Decididos a cumprir o objetivo, o padeiro e sua esposa adentram na floresta.', 0, NULL, NULL, NULL),
(NULL, 496, 'Para Todos os Garotos que Já Amei', 'To All the Boys I', 'Estados Unidos', 'Comédia dramática', 'Susan Johnson', '15420191275be95837eea91.jpg', 99, 2018, 'CK-g0OqzQHQ', 'Lana Condor, Noah Centineo, Janel Parrish, Anna Cathcart, John Corbett, Israel Broussard', 'Lara Jean Song Covey (Lana Condor) escreve cartas de amor secretas para todos os seus antigos paqueras. Um dia, essas cartas são misteriosamente enviadas para os meninos sobre os quem ela escreve, virando sua vida de cabeça para baixo.', 0, NULL, NULL, NULL),
(NULL, 497, 'Os Incríveis', 'The Incredibles', 'Estados Unidos', 'Animação', 'Brad Bird', '15420201895be95c5d6b68c.jpg', 115, 2004, 'P7KMDFpqXqk', 'Craig T. Nelson, Holly Hunter, Samuel L. Jackson, Jason Lee', 'Roberto Pêra (Craig T. Nelson) já foi o maior herói do planeta, salvando vidas e combatendo o mal todos os dias sob o codinome Sr. Incrível. Porém, após salvar um homem de se suicidar, ele é processado e condenado na Justiça. Uma série de processos seguintes faz com que o Governo tenha que desembolsar uma alta quantia para pagar as indenizações, o que faz com que a opinião pública se volte contra os super-heróis. Em reconhecimento aos serviços prestados, o Governo faz a eles uma oferta: que levem suas vidas como pessoas normais, sem demonstrar que possuem superpoderes, recebendo em troca uma pensão anual. Quinze anos depois, Roberto leva uma vida pacata ao lado de sua esposa Helen (Holly Hunter), que foi a super-heroína Mulher-Elástica, e seus três filhos. Roberto agora trabalha em uma seguradora e luta para combater o tédio da vida de casado e o peso extra. Com vontade de retomar a vida de herói, ele tem a grande chance quando surge um comunicado misterioso, que o convida para uma missão secreta em uma ilha remota.', 0, NULL, NULL, NULL),
(NULL, 498, 'Os Incríveis 2', 'The Incredibles 2', 'Estados Unidos', 'Animação', 'Brad Bird', '15479401585c43b13e19a97.jpg', 118, 2018, '8NURuV5GmPY', '', 'Quando Helena Pêra é chamada para voltar a lutar contra o crime como a super-heroína Mulher-Elástica, cabe ao seu marido, Roberto, a tarefa de cuidar das crianças, especialmente o bebê Zezé. O que ele não esperava era que o caçula da família também tivesse superpoderes, que surgem sem qualquer controle.', 0, NULL, NULL, NULL),
(NULL, 499, 'Carrie, a Estranha', 'Carrie ', 'Estados Unidos', 'Terror', 'Brian De Palma', '15420207915be95eb788e9e.jpg', 98, 1976, 'QDkpLa4oGZc', 'Sissy Spacek, Piper Laurie, Amy Irving, William Katt', 'Nesta adaptação do romance de Stephen King, a quieta e sensível adolescente Carrie White enfrenta insultos dos colegas na escola e abuso em casa de sua mãe, uma fanática religiosa. Quando estranhos acontecimentos começam a acontecer em torno de Carrie, ela começa a suspeitar que tem poderes sobrenaturais. Convidada para o baile da escola pelo autoritário Tommy Ross, Carrie tenta relaxar, mas as coisas tomam um rumo sombrio e violento.', 0, NULL, NULL, NULL),
(NULL, 500, 'Carrie, a Estranha', 'Carrie', 'Estados Unidos', 'Terror', 'Kimberly Peirce', '15420210785be95fd611cb6.jpg', 100, 2013, '1TaYCap3nok', 'Julianne Moore, Chloë Grace Moretz, Gabriella Wilde, Portia Doubleday', 'Carietta White (Chloë Grace Moretz) sempre foi oprimida pela sua mãe, Margaret (Julianne Moore), uma fanática religiosa. Além dos maus tratos em casa, Carrie também sofre com o abuso dos colegas de escola, que nunca compreenderam sua aparência nem seu comportamento. Ridicularizada por todos, aos poucos ela descobre que possui estranhos poderes telecinéticos, que se manifestam com força total durante sua festa de formatura.', 0, NULL, NULL, NULL),
(NULL, 501, 'O Diário de Anne Frank', 'The Diary of Anne Frank', 'Estados Unidos', 'Biografia', 'George Stevens', '15420219255be9632526f06.jpg', 180, 1959, 'nLCooqzoFtA', 'Millie Perkins, Joseph Schildkraut, Shelley Winters, Richard Beymer', 'Holanda, 1942. Anne Frank (Millie Perkins) vive no sótão secreto de um estabelecimento comercial, juntamente com seus pais, Otto (Joseph Schildkraut) e Edith (Gusti Huber), e sua irmã Margot (Diane Baker). Além deles vive no local uma outra família judia, composta por Hans Van Daan (Lou Jacobi), Petronella Van Daan (Shelley Winters), Peter Van Daan (Richard Beymer) e Albert Dussell (Ed Wynn), um idoso dentista. Anne Frank, uma jovem de 13 anos, documenta sua vida enquanto se esconde da Gestapo da Holanda. Este refúgio foi providenciado por Kraler (Douglas Spencer) e Miep (Dodie Heath), bondosos proprietários de lojas. Por dois anos eles ficam escondidos, vivendo sempre na apreensão de saberem que podem ser traídos ou descobertos a qualquer momento e mandados para um campo de concentração. Apesar disto eles sonham com dias melhores, ao mesmo tempo em que Peter e Anne se apaixonam.', 0, NULL, NULL, NULL),
(NULL, 502, 'As Crônicas de Nárnia: O Leão, a Feiticeira e o Guarda-Roupa', 'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe', 'Estados Unidos', 'Fantasia', 'Andrew Adamson', '15420253125be97060802e5.jpg', 143, 2005, 'PKVNju6bwyw', 'Georgie Henley, Skandar Keynes, William Moseley, Anna Popplewell', 'Lúcia (Georgie Henley), Susana (Anna Popplewell), Edmundo (Skandar Keynes) e Pedro (William Moseley) são quatro irmãos que vivem na Inglaterra, em plena 2ª Guerra Mundial. Eles vivem na propriedade rural de um professor misterioso, onde costumam brincar de esconde-esconde. Em uma de suas brincadeiras eles descobrem um guarda-roupa mágico, que leva quem o atravessa ao mundo mágico de Nárnia. Este novo mundo é habitado por seres estranhos, como centauros e gigantes, que já foi pacífico mas hoje vive sob a maldição da Feiticeira Branca, Jadis (Tilda Swinton), que fez com que o local sempre estivesse em um pesado inverno. Sob a orientação do leão Aslam, que governa Nárnia, as crianças decidem ajudar na luta para libertar este mundo do domínio de Jadis.', 0, NULL, NULL, NULL),
(NULL, 503, 'As Crônicas de Nárnia: Principe Caspian', 'The Chronicles of Narnia: Prince Caspian', 'Estados Unidos', 'Fantasia', 'Andrew Adamson', '15420255755be9716772f57.jpg', 150, 2008, '1gmMwfpdTpI', 'Ben Barnes, Georgie Henley, Skandar Keynes, William Moseley', 'Um ano depois os irmãos Lucy (Georgie Henley), Edmund (Skandar Keynes), Susan (Anna Popplewell) e Peter (William Moseley) retornam ao mundo de Nárnia, onde já se passaram 1300 anos desde sua última visita. Durante sua ausência Nárnia foi conquistada pelo rei Miraz (Sergio Castellitto), que governa o local sem misericórdia. Os irmãos Pevensie então conhecem Caspian (Ben Barnes), o príncipe de direito de Nárnia, que precisa se refugiar por ser procurado por Miraz, seu tio. Decididos a destronar Miraz, o grupo reúne os narnianos restantes para combatê-lo.', 0, NULL, NULL, NULL),
(NULL, 504, 'As Crônicas de Nárnia: A Viagem do Peregrino da Alvorada', 'The Chronicles of Narnia: The Voyage of the Dawn Treader', 'Estados Unidos', 'Fantasia', 'Michael Apted', '15420258805be972985da88.jpg', 113, 2010, '8dmMM-RNb8s', 'Georgie Henley, Skandar Keynes, Ben Barnes, Will Poulter', 'Lúcia (Georgie Henley), Edmundo (Skandr Keynes) e Eustáquio (Will Poulter) retornam para Nárnia, onde encontram com príncipe Caspian (Ben Barnes), agora rei, e outros amigos. Buscando os Sete Fidalgos Desaparecidos de Telmar, eles começam uma nova aventura a bordo do navio Peregrino da Alvorada e irão encarar guerreiros, dragões, anões e tritões.', 0, NULL, NULL, NULL),
(NULL, 505, 'A Casa Monstro', 'Monster House', 'Estados Unidos', 'Animação', 'Gil Kenan', '15420263815be9748dee23a.jpg', 91, 2006, 'XG0SsmJrc0o', 'Ryan Newman, Steve Buscemi, Mitchel Musso, Catherine O\'Hara', 'DJ Walters (Mitchel Musso) é um garoto de 12 anos que acredita que há algo de estranho na casa do velho Nebbercracker (Steve Buscemi), localizada do outro lado da rua. Tudo que passa perto da casa simplesmente desaparece, incluindo triciclos, brinquedos e animais de estimação. Na véspera do Dia das Bruxas, DJ e seu amigo Chowder (Sam Lester) deixam que a bola de basquete com a qual estão jogando caia no terreno de Nebbercracker, sumindo misteriosamente. Logo em seguida a casa tenta devorar Jenny (Spencer Locke), uma amiga de ambos, que é salva do ataque. Eles tentam avisar a todos do perigo que é a casa, mas ninguém acredita neles. O trio recorre a Skull (Jon Heder), um preparador de pizza preguiçoso que ganhou fama por no passado ter jogado videogame por 4 dias seguidos. Skull acredita que a casa tenha adquirido alma humana e que o único meio de eliminar o perigo que ela representa seja acertando-a direto em seu coração. É quando os amigos elaboram um plano que permita que entrem na própria casa.', 0, NULL, NULL, NULL),
(NULL, 506, 'Doce Vingança 2', 'I Spit on Your Grave 2', 'Estados Unidos', 'Suspense', 'Steven R. Monroe', '15420266365be9758c03c8d.jpg', 106, 2013, 'mTH1gewDVmI', 'Jemma Dallender, Joe Absolom, Yavor Baharov, George Zlatarev', 'A jovem e bela Katie (Jemma Dallender) sonha em conseguir seguir a carreira de modelo em Nova York. Sem dinheiro para pagar uma sessão com um fotográfo profissional, ela vê um anúncio de um homem que tira fotos de graça. Mas a inocente sessão acaba culminando na jovem sendo estuprada, humilhada, drogada e sequestrada. Ela acorda em outro país, mas, ao tentar escapar, é enterrada viva. Apesar de todas as propabilidades contra ela, a jovem sobrevive. E agora, Katie vai buscar uma brutal vingança contra aqueles que tanto a machucaram.', 0, NULL, NULL, NULL),
(NULL, 507, 'Aladdin', 'Aladdin', 'Estados Unidos', 'Animação', 'John Musker', '15420271505be9778ea69af.jpg', 90, 1992, 'phwe8Wt2G-4', 'Scott Weinger, Robin Williams, Linda Larkin, Jonathan Freeman', 'Após o sultão ordenar que sua filha, a princesa Jasmine, ache um marido rapidamente, ela foge do palácio. Jasmine encontra um tipo meio malandro, Aladdin, que conquista seu coração. Porém ambos são achados pelos guardas de Jafar, o vizir do sultão. Jafar criou um feitiço para dominar o sultão, se casar com Jasmine e se tornar ele mesmo o sultão. Além disto finge que cometeu um engano e mandou decapitar Aladdin, que na verdade está vivo, pois Jafar precisa dele para conseguir uma lâmpada mágica, que é a morada de um poderoso gênio. Mas o plano de Jafar falha, pois Aladdin fica com a lâmpada graças a intervenção de um pequeno macaco, Abu, seu fiel mascote. Quando descobre que há na lâmpada um gênio poderoso, que pode se transformar em qualquer pessoa ou coisa e que lhe concederá três desejos, Aladdin planeja usá-los para conquistar Jasmine, sem imaginar que Jafar é um diabólico inimigo, que precisa ser detido.', 0, NULL, NULL, NULL),
(NULL, 508, 'Até o Limite da Honra', 'G.I. Jane', 'Estados Unidos', 'Ação', 'Ridley Scott', '15420273385be9784a65a42.jpg', 125, 1997, 'PaAVvWvH5Gw', 'Demi Moore, Viggo Mortensen, Anne Bancroft, Jason Beghe', 'Após a pressão de uma senadora (Anne Bancroft) de idéias aparentemente feministas, uma oficial (Demi Moore) torna-se a única mulher em um grupo de elite da Marinha Americana e no treinamento terá de provar que pode suportar semanas de tortura física e emocional, com poucos acreditando que ela possa vencer. Na verdade alguns altos oficiais do governo e até mesmo a parlamentar que lhe apoiou estão torcendo pelo seu fracasso.', 0, NULL, NULL, NULL),
(NULL, 509, 'Amanda Knox', 'Amanda Knox', 'Estados Unidos', 'Documentário', ' Brian McGinn', '15420276505be97982e0b7a.jpg', 92, 2016, 'cNxe1X_P3Tw', 'Amanda Knox, Meredith Kercher, Raffaele Sollecito, Giuliano Mignini', 'A estadunidense Amanda Knox chega em Perugia, Itália, para começar em setembro suas atividades como intercambista. A jovem de 20 anos de idade logo conhece sua colega de quarto, a britânica Meredith Kercher. O ninguém esperava é que ambas se envolveriam em um crime tão brutal.', 0, NULL, NULL, NULL),
(NULL, 510, 'O Mistério das Duas Irmãs', 'The Uninvited', 'Estados Unidos', 'Suspense', 'Charles Guard', '15420292165be97fa03a3b8.jpg', 87, 2009, 'j47xLHZEvb4', 'Emily Browning, Arielle Kebbel, David Strathairn, Elizabeth Banks', '', 0, NULL, NULL, NULL),
(NULL, 511, 'Trainspotting 2', 'Trainspotting 2', 'Reino Unido', 'Drama', 'Dany Boyle', '15420292845be97fe44cde4.jpg', 117, 2017, 'HLRxjY2En9k', NULL, 'Renton (Ewan McGregor) retorna à cidade natal depois de vinte anos de ausência. Hoje, ele é um homem novo, com um emprego fixo e livre das drogas. Os amigos não tiveram a mesma sorte: Sick Boy (Jonny Lee Miller) comanda um comércio fracassado, Spud (Ewen Bremner) continua dependente de heroína e Begbie (Robert Carlyle) está na prisão. Aos poucos, Renton revela que sua realidade não é tão positiva quanto ele mostrava, e volta a praticar os crimes de antigamente. Sequência de Trainspotting - Sem Limites (1996), inspirada no livro \"Porno\", de Irvine Welsh.', 0, NULL, NULL, NULL),
(NULL, 512, 'As Aventuras de Pi ', 'Life of Pi', 'Estados Unidos', 'Aventura', 'Ang Lee', '15420294335be9807920686.jpg', 127, 2012, 'YA_T5kar83Q', 'Suraj Sharma, Irrfan Khan, Ayush Tandon, Gautam Belur', 'Pi Patel (Suraj Sharma) é filho do dono de um zoológico localizado em Pondicherry, na Índia. Após anos cuidando do negócio, a família decide vender o empreendimento devido à retirada do incentivo dado pela prefeitura local. A ideia é se mudar para o Canadá, onde poderiam vender os animais para reiniciar a vida. Entretanto, o cargueiro onde todos viajam acaba naufragando devido a uma terrível tempestade. Pi consegue sobreviver em um bote salva-vidas, mas precisa dividir o pouco espaço disponível com uma zebra, um orangotango, uma hiena e um tigre de bengala chamado Richard Parker.', 0, NULL, NULL, NULL),
(NULL, 513, 'Psicose', 'Psycho', 'Estados Unidos', 'Terror', 'Alfred Hitchcock', '15420294355be9807b9e519.jpg', 109, 1960, 'wfGjWZmyvfo', 'Anthony Perkins, Vera Miles, John Gavin, Janet Leigh', 'Marion Crane é uma secretária (Janet Leigh) que rouba 40 mil dólares da imobiliária onde trabalha para se casar e começar uma nova vida. Durante a fuga à carro, ela enfrenta uma forte tempestade, erra o caminho e chega em um velho hotel. O estabelecimento é administrado por um sujeito atencioso chamado Norman Bates (Anthony Perkins), que nutre um forte respeito e temor por sua mãe. Marion decide passar a noite no local, sem saber o perigo que a cerca.', 0, NULL, NULL, NULL),
(NULL, 514, 'Sr. e Sra. Smith ', 'Mr. and Mrs. Smith', 'Estados Unidos', 'Ação', 'Doug Liman', '15420297105be9818ee4200.jpg', 120, 2005, 'JaNKH74Ws4w', NULL, 'John (Brad Pitt) e Jane Smith (Angelina Jolie) trabalham como assassinos de aluguel. Eles são também casados, mas um não sabe do trabalho do outro e vivem atualmente uma vida entediada. A situação entre eles muda de rumo quando cada um recebe um novo trabalho de sua respectiva agência, que faz com que eles se encontrem para realizar a mesma missão.', 0, NULL, NULL, NULL),
(NULL, 515, 'O Iluminado', 'The Shining', 'Reino Unido', 'Terror', 'Stanley Kubrick', '15420297845be981d841707.png', 146, 1980, 'lnsFOmv8Yjk', 'Jack Nicholson, Shelley Duvall, Danny Lloyd, Scatman Crothers', 'Durante o inverno, um homem (Jack Nicholson) é contratado para ficar como vigia em um hotel no Colorado e vai para lá com a mulher (Shelley Duvall) e seu filho (Danny Lloyd). Porém, o contínuo isolamento começa a lhe causar problemas mentais sérios e ele vai se tornado cada vez mais agressivo e perigoso, ao mesmo tempo que seu filho passa a ter visões de acontecimentos ocorridos no passado, que também foram causados pelo isolamento excessivo.', 0, NULL, NULL, NULL),
(NULL, 516, 'A Troca', 'Changeling', 'Estados Unidos', 'Drama', 'Clint Eastwood', '15420298945be9824619b85.jpg', 141, 2008, 'Nb_k_nhpATo', 'Angelina Jolie, Gattlin Griffith, Michelle Gunn, Jan Devereaux', 'Christine Collins (Angelina Jolie), uma mãe solteira, se despede de Walter (Gattlin Griffith), seu filho de 9 anos, e parte rumo ao trabalho. Ao retornar descobre que Walter desapareceu, o que faz com que inicie uma busca exaustiva. Cinco meses depois a polícia traz uma criança, dizendo ser Walter. Atordoada pela emoção da situação, além da presença de policiais e jornalistas que desejam tirar proveito da repercussão do caso, Christine aceita a criança. Porém, no íntimo, ela sabe que ele não é Walter e, com isso, pressiona as autoridades para que continuem as buscas por ele.', 0, NULL, NULL, NULL),
(NULL, 517, 'Sniper Americano ', 'American Sniper', 'Estados Unidos', 'Biografia', 'Clint Eastwood', '15420300135be982bd3013c.jpg', 133, 2014, 'ztUAnmhwCWU', 'Bradley Cooper, Kyle Gallner, Cole Konis, Ben Reed', 'Adaptado do livro American Sniper: The Autobiography of the Most Lethal Sniper in U.S. Militar History, o filme conta a história real de Chris Kyle (Bradley Cooper), atirador de elite das forças especiais da marinha americana. Durante cerca de dez anos ele matou mais de 150 pessoas, tendo recebido diversas condecorações por sua atuação na Guerra do Iraque.', 0, NULL, NULL, NULL),
(NULL, 518, 'Top Gun - Ases Indomáveis ', 'Top Gun', 'Estados Unidos', 'Ação', 'Tony Scott', '15420301445be9834052240.png', 110, 1986, 'xa_z57UatDY', 'Tom Cruise, Kelly McGillis, Val Kilmer, Anthony Edwards', 'Pete Mitchell (Tom Cruise), um jovem piloto, ingressa na Academia Aérea para se tornar piloto de caça. Lá se envolve com Charlotte Blackwood (Kelly McGillis), uma bela mulher, e enfrenta um competidor à sua altura (Val Kilmer).', 0, NULL, NULL, NULL),
(NULL, 519, 'A Entidade', 'Sinister', 'Estados Unidos', 'Terror', 'Scott Derrickson', '15420301685be983585e259.png', 110, 2012, 'Q_dwLGd2Rs', 'Ethan Hawke, Juliet Rylance, Fred Dalton Thompson, James Ransone', 'Ellison (Ethan Hawke) é um escritor de romances policias que acaba de se mudar com a família. No sótão da nova casa ele descobre antigos rolos de filme, que trazem imagens de pessoas sendo mortas. Intrigado com o que elas representam e com um estranho símbolo presente nas imagens, ele e sua família logo passam a correr sério risco de morte. Com Vincent D\'Onofrio.', 0, NULL, NULL, NULL),
(NULL, 520, 'A Entidade 2', 'Sinister 2', 'Estados Unidos', 'Terror', 'Ciarán Foy', '15420303655be9841dc2b71.png', 97, 2015, 'XBm81XCw2Uo', 'James Ransone, Shannyn Sossamon, Robert Daniel Sloan, Dartanian Sloan', 'Courtney (Shannyn Sossamon), uma jovem mãe solteira e superprotetora de dois gêmeos de 9 anos, se muda com os filhos para uma casa em uma área rural de uma pequena cidade. Logo, ela descobre que o local foi palco de estranhos acontecimentos e que sua família está marcada para morrer.', 0, NULL, NULL, NULL),
(NULL, 521, '16 Desejos', '16 Wishes ', 'Estados Unidos', 'Fantasia', 'Peter DeLuise', '15420304235be98457583c2.jpg', 90, 2010, '2cPcW6JaCas', 'Debby Ryan, Jean-Luc Bilodeau, Anna Mae Wills, Karissa Tynes', 'Abby não vê a hora de completar 16 anos e desde a infância mantém uma lista com 16 desejos para realizar no dia do seu aniversário. No entanto, uma série de confusões acontece, fazendo Abby se arrepender de tudo o que desejou.', 0, NULL, NULL, NULL),
(NULL, 522, 'Sobre Meninos e Lobos', 'Mystic River', 'Estados Unidos', 'Suspense', 'Clint Eastwood', '15420333485be98fc4539c5.jpg', 138, 2003, 'rW7n3PsFd8U', 'Sean Penn, Tim Robbins, Kevin Bacon, Laurence Fishburne', 'Após a filha de Jimmy Marcus (Sean Penn) ser encontrada morta, Sean Devine (Kevin Bacon), seu amigo de infância, é encarregado de investigar o caso. As investigações de Sean o fazem reencontrar um mundo de violência e dor, que ele acreditava ter deixado para trás, além de colocá-lo em rota de colisão com o próprio Jimmy, que deseja resolver o crime de forma brutal. Há ainda Dave Boyle (Tim Robbins), que guarda um segredo do passado que nem mesmo sua esposa conhece. A caçada ao assassino faz com que o trio tenha que reencontrar fatos marcantes do passado, os quais eles preferiam que ficassem esquecidos para sempre.', 0, NULL, NULL, NULL),
(NULL, 523, 'Gênio Indomável ', 'Good Will Hunting', 'Estados Unidos', 'Drama', 'Gus Van Sant', '15420338365be991aca4d5a.jpg', 126, 1997, 'RfPivdyYO0c', 'Matt Damon, Ben Affleck, Stellan Skarsgård, John Mighton', 'Em Boston, um jovem de 20 anos (Matt Damon) que já teve algumas passagens pela polícia e servente de uma universidade, revela-se um gênio em matemática e, por determinação legal, precisa fazer terapia, mas nada funciona, pois ele debocha de todos os analistas, até se identificar com um deles.', 0, NULL, NULL, NULL),
(NULL, 524, 'A Colina Escarlate ', 'Crimson Peak', 'Estados Unidos', 'Terror', 'Guillermo del Toro', '15420340045be99254b1978.png', 119, 2015, 'vnlOqL2DVhY', 'Mia Wasikowska, Jessica Chastain, Tom Hiddleston, Charlie Hunnam', 'Apaixonada pelo misterioso Sir Thomas Sharpe (Tom Hiddleston), a escritora Edith Cushing (Mia Wasikowska) muda-se para sua sombria mansão no alto de uma colina. Habitada também por sua fria cunhada Lucille Sharpe (Jessica Chastain), a casa tem uma história macabra e a forte presença de seres de outro mundo não demora a abalar a sanidade de Edith.', 0, NULL, NULL, NULL),
(NULL, 525, 'Selma - Uma Luta pela Igualdade', 'Selma', 'Reino Unido', 'Drama', 'Ava DuVernay', '15420341335be992d5f160f.jpg', 128, 2014, 'EwvxtJwbRgM', 'David Oyelowo, Carmen Ejogo, Jim France, Trinity Simone', 'Cinebiografia do pastor protestante e ativista social Martin Luther King, Jr (David Oyelowo), que acompanha as históricas marchas realizadas por ele e manifestantes pacifistas em 1965, entre a cidade de Selma, no interior do Alabama, até a capital do estado, Montgomery, em busca de direitos eleitorais iguais para a comunidade afro-americana.', 0, NULL, NULL, NULL),
(NULL, 526, 'A Lista de Schindler ', 'Schindler\'s List', 'Estados Unidos', 'Biografia', 'Steven Spielberg', '15420342905be993721e3eb.jpg', 195, 1993, 'x3CEN6lIRyU', 'Liam Neeson, Ben Kingsley, Ralph Fiennes, Caroline Goodall', 'A inusitada história de Oskar Schindler (Liam Neeson), um sujeito oportunista, sedutor, \"armador\", simpático, comerciante no mercado negro, mas, acima de tudo, um homem que se relacionava muito bem com o regime nazista, tanto que era membro do próprio Partido Nazista (o que não o impediu de ser preso algumas vezes, mas sempre o libertavam rapidamente, em razão dos seus contatos). No entanto, apesar dos seus defeitos, ele amava o ser humano e assim fez o impossível, a ponto de perder a sua fortuna mas conseguir salvar mais de mil judeus dos campos de concentração.\r\n', 0, NULL, NULL, NULL),
(NULL, 527, 'Namorados para Sempre ', 'Blue Valentine', 'Estados Unidos', 'Romance', 'Derek Cianfrance', '15420344605be9941ca9cce.jpg', 112, 2010, '1U5UatXppEU', 'Ryan Gosling, Michelle Williams, Faith Wladyka, John Doman', 'Casados há vários anos e com uma filha, Cindy (Michelle Williams) e Dean (Ryan Gosling) são jovens da classe trabalhadora que passam por um momento de crise, vendo o relacionamento ser contaminado por uma série de incertezas. Ele trabalha como pintor, enquanto que ela é enfermeira de uma clínica médica. Seguem em frente e tentam superar os problemas, se baseando no passado que fez com que se apaixonassem um pelo outro.', 0, NULL, NULL, NULL),
(NULL, 528, 'Cidade de Deus', 'Cidade de Deus ', 'Brasil', 'Drama', 'Fernando Meirelles', '15420345875be9949babc5c.jpg', 130, 2002, 'pUt-yPxOZqk', NULL, 'Buscapé (Alexandre Rodrigues) é um jovem pobre, negro e muito sensível, que cresce em um universo de muita violência. Buscapé vive na Cidade de Deus, favela carioca conhecida por ser um dos locais mais violentos da cidade. Amedrontado com a possibilidade de se tornar um bandido, Buscapé acaba sendo salvo de seu destino por causa de seu talento como fotógrafo, o qual permite que siga carreira na profissão. É através de seu olhar atrás da câmera que Buscapé analisa o dia-a-dia da favela onde vive, onde a violência aparenta ser infinita.', 0, NULL, NULL, NULL),
(NULL, 529, 'Trainspotting - Sem Limites', 'Trainspotting', 'Reino Unido', 'Drama', 'Danny Boyle', '15420350095be99641e826c.jpg', 94, 1996, 'Ko8blJYbWcQ', 'Ewan McGregor, Ewen Bremner, Jonny Lee Miller, Kevin McKidd', 'Em Edimburgo, na Escócia, vive Renton (Ewan McGregor), um jovem usuário de heroína que leva uma vida despreocupada, dividindo-se entre seu romance com a estudante colegial Diane (Kelly Macdonald) e os encontros com seus quatro amigos viciados: Sick Boy, (Jonny Lee Miller), um imoral desenhista de HQs fanático por Sean Connery; Tommy (Kevin McKidd), um atleta responsável; Spud (Ewen Bremner), um bobalhão de bom coração e Begbie (Robert Carlyle), um violento sociopata.', 0, NULL, NULL, NULL),
(NULL, 530, 'Os Intocáveis ', 'The Untouchables', 'Estados Unidos', 'Policial, Neo Noir', 'Brian De Palma', '15420351895be996f57f331.jpg', 119, 1987, 'jxDDeTCF56Y', 'Kevin Costner, Sean Connery, Charles Martin Smith, Andy Garcia', 'Na Chicago dos anos 30, o jovem agente federal Eliot Ness (Kevin Costner) tenta acabar com o reinado de terror e corrupção instaurado pelo gângster Al Capone (Robert De Niro). Para isso, ele recruta um pequeno time de corajosos e incorruptíveis homens e conta com a ajuda do experiente policial Jim Malone (Sean Connery).', 0, NULL, NULL, NULL),
(NULL, 531, 'E.T - O Extraterrestre ', 'E.T  The Extra-Terrestrial ', 'Estados Unidos', 'Ficção Científica', 'Steven Spielberg', '15420354005be997c8e958f.jpg', 120, 2002, 'qYAETtIIClk', NULL, 'Um garoto faz amizade com um ser de outro planeta, que ficou sozinho na Terra, protegendo-o de todas as formas para evitar que ele seja capturado e transformado em cobaia. Gradativamente, surge entre os dois uma forte amizade.', 0, NULL, NULL, NULL),
(NULL, 532, 'Perfectos Desconocidos', 'Perfectos Desconocidos', 'Espanha', 'Comédia', 'Manolo Caro', '15420355735be99875e462f.jpg', 96, 2018, '8EXb8EhYvVI', 'Manuel Garcia-Rulfo, Cecilia Suárez, Mariana Treviño, Bruno Bichir', 'Sete amigos de longa data se encontram para jantar depois de muito tempo afastados, com a regra simples e objetiva de que todas as mensagens e telefonemas que eles receberem serão públicas para o resto da mesa. Mas o que começa como uma brincadeira, acaba se tornando uma complexa experiência, revelando segredos sórdidos que bagunçam as vidas de todos os envolvidos.', 0, NULL, NULL, NULL),
(NULL, 533, 'Alex Strangelove ', 'Alex Strangelove', 'Estados Unidos', 'Comédia dramática', 'Craig Johnson', '15420358815be999a9e07c9.jpg', 99, 2018, 'ONOTM4LUCt0', 'Michael Abela, Daniel Doheny, Brendan Archer, Gianna Jean', 'Alex Truelove (Daniel Doheny) é um aluno exemplar do último ano do Ensino Médio. Ele tem um grande futuro pela frente, mas antes de se formar ele quer alcançar o último marco da adolescência: perder a virgindade com a sua namorada, Claire (Madeline Weinstein). Tudo se complica quando ele conhece Elliot (Antionio Marziale), um charmoso menino gay que sem querer põe Alex em uma jornada de autodescoberta.', 0, NULL, NULL, NULL),
(NULL, 534, 'Duck Butter', 'Duck Butter', 'Estados Unidos', 'Comédia', 'Miguel Arteta', '15420378675be9a16be992b.jpg', 93, 2018, 'uHOEqF3Mmjs', 'Alia Shawkat, Laia Costa, Mae Whitman, Hong Chau', 'Duas mulheres insatisfeitas com as mentiras e infidelidades de relacionamentos fazem um pacto de passar 24 horas juntas, na esperança de achar uma maneira nova de criar intimidade e vulnerabilidade.', 0, NULL, NULL, NULL),
(NULL, 535, 'Dream Boat ', 'Dream Boat', 'Alemanha', 'Documentário', 'Tristan Ferland Milewski', '15420380755be9a23b08d05.jpg', 92, 2017, '1UACdMZZWTw', 'Michael Anastasio, Richard Weigle', 'Uma vez por ano o Dream Boat parte em uma viagem marítima pela costa do Mediterrâneo. é o único cruzeiro para homens homossexuais na Europa. Mais de 2.500 passageiros aguardam sua partida. Entre eles estão cinco homens de cinco países diferentes que escapam das suas vidas cotidianas, longe de restrições familiares e políticas. Eles parecem ter encontrado o paraíso, até que suas histórias pessoais vêm à tona e o processo de auto-aceitação começa.', 0, NULL, NULL, NULL),
(NULL, 536, 'A Morte e a Vida de Marsha P. Johnson', 'The Death and Life of Marsha P. Johnson', 'Estados Unidos', 'Documentário', 'David France', '15420384135be9a38dbe545.jpg', 105, 2017, 'pADsuuPd79E', 'Kurt Wolfe, Sue Yacka, Catherine Shugrue Dos Santos, Victoria Cruz', 'Documentário sobre o legado político deixado por Marsha P. Johnson, a estrela da TV americana e lendária figura do gueto gay de Nova York, conhecida por muitos como a \"Rosa Parks do mundo LGBT\". Ao lado de Sylvia Rivera, Marsha foi a responsável por fundar a Transvestites Action Revolutionaries, um grupo de ativistas trans do país.', 0, NULL, NULL, NULL),
(NULL, 537, 'Serena', 'Serena', 'Estados Unidos', 'Drama', 'Susanne Bier', '15420516685be9d75439b9d.jpg', 109, 2014, 'FPVK2hzFahw', 'Bradley Cooper, Jennifer Lawrence, Rhys Ifans, Toby Jones', 'Em 1929 George Pemberton (Bradley Cooper) e Serena Pemberton (Jennifer Lawrence) decidem ir de Boston à Carolina do Norte no intuito de construir um império no ramo da madeira. Ao descobrir que é infértil, Serena começa a manifestar sentimentos de vingança contra a mulher com quem George teve um filho ilegítimo antes de se casar. Ela suspeita cada vez mais da relação do marido com esta outra família e a intensa união dos dois começa a se destruir.', 0, NULL, NULL, NULL),
(NULL, 538, 'O Lado Bom da Vida', 'Silver Linings Playbook', 'Estados Unidos', 'Comédia dramática', 'David O. Russell', '15420517655be9d7b522f72.jpg', 122, 2012, 'nZTgWcLEYgc', 'Bradley Cooper, Jennifer Lawrence, Robert De Niro, Jacki Weaver', 'Por conta de algumas atitudes erradas que deixaram as pessoas de seu trabalho assustadas, Pat Solitano Jr. (Bradley Cooper) perdeu quase tudo na vida: sua casa, o emprego e o casamento. Depois de passar um tempo internado em um sanatório, ele acaba saindo de lá para voltar a morar com os pais. Decidido a reconstruir sua vida, ele acredita ser possível passar por cima de todos os problemas do passado recente e até reconquistar a ex-esposa. Embora seu temperamento ainda inspire cuidados, um casal amigo o convida para jantar e nesta noite ele conhece Tiffany (Jennifer Lawrence), uma mulher também problemática que poderá provocar mudanças significativas em seus planos futuros.', 0, NULL, NULL, NULL),
(NULL, 539, 'Todo Dia', 'Every Day', 'Estados Unidos', 'Drama', 'Michael Sucsy', '15420518455be9d8053f2a0.jpg', 97, 2018, 'HUnTZny9E4g', 'Angourie Rice, Justice Smith, Jeni Ross, Lucas Jade Zumann', '\'A\' tem o incrível poder de acordar todos os dias em um corpo diferente, independente de gênero, cor ou idade. Sua rotina de constante adaptação, no entanto, ganha ares tristes quando acorda no corpo de Justin (Justice Smith) e acaba se apaixonando perdidamente pela namorada dele, Rhiannon (Angourie Rice).', 0, NULL, NULL, NULL),
(NULL, 540, 'Passageiros', 'Passengers', 'Estados Unidos', 'Ficção Científica', 'Morten Tyldum', '15420519315be9d85bbe892.jpg', 116, 2016, 'Q5MV9qMXH2I', 'Jennifer Lawrence, Chris Pratt, Michael Sheen, Laurence Fishburne', 'Durante uma viagem de rotina no espaço, dois passageiros são despertados 90 anos antes do tempo programado, por causa de um mal funcionamento de suas cabines. Sozinhos, Jim (Chris Pratt) e Aurora (Jennifer Lawrence) começam a estreitar o seu relacionamento. Entretanto, a paz é ameaçada quando eles descobrem que a nave está correndo um sério risco e que eles são os únicos capazes de salvar os mais de cinco mil colegas em sono profundo.', 0, NULL, NULL, NULL),
(NULL, 541, 'O Maravilhoso Agora', 'The Spectacular Now', 'Estados Unidos', 'Comédia romântica', 'James Ponsoldt', '15420520305be9d8be89e29.jpg', 95, 2013, '9JOcBXOu6XY', 'Miles Teller, Shailene Woodley, Brie Larson, Masam Holden', 'Sutter Keely (Miles Teller) leva uma vida despreocupada. Ele nunca terminou os estudos, adora festas e álcool, e troca frequentemente de namorada. Quando é rejeitado por uma de suas pretendentes, ele se embebeda e acorda em um gramado ao lado de Aimee Finicky (Shailene Woodley). Nasce uma relação improvável entre esta garota solitária, fã de ficção científica, e o homem que vive apenas no tempo presente.', 0, NULL, NULL, NULL),
(NULL, 542, 'Garden Party', 'Garden Party', 'Estados Unidos', 'Drama', 'Jason Freeland', '15420521625be9d94243b77.jpg', 88, 2008, 'hg_SlvzQgFM', 'Tierra Abbott, Christopher Allport, Lisa Arturo, Erik Bragg', 'April tem quinze anos de idade, e poucas perspectivas de vida. Ela adoraria encontrar algum emprego que não consistisse em tirar a roupa... April decide ir para Los Angeles, onde encontra um grupo de adolescente tão perturbados e talentosos quanto ela, cada um lutando para concretizar um sonho diferente. Mas todos terão que lidar com a poderosa traficante Sally Saint Clair, que tem planos perversos e maliciosos para o grupo.', 0, NULL, NULL, NULL),
(NULL, 543, 'O Paciente - O Caso Tancredo Neves', 'O Paciente - O Caso Tancredo Neves', 'Brasil', 'Biografia', 'Sergio Rezende', '15420523345be9d9ee45c1e.jpg', 100, 2018, '6Z25O87Aw6A', 'Othon Bastos, Ester Góes, Leonardo Medeiros, Paulo Betti', 'Os últimos dias da vida de Tancredo Neves (Othon Bastos), o primeiro presidente civil eleito pelo colégio eleitoral no Congresso Nacional, depois da ditadura militar. Toda a expectativa da população brasileira e a doença de Tancredo, que, após 39 dias de internação, morreu no dia 21 de abril de 1985 sem ser empossado.', 0, NULL, NULL, NULL),
(NULL, 544, 'Um Novo Despertar', 'The Beaver', 'Estados Unidos', 'Drama', 'Jodie Foster', '15420525945be9daf293f04.jpg', 91, 2011, 'iSS6iF4vsoI', 'Mel Gibson, Cherry Jones, Jodie Foster, Anton Yelchin', 'Walter Black (Mel Gibson) é o presidente de uma indústria de brinquedos. Ele sofre de depressão, o que faz com que se torne cada vez mais distante da esposa Meredith (Jodie Foster) e dos filhos Porter (Anton Yelchin) e Henry (Riley Thomas Stewart). Um dia, ao jogar o lixo fora, ele encontra o castor, um bicho de pelúcia no qual é possível colocar o braço. Logo em seguida Walter tenta o suicídio, mas fracassa. A partir de então, já com o castor, ele assume uma nova identidade e passa a se comunicar através do boneco. O castor permite que Walter volte à vida, no trabalho e junto à família, mas aos poucos ele passa a sofrer um conflito de identidades.', 0, NULL, NULL, NULL),
(NULL, 545, 'D.U.F.F - Você Conhece, Tem Ou É', 'The Duff', 'Estados Unidos', 'Comédia', 'Ari Sandel', '15421262605beafab433813.jpg', 101, 2015, 'HDvEqkeiM6U', 'Mae Whitman, Robbie Amell, Bella Thorne, Bianca A. Santos', 'A jovem Bianca (Mae Whitman) descobre um dia que foi escolhidas pelas amigas de colégio como uma DUFF (Designated Ugly Fat Friend), ou seja uma amiga feia para que elas se pareçam ainda mais bonitas em comparação. Revoltada, Bianca pede a um atleta popular da escola para ajudá-la a melhorar o seu visual.', 0, NULL, NULL, NULL),
(NULL, 546, 'Minimalismo: um documentário sobre as coisas importantes', 'Minimalism: A Documentary About the Important Things', 'Estados Unidos', 'Documentário', 'Matt D', '15421263545beafb12c1d08.jpg', 79, 2015, '0Co1Iptd4p4', 'Dan Harris, Joshua Becker, Shannon Whitehead, Sam Harris', 'Questionando como a vida poderia ser melhor com menos coisas materiais, o documentário entrevista pessoas que não são materialistas. Famílias, empresários, arquitetos, artistas, jornalistas e cientistas refletem sobre o ator de levar uma vida minimalista.', 0, NULL, NULL, NULL),
(NULL, 547, 'Filhos da Esperança', 'Children of Men', 'Estados Unidos', 'Ficção Científica', 'Alfonso Cuarón', '15421264795beafb8ff4136.jpg', 109, 2006, '9jisy5XHAC0', 'Clive Owen, Juan Gabriel Yacuzzi, Michael Caine, Mishal Husain', '2027. Não se sabe o motivo, mas as mulheres não conseguem mais engravidar. O mais novo ser humano morreu aos 18 anos e a humanidade discute seriamente a possibilidade de extinção. Theodore Faron (Clive Owen) é um ex-ativista desiludido que se tornou um burocrata e que vive em uma Londres arrasada pela violência e pelas seitas nacionalistas em guerra. Procurado por sua ex-esposa Julian (Julianne Moore), Theodore é apresentado a uma jovem que misteriosamente está grávida. Eles passam a protegê-la a qualquer custo, por acreditar que a criança por vir seja a salvação da humanidade.', 0, NULL, NULL, NULL),
(NULL, 548, 'A Escolha de Sofia ', 'Sophie\'s Choice', 'Estados Unidos', 'Drama', 'Alan J. Pakula', '15421266615beafc451cb60.jpg', 150, 1982, 'Z0tdw5cEwcQ', 'Meryl Streep, Kevin Kline, Peter MacNicol, Rita Karin', 'Em 1947 Stingo (Peter MacNicol), um jovem aspirante a escritor vindo do sul, vai morar no Brooklyn na casa de Yetta Zimmerman (Rita Karin), que alugava quartos. Lá conhece Sofia Zawistowska (Meryl Streep), sua vizinha do andar de cima, que é polonesa e fora prisioneira em um campo de concentração e Nathan Landau (Kevin Kline), seu namorado, um carismático judeu dono de um temperamento totalmente instável. Em pouco tempo tornam-se amigos, sendo que Stingo não tem a menor idéia dos segredos que Sofia esconde nem da insanidade de Nathan.', 0, NULL, NULL, NULL),
(NULL, 549, 'Scarface', 'Scarface', 'Estados Unidos', 'Ação', 'Brian De Palma', '15421267835beafcbf84b9c.jpg', 170, 1983, 'a9LVwNum6rE', 'Al Pacino, Steven Bauer, Michelle Pfeiffer, Mary Elizabeth Mastrantonio', 'Um criminoso cubano exilado (Al Pacino) vai para Miami e em pouco tempo está trabalhando para um chefão das drogas. Sua ascensão na quadrilha é meteórica, mas quando ele começa a sentir interesse na amante do chefe (Michelle Pfeiffer) este manda matá-lo. No entanto ele escapa do atentado, mata o mandante do crime, fica com a amante dele - mas simultaneamente sente desejos incestuosos por sua irmã (Mary Elizabeth Mastrantonio) - e assume o controle da quadrilha. Em pouco tempo ele ganha mais dinheiro do que jamais sonhou. No entanto ele está na mira dos agentes federais, que o pegam quando ele está \"trocando\" dinheiro. Mas seu problema pode ser resolvido se ele fizer um \"serviço\" em Nova York para um grande traficante e pessoas influentes, que podem manipular o poder para ajudá-lo. Porém, a missão toma um rumo inesperado quando, para concretizá-la, ele precisa matar crianças.', 0, NULL, NULL, NULL),
(NULL, 550, 'As Patricinhas de Beverly Hills', 'Clueless', 'Estados Unidos', 'Comédia', 'Amy Heckerling', '15421269365beafd58903fb.jpg', 97, 1995, 'RS0KyTZ3Ie4', 'Alicia Silverstone, Stacey Dash, Brittany Murphy, Paul Rudd', 'Em Beverly Hills, a adolescente Cher (Alicia Silverstone), filha de uma advogado (Dan Hedaya) muito rico, passa seu tempo em conversas fúteis e fazendo compras com amigas totalmente alienadas como ela. Mas a chegada do enteado de seu pai, Josh (Paul Rudd), muda tudo, primeiro por ele criticá-la de não tomar conhecimento com o \"mundo real\" e em segundo lugar por ela descobrir que está apaixonada por ele.', 0, NULL, NULL, NULL),
(NULL, 551, 'O Trote', 'Goat', 'Estados Unidos', 'Drama', 'Andrew Neel', '15421270925beafdf411f60.jpg', 96, 2016, 'jfsokrq-DK8', 'Ben Schnetzer, Nick Jonas, Gus Halper, Danny Flaherty', 'Após um terrível ataque contra si e de se recuperar das sequelas deixadas, Brad, um jovem de dezenove anos, se matricula na faculdade junto com o seu irmão. Os dois acabam entrando na mesma fraternidade, porém o que acontece lá em nome da lealdade entre os integrantes testa os dois irmãos e seu relacionamento de maneiras brutais.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 552, 'Ícaro', 'Ícaro', 'Estados Unidos', 'Documentário', 'Bryan Fogel', '15421271405beafe2442148.jpg', 110, 2017, 'TvsXSvMu0jE', NULL, 'Quando o ciclista amador Bryan Fogel começa a descobrir a verdade sobre o doping nos esportes, decide entrar de cabeça num experimento ousado para comprovar a incompetência do método de controle dos atletas. Sua investida, no entanto, transforma-se em algo muito maior quando o médico russo que o orienta no processo se vê no centro de um enorme escândalo que compromete os resultados das últimas Olimpíadas de verão e inverno e envolve até a temida agência russa de segurança.', 0, NULL, NULL, NULL),
(NULL, 553, 'O Destino de Uma Nação ', 'Darkest Hour', 'Reino Unido', 'Biografia', 'Joe Wright', '15421273755beaff0f20e44.jpg', 125, 2017, '2bTSm8311jQ', 'Gary Oldman, Kristin Scott Thomas, Ben Mendelsohn, Lily James', 'Winston Churchill (Gary Oldman) está prestes a encarar um de seus maiores desafios: tomar posse do cargo de Primeiro Mnistro da Grã-Bretanha. Paralelamente, ele começa a costurar um tratado de paz com a Alemanha nazista que pode significar o fim de anos de conflito.', 0, NULL, NULL, NULL),
(NULL, 554, 'Artista do Desastre', 'The Disaster Artist', 'Estados Unidos', 'Drama', 'James Franco', '15421275415beaffb5cd523.jpg', 104, 2017, 'sBUeFolr6rE', 'Dave Franco, James Franco, Seth Rogen, Ari Graynor', 'Greg Sestero (Dave Franco) se aproxima do excêntrico Tommy Wiseau (James Franco) após uma aula de atuação e os dois desenvolvem uma intensa amizade ancorada no sonho em comum de fazer sucesso nas artes dramáticas. Juntos eles partem para Hollywood, onde Tommy, cansado de ser rejeitado em testes, decide produzir, financiar, dirigir, escrever e protagonizar – ao lado do melhor amigo – o longa-metragem que o catapultará ao estrelato: \"The Room\".', 0, NULL, NULL, NULL),
(NULL, 555, 'Simplesmente Complicado', 'Simply Complicated', 'Estados Unidos', 'Documentário', 'Hannah Lux Davis', '15421276475beb001fd4340.jpg', 78, 2017, 'bpDylTwwunc', 'Demi Lovato, Marissa Callahan, Dianna De La Garza, Dallas Lovato', 'O documentário traz histórias nunca antes contadas e que mostram a pessoa que Demi é hoje. No filme, Demi fala sobre todas as dificuldades que encontrou durante a sua carreira e como se tornou uma das maiores estrelas da música pop internacional.', 0, NULL, NULL, NULL),
(NULL, 556, 'Mudbound: Lágrimas Sobre o Mississipi', 'Mudbound', 'Estados Unidos', 'Drama', 'Dee Rees', '15421276595beb002b120f7.jpg', 134, 2017, 'CT9ANvExRwA', 'Carey Mulligan, Jonathan Banks, Garrett Hedlund, Jason Clarke', 'A tímida Laura (Carey Mulligan) acredita ter tirado a sorte grande quando encontra Henry McAllan (Jason Clarke), um homem um pouco bruto, mas interessado nela. Logo após o casamento, a família se muda para uma fazenda no chuvoso delta do Rio Mississipi. Enquanto Laura enfrenta dificuldades para se adaptar à vida rural, ela é confrontada com uma família negra, os Jackson, responsáveis por ajudar no trabalho pesado com o plantio e a colheita. Duas posições muito distintas se desenham na família: enquanto o pai idoso de Henry, Poppy McAllan (Jonathan Banks), luta para manter os privilégios dos brancos no terreno, o irmão de Henry, Jamie McAllan (Garrett Hedlund), desenvolve uma boa amizade com o filho dos caseiros, Ronsell Jackson (Jason Mitchell), pelo fato de ambos compartilharem traumas da guerra. Um violento conflito de etnias, gêneros e classes sociais marca a convivência entre os McAllan e os Jackson.', 0, NULL, NULL, NULL),
(NULL, 557, 'Todo o dinheiro do mundo', 'All the Money in the World', 'Estados Unidos', 'Suspense', 'Ridley Scott', '15421277725beb009c1d44c.jpg', 132, 2017, 'nLZuzFsRITw', 'Michelle Williams, Christopher Plummer, Mark Wahlberg, Romain Duris', 'Itália, 1973. John Paul Getty III (Charlie Plummer) é o neto favorito do magnata do petróleo J. Paul Getty (Christopher Plummer), um dos primeiros bilionários da história da humanidade. O sequestro do rapaz coloca a sua mãe, Gail Harris (Michelle Williams), em uma corrida desesperada para convencer o ex-sogro a pagar o resgate milionário do filho. Frio, manipulador e mesquinho, Getty irá encarregar o ex-espião Fletcher Chase (Mark Wahlberg), seu homem de confiança, de descobrir quem e o que está por trás do crime, solucionando o problema sem o desperdício de nenhum centavo de sua fortuna.', 0, NULL, NULL, NULL),
(NULL, 558, 'O Poderoso Chefinho', 'The Boss Baby', 'Estados Unidos', 'Animação', 'Tom McGrath', '15421279685beb0160ead72.jpg', 97, 2017, '6pTlq7vH49E', 'Alec Baldwin, Steve Buscemi, Jimmy Kimmel, Lisa Kudrow', 'Um bebê falante que usa terno e carrega uma maleta misteriosa une forças com seu irmão mais velho invejoso para impedir que um inescrupuloso CEO acabe com o amor no mundo. A missão é salvar os pais, impedir a catástrofe e provar que o mais intenso dos sentimentos é uma poderosa força.', 0, NULL, NULL, NULL),
(NULL, 559, 'Gaga: Five Foot Two', 'Gaga: Five Foot Two', 'Estados Unidos', 'Documentário', 'Chris Moukarbel', '15421280805beb01d0ca1ee.jpg', 101, 2017, '2k_9Pr86pCA', 'Lady Gaga, Sandra Amador, Michael Bearden, Tony Bennett, Florence Welch, Donatella Versace, BloodPop', 'Lady Gaga fora dos palcos, por trás da cortina. Os altos e baixos na vida pessoal, as lutas com os relacionamentos, os problemas de saúde e, o principal, a diferença da vida como uma estrela da vida como uma mulher cotidiana.', 0, NULL, NULL, NULL),
(NULL, 560, 'Victoria e Abdul - O Confidente da Rainha', 'Victoria And Abdul', 'Reino Unido', 'Biografia', 'Stephen Frears', '15421281725beb022cd9afe.jpg', 102, 2017, 'e9x7GDeA6ok', NULL, '1887, cidade de Agra, na Índia. Dois jovens locais são escolhidos para viajar até Londres de forma a presentear a rainha Victoria (Judi Dench) com uma valiosa moeda local. Ao chegar, tanto Abdul (Ali Fazal) quanto Mohammed (Adeel Akhtar) estranham bastante os costumes da realeza britânica, sempre a postos para mimar a rainha. Ao entregar a moeda, Abdul quebra o protocolo e encara a monarca. Tamanha ousadia chama a atenção da rainha Victoria, que através de várias conversas não só passa a conhecê-lo melhor como também o transforma em seu conselheiro. Esta decisão não agrada nem um pouco a corte inglesa, que não entende como um humilde indiano pode ser detentor de tal honraria.', 0, NULL, NULL, NULL),
(NULL, 561, 'Cidades de Papel', 'Paper Towns', 'Estados Unidos', 'Aventura', 'Jake Schreier', '15421284545beb03467fd24.jpg', 109, 2015, 'efdWb_9h6aE', 'Nat Wolff, Cara Delevingne, Austin Abrams, Justice Smith', 'A história é centrada em Quentin Jacobsen (Nat Wolff) e sua enigmática vizinha e colega de escola Margo Roth Spiegelman (Cara Delevingne). Ele nutre uma paixão platônica por ela. E não pensa duas vezes quando a menina invade seu quarto propondo que ele participe de um engenhoso plano de vingança. Mas, depois da noite de aventura, Margo desaparece – não sem deixar pistas sobre o seu paradeiro.', 0, NULL, NULL, NULL),
(NULL, 563, 'O Mau Exemplo de Cameron Post', 'The Miseducation of Cameron Post', 'Estados Unidos', 'LGBT', 'Desiree Akhavan', '15421290215beb057dbf8f2.jpg', 91, 2018, 'toXBb638n2Y', 'Chloë Grace Moretz, Steven Hauck, Quinn Shephard, Kerry Butler', 'Flagrada pelo namorado transando com a melhor amiga em pleno baile de formatura, Cameron Post (Chloe Grace Moretz) é enviada pela tia para um centro religioso que afirma curar jovens atraídos pelo mesmo sexo, mas para se submeter ou não ao suposto tratamento, a adolescente precisa antes descobrir quem é de fato.', 0, NULL, NULL, NULL),
(NULL, 564, 'Felicidade por Um Fio', 'Nappily Ever After', 'Estados Unidos', 'Drama', 'Haifaa Al-Mansour', '15421294115beb0703b3be4.jpg', 98, 2018, 'EZOwfX3bmzQ', 'Sanaa Lathan, Ricky Whittle, Lyriq Bent, Lynn Whitfield', 'Violet Jones (Sanaa Lathan) é uma publicitária bem-sucedida que considera sua vida perfeita, tendo um ótimo namorado e uma rotina organizada meticulosamente para conseguir estar sempre impecável. Após uma enorme desilusão, ela resolve repaginar o visual e o caminho de aceitação de seu cabelo está intrinsecamente ligado à sua reformulação como mulher, superando traumas que vêm desde a infância e pela primeira vez se colocando acima da opinião alheia.', 0, NULL, NULL, NULL),
(NULL, 565, 'Feministas: O Que Elas Estavam Pensando?', 'Feminists: What Were They Thinking?', 'Estados Unidos', 'Documentário', 'Johanna Demetrakas', '15421298635beb08c741654.jpg', 86, 2018, 'uAgeCLYnwNg', 'Laurie Anderson, Judy Chicago, Jane Fonda, Sally Kirkland', 'Em 1977, um livro de fotografias captou um despertar - as mulheres se livraram das restrições culturais de suas infâncias e adotaram toda a sua humanidade. \"Feministas: O Que Eles Estavam Pensando?\" revisita essas fotos, essas mulheres, aqueles momentos  e aponta para a nossa cultura atual, revelando de maneira muito vívida a necessidade urgente de mudanças contínuas. O filme oferece entrevistas sinceras e fascinantes com mulheres como Jane Fonda, Gloria Steinem, Lily Tomlin e Judy Chicago abordando temas como identidade, aborto, raça, infância e maternidade. Um documentário original da Netflix dirigido por Johanna Demetrakas.', 0, NULL, NULL, NULL),
(NULL, 566, '7 Desejos', 'Wish Upon', 'Canadá', 'Terror', 'John R. Leonetti', '15421302395beb0a3f16f87.jpg', 90, 2017, '=Q0ipNmPQeX4', 'Joey King, Ryan Phillippe, Ki Hong Lee, Mitchell Slaggert', 'A adolescente Claire (Joey King) descobre uma caixa mágica, que lhe concede sete desejos. Claire acaba fazendo apenas desejos pessoais e coisas ruins começam a acontecer. Com isso ela descobre que dentro da caixa vive uma entidade malvada, que pode estar causando esses acontecimentos terríveis.', 0, NULL, NULL, NULL),
(NULL, 567, 'The Feels', 'The Feels', 'Estados Unidos', 'LGBT', 'Jenée LaMarque', '15421306115beb0bb310249.jpg', 90, 2017, 'Ml_hklgKMnM', 'Constance Wu, Angela Trimbur, Josh Fadem, Gretchen Klein', 'Uma despedida de solteira lésbica dá errado quando uma das noivas admite que nunca teve um orgasmo.', 0, NULL, NULL, NULL),
(NULL, 568, 'Lion: Uma Jornada Para Casa', 'Lion', 'Estados Unidos', 'Drama', 'Garth Davis', '15421309945beb0d323c07a.jpg', 118, 2016, '0MRHntVJ0EM', 'Sunny Pawar, Abhishek Bharate, Priyanka Bose, Khushi Solanki', 'Quando tinha apenas cinco anos, o indiano Saroo (Dev Patel) se perdeu do irmão numa estação de trem de Calcutá e enfretou grandes desafios para sobreviver sozinho até de ser adotado por uma família australiana. Incapaz de superar o que aconteceu, aos 25 anos ele decide buscar uma forma de reencontrar sua família biológica.', 0, NULL, NULL, NULL),
(NULL, 569, 'Como Ser Solteira', 'How to Be Single', 'Estados Unidos', 'Comédia romântica', 'Christian Ditter', '15421316585beb0fca91093.jpg', 110, 2016, 'MxARqpiCMTc', 'Dakota Johnson, Rebel Wilson, Leslie Mann, Damon Wayans Jr.', 'Alice (Dakota Johnson) acabou de sair de um relacionamento e não sabe muito bem como agir sem outra metade. Para sua sorte, ela tem uma animada amiga (Rebel Wilson) especialista na vida noturna de Nova York, que passa a ensiná-la como ser solteira.', 0, NULL, NULL, NULL),
(NULL, 570, 'O Perfume da Memória', 'O Perfume da Memória', 'Brasil', 'LGBT', 'Oswaldo Montenegro', '15421318975beb10b95f0b5.jpg', 73, 2016, 'BPcpJ05BMMQ', 'Amandha Monteiro, Oswaldo Montenegro, Kamila Pistori, Janaína Salles', 'O Perfume da Memória é baseado na música homônima de Oswaldo Montenegro, e fala da história de amor entre Ana e Laura, duas mulheres com várias afinidades, mas tendo que lidar com divergências irreconciliáveis.', 0, NULL, NULL, NULL),
(NULL, 571, 'Meu Nome é Ray', '3 Generations', 'Estados Unidos', 'Drama', 'Gaby Dellal', '15421321035beb11872c147.jpg', 92, 2015, 'UkNjFuA210E', 'Elle Fanning, Linda Emond, Susan Sarandon, Naomi Watts', 'Ray (Elle Fanning) nasceu mulher, mas nunca se identificou com o gênero e se prepara para fazer a cirurgia de transgenitalização. Sua mãe, Maggie (Naomi Watts), tenta encontrar a melhor forma de lidar com a questão, mas a avó homossexual de Ray, Dolly (Susan Sarandon), recusa-se a aceitar a resolução e cria um conflito familiar.', 0, NULL, NULL, NULL),
(NULL, 572, 'Se Eu Ficar', 'If I Stay', 'Estados Unidos', 'Drama', 'R.J. Cutler', '15421323505beb127e3dbd4.jpg', 107, 2014, 'D5keBYwpI10', 'Chloë Grace Moretz, Mireille Enos, Jamie Blackley, Joshua Leonard', 'A jovem musicista Mia tem uma brilhante carreira pela frente, o que lhe gera dúvida entre dedicar-se integralmente à carreira, na famosa escola Julliard, ou a Adam, seu amor. Porém, a vida lhe traz uma surpresa. Mia sofre um grave acidente de carro, perde a família e fica à beira da morte. Em coma, ela reflete sobre o passado e o futuro que pode ter, caso sobreviva.', 0, NULL, NULL, NULL),
(NULL, 573, 'Esposa de Mentirinha', 'Just Go with It', 'Estados Unidos', 'Comédia', 'Dennis Dugan', '15421327865beb1432721f2.jpg', 117, 2011, 'QmL1mdzS544', 'Adam Sandler, Jennifer Aniston, Nicole Kidman, Nick Swardson', 'Danny Maccabee (Adam Sandler) queria um relacionamento sério, mas foi infeliz em sua tentativa de casamento. Para driblar a carência, passa a vivenciar somente namoricos e transas sem o menor compromisso. Assim, ele toca sua vida como cirurgião plástico bem sucedido, tendo sua melhor amiga Katherine (Jennifer Aniston), mãe solteira de um casal de pirralhos, como fiel escudeira. Mas um dia ele conhece a jovem Palmer (Brooklyn Decker) e a paixão toma conta de ambos. Disposto a se casar com ela, Danny pisa na bola quando, para conquistá-la, inventa que é marido da amiga, pai das crianças e que vai se separar. Começa então uma verdadeira aventura amorosa recheada de confusões de todos os tipos. ', 0, NULL, NULL, NULL),
(NULL, 574, 'Barbie: Escola de Princesa', 'Barbie: Princess Charm School', 'Estados Unidos', 'Animação', 'Ezekiel Norton', '15421330365beb152cbd20e.jpg', 81, 2011, 'G-9dkcZtjYA', 'Diana Kaarina, Morwenna Banks, Nicole Oliver, Brittney Wilson', 'Barbie interpreta Blair Willows, uma garota simples e bondosa que foi sorteada para estudar na exclusiva Escola de Princesas, um local onde as futuras princesas e damas reais aprendem dança, etiqueta, artes e outras habilidades indispensáveis. Blair adora suas aulas, suas fadinhas assistentes e suas novas amigas, as Princesas Hadley e Isla, mesmo com todas as dificuldades que passa na Escola de Princesas. Mas, quando a malvada Dama Devin desconfia que Blair é a princesa-herdeira desaparecida, ela faz de tudo para impedir que ela seja coroada e assuma o trono. Blair e suas amigas embarcam em uma aventura para encontrar a coroa encantada e descobrir sua verdadeira identidade', 0, NULL, NULL, NULL),
(NULL, 575, 'Camp Rock', 'Camp Rock', 'Estados Unidos', 'Musical', 'Matthew Diamond', '15421345025beb1ae68df3a.jpg', 94, 2008, 'chqevL3FSz8', 'Demi Lovato, Joe Jonas, Meaghan Martin, Maria Canals-Barrera', 'Mitchie Torres (Demi Lovato) quer muito participar do famoso acampamento musical de verão \"Camp Rock\", mas tudo que consegue é um emprego na cozinha. Um dos jovens participantes a escuta cantando e fica apaixonado pela voz, mas antes de assumir seu enorme talento e finalmente se apresentar a garota precisa criar coragem.', 0, NULL, NULL, NULL),
(NULL, 576, 'Camp Rock 2: The Final Jam', 'Camp Rock 2: The Final Jam', 'Estados Unidos', 'Musical', 'Paul Hoen', '15421346655beb1b89d75b1.jpg', 97, 2010, '', 'Demi Lovato, Joe Jonas, Nick Jonas, Kevin Jonas', 'Mitchie (Demi Lovato) está muito animada para voltar ao Camp Rock, passar o verão criando músicas com seus amigos e, principalmente, reencontrar o superastro Shane Gray (Joe Jonas) da banda Connect 3. Mas ninguém esperava que abriu um novo e extravagente acampamento musical do outro lado do rio, o Camp Star, uma óbvia concorrência ao Camp Rock. A rivalidade aumenta quando surge um desafio entre os dois grupos: uma batalha musical, com transmissão ao vivo pela televisão, onde só pode haver um vencedor. Enquanto Mitchie lidera seus amigos para criar o melhor show de todos, algo que acaba atrapalhando seu romance com Shane: o irmão dele, Nate (Nick Jonas), se apaixona por Dana (Chloe Bridges), a filha do dono do Camp Star.', 0, NULL, NULL, NULL),
(NULL, 577, 'O Diabo Veste Prada', 'The Devil Wears Prada', 'Estados Unidos', 'Comédia', 'David Frankel', '15421349195beb1c874bb5d.jpg', 109, 2006, 'DgAWG0CrGTM', 'Meryl Streep, Anne Hathaway, Emily Blunt, Stanley Tucci', 'Andrea Sachs (Anne Hathaway) é uma jovem que conseguiu um emprego na Runaway Magazine, a mais importante revista de moda de Nova York. Ela passa a trabalhar como assistente de Miranda Priestly (Meryl Streep), principal executiva da revista. Apesar da chance que muitos sonhariam em conseguir, logo Andrea nota que trabalhar com Miranda não é tão simples assim.', 0, NULL, NULL, NULL),
(NULL, 578, 'Legítimo Rei', 'Outlaw King', 'Estados Unidos', 'Drama', 'David Mackenzie', '15421353035beb1e07e40fb.jpg', 121, 2018, 'V6Msl1HFJv0', 'Chris Pine, Stephen Dillane, Rebecca Robin, Billy Howle', 'Depois de ser coroado Rei dos Escoceses, o lendário Robert \"The Bruce\" luta para tentar recuperar o controle mas acaba sendo derrotado em um ataque surpresa feito pelo rei inglês, o que o deixou um fora-da-lei.', 0, NULL, NULL, NULL),
(NULL, 579, 'A Era do Gelo', 'Ice Age', 'Estados Unidos', 'Animação', 'Chris Wedge', '15421375635beb26db1b6f1.jpg', 81, 2002, 'NWtFKeCSoAM', 'Ray Romano, John Leguizamo, Denis Leary, Goran Visnjic', 'O mamute Manny (Ray Romano/Diogo Vilela), o tigre de dente de sabre Diego (Dennis Leary/Márcio Garcia) e a preguiça-gigante Sid (John Leguizamo/Tadeu Melo) são amigos em uma época muito distante dos dias atuais e vivem suas vidas em meio a muito gelo. Até o dia em que eles encontram um menino esquimó totalmente sozinho, longe de seus pais, e decidem que precisam ajudá-lo a achar a sua família. Enquanto isso, o esquilo pré-histórico Scrat segue na sua saga para manter sua amada noz protegida de outros predadores.', 0, NULL, NULL, NULL),
(NULL, 580, 'Infiltrado na Klan', 'BlacKkKlansman', 'Estados Unidos', 'Biografia, Policial, Comédia', 'Spike Lee', '15481001895c46225d8d792.jpg', 135, 2018, 'ie339j2Qeog', 'John David Washington, Adam Driver, Topher Grace, Laura Harrier, Ryan Eggold, Jasper Pääkkönen, Corey Hawkins, Ashlie Atkinson', 'Em 1978, Ron Stallworth (John David Washington), um policial negro do Colorado, conseguiu se infiltrar na Ku Klux Klan local. Ele se comunicava com os outros membros do grupo através de telefonemas e cartas, quando precisava estar fisicamente presente enviava um outro policial branco no seu lugar. Depois de meses de investigação, Ron se tornou o líder da seita, sendo responsável por sabotar uma série de linchamentos e outros crimes de ódio orquestrados pelos racistas.', 0, NULL, NULL, NULL),
(NULL, 581, 'O Ódio que Você Semeia', 'The Hate U Give', 'Estados Unidos', 'Drama', 'George Tillman Jr.', '15421414375beb35fdcf6ae.jpg', 133, 2018, 'EryI11N3Oss', 'Amandla Stenberg, Regina Hall, Russell Hornsby, Anthony Mackie', 'Starr Carter (Amandla Stenberg) é uma adolescente negra de dezesseis anos que presencia o assassinato de Khalil, seu melhor amigo, por um policial branco. Ela é forçada a testemunhar no tribunal por ser a única pessoa presente na cena do crime. Mesmo sofrendo uma série de chantagens, ela está disposta a dizer a verdade pela honra de seu amigo, custe o que custar.', 0, NULL, NULL, NULL),
(NULL, 582, 'Podres de Ricos', 'Crazy Rich Asians', 'Estados Unidos', 'Comédia romântica', 'Jon M. Chu', '15421426885beb3ae0eee1c.jpg', 120, 2018, 'dyFXpJNzpst', 'Constance Wu, Henry Golding, Michelle Yeoh, Gemma Chan', 'Rachel Chu (Constance Wu) é uma professora de economia nos EUA e namora com Nick Young (Henry Golding) há algum tempo. Quando Nick convida Rachel para ir no casamento do melhor amigo, em Singapura, ele esquece de avisar à namorada que, como herdeiro de uma fortuna, ele é um dos solteiros mais cobiçados do local, colocando Rachel na mira de outras candidatas e da mãe de Nick, que desaprova o namoro.', 0, NULL, NULL, NULL),
(NULL, 583, 'As Viúvas', 'Widows', 'Estados Unidos', 'Drama', 'Steve McQueen', '15421430325beb3c38b8d7e.jpg', 129, 2018, 'pMwemGNJy6A', 'Viola Davis, Liam Neeson, Jon Bernthal, Manuel Garcia-Rulfo', 'Quatro viúvas entram para o mundo do crime após os seus maridos morrerem durante uma das maiores tentativas de assalto da atualidade. Eles tomam para a si a responsabilidade de honrar a memória dos amados terminando o que eles não conseguiram completar. ', 0, NULL, NULL, NULL),
(NULL, 584, 'O Outro Lado do Vento', 'The Other Side of the Wind', 'Estados Unidos', 'Drama', 'Orson Welles', '15421434955beb3e07f1047.jpg', 122, 2018, 'nMWHBUTHmf0', 'John Huston, Oja Kodar, Peter Bogdanovich, Susan Strasberg', 'J.J. Jake Hannaford (John Huston) é um consagrado diretor de cinema que enfrenta problemas para concluir seu último filme, \"O Outro Lado do Vento\", devido ao abandono repentino do protagonista, John Dale (Robert Random). Com o orçamento estourado e a pressão de executivos de Hollywood, Hannaford comemora seu aniversário em meio a amigos e inimigos, exibindo aos presentes o que já filmou até o momento.', 0, NULL, NULL, NULL),
(NULL, 585, 'Mid90s', 'Mid90s', 'Estados Unidos', 'Drama', 'Jonah Hill', '15421437045beb3ed81bf14.jpg', 84, 2018, 'Igfhy3Q5CeI', 'Sunny Suljic, Katherine Waterston, Lucas Hedges, Na-kel Smith', 'Aos 13 anos, Stevie é um garoto de Los Angeles tentando curtir o início da adolescência enquanto tenta relevar o relacionamento abusivo com o irmão mais velho. Em plena década de 90, ele descobre o skate e aprende lições de vida com o seu novo grupo de amigos.', 0, NULL, NULL, NULL),
(NULL, 587, 'O Grinch', 'The Grinch', 'Estados Unidos', 'Animação', 'Yarrow Cheney, Scott Mosier', '15421447465beb42eae5d68.jpg', 90, 2018, 'Bf6D-i8YpHg', 'Benedict Cumberbatch, Cameron Seely, Rashida Jones, Pharrell Williams', 'O Grinch é um ser verde que não suporta o Natal e, todo ano, precisa aturar que os habitantes da cidade vizinha de Quemlândia comemorem a data. Decidido a acabar com a festa, ele resolve invadir os lares dos vizinhos e roubar tudo o que está relacionado ao Natal.', 0, NULL, NULL, NULL),
(NULL, 589, 'Eighth Grade', 'Eighth Grade', 'Estados Unidos', 'Drama', 'Bo Burnham', '15421451745beb4496c748a.jpg', 93, 2018, 'y8lFgF_IjPw', 'Elsie Fisher, Josh Hamilton, Emily Robinson, Jake Ryan', 'Kayla (Elsie Fisher), de 13 anos, como toda jovem do subúrbio americano, sofre na última semana do ensino fundamental - o fim de seu até agora desastroso ano da oitava série/nono ano - antes de começar a frequentar uma escola nova no ensino médio.', 0, NULL, NULL, NULL),
(NULL, 590, 'Vida Selvagem', 'Wildlife', 'Estados Unidos', 'Drama', 'Paul Dano', '15421453215beb4529b02aa.jpg', 104, 2018, 'Loa1OF_XLCM', 'Jake Gyllenhaal, Carey Mulligan, Ed Oxenbould, Bill Camp', 'Aos 14 anos de idade, Joe (Ed Oxenbould) começa a perceber que sua família está desmoronando. O pai, Jerry (Jake Gyllenhaal), acaba de perder o emprego, mas não quer que a esposa trabalhe. A mãe, Jeanette (Carey Mulligan), não pretende ficar de braços cruzados diante da crise e começa a ganhar sua autonomia. Quando Jerry decide ficar muitos meses fora de casa, num trabalho temporário apagando incêndios pela região, Jeanette decide que é hora de refazer a sua vida. Mas para Joe, a única coisa que importa é ver os pais reunidos novamente.', 0, NULL, NULL, NULL),
(NULL, 591, 'Suspíria', 'Suspiria', 'Itália', 'Terror', 'Dario Argento', '15421455015beb45dd15fe1.jpg', 92, 1977, 'MecSlkWMHPY', 'Jessica Harper, Stefania Casini, Flavio Bucci, Miguel Bosé', 'Suzy (Jessica Harper) é uma jovem americana chega em Fribourg para fazer cursos em uma academia de dança de prestígio. A atmosfera do lugar, estranho e perturbador, acaba surpreendendo a garota. Quando uma jovem estudante é assassinada, Suzy entra em estado de choque. O ambiente fica ainda pior quando o pianista cego da academia morre atacado por seu próprio cão. A jovem descobre que o local já foi a casa de uma bruxa conhecida como a Mãe dos Suspiros.', 0, NULL, NULL, NULL),
(NULL, 592, 'Boy Erased - Uma Verdade Anulada', 'Boy Erased', 'Estados Unidos', 'LGBT, Drama, Coming of Age, Biográfico', 'Joel Edgerton', '15421457165beb46b4d4b26.jpg', 114, 2018, 'tsBTlUG1Mck', 'Lucas Hedges, Nicole Kidman, Russell Crowe, Madelyn Cline, Joel Edgerton, Joe Alwyn, Flea, Théodore Pellerin, Xavier Dolan, Troye Sivan', 'O jovem Garrard (Lucas Hedges) de apenas 19 anos mora numa pequena cidade conservadora do Arkansas. Ele é gay e filho de um pastor da igreja batista. Chega um momento em que ele é confrontado pela família, ou arrisca perder sua família e amigos ou entra num programa de terapia que busca a \"cura\" da homossexualidade.', 0, NULL, NULL, NULL),
(NULL, 593, 'Resident Evil: O Hóspede Maldito', 'Resident Evil', 'Estados Unidos', 'Ficção Científica', 'Paul W.S. Anderson', '15421465445beb49f0f0eb6.jpg', 100, 2002, 'eEGDRSYEd0E', 'Ryan McCluskey, Oscar Pearce, Indra Ové, Anna Bolt', 'Alguma coisa terrível está oculta na “Colméia”, um enorme laboratório subterrâneo utilizado para pesquisa genética que é controlado pela Umbrella, uma dos maiores conglomerados do mundo. Lá há uma epidemia do T-Vírus, uma arma biológica de grande poder que acaba matando todos os cientistas que lá trabalhavam. Na verdade se eles tivessem sido mortos realmente teria sido ótimo, mas todos são transformados em zumbis, que sentem uma fome incontrolável e transformam todas as suas vítimas em outros zumbis. Quando isto acontece Alice (Milla Jovovich), que não sabe bem quem ela é, e Rain Ocampo (Michelle Rodriguez) se integram a um comando que entra na “Colméia” para entender e tentar controlar a situação. Porém isto tem de ser feito muito rápido, pois em três horas “Rainha Vermelha”, o supercomputador que controla o local, o selará para sempre e quem estiver lá dentro estará fatalmente condenado a se tornar um zumbi.', 0, NULL, NULL, NULL),
(NULL, 594, 'Resident Evil: Apocalipse', 'Resident Evil: Apocalypse', 'Estados Unidos', 'Ficção Científica', 'Alexander Witt', '15421468025beb4af2a0798.jpg', 94, 2004, 'sT6N__M_glo', 'Milla Jovovich, Sienna Guillory, Oded Fehr, Thomas Kretschmann', 'Desde que foi capturada pela Corporação Umbrella, Alice (Milla Jovovich) passou por várias experiências biogênicas. Ela teve seus genes modificados, o que fez com que adquirisse poderes, sentidos e agilidade sobre-humanos. Agora ela precisa retornar à cidade de Racoon, onde recebe o apoio de Jill Valentine (Sienna Guillory) e Carlos Olivera (Oded Fehr) para eliminar um vírus mortal que ameaça fazer com que todo ser humano retorne como morto-vivo.', 0, NULL, NULL, NULL),
(NULL, 595, 'Resident Evil: A Extinção', 'Resident Evil: Extinction', 'Estados Unidos', 'Ficção Científica', 'Russell Mulcahy', '15421470145beb4bc636d99.jpg', 94, 2007, '73qqFnKTmnw', 'Milla Jovovich, Oded Fehr, Ali Larter, Iain Glen', 'O T-Vírus experimental, criado pela Umbrella Corporation, foi liberado no mundo, transformando a população em zumbis que se alimentam de carne humana. Com as cidades sem segurança alguma, Carlos Olivera (Oded Fehr) e L.J. (Mike Epps), juntamente com as sobreviventes K-Mart (Spencer Locke) e Betty (Ashanti), reúnem um grupo e fogem pelo deserto, em um comboio blindado. Eles procuram outras pessoas que não estejam infectadas, mas apenas encontram outros mortos-vivos. O grupo é acompanhado pelo dr. Isaacs (Iain Glen), que está num complexo laboratorial subterrâneo da Umbrella Corporation, escondido sob uma torre de rádio abandonada em Nevada. Isaacs acompanha também Alice (Milla Jovovich), que, após ser capturada pela Umbrella, foi submetida a um teste biogenético que alterou sua configuração genética. Agora transformando-se constantemente e sob o risco de ser traída pelo seu próprio corpo, Alice segue o comboio e tenta conduzi-los ao seu destino: o Alasca, onde acreditam que estarão livres dos zumbis.', 0, NULL, NULL, NULL),
(NULL, 596, 'Resident Evil: Recomeço', 'Resident Evil: Afterlife', 'Estados Unidos', 'Ficção Científica', 'Paul W.S. Anderson', '15421471955beb4c7bc86f7.jpg', 96, 2010, '3YO38VrOj-k', 'Milla Jovovich, Ali Larter, Kim Coates, Shawn Roberts', 'Em um mundo devastado pela infecção por um vírus que faz com que suas vítimas se tornem zumbis, Alice (Milla Jovovich) segue sua jornada em busca de sobreviventes. O confronto com a Umbrella Corporation atinge um novo nível, o que faz com que Alice receba a inesperada ajuda de um velho amigo. Los Angeles aparenta ser um local seguro para os não-infectados, mas ao chegarem à cidade eles descobrem que foram atraídos para uma armadilha mortal.', 0, NULL, NULL, NULL),
(NULL, 597, 'Resident Evil: Retribuição', 'Resident Evil: Retribution', 'Estados Unidos', 'Ficção Científica', 'Paul W.S. Anderson', '15421473425beb4d0e47334.jpg', 95, 2012, 'abCoRJHSr7s', 'Milla Jovovich, Sienna Guillory, Michelle Rodriguez, Aryana Engineer', 'Fruto de uma das experiências das Umbrella Corporation, Alice (Milla Jovovich) acorda misteriosamente em outra realidade, como se nada tivesse acontecido no planeta Terra. Mas as sequelas do vírus T logo aparecem na forma de zumbis famintos por carne humana e ela descobre, novamente, fazer parte de um novo e viajante experimento. Dentro das intalações da terrível corporação, a guerreira descobre que um antigo inimigo pode estar por trás de um plano para salvar não só ela, mas também seus antigos companheiros de luta, como Ada (Binbing Li), entre outros. Agora reunidos, eles lutarão lado a lado num combate sangrento, que os levará a uma importante e inacreditável revelação. Só existe um problema, Jill Valentine (Sienna Gillory) e Rain Ocampo (Michelle Rodriguez), sob as ordens da poderosa Rainha Vermelha, não estão dispostas a facilitar as coisas para o grupo, que ainda por cima corre contra ', 0, NULL, NULL, NULL),
(NULL, 598, 'Shrek', 'Shrek', 'Estados Unidos', 'Animação', 'Andrew Adamson', '15421527255beb6215cadf0.jpg', 90, 2001, 'jnFPKHUuGdg', 'Mike Myers, Eddie Murphy, Cameron Diaz, John Lithgow', 'Em um pântano distante vive Shrek (Mike Myers), um ogro solitário que vê, sem mais nem menos, sua vida ser invadida por uma série de personagens de contos de fada, como três ratos cegos, um grande e malvado lobo e ainda três porcos que não têm um lugar onde morar. Todos eles foram expulsos de seus lares pelo maligno Lorde Farquaad (John Lithgow). Determinado a recuperar a tranquilidade de antes, Shrek resolve encontrar Farquaad e com ele faz um acordo: todos os personagens poderão retornar aos seus lares se ele e seu amigo Burro (Eddie Murphy) resgatarem uma bela princesa (Cameron Diaz), que é prisioneira de um dragão. Porém, quando Shrek e o Burro enfim conseguem resgatar a princesa logo eles descobrem que seus problemas estão apenas começando.', 0, NULL, NULL, NULL),
(NULL, 599, 'Shrek 2', 'Shrek 2', 'Estados Unidos', 'Animação', 'Andrew Adamson', '15421529485beb62f44cd07.jpg', 93, 2004, '7Cz9GFwKVo0', 'Mike Myers, Eddie Murphy, Cameron Diaz, Julie Andrews', 'Após se casar com a Princesa Fiona (Cameron Diaz), Shrek (Mike Myers) vive feliz em seu pântano. Ao retornar de sua lua-de-mel Fiona recebe uma carta de seus pais, que não sabem que ela agora é um ogro, convidando-a para um jantar juntamente com seu grande amor, na intenção de conhecê-lo. A muito custo Fiona consegue convencer Shrek a ir visitá-los, tendo ainda a companhia do Burro (Eddie Murphy). Porém os problemas começam quando os pais de Fiona descobrem que ela não se casou com o Príncipe (Rupert Everett), a quem havia sido prometida, e enviam o Gato de Botas (Antonio Banderas) para separá-los.', 0, NULL, NULL, NULL),
(NULL, 600, 'Shrek Terceiro', 'Shrek the Third', 'Estados Unidos', 'Animação', 'Chris Miller', '15421531725beb63d4f0cd8.jpg', 93, 2007, 'ev8N_mGPqCI', 'Mike Myers, Eddie Murphy, Cameron Diaz, Antonio Banderas', 'O rei Harold (John Cleese), pai de Fiona (Cameron Diaz), morre repentinamente. Com isto Shrek (Mike Myers) precisa ser coroado rei, algo que ele jamais pensou em ser. Juntamente com o Burro (Eddie Murphy) e o Gato de Botas (Antonio Banderas), ele precisa encontrar alguém que possa substituí-lo no cargo de soberano do Reino de Tão, Tão Distante. O principal candidato é Artie (Justin Timberlake), um jovem desprezado por todos em sua escola, que é primo de Fiona.', 0, NULL, NULL, NULL),
(NULL, 601, 'Especial de Natal do Shrek', 'Shrek the Halls', 'Estados Unidos', 'Animação', 'Gary Trousdale', '15421536315beb659f68df2.jpg', 21, 2007, 'KpytAHTmKXI', 'Mike Myers, Eddie Murphy, Cameron Diaz, Antonio Banderas', 'O Natal está chegando e Fiona (Cameron Diaz) está empolgada para passar seu primeiro Natal com Shrek (Mike Meyers) e seus filhos. O problema é que Shrek não tem ideia de como se comemora essa data. Ele, então, compra um livro para ajudá-lo. Tudo corre bem com os preparativos até que Burro (Eddie Murphy) e os outros personagens aparecem em sua casa para a festa de Natal.', 0, NULL, NULL, NULL),
(NULL, 602, 'Shrek Para Sempre', 'Shrek Forever After', 'Estados Unidos', 'Animação', 'Mike Mitchell', '15421539435beb66d765e79.jpg', 93, 2010, 'PORwFT-tiSE', 'Mike Myers, Eddie Murphy, Cameron Diaz, Antonio Banderas', 'Shrek (Mike Myers) está entediado. Sua antiga vida de aventuras foi substituída pela de pacato pai de família. Casado com Fiona (Cameron Diaz) e pai de três filhos, Shrek sente falta da adrenalina e da liberdade que tinha no passado. Para recuperá-los, ele firma um pacto com Rumpelstiltiskin (Walt Dohrm). Imediatamente Shrek é levado a uma versão alternativa do Reino de Tão, Tão Distante, onde Fiona é uma temível ogro e ele não é mais reconhecido pelo Burro (Eddie Murphy) e o Gato de Botas (Antonio Bandera), seus melhores amigos.', 0, NULL, NULL, NULL),
(NULL, 603, 'Gato de Botas', 'Puss in Boots', 'Estados Unidos', 'Animação', 'Chris Miller', '15421543715beb68835d1dc.jpg', 90, 2011, 'U1Z-WDlnjv8', 'Antonio Banderas, Salma Hayek, Zach Galifianakis, Billy Bob Thornton', 'Muito antes de conhecer o ogro Shrek e sua turma, Gato de Botas (Antonio Banderas) vai viver uma grande aventura ao lado de Humpty Dumpty (Zach Galifianakis) e Kitty Pata Mansa (Salma Hayek). Dipostos a roubar os feijões mágicos do casal fora da lei Jack (Billy Bob Thornton) e Jill (Amy Sedaris), o trio quer mesmo é botar as mãos na famosa gansa que bota ovos de ouro. Mas algumas coisas não estavam nos planos e Gato vai descobrir, meio atrasado, que tem um grande problema pela frente para conseguir limpar o que ficou para trás: a  sua honra.', 0, NULL, NULL, NULL),
(NULL, 604, 'Os Jovens Titans em Ação! Nos Cinemas', 'Teen Titans Go! To the Movies', 'Estados Unidos', 'Animação', 'Aaron Horvath', '15421548125beb6a3c0a7e2.jpg', 84, 2018, 'cCnaL3QIHiY', 'Greg Cipes, Scott Menville, Khary Payton, Tara Strong', 'Robin, Ciborgue, Estelar, Ravena e Mutano são os Jovens Titãs. Ao perceberem que todos os super-heróis estão estrelando filmes, eles decidem se mobilizar para também ter espaço nas telonas. O líder do grupo, Robin, está determinado a ser visto como um astro e com ideias malucas e até uma canção eles partem em busca de um diretor de Hollywood, mas acabam enganados por um supervilão.', 0, NULL, NULL, NULL),
(NULL, 605, 'Universidade Monstros', 'Monsters University', 'Estados Unidos', 'Animação', 'Dan Scanlon', '15421553335beb6c45d10ac.jpg', 104, 2013, 'KlA-qAG3VCc', 'Billy Crystal, John Goodman, Steve Buscemi, Helen Mirren', 'Mike Wazowski (Billy Crystal) e James P. Sullivan (John Goodman) são uma dupla inseparável em Monstros S.A., mas nem sempre foi assim. Quando se conheceram na universidade, os dois jovens monstros se detestavam, com Mike sendo um sujeito estudioso, mas não muito assustador, e Sulley surgindo como o cara popular e arrogante, graças ao talento inerente para o susto. Após um incidente durante um teste, os dois são obrigados a participar da mesma equipe na Olimpíada dos Sustos. A equipe, por sinal, é formada por uma série de monstros desajustados, para o desespero de Sulley, acostumado a conviver com os caras mais populares da escola.', 0, NULL, NULL, NULL),
(NULL, 606, 'Valerian e a Cidade dos Mil Planetas', 'Valerian and the City of a Thousand Planets', 'França', 'Ficção Científica', 'Luc Besson', '15421557065beb6dba38d4f.jpg', 137, 2017, 's01qE3iv_lM', 'Dane DeHaan, Cara Delevingne, Clive Owen, Rihanna', 'Século XXVIII. Valérian (Dane DeHaan) é um agente viajante do tempo e do espaço que luta ao lado da parceira Laureline (Cara Delevingne), por quem é apaixonado, em defesa da Terra e seus planetas aliados, continuamente atacados por bandidos intergaláticos. Quando chegam no planeta Alpha, eles precisarão acabar com uma operação comandada por grandes forças que deseja destruir os sonhos e as vidas dos dezessete milhões de habitantes do planeta.', 0, NULL, NULL, NULL),
(NULL, 607, 'Em Chamas', 'Burning', 'Coreia do Sul', 'Drama', 'Chang-dong Lee', '15421866015bebe669efa69.jpg', 148, 2018, 'wi6Kw7V8gXk', 'Ah-In Yoo, Steven Yeun, Jong-seo Jeon, Soo-Kyung Kim', 'Durante um dia normal de trabalho como entregador, Jong-soo (Yoo Ah-In) reencontra Hae-mi (Jeon Jong-seo), uma antiga amiga que vivia no mesmo bairro que ele. A jovem está com uma viagem marcada para o exterior e pede para Jong-soo cuidar de seu gato de estimação enquanto está longe. Hae-mi volta para casa na companhia de Ben (Steven Yeun), um jovem misterioso que conheceu na África. No entanto, o forasteiro tem um hobby peculiar, que está prestes a ser revelado aos amigos.', 0, NULL, NULL, NULL),
(NULL, 608, 'Operação Cupido', 'The Parent Trap', 'Estados Unidos', 'Comédia', 'Nancy Meyers', '15421867775bebe719edba7.jpg', 128, 1998, 'WxbgYqkn8Qg', 'Lindsay Lohan, Dennis Quaid, Natasha Richardson, Elaine Hendrix', 'As gêmeas Hallie e Annie (Lindsay Lohan) foram separadas ainda pequenas. Uma ficou com a mãe, Elizabeth (Natasha Richardson), e outra com o pai, Nicholas (Dennis Quaid). Um dia as duas se encontram num acampamento de verão e se dão conta do parentesco até então desconhecido. Elas trocam de lugar na volta para a casa e elaboram um plano para que o casal volte às boas e a família enfim possa se reunir.', 0, NULL, NULL, 1),
(NULL, 609, 'Você Nunca Esteve Realmente Aqui', 'You Were Never Really Here', 'Estados Unidos', 'Drama', 'Lynne Ramsay', '15421869355bebe7b70961c.jpg', 89, 2017, 'YYMPfgapICU', 'Joaquin Phoenix, Dante Pereira-Olson, Larry Canady, Vinicius Damasceno', 'Um homem, veterano de guerra, ganha a vida resgatando mulheres presas em cativeiros trabalhando como escravas sexuais. Após uma missão mal sucedida em um bordel de Manhattan, no entanto, a opinião pública se torna contra ele e uma onda de violência se abate na região.', 0, NULL, NULL, NULL),
(NULL, 610, 'Sem Rastros', 'Leave No Trace', 'Estados Unidos', 'Drama', 'Debra Granik', '15421870485bebe828d38c9.jpg', 109, 2018, 'V8yQstxSiKo', 'Thomasin McKenzie, Ben Foster, Jeffery Rifflard, Derek John Drescher', 'Will (Ben Foster) e sua filha adolescente, Tom (Thomasin McKenzie), viveram felizes e indetectados pelas autoridades durante anos em uma vasta reserva na fronteira de Portland, nos EUA. Após um encontro inesperado, eles são retirados do acampamento e colocados sob a responsabilidade do serviço social. Will e Tom tentam retornar ao mundo selvagem enquanto são forçados a lidar com desejos conflitantes.', 0, NULL, NULL, NULL),
(NULL, 611, 'Ponto Cego', 'Blindspotting', 'Estados Unidos', 'Comédia dramática', 'Carlos López Estrada', '15421872645bebe900131fb.jpg', 95, 2018, '', 'Daveed Diggs, Rafael Casal, Janina Gavankar, Jasmine Cephas Jones', 'Em Oakland, Califórnia, o ex-presidiário Collin (Daveed Diggs) enfrenta os últimos dias de liberdade de condicional antes de acertar as suas contas com a justiça. Quando presencia uma troca de tiros envolvendo policiais, ele hesita sobre a melhor coisa a fazer e conta com a ajuda de seu amigo de infância, Miles (Rafael Casal). Contudo, o caso expõe as diferenças de pensamentos entre ambos e revela os traumas sociais de cada um.', 0, NULL, NULL, NULL),
(NULL, 612, 'First Reformed', 'First Reformed', 'Estados Unidos', 'Drama', 'Paul Schrader', '15421874915bebe9e364165.jpg', 113, 2018, 'wZ6xeRGCcLs', NULL, 'O ex-militar capelão Toller (Ethan Hawke) sofre pela perda do filho que ele encorajou a se alistar nas forças armadas. Um outro desafio começa quando ele faz amizade com a jovem paroquiana Mary (Amanda Seyfried) e seu marido, que é um ambientalista radical. Toller logo descobre segredos escondidos de sua igreja com relação a empresas inescrupulosas.', 0, NULL, NULL, NULL),
(NULL, 613, 'Puro Sangue', 'Thoroughbreds', 'Estados Unidos', 'Comedy, Crime, Drama', 'Cory Finley', '15421878235bebeb2f3c0df.jpg', 92, 2017, 'lI9DV4a4NNk', 'Olivia Cooke, Anya Taylor-Joy, Anton Yelchin, Paul Sparks', 'Duas meninas adolescentes no subúrbio de Connecticut se reconectam numa amizade improvável após anos distantes. No processo, elas aprendem que nenhuma das duas é o que aparenta ser - e que um assassinato pode resolver ambos os seus problemas.', 0, NULL, NULL, NULL),
(NULL, 614, 'American Animals', 'American Animals', 'Estados Unidos', 'Drama', 'Bart Layton', '15421879535bebebb19df56.jpg', 116, 2018, '6L8S85PRrbE', 'Spencer Reinhard, Warren Lipka, Eric Borsuk, Chas Allen', 'A história inacreditável história de quatro jovens americanos, com temperamentos extremamente diferentes, que se juntam para roubar o livro mais valioso dos Estados Unidos. Durante o processo, eles começam a questionar o verdadeiro propósito do ato para as suas vidas e o que ele representa para a sociedade em  que vivem.  \r\n', 0, NULL, NULL, NULL),
(NULL, 615, 'A Rota Selvagem', 'Lean on Pete', 'Reino Unido', 'Drama', 'Andrew Haigh', '15421880705bebec2648ad2.jpg', 121, 2017, 'nzlazAyylw8', 'Charlie Plummer, Amy Seimetz, Travis Fimmel, Steve Buscemi', 'Charley (Charlie Plummer) é um menino de 15 anos que vive com o pai solteiro em Portland, Oregon. Na procura pela tia desaparecida há muitos anos, Charley consegue um emprego de verão como treinador de cavalos e acaba fazendo amizade com um cavalo de corrida chamado Lean on Pete.', 0, NULL, NULL, NULL),
(NULL, 616, 'Upgrade', 'Upgrade', 'Austrália', 'Ficção Científica', 'Leigh Whannell', '15421882245bebecc0e46a9.jpg', 100, 2018, 'uQf64EgOI30', 'Logan Marshall-Green, Melanie Vallejo, Steve Danielsen, Abby Craden', 'No futuro próximo, a tecnologia controla quase todos os aspectos da vida. Mas quando Gray, um tecnofóbico, tem seu mundo virado de cabeça para baixo, sua única esperança de vingança é um implante experimental de chips de computador chamado Stem.', 0, NULL, NULL, NULL),
(NULL, 617, 'Domando o Destino', 'The Rider', 'Estados Unidos', 'Drama', 'Chloé Zhao', '15421883465bebed3a864b6.jpg', 104, 2017, 'TWROzQ6veSc', 'Brady Jandreau, Mooney, Tim Jandreau, Lilly Jandreau', 'A frustração e a angústia passam  fazer parte da rotina de Brady quando ele se vê impedido de montar em cavalos após sofrer um grave acidente no rodeio. Pouco a pouco, o cowbow aprende a domar sua impaciência e tirar maior proveito dessa experiência de profunda introspecção, refletindo sobre sua identidade e a cultura local. ', 0, NULL, NULL, NULL),
(NULL, 618, 'Support The Girls', 'Support the Girls', 'Estados Unidos', 'Comédia', 'Andrew Bujalski', '15421884635bebedaf037a3.jpg', 90, 2018, 'OI1CWYxbbkI', 'Regina Hall, Haley Lu Richardson, Dylan Gelula, Zoe Graham', 'Lisa Conroy (Reginal Hall) é a gerente do restaurante Double Whammies, ela adora o lugar, seus clientes e protege ferozmente suas funcionárias. Ao tentar arrecadar dinheiro para ajudar uma de suas garotas, o dono do restaurante descobre e decide que vai fazer o que for preciso para impedir Lisa.', 0, NULL, NULL, NULL),
(NULL, 622, 'Carros', 'Cars', 'Estados Unidos', 'Animação', 'John Lasseter, Joe Ranft(co-director)', '15421901405bebf43c8f16e.jpg', 117, 2006, 'E1nE-ZJ5IY4', 'Owen Wilson, Paul Newman, Bonnie Hunt, Larry the Cable Guy', 'Ao viajar para a Califórnia para competir contra The King e Chick Hicks para o Campeonato da Copa Pistão, Lightning McQueen se perde depois de cair do seu caminhão na cidade chamada Radiator Springs. Aos poucos, ele faz amizade com os moradores da cidade, incluindo Sally, Doc Hudson e Mate. Quando chega a hora de McQueen ir embora, o campeonato não é mais a sua prioridade.', 0, NULL, NULL, NULL),
(NULL, 623, 'Carros 2', 'Cars 2', 'Estados Unidos', 'Animação', 'John Lasseter, Brad Lewis(co-director)', '15421903585bebf516ce04e.jpg', 106, 2011, 'GC-gtaH2_JY', 'Larry the Cable Guy, Owen Wilson, Michael Caine, Emily Mortimer', 'O astro das corridas, Relâmpago McQueen, e o carro-guincho, Mate, viajam para disputar o primeiro Grand Prix Mundial, que irá revelar o carro mais veloz do planeta. Nessa jornada imperdível, Mate se envolve com um grupo de espionagem e vive grandes aventuras com seus amigos.', 0, NULL, NULL, NULL),
(NULL, 624, 'Carros 3', 'Cars 3', 'Estados Unidos', 'Animação', 'Brian Fee', '15421905105bebf5aec9b5e.jpg', 102, 2017, 'BuvJZGLclAU', 'Owen Wilson, Cristela Alonzo, Chris Cooper, Nathan Fillion', 'Veterano das pistas, o campeoníssimo Relâmpago McQueen se vê em apuros após o surgimento de um novato bastante veloz, Jackson Storm, que utiliza de alta tecnologia nos treinamentos. Obrigado a chegar ao limite para batê-lo, McQueen acaba sofrendo um sério acidente durante uma corrida, que o obriga a abandonar o campeonato daquele ano. Prestes a iniciar a próxima temporada, ele se vê em dúvidas sobre se consegue ser rápido o suficiente para bater Storm e, por causa disto, busca ajuda com seu novo patrocinador.', 0, NULL, NULL, NULL),
(NULL, 625, 'Vida de Inseto', 'A Bug\'s Life', 'Estados Unidos', 'Animação', 'John Lasseter, Andrew Stanton(co-director)', '15421907475bebf69b57509.jpg', 95, 1998, 'L6CbIRt0wmY', 'Dave Foley, Kevin Spacey, Julia Louis-Dreyfus, Hayden Panettiere', 'Todo ano, os gananciosos gafanhotos exigem uma parte da colheita das formigas. Mas quando algo dá errado e a colheita destruída, os gafanhotos ameaçam atacar e as formigas são forçadas a pedir ajuda a outros insetos para enfrentá-los numa batalha.', 0, NULL, NULL, NULL),
(NULL, 626, 'Procurando Nemo', 'Finding Nemo', 'Estados Unidos', 'Animação', 'Andrew Stanton, Lee Unkrich(co-director)', '15421908915bebf72b5f06c.jpg', 100, 2003, '4-LNlsaekIE', 'Albert Brooks, Ellen DeGeneres, Alexander Gould, Willem Dafoe', 'Em seu primeiro dia de aula, esquecendo os conselhos do pai superprotetor, Nemo é capturado por um mergulhador e acaba no aquário de um dentista. Enquanto Nemo tenta bolar um plano para escapar, seu pai cruza o oceano para resgatá-lo.', 0, NULL, NULL, NULL),
(NULL, 627, 'Valente', 'Brave', 'Estados Unidos', 'Animação', 'Mark Andrews, Brenda Chapman, Steve Purcell(co-dir', '15421910665bebf7dac76b1.jpg', 93, 2012, 'vHOC1Kd_zhw', 'Kelly Macdonald, Billy Connolly, Emma Thompson, Julie Walters', '--\r\nNOTAR :\r\nVOU VER\r\nESCREVER MINHA CRÍTICA\r\nSINOPSE E DETALHES\r\nA partir de 3 anos\r\nA jovem princesa Merida foi criada pela mãe para ser a sucessora perfeita ao cargo de rainha, seguindo a etiqueta e os costumes do reino. Mas a garota dos cabelos rebeldes não tem a menor vocação para esta vida traçada, preferindo cavalgar pelas planícies selvagens da Escócia e praticar o seu esporte favorito, o tiro ao arco. Quando uma competição é organizada contra a sua vontade, para escolher seu futuro marido, Merida decide recorrer à ajuda de uma bruxa, a quem pede que sua mãe mude. Mas quando o feitiço surte efeito, a transformação da rainha não é exatamente o que Merida imaginava... Agora caberá à jovem ajudar a sua mãe e impedir que o reino entre em guerra com os povos vizinhos.', 0, NULL, NULL, NULL),
(NULL, 628, 'A Pequena Sereia', 'The Little Mermaid', 'Estados Unidos', 'Animação', 'Ron Clements, John Musker', '15421915395bebf9b3365c7.png', 83, 1989, 'ODCZF3_l7eY', 'Rene Auberjonois, Christopher Daniel Barnes, Jodi Benson, Pat Carroll', 'Ariel é a filha caçula do Rei Tritão, comandante dos sete mares, que está insatisfeita com sua vida. Ela deseja caminhar entre os humanos para conhecê-los melhor, mas sempre é proibida por seu pai, que considera os humanos como sendo \"bárbaros comedores de peixe\". Até que ela se apaixona por um jovem príncipe e, no intuito de conhecê-lo, resolve firmar um pacto com Úrsula, a bruxa do reino, que faz com que ela ganhe pernas e se torne uma verdadeira humana. Porém, Úrsula também tem seus planos e eles incluem a conquista do reino de Tritão.', 0, NULL, NULL, NULL),
(NULL, 629, 'Mulan', 'Mulan', 'Estados Unidos', 'Animação', 'Tony Bancroft, Barry Cook', '15421922445bebfc7414722.jpg', 88, 1998, 'MYjoy1XRAzY', 'Miguel Ferrer, Harvey Fierstein, Freda Foh Shen, June Foray', 'Temendo que seu pai adoentado seja convocado para servir o exército chinês, Mulan (Ming-Na Wen) se disfarça de homem e treina com os colegas. Acompanhada de seu dragão Mushu (Eddie Murphy), ela usa sua inteligência para ajudar a combater a invasão Hun e se apaixona por um charmoso capitão.', 0, NULL, NULL, NULL),
(NULL, 630, 'Lilo e Stitch', 'Lilo & Stitch', 'Estados Unidos', 'Animação', 'Dean DeBlois, Chris Sanders', '15421924555bebfd473fd12.jpg', 85, 2002, 'wAtaSKQ4-T0', 'Daveigh Chase, Chris Sanders, Tia Carrere, David Ogden Stiers', 'Lilo é uma garota que adora cuidar de animais menos favorecidos. Lilo tem o costume de coletar lixo reciclável nas praias para, com o dinheiro recebido, comprar comida para peixes. Até que, em um belo dia, ela encontra um cachorro e decide adotá-lo. Entretanto, este cachorro na verdade é Stitch, um ser alienígena que é um dos criminosos mais perigosos da galáxia. Agora, Stitch esconde quatro de suas seis pernas e decide se fazer passar por um cachorro comum, ficando amigo de Lilo.', 0, NULL, NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 631, 'Lilo e Stitch 2: Stitch Deu Defeito', 'Lilo & Stitch 2: Stitch Has a Glitch', 'Estados Unidos', 'Animação', 'Dean DeBlois, Chris Sanders', '15421926705bebfe1e404ca.jpg', 85, 2005, 'C-CXo_HpfP0', 'Chris Sanders, Dakota Fanning, Tia Carrere, David Ogden Stiers', 'Stitch está começando a se acostumar com a rotina do Havaí, morando com Lilo e aproveitando a vida boa. Ele está tentando ajudar a garota a seguir os passos da mãe e se preparar para o grande concurso de Hula da ilha. Quando menos esperava, Stitch começa a apresentar um defeito, ativando o seu programa destrutivo. Lilo e seus amigos vão lutar para salvar o amiguinho e garantir a paz da ilha.', 0, NULL, NULL, NULL),
(NULL, 632, 'Aristogatas', 'The Aristocats', 'Estados Unidos', 'Animação', 'Wolfgang Reitherman', '15421927885bebfe944d6ab.jpg', 78, 1970, 'tK1z-_UtKzI', 'Phil Harris, Eva Gabor, Sterling Holloway, Scatman Crothers', 'Para garantir o futuro da gata Duquesa e de seus três gatinhos, Marie, Berlioz e Toulouse, a rica madame Bonnefamille decide deixar para os animais todas as suas riquezas, para desespero do malvado mordomo Edgar.', 0, NULL, NULL, NULL),
(NULL, 633, 'Hercules', 'Hercules', 'Estados Unidos', 'Animação', 'Ron Clements, John Musker', '15421929355bebff27213a8.jpg', 93, 1997, 'ZvtspevZxpg', 'Tate Donovan, Josh Keaton, Roger Bart, Danny DeVito', 'Hercules, filho dos deuses, foi capturado quando bebê por Hades e forçado a viver entre os mortais como metade homem e metade deus. Agora um adolescente, Hércules precisa realizar um rito de passagem na Terra para provar-se digno de viver com os deuses do Monte Olimpo. Com seu ajudante sátiro e corajoso Filoctetes, Hércules deve aprender a usar sua força para derrotar uma série de criaturas malignas.', 0, NULL, NULL, NULL),
(NULL, 634, 'A Princesa e o Sapo', 'The Princess and the Frog', 'Estados Unidos', 'Animação', 'Ron Clements, John Musker', '15421931225bebffe25cb18.jpg', 97, 2009, 'gqgPzVsJhB8', 'Anika Noni Rose, Bruno Campos, Keith David, Michael-Leon Wooley', 'A trabalhadora e ambiciosa, Tiana sonha em um dia abrir o seu próprio restaurante em Nova Orleans. Seus planos tomam um rumo diferente quando ela conhece o príncipe Naveen, o qual tinha se tornado um sapo pelo maldoso Dr. Facilier. Porém, o príncipe, que agora é um sapo, tem esperanças de ser um humano novamente se Tiana beijá-lo.', 0, NULL, NULL, NULL),
(NULL, 635, 'O Corcunda de Notre Dame', 'The Hunchback of Notre Dame', 'Estados Unidos', 'Animação', 'Gary Trousdale, Kirk Wise', '15421932155bec003fb0db7.jpg', 91, 1996, 'nOIUPwBRIk8', 'Jason Alexander, Mary Kay Bergman, Corey Burton, Jim Cummings', 'Em Paris, durante a Idade Média, vive Quasímodo, um corcunda que mora enclausurado desde a infância nos porões da catedral de Notre Dame. Um dia Quasímodo decide sair da escuridão em que vive e conhece Esmeralda, uma bela cigana por quem se apaixona. Para conseguir concretizar seu amor ele terá antes que enfrentar o poderoso Claude Frollo e seu fiel ajudante Febo.', 0, NULL, NULL, NULL),
(NULL, 637, 'A Branca de Neve e Os Sete Anões', 'Snow White and the Seven Dwarfs', 'Estados Unidos', 'Animação', 'William Cottrell, David Hand, Wilfred Jackson, Lar', '15421943005bec047cce350.jpg', 83, 1937, 'XESn0SPHcRI', 'Roy Atwell, Stuart Buchanan, Adriana Caselotti, Eddie Collins', 'A rainha malvada morre de ciúmes da beleza de Branca de Neve e manda mata-la. Logo, descobre que a jovem não morreu e está morando na floresta com sete amiguinhos. A princesa então é envenenada pela rainha e só o beijo de um príncipe pode salvá-la.', 0, NULL, NULL, NULL),
(NULL, 638, '101 Dálmatas', 'One Hundred and One Dalmatians', 'Estados Unidos', 'Animação', 'Clyde Geronimi', '15422012675bec1fb34d6e4.jpg', 79, 1961, 'HgC2cISSBy0', NULL, 'Anita (Lisa Davis/ Simone de Morais) e Roger (Ben Wright/ Helio Colonna) possuem um casal de dálmatas chamado Pongo (Rod Taylor/ Domingos Martins) e Prenda (Cate Bauer/ Maria Alice Barreto). Quando a fêmea acaba de dar a luz a 15 filhotes, Cruela Cruel (Betty Lou Gerson/ Olga Nobre), uma antiga amiga de Anita, rica e viciada em roupas de pele de animais, se propõe a comprá-los. Roger nega vender os filhotes, pois desconfia que ela queira transformar os cachorrinhos em casacos de pele. Indignada, Cruela vai contar com seus capangas para roubar os tão almejados filhotes.', 0, NULL, NULL, NULL),
(NULL, 639, 'Pocahontas - O Encontro de Dois Mundos', 'Pocahontas', 'Estados Unidos', 'Animação', 'Mike Gabriel', '15422015775bec20e93d2b9.jpg', 81, 1995, 'vXeniQvTKlI', 'Joe Baker, Christian Bale, Irene Bedard, Billy Connolly', 'Um navio parte da Inglaterra com o objetivo de encontrar o \"novo mundo\", tendo a bordo o governador Ratcliff, que está ansioso em encontrar ouro, e o capitão John Smith. Ao chegarem, John decide explorar o mundo desconhecido. Logo encontra Pocahontas, uma bela índia por quem se apaixona. Só que o povo índio e os ingleses logo entram em guerra, já que estão em disputa pelas terras da América.', 0, NULL, NULL, NULL),
(NULL, 640, 'Cinderela', 'Cinderella', 'Estados Unidos', 'Animação', 'Clyde Geronimi', '15422019725bec22741d54e.jpg', 74, 1950, 'HvbJrZqtstw', 'Ilene Woods, Eleanor Audley, Verna Felton, Claire Du Brey', 'Cinderela vive com sua madrasta, Lady Tremaine e as duas filhas dela. Obrigada a trabalhar como empregada da casa, ela tem como amigos apenas os animais que a rodeiam. O local em que vive está agitado devido ao baile que será realizado no castelo, o qual contará com a presença do príncipe. Como Lady Tremaine pretende que uma das filhas se case com ele, elas se preparam com requinte para o evento. Cinderela, entretanto, não pode ir. Até que surge a Fada-madrinha, que dá a Cinderela um vestido e condições para que possa ir ao baile em alto estilo. Entretanto há uma condição: Cinderela precisa retornar antes da meia-noite, caso contrário o feitiço será desfeito.', 0, NULL, NULL, NULL),
(NULL, 641, 'A Dama e o Vagabundo', 'Lady and the Tramp', 'Estados Unidos', 'Animação', 'Clyde Geronimi', '15422022775bec23a5c472f.jpg', 76, 1955, 'Ehi3Nxg50aE', 'Peggy Lee, Larry Roberts, Bill Baucom, Verna Felton', 'Dama é uma cadelinha da raça cocker spaniel, que vive na mordomia e no acolhimento da casa de seus donos, a aristocrata \"Querida\" e seu esposo Jim. Ela sempre recebeu carinho e tudo que queria, só que com Querida grávida, ela começa a se sentir em segundo plano. É justamente nessa fase que ela conhece Vagabundo. Ele é um cachorro de rua, vira-lata e que tem se virar para sobreviver. Até que um dia a dona de Dama viaja e deixa o bebê recém-nascido sob os cuidados de Tia Sarah, uma mulher que tem dois malvados gatos siameses. Eles armam uma tremenda confusão e culpam a cadelinha, que para se proteger tem de fugir. Dama então se perde na cidade, e vai depender da ajuda de Vagabundo para sobreviver e também para voltar aos seus donos humanos.', 0, NULL, NULL, NULL),
(NULL, 642, 'A Vingança Está na Moda', 'The Dressmaker', 'Austrália', 'Comédia dramática', 'Jocelyn Moorhouse', '15422025385bec24aac58cf.jpg', 119, 2015, 'whrQgrMXghI', 'Kate Winslet, Judy Davis, Liam Hemsworth, Hugo Weaving', 'Uma atraente mulher (Kate Winslet) retorna à sua cidade natal na Austrália rural. Com sua máquina de costura e estilo \"haute couture\", ela transforma as mulheres e demanda a doce vingança de quem não acreditou em seus feitos.', 0, NULL, NULL, NULL),
(NULL, 643, 'Mental', 'Mental', 'Estados Unidos', 'Comédia dramática', 'P.J. Hogan', '15422028355bec25d36d5a1.jpg', 116, 2012, 'Tv8oX82DByU', 'Rebecca Gibney, Hayley Magnus, Nicole Freeman, Chelsea Bennett', 'Uma carismática e mal-humorada adolescente transforma a vida de uma família quando se torna babá de cinco garotas cuja mãe rompeu com o seu marido por suas ambições políticas e infidelidade.', 0, NULL, NULL, NULL),
(NULL, 644, 'American Mall', 'The American Mall', 'Estados Unidos', 'Musical', 'Shawn Ku', '15422030545bec26aebce22.jpg', 100, 2008, 'ys1FtuZaPu8', 'Nina Dobrev, Rob Mayes, Autumn Reeser, Yassmin Alers', 'Ally (Nina Dobrev) passa boa parte de seu tempo no shopping onde a mãe administra uma loja de instrumentos musicais. A jovem tem uma composição incompleta e conta com a ajuda do faxineiro Joey (Rob Mayes) para terminá-la, mas os dois são perseguidos pela mimada Madison (Autumn Reeser), filha do proprietário do empreendimento comercial.', 0, NULL, NULL, NULL),
(NULL, 645, 'Peter Pan', 'Peter Pan', 'Estados Unidos', 'Aventura', '	P.J. Hogan', '15422032115bec274b63b34.jpg', 103, 2003, 'MKnI2KPMEjs', 'Jason Isaacs, Jeremy Sumpter, Rachel Hurd-Wood, Lynn Redgrave', 'Peter Pan (Jeremy Sumpter) é um garoto que nunca cresce e que vive na Terra do Nunca juntamente com os Garotos Perdidos e a fada Sininho. Num belo dia Peter Pan visita a casa dos Darling e convence Wendy (Rachel Hurt-Wood), John (Harry Newell) e Michael (Freddie Popplewell) a viajaram com ele para o lugar onde vive. Lá todos enfrentarão a ameaça do temível Capitão Gancho (Jason Isaacs).', 0, NULL, NULL, NULL),
(NULL, 646, 'Esquadrão Suicida', 'Suicide Squad', 'Estados Unidos', 'Herói', 'David Ayer', '15422103615bec4339a485e.jpg', 123, 2016, '8pYp4T8TdP4', 'Will Smith, Jaime FitzSimons, Ike Barinholtz, Margot Robbie, Jared Leto, Viola Davis, Jai Cortney, Jay Hernandez, Cara Delevingne, Karen Fukuhara', 'Após a aparição do Superman, a agente Amanda Waller (Viola Davis) está convencida que o governo americano precisa ter sua própria equipe de metahumanos, para combater possíveis ameaças. Para tanto ela cria o projeto do Esquadrão Suicida, onde perigosos vilões encarcerados são obrigados a executar missões a mando do governo. Caso sejam bem-sucedidos, eles têm suas penas abreviadas em 10 anos. Caso contrário, simplesmente morrem. O grupo é autorizado pelo governo após o súbito ataque de Magia (Cara Delevingne), uma das \"convocadas\" por Amanda, que se volta contra ela. Desta forma, Pistoleiro (Will Smith), Arlequina (Margot Robbie), Capitão Bumerangue (Jai Courtney), Crocodilo (Adewale Akinnuoye-Agbaje), El Diablo (Jay Hernandez) e Amarra (Adam Beach) são convocados para a missão. Paralelamente, o Coringa (Jared Leto) aproveita a oportunidade para tentar resgatar o amor de sua vida: Arlequina.', 0, NULL, NULL, NULL),
(NULL, 647, 'Batman', 'Batman', 'Estados Unidos', 'Herói', 'Tim Burton', '15422105725bec440cb4f74.jpg', 126, 1989, 'dgC9Q0uhX70', 'Michael Keaton, Jack Nicholson, Kim Basinger, Robert Wuhl', 'Em Gotham City o milionário Bruce Wayne (Michael Keaton), que quando jovem teve os pais assassinados por bandidos, resolve combater o crime como Batman, o Homem-Morcego. Mas chega o dia em que o vilão Coringa (Jack Nicholson) decide dominar a cidade e se torna um grande desafio para o super-herói.', 0, NULL, NULL, NULL),
(NULL, 648, 'Liga da Justiça', 'Justice League', 'Estados Unidos', 'Herói', 'Zack Snyder', '15422108665bec45323f884.png', 120, 2017, 'H0Z7ewOXCKw', 'Ben Affleck, Henry Cavill, Amy Adams, Gal Gadot', 'Impulsionado pela restauração de sua fé na humanidade e inspirado pelo ato altruísta do Superman (Henry Cavill), Bruce Wayne (Ben Affleck) convoca sua nova aliada Diana Prince (Gal Gadot) para o combate contra um inimigo ainda maior, recém-despertado. Juntos, Batman e Mulher-Maravilha buscam e recrutam com agilidade um time de meta-humanos, mas mesmo com a formação da liga de heróis sem precedentes - Batman, Mulher-Maraviha, Aquaman (Jason Momoa), Cyborg (Ray Fisher) e Flash (Ezra Miller) -, poderá ser tarde demais para salvar o planeta de um catastrófico ataque.', 0, NULL, NULL, NULL),
(NULL, 649, 'Batman - O Cavaleiro das Trevas', 'The Dark Knight', 'Estados Unidos', 'Herói, Neo Noir', 'Christopher Nolan', '15422110645bec45f82f172.jpg', 152, 2008, '4gHh4TGxCK0', 'Christian Bale, Heath Ledger, Aaron Eckhart, Michael Caine', 'Após dois anos desde o surgimento do Batman (Christian Bale), os criminosos de Gotham City têm muito o que temer. Com a ajuda do tenente James Gordon (Gary Oldman) e do promotor público Harvey Dent (Aaron Eckhart), Batman luta contra o crime organizado. Acuados com o combate, os chefes do crime aceitam a proposta feita pelo Coringa (Heath Ledger) e o contratam para combater o Homem-Morcego.', 0, NULL, NULL, NULL),
(NULL, 650, 'Batman - O Cavaleiro das Trevas Ressurge', 'The Dark Knight Rises', 'Estados Unidos', 'Herói, Neo Noir', 'Christopher Nolan', '15422112535bec46b529a5b.jpg', 164, 2012, 'pUvnB4x8Qgs', 'Christian Bale, Gary Oldman, Tom Hardy, Joseph Gordon-Levitt', 'Oito anos após a morte de Harvey Dent, a cidade de Gotham City está pacificada e não precisa mais do Batman. A situação faz com que Bruce Wayne (Christian Bale) se torne um homem recluso em sua mansão, convivendo apenas com o mordomo Alfred (Michael Caine). Um dia, em meio a uma festa realizada na Mansão Wayne, uma das garçonetes contratadas rouba um colar de grande valor sentimental. Trata-se de Selina Kyle (Anne Hathaway), uma esperta e habilidosa ladra que, apesar de flagrada por Bruce, consegue fugir. Curioso em descobrir quem é ela, Bruce retorna à caverna para usar os computadores que tanto lhe serviram quando vestia o manto do Homem-Morcego. Aos poucos começa a perceber indícios do surgimento de uma nova ameaça a Gotham City, personificada no brutamontes Bane (Tom Hardy). É o suficiente para que volte a ser o Batman, apesar dos problemas físicos decorrentes de suas atividades como super-herói ao longo dos anos.', 0, NULL, NULL, NULL),
(NULL, 651, 'O Homem de Aço', 'Man of Steel', 'Estados Unidos', 'Herói', 'Zack Snyder', '15422119525bec49706b39c.png', 143, 2013, 'Bgi8Ud7IJJ4', 'Henry Cavill, Amy Adams, Michael Shannon, Diane Lane', '', 0, NULL, NULL, NULL),
(NULL, 652, 'Superman - O Retorno', 'Superman Returns', 'Estados Unidos', 'Herói', 'Bryan Singer', '15422121695bec4a495d158.png', 154, 2006, 'zVCozSQj8TQ', 'Brandon Routh, Kate Bosworth, Kevin Spacey, James Marsden', 'Após alguns anos de um misterioso desaparecimento, Superman (Brandon Routh) retorna ao planeta Terra. Porém a situação em Metrópolis está bastante mudada desde que o Homem de Aço deixou o planeta, pois a cidade se acostumou a viver sem ele. Além disto Lois Lane (Kate Bosworth), sua grande paixão, seguiu sua vida após o sumiço do herói. Ao mesmo tempo em que precisa se adaptar à nova realidade, Superman precisa enfrentar um antigo inimigo, que planeja um meio de acabar com ele de uma vez por todas.', 0, NULL, NULL, NULL),
(NULL, 653, 'Batman Begins', 'Batman Begins', 'Estados Unidos', 'Herói, Neo Noir', 'Christopher Nolan', '15422124305bec4b4e304d9.png', 140, 2005, 'neY2xVmOfUM', 'Christian Bale, Michael Caine, Liam Neeson, Katie Holmes', 'Marcado pelo assassinato de seus pais quando ainda era criança, o milionário Bruce Wayne (Christian Bale) decide viajar pelo mundo em busca de encontrar meios que lhe permitam combater a injustiça e provocar medo em seus adversários. Após retornar a Gotham City, sua cidade-natal, ele idealiza seu alter-ego: Batman, um justiceiro mascarado que usa força, inteligência e um arsenal tecnológico para combater o crime.', 0, NULL, NULL, NULL),
(NULL, 654, 'Lanterna Verde', 'Green Lantern', 'Estados Unidos', 'Herói', 'Martin Campbell', '15422125815bec4be598040.png', 114, 2011, 'ldhFSlrXHI4', 'Ryan Reynolds, Blake Lively, Peter Sarsgaard, Mark Strong', '', 0, NULL, NULL, NULL),
(NULL, 655, 'A Vigilante do Amanhã', 'Ghost in the Shell', 'Estados Unidos', 'Ficção Científica', 'Rupert Sanders', '15422129245bec4d3c1984b.png', 107, 2017, '8d2EmV46mmo', 'Scarlett Johansson, Pilou Asbæk, Takeshi Kitano, Juliette Binoche', 'Em um mundo pós-2029, é bastante comum o aperfeiçoamento do corpo humano a partir de inserções tecnológicas. O ápice desta evolução é a Major Mira Killian (Scarlett Johansson), que teve seu cérebro transplantado para um corpo inteiramente construído pela Hanka Corporation. Considerada o futuro da empresa, Major logo é inserida no Section 9, um departamento da polícia local. Lá ela passa a combater o crime, sob o comando de Aramaki (Takeshi Kitano) e tendo Batou (Pilou Asbaek) como parceiro. Só que, em meio à investigação sobre o assassinato de executivos da Hanka, ela começa a perceber certas falhas em sua programação que a fazem ter vislumbres do passado quando era inteiramente humana.', 0, NULL, NULL, NULL),
(NULL, 656, 'Cinquenta Tons de Cinza', 'Fifty Shades of Grey', 'Estados Unidos', 'Erótico', 'Sam Taylor-Johnson', '15422131695bec4e312a359.png', 125, 2015, 'DEwIt4amgq4', 'Dakota Johnson, Jamie Dornan, Jennifer Ehle, Eloise Mumford', 'Anastasia Steele (Dakota Johnson) é uma estudante de literatura de 21 anos, romântica e virgem. Uma dia ela deve entrevistar para o jornal da faculdade o poderoso magnata Christian Grey (Jamie Dornan). Nasce uma complexa relação entre ambos: com a descoberta amorosa e sexual, Anastasia conhece os prazeres do sadomasoquismo, tornando-se o objeto de submissão do sádico Grey.', 0, NULL, NULL, NULL),
(NULL, 657, 'Cinquenta Tons Mais Escuros', 'Fifty Shades Darker', 'Estados Unidos', 'Erótico', 'James Foley', '15422134345bec4f3a94d01.png', 118, 2017, 'vJ41tFyuaFs', 'Dakota Johnson, Jamie Dornan, Eric Johnson, Eloise Mumford', 'Incomodada com os hábitos e atitudes de Christian Grey (Jamie Dornan), Anastasia (Dakota Johnson) decide terminar o relacionamento e focar no desenvolvimento de sua carreira. Ele, no entanto, não desiste tão fácil e fica sempre ao seu encalço, insistindo que aceita as regras dela. Tal cortejo acaba funcionando e ela reinicia o relacionamento com o jovem milionário, sendo que, aos poucos, passa a compreender melhor os jogos sexuais que ele tanto aprecia.', 0, NULL, NULL, NULL),
(NULL, 658, 'Cinquenta Tons de Liberdade', 'Fifty Shades Freed', 'Estados Unidos', 'Erótico', 'James Foley', '15422136955bec503fb6b25.png', 105, 2018, 'yVYqTnXuRPw', 'Dakota Johnson, Jamie Dornan, Eric Johnson, Eloise Mumford', 'Superados os principais problemas, Anastasia (Dakota Johnson) e Christian (Jamie Dornan) agora têm amor, intimidade, dinheiro, sexo, relacionamento estável e um promissor futuro. A vida, no entanto, ainda reserva surpresas para os dois e fantasmas do passado como Jack Hyde (Eric Johnson) e Elena Lincoln (Kim Basinger) voltam a impedir a paz do casal.', 0, NULL, NULL, NULL),
(NULL, 659, 'O Rei do Show', 'The Greatest Showman', 'Estados Unidos', 'Musical', 'Michael Gracey', '15422141545bec520aad365.png', 105, 2017, 'r5R6CVp_JzU', 'Hugh Jackman, Michelle Williams, Zac Efron, Zendaya', 'De origem humilde e desde a infância sonhando com um mundo mágico, P.T. Barnum (Hugh Jackman) desafia as barreiras sociais se casando com a filha do patrão do pai e dá o pontapé inicial na realização de seu maior desejo abrindo uma espécie de museu de curiosidades. O empreendimento fracassa, mas ele logo vislumbra uma ousada saída: produzir um grande show estrelado por freaks, fraudes, bizarrices e rejeitados de todos os tipos.', 0, NULL, NULL, NULL),
(NULL, 660, 'Planeta dos Macacos: A Origem', 'Rise of the Planet of the Apes', 'Estados Unidos', 'Ação', 'Rupert Wyatt', '15422144175bec531121278.png', 105, 2011, 'h4rmlcA0VNM', 'Andy Serkis, Karin Konoval, Terry Notary, Richard Ridings', 'San Francisco. Will Rodman (James Franco) é um cientista que trabalha em um laboratório onde são realizadas experiências com macacos. Ele está interessado em descobrir novos medicamentos para a cura do mal de Alzheimer, já que seu pai, Charles (John Lithgow), sofre da doença. Após um dos macacos escapar e provocar vários estragos, sua pesquisa é cancelada. Will não desiste e leva para casa algumas amostras do medicamento, aplicando-as no próprio pai, e também um filhote de macaco de uma das cobaias do laboratório. Logo Charles não apenas se recupera como tem a memória melhorada, graças ao medicamento. Já o filhote, que recebe o nome de César, demonstra ter inteligência fora do comum, já que recebeu geneticamente os medicamentos aplicados na mãe. O trio leva uma vida tranquila, até que, anos mais tarde, o remédio para de funcionar em Charles e, em uma tentativa de defendê-lo, César ataca um vizinho. O macaco é então engaiolado, onde passa a ter contato com outros símios e, cada vez mais, se revolta com a situação.', 0, NULL, 1, NULL),
(NULL, 661, 'Planeta dos Macacos: O Confronto', 'Dawn of the Planet of the Apes', 'Estados Unidos', 'Ação', 'Matt Reeves', '15422145795bec53b3845f0.png', 130, 2014, 'Ib0gEOErkTo', 'Andy Serkis, Jason Clarke, Gary Oldman, Keri Russell', 'Dez anos após a conquista da liberdade, César (Andy Serkis) e os demais macacos vivem em paz na floresta próxima a San Francisco. Lá eles desenvolveram uma comunidade própria, baseada no apoio mútuo, enquanto os humanos enfrentam uma das maiores epidemias de todos os tempos, causada por um vírus criado em laboratório. Sem energia elétrica, um grupo de sobreviventes planeja invadir a floresta e reativar a usina lá instalada. Malcolm (Jason Clarke), único que conhece bem os símios, tenta agir pacificamente e impedir que o confronto aconteça.', 0, NULL, NULL, NULL),
(NULL, 662, 'Planeta dos Macacos: A Guerra', 'War for the Planet of the Apes', 'Estados Unidos', 'Ação', 'Matt Reeves', '15422147415bec5455bcc66.png', 140, 2017, 'QzgWDG4QviU', 'Andy Serkis, Woody Harrelson, Steve Zahn, Karin Konoval', 'César e seu grupo são forçados a entrar em uma guerra contra um exército de soldados liderados por um impiedoso coronel. Depois que vários macacos perdem suas vidas no conflito, César luta contra seus instintos e parte em busca de vingança. Dessa jornada, o futuro do planeta poderá estar em jogo.', 0, NULL, NULL, NULL),
(NULL, 663, 'Assassin\'s Creed', 'Assassin\'s Creed', 'Estados Unidos', 'Ação', 'Justin Kurzel', '15422152335bec5641242fc.png', 115, 2017, 'aAklMzFDW8A', 'Chris Jai Alex, John Hennigan, Marissa Labog, Ashton Moio', 'Callum Lynch (Michael Fassbender) descobre que é descendente de um membro da Ordem dos Assassinos e, via memória genética, revive as aventuras do guerreiro Aguilar, seu ancestral espanhol do século XV. Dotado de novos conhecimentos e incríveis habilidades, ele volta aos dias de hoje pronto para enfrentar os Templários. Versão para as telonas do game Assassin\'s Creed.', 0, NULL, NULL, NULL),
(NULL, 664, 'Resident Evil: O Capítulo Final', 'Resident Evil: The Final Chapter', 'Estados Unidos', 'Ficção Científica', 'Paul W.S. Anderson', '15422155545bec5782ce5ff.png', 107, 2016, '17sInSM9kE0', 'Milla Jovovich, Iain Glen, Ali Larter, Shawn Roberts', 'Sobrevivente do massacre zumbi, Alice (Milla Jovovich) retorna para onde o pesadelo começou, Raccoon City, onde a Umbrella Corporation reúne suas forças para um ataque final contra os remanescentes do apocalipse. Para vencer a dura batalha final e salvar a raça humana, a heroína recruta velhos e novos amigos.', 0, NULL, NULL, NULL),
(NULL, 665, 'Kong: A Ilha da Caveira', 'Kong: Skull Island', 'Estados Unidos', 'Aventura', 'Jordan Vogt-Roberts', '15422157315bec5833cf0f1.png', 118, 2017, 'ksUvtsN8KRI', 'Tom Hiddleston, Samuel L. Jackson, Brie Larson, John C. Reilly', '', 0, NULL, NULL, NULL),
(NULL, 666, 'A Grande Muralha', 'The Great Wall', 'Estados Unidos', 'Aventura', 'Yimou Zhang', '15422160235bec5957d1bb6.png', 103, 2016, 'N7v-7-yCuNw', 'Matt Damon, Tian Jing, Willem Dafoe, Andy Lau', '', 0, NULL, NULL, NULL),
(NULL, 667, 'A Múmia', 'The Mummy', 'Estados Unidos', 'Fantasia', 'Alex Kurtzman', '15422168095bec5c691f8a3.png', 124, 2017, 'gHHxaXgrRC0', 'Tom Cruise, Russell Crowe, Annabelle Wallis, Sofia Boutella', 'Na Mesopotâmia, séculos atrás, Ahmanet (Sofia Boutella) tem seus planos interrompidos justamente quando está prestes a invocar Set, o deus da morte, de forma que juntos possam governar o mundo.  Mumificada, ela é aprisionada dentro de uma tumba. Nos dias atuais, o local é descoberto por acidente por Nick Morton (Tom Cruise) e Chris Vail (Jake Johnson), saqueadores de artefatos antigos que estavam na região em busca de raridades. Ao lado da pesquisadora Jenny Halsey (Annabelle Wallis), eles investigam a tumba recém-descoberta e, acidentalmente, despertam Ahmanet. Ela logo elege Nick como seu escolhido e, a partir de então, busca a adaga de Set para que possa invocá-lo no corpo do saqueador.', 0, NULL, NULL, NULL),
(NULL, 668, 'Onde Está Segunda?', 'What Happened to Monday', 'Reino Unido', 'Ficção Científica', 'Tommy Wirkola', '15422278205bec876c3b1a3.jpg', 123, 2017, 'mQoEE8gpCwk', 'Noomi Rapace, Glenn Close, Willem Dafoe, Marwan Kenzari', '2073. O aumento crescente da população faz com que os recursos naturais da Terra se tornem cada vez mais escassos, especialmente após a América do Sul tornar-se um imenso deserto. A saída é investir em alimentos geneticamente modificados, de forma a ampliar a produção em um espaço físico cada vez mais limitado. Entretanto, tal iniciativa gera como efeito colateral o nascimento cada vez maior de gêmeos, o que aumenta ainda mais o problema da superpopulação. Neste contexto, Nicolette Cayman (Glenn Close) surge com uma proposta drástica: cada casal pode ter apenas um filho, e os irmãos são confinados em ambiente criogênico para serem despertados quando a situação do planeta estiver sob controle. Todos os países adotam esta proposta, com a criação de uma agência implacável que fiscaliza os cidadãos através de pulseiras eletrônicas. Apesar de tamanha vigilância, Terrence Settman (Willem Dafoe) consegue salvar a vida de suas sete netas fazendo com que elas se revezem nos dias da semana, de forma que todas assumam o codinome Karen Settman - o mesmo nome de sua mãe, que faleceu no parto. Trinta anos depois, as sete irmãs seguem esta rígida rotina até que uma delas, Segunda (Noomi Rapace), misteriosamente não retorna para casa.', 0, NULL, NULL, NULL),
(NULL, 669, 'A Sociedade Literária e a Torta de Casca de Batata', 'The Guernsey Literary and Potato Peel Pie Society', 'Estados Unidos', 'Drama', 'Mike Newell', '15422280535bec8855b17fb.jpg', 124, 2018, '4GVLkxvG8lU', 'Jessica Brown Findlay, Tom Courtenay, Michiel Huisman, Katherine Parkinson', 'Juliet Ashton (Lily James) é uma escritora na Londres de 1946 que decide visitar Guernsey, uma das Ilhas do Canal invadidas pela Alemanha durante a Segunda Guerra Mundial, depois que ela recebe uma carta de um fazendeiro contando sobre como um clube do livro local foi fundado durante a guerra. Lá ela constrói profundos relacionamentos com os moradores da ilha e decide escrever um livro sobre as experiências deles na guerra.', 0, NULL, NULL, NULL),
(NULL, 670, 'Azul É a Cor Mais Quente', 'Blue Is the Warmest Color', 'França', 'LGBT', 'Abdellatif Kechiche', '15422283225bec896208326.jpg', 180, 2013, 'lU5jrPnGAjU', 'Léa Seydoux, Adèle Exarchopoulos, Salim Kechiouche, Aurélien Recoing', 'Adèle (Adèle Exarchopoulos) é uma garota de 15 anos que descobre, na cor azul dos cabelos de Emma (Léa Seydoux), sua primeira paixão por outra mulher. Sem poder revelar a ninguém seus desejos, ela se entrega por completo a este amor secreto, enquanto trava uma guerra com sua família e com a moral vigente.', 0, NULL, NULL, NULL),
(NULL, 672, 'Detona Ralph', 'Wreck-It Ralph', 'Estados Unidos', 'Animação', 'Rich Moore', '15422374415becad01245ff.jpg', 101, 2012, 'MsoG4LnjhL0', 'John C. Reilly, Sarah Silverman, Jack McBrayer, Jane Lynch', 'Ralph está cansado de ser desprezado no seu próprio jogo de fliperama. Para ganhar a atenção do herói Felix e todos os outros personagens, o vilão tem um plano e sai em busca de uma medalha, com a intenção de provar o seu valor.', 0, 'nadalini', NULL, NULL),
(NULL, 673, 'O Segredo de Seus Olhos', 'El Secreto de Sus Ojos', 'Espanha', 'Drama', 'Juan José Campanella', '15422401815becb7b556805.jpg', 129, 2010, 'pSSxSp-lsf0', NULL, 'Benjamin Esposito (Ricardo Darín) se aposentou recentemente do cargo de oficial de justiça de um tribunal penal. Com bastante tempo livre, ele agora se dedica a escrever um livro. Benjamin usa sua experiência para contar uma história trágica, a qual foi testemunha em 1974. Na época o Departamento de Justiça onde trabalhava foi designado para investigar o estupro e consequente assassinato de uma bela jovem. É desta forma que Benjamin conhece Ricardo Morales (Pablo Rago), marido da falecida, a quem promete ajudar a encontrar o culpado. Para tanto ele conta com a ajuda de Pablo Sandoval (Guillermo Francella), seu grande amigo, e com Irene Menéndez Hastings (Soledad Villamil), sua chefe imediata, por quem nutre uma paixão secreta.', 0, 'matheus', NULL, NULL),
(NULL, 674, 'A Saga Crepúsculo: Lua Nova', 'The Twilight Saga: New Moon', 'Estados Unidos', 'Fantasia', 'Chris Weitz', '15422403785becb87a3838e.jpg', 130, 2009, 'tOLDJJss6KU&t=9s', 'Kristen Stewart, Robert Pattinson, Billy Burke, Taylor Lautner, Ashley Greene, Anna Kendrick, Jackson Rathbone, Dakota Fanning, Michael Sheen', 'Um incidente na festa de aniversário de Isabella \"Bella\" Swan (Kristen Stewart) faz com que Edward Cullen (Robert Pattinson) vá embora. Arrasada, Bella encontra consolo ao lado de Jacob Black (Taylor Lautner). Aos poucos ela é atraída para o mundo dos lobisomens, ancestrais inimigos dos vampiros, e passa a ter sua lealdade testada. Quando descobre que a vida de Edward está em perigo, Bella corre contra o tempo para ajudá-lo no combate aos Volturi, um dos mais poderosos clãs de vampiros existentes.', 0, 'matheus', NULL, NULL),
(NULL, 675, 'Tudo Sobre Minha Mãe', 'Todo Sobre Mi Madre', 'Espanha', 'Drama', 'Pedro Almodóvar', '15422411175becbb5e0004e.jpg', 101, 1999, '3MzgPrFkrcA', NULL, 'No dia de seu aniversário, Esteban (Eloy Azorín) ganha de presente da mãe, Manuela (Cecilia Roth), um ingresso para a nova montagem da peça \"Um bonde chamado desejo\", estrelada por Huma Rojo (Marisa Paredes). Após o espetáculo, ao tentar pegar um autógrafo de Huma, Esteban é atropelado e morre. Manuela resolve então ir até o pai do menino, que vive em Barcelona, para dar a notícia. No caminho, ela encontra o travesti Agrado (Antonia San Juan), a freira Rosa (Penélope Cruz) e a própria Huma Rojo.', 0, 'matheus', NULL, NULL),
(NULL, 676, 'Crônica de Uma Fuga', 'Crónica de Una Fuga', 'Argentina', 'Drama', 'Adrián Caetano', '15422417095becbdad64362.jpg', 0, 2006, 'caDWPT0m4pw', NULL, 'Nos anos 70, o goleiro de um time argentino é sequestrado pelo regime militar, interrogado e torturado. Mais tarde, ele descobre ser parte de um golpe e decide fugir com mais três presos.', 0, 'matheus', NULL, NULL),
(NULL, 677, 'O Que É Isso, Companheiro?', 'O Que É Isso, Companheiro?', 'Brasil', 'Drama', 'Bruno Barreto', '15422429085becc25c337ac.jpg', 110, 1997, 'oizUBqDibIk', NULL, 'O jornalista Fernando (Pedro Cardoso) e seu amigo César (Selton Mello) abraçam a luta armada contra a ditadura militar no final da década de 60. Os dois alistam num grupo guerrilheiro de esquerda. Em uma das ações do grupo militante, César é ferido e capturado pelos militares. Fernando então planeja o sequestro do embaixador dos Estados Unidos no Brasil, Charles Burke Elbrick (Alan Arkin), para negociar a liberdade de César e de outros companheiros presos.', 0, 'matheus', NULL, NULL),
(NULL, 678, 'Nostalgia da Luz', 'Nostalgia de la Luz', 'Chile', 'Documentário', 'Patricio Guzmán', '15422439125becc64836ec7.jpg', 90, 2015, 'otAMuEhRNKw', NULL, 'No deserto de Atacama, astrônomos de todo o mundo se reúnem para observar as estrelas. Nessa região do Chile, a três mil metros de altitude, o calor do sol mantém intactos restos humanos. Ao mesmo tempo em que os astrônomos pesquisam as galáxias em busca de vida extraterrestre, mulheres procuram seus parentes na terra do deserto.', 0, 'matheus', NULL, NULL),
(NULL, 679, 'A Casa que Jack Construiu', 'The House that Jack Built', 'Dinamarca', 'Suspense', 'Lars von Trier', '15423715155beeb8bb6f794.jpg', 155, 2018, 'oQwj6DuO7CA', 'Matt Dillon, Bruno Ganz, Uma Thurman, Siobhan Fallon Hogan', 'Um dia, durante um encontro fortuito na estrada, o arquiteto Jack (Matt Dillon) mata uma mulher. Este evento provoca um prazer inesperado no personagem, que passa a assassinar dezenas de pessoas ao longo de doze anos. Devido ao descaso das autoridades e à indiferença dos habitantes locais, o criminoso não encontra dificuldade em planejar seus crimes, executá-los ao olhar de todos e guardar os cadáveres num grande frigorífico. Tempos mais tarde, ele compartilha os seus casos mais marcantes com o sábio Virgílio (Bruno Ganz) numa jornada rumo ao inferno.', 0, 'nadalini', NULL, NULL),
(NULL, 680, 'Winter on Fire', 'Winter on Fire: Ukraine\'s Fight for Freedom', 'Ucrânia', 'Documentário', 'Evgeny Afineevsky', '15423852295beeee4d69077.jpg', 102, 2015, 'VaeFbmVAcTg', 'Bishop Agapit, Catherine Ashton, Serhii Averchenko, Kristina Berdinskikh', 'O que começou como uma manifestação pacífica de estudantes se transforma em 93 violentos dias de revolução na luta pelos direitos civis na Ucrânia.', 0, 'nadalini', NULL, NULL),
(NULL, 681, 'Animais Fantásticos e Onde Habitam', 'Fantastic Beasts and Where to Find Them', 'Estados Unidos', 'Fantasia', 'David Yates', '15424174655bef6c39bdf33.jpg', 133, 2016, 'HRdIQ5oLHG4', 'Eddie Redmayne, Sam Redford, Scott Goldman, Tim Bentinck', 'O excêntrico magizoologista Newt Scamander (Eddie Redmayne) chega à cidade de Nova York levando com muito zelo sua preciosa maleta, um objeto mágico onde ele carrega fantásticos animais do mundo da magia que coletou durante as suas viagens. Em meio a comunidade bruxa norte-americana, que teme muito mais a exposição aos trouxas do que seus colegas ingleses, Newt precisará usar todas suas habilidades e conhecimentos para capturar uma variedade de criaturas que acabam fugindo.', 0, 'matheus', NULL, NULL),
(NULL, 682, 'Animais Fantásticos: Os Crimes de Grindelwald', 'Fantastic Beasts: The Crimes Of Grindelwald', 'Estados Unidos', 'Fantasia', 'David Yates', '15424180705bef6e96f2a60.jpg', 113, 2018, 'YNskLKO_FzE', 'Johnny Depp, Kevin Guthrie, Carmen Ejogo, Wolf Roth', 'Newt Scamander (Eddie Redmayne) reencontra os queridos amigos Tina Goldstein (Katherine Waterston), Queenie Goldstein (Alison Sudol) e Jacob Kowalski (Dan Fogler). Ele é recrutado pelo seu antigo professor em Hogwarts, Alvo Dumbledore (Jude Law), para enfrentar o terrível bruxo das trevas Gellert Grindelwald (Johnny Depp), que escapou da custódia da MACUSA (Congresso Mágico dos EUA) e reúne seguidores, dividindo o mundo entre seres de magos sangue puro e seres não-mágicos.', 0, 'matheus', NULL, NULL),
(NULL, 683, 'Seven - Os Sete Crimes Capitais', 'Se7en', 'Estados Unidos', 'Neo Noir, Drama, Suspense', 'David Fincher', '15425008495bf0b1f18e84d.jpg', 127, 1995, 'znmZoVkCjpI', 'Morgan Freeman, Andrew Kevin Walker, Daniel Zacapa, Brad Pitt', 'Dois policiais, om jovem e impetuoso David Mills (Brad Pitt) e o outro maduro e prestes a se aposentar, William Somerset (Morgan Freeman), são encarregados de uma periogosa investigação: encontrar um serial killer que mata as pessoas seguindo a ordem dos sete pecados capitais.', 0, 'matheus', NULL, NULL),
(NULL, 684, 'O Curioso Caso de Benjamin Button', 'The Curious Case of Benjamin Button', 'Estados Unidos', 'Drama', 'David Fincher', '15425012505bf0b382cb192.jpg', 166, 2008, 'p8ucIL2tLLo&t=4s', 'Cate Blanchett, Brad Pitt, Julia Ormond, Faune Chambers Watkins', '', 0, 'matheus', NULL, NULL),
(NULL, 685, 'O Quarto do Pânico', 'Panic Room', 'Estados Unidos', 'Suspense', 'David Fincher', '15425014905bf0b472e49b4.jpg', 112, 2002, 'OAchdnjxuYk', 'Jodie Foster, Kristen Stewart, Forest Whitaker, Dwight Yoakam', 'Meg Altman (Jodie Foster) é uma mulher recém-separada que é surpreendida com a invasão de sua casa por três homens estranhos. Logo ela e sua filha Sarah (Kristen Stewart) vão para um quarto secreto, construído especialmente para situações de emergência. De dentro do quarto Meg espiona o que está ocorrendo em sua casa através de um circuito fechado de TV, mas logo ela passa a enfrentar pequenos problemas dentro e fora de seu refúgio, principalmente porque aquilo que os homens estão procurando está justamente no quarto onde Meg e Sarah estão.', 0, 'matheus', NULL, NULL),
(NULL, 686, 'Argo', 'Argo', 'Estados Unidos', 'Drama', 'Ben Affleck', '15425037875bf0bd6bbaa53.jpg', 120, 2012, '6Y_uWmOxvt8', 'Ben Affleck, Bryan Cranston, Alan Arkin, John Goodman', '1979. O Irã está em ebulição, com a chegada ao poder do aiatolá Khomeini. Como o antigo xá ganhou asilo político nos Estados Unidos, que haviam apoiado seu governo de opressão ao povo iraniano, há nas ruas de Teerã diversos protestos contra os americanos. Um deles acontece em frente à embaixada do país, que acaba invadida. Seis diplomatas americanos conseguem escapar do local pouco antes da invasão, indo se refugiar na casa do embaixador canadense. Lá eles vivem durante meses, sob sigilo absoluto, enquanto a CIA busca um meio de retirá-los do país em segurança. A melhor opção é apresentada por Tony Mendez (Ben Affleck), um especialista em exfiltrações, que sugere que uma produção de Hollywood seja utilizada como fachada para a operação. Aproveitando o sucesso de filmes como \"Guerra nas Estrelas\" e \"A Batalha do Planeta dos Macacos\", a ideia é criar um filme falso, a ficção científica Argo, que usaria as paisagens desérticas do Irã como locação. O projeto segue adiante com a ajuda do produtor Lester Siegel (Alan Arkin) e do maquiador John Chambers (John Goodman), que conhecem bem como funciona Hollywood.', 0, 'matheus', NULL, NULL),
(NULL, 688, 'O Leitor ', 'The Reader', 'Estados Unidos', 'Drama', 'Stephen Daldry', '15426331175bf2b69d20903.jpg', 124, 2008, 'I50ZKFCqr8g', 'Ralph Fiennes, Jeanette Hain, David Kross, Kate Winslet', 'Na Alemanha pós-2ª Guerra Mundial o adolescente Michael Berg (David Kross) se envolve, por acaso, com Hanna Schmitz (Kate Winslet), uma mulher que tem o dobro de sua idade. Apesar das diferenças de classe, os dois se apaixonam e vivem uma bonita história de amor. Até que um dia Hanna desaparece misteriosamente. Oito anos se passam e Berg, então um interessado estudante de Direito, se surpreende ao reencontrar seu passado de adolescente quando acompanhava um polêmico julgamento por crimes de guerra cometidos pelos nazistas.', 0, 'helena', NULL, NULL),
(NULL, 689, 'Birdman ou (A Inesperada Virtude da Ignorância)', 'Birdman or (The Unexpected Virtue of Ignorance)', 'Estados Unidos', 'Comédia dramática', 'Alejandro G Iñárritu', '15426385925bf2cc0005d53.jpg', 119, 2014, 'n7kPKVxuz6k', 'Michael Keaton, Emma Stone, Edward Norton, Naomi Watts, Zach Galifianakis, Kenny Chin, Andrea Riseborough, Amy Ryan, Lindsay Duncan', 'No passado, Riggan Thomson (Michael Keaton) fez muito sucesso interpretando o Birdman, um super-herói que se tornou um ícone cultural. Entretanto, desde que se recusou a estrelar o quarto filme com o personagem sua carreira começou a decair. Em busca da fama perdida e também do reconhecimento como ator, ele decide dirigir, roteirizar e estrelar a adaptação de um texto consagrado para a Broadway. Entretanto, em meio aos ensaios com o elenco formado por Mike Shiner (Edward Norton), Lesley (Naomi Watts) e Laura (Andrea Riseborough), Riggan precisa lidar com seu agente Brandon (Zach Galifianakis) e ainda uma estranha voz que insiste em permanecer em sua mente.', 0, 'matheus', NULL, NULL),
(NULL, 690, 'Slender Man: Pesadelo Sem Rosto', 'Slender Man', 'Estados Unidos', 'Terror', 'Sylvain White', '15428791085bf6778413564.jpg', 93, 2018, 'lz1LYJj92EE', 'Joey King, Julia Goldani Telles, Jaz Sinclair, Annalise Basso', 'As amigas Wren, Hallie, Chloe e Katie levam uma vida entediante no colégio. Quando ouvem falar num monstro chamado Slender Man, decidem invocá-lo através de um vídeo na Internet. A brincadeira se transforma num perigo real quando todas começam a ter pesadelos e visões do homem se rosto, com vários braços, capaz de fazer as suas vítimas alucinarem. Um dia, Katie desaparece. Como a polícia não dispõe de nenhuma prova para a investigação, cabe às três amigas fazerem a sua própria busca, enfrentando a criatura.', 0, 'helena', NULL, NULL),
(NULL, 691, 'Franca: Caos e Criação', 'Franca: Chaos and Creation', 'Itália', 'Documentário', 'Francesco Carrozzini', '15428797135bf679e148fe6.jpg', 80, 2016, 'YhAQJgyid1k', 'Marina Abramovic, Azzedine Alaïa, Naomi Campbell, Francesco Carrozzini', 'Um retrato íntimo de Franca Sozzani, a lendária editora-chefe da Vogue italiana.', 0, 'raissa', NULL, NULL),
(NULL, 692, 'Moulin Rouge - Amor em Vermelho', 'Moulin Rouge!', 'Austrália', 'Musical', 'Baz Luhrmann', '15428797925bf67a30a6f6c.jpg', 127, 2001, '4tWw9zqp7Mk', 'Nicole Kidman, Ewan McGregor, John Leguizamo, Jim Broadbent', 'Christian (Ewan McGregor) é um jovem escritor que possui um dom para a poesia e que enfrenta seu pai para poder se mudar para o bairro boêmio de Montmartre, em Paris. Lá ele recebe o apoio de Henri de Toulouse-Latrec (John Leguizamo), que o ajuda a participar da vida social e cultural do local, que gira em torno do Moulin Rouge, uma boate que possui um mundo próprio de sexo, drogas, adrenalina e Can-Can. Ao visitar o local, Christian logo se apaixona por Satine (Nicole Kidman), a mais bela cortesã de Paris e estrela maior do Moulin Rouge.', 0, 'matheus', NULL, NULL),
(NULL, 693, 'Tal Pai, Tal Filha', 'Like Father', 'Estados Unidos', 'Comédia dramática', 'Lauren Miller Rogen', '15428798255bf67a5157c86.jpg', 98, 2018, 'RG1aG6BL4LE', 'Kristen Bell, Danielle Davenport, Kimiko Glenn, Wynter Kullman', 'Rachel (Kristen Bell) é uma jovem viciada no trabalho que está prestes a se casar com Owen (Jon Foster). Momentos antes da cerimônia, ela ainda está ao celular resolvendo detalhes de um possível novo cliente. Tal situação faz com que o noivo desista do casamento em pleno altar, por perceber que ela jamais irá mudar. Desolada, Rachel ainda é surpreendida com a súbita reaparição de seu pai, Harry (Kelsey Grammer), que a abandonou quando tinha apenas 5 anos. Após uma noite de bebedeira, ela decide não perder o cruzeiro ao Caribe que já havia programado para sua lua de mel, e convida seu pai a acompanhá-la.', 0, 'helena', NULL, NULL),
(NULL, 694, 'Turbo', 'Turbo', 'Estados Unidos', 'Animação', 'David Soren', '15428799215bf67ab1b8fc4.jpg', 96, 2013, 'qivPeDgmxTI', 'Ryan Reynolds, Paul Giamatti, Michael Peña, Samuel L. Jackson', 'Theo (voz original de Ryan Reynolds) é um caracol de jardim, que passa o dia com outros caracóis, colhendo tomates e torcendo para não ser capturado por aves predadoras. Apesar da vida pacata, este jovem animal sonha em se tornar extremamente veloz, como o seu ídolo, o corredor campeão de Indianápolis Guy Gagné (voz original de Bill Hader). A obsessão pela velocidade faz que com Theo seja ridicularizado pelos colegas. Um dia, no entanto, ele cai acidentalmente dentro do motor de um grande carro de corrida, e um efeito inesperado acontece em seu corpo, fazendo com que ele se torne extremamente veloz. Rebatizado Turbo, o caracol encontra abrigo na casa de Tito (voz original de Michael Peña), um vendedor de comida mexicana conhecido pelos planos inusitados e que quase sempre dão errado. Surpreso com a velocidade de Turbo, Tito decide levá-lo à corrida de Indianápolis, para competir com Guy Gagné.', 0, 'helena', NULL, NULL),
(NULL, 695, 'Capitão Fantástico', 'Captain Fantastic', 'Estados Unidos', 'Comédia dramática', 'Matt Ross', '15428801155bf67b7340353.jpg', 118, 2016, 'D1kH4OMIOMc', 'Viggo Mortensen, George MacKay, Samantha Isler, Annalise Basso', 'Ben (Viggo Mortensen) tem seis filhos com quem vive longe da civilização, no meio da floresta, numa rígida rotina de aventuras. As crianças lutam, escalam, leem obras clássicas, debatem, caçam e praticam duros exercícios, tendo a autossuficiência sempre como palavra de ordem. Certo dia um triste acontecimento leva a família a deixar o isolamento e o reencontro com parentes distantes traz à tona velhos conflitos.', 0, 'matheus', NULL, NULL),
(NULL, 696, 'Dries', 'Dries', 'Alemanha', 'Documentário', 'Reiner Holzemer', '15428801525bf67b982d956.jpg', 93, 2017, 'Q7Sqe2DKAFo', 'Dries Van Noten, Iris Apfel, Pamela Golbin, Geert Brulot', 'Pela primeira vez, o designer de moda, Dries Van Noten, permite que um cineasta o acompanhe em sua vida pessoal e processo criativo. Durante um ano inteiro, Reiner Holzemer documentou os passos precisos que Dries leva para conceber quatro coleções. O filme exibe desde a escolha dos ricos tecidos, bordados e estampas exclusivas de seus desenhos, até os desfiles de moda emblemáticos que trazem suas coleções para o mundo e se tornaram imperdíveis na semana da moda parisiense.', 0, 'raissa', NULL, NULL),
(NULL, 697, 'O Pequeno Príncipe ', 'The Little Prince', 'França', 'Animação', 'Mark Osborne', '15428801545bf67b9a9ded8.png', 108, 2015, '7WoO-luLshk', 'Jeff Bridges, Mackenzie Foy, Rachel McAdams, Marion Cotillard', 'Uma garota acaba de se mudar com a mãe, uma controladora obsessiva que deseja definir antecipadamente todos os passos da filha para que ela seja aprovada em uma escola conceituada. Entretanto, um acidente provocado por seu vizinho faz com que a hélice de um avião abra um enorme buraco em sua casa. Curiosa em saber como o objeto parou ali, ela decide investigar. Logo conhece e se torna amiga de seu novo vizinho, um senhor que lhe conta a história de um pequeno príncipe que vive em um asteróide com sua rosa e, um dia, encontrou um aviador perdido no deserto em plena Terra.', 0, 'helena', NULL, NULL),
(NULL, 698, 'O Grande Circo Místico', 'O Grande Circo Místico', 'Brasil', 'Romance', 'Carlos Diegues', '15428803645bf67c6ccf451.jpg', 104, 2018, 'pgmwoojUY24', NULL, 'Em meio ao universo de uma tradicional família austríaca, que é dona do Grande Circo Knieps, nasceu um improvável romance entre um aristocrata e uma acrobata. Este é o retrato dos 100 anos de existência do Grande Circo e das cinco gerações do clã à frente do espetáculo e suas histórias fantásticas.', 0, 'helena', NULL, NULL),
(NULL, 699, 'O Verdadeiro Custo', 'The True Cost', 'Reino Unido', 'Documentário', 'Andrew Morgan ', '15428804595bf67ccb06ceb.jpg', 92, 2015, 'DjncKUmpOZk', 'Livia Giuggioli, Stella McCartney, Vandana Shiva, Lucy Siegle', 'Através do mundo da moda, o documentário pensa sobre as roupas que usamos e as pessoas que as fabricam. Em meio a realidade industrial, o preço das roupas estão diminuindo há decadas, enquanto que os custos ambientais e humanos só aumentam. Qual o impacto dessa indústria da moda? Quem realmente para o preço pelas nossas roupas?', 0, 'raissa', NULL, NULL),
(NULL, 700, 'O Último Dançarino de Mao', 'Mao\'s Last Dancer', 'Australia', 'Drama', 'Bruce Beresford', '15428805405bf67d1cb5a1d.jpg', 117, 2009, 'FTJFDN-acCs', 'Chi Cao, Bruce Greenwood, Penne Hackforth-Jones, Christopher Kirby', 'China, durante a Revolução Cultural implementada por Mao Tsé Tung. Aos 11 anos Lin Cunxin (Wen Bing Huang/Chengwu Guo/Chi Cao) foi escolhido para deixar sua família de camponeses e estudar balé em Pequim. Em 1979, durante uma visita ao Texas, nos Estados Unidos, ele se apaixona por uma mulher local. Dois anos depois, ele se torna o principal dançarino do Houston Ballet e também o principal artista do Australian Ballet.', 0, 'helena', NULL, NULL),
(NULL, 701, 'Lavoura Arcaica', 'Lavoura Arcaica', 'Brasil', 'Drama', 'Luiz F. Carvalho', '15428805625bf67d32e3229.jpg', 171, 2001, 'kZ1_aD00GmI', NULL, 'André (Selton Mello) é um filho desgarrado, que saiu de casa devido à severa lei paterna e o sufocamento da ternura materna. Pedro (Leonardo Medeiros), seu irmão mais velho, recebe de sua mãe a missão de trazê-lo de volta ao lar. Cedendo aos apelos da mãe e de Pedro, André resolve voltar para a casa dos seus pais, mas irá quebrar definitivamente os alicerces da família ao se apaixonar por sua bela irmã Ana (Simone Spoladore).', 0, 'matheus', NULL, NULL),
(NULL, 702, 'O Reino da Beleza ', 'Le Règne de la beauté', 'Canadá', 'Drama', 'Denys Arcand', '15428807545bf67df24b2ec.jpg', 102, 2017, '5nsKs-9g4SU', NULL, 'Durante um colóquio na cidade de Toronto, Luc Sauvageau (Éric Bruneau), um arquiteto casado com Stéphanie (Mélanie Thierry) e natural do Quebec, conhece Lindsay (Melanie Merkosky), uma mulher intrigante. Luc acaba se apaixonando pela mulher e começa um relacionamento apaixonado e tortuoso com ela.', 0, 'helena', NULL, NULL),
(NULL, 703, 'O Ditador', 'The Dictator', 'Estados Unidos', 'Comédia', 'Larry Charles', '15428808925bf67e7c12f0e.jpg', 83, 2012, '-oVDMv6nCOs', 'Sacha Baron Cohen, Sayed Badreya, Rocky Citron, Liam Campora', 'A heróica história do General Aladeen (Sacha Baron Cohen), ditador da República de Wadiya, localizada no norte da África. Ele dedica sua vida inteira a garantir que a democracia jamais chegue ao seu país, enquanto ergue estátuas em sua homenagem e cria seus próprios Jogos Olímpicos. Quando a comunidade internacional suspeita que Wadiya está construindo uma arma nuclear, ele é intimado a se explicar na sede da Organização das Nações Unidas, nos Estados Unidos. Mas seu encontro com a democracia americana não se passa exatamente como ele esperava.', 0, 'helena', NULL, NULL),
(NULL, 704, 'Carnívoras', 'Carnivores', 'França', 'Suspense', 'Jérémie Renier', '15428809285bf67ea0a418b.jpg', 86, 2018, 'lAgTBd_RExs', 'Leïla Bekhti, Zita Hanrot, Bastien Bouillon, Johan Heldenbergh', 'No início de seus trinta anos, Mona (Leïla Bekhti) tenta decolar como atriz. O tempo passa e as propostas não chegam. Com poucos recursos, ela é forçada a morar com Sam (Zita Hanrot), sua irmã mais nova. Sam é uma atriz e compartilha sua vida com Manuel (Bastien Bouillon) e seu filho. Esta é a vida que Mona cobiça tanto, Sam já não a apoia e afunda em sua neurose, deixando o lugar para a irmã mais velha existir, redefinir sua vida e suas prioridades, seja qual for o preço.', 0, 'raissa', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 705, 'De Volta Para o Futuro', 'Back to the Future', 'Estados Unidos', 'Ficção Científica', 'Robert Zemeckis', '15428812135bf67fbd46e2d.jpg', 116, 1985, 'qvsgGtivCgs', 'Michael J. Fox, Christopher Lloyd, Lea Thompson, Crispin Glover', 'Um jovem (Michael J. Fox) aciona acidentalmente uma máquina do tempo construída por um cientista (Christopher Lloyd) em um Delorean, retornando aos anos 50. Lá conhece sua mãe (Lea Thompson), antes ainda do casamento com seu pai, que fica apaixonada por ele. Tal paixão põe em risco sua própria existência, pois alteraria todo o futuro, forçando-o a servir de cupido entre seus pais.', 0, 'matheus', NULL, NULL),
(NULL, 706, 'De Volta Para o Futuro 2', 'Back to the Future Part II', 'Estados Unidos', 'Ficção Científica', 'Robert Zemeckis', '15428815005bf680dc73b22.jpg', 108, 1989, 'MdENmefJRpw', 'Michael J. Fox, Christopher Lloyd, Lea Thompson, Thomas F. Wilson', 'O cientista Doc Brown (Christopher Lloyd) leva Marty (Michael J. Fox) e sua namorada (Elisabeth Shue) para o ano 2015, com a finalidade de resolver uma questão familiar no futuro deles. Mas Biff (Thomas F. Wilson), velho inimigo da família, obriga-os a correrem contra o tempo (literalmente falando) para não alterarem os acontecimentos.', 0, 'matheus', NULL, NULL),
(NULL, 707, 'De Volta Para o Futuro 3', 'Back to the Future Part III', 'Estados Unidos', 'Ficção Científica', 'Robert Zemeckis', '15428816145bf6814e419c6.jpg', 118, 1990, '3C8c3EoEfw4', 'Michael J. Fox, Christopher Lloyd, Mary Steenburgen, Thomas F. Wilson', 'Após de receber uma carta de Doc (Christopher Lloyd) datada de 1885, Marty McFly (Michael J. Fox) decide viajar para o Velho Oeste, no dia 2 de setembro do mesmo ano. Lá ele descobre que o doutor está fugindo de uma gangue de bandidos e se apaixonou por uma professora da época. Agora, Marty tem apenas cinco dias para salvar a si e aos seus amigos e voltar para o futuro.', 0, 'matheus', NULL, NULL),
(NULL, 708, 'A Morte Te Dá Parabéns', 'Happy Death Day', 'Estados Unidos', 'Terror', 'Christopher Landon', '15428818385bf6822e67722.jpg', 97, 2017, 'XVF84CJGVuY', 'Jessica Rothe, Israel Broussard, Ruby Modine, Charles Aitken, Rachel Matthews, Laura Clifton, Phi Vu, Caleb Spillyards, Rob Mello, Cariella Smith', 'Tree (Jessica Rothe) é uma jovem estudante que trata mal os meninos, desdenha das amigas e não parece estar muito disposta a atender as ligações do pai no dia do aniversário dela. No fim do mesmo dia, no entanto, ela é brutalmente assassinada por um mascarado. Acontece que ela \"sobrevive\", ou melhor, acorda no mesmo e fatídico dia, numa espécie de looping macabro, que termina sempre com a morte da garota. Repetir, seguidamente, o mesmo dia, por outro lado, dá a Tree a chance de investigar quem a está querendo morta e o porquê.', 0, 'raissa', NULL, NULL),
(NULL, 709, 'A Morte Te Dá Parabéns 2', 'Happy Death Day 2', 'Estados Unidos', 'Comédia', 'Christopher Landon', '15428821445bf68360f1c17.jpeg', 0, 2019, 'Z_6Uch1b5Tw', 'Jessica Rothe, Israel Broussard, Ruby Modine, Rachel Matthews', 'Sequência de A Morte Te Dá Parabéns, em que a jovemTree (Jessica Rothe) se vê presa misteriosamente no aniversário da sua morte eternamente. Sinopse ainda não divulgada pelo estúdio.', 0, 'raissa', NULL, NULL),
(NULL, 710, 'Frances Ha', 'Frances Ha', 'Estados Unidos', 'Comédia dramática', 'Noah Baumbach', '15428833135bf687f1798bc.jpg', 86, 2013, 'hZWdYn7ZQFM', 'Noah Baumbach, Peter Bogdanovich', 'Frances (Greta Gerwig) divide um apartamento em Nova York com Sophie (Mickey Sumner), sua melhor amiga. Brincalhona e com ar de quem não deseja crescer, ela recusa o convite do namorado para que more com ele justamente para não deixar Sophie sozinha. Entretanto, a amiga não toma a mesma atitude quando surge a oportunidade de se mudar para um apartamento melhor localizado, mesmo que isto signifique que ela e Frances passem a morar em locais diferentes. A partir de então tem início a peregrinação de Frances em busca de um novo lugar que se adeque às suas finanças, já que ela é apenas aluna em uma companhia de dança à espera de uma chance de integrar o grupo de bailarinos que encenará o espetáculo de Natal. Mesmo diante das dificuldades, Frances tenta manter o alto astral diante os problemas que a vida adulta traz.', 0, 'raissa', NULL, NULL),
(NULL, 711, 'Homens, Mulheres e Filhos', 'Men, Women & Children', 'Estados Unidos', 'Drama', 'Jason Reitman', '15428836385bf68936ce4a3.jpg', 119, 2014, 'IdQ7o0vbm1E', 'Ansel Elgort, Adam Sandler, Jennifer Garner, Rosemarie DeWitt, Judy Greer', 'Adultos, adolescentes e crianças amam, sofrem, se relacionam e compartilham tudo, sempre conectados. A internet é onipresente e, nesta grande rede em que o mundo se transformou, as ideias de sociedade e interação social ganham um novo significado. Algumas situações como um casal que não tem intimidade; uma garota que quer ser uma anoréxica melhor; um adolescente que vive em num mundo de pornografia virtual, fazem o expectador repensar a relações humanas.', 0, 'helena', NULL, NULL),
(NULL, 712, 'Vida Fácil', 'Easy Living', 'Estados Unidos', 'Drama', 'Adam Keleman ', '15428844495bf68c6170471.jpg', 80, 2017, '-4mTeCBdDCI', 'Caroline Dhavernas, McCaleb Burnett, Elizabeth Marvel, Charlie Hofheimer', 'Sherry (Caroline Dhavernas) é uma vendedora de maquiagem autodestrutiva, que vive de acordo com as suas regras. De dia vende maquiagem e de noite fica com homens em bares. Muitas vezes ela lê livros de auto-ajuda e assiste filmes em preto e branco para escapar do meio suburbano onde vive. Distanciada da família, ela recebe um ultimato da sua irmã e decide tentar abrir um salão de beleza com sua melhor amiga, Danny (Jen Richards). Quando seus planos amorosos e profissionais começam a dar errado ela decide então assumir o controle da sua vida.', 0, 'helena', NULL, NULL),
(NULL, 713, 'O Insulto', 'L\' Insulte', 'França', 'Drama', 'Ziad Doueiri', '15428846765bf68d446dd9f.jpg', 109, 2018, 'iOO3-bjyyx4', NULL, 'Beirute. Toni (Adel Karam) é um cristão libanês que sempre rega as plantas de sua varanda e um dia, acidentalmente, acaba molhando Yasser (Kamel El Basha), um refugiado palestino. Assim começa um intenso desacordo que evolui para julgamento com ampla cobertura midiática e toma dimensão nacional.', 0, 'raissa', NULL, NULL),
(NULL, 714, 'Jackie', 'Jackie', 'Estados Unidos', 'Biografia', 'Pablo Larraín', '15428846805bf68d488782b.png', 100, 2016, 'faIzAaZU8aA', 'Natalie Portman, Peter Sarsgaard, Greta Gerwig, Billy Crudup', 'Jacqueline Kennedy (Natalie Portman), inesperadamente viúva, lida com o trauma nos quatro dias posteriores ao assassinato de seu marido, o então presidente dos Estados Unidos John F. Kennedy.', 0, 'helena', NULL, NULL),
(NULL, 715, 'Troca de Rainhas', 'L\'Echange des Princesses', 'França', 'Drama', 'Marc Dugain', '15428848825bf68e12142ff.jpg', 100, 2018, '0V5dJJJo87I', NULL, 'Em 1721, para manter a paz entre França e Espanha após anos de guerra, o Regente do Reino da França, Philippe d\'Orléans (Olivier Gourmet), propõe uma troca de princesas que resulta no noivado do rei da França, Louis XV (Igor van Dessel), de 11 anos, com Anna Maria Victoria (Juliane Lepoureau), de 4 anos; e do príncipe herdeiro Louis, de 11 anos, com Louise-Elisabeth d\'Orleans (Anamaria Vartolomei), de 12 anos. Porém, a chegada dessas jovens princesas pode comprometer os jogos de poder na Corte.', 0, 'helena', NULL, NULL),
(NULL, 716, 'Tudo por um Popstar', 'Tudo por um Popstar', 'Brasil', 'Comédia', 'Bruno Garotti', '15428851495bf68f1dc2405.jpg', 115, 2018, '-tOHDkuqYvU', NULL, 'A banda pop Slavabody Disco Disco Boys, febre entre as meninas de todo o Brasil, anuncia que irá tocar no Rio de Janeiro. Fãs de carteirinha do grupo, as adolescentes e melhores amigas Gabi (Maísa Silva), Manu (Klara Castanho) e Ritinha (Mel Maia) farão de tudo para que seus pais deixem que elas assistam ao show do grupo longe da cidade onde moram.', 0, 'helena', NULL, NULL),
(NULL, 717, 'Branquinha', 'White Girl', 'Estados Unidos', 'Drama', ' Morgan Saylor', '15428851565bf68f2484f1e.jpg', 88, 2017, '7dzrDvaHGEA', 'Ranya Lee, Kin-Ping Leung, Michael Ning, Joe Odagiri', 'Verão, Cidade de Nova York. Uma estudante universitária faz de tudo para conseguir tirar seu namorado traficante da prisão.', 0, 'raissa', NULL, NULL),
(NULL, 718, 'O Doador de Memórias ', 'The Giver', 'Estados Unidos', 'Ficção Científica', 'Phillip Noyce', '15428853295bf68fd1c900c.jpg', 97, 2014, 'heQvHKNZgLA', 'Jeff Bridges, Meryl Streep, Brenton Thwaites, Alexander Skarsgård', 'Uma pequena comunidade vive em um mundo aparentemente ideal, sem doenças nem guerras, mas também sem sentimentos. Uma pessoa é encarregada a armazenar estas memórias, de forma a poupar os demais habitantes do sofrimento e também guiá-los com sua sabedoria. De tempos em tempos esta tarefa muda de mãos e agora cabe ao jovem Jonas (Brenton Thwaites), que precisa passar por um duro treinamento para provar que é digno da responsabilidade.', 0, 'helena', NULL, NULL),
(NULL, 719, 'À Espera de um Milagre', 'The Green Mile', 'Estados Unidos', 'Fantasia', 'Frank Darabont', '15428862545bf6936e18b44.jpg', 189, 1999, 'EIc_wJtm6AU', 'Tom Hanks, David Morse, Bonnie Hunt, Michael Clarke Duncan', '1935, no corredor da morte de uma prisão sulista. Paul Edgecomb (Tom Hanks) é o chefe de guarda da prisão, que temJohn Coffey (Michael Clarke Duncan) como um de seus prisioneiros. Aos poucos, desenvolve-se entre eles uma relação incomum, baseada na descoberta de que o prisioneiro possui um dom mágico que é, ao mesmo tempo, misterioso e milagroso.', 0, 'helena', NULL, NULL),
(NULL, 720, 'Vingança', 'Revenge', 'França', 'Suspense', 'Coralie Fargeat', '15428863495bf693cda450c.jpg', 113, 2018, '', 'Jon MacIntyre, Meghan Hemingway, Hans Potter, Mike Li', 'Três homens casados e ricos fazem anualmente uma espécie de caçada no deserto. Desta vez, um dos empresários decide trazer sua amante (Matilda Lutz). Quando ela é abandonada para morrer devido a uma série de acontecimentos, eles terão que lidar com as consequências de uma mulher que busca vingança.', 0, 'raissa', NULL, NULL),
(NULL, 721, 'Homens de Honra', 'Men of Honor', 'Estados Unidos', 'Drama', 'George Tillman Jr.', '15428864425bf6942a794fa.jpg', 129, 2000, 'Zs0u3LNLhGc', 'Robert De Niro, Cuba Gooding Jr., Charlize Theron, Aunjanue Ellis', 'Carl Brashear (Cuba Gooding Jr.) veio de uma humilde família negra, que vivia em uma área rural em Sonora, Kentucky. Ainda garoto, no início dos anos 40, já adorava mergulhar, sendo que quando jovem se alistou na Marinha esperando se tornar um mergulhador. Inicialmente Carl trabalha como cozinheiro que era uma das poucas tarefas permitidas a um negro na época. Quando resolve mergulhar no mar em uma sexta-feira acaba sendo preso, pois os negros só podiam nadar na terça-feira, mas sua rapidez ao nadar é vista por todos e assim se torna um \"nadador de resgate\", por iniciativa do capitão Pullman (Powers Boothe). Quando Brashear solicita a escola de mergulhadores encontra o comandante Billy Sunday (Robert De Niro), um instrutor de mergulho áspero e tirânico que tem absoluto poder sobre suas decisões. No princípio Sunday faz muito pouco para encorajar as ambições de Brashear e o aspirante a mergulhador descobre que o racismo no exército é um fato quando os outros aspirantes brancos - exceto Snowhill (Michael Rapaport), que por isto foi perseguido por Sunday - se negam a compartilhar um alojamento com um negro. Mas a coragem e determinação de Brashear impressionam Sunday e os dois se tornam amigos quando Brashear tem de lutar contra o preconceito e a burocracia militar, que quer acabar com seus sonhos de se tornar comandante e reformá-lo.', 0, 'helena', NULL, NULL),
(NULL, 722, 'O Resgate do Soldado Ryan ', 'Saving Private Ryan', 'Estados Unidos', 'Guerra', 'Steven Spielberg', '15428870665bf6969a073b3.jpg', 169, 1998, 'S7Wnyl-lbeU', 'Tom Hanks, Tom Sizemore, Edward Burns, Barry Pepper', 'Ao desembarcar na Normandia, no dia 6 de junho de 1944, capitão Miller (Tom Hanks) recebe a missão de comandar um grupo do segundo batalhão para o resgate do soldado James Ryan, caçula de quatro irmãos, dentre os quais três morreram em combate. Por ordens do chefe George C. Marshall, eles precisam procurar o soldado e garantir o seu retorno, com vida, para casa.', 0, 'helena', NULL, NULL),
(NULL, 723, 'À Procura da Felicidade', 'The Pursuit of Happyness', 'Estados Unidos', 'Biografia', 'Gabriele Muccino', '15428889555bf69dfb1b0ac.jpg', 117, 2006, 'oZa9eX2mr6M', 'Will Smith, Jaden Smith, Thandie Newton, Brian Howe', 'Chris Gardner (Will Smith) é um pai de família que enfrenta sérios problemas financeiros. Apesar de todas as tentativas em manter a família unida, Linda (Thandie Newton), sua esposa, decide partir. Chris agora é pai solteiro e precisa cuidar de Christopher (Jaden Smith), seu filho de apenas 5 anos. Ele tenta usar sua habilidade como vendedor para conseguir um emprego melhor, que lhe dê um salário mais digno. Chris consegue uma vaga de estagiário numa importante corretora de ações, mas não recebe salário pelos serviços prestados. Sua esperança é que, ao fim do programa de estágio, ele seja contratado e assim tenha um futuro promissor na empresa. Porém seus problemas financeiros não podem esperar que isto aconteça, o que faz com que sejam despejados. Chris e Christopher passam a dormir em abrigos, estações de trem, banheiros e onde quer que consigam um refúgio à noite, mantendo a esperança de que dias melhores virão.', 0, 'helena', NULL, NULL),
(NULL, 724, 'Yonlu', 'Yonlu', 'Brasil', 'Drama', 'Hique Montanari', '15428890945bf69e86a192c.jpg', 80, 2017, '9Y5carRWlF4', 'Leonardo Machado, Thalles Cabral, Nélson Diniz, Mirna Spritzer', 'Vinícius Gageiro (Thalles Cabral), mais conhecido como Yonlu, é um jovem poeta, músico e desenhista, fluente em quatro idiomas. Apesar de talentoso, ele decidiu dar fim à sua vida depois de ingressar em uma comunidade virtual de assistência para potenciais suicidas.', 0, 'raissa', NULL, NULL),
(NULL, 725, 'Vida', 'Life', 'Estados Unidos', 'Ficção Científica', 'Daniel Espinosa', '15428893505bf69f8646f2c.jpg', 104, 2017, 'yFp6h2iLhM8', 'Hiroyuki Sanada, Ryan Reynolds, Rebecca Ferguson, Jake Gyllenhaal', 'Seis astronautas de diferentes nacionalidades estão em uma estação espacial, cujo objetivo maior é estudar amostras coletadas no solo de Marte por um satélite. Dentre elas está um ser unicelular, despertado por Hugh Derry (Ariyon Bakare) através dos equipamentos da própria estação espacial. Tal descoberta é intensamente celebrada por ser a primeira forma de vida encontrada fora da Terra, sendo que um concurso mundial elege seu nome: Calvin. Só que, surpreendentemente, este ser se desenvolve de forma bastante rápida, ganhando novas células e uma capacidade inimaginável.', 0, 'raissa', NULL, NULL),
(NULL, 726, 'Uma Linda Mulher', 'Pretty Woman', 'Estados Unidos', 'Comédia', 'Garry Marshall', '15428896165bf6a0901c132.jpg', 119, 1990, 'Wzii8IuL8lk', 'Richard Gere, Julia Roberts, Ralph Bellamy, Jason Alexander', 'Magnata perdido (Richard Gere) pede ajuda uma prostituta (Julia Roberts) que \"trabalha\" no Hollywood Boulevard e acaba contratando-a por uma semana. Neste período ela se transforma em uma elegante jovem para poder acompanhá-lo em seus compromissos sociais, mas os dois começam a se envolver e a relação patrão/empregado se modifica para um relacionamento entre homem e mulher', 0, 'raissa', NULL, NULL),
(NULL, 727, 'O Rei Leão', 'The Lion King', 'Estados Unidos', 'Animação', 'Roger Allers', '15429028705bf6d4569cf31.jpg', 88, 1994, 'rHiHRhbTv-Q', 'Rowan Atkinson, Matthew Broderick, Niketa Calame-Harris, Jim Cummings', 'Mufasa (voz de James Earl Jones), o Rei Leão, e a rainha Sarabi (voz de Madge Sinclair) apresentam ao reino o herdeiro do trono, Simba (voz de Matthew Broderick). O recém-nascido recebe a bênção do sábio babuíno Rafiki (voz de Robert Guillaume), mas ao crescer é envolvido nas artimanhas de seu tio Scar (voz de Jeremy Irons), o invejoso e maquiavélico irmão de Mufasa, que planeja livrar-se do sobrinho e herdar o trono.', 0, 'matheus', NULL, NULL),
(NULL, 728, 'O Rei Leão 2: O Reino de Simba', 'The Lion King 2: Simba', 'Estados Unidos', 'Animação', 'Darrell Rooney', '15429031155bf6d54bc9cbe.jpg', 81, 1998, 'rHiHRhbTv-Q', NULL, 'Kiara (Neve Campbell) é a filhote de Simba (Matthew Broderick) e Nala (Moira Kelly). A pequena leoa tem um espírito livre e aventureiro. Um dia, ela resolve passear para além dos limites do território de seu pai e encontra os descendentes do maléfico Scar. Um dos descendentes do algoz de Mufasa (James Earl Jones) é Kovu (Jason Marsden), que se torna um grande amigo de Kiara. Entretanto, o amor entre os dois leõezinhos irá reacender uma rivalidade histórica.', 0, 'matheus', NULL, NULL),
(NULL, 729, 'O Rei Leão 3 - Hakuna Matata', 'The Lion King 1 1/2', 'Estados Unidos', 'Animação', 'Bradley Raymond', '15429035405bf6d6f4942a4.jpg', 77, 2004, 'kayvB03Cu1E', 'Nathan Lane, Ernie Sabella, Julie Kavner, Jerry Stiller', 'Timão e Pumba começam a assistir o primeiro filme do Rei Leão, e Timão fica insistindo para que Pumba avance até a parte em que eles aparecem, porque eles não estão no início do filme. A partir daí, Pumba resolve contar um pouco da história dos dois, que começa antes da jornada de Simba. Contam sobre a mãe de Timão e sobre o Tio Max, descobrem porque Timão deixou a colônia, e onde ele aprendeu o Hakuna Matata. Também relatam como os dois se conheceram, e os perigos que enfrentaram enquanto procuravam pelo lar dos sonhos.', 0, 'matheus', NULL, NULL),
(NULL, 730, 'O Chamado', 'The Ring', 'Estados Unidos', 'Terror', 'Gore Verbinski', '15429633275bf7c07fe7639.jpg', 115, 2002, '8oiHy_yoJHQ', 'Naomi Watts, Martin Henderson, David Dorfman, Brian Cox', 'Rachel Keller (Naomi Watts) é uma jornalista que decide investigar a misteriosa morte de sua sobrinha. Ela percebe a relação da morte dela e de várias outras mortes com um estranho vídeo, que faz com que todas as pessoas que o assistam morram exatamente sete dias depois. Intrigada com a história, ela agora precisa descobrir um meio que impeça que a profecia se realize, já que ela e seu filho assistiram ao vídeo.', 0, 'iris', NULL, NULL),
(NULL, 731, 'O Bebê de Rosemary', 'Rosemary', 'Estados Unidos', 'Terror', 'Roman Polanski', '15429634785bf7c1166b265.jpg', 137, 1968, 'MUw6HBQ8DC0', NULL, 'Um jovem casal, Rosemarey (Mia Farrow) e Guy Woodhouse (John Cassavetes), se muda para um prédio habitado por estranhas pessoas, onde coisas bizarras acontecem. Quando ela engravida, passa a ter estranhas alucinações e vê o seu marido se envolver com os vizinhos, uma seita de bruxas que quer que ela dê luz ao Filho das Trevas.', 0, 'iris', NULL, NULL),
(NULL, 732, 'Excelentíssimos', 'Excelentíssimos', 'Brasil', 'Documentário', 'Douglas Duarte', '15429638545bf7c28eb7175.png', 152, 2018, 'eQG-UYZcwE4', NULL, 'Retrato da democracia brasileira em um momento frágil de polarização política no Congresso Nacional, acompanhada durante quatro meses por uma equipe de filmagem. Processos que permitem cerca de 600 pessoas influenciar nas decisões do país, legisladores corruptos que se transformam em delatores, uma presidente que defende seu mandato com um pedaço de papel e falcões que traçam sua subida ao poder enquanto multidões cantam e protestam.', 0, 'iris', NULL, NULL),
(NULL, 733, 'Filme Paisagem - Um Olhar Sobre Roberto Burle Mar', 'Filme Paisagem - Um Olhar Sobre Roberto Burle Mar', 'Brasil', 'Documentário', 'João Vargas Penha', '15429640245bf7c33897a26.jpg', 72, 2018, 'c_-fxQSF7IM', NULL, 'Passeando pela arte e personalidade do paisagista, pintor e escultor brasileiro Roberto Burle Marx, o documentário apresenta suas ideias em forma de homenagem, com uma sucessão de paisagens sensoriais.', 0, 'iris', NULL, NULL),
(NULL, 734, 'A Última Abolição', 'A Última Abolição', 'Brasil', 'Documentário', 'Alice Gomes', '15429641835bf7c3d7d75b0.jpg', 82, 2018, '-7fdE487idk', NULL, 'Uma retrospetiva detalhada de um momento emblemático da história do Brasil, a abolição da escravidão, apresentado de uma outra perspectiva. Ao contrário do que foi pregado por livros didáticos e outras vertentes da história oficial por muito tempo, não foi meramente a assinatura da Princesa Isabel na Lei Áurea em 13 de maio de 1888 que libertou os escravos, e tampouco tal liberdade foi um presente ou um passo na direção da mitológica democracia racial.', 0, 'iris', NULL, NULL),
(NULL, 735, 'Joana D\'Arc', 'Joan of Arc', 'Canadá', 'Drama', 'Christian Duguay', '15429647435bf7c60741657.jpg', 180, 1999, 'Rf0N1O56CnM', 'Leelee Sobieski, Chad Willett, Peter O\'Toole, Neil Patrick Harris', 'Um dia, a jovem Joana começa a ouvir vozes divinas, encorajando-a a integrar a guerra francesa comandada pelo Rei Charles. À medida que sua fama e seu poder de liderança aumentam, as especulações aumentam sobre a origem da garota e sua legitimidade em comandar uma guerra. Quando as ações em Paris fracassam e levam à morte do irmão de Joana, ela é capturada e vendida aos ingleses, sendo considerada uma herege.', 0, 'iris', NULL, NULL),
(NULL, 736, 'Super 8', 'Super 8', 'Estados Unidos', 'Ficção Científica', 'J.J. Abrams', '15429649195bf7c6b72d713.jpg', 112, 2011, 't-0XuYxh67w', 'Joel Courtney, Jessica Tuck, Joel McKinnon Miller, Ryan Lee', 'No verão de 1979, em Ohio, um grupo de jovens testemunha uma catastrófica colisão que envolve um trem de carga e uma caminhonete. Eles registram tudo com uma câmera Super-8 com a qual estavam tentando fazer um filme. Quando misteriosos desaparecimentos começam a acontecer, os amigos descobrem que a tragédia não foi um acidente.', 0, 'iris', NULL, NULL),
(NULL, 737, 'Terra Para Echo', 'Earth to Echo', 'Estados Unidos', 'Ficção Científica', 'Dave Green', '15429650845bf7c75c10ce6.jpg', 91, 2014, 'TvyozLFc2Sc', 'Teo Halm, Astro, Reese Hartwig, Ella Wahlestedt', 'Um dia, os amigos Tuck, Munch e Alex começam a receber mensagens estranhas em seus telefones celulares. Eles suspeitam que a nova construção no bairro esteja relacionada com essas frases codificadas, mas os pais e as autoridades locais não prestam atenção nos garotos. Pesquisando sozinhos, eles descobrem que existe um ser alienígena tentando se comunicar com eles, e precisando urgentemente de ajuda.', 0, 'iris', NULL, NULL),
(NULL, 738, 'Tempestade: Planeta em Fúria', 'Geostorm', 'Estados Unidos', 'Ficção Científica', 'Dean Devlin', '15429653405bf7c85c08dd9.jpg', 109, 2017, 'v=lNAC9wVUaqY', 'Gerard Butler, Jim Sturgess, Abbie Cornish, Alexandra Maria Lara', 'Um dia, os amigos Tuck, Munch e Alex começam a receber mensagens estranhas em seus telefones celulares. Eles suspeitam que a nova construção no bairro esteja relacionada com essas frases codificadas, mas os pais e as autoridades locais não prestam atenção nos garotos. Pesquisando sozinhos, eles descobrem que existe um ser alienígena tentando se comunicar com eles, e precisando urgentemente de ajuda.', 0, 'iris', NULL, NULL),
(NULL, 739, 'Terremoto: A Falha de San Andreas', 'San Andreas', 'Estados Unidos', 'Ação', 'Brad Peyton', '15429655175bf7c90d3f084.jpg', 114, 2015, 'r-XhAVvfrvM', 'Dwayne Johnson, Carla Gugino, Alexandra Daddario, Ioan Gruffudd', 'Um forte terremoto atinge a Califórnia e faz com que Ray (Dwayne Johnson), um bombeiro especializado em resgates com helicópteros, tenha que percorrer o estado ao lado da ex-esposa (Carla Gugino) para resgatar a sua filha Blake (Alexandra Daddario).', 0, 'iris', NULL, NULL),
(NULL, 740, 'O Que Esperar Quando Você Está Esperando', 'What to Expect When You’re Expecting', 'Estados Unidos', 'Comédia', 'Kirk Jones', '15429668015bf7ce11904ed.jpg', 110, 2012, '7q_RAzlXeNQ', NULL, 'Holly (Jennifer Lopez) é uma fotógrafa casada com Alex (Rodrigo Santoro) e quer muito adotar uma criança. Ele concorda com a ideia, mas a proximidade de receber o bebê faz com que tenha dúvidas se está preparado para a tarefa de ser pai.', 0, 'iris', NULL, NULL),
(NULL, 741, 'A Última Música', 'The Last Song', 'Estados Unidos', 'Romance', 'Julie Anne Robinson', '15429669925bf7ced054ef2.jpg', 107, 2010, 'tlQpJAcNzJg', 'Miley Cyrus, Greg Kinnear, Bobby Coleman, Liam Hemsworth', 'A adolescente Ronnie não fica nada satisfeita quando a mãe decide enviá-la a uma cidade litorânea para passar o verão com o pai, que não vê há anos. Enquanto o pai tenta usar o amor que os dois compartilham pela música para se reconectar com a filha, Ronnie se apaixona por um bonitão local.', 0, 'iris', NULL, NULL),
(NULL, 742, 'Marley & Eu', 'Marley & Me', 'Estados Unidos', 'Comédia romântica', 'David Frankel', '15429672875bf7cff7dbc20.jpg', 144, 2008, '22NkKx6_MWw', 'Owen Wilson, Jennifer Aniston, Eric Dane, Kathleen Turner', 'Os recém-casados John e Jenny Grogan se mudam de Michigan para a Flórida, onde eles compram sua primeira casa e encontram trabalhos em competitivos jornais. Mais tarde, o casal adota Marley, um adorável filhote de labrador amarelo. Marley cresce rapidamente e se torna bastante travesso. Ainda assim, mesmo enquanto ele está destruindo a mobília e não obedece, ele sempre consegue alegrar John, Jenny e sua crescente família.', 0, 'iris', NULL, NULL),
(NULL, 743, 'Jumanji: Bem-Vindo à Selva', 'Jumanji: Welcome to the Jungle', 'Estados Unidos', 'Comédia', 'Jake Kasdan', '15429674705bf7d0ae112fa.jpg', 119, 2017, 'y0oqJGwi42M', 'Dwayne Johnson, Kevin Hart, Jack Black, Karen Gillan', 'Quatro adolescentes encontram um videogame cuja ação se passa em uma floresta tropical. Empolgados com o jogo, eles escolhem seus avatares para o desafio, mas um evento inesperado faz com que eles sejam transportados para dentro do universo fictício, transformando-os nos personagens da aventura.', 0, 'iris', NULL, NULL),
(NULL, 745, 'O Poderoso Chefão', 'The Godfather', 'Estados Unidos', 'Crime, Drama, Neo Noir', 'Francis Ford Coppola', '15429692535bf7d7a5e29f5.jpg', 175, 1972, 'sY1S34973zA', 'Marlon Brando, Al Pacino, James Caan, Richard S. Castellano', 'A saga conta a história de uma família mafiosa que luta para estabelecer sua supremacia na América depois da Segunda Guerra. Uma tentativa de assassinato deixa Vito Corleone incapacitado e força os filhos Michael e Sonny a assumirem os negócios.', 0, 'matheus', NULL, NULL),
(NULL, 746, 'Matrix', 'Matrix', 'Canada', 'Ficção Científica', 'Irmãs Wachowski', '15429948275bf83b8b59d43.jpg', 135, 1999, '2KnZac176Hs', 'Keanu Reeves, Laurence Fishburne, Carrie-Anne Moss, Hugo Weaving', 'Em um futuro próximo, Thomas Anderson (Keanu Reeves), um jovem programador de computador que mora em um cubículo escuro, é atormentado por estranhos pesadelos nos quais encontra-se conectado por cabos e contra sua vontade, em um imenso sistema de computadores do futuro. Em todas essas ocasiões, acorda gritando no exato momento em que os eletrodos estão para penetrar em seu cérebro. À medida que o sonho se repete, Anderson começa a ter dúvidas sobre a realidade. Por meio do encontro com os misteriosos Morpheus (Laurence Fishburne) e Trinity (Carrie-Anne Moss), Thomas descobre que é, assim como outras pessoas, vítima do Matrix, um sistema inteligente e artificial que manipula a mente das pessoas, criando a ilusão de um mundo real enquanto usa os cérebros e corpos dos indivíduos para produzir energia. Morpheus, entretanto, está convencido de que Thomas é Neo, o aguardado messias capaz de enfrentar o Matrix e conduzir as pessoas de volta à realidade e à liberdade.', 0, 'matheus', NULL, NULL),
(NULL, 747, 'Matrix Reloaded', 'The Matrix Reloaded', 'Estados Unidos', 'Ficção Científica', 'Irmãs Wachowski', '15429950755bf83c83237c9.jpg', 138, 2003, 'xkupR3NQWGA', 'Ray Anthony, Christine Anu, Andy Arness, Alima Ashton-Sheibu', 'Após derrotar as máquinas em seu combate inicial, Neo (Keanu Reeves) ainda vive na Nabuconodosor ao lado de Morpheus (Laurence Fishburne), Trinity (Carrie-Anne Moss) e Link (Harold Perrineau Jr.), o novo tripulante da nave. As máquinas estão realizando uma grande ofensiva contra Zion, onde 250 mil máquinas estão escavando rumo à cidade e podem alcançá-la em poucos dias. A Nabucodonosor é convocada para retornar a Zion, para participar da reunião que definirá o contra-ataque humano às máquinas. Entretanto, um recado enviado pelo Oráculo (Gloria Foster) faz com que a nave parta novamente, levando Neo de volta à matrix. Lá ele descobre que precisa encontrar o Chaveiro (Randall Duk Kim), um ser que possui a chave para todos os caminhos da matrix e que é mantido como prisioneiro por Merovingian (Lambert Wilson) e sua esposa, Persephone (Monica Bellucci).', 0, 'matheus', NULL, NULL),
(NULL, 748, 'Matrix Revolutions', 'The Matrix Revolutions', 'Estados Unidos', 'Ficção Científica', 'Irmãs Wachowski', '15429953265bf83d7ef047f.jpg', 129, 2003, 'hMbexEPAOQI', 'Mary Alice, Tanveer K. Atwal, Helmut Bakaitis, Kate Beahan', 'Após enfrentar os sentinelas no mundo real, Neo (Keanu Reeves) tem sua mente presa em um local que fica entre a Matrix e a realidade, do qual apenas poderá sair com a ajuda de Trainman (Bruce Spence). Após perceberem que as ondas cerebrais de Neo são idênticas as de uma pessoa conectada à Matrix, Trinity (Carrie-Anne Moss) e Morpheus (Laurence Fishburne) buscam a ajuda da Oráculo (Mary Alice) e Seraph (Sing Ngai). Trinity, Morpheus e Seraph vão em busca de Merovingian (Lambert Wilson), que possui controle sobre Trainman e pode libertar Neo. Após obterem sucesso no resgate, o trio se divide em duas missões: enquanto Morpheus e a tripulação de duas naves parte rumo a Zion, na tentativa de ajudar no combate contra as máquinas, Neo e Trinity se dirigem à cidadela das máquinas.', 0, 'matheus', NULL, NULL),
(NULL, 749, 'O Senhor dos Anéis: As Duas Torres', 'The Lord of the Rings: The Two Towers', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15429959455bf83fe945589.jpg', 179, 2002, 'LbfMDwc4azU', 'Bruce Allpress, Sean Astin, John Bach, Sala Baker', 'Após a captura de Merry (Dominic Monaghan) e Pippy (Billy Boyd) pelos orcs, a Sociedade do Anel é dissolvida. Enquanto que Frodo (Elijah Wood) e Sam (Sean Astin) seguem sua jornada rumo à Montanha da Perdição para destruir o Um Anel, Aragorn (Viggo Mortensen), Legolas (Orlando Bloom) e Gimli (John Rhys-Davies) partem para resgatar os hobbits sequestrados.', 0, 'matheus', NULL, NULL),
(NULL, 750, '2001: Uma Odisseia no Espaço', '2001: A Space Odyssey', 'Estados Unidos', 'Ficção Científica', 'Stanley Kubrick', '15430002285bf850a4c29ee.jpg', 149, 1968, '7E9CD3Hucws', 'Keir Dullea, Gary Lockwood, William Sylvester, Daniel Richter', 'Uma estrutura imponente preta fornece uma conexão entre o passado e o futuro nesta adaptação enigmática de um conto reverenciado de ficção científica do autor Arthur C. Clarke. Quando o Dr. Dave Bowman e outros astronautas são enviados para uma misteriosa missão, os chips de seus computadores começam a mostrar um comportamento estranho, levando a um tenso confronto entre homem e máquina que resulta em uma viagem alucinante no espaço e no tempo.', 0, 'carvalho', NULL, NULL),
(NULL, 751, 'Laranja Mecânica', 'A Clockwork Orange', 'Estados Unidos', 'Crime', 'Stanley Kubrick', '15430007325bf8529c554b6.jpg', 136, 1971, 'eRerbaI9axY', 'Malcolm McDowell, Patrick Magee, Michael Bates, Warren Clarke', 'No futuro, o violento Alex (Malcolm McDowell), líder de uma gangue de delinquentes que matam, roubam e estupram, cai nas mãos da polícia. Preso, ele recebe a opção de participar em um programa que pode reduzir o seu tempo na cadeia. Alex vira cobaia de experimentos destinados a refrear os impulsos destrutivos do ser humano, mas acaba se tornando impotente para lidar com a violência que o cerca.', 0, 'carvalho', NULL, NULL),
(NULL, 754, '1984', '1984', 'Reino Unido', 'Drama', 'Michael Radford', '15430019325bf8574c267fb.jpg', 113, 1984, 'Z4rBDUJTnNU', 'John Hurt, Richard Burton, Suzanna Hamilton, Cyril Cusack', 'Depois da guerra atômica, o mundo foi dividido em três estados e Londres é a capital da Oceania, dominada por um partido que tem total controle sobre todos os cidadãos. Winston Smith é um humilde funcionário do partido e comete o atrevimento de se apaixonar por Julia, numa sociedade totalitária onde as emoções são consideradas ilegais. Eles tentam escapar dos olhos e dos ouvidos do Grande Irmão, sabendo das dificuldades que teriam que enfrentar.', 0, 'carvalho', 1, NULL),
(NULL, 756, 'O Rei Leão', 'The Lion King', 'Estados Unidos', 'Aventura', 'Jon Favreau', '15430649465bf94d7256d9c.jpg', 0, 2019, '7cj1SGaeYMY', 'Donald Glover, Beyoncé, Chiwetel Ejiofor, James Earl Jones, Seth Rogen, Billy Eichner, Alfre Woodard, John Oliver', 'Simba (Donald Glover) é um jovem leão cujo destino é se tornar o rei da selva. Tudo corre bem, até que uma grande tragédia atinge sua vida mudando sua trajetória para sempre. A sinopse oficial ainda não foi divulgada.', 0, 'nadalini', NULL, NULL),
(NULL, 757, 'Toy Story 4', 'Toy Story 4', 'Estados Unidos', 'Animação', 'Josh Cooley', '15430656285bf9501cc7b52.png', 0, 2019, 'vyuMIQXkI2A', 'Tom Hanks, Annie Potts, Patricia Arquette, Michael Keaton', 'Woody, Buzz, Jesse e toda a turma vivem felizes, agora como brinquedos da pequena Bonnie. Entretanto, a chegada de um garfo transformado em brinquedo, Forky, faz com que a calmaria reinante chegue ao fim, justamente porque ele não se aceita como brinquedo.', 0, 'nadalini', NULL, NULL),
(NULL, 758, 'Plano de Voo', 'Flightplan', 'Estados Unidos', 'Suspense', 'Robert Schwentke', '15432231565bfbb774d5b1c.jpg', 98, 2005, 'OHukIo3qVy4', 'Jodie Foster, Peter Sarsgaard, Sean Bean, Kate Beahan', 'Kyle Pratt (Jodie Foster) é uma mulher devastada emocionalmente, devido à recente morte súbita de seu marido. Em meio a uma viagem de Berlim a Nova York, estando a mais de 40 mil pés de atitude e a bordo de um moderno avião, Kyle entra em pânico após perceber o desaparecimento de sua filha de 6 anos, Julia (Marlene Lawston). Desesperada, Kyle precisa provar à tripulação e aos passageiros sua sanidade, já que não há pista alguma sobre o paradeiro de Julia, e ao mesmo tempo convencer a si mesmo que não está enlouquecendo.', 0, 'matheus', NULL, NULL),
(NULL, 760, 'Crônicas de Natal', 'The Christmas Chronicles', 'Estados Unidos', 'Comédia', 'Clay Kaytis', '15432472285bfc157cdec5a.jpg', 100, 2018, 'gvjXat2pySE', 'Kurt Russell, Judah Lewis, Kimberly Williams-Paisley, Oliver Hudson, Darby Camp', 'O presente de natal das crianças ao redor do mundo está em risco. Isso porque os irmãos Kate (Darby Camp) e Teddy Pierce (Judah Lewis) fizeram suas travessuras. Empenhados em flagrar o exato momento da chegada do Papai Noel, os dois se acomodaram em seu trenó e, acidentalmente, danificaram o veículo. Agora eles precisam fazer uma uma força-tarefa para ajudar o bom velhinho a correr contra o tempo, entregar os presentes e salvar o Natal. ', 0, 'raissa', NULL, NULL),
(NULL, 761, 'S.O.S - Mulheres ao Mar', 'S.O.S - Mulheres ao Mar', 'Brasil', 'Comédia', 'Cris D', '15432473735bfc160d6745d.jpg', 96, 2014, 'M86Al02r6BI', NULL, 'Adriana (Giovanna Antonelli) não está em um bom momento. Ela não consegue que alguma editora publique seus livros e, para ganhar a vida, legenda filmes pornôs. Para piorar a situação, seu marido Eduardo (Marcello Airoldi) decide pedir o divórcio. Em meio à fossa da separação, ela descobre que Eduardo fará um cruzeiro ao lado da nova namorada, Beatriz (Emanuelle Araújo), uma estrela da TV. Incentivada pela irmã Luíza (Fabíula Nascimento), as duas decidem embarcar no mesmo cruzeiro para que Adriana tenha a chance de reconquistá-lo. A empregada Dialinda (Thalita Carauta), que tenta ajudar a patroa a todo custo, acaba também embarcando nesta aventura.', 0, 'helena', NULL, NULL),
(NULL, 762, 'Gostos e Cores', 'Les Goûts et Les Couleurs', 'França', 'Romance', 'Myriam Aziza', '15432476295bfc170d7da41.jpg', 95, 2018, 'Yx87SHR9oXc', NULL, 'Depois de um longo período de autodescoberta, a jovem judia Simone consegue reunir a coragem necessária para assumir a sua família conservadora que é homossexual. Quando arquiteta todo o plano para deixar seus pais preparados, ela se vê atraída por um homem pela primeira vez, e agora se pergunta sobre quais são suas reais perspectivas amorosas.', 0, 'raissa', NULL, NULL),
(NULL, 763, 'S.O.S - Mulheres ao Mar 2', 'S.O.S - Mulheres ao Mar 2', 'Brasil', 'Comédia', 'Cris D', '15432484395bfc1a377fae5.jpg', 94, 2015, '-4fE6M8Yr9I', NULL, 'Adriana (Giovanna Antonelli), agora uma escritora bem-sucedida, segue feliz em seu romance com André (Reynaldo Gianecchini), que está prestes a lançar sua mais nova coleção de moda durante um cruzeiro pelo Caribe. Porém, quando ela descobre que a bela ex-noiva do estilista irá acompanhá-lo em busca de uma reconciliação, Adriana convoca a irmã Luiza (Fabíula Nascimento) e Dialinda (Thalita Carauta) - sua ex-diarista que agora trabalha nos EUA - para uma nova aventura.', 0, 'helena', NULL, NULL),
(NULL, 764, 'A Autópsia de Jane Doe', 'The Autopsy of Jane Doe', 'Reino Unido', 'Terror', 'André Øvredal', '15432486955bfc1b370a58c.jpg', 86, 2016, 'IhRT923aGrM', 'Brian Cox, Emile Hirsch, Ophelia Lovibond, Michael McElhatton', 'Tommy Tilden (Brian Cox) e Austin Tilden (Emile Hirsch), seu filho, são os reponsáveis por comandar o necrotério de uma pequena cidade do interior dos Estados Unidos. Os trabalhos que recebem costumam ser muito tranquilos por causa da natureza pacata da cidade, mas, certo dia, o xerife local (Michael McElhatton) traz um caso complicado: uma mulher desconhecida foi encontrada morta nos arredores da cidade - \"Jane Doe\", no jargão americano. Conforme pai e filho tentam descobrir a identidade da mulher morta, coisas estranhas e perigosas começam a ocorrer, colocando a vida dos dois em perigo.', 0, 'helena', NULL, NULL),
(NULL, 765, 'Frida', 'Frida', 'Estados Unidos', 'Drama', 'Julie Taymor', '15432504475bfc220f387bc.jpg', 150, 2002, '-CTM7FcY1LE', 'Salma Hayek, Mía Maestro, Alfred Molina, Antonio Banderas', 'Frida Kahlo (Salma Hayek) foi um dos principais nomes da história artística do México. Conceituada e aclamada como pintora, ele teve um agitado casamento aberto com Diego Rivera (Alfred Molina), seu companheiro também nas artes, e ainda um controverso caso com o político Leon Trostky (Geoffrey Rush), além de várias outras mulheres.', 0, 'raissa', NULL, NULL),
(NULL, 766, 'Aladdin', 'Aladdin', 'Estados Unidos', 'Aventura', 'Guy Ritchie', '15432509465bfc2402b330f.jpg', 0, 2019, 'ek_ZnUNk99U', 'Naomi Scott, Mena Massoud, Will Smith, Billy Magnussen', 'Um jovem humilde descobre uma lâmpada mágica, com um gênio que pode lhe conceder desejos. Agora o rapaz quer conquistar a moça por quem se apaixonou, mas o que ele não sabe é que a jovem é uma princesa que está prestes a se noivar. Agora, com a ajuda do Gênio (Will Smith), ele tenta se passar por um príncipe e para conquistar o amor da moça e a confiança de seu pai. A sinopse oficial ainda não foi divulgada.', 0, 'raissa', NULL, NULL),
(NULL, 768, 'O Jogo de Geri', 'Geri', 'Estados Unidos', 'Curta-metragem, Animação', 'Jan Pinkava', '15432564455bfc397d392a0.jpg', 5, 1997, '', '', 'Um homem idoso está numa praça, jogando uma partida de xadrez contra ele mesmo. Geri move as peças brancas e pretas de um lado para outro. No decorrer do jogo, os dois lados do senhor tornam-se indivíduos únicos, jogadores diferentes: o lado branco é pensativo e o preto é agressivo. A disputa se encaminha para um fim quando o jogador branco faz um movimento inesperado, que pode transformar o resultado do embate.', 0, 'carvalho', NULL, NULL),
(NULL, 769, 'O Ataque do Zezé', 'Jack-Jack Attack', 'Estados Unidos', 'Curta-metragem, Animação, Comédia', 'Brad Bird', '15432762105bfc86b247612.jpeg', 5, 2005, '', 'Bret \'Brook\' Parker, Bud Luckey, Eli Fucile, Jason Lee', 'O bebê dos Pera parece ser normal, sem vestígios de qualquer super-poder. Mas quando ele fica sozinho com a babá, o bebê mostra o seu verdadeiro potencial.', 0, 'carvalho', NULL, NULL),
(NULL, 770, 'Luxo Jr.', 'Luxo Jr.', 'Estados Unidos', 'Curta-metragem, Animação', 'John Lasseter', '15432775085bfc8bc4d843e.jpeg', 2, 1986, '', '', 'A curta se passa em cima de uma de uma mesa de trabalho, e conta a história de um papai-luminária e do seu simpático filho chamado Luxo Jr.', 0, 'carvalho', NULL, NULL),
(NULL, 771, 'Click', 'Click', 'Estados Unidos', 'Drama', 'Frank Coraci', '15432781715bfc8e5bb0f95.jpeg', 107, 2006, 'Ciq6jg6LVyA', 'Adam Sandler, Kate Beckinsale, Christopher Walken, David Hasselhoff', 'Sandler interpreta um arquiteto com excesso de trabalho que negligência sua família. Quando ele adquire um controle remoto universal que lhe permite \"avançar\" através de partes desagradáveis ​​ou totalmente sem graça de sua vida, ele logo descobre que aqueles aparentemente maus bocados continham partes vitais de lições da vida.', 0, 'carvalho', NULL, NULL),
(NULL, 772, 'O Senhor dos Anéis: A Sociedade do Anel', 'The Lord of the Rings: The Fellowship of the Ring', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15433956315bfe592f205e7.jpg', 178, 2002, 'zIu2hTgqquw', NULL, 'Numa terra fantástica e única, chamada Terra-Média, um hobbit (seres de estatura entre 80 cm e 1,20 m, com pés peludos e bochechas um pouco avermelhadas) recebe de presente de seu tio o Um Anel, um anel mágico e maligno que precisa ser destruído antes que caia nas mãos do mal. Para isso o hobbit Frodo (Elijah Woods) terá um caminho árduo pela frente, onde encontrará perigo, medo e personagens bizarros. Ao seu lado para o cumprimento desta jornada aos poucos ele poderá contar com outros hobbits, um elfo, um anão, dois humanos e um mago, totalizando 9 pessoas que formarão a Sociedade do Anel.', 0, 'matheus', NULL, NULL),
(NULL, 773, 'O Senhor dos Anéis: O Retorno do Rei', 'The Lord of the Rings: The Return of the King', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15433958015bfe59d976009.jpg', 201, 2003, 'Q9wZCGjBxyU', 'Noel Appleby, Ali Astin, Sean Astin, David Aston', 'Sauron planeja um grande ataque a Minas Tirith, capital de Gondor, o que faz com que Gandalf (Ian McKellen) e Pippin (Billy Boyd) partam para o local na intenção de ajudar a resistência. Um exército é reunido por Theoden (Bernard Hill) em Rohan, em mais uma tentativa de deter as forças de Sauron. Enquanto isso Frodo (Elijah Wood), Sam (Sean Astin) e Gollum (Andy Serkins) seguem sua viagem rumo à Montanha da Perdição, para destruir o Um Anel.', 0, 'matheus', NULL, NULL),
(NULL, 774, 'O Hobbit - Uma Jornada Inesperada', 'The Hobbit: An Unexpected Journey', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15433959595bfe5a77b22f8.jpg', 169, 2012, '4AKkpnCKa2I', 'Ian McKellen, Martin Freeman, Richard Armitage, Ken Stott', 'Bilbo Bolseiro (Martin Freeman) vive uma vida pacata no condado, como a maioria dos hobbits. Um dia, aparece em sua porta o mago Gandalf, o cinzento (Ian McKellen), que lhe promete uma aventura como nunca antes vista. Na companhia de vários anões, Bilbo e Gandalf iniciam sua jornada inesperada pela Terra Média. Eles têm por objetivo libertar o reino de Erebor, conquistado há tempos pelo dragão Smaug e que antes pertencia aos anões. No meio do caminho encontram elfos, trolls e, é claro, a criatura Gollum (Andy Serkis) e seu precioso anel.', 0, 'matheus', NULL, NULL),
(NULL, 775, 'O Hobbit - A Desolação de Smaug', 'The Hobbit: The Desolation of Smaug', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15433961805bfe5b549d0da.jpg', 161, 2013, 'e9UOlJr_izQ', 'Ian McKellen, Martin Freeman, Richard Armitage, Ken Stott', 'Após iniciar sua jornada ao lado de um grupo de anões e de Gandalf (Ian McKellen), Bilbo Bolseiro (Martin Freeman) segue em direção à Montanha Solitária, onde deverá ajudar seus companheiros de missão a retomar a Pedra de Arken, que fará com que Thorin  (Richard Armitage) obtenha o respeito de todos os anões e o apoio na luta para retomar seu reino. O problema é que o artefato está perdida em meio a um tesouro protegido pelo temido dragão Smaug (voz de Benedict Cumberbatch). Ao mesmo tempo, Gandalf investiga uma nova força sombria que surge na Terra Média.', 0, 'matheus', NULL, NULL),
(NULL, 776, 'O Hobbit: A Batalhas dos Cinco Exércitos', 'The Hobbit: The Battle of the Five Armies', 'Estados Unidos', 'Fantasia', 'Peter Jackson', '15433963255bfe5be565374.jpg', 144, 2014, 'VKkFW5TTB6g', 'Ian McKellen, Martin Freeman, Richard Armitage, Ken Stott', 'Após ser expulso da montanha de Erebor, o dragão Smaug ataca com fúria a cidade dos homens que fica próxima ao local. Após muita destruição, Bard (Luke Evans) consegue derrotá-lo. Não demora muito para que a queda de Smaug se espalhe, atraindo os mais variados interessados nas riquezas que existem dentro de Erebor. Entretanto, Thorin (Richard Armitage) está disposto a tudo para impedir a entrada de elfos, anões e orcs, ainda mais por ser tomado por uma obsessão crescente pela riqueza à sua volta. Paralelamente a estes eventos, Bilbo Bolseiro (Martin Freeman) e Gandalf (Ian McKellen) tentam impedir a guerra.', 0, 'matheus', NULL, NULL),
(NULL, 777, 'Papillon', 'Papillon', 'Estados Unidos', 'Aventura', 'Michael Noer', '15434857575bffb93d5cced.jpg', 157, 2018, '4NuCY8i1J44', 'N/A', 'Henri Charrière (Charlie Hunnam), chamado de Papillon, pequeno bandido do subúrbio de Paris da década de 30, é condenado à prisão perpétua por um crime que não cometeu. Enviado para a Ilha do Diabo, na Guiana Francesa, ele conhece Louis Dega (Rami Malek), homem que Papillon promete ajudar em troca de auxílio para escapar da prisão.', 0, 'helena', NULL, NULL),
(NULL, 778, 'Corações de Ferro', 'Fury', 'Estados Unidos', 'Guerra', 'David Ayer', '15434860155bffba3f199bc.jpg', 134, 2015, 'OoKSKzqpPy4', 'N/A', 'Durante o final da Segunda Guerra Mundial, um grupo de cinco soldados americanos é encarregado de atacar os nazistas dentro da própria Alemanha. Apesar de estarem em quantidade inferior e terem poucas armas, eles são liderados pelo enfurecido Wardaddy (Brad Pitt), sargento que pretende levá-los à vitória, enquanto ensina o novato Norman (Logan Lerman) a lutar.', 0, 'raissa', NULL, NULL),
(NULL, 779, 'Baywatch: S.O.S Malibu', 'Baywatch', 'Estados Unidos', 'Comédia', 'Seth Gordon', '15434861645bffbad4aa5d7.jpg', 116, 2017, '26S3XtfWEwc', 'Dwayne Johnson, Zac Efron, Priyanka Chopra, Alexandra Daddario', 'Mitch Buchannon (Dwayne Johnson) é um devoto salva-vidas, orgulhoso do seu trabalho. Enquanto está treinando o novo e exibido recruta Matt Brody (Zac Efron), os dois descobrem uma conspiração criminosa no local que pode ameaçar o futuro da baía.', 0, 'helena', NULL, NULL),
(NULL, 780, 'Regressão', 'Regression', 'Espanha', 'Suspense', 'Alejandro Amenábar', '15434864905bffbc1a95787.jpg', 107, 2015, '4TbSs_jXa8s', 'Ethan Hawke, Emma Watson, David Thewlis, Lothaire Bluteau', 'Em Minnesota na década de 1980, Bruce (Ethan Hawke) é preso por abusar sexualmente da própria filha, Angela (Emma Watson). Embora não se lembre do que aconteceu, ele se declara culpado. Auxiliado por psicólogos, ele revive os momentos e até acusa um policial de ter participado do crime, porém, ele começa a desconfiar da existência de uma conspiração nacional.', 0, 'raissa', NULL, NULL),
(NULL, 781, 'Os Farofeiros', 'Os Farofeiros', 'Brasil', 'Comédia', 'Roberto Santucci', '15434866205bffbc9c7f07f.jpg', 99, 2018, 'EI-mvRW6FkU', NULL, 'Quatro colegas de trabalho se programam para curtir o feriado prolongado em uma casa de praia e, chegando lá, descobrem que se meteram em uma tremenda roubada. Para começar o destino não é Búzios, mas Maringuaba; a residência alugada é encontrada caindo aos pedaços, bem diferente do prometido; a praia está sempre cheia; e as confusões são inúmeras.', 0, 'helena', NULL, NULL),
(NULL, 783, 'Barbie como Rapunzel', 'Barbie as Rapunzel', 'Estados Unidos', 'Animação', 'Owen Hurley', '15434872175bffbef145fd8.jpg', 84, 2002, 'YQhRefQ0zPg', 'Kelly Sheridan, Anjelica Huston, Cree Summer, Ian James Corlett', 'Rapunzel é obrigada por sua madrasta, a bruxa Gothell, a cuidar de todo o serviço de casa. Após descobrir uma escova de cabelo, com uma frase escrita por seus pais, a jovem resolve investigar o seu passado e acaba conhecendo o príncipe Steffan, por quem se apaixona. Gothell descobre tudo sobre os passeios de Rapunzel e resolve trancafiá-la em uma torre.', 0, 'raissa', NULL, NULL),
(NULL, 784, 'Barbie: Lago dos Cisnes', 'Barbie of Swan Lake', 'Estados Unidos', 'Animação', 'Owen Hurley', '15434877415bffc0fde4940.jpg', 0, 2003, 'eH4Ar5x0gv8', 'Kelly Sheridan, Mark Hildreth, Kelsey Grammer, Maggie Wheeler', 'Depois de seguir um unicórnio até a Floresta Encanatada, Odette, filha mais nova de um padeiro, é amaldiçoada por um perverso feiticeiro. Com a intenção de derrotar a Rainha das Fadas, o vilão transforma Odette em cisne e a obriga a salvar os habitantes do local.', 0, 'raissa', NULL, NULL),
(NULL, 785, 'Barbie Fairytopia: Mermaidia', 'Barbie Fairytopia: Mermaidia', 'Estados Unidos', 'Animação', 'William Lau', '15434883435bffc357e2de2.jpg', 70, 2005, 'Snxs-ZsuPbE', NULL, 'Depois de ganhar um par de asas como agradecimento por ter salvado o Reino das Fadas em Barbie Fairytopia (2005), Elina embarca em uma aventura debaixo d\'água. Com a ajuda da sereia Nori, a Fada do Campo precisa salvar o príncipe tritão Nalu, que foi sequestrado pela cruel Laverna.', 0, 'raissa', NULL, NULL),
(NULL, 786, 'Barbie Butterfly: Uma Aventura em Fairytopia', 'Barbie: Mariposa and her Butterfly Fairy Friends', 'Estados Unidos', 'Animação', 'Conrad Helten', '15434886055bffc45d8dcad.jpg', 75, 2007, 'ZNtfvUHeLkE', NULL, 'Butterfly é uma fada borboleta que vive no reino de Flutterfield. Com a ajuda do príncipe Carlos e das amigas Rayna e Rayla, Butterfly começa uma jornada em busca de um antídoto para salvar a Rainha Marabella, envenenada pela malvada Henna.', 0, 'raissa', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 787, 'Barbie e as Suas Irmãs em Uma Aventura de Cavalos', 'Barbie & Her Sisters in A Pony Tale', 'Estados Unidos', 'Animação', 'Kyran Kelly', '15434887915bffc5174055b.jpg', 71, 2013, 'D96pA5mMPik', 'Kelly Sheridan, Katie Crown, Ali Liebert, Brett Dier', 'De férias, Barbie e suas irmãs, Stacie, Skipper e Chelsea, viajam até os Alpes Suíços para participar de uma academia de equitação. Enquanto aproveitam as aulas, Barbie descobre um misterioso cavalo selvagem na floresta, transformando a simples visita em uma aventura mmágica.', 0, 'raissa', NULL, NULL),
(NULL, 788, 'Barbie: Super Princesa', 'Barbie in Princess Power', 'Estados Unidos', 'Animação', 'Ezekiel Norton', '15434889825bffc5d630a2f.jpg', 73, 2014, 'L0ydtALJaaY', NULL, 'Depois de ser beijada por uma borboleta mágica, a princesa Kara acorda com super poderes no dia seguinte. Com a capacidade de voar, soltar bolas de luz explosivas e ter força sobrehumana, ela se torna uma super-heroína e desperta a inveja da prima Corinne, que captura a borboleta com o objetivo de se tornar tão poderosa quanto Kara.', 0, 'raissa', NULL, NULL),
(NULL, 789, 'Barbie e Suas Irmãs em Uma Aventura de Cachorrinho', 'Barbie And Her Sisters in the Great Puppy Adventur', 'Estados Unidos', 'Animação', 'Andrew Taw', '15434891175bffc65da2e96.jpg', 76, 2015, 'QLIax1NWEmc', NULL, 'Barbie e suas irmãs, Skipper, Stacie e Chelsea, e seus adoráveis filhotes de cachorros irão vivenciar um inesperado mistério e uma grande aventura quando elas retornam para sua casa em Willows. Ao mexer nas lembranças da avó no sótão, elas descobrem um antigo mapa, que leva até um tesouro perdido e enterrado em algum lugar da cidade. Com os seus cachorrinhos, as quatro irmãs partem em uma emocionante caça ao tesouro, onde irão aprender grandes lições de vida.', 0, 'raissa', NULL, NULL),
(NULL, 790, 'Barbie Rock’n Royals', 'Barbie - Rock\'n Royals', 'Estados Unidos', 'Animação', 'Karen J. Lloyd', '15434892805bffc7002cd8a.jpg', 83, 2015, 'UxGbHveYJ3w', NULL, 'Por um engano, a princesa Courtney é enviada para o Acampamento Pop, enquanto Erika, uma famosa pop star, acaba indo para o Acampamento Real. Ao descobrirem que os acampamentos estão prestes a acabar, as duas se juntam para uma épica competição musical, a fim de salvarem os acampamentos.', 0, 'raissa', NULL, NULL),
(NULL, 791, 'Barbie e os Golfinhos Mágicos', 'Barbie: Dolphin Magic', 'Estados Unidos', 'Animação', 'Conrad Helten', '15434895595bffc81745168.png', 60, 2017, 'AkRhvbFh-hs', 'Erica Lindbeck, Shannon Chan-Kent, Kazumi Evans, Claire Margaret Corlett', 'Ken está com um trabalho temporário de verão nos recifes de corais, onde ele pesquisa os golfinhos. Barbie e suas irmãs vão visitar  vão visitá-lo e é nessa aventura debaixo d\'água que elas encontram golfinhos coloridos que só passam por ali uma vez por ano. As irmãs também conhecem Isla, uma amiga misteriosa.', 0, 'raissa', NULL, NULL),
(NULL, 792, 'Barbie Em Um Mundo De Vídeogame', 'Barbie Video Game Hero', 'Estados Unidos', 'Animação', 'Conrad Helten', '15434898405bffc9309dbbe.jpg', 72, 2017, 'z4IAs5FC8rU', 'Erica Lindbeck, Sienna Bohn, Shannon Chan-Kent, Michael Dobson', 'O jogo favorito da Barbie está em perigo, ele foi dominado pelo vírus emoji. Então a boneca é convidada por Cutie, o tutorial do jogo, para entrar no videogame e vencer todos os níveis até salvá-lo. Tudo começa ainda no Nível 1, com Barbie e seus novos amigos e jogadores, Bella e Kris. \r\nE o último nível reserva muitas aventuras. Será que Barbie vai salvar o jogo?', 0, 'raissa', NULL, NULL),
(NULL, 793, 'Tiny Shoulders: Rethinking Barbie ', 'Tiny Shoulders: Repensando a Barbie ', 'Estados Unidos', 'Animação', 'Andrea Nevins', '15434902325bffcab86c92a.jpg', 91, 2018, '4mnC4LVGkr4', '', 'Barbie é a boneca mais popular já criada, chegada nas prateleiras há 60 anos, ela já passou por diversas mudanças e esteve em constante conflito com ideais femininos. Esse documentário explora o local da Barbie na história da mulher na sociedade e sua relação com ideias de beleza, com entrevistas com importantes pensadoras feministas como Gloria Steinem e Roxane Gay, enquanto acompanha a Mattel na maior mudança de imagem pela qual a Barbie já passou.', 0, 'raissa', NULL, NULL),
(NULL, 794, 'Barbie - O Quebra-Nozes', 'Barbie in the Nutcracker', 'Estados Unidos', 'Animação', 'Owen Hurley', '15434904205bffcb742b57a.jpg', 76, 2001, 'wUonq4jxJUk', 'Kelly Sheridan, Kirby Morrow, Tim Curry, Peter Kelamis', 'Clara (Kelly Sheridan) é uma menina órfã que ganha de presente de Natal um boneco, o Quebra-Nozes (Kirby Morrow). Enquanto Clara está dormindo, o boneco ganha vida e defende a menina dos soldados comandados pelo Rei dos Ratos (Tim Curry). Quando ela acorda, percebe que foi encolhida através de um feitiço. Clara e o Quebra-Nozes iniciam uma jornada em busca da Fada Caramelo, a única que pode desfazer o feitiço.', 0, 'raissa', NULL, NULL),
(NULL, 795, 'Barbie e O Portal Secreto', 'Barbie and the Secret Door', 'Estados Unidos', 'Animação', 'Karen J. Lloyd', '15434906305bffcc46ad7c3.jpg', 78, 2014, 'W-TQpbTVWH8', 'Kelly Sheridan, Brittany McDonald, Ashleigh Ball, Chanelle Peloso', 'Alexa é uma bela princesa que encontra um portal que a conduz a um território encantado recheado de criaturas mágicas. \r\n', 0, 'raissa', NULL, NULL),
(NULL, 796, 'Barbie e as Agentes Secretas', 'Barbie: Spy Squad', 'Estados Unidos', 'Animação', 'Conrad Helten', '15434907955bffcceb1b938.jpg', 72, 2016, 'AYcvsjRKkkw', 'Erica Lindbeck, Stephanie Sheh, Jenny Pellicer, Alyssya Swales', 'Barbie e suas duas melhores amigas, Teresa e Renee, são ótimas atletas. Suas habilidades de ginástica acabam chamando a atenção de uma super-secreta agência de espionagem que as convidam para entrar no caso se um roubo de pedras preciosas, As atletas se transforman em agentes secretas. Cheias de equipamentos tecnológicos e disfarces, elas precisam provar serem capazes de solucionar o problema.', 0, 'raissa', NULL, NULL),
(NULL, 797, 'Barbie: Aventura nas Estrelas', 'Barbie: Star Light Adventure', 'Estados Unidos', 'Animação', 'Andrew Taw', '15434912205bffce9400901.jpg', 75, 2016, 'KrJp20P3hVQ', 'Erica Lindbeck, Robbie Daymond, Kimberly Woods, Sarah Anne Williams', 'Barbie leva uma vida de diversão em planeta distante ao lado do seu bichinho Pipoca. Mas quando ela descobre que o brilho da sua galáxia está enfraquecendo e as estrelas pararam de dançar pelo céu, Barbie decide viajar até o Planeta Capital a fim de salvar as estrelas. Lá, ela conhece a campeã galáctica de hoverboard, Sal-lee, e um grupo de amigos cheios de talento, que a ajudam a escutar seu coração e descobrir que ela pode se tornar a líder que a galáxia inteira está esperando.', 0, 'raissa', NULL, NULL),
(NULL, 798, 'A Escolha Perfeita', 'Pitch Perfect', 'Estados Unidos', 'Musical', 'Jason Moore', '15434916945bffd06e38105.jpg', 112, 2012, 'XOwBS2s_S_w', 'Anna Kendrick, Skylar Astin, Ben Platt, Brittany Snow', 'O The Barden Bellas é um grupo formado apenas por garotas, que apostam no visual perfeito e em sucessos pop para atrair o público da escola. Entretanto, após uma apresentação desastrosa na competição de fim de ano, suas integrantes decidem repensar o grupo. É quando surge o convite para que Beca (Anna Kendrick), uma DJ aspirante que não tem o menor interesse na vida colegial, integre a nova banda. De início Beca descarta completamente o convite, mas após conhecer Jesse (Skylar Astin), que integra uma banda formada apenas por garotos, ela resolve aceitar o convite e passa a ajudar as integrantes do The Barden Bellas a encontrar um novo visual.', 0, 'helena', NULL, NULL),
(NULL, 799, 'A Escolha Perfeita 2', 'Pitch Perfect 2', 'Estados Unidos', 'Musical', 'Elizabeth Banks', '15434919425bffd166474b4.jpg', 115, 2015, 'wmzTqIlbF8k', 'Anna Kendrick, Rebel Wilson, Hailee Steinfeld, Brittany Snow', 'Após conquistarem o sucesso, as Barden Bellas ganham a oportunidade de se apresentar para ninguém menos que o presidente dos Estados Unidos. Só que o show é um grande fiasco, o que as torna uma vergonha nacional. Diante do ocorrido, as Bellas são proibidas de participar de competições no meio acadêmico e até mesmo de aceitar novas integrantes. A única saída de Beca (Anna Kendrick), Fat Amy (Rebel Wilson) & cia é vencer o campeonato mundial a capela, o que apagaria as punições aplicadas ao grupo. Mas há um problema: nunca uma equipe americana venceu o torneio.', 0, 'helena', NULL, NULL),
(NULL, 800, 'A Escolha Perfeita 3', 'Pitch Perfect 3', 'Estados Unidos', 'Musical', 'Trish Sie', '15434920915bffd1fb66aa6.jpg', 93, 2017, 'E1KYa7h5W1A', 'Anna Kendrick, Rebel Wilson, Brittany Snow, Anna Camp', 'Agora formadas, Beca (Anna Kendrick), Fat Amy (Rebel Wilson), Chloe (Brittany Snow) e as demais Bella Bardens estão infelizes devido a trabalhos mal remunerados e pouco motivadores. Diante desta situação, elas decidem se unir mais uma vez como grupo a capela para participar do USO Tour, uma turnê que as levará para apresentações na Europa. Lá, elas precisam duelar com grupos musicais que tocam instrumentos, algo que jamais haviam feito até então.', 0, 'helena', NULL, NULL),
(NULL, 801, 'Hotel Transilvânia', 'Hotel Transylvania ', 'Estados Unidos', 'Animação', ' Genndy Tartakovsky', '15434943965bffdafc46e32.jpg', 91, 2012, 'WtyiO4ZpbmM', 'Adam Sandler, Andy Samberg, Selena Gomez, Kevin James', 'O Hotel Transilvânia é um resort cinco estrelas que serve de refúgio para que os monstros possam descansar do árduo trabalho de perseguir e assustar os humanos. O local é comandado pelo Conde Drácula (Adam Sandler), que resolve convidar os amigos para comemorar, ao longo de um fim de semana, o 118º aniversário de sua filha Mavis (Selena Gomez). O que ele não esperava era que Jonathan (Adam Samberg), um humano sem noção, fosse aparecer no local justo quando o hotel está repleto de convidados e, ainda por cima, se apaixonasse por Mavis.', 0, 'raissa', NULL, NULL),
(NULL, 802, 'A 5ª Onda', 'The 5th Wave', 'Estados Unidos', 'Ficção Científica', ' J Blakeson', '15434949845bffdd48a28cc.jpg', 112, 2016, 'DxCntPIs38U', 'Chloë Grace Moretz, Matthew Zuk, Gabriela Lopez, Bailey Anne Borders', 'A Terra repentinamente sofre uma série de ataques alienígenas. Na primeira onda de ataques, um pulso eletromagnético retira a eletricidade do planeta. Na segunda onda, um tsunami gigantesco mata 40% da população. Na terceira onda, os pássaros passam a transmitir um vírus que mata 97% das pessoas que resistiram aos ataques anteriores. Na quarta onda, os próprios alienígenas se infiltram entre os humanos restantes, espalhando a dúvida entre todos. Com a proximidade cada vez maior da quinta onda, que promete exterminar de vez a raça humana, a adolescente Cassie Sullivan (Chloe Grace Moretz) precisa proteger seu irmão mais novo e descobrir em quem pode confiar.', 0, 'raissa', NULL, NULL),
(NULL, 803, 'Goosebumps - Monstros e Arrepios', 'Goosebumps', 'Estados Unidos', 'Aventura', 'Rob Letterman', '15434954135bffdef5d8a48.jpg', 103, 2015, 'IKyiFa9qef0', 'Jack Black, Dylan Minnette, Odeya Rush, Ryan Lee', 'O jovem Zach Cooper (Dylan Minnette) se muda de Nova York para uma cidade pequena dos Estados Unidos, para onde a mãe é transferida. Lá, eles passam a morar na casa ao lado da de Hannah (Odeya Rush) – por quem o adolescente se apaixona – e o pai, o ranzinza R. L. Stine (Jack Black). Depois de escutar gritos vindo da propriedade ao lado, Zach invade a residência com a ajuda do medroso colega (Ryan Lee) e acaba, acidentalmente, abrindo um dos livros e, consequentemente, dando início à libertação de todos os monstros criados por Stine. Juntos, eles terão que mandar as criaturas de volta para as prateleiras.', 0, 'raissa', NULL, NULL),
(NULL, 804, 'A Origem dos Guardiões', 'Rise of the Guardians', 'Estados Unidos', 'Animação', 'Peter Ramsey', '15434957245bffe02ce50af.jpg', 97, 2012, 'ctI56H-_Pt0', 'Chris Pine, Alec Baldwin, Jude Law, Isla Fisher', 'As crianças do mundo inteiro são protegidas por um seleto grupo de guardiões: Papai Noel, Fada do Dente, Coelho da Páscoa e Sandman. São eles que garantem a inocência e as lendas infantis. Mas um espírito maligno, o Breu, pretende transformar todos os sonhos em pesadelo, despertando medo em todas as crianças. Para combater este adversário poderoso, a Lua designa um novo guardião para ajudar o grupo: Jack Frost, um garotinho invisível que controla o inverno. Sem conhecer sua própria vocação de guardião, ele embarca em uma aventura na qual vai descobrir tanto sobre as crianças quanto sobre seu próprio passado.', 0, 'raissa', NULL, NULL),
(NULL, 805, 'Para Sempre Alice', 'Still Alice', 'Estados Unidos', 'Drama', 'Wash Westmoreland', '15434959435bffe1075a003.jpg', 101, 2014, 'ikwYmKkvI6o&t=3s', 'Julianne Moore, Kate Bosworth, Shane McRae, Hunter Parrish', 'A Dra. Alice Howland (Julianne Moore) é uma renomada professora de linguistica. Aos poucos, ela começa a esquecer certas palavras e se perder pelas ruas de Manhattan. Ela é diagnosticada com Alzheimer. A doença coloca em prova a a força de sua família. Enquanto a relação de Alice com o marido, John (Alec Baldwinse), fragiliza, ela e a filha caçula, Lydia (Kristen Stewart), se aproximam.', 0, 'helena', NULL, NULL),
(NULL, 806, 'Meu Nome é Khan', 'My Name is Khan', 'Índia', 'Drama', 'Karan Johar', '15434959675bffe11f1446d.jpg', 160, 2010, 'JEpqz33vKus', 'Shah Rukh Khan, Kajol, Katie A. Keane, Kenton Duty', 'Rizwan Khan, uma criança muçulmana que tem síndrome de Asperger, uma espécie de autismo, cresceu com a sua mãe em Mumbai. Quando adulto, ele decide se mudar para São Francisco, onde vai viver com os seus irmãos. Lá, ele se apaixona pela jovem Mandira, uma cabeleireira divorciada que vive com o filho Samee. Os dois se casam e passam a ter uma vida feliz, mas apenas até os atentatos de 11 de Setembro, quando começam a ser atacados por sua origem étnica e a sofrer muito preconceito.', 0, 'raissa', NULL, NULL),
(NULL, 807, 'Ponte para Terabítia', 'Bridge to Terabithia', 'Estados Unidos', 'Fantasia', 'Gabor Csupo', '15434961655bffe1e5a6270.jpg', 94, 2007, '50xhXc1ZU_c', 'Josh Hutcherson, AnnaSophia Robb, Zooey Deschanel, Robert Patrick', 'Jess Aarons (Josh Hutcherson) sente-se um estranho na escola e até mesmo em sua família. Durante todo o verão ele treinou para ser o garoto mais rápido da escola, mas seus planos são ameaçados por Leslie Burke (AnnaSophia Robb), que vence uma corrida que deveria ser apenas para garotos. Logo Jess e Leslie tornam-se grandes amigos e, juntos, criam o reino secreto de Terabítia, um lugar mágico onde apenas é possível chegar se pendurando em uma velha corda, que fica sobre um riacho perto de suas casas. Lá eles lutam contra Dark Master (Matt Gibbons) e suas criaturas, além de conspirar contra as brincadeiras de mau gosto que são feitas na escola.', 0, 'raissa', NULL, NULL),
(NULL, 808, 'Herbie: Meu Fusca Turbinado', 'Herbie: Fully Loaded', 'Estados Unidos', 'Comédia', 'Angela Robinson', '15434963345bffe28e9967d.jpg', 101, 2005, 'lPZjnvi_jGE', 'Lindsay Lohan, Michael Keaton, Matt Dillon, Breckin Meyer', 'Maggie Payton (Lindsay Lohan) é uma jovem que faz parte de uma família de pilotos na Nascar e que adora competir, mas foi proibida de correr por Ray (Michael Keaton), seu pai superprotetor. Por causa desta proibição, Maggie está prestes a iniciar uma carreira no canal ESPN. Querendo presentear a filha com um carro devido a sua formatura, Ray a leva a um ferro-velho para que ela escolha seu presente. Maggie inicialmente está em busca de um carro esportivo, mas um desgastado e enferrujado fusca da década de 60 chama sua atenção. Maggie o escolhe e, para sua surpresa, logo descobre que ele não é um carro comum. Com a ajuda de seus novos amigos Herbie logo fica mais rápido do que nunca, fazendo com que Maggie decida inscrevê-lo para competir na Nascar.', 0, 'helena', NULL, NULL),
(NULL, 809, 'Fomos Heróis ', 'We Were Soldiers', 'Estados Unidos', 'Guerra', 'Randall Wallace ', '15436168465c01b94ef0309.jpg', 130, 2002, 'g-rPbmuZ3TA', 'Mel Gibson, Madeleine Stowe, Greg Kinnear, Sam Elliott', 'Em plena Guerra do Vietnã, o tenente-coronel Hal Moore (Mel Gibson) e mais 400 integrantes do exército norte-americano, todos da elite de combate, são cercados por 2000 soldados vietnamitas. A batalha que se segue a partir de então se torna uma das mais sangrentas da história militar norte-americana, fazendo com que posteriormente o lugar onde ela ocorreu seja conhecido como o Vale da Morte.', 0, 'raissa', NULL, NULL),
(NULL, 810, 'Triplo X', 'Triple X', 'Estados Unidos', 'Ação', 'Rob Cohen', '15437708955c04130fd16d1.jpg', 124, 2002, '2nw1XGbUL0U', NULL, 'Xander Cage (Vin Diesel) é um atleta de esportes radicais famoso por suas performances em público que desafiavam a própria morte. Apostando em sua capacidade em decifrar crimes não solucionados por espiões comuns, Gibbons (Samuel L. Jackson), um agente da NSA, decide recrutá-lo para sua organização. Xander aceita o convite e é escalado para uma missão onde enfrentará um inteligente, organizado e implacável inimigo.', 0, 'raissa ', NULL, NULL),
(NULL, 812, 'O Expresso Polar', 'The Polar Express', 'Estados Unidos', 'Animação', 'Robert Zemeckis', '15437936005c046bc080bf9.jpg', 100, 2004, 'TQhRqtt-Fpo', 'Tom Hanks, Leslie Zemeckis, Eddie Deezen, Nona Gaye', 'É véspera de Natal e um garoto (Tom Hanks) está acordado. Sem acreditar mais em Papai Noel, ele espera por algo que faça com que sua crença na figura natalina retorne. De repente ele ouve um grande barulho, indo para fora de sua casa. O garoto então vê à sua frente um gigantesco trem negro com destino ao Pólo Norte, cujo condutor (Tom Hanks) o convida para embarcar. Após certa relutância, ele decide seguir viagem.', 0, 'matheus', NULL, NULL),
(NULL, 813, 'A Decadência de Uma Espécie', 'The Handmaid', 'Alemanha', 'Suspense', 'Volker Schlöndorff', '15437979305c047caa33e35.jpg', 108, 1990, 'rJglr8Po6ZI', NULL, 'A República de Gileade é um estado totalitário que tenta usar a Bíblia para fundamentar seus atos. Kate (Natasha Richardson) foi presa por tentar atravessar a fronteira, seu marido foi morto e ela nunca mais viu a filha. Neste país qualquer mulher que comete um delito, e homossexualidade está entre eles, se é estéril vai para as colônias penais, mas se é fértil se torna uma serva. Como só 1% das mulheres são férteis, estas servas são obrigadas a terem relações sexuais com quem o governo determina e é bom ficarem grávidas, pois o defeito nunca é do homem. Esta esterilização em massa é consequência do ar ficar cheio de produtos químicos radioativos e as águas das chuvas terem sido contaminadas com moléculas tóxicas. Após ser cruelmente treinada por \"Tia\" Lydia (Victoria Tennant), ela é designada para ser a serva do comandante (Robert Duvall), o supremo chefe militar. Porém Serena Joy (Faye Dunaway), sua esposa, é ciumenta e Kate se sente atraída é por Nick (Aidan Quinn), um ordenança do comandante. Ao mesmo tempo um movimento de resistência começa a desafiar o regime.', 0, 'helena', NULL, NULL),
(NULL, 814, 'A Decadência de Joe Albany', 'Low Down', 'Estados Unidos', 'Biografia', 'Jeff Preiss', '15437981605c047d90257f3.jpg', 114, 2014, 'UjWH7DC-Fa0', 'John Hawkes, Elle Fanning, Glenn Close, Peter Dinklage', 'A derrocada do pianista de jazz Joe Albany (John Hawkes) a partir do ponto de vista de sua filha, Amy (Elle Fanning). Na cena jazzística dos anos 60 e 70, ele se afunda nas drogas.', 0, 'helena', NULL, NULL),
(NULL, 815, 'A Teoria de Tudo', 'The Theory of Everything', 'Reino Unido', 'Biografia', 'James Marsh', '15437983115c047e275373a.jpg', 123, 2014, 'OgVdYzUW0yk', 'Eddie Redmayne, Felicity Jones, Tom Prior, Sophie Perry', 'Baseado na biografia de Stephen Hawking, o filme mostra como o jovem astrofísico (Eddie Redmayne) fez descobertas importantes sobre o tempo, além de retratar o seu romance com a aluna de Cambridge Jane Wide (Felicity Jones) e a descoberta de uma doença motora degenerativa quando tinha apenas 21 anos.', 0, 'helena', NULL, NULL),
(NULL, 816, 'Te Peguei!', 'Tag', 'Estados Unidos', 'Comédia', 'Jeff Tomsic', '15437991125c048148344b9.jpg', 100, 2018, 'b8A12w4RqOY', 'Ed Helms, Lil Rel Howery, Jon Hamm, Annabelle Wallis', 'Desde a primeira série na escola um grupo de cinco amigos têm um hábito curioso, que realizam pelo menos uma vez ao ano: brincar enlouquecidamente de pega-pega, correndo em uma partida alucinante para ser o último homem de pé ao final da brincadeira, arriscando seus empregos e relacionamentos. Neste ano, que coincide com o casamento do jogador invicto da trupe, eles farão de tudo para derrubá-lo no momento de vulnerabilidade.', 0, 'helena', NULL, NULL),
(NULL, 817, 'De Onde Eu Te Vejo', 'De Onde Eu Te Vejo', 'Brasil', 'Romance', 'Luiz Villaça', '15437992565c0481d8640dc.png', 90, 2016, '2claqa74qOk', 'Manoela Aliperti, Domingos Montagner, Denise Fraga', 'Ana Lúcia (Denise Fraga) e Fábio (Domingos Montagner) decidem se separar após vinte anos de casamento e ele se muda para um apartamento do outro lado da rua. Além da separação, eles passam por uma crise no trabalho e precisam enfrentar a iminente mudança de cidade da filha. Com todas essas mudanças, eles precisam aprender a viver essa nova realidade e reinventar o amor.', 0, 'helena', NULL, NULL),
(NULL, 818, 'Beleza Oculta', 'Collateral Beauty', 'Estados Unidos', 'Drama', 'David Frankel', '15437995425c0482f6d76c8.jpg', 97, 2016, 'fSbMvWW_BBE', 'Will Smith, Edward Norton, Kate Winslet, Michael Peña', 'Após uma tragédia pessoal, Howard (Will Smith) entra em depressão e passa a escrever cartas para a Morte, o Tempo e o Amor - algo que preocupa seus amigos. Mas o que parece impossível, se torna realidade quando essas três partes do universo decidem responder. Morte (Helen Mirren), Tempo (Jacob Latimore) e Amor (Keira Knightley) vão tentar ensinar o valor da vida para o protagonista.', 0, 'helena', NULL, NULL),
(NULL, 819, 'Quem Quer Ser um Milionário?', 'Slumdog Millionaire', 'Estados Unidos', 'Comédia dramática', ' Danny Boyle', '15437997535c0483c99bc24.jpg', 120, 2008, 'DuqSAaE-n94', 'Dev Patel, Saurabh Shukla, Anil Kapoor, Raj Zutshi', 'Jamal K. Malik (Dev Patel) é um jovem que trabalha servindo chá em uma empresa de telemarketing. Sua infância foi difícil, tendo que fugir da miséria e violência para conseguir chegar ao emprego atual. Um dia ele se inscreve no popular programa de TV \"Quem Quer Ser um Milionário?\". Inicialmente desacreditado, ele encontra em fatos de sua vida as respostas das perguntas feitas.', 0, 'helena', NULL, NULL),
(NULL, 820, 'Patch Adams - O Amor É Contagioso', 'Patch Adams', 'Estados Unidos', 'Comédia dramática', 'Tom Shadyac', '15438000365c0484e42f184.jpg', 115, 1998, 'WkgjttNaazI', 'Robin Williams, Daniel London, Monica Potter, Philip Seymour Hoffman', 'Em 1969, após tentar se suicidar, Hunter Adams (Robin Williams) voluntariamente se interna em um sanatório. Ao ajudar outros internos, descobre que deseja ser médico, para poder ajudar as pessoas. Deste modo, sai da instituição e entra na faculdade de medicina. Seus métodos poucos convencionais causam inicialmente espanto, mas aos poucos vai conquistando todos, com exceção do reitor, que quer arrumar um motivo para expulsá-lo, apesar dele ser o primeiro da turma.', 0, 'helena', NULL, NULL),
(NULL, 821, 'O Grande Lebowski', 'The Big Lebowski', 'Estados Unidos', 'Comédia', 'Irmãos Coen', '15438003495c04861d9d2d1.jpg', 117, 1998, '4Z93PDj6d9U', 'Jeff Bridges, John Goodman, Julianne Moore, Steve Buscemi', 'Venice, Califórnia. Jeffrey Lebowski (Jeff Bridges) é um desempregado convicto, que vive no ócio e chama a si mesmo de \"the Dude\". Quando não está sozinho no apartamento, ouvindo canções do Creedence ou usando drogas, está jogando boliche junto com os amigos Walter Sobchak (John Goodman), neurótico por armas, e Donny (Steve Buscemi), um grande jogador que ninguém deixa falar. Um dia alguns desconhecidos invadem o apartamento de Lebowski, cobrando o dinheiro devido por Bunny (Tara Reid), sua suposta esposa. \"Dude\" tenta desfazer o mal entendido, mas um deles se vinga urinando no tapete. Logo em seguida \"Dude\" descobre que eles estavam atrás de outro Lebowski (David Huddleston), um milionário. Irritado com o que aconteceu, já que gostava muito do tapete, \"Dude\" vai até seu homônimo exigir uma compensação. Sem conseguir nada, ele resolve roubar um dos valiosos tapetes da mansão. Tempos depois, Lebowski pede que \"Dude\" o ajude a entregar a quantia pedida pelo resgate de Bunny. É quando Walter elabora um plano para desmascarar os sequestradores e ainda ficar com o dinheiro.', 0, 'helena', NULL, NULL),
(NULL, 822, 'O Homem da Máscara de Ferro', 'The Man in the Iron Mask', 'Estados Unidos', 'Aventura', 'Randall Wallace', '15438005845c04870880306.jpg', 132, 1998, 'OiAyH_WH_-I', 'Leonardo DiCaprio, Jeremy Irons, John Malkovich, Gérard Depardieu', 'No século XVII, o cruel Luís XIV (Leonardo DiCaprio) manda clandestinamente para a masmorra o irmão gêmeo que ninguém sabe existir, para tomar o poder. Mas o mosqueteiro Aramis (Jeremy Irons) descobre o segredo e convence seus companheiros a salvar o prisioneiro.', 0, 'helena', NULL, NULL),
(NULL, 823, 'Central do Brasil', 'Central do Brasil', 'Brasil', 'Drama', 'Walter Salles', '15438008455c04880da193f.jpg', 113, 1998, 'lARFBFxjLNI', NULL, 'Dora (Fernanda Montenegro) trabalha escrevendo cartas para analfabetos na estação Central do Brasil, no centro da cidade do Rio de Janeiro. Ainda que a escrivã não envie todas as cartas que escreve - as cartas que considera inúteis ou fantasiosas demais -, ela decide ajudar um menino (Vinícius de Oliveira), após sua mãe ser atropelada, a tentar encontrar o pai que nunca conheceu, no interior do Nordeste.', 0, 'helena', NULL, NULL),
(NULL, 824, 'Cidade dos Anjos', 'City of Angels', 'Alemanha', 'Fantasia', 'Brad Silberling', '15438010335c0488c990ac3.jpg', 114, 1998, 'UIq-RTIwUNw', 'Nicolas Cage, Meg Ryan, Andre Braugher, Dennis Franz', 'Em Los Angeles, uma dedicada cirurgiã (Meg Ryan) fica arrasada quando perde um paciente durante uma operação, no mesmo instante em que um anjo (Nicolas Cage), que estava na sala de cirurgia, começa a se sentir atraído por ela. Em pouco tempo ele fica apaixonado pela médica e resolve ficar visível para ela, a fim de poder encontrá-la frequentemente, o que acaba provocando entre os dois uma atração cada vez maior, apesar dela ter um sério relacionamento com um colega de profissão. O ser celestial não pode sentir calor, nem o vento no rosto, o gosto de uma fruta ou o toque da sua amada, assim ele cogita em deixar de ser um imortal para poder amar e ser amado intensamente.', 0, 'helena', NULL, NULL),
(NULL, 825, 'A Máscara do Zorro', 'The Mask of Zorro', 'Estados Unidos', 'Aventura', 'Martin Campbell', '15438012235c048987097af.jpg', 136, 1998, 'w8QUEvoLWcA', 'José María de Tavira, Diego Sieres, Emiliano Guerra, Yolanda Orizaga', 'Depois que sua esposa é assassinada e sua filha levada por seu maior inimigo, Don Diego (Anthony Hopkins) passa mais de 20 anos na prisão. Quando consegue fugir, toma o ladrão Alejandro Murrieta (Antonio Banderas) como pupilo a fim de transformá-lo em um novo Zorro e, com isso, vingar-se de seu antigo desafeto.', 0, 'helena', NULL, NULL),
(NULL, 826, 'A Outra História Americana', 'American History X', 'Estados Unidos', 'Drama', 'Tony Kaye', '15438013985c048a36f349f.jpg', 119, 1998, '715wjoUMrro', 'Edward Norton, Edward Furlong, Beverly D\'Angelo, Jennifer Lien', 'Derek (Edward Norton) busca vazão para suas agruras tornando-se líder de uma gangue de racistas. A violência o leva a um assassinato, e ele é condenado pelo crime. Três anos mais tarde, ele sai da prisão e tem que convencer seu irmão (Edward Furlong), que está prestes a assumir a liderança do grupo, a não trilhar o mesmo caminho.', 0, 'helena', NULL, NULL),
(NULL, 827, 'Quando as Luzes se Apagam', 'Lights Out', 'Estados Unidos', 'Terror', 'David F. Sandberg', '15438015845c048af0de31c.jpg', 81, 2016, 'aH3lLOumNoQ', 'Teresa Palmer, Gabriel Bateman, Alexander DiPersia, Billy Burke', 'Desde que era pequena, Rebecca tinha uma porção de medos, especialmente quando as luzes se apagavam. Ela acreditava ser perseguida pela figura de uma mulher e anos mais tarde seu irmão mais novo começa a sofrer do mesmo problema. Juntos eles descobrem que a aparição está ligada à mãe deles, Rebecca começa a investigar o caso e chega perto de conhecer a terrível verdade.', 0, 'helena', NULL, NULL),
(NULL, 828, 'Cam', 'Cam', 'Estados Unidos', 'Mistério', 'Daniel Goldhaber', '15438065475c049e5350549.jpg', 94, 2018, '2GXHmHr5HSI', 'Madeline Brewer, Patch Darragh, Melora Walters, Devin Druid', 'Alice (Madeline Brewer) é uma ambiciosa jovem mulher que trabalha com pornografia de webcam. Quando uma misteriosa mulher idêntica a ela toma seu canal, ela se vê perdendo o controle sobre os limites que estabeleceu em relação a sua identidade online e os homens na sua vida.', 0, 'nadalini', NULL, NULL),
(NULL, 829, 'Perdido em Marte', 'The Martian', 'Estados Unidos', 'Adventure, Drama, Sc', 'Ridley Scott', '15438521895c05509de11b5.jpg', 144, 2015, 'QVX5DSzRn14', 'Matt Damon, Jessica Chastain, Kristen Wiig, Jeff Daniels', 'Durante uma missão a Marte, o astronauta americano Mark Watney é dado como morto e deixado para trás. Mas Watney ainda está vivo. Contra todas as probabilidades, ele procura uma maneira de entrar em contato com a Terra.\r\n', 0, 'iris', NULL, NULL),
(NULL, 830, 'O Palhaço', 'O Palhaço', 'Brasil', 'Comédia dramática', 'Selton Mello', '15438525385c0551fa9ed50.jpg', 88, 2011, 'DzS9nGJc5Sk', NULL, 'Benjamim e Valdemar formam a divertida dupla de palhaços Pangaré e Puro Sangue. Mas Benjamin decide deixar o circo e mergulhar em uma nova aventura para realizar um grande sonho.', 0, 'iris', NULL, NULL),
(NULL, 831, 'Looper: Assassinos do Futuro', 'Looper', 'Estados Unidos', 'Ficção Científica', 'Rian Johnson', '15438528175c05531150381.jpg', 113, 2012, 'KG-cmT4MFgo', 'Joseph Gordon-Levitt, Bruce Willis, Emily Blunt, Paul Dano', 'Kansas City, 2044. Viagens no tempo são uma realidade, mas estão apenas disponíveis no mercado negro. Seu principal cliente é a máfia, que costuma enviar ao passado pessoas que deseja que sejam eliminadas, já que é bastante complicado se livrar dos corpos no futuro. Os responsáveis por estes assassinatos são os loopers, organização a qual Joe (Joseph Gordon-Levitt) faz parte. Um dia, ao realizar mais um serviço corriqueiro, ele descobre que seu alvo é a versão mais velha de si mesmo (Bruce Willis), trazida em viagem no tempo por ter se tornado uma séria ameaça à máfia no futuro.', 0, 'iris', NULL, NULL),
(NULL, 832, 'Velocidade Máxima', 'Speed', 'Estados Unidos', 'Crime', 'Jan de Bont', '15438530095c0553d1e4982.jpg', 116, 1994, '8EW2wpplyZU', 'Keanu Reeves, Dennis Hopper, Sandra Bullock, Joe Morton', 'Howard Payne é um psicopata que está ameaçando Los Angeles com explosivos. Jack Traven é o agente que está perto de capturá-lo. Quando Payne instala bombas em um ônibus, Jack precisa evacuar os passageiros sem reduzir a velocidade do veículo para menos de 80 km por hora. Para complicar, a motorista, Annie, nunca dirigiu um ônibus antes.', 0, 'iris', NULL, NULL),
(NULL, 833, 'Peter Pan', 'Pan', 'Estados Unidos', 'Fantasia', 'Joe Wright', '15438531445c055458a2885.jpg', 111, 2015, 'Gt-yG0e9-MI', 'Hugh Jackman, Levi Miller, Garrett Hedlund, Rooney Mara', 'Peter é um menino travesso de 12 anos que vive em um sombrio orfanato em Londres. Em uma noite inacreditável, Peter é levado do orfanato a um mundo fantástico de piratas, guerreiros e fadas, chamado Terra do Nunca. Lá, ele vive aventuras incríveis enquanto tenta descobrir o segredo da sua mãe, que o deixou no orfanato há tanto tempo. Na companhia da guerreira Tiger Lily e do novo amigo chamado James Hook, Peter deve derrotar o cruel pirata Blackbeard e se tornar o herói da Terra do Nunca.', 0, 'iris', NULL, NULL),
(NULL, 834, 'O Aviso', 'El Aviso', 'Espanha', 'Adventure, Comedy, D', 'Daniel Calparsoro', '15438535925c05561834f35.jpg', 80, 2018, 'Ozae5C4eyGA', NULL, 'Jon (Raúl Arévalo) é um gênio incompreendido da matemática, cujo futuro promissor foi solapado por um diagnóstico de esquizofrenia. Quando ele presencia um assalto no qual seu amigo, David (Sergio Mur), é baleado, a antiga paixão pela ciência é reacesa. Comovido pela eminente morte de David, o jovem passa a investigar a ligação entre diversos roubos anteriores e descobre um padrão matemático entre eles. Segundo seus cálculos, a próxima vítima será Nico (Hugo Arbues), um garoto inocente de 10 anos.', 0, 'iris', NULL, NULL),
(NULL, 835, 'Fica Comigo', 'You Get Me', 'Estados Unidos', 'Romance', 'Brent Bonacorso', '15438540415c0557d9d6f6a.jpg', 89, 2017, 'oF5Cg628wm4', 'Bella Thorne, Halston Sage, Taylor John Smith, Nash Grier', 'A bela e jovem Holly está completamente obcecada: depois de uma transa intensa com Tyler, ela decide iniciar uma jornada árdua para conseguir ficar com ele a qualquer custo. O primeiro passo foi se matricular na mesma escola dele, para ficar atenta a todos os seus passos. O que deveria ser apenas mais uma paixão adolescente começará a passar de todos os limites.\r\n', 0, 'iris', NULL, NULL),
(NULL, 836, '#REALITYHIGH', '#REALITYHIGH', 'Estados Unidos', 'Comédia dramática', 'Fernando Lebrija', '15438544155c05594fd0231.jpg', 99, 2017, 'zS_DBMlQxeY', 'Keith Powers, Michael Provost, Nesta Cooper, Anne Winters, Jake Borelli, Alicia Sanz, Kate Walsh, John Michael Higgins, Peter Gilroy, Rebekah Graf', 'Dani Barnes (Nesta Cooper) é uma jovem nerd percorrendo um grande sonho de ser aceita na UC Davis, a melhor universidade veterinária do mundo. Mas seus planos podem ir por água abaixo quando ela finalmente chama a atenção do garoto que ela estavam afim: a namorada dele, uma cebelebridade nas redes sociais, despertou sua fúria por Dani.', 0, 'iris', NULL, NULL),
(NULL, 838, 'Perfeita para Você', 'Irreplaceable You', 'Estados Unidos', 'Comédia dramática', 'Stephanie Laing', '15438548925c055b2c4731d.jpg', 96, 2018, '8ohALiKZ2oo', 'Gugu Mbatha-Raw, Michiel Huisman, Steve Coogan, Timothy Simons', 'Abbie (Gugu Mbatha-Raw) e Sam (Michiel Huisman) se conhecem desde os oito anos de idade e acreditam ser almas gêmeas, destinadas a ficar juntos para sempre. Mas, tudo muda quando um deles recebe a notícia de que tem câncer terminal.', 0, 'iris', NULL, NULL),
(NULL, 839, 'Raça', 'Race', 'Canadá', 'Biografia', 'Stephen Hopkins', '15438554165c055d38f3ced.jpg', 134, 2016, 'idHPNCqhw8M', 'Stephan James, Jason Sudeikis, Eli Goree, Shanice Banton', 'A história de Jesse Owens, atleta americano que superou o racismo e não só participou dos Jogos Olímpicos de Berlim em 1936, em pleno regime nazista, como conquistou quatro medalhas de ouro.', 0, 'iris', NULL, NULL),
(NULL, 840, 'Raça', 'Raça', 'Brasil', 'Documentário', 'Joel Zito Araújo', '15438557045c055e589e2d0.jpg', 104, 2013, 'OWqoJogP0qA', 'N/A', 'Este documentário busca trazer o foco para o trabalho de três afro-brasileiros que estão lutando por igualdade racial: Paulo Paim, o único negro senador da república; Netinho de Paula, cantor e apresentador de TV e Miúda dos Santos, ativista quilombola e neta de escravos.', 0, 'iris', NULL, NULL),
(NULL, 841, 'Extermínio', '28 Days Later', 'Estados Unidos', 'Ficção Científica', 'Danny Boyle', '15438562625c056086c996c.jpg', 113, 2002, 'dgceWzuFDCI', 'Alex Palmer, Bindu De Stoppani, Jukka Hiltunen, David Schneider', 'Uma praga transforma a maioria da humanidade em zumbis sedentos de sangue. Um grupo ainda não afetado se prepara para a mais perigosa jornada de suas vidas: tentar chegar a uma fortaleza militar em Manchester.', 0, 'iris', NULL, NULL),
(NULL, 842, 'Robin Hood - A Origem', 'Robin Hood', 'Estados Unidos', 'Aventura', 'Otto Bathurst', '15438740245c05a5e843778.jpg', 116, 2018, 'bLn62bTFIQE', 'Taron Egerton, Jamie Foxx, Ben Mendelsohn, Eve Hewson', 'A origem da famosa lenda sobre o ladrão que rouba dos ricos para dar aos pobres é contada a partir de quando Robin Hood (Taron Egerton) volta das Cruzadas e surpreende-se ao encontrar a Floresta Sherwood infestada de criminosos. Ele não deixará que as coisas permaneçam desse jeito e contará com a ajuda de John (Jamie Foxx) e Marian (Eve Hewson) para trazer justiça à cidade.', 0, 'matheus', NULL, NULL),
(NULL, 843, '127 Horas', '127 Hours', 'Estados Unidos', 'Drama', 'Danny Boyle', '15438779515c05b53fd170e.jpg', 94, 2010, 'ivp3I_8shRg', 'James Franco, Kate Mara, Amber Tamblyn, Sean Bott', 'Baseado na história real de como alpinista Aron Ralston lutou para salvar a própria vida após um acidente. Em maio de 2003, Aron (vivido por James Franco) fazia mais uma escalada nas montanhas de Utah, Estados Unidos, quando acabou ficando com seu braço preso em uma fenda. Sua luta pela sobrevivência durante mais de cinco dias (durou 127 horas) foi marcada por memórias e momentos de muita tensão. Dirigido por Danny Boyle, o longa conquistou seis indicações ao Oscar.', 0, 'helena', NULL, NULL),
(NULL, 844, 'Dias em Família ', 'Days and Nights', 'Estados Unidos', 'Comédia dramática', 'Christian Camargo', '15438784535c05b73568996.jpg', 92, 2014, '1GqWmvEKATc', 'Allison Janney, Katie Holmes, Ben Whishaw, Mark Rylance', 'Durante um feriado, a estrela de cinema Elizabeth decide levar o namorado Peter para a casa de sua família, à beira do lago. Várias pessoas moram no lugar, como o irmão de Elizabeth, seu sobrinho, o médico da família e o casal de empregados com sua filha temperamental. Durante o fim de semana, revelações e rancores são revelados, levando à crise familiar.', 0, 'helena', NULL, NULL),
(NULL, 845, 'Tully', 'Tully', 'Estados Unidos', 'Drama', 'Jason Reitman', '15438785715c05b7ab5e031.jpg', 95, 2018, 'DAZ-fpkjx4g', 'Charlize Theron, Mackenzie Davis, Ron Livingston, Asher Miles Fallica', 'Marlo (Charlize Theron), mãe de três filhos, sendo um deles um recém-nascido, vive uma vida muito atarefada, e, certo dia, ganha de presente de seu irmão: uma babá para cuidar das crianças durante a noite. Antes um pouco hesitante, Marlo acaba se surpreendendo com Tully (Mackenzie Davis).', 0, 'helena', NULL, NULL),
(NULL, 846, 'Somente o Mar Sabe', 'The Mercy', 'Reino Unido', 'Drama', 'James Marsh', '15438786875c05b81f6e6d6.png', 112, 2018, 'UJUhTqFIYhg', 'Rachel Weisz, David Thewlis, Colin Firth, Mark Gatiss', 'Donald Crowhurst (Colin Firth), empresário britânico e navegante amador, decide se tornar o primeiro homem a dar a volta ao mundo sem paradas, vencendo a Golden Globe Race de 1968 e faturando um polpudo prêmio. Deixando em terra mulher (Rachel Weisz), filhos e muitas dívidas referentes à construção de sua inovadora embarcação, ele parte numa solitária aventura náutica marcada por problemas, inexperiência e desespero.', 0, 'helena', NULL, NULL),
(NULL, 847, 'Diamante de Sangue', 'Blood Diamond', 'Estados Unidos', 'Aventura', 'Edward Zwick', '15438788825c05b8e2b9ddc.jpg', 143, 2006, 'r0iDAjXWU4Q', 'Leonardo DiCaprio, Djimon Hounsou, Jennifer Connelly, Kagiso Kuypers', 'Serra Leoa, final da década de 90. O país está em plena guerra civil, com conflitos constantes entre o governo e a Força Unida Revolucionária (FUR). Quando uma tropa da FUR invade uma aldeia da etnia Mende, o pescador Solomon Vandy (Djimon Hounsou) é separado de sua família, que consegue fugir. Solomon é levado a um campo de mineração de diamantes, onde é obrigado a trabalhar. Lá ele encontra um diamante cor-de-rosa, que tem cerca de 100 quilates. Solomon consegue escondê-lo em um pedaço de pano e o enterra, mas é descoberto por um integrante da FUR. Neste exato momento ocorre um ataque do governo, que faz com que Solomon e vários dos presentes sejam presos. Ao chegar na cadeia lá está Danny Archer (Leonardo DiCaprio), um ex-mercenário nascido no Zimbábue que se dedica a contrabandear diamantes para a Libéria, de onde são vendidos a grandes corporações. Danny ouve um integrante da FUR acusar Solomon de ter escondido o diamante e se interessa pela história. Ao deixar a prisão Danny faz com que Solomon também saia, propondo-lhe um trato: que ele mostre onde o diamante está escondido, em troca de ajuda para que possa encontrar sua família. Solomon não acredita em Danny mas, sem saída, aceita o acordo.', 0, 'helena', NULL, NULL),
(NULL, 848, '(500) Dias com Ela', '(500) Days of Summer', 'Estados Unidos', 'Comédia romântica', 'Marc Webb', '15438790535c05b98d470e3.jpg', 95, 2009, 'RUHnqU9TbNA', 'Zooey Deschanel, Joseph Gordon-Levitt, Minka Kelly, Geoffrey Arend, Clark Gregg, Rachel Boston, Chlöe Moretz, Matthew Gray Gluber, Yvette Nicole Brown', 'Tom Hansen (Joseph Gordon-Levitt) está em uma reunião com seu chefe, Vance (Clark Gregg), quando ele apresenta sua nova assistente, Summer Finn (Zooey Deschanel). Tom logo fica impressionado com sua beleza, o que faz com que tente, nas duas semanas seguintes, realizar algum tipo de contato. Sua grande chance surge quando seu melhor amigo o convida a ir em um karaokê, onde os colegas de trabalho costumam ir. Lá Tom encontra Summer. Eles também cantam e conversam sobre o amor, dando início a um relacionamento.', 0, 'helena', NULL, NULL),
(NULL, 849, 'Colombiana: Em Busca de Vingança', 'Colombiana', 'França', 'Crime', 'Olivier Megaton', '15439463565c06c0749b51c.jpg', 108, 2011, 'ctcNn-oCDZU', 'Zoe Saldana, Jordi Mollà, Lennie James, Amandla Stenberg', 'Cataleya se tornou uma assassina cruel após testemunhar a morte de seus pais quando era criança em Bogotá. Ela trabalha como matadora de aluguel, mas, em seu tempo livre, fica atenta, procurando o mafioso que assassinou seus pais.', 0, 'iris', NULL, NULL),
(NULL, 850, 'Capitã Marvel', 'Captain Marvel', 'Estados Unidos', 'Herói', 'Anna Boden', '15439529015c06da0503e90.jpg', 0, 2019, 'JhY6Yy4wtb4', 'Mckenna Grace, Gemma Chan, Brie Larson, Jude Law', 'Aventura sobre Carol Danvers, uma agente da CIA que tem contato com uma raça alienígena e ganha poderes sobre-humanos. Entre os seus poderes estão uma força fora do comum e a habilidade de voar.', 0, 'matheus', NULL, NULL),
(NULL, 851, 'O Estranho Mundo de Jack', 'The Nightmare Before Christmas', 'Estados Unidos', 'Animação', 'Henry Selick', '15439534235c06dc0f22135.jpg', 76, 1993, 'LuvdeINbNhM', 'Danny Elfman, Chris Sarandon, Catherine O\'Hara, William Hickey', 'Jack Skellington (Chris Sarandon) é um ser fantástico que vive na Cidade do Halloween, um local cercado por criaturas fantásticas. Lá todos passam o ano organizando o Halloween do ano seguinte mas, após mais um Halloween, Jack se mostra cansado de fazer aquilo todos os anos. Assim ele deixa os limites da Cidade do Halloween e vagueia pela floresta. Por acaso acha alguns portais, sendo que cada um leva até um tipo festividade. Jack acaba atravessando o portal do Natal, onde vê demonstrações do espírito natalino. Ao retornar para a Cidade do Halloween, sem ter compreendido o que viu, ele começa a convencer os cidadãos a sequestrarem o Papai Noel (Edward Ivory) e fazerem seu próprio Natal. Apesar de argumentos fortes de sua leal namorada Sally (Catherine O\'Hara) contra o projeto, o Papai Noel é capturado. Mas os fatos mostrarão que Sally estava totalmente certa.', 0, 'matheus', NULL, NULL),
(NULL, 853, 'Assim na Terra Como no Inferno', 'As Above, So Below', 'Estados Unidos', 'Terror', 'John Erick Dowdle', '15439541025c06deb67b1d6.jpg', 93, 2014, 'ry4QSkZYS64', 'Perdita Weeks, Ben Feldman, Edwin Hodge, François Civil', 'Um grupo de arqueólogos está em busca de um tesouro perdido e, para isso, explora o desconhecido labirinto de ossos nas catacumbas abaixo de Paris. Aquela região, conhecida como a cidade dos mortos, revela um segredo que mexerá com a psique humana de modo que os demônios pessoais de cada um voltarão para assombrá-los.', 0, 'matheus', NULL, NULL),
(NULL, 854, 'A Pirâmide', 'The Pyramid', 'Estados Unidos', 'Terror', 'Grégory Levasseur', '15439545945c06e0a22e6fb.jpg', 89, 2014, 'v0Yo9xasRKg', 'Ashley Hinshaw, Denis O\'Hare, James Buckley, Christa Nicola', 'Uma equipe de arqueologistas norte-americanos encontra uma rara pirâmide trilateral enterrada no deserto egípcio. Empolgados com a descoberta, conseguem acessá-la e iniciam a exploração. Perdidos nas escuras catacumbas, eles percebem que não estão sozinhos e, desesperados, buscam uma rapidamente uma saída antes que seja tarde demais.', 0, 'matheus', NULL, NULL),
(NULL, 855, 'Quem Quer Ser Um Milionário?', 'Slumdog Millionaire', 'Reino Unido', 'Drama', 'Danny Boyle', '15439567825c06e92e5bc77.jpg', 120, 2008, 'dlC6oQPh0N4', 'Dev Patel, Saurabh Shukla, Anil Kapoor, Raj Zutshi', 'Jamal Malik é um rapaz de 18 anos que teve uma infância muito difícil, lidando com a violência e a miséria na Índia. Ele é chamado para participar da versão indiana do famoso programa de TV \"Quem quer ser um milionário?\" e sua experiência de vida o ajuda a responder as perguntas do show. Porém a polícia desconfia da honestidade de Jamal, que deve provar sua inocência.', 0, 'nadalini', NULL, NULL),
(NULL, 856, 'Faroeste Caboclo', 'Faroeste Caboclo', 'Brasil', 'Romance', 'René Sampaio', '15439608345c06f902183ad.jpg', 108, 2013, '4azYkNkPtJg', NULL, 'Baseado na música escrita por Renato Russo, o longa acompanha a história de João do Santo Cristo, que deixa Salvador, sua cidade natal, e se muda para a Brasília em busca de uma vida melhor. Lá, ele encontra a miséria e o crime, mas também descobre o amor nos braços de Maria Lúcia, por quem se apaixona e com quem gostaria de viver uma vida feliz. Porém, o envolvimento com o tráfico de drogas e com Jeremias, um traficante rival, coloca tudo a perder.', 0, 'nadalini', NULL, NULL),
(NULL, 857, 'Alien: Covenant', 'Alien: Covenant', 'Estados Unidos', 'Ficção Científica', 'Ridley Scott', '15440237235c07eeab721dd.jpg', 122, 2017, '5incfB5jHWU', 'Michael Fassbender, Katherine Waterston, Billy Crudup, Danny McBride', '2104. Viajando pela galáxia, a nave colonizadora Covenant tem por objetivo chegar ao planeta Origae-6, bem distante da Terra. Um acidente cósmico antes de chegar ao seu destino faz com que Walter (Michael Fassbender), o andróide a bordo da espaçonave, seja obrigado a despertar os 17 tripulantes da missão. Logo Oram (Billy Crudup) precisa assumir o posto de capitão, devido a um acidente ocorrido no momento em que todos são despertos. Em meio aos necessários consertos, eles descobrem que nas proximidades há um planeta desconhecido, que abrigaria as condições necessárias para abrigar vida humana. Oram e sua equipe decidem ir ao local para investigá-lo, considerando até mesmo a possibilidade de deixar de lado a viagem até Origae-6 e se estabelecer por lá. Só que, ao chegar, eles rapidamente descobrem que o planeta abriga seres mortais.', 0, 'matheus', NULL, NULL),
(NULL, 858, 'O Nevoeiro', 'The Mist', 'Estados Unidos', 'Terror', 'Frank Darabont', '15440241425c07f04e47138.jpg', 126, 2007, 'ho9fmduWcaU', 'Thomas Jane, Marcia Gay Harden, Laurie Holden, Andre Braugher', 'Após uma violenta tempestade devastar a cidade de Maine, David Drayton (Thomas Jane) e Billy (Nathan Gamble), seu filho de 8 anos, correm rumo ao supermercado, temendo que os suprimentos se esgotem. Porém um estranho nevoeiro toma conta da cidade, o que faz com que David, Billy e outras pessoas fiquem presas no supermercado. Logo David descobre que há algo de sobrenatural envolvido e que, caso deixem o local, isto pode ser fatal.', 0, 'matheus', NULL, NULL),
(NULL, 859, 'Lincoln', 'Lincoln', 'Estados Unidos', 'Biografia', 'Steven Spielberg', '15440246335c07f239e0cf1.jpg', 150, 2012, 'b6WkKvgn2G4', 'Daniel Day-Lewis, Sally Field, David Strathairn, Joseph Gordon-Levitt', 'Baseado no livro “Team of Rivals: The Genius of Abraham Lincoln”, de Doris Kearns Goodwin, o filme se passa durante a Guerra Civil norte-americana, que acabou com a vitória do Norte. Ao mesmo tempo em que se preocupava com o conflito, o o 16º presidente norte-americano, Abraham Lincoln (Daniel Day-Lewis), travava uma batalha ainda mais difícil em Washington. Ao lado de seus colegas de partido, ele tentava passar uma emenda à Constituição dos Estados Unidos que acabava com a escravidão.', 0, 'matheus', NULL, NULL),
(NULL, 860, 'Abraham Lincoln: Caçador de Vampiros', 'Abraham Lincoln: Vampire Hunter', 'Estados Unidos', 'Fantasia', 'Timur Bekmambetov', '15440247815c07f2cd2fa89.jpg', 105, 2012, 'FGDF8yj4808', 'Benjamin Walker, Dominic Cooper, Anthony Mackie, Mary Elizabeth Winstead', 'Nancy Lincoln (Robin McLeavy) é a mãe do presidente Abraham Lincoln (Benjamin Walker) e foi assassinada por uma criatura sobrenatural. Incorfomado com o fato, ele declara uma guerra sem piedade contra os seres das trevas e começa a destruir todos os vampiros e os escravos que os ajudam. Dirigido por Timur Bekmambetov (O Procurado) e estrelado por Benjamin Walker, Dominic Cooper e Mary Elizabeth Winstead.', 0, 'matheus', NULL, NULL),
(NULL, 861, 'Shazam!', 'Shazam!', 'Estados Unidos', 'Herói', 'David F. Sandberg', '15440276625c07fe0ebf5a8.jpg', 0, 2019, 'VIDmMoSeG30', 'Zachary Levi, Mark Strong, Michelle Borth, Adam Brody', 'Billy Batson (Asher Angel) tem apenas 14 anos de idade, mas recebeu de um antigo mago o dom de se transformar num super-herói adulto chamado Shazam (Zachary Levi). Ao gritar a palavra SHAZAM!, o adolescente se transforma nessa sua poderosa versão adulta para se divertir e testar suas habilidades. Contudo, ele precisa aprender a controlar seus poderes para enfrentar o malvado Dr. Thaddeus Sivana (Mark Strong).', 0, 'matheus', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 862, 'Sexta-Feira Muito Louca', 'Freaky Friday', 'Estados Unidos', 'Comédia', 'Mark Waters', '15440888235c08ecf72adcb.jpg', 97, 2003, 'N0YMnqMVgrQ', 'Jamie Lee Curtis, Lindsay Lohan, Mark Harmon, Harold Gould', 'Tess (Jamie Lee Curtis) e Anna (Lindsay Lohan) são mãe e filha que vivem às turras. Decididas a acabar com as brigas, elas repentinamente trocam de corpos. Agora cada uma precisa aprender a lidar com a vida da outra, com as confusões crescendo ainda mais pelo fato de Tess estar de casamento marcado.', 0, 'helena', NULL, NULL),
(NULL, 863, 'Confissões de Adolescente', 'Confissões de Adolescente', 'Brasil', 'Comédia dramática', 'Daniel Filho', '15440889745c08ed8ee9875.jpg', 96, 2013, 'PRzkD4Zfquc', 'Sophia Abrahão, Bella Camero, Malu Rodrigues, Clara Tiezzi', 'Paulo (Cássio Gabus Mendes) está passando por dificuldades financeiras para sustentar as quatro filhas, Tina (Sophia Abrahão), Bella Camero (Bianca), Malu Rodrigues (Alice) e Clara Tiezzi (Karina), depois que anunciaram um novo aumento no aluguel. Quando ele avisa que eles precisam se mudar do apartamento onde vivem, na Barra da Tijuca (Zona Oeste do Rio), elas se comprometem em ajudar de alguma forma, começando a cortar despesas bobas e ajudando nas tarefas domésticas. Mas enquanto precisam lidar com essa novidade, o quarteto tem ainda outras experiências típicas, relacionadas a idade de cada um delas. Tina vem penando para conseguir um primeiro trabalho, ao mesmo tempo que vem se desentendendo com o namorado riquinho. Bianca, por outro lado, esconde uma relação misteriosa, diferente de sua irmã Alice,  ainda virgem, e as voltas com a famigerada primeira vez. Correndo por fora, Karina é a mais nerd da turma e anda atraindo as atenções de um dos colegas da escola, mas eles ainda não sabem bem ao certo como lidar com isso. Apesar dos conflitos, a união entre elas permanece e as experiências, tudo indica, irão contribuir ainda mais para manter a família unida.', 0, 'helena', NULL, NULL),
(NULL, 864, 'A Casa de Cera', 'House of Wax', 'Estados Unidos', 'Terror', 'Jaume Collet-Serra', '15440892055c08ee75d487e.jpg', 108, 2005, 'iRzDyUQi2Qk', 'Elisha Cuthbert, Chad Michael Murray, Brian Van Holt, Paris Hilton', 'Carly (Elisha Cuthbert), Paige (Paris Hilton), Wade (Jared Padalecki), Nick (Chad Michael Murray) e mais dois amigos decidem viajar de carro para o maior campeonato universitário de futebol americano a ser realizado no ano. Durante a viagem eles decidem acampar à noite, planejando seguir adiante pela manhã. Um acidente com um motorista de caminhão assusta o grupo, que no dia seguinte descobre que o carro em que estavam foi danificado. Sem saída, eles aceitam uma carona até Ambrose, a cidade mais perto do local. Ao chegar chama a atenção do grupo a Casa de Cera de Trudy, a principal atração de Ambrose, que possui várias estátuas de cera bastante parecidas com pessoas de verdade. Porém o que eles não sabem é o motivo pelo qual as estátuas parecem tão reais.', 0, 'helena', NULL, NULL),
(NULL, 865, 'Internet: O Filme', 'Internet: O Filme', 'Brasil', 'Comédia', 'Filippo Capuzzi Lapietra', '15440893555c08ef0b4645b.jpg', 97, 2017, 'AaxgO8qJXZ4', 'Rafinha Bastos, Paulinho Serra, Felipe Castanhari, Pathy dos Reis', 'A realização de uma convenção de youtubers em um hotel atrai influenciadores de todo tipo e, é claro, seus fãs. A estrela maior do evento é Uesley (Gusta Stockler), um arrogante youtuber que destrata todos à sua volta e apenas se importa com a própria popularidade. Ao publicar em seu canal o flagra do beijo entre Mateus (Felipe Castanhari) e Natalia (Pathy dos Reis), Uesley sem querer impulsiona a popularidade da dupla, que passa a conquistar fãs como casal e, consequentemente, ofuscá-lo. Paralelamente, três amigos fazem uma aposta para que Vepê (Teddy) seduza Barbarinha (Polly Marinho), em troca de uma passagem para Los Angeles, e duas amigas, Malu (Thaynara OG) e Fabi (Gabi Lopes), chegam ao hotel sem saber que o local será palco de uma convenção de youtubers. Há ainda Cesinha Passos (Rafinha Bastos), que precisa aprender a lidar com a má fama que possui ao mesmo tempo em que convive com Adalgamir (Paulinho Serra), um fã que passa a trabalhar com ele, e também Paulinho (Rafael Cellbit), especialista em Street Fighter que se fantasia como youtuber e agora sofre a ameaça de ser desmascarado.', 0, 'helena', NULL, NULL),
(NULL, 866, 'Teenage Cocktail', 'Teenage Cocktail', 'Estados Unidos', 'Drama', 'John Carchietta', '15440894925c08ef94c9863.jpg', 88, 2016, 'SWnKObOLctQ', 'Nichole Bloom, Fabianne Therese, Pat Healy, Michelle Borth', 'Sentindo -se confinadas em sua pequena cidade e oprimidas pelos pais, Annie e Jules armam um esquema para fugir. O único problema é que elas não possuem dinheiro. Jules sugere que as duas façam exibições sensual pela webcam. Annie fica nervosa no começo, mas quando o dinheiro começa a parecer ela não consegue dizer não. Porém, como elas logo descobrem, as consequências podem tomar conta delas.\r\n', 0, 'helena', NULL, NULL),
(NULL, 867, 'Ted ', 'Ted', 'Estados Unidos', 'Comédia', 'Seth MacFarlane', '15440896625c08f03e44240.jpg', 106, 2012, 'ayiOcR4nEnI', 'Mark Wahlberg, Mila Kunis, Seth MacFarlane, Joel McHale', 'É Natal e o pequeno John tem apenas um pedido a fazer ao Papai Noel: que seu ursinho de pelúcia, Ted, ganhe vida. O garoto fica surpreso ao perceber que seu pedido foi atendido e logo eles se tornam grandes amigos. John e Ted crescem juntos e o urso de pelúcia se torna bastante mal humorado com a idade. Já adulto, John (Mark Wahlberg) precisa decidir entre manter a amizade de infância ou o namoro com Lori Collins (Mila Kunis).', 0, 'helena', NULL, NULL),
(NULL, 868, 'Ted 2', 'Ted 2', 'Estados Unidos', 'Comédia', 'Seth MacFarlane', '15440897545c08f09a33589.jpg', 115, 2015, 'MQ-7kKqp2is', 'Mark Wahlberg, Seth MacFarlane, Amanda Seyfried, Jessica Barth', 'Completamente apaixonado, Ted (voz de Seth MacFarlane) decide se casar com Tami-Lynn (Jessica Barth). Entretanto, não demora muito para que o casal entre em crise. Querendo evitar um possível divórcio, Ted resolve ter um filho. Tami-Lynn logo fica empolgada com a ideia, o que faz com que o casal inicie uma busca sobre quem poderia ser o doador de esperma ideal para o bebê. Seu grande amigo John (Mark Wahlberg) o ajuda na tarefa, mas logo Ted descobre que não pode ter um filho porque, legalmente, ele não é uma pessoa, e sim uma propriedade. Começa então uma batalha judicial em que o urso de pelúcia tenta provar que merece ser considerado um cidadão como qualquer outro ser humano.', 0, 'helena', NULL, NULL),
(NULL, 869, 'Aurora', 'Sunrise: A Song of Two Humans', 'Estados Unidos', 'Drama', 'F. W. Murnau ', '15440900525c08f1c40820c.jpg', 97, 1927, '3r8nQT5Z9hw', NULL, 'Um homem pondera matar sua inocente esposa, mas é acometido pela culpa, e a mulher reage com terror quando suas intenções ficam claras. Enquanto isso, o marido que tenta levar adiante o plano é atormentado por uma sedutora mulher da cidade, que chega a assombrar os pensamentos do homem. O casal do interior acaba tendo suas vidas destruídas por causa dessa mulher que veio de fora.', 0, 'helena', NULL, NULL),
(NULL, 870, 'Luzes da Cidade', 'City Lights', 'Estados Unidos', 'Comédia dramática', 'Charles Chaplin', '15440902625c08f2967ae14.jpg', 87, 1931, 'PaVM8V1JfXE', 'Virginia Cherrill, Florence Lee, Harry Myers, Al Ernest Garcia', 'Um vagabundo (Charles Chaplin) impede um homem rico (Harry Myers), que está bêbado, de se matar. Grato, ele o convida até sua casa e se torna seu amigo. Só que ele esquece completamente o que aconteceu quando está sóbrio, o que faz com que o vagabundo seja tratado de forma bem diferente. Paralelamente, o vagabundo se interessa por uma florista cega (Virginia Cherrill), a quem tenta ajudar a pagar o aluguel atrasado e a restaurar a visão. Só que ela pensa que seu benfeitor é, na verdade, um milionário.', 0, 'helena', NULL, NULL),
(NULL, 871, 'Tempos Modernos', 'Modern Times', 'Estados Unidos', 'Comédia dramática', 'Charles Chaplin', '15440903865c08f312be774.jpg', 87, 1936, 'FNv7M-UPNuY', 'Charles Chaplin, Paulette Goddard, Henry Bergman, Tiny Sandford', 'Um operário de uma linha de montagem, que testou uma \"máquina revolucionária\" para evitar a hora do almoço, é levado à loucura pela \"monotonia frenética\" do seu trabalho. Após um longo período em um sanatório ele fica curado de sua crise nervosa, mas desempregado. Ele deixa o hospital para começar sua nova vida, mas encontra uma crise generalizada e equivocadamente é preso como um agitador comunista, que liderava uma marcha de operários em protesto. Simultaneamente uma jovem rouba comida para salvar suas irmãs famintas, que ainda são bem garotas. Elas não tem mãe e o pai delas está desempregado, mas o pior ainda está por vir, pois ele é morto em um conflito. A lei vai cuidar das órfãs, mas enquanto as menores são levadas a jovem consegue escapar.', 0, 'helena', NULL, NULL),
(NULL, 872, 'Encontros e Desencontros', 'Lost in Translation', 'Estados Unidos', 'Drama', 'Sofia Coppola', '15440906385c08f40e14b96.jpg', 102, 2003, 'pcumlhQTkXs', 'Scarlett Johansson, Bill Murray, Akiko Takeshita, Kazuyoshi Minamimagoe', 'Bob Harris (Bill Murray) é uma estrela de cinema, que está em Tóquio para fazer um comercial de uísque. Charlotte (Scarlett Johansson), por sua vez, está na cidade acompanhando seu marido, um fotógrafo workaholic (Giovanni Ribisi) que a deixa sozinha o tempo todo. Sofrendo com o horário, Bob e Charlotte não conseguem dormir. Eles se encontram, por acaso, no bar de um hotel de luxo, e em pouco tempo tornam-se grandes amigos.', 0, 'helena', NULL, NULL),
(NULL, 873, 'Carandiru', 'Carandiru', 'Brasil', 'Drama', 'Hector Babenco', '15440908595c08f4ebad807.jpg', 145, 2003, 'BdLvrNz9tUk', 'Luiz Carlos Vasconcelos, Milton Gonçalves, Ivan de Almeida, Ailton Graça', 'Um médico (Luiz Carlos Vasconcelos) se oferece para realizar um trabalho de prevenção a AIDS no maior presídio da América Latina, o Carandiru. Lá ele convive com a realidade dos cárceres, que inclui violência, superlotação das celas e instalações precárias. Porém, apesar de todos os problemas, o médico logo percebe que os prisioneiros não são figuras demoníacas, existindo dentro da prisão solidariedade, organização e uma grande vontade de viver.', 0, 'helena', NULL, NULL),
(NULL, 874, 'A Hora Mais Escura', 'Zero Dark Thirty', 'Estados Unidos', 'Suspense', 'Kathryn Bigelow', '15440910955c08f5d738f7b.jpg', 157, 2012, 'GPBvmckriE4', 'Jason Clarke, Reda Kateb, Jessica Chastain, Kyle Chandler', 'Os ataques terroristas sofridos pelos Estados Unidos em 11 de setembro de 2001 deram início a uma época de medo e paranoia do povo americano em relação ao inimigo, onde todos os esforços foram realizados na busca pelo líder da Al Qaeda, Osama bin Laden. Maya (Jessica Chastain) é uma agente da CIA que está por trás dos principais esforços em capturar Laden, por ter descoberto os interlocutores do líder do grupo terrorista. Com isso ela participa da operação que levou militares americanos a invadir o território paquistanês, com o objetivo de capturar e matar bin Laden.', 0, 'helena', NULL, NULL),
(NULL, 875, 'Guerra ao Terror', 'The Hurt Locker', 'Estados Unidos', 'Guerra', 'Kathryn Bigelow', '15440911865c08f6324d397.jpg', 131, 2008, 'QIiI0W9nUBE', 'Jeremy Renner, Anthony Mackie, Brian Geraghty, Guy Pearce', 'JT Sanborn (Anthony Mackie), Brian Geraghty (Owen Eldridge) e Matt Thompson (Guy Pearce) integram o esquadrão anti-bombas do exército americano, em ação em pleno Iraque. Eles trabalham na destruição de um explosivo, fazendo com que seja detonado sem que atinja alguém. Entretanto, um erro faz com que o artefato exploda e mate Thompson. Em seu lugar é enviado o sargento William James (Jeremy Renner), que possui grande sangue frio em ação. Isto gera alguns desentendimentos com Sanborn, que o considera irresponsável. Apesar disto, o trio segue na ativa, tendo consciência de que cada dia concluído de trabalho é um dia a mais de vida.', 0, 'helena', NULL, NULL),
(NULL, 876, 'Mulheres à Beira de um Ataque de Nervos', 'Mujeres al borde de un ataque de nervios', 'Espanha', 'Comédia dramática', 'Pedro Almodóvar', '15440918915c08f8f3d94bd.jpg', 95, 1988, '8pjdLAjNwlg', NULL, 'Em Madri, Pepa Marcos (Carmen Maura), uma atriz que está grávida mas ninguém sabe, é abandonada por Ivan (Fernando Guillén), seu amante, e se desespera tentando encontrá-lo. Ela recebe a visita de Candela (María Barranco), uma amiga que se apaixonou por um desconhecido e agora que descobre que o amado é um terrorista xiita, temendo ser presa. A mulher de Ivan descobre a traição do marido e tenta matá-lo.  Pepa quer fazer de tudo para salvar a vida de Ivan.', 0, 'helena', NULL, NULL),
(NULL, 877, 'Um Pequeno Favor', 'A Simple Favor', 'Estados Unidos', 'Suspense', 'Paul Feig', '15440920075c08f967729a3.jpg', 117, 2018, 'kui4PiIx5GQ', 'Anna Kendrick, Ian Ho, Joshua Satine, Glenda Braganza, Blake Lively', 'Stephanie (Anna Kendrick) é uma jovem mãe que divide o tempo entre a criação do filho e a dedicação ao vlog de culinária. Ela é uma pessoa solitária, que se torna fascinada pela mãe de um colega de escola de seu filho. Esta mulher, Emily (Blake Lively) é poderosa, destemida, e leva uma vida de luxo ao lado do marido. Um dia, Emily desaparece. A polícia tem dificuldades para lidar com o caso, mas Stephanie parte em busca de respostas por conta própria. No caminho, descobre que a nova amiga não era nada do que ela pensava.\r\n', 0, 'mockingjay', NULL, NULL),
(NULL, 878, 'Faça a Coisa Certa', 'Do the Right Thing', 'Estados Unidos', 'Drama', 'Spike Lee', '15440921385c08f9ea71a99.jpg', 120, 1989, 'EMctvRomxoA', 'Danny Aiello, Ossie Davis, Ruby Dee, Richard Edson', 'Sal (Danny Aiello), um ítalo-americano, é dono de uma pizzaria em Bedford-Stuyvesant, Brooklyn. Com predominância de negros e latinos, é uma das áreas mais pobres de Nova York. Ele é um cara boa praça, que comanda a pizzaria juntamente com Vito (Richard Edson) e Pino (John Turturro), seus filhos, além de ser ajudado por Mookie (Spike Lee). Sal decora seu estabelecimento com fotografias de ídolos ítalo-americanos dos esportes e do cinema, o que desagrada sua freguesia. No dia mais quente do ano, Buggin\' Out (Giancarlo Esposito), o ativista local, vai até lá para comer uma fatia de pizza e reclama por não existirem negros na \"Parede da Fama\". Este incidente trivial é o ponto de partida para um efeito dominó, que não terminará bem.', 0, 'helena', NULL, NULL),
(NULL, 879, 'Fargo', 'Fargo', 'Estados Unidos', 'Policial, Drama, Neo Noir', 'Joel Coen, Ethan Coen', '15460270455c2680252cfdb.jpg', 98, 1996, 'h2tY82z3xXU', 'William H. Macy, Steve Buscemi, Peter Stormare, Kristin Rudrüd', 'Em 1987 em Fargo, no Dakota do Norte, o gerente (William H. Macy) de uma revendedora de automóveis, ao se ver em uma delicada situação financeira, elabora o seqüestro da própria esposa (Kristin Rudrud) e faz um acordo com dois marginais, que ganhariam um carro novo e metade dos 80 mil dólares que seriam pagos pelo seu sogro, um homem muito rico. Mas uma série de acontecimentos não previstos cria logo de início um triplo assassinato e uma chefe de polícia grávida (Frances McDormand) tenta elucidar o caso, que continua provocando mais mortes.', 0, 'helena', NULL, NULL),
(NULL, 880, 'Mamma Mia', 'Mamma Mia', 'Estados Unidos', 'Musical', 'Phyllida Lloyd', '15440923155c08fa9b509d7.jpg', 120, 2008, '7arZdzmDKMI', 'Amanda Seyfried, Stellan Skarsgård, Pierce Brosnan, Nancy Baldwin', '1999, na ilha grega de Kalokairi. Sophie (Amanda Seyfried) está prestes a se casar e, sem saber quem é seu pai, envia convites para Sam Carmichael (Pierce Brosnan), Harry Bright (Colin Firth) e Bill Anderson (Stellan Skarsgard). Eles vêm de diferentes partes do mundo, dispostos a reencontrar a mulher de suas vidas: Donna (Meryl Streep), mãe de Sophie. Ao chegarem Donna é surpreendida, tendo que inventar desculpas para não revelar quem é o pai de Sophie.', 0, 'mockingjay', NULL, NULL),
(NULL, 881, 'O Doce Amanhã', 'The Sweet Hereafter', 'Canadá', 'Drama', 'Atom Egoyan', '15440924165c08fb004c7d1.jpg', 112, 1997, 'F7w-dPZI_LY', 'Ian Holm, Caerthan Banks, Sarah Polley, Tom McCamus', 'Um acidente de ônibus escolar provoca a morte de 20 crianças, em uma cidade no interior do Canadá. As famílias em luto são visitadas por Mitchell Stephens (Ian Holm), um advogado que tenta convencer os pais a pedirem uma indenização contra qualquer um que possam culpar. Paralelamente Mitchell enfrenta um drama pessoal, pois sua filha é viciada em drogas. A comunidade está paralisada em sua dor, mas Nicole (Sarah Polley), uma jovem que sobreviveu ao acidente, de sua cadeira de rodas talvez possa ser o testemunho que decidirá este caso.', 0, 'helena', NULL, NULL),
(NULL, 882, 'No Limite do Amanhã', 'Edge of Tomorrow', 'Estados Unidos', 'Ficção Científica', 'Doug Liman', '15440925555c08fb8b71cbb.jpg', 113, 2014, 'EA6EWWwDbtY', 'Tom Cruise, Emily Blunt, Brendan Gleeson, Bill Paxton', 'Quando a Terra é tomada por alienígenas, Bill Cage (Tom Cruise), relações públicas das Forças Armadas dos Estados Unidos, é obrigado a ir para a linha de frente no dia do confronto final. Inexplicavelmente ele acaba preso no tempo, condenado a reviver esta data repetidamente. A cada morte e renascimento, Cage avança e, antecipando os acontecimentos, tem a chance de mudar o curso da batalha com o apoio da guerreira Rita Vrataski (Emily Blunt).', 0, 'helena', NULL, NULL),
(NULL, 883, 'Os Bad Boys', 'Bad Boys', 'Estados Unidos', 'Policial', 'Michael Bay', '15440926565c08fbf08cc8b.jpg', 119, 1995, 'Xm12NSa8jsM', 'Lisa Boyle, Michael Taliferro, Emmanuel Xuereb, Tchéky Karyo', 'Os policiais Burnett (Martin Lawrence) e Lowrey (Will Smith) são encarregados de encontrar um carregamento de heroína que foi roubado. Uma testemunha liga para a delegacia dizendo ser capaz de identificar o ladrão. O pacato Burnett finge ser Lowrey para não perder o caso e acaba tendo que proteger a mulher, enquanto seu parceiro mulherengo cuida de sua família.', 0, 'cdoriguello', NULL, NULL),
(NULL, 884, 'Mamma Mia! Lá Vamos Nós de Novo', 'Mamma Mia! Here We Go Again', 'Estados Unidos', 'Musical', 'Ol Parker', '15440927085c08fc248a2e5.jpg', 124, 2018, 'YClcvscKf3w', 'Amanda Seyfried, Andy Garcia, Celia Imrie, Lily James', 'Um ano após a morte de Donna (Meryl Streep), sua filha Sophie (Amanda Seyfried) está prestes a reinaugurar o hotel da mãe, agora totalmente reformado. Para tanto convida seus três \"pais\", Harry (Colin Firth), Sam (Pierce Brosnan) e Bill (Stellan Skarsgard) e as eternas amigas da mãe, Rosie (Julie Walters) e Tanya (Christine Baranski), ao mesmo tempo em que precisa lidar com a distância do marido Sky (Dominic Cooper), que está fazendo um curso de hotelaria em Nova York. O reencontro serve para desenterrar memórias sobre a juventude de Donna (Lily James), no final dos anos 70, quando ela resolve se estabelecer na Grécia.', 0, 'mockingjay', NULL, NULL),
(NULL, 885, 'Pets - A Vida Secreta dos Bichos', 'The Secret Life of Pets', 'Estados Unidos', 'Animação', 'Yarrow Cheney', '15440928965c08fce06b227.jpg', 97, 2016, 'x6nbYUhuo0o', 'Louis C.K., Eric Stonestreet, Kevin Hart, Jenny Slate', 'Max é um cachorro que mora em um apartamento de Manhattan. Quando sua querida dona traz para casa um novo cão chamado Duke, Max não gosta nada, já que seus privilégios parecem ter acabado. Mas logo eles vão ter que pôr as divergências de lado quando um incidente coloca os dois na mira da carrocinha. Enquanto tentam fugir, os animais da vizinhança se reúnem para o resgate e uma gangue de bichos que moram nos esgotos se mete no caminho da dupla.', 0, 'mockingjay', NULL, NULL),
(NULL, 886, 'O Labirinto do Fauno', 'El laberinto del fauno', 'Espanha', 'Fantasia', 'Guillermo del Toro', '15440929505c08fd1677e5e.jpg', 112, 2006, 'M09mCcVgrsA', NULL, 'Oficialmente a Guerra Civil já terminou, mas um grupo de rebeldes ainda luta nas montanhas ao norte de Navarra. Ofelia (Ivana Baquero), de 10 anos, muda-se para a região com sua mãe, Carmen (Ariadna Gil). Lá as espera seu novo padrasto, um oficial fascista que luta para exterminar os guerrilheiros da localidade. Solitária, a menina logo descobre a amizade de Mercedes (Maribel Verdú), jovem cozinheira da casa, que serve de contato secreto dos rebeldes. Além disso, em seus passeios pelo jardim da imensa mansão em que moram, Ofelia descobre um labirinto que faz com que todo um mundo de fantasias se abra, trazendo consequências para todos à sua volta.', 0, 'helena', NULL, NULL),
(NULL, 888, 'Que Mal Eu Fiz a Deus?', 'Qu\'est-ce qu\'on a fait au Bon Dieu?', 'França', 'Comédia', 'Philippe de Chauvero', '15440931655c08fdedc9085.jpg', 107, 2014, 'SRa67esFRnY', NULL, 'O casal Verneuils tem quatro filhas. Católicos, conservadores e um pouco preconceituosos, eles não ficaram muito felizes quando três de suas filhas se casaram com homens de diferentes nacionalidades e religiões. Quando a quarta anuncia o seu casamento com um católico, o casal fica nas nuvens e toda a família vai se reunir. Mas logo eles vão descobrir que nem tudo é do jeito que eles querem.', 0, 'mockingjay', NULL, NULL),
(NULL, 889, 'Bad Boys II', 'Bad Boys II', 'Estados Unidos', 'Policial', 'Michael Bay', '15440932905c08fe6a622ad.jpg', 147, 2003, 'hsuKq5pNOcM', 'Martin Lawrence, Will Smith, Jordi Mollà, Gabrielle Union', 'Os detetives da Narcóticos Marcus Burnett (Martin Lawrence) e Mike Lowrey (Will Smith) foram designados para investigar a proliferação do ecstasy na cidade de Miami. As investigações os levam a um alvo maior, Johnny Tapia (Jordi Mollà), um traficante cuja ambição de tomar conta do tráfico na cidade inicia uma verdadeira guerra entre quadrilhas. Em meio a esta situação, Lowrey passa a se interessar por Syd (Gabrielle Union), irmã de Burnett, o que põe a amizade deles à prova.', 0, 'cdoriguello', NULL, NULL),
(NULL, 890, 'Ele Está de Volta', 'Er ist wieder da ', 'Alemanha', 'Comédia', 'David Wnendt', '15440934435c08ff03888ba.jpg', 116, 2015, 'CTWtbIzlaM8', NULL, 'Baseado no livro de mesmo título, Adolf Hitler acorda em um terreno baldio em Berlin, no ano de 2011, sem memória alguma do que aconteceu depois de 1945. Perdido, ele se vê em uma sociedade completamente diferente, onde não há partido nazista, a guerra e o país é governado por uma mulher. Ele é reconhecido pelas pessoas que acreditam que seja apenas um artista que não consegue sair do seu personagem. Mas, um discurso de Hitler é viralizado na internet, e a partir daí todos querem ouvi-lo, saber sobre ele, até que ganha um programa de televisão onde propaga suas ideias ao mesmo tempo em que tenta convercer a todos que ele é quem realmente diz ser.', 0, 'helena', NULL, NULL),
(NULL, 891, 'Pegar e Largar', 'Catch and Release', 'Estados Unidos', 'Comédia romântica', 'Susannah Grant', '15440934515c08ff0b357f7.jpg', 124, 2007, '6NuyXTNQsJY', NULL, 'Após a repentina morte de seu noivo, Gray Wheeler (Jennifer Garner) encontra conforto na companhia dos amigos dele: o divertido Sam (Kevin Smith), o responsável Dennis (Sam Jaeger) e o playboy irresponsável Fritz (Timothy Olyphant). À medida que os segredos de seu noivo são revelados pelos amigos, Gray passa a ver novas faces do homem que ela julgava conhecer. Simultaneamente ela passa a se interessar pelo homem que ela jamais considerou se apaixonar até então.', 0, 'mockingjay', NULL, NULL),
(NULL, 892, 'Loving Annabelle', 'Loving Annabelle', 'Estados Unidos', 'LGBT', 'Katherine Brooks', '15440937165c090014dffbe.jpg', 75, 2006, 'x1qzMfTRdyY', 'Erin Kelly, Diane Gaidry, Laura Breckenridge, Michelle Horn', 'Após ser expulsa em outras duas escolas, Annbelle (Erin Kelly) é a novata em um colégio católico exclusivo para garotas. A jovem recém-chegada começa a desenvolver interesse em Simone Bradley (Diane Gaidry), uma de suas professoras. Annabelle passa a perseguir Simone até que ela faça sua escolha, lidando com o que é certo e com a paixão.', 0, 'mockingjay', NULL, NULL),
(NULL, 893, '3096 Dias', '3096 Tage', 'Alemanha', 'Drama', 'Sherry Hormann', '15440937235c09001bb6139.jpg', 110, 2012, '39zVQRDl17o', NULL, 'O filme é baseado na história real de Natascha Kampusch, que foi raptada e mantida em cativeiro entre os anos de 1998 e 2006. Capturada em uma rua de Viena aos dez anos, o longa narra sua vida ainda em liberdade, passando pelo período de isolamento completo do mundo exterior, onde sofreu abusos físicos e psicológicos, até o momento de sua fuga e readaptação a vida em sociedade.  ', 0, 'helena', NULL, NULL),
(NULL, 894, 'Fuga de Alcatraz', 'Escape from Alcatraz', 'Estados Unidos', 'Ação', 'Don Siegel', '15440939575c09010513071.jpg', 112, 1979, 'Klfqq6K9ov8', 'Clint Eastwood, Patrick McGoohan, Roberts Blossom, Jack Thibeau', 'São Francisco, 1960. Frank Morris (Clint Eastwood) é um condenado que tem várias tentativas de fugas em seu histórico. Eleé enviado para Alcatraz, uma prisão de segurança máxima que também é conhecida como A Rocha e que fica em uma ilha, sendo que quem tentou escapar de lá ou foi recapturado ou morreu afogado. Warden Gradativamente Frank vê os pontos vulneráveis de Alcatraz e, com a ajuda de alguns outros internos, tenta pacientemente criar um rota de fuga.', 0, 'helena', NULL, NULL),
(NULL, 895, 'A Jovem Rainha', 'The Girl King', 'Finlândia', 'LGBT', 'Mika Kaurismäki', '15440940315c09014f3cefe.jpg', 116, 2017, 'ViM31b7a23k', NULL, 'Enigmática e em conflito é Cristina (Malin Buska), rainha coroada da Suécia. Criada rigorosamente como um príncipe, ela assume sua posição como líder e, inspirada pela filosofia, enfrenta grande resistência à suas ideias de modernizar a Suécia e acabar com a Guerra dos Trinta Anos, entre protestantes e católicos. Além dos problemas políticos, Cristina ainda precisa lidar com a sua crescente atração por uma dama de companhia.', 0, 'mockingjay', NULL, NULL),
(NULL, 896, 'Depois da Terra', 'After Earth', 'Estados Unidos', 'Ficção Científica', 'M. Night Shyamalan', '15440943585c0902968d7a5.jpg', 100, 2013, 'NLWsHhS1mFg', 'Jaden Smith, Will Smith, Sophie Okonedo, Zoë Kravitz', 'Há 1000 anos, um cataclismo tornou a Terra um lugar hostil e forçou os humanos a se abrigarem no planeta Nova Prime, morando em naves espaciais. Depois de uma missão, o general Cypher Raige (Will Smith) retorna à sua família e ao filho de treze anos de idade (Jaden Smith). Mas pouco tempo após seu retorno, uma chuva de asteroides faz com que a nave onde moram caia na Terra. Com o pai correndo risco de morte, o jovem adolescente deverá aprender sozinho a domar este planeta, encontrando água, comida e cuidando de seu pai.', 0, 'mockingjay', NULL, NULL),
(NULL, 898, 'De repente 30', '13 Going on 30', 'Estados Unidos', 'Comédia', 'Gary Winick', '15440946175c090399f157b.jpg', 98, 2004, 'UE1yDA4eHFo', 'Jennifer Garner, Mark Ruffalo, Judy Greer, Andy Serkis', 'Jenna Rink (Christa B. Allen) é uma garota que está descontente com sua própria idade, já que seus colegas mais populares da escola não lhe dão atenção, seus pais ficam sempre no seu pé e o garoto por quem está apaixonada nem sabe que ela existe. A única amizade que Jenna possui é Matt Flamhaff (Sean Marquette), seu vizinho. Para tentar reverter a situação Jenna decide por ter uma grande festa para o seu 13º aniversário, convidando todos os adolescentes que conhece. Porém o que deveria ser sua consagração se transforma num grande desastre, após Jenna ser trancada em um armário devido a uma brincadeira e ser completamente esquecida pelos demais presentes na festa. Triste, Jenna faz um pedido: virar adulta de repente, para ter a vida com que sempre sonhou. O pedido milagrosamente se torna realidade e, no dia seguinte, Jenna (Jennifer Garner) desperta em 2004 e com 30 anos de idade. De início Jenna fica assustada com as novidades de sua vida, mas aos poucos fica cada vez mais encantada por ter se tornado tudo aquilo que sempre sonhou ser. Porém, quando tenta reencontrar Matt (Mark Ruffalo), Jenna descobre que perdeu contato com ele há vários anos e que agora ele está prestes a se casar.', 0, 'cdoriguello', NULL, NULL),
(NULL, 899, 'A Casa das Coelhinhas', 'The House Bunny', 'Estados Unidos', 'Comédia', 'Fred Wolf', '15440949275c0904cfe1284.jpg', 97, 2008, 'VFwaidsf-Xg', 'Anna Faris, Colin Hanks, Emma Stone, Katherine McPhee, Rummer Willis, Tyson Ritter, Dana Goodman, Kiely Williams, Hugh Hefner, Kat Dennings', 'Shelley Darlingson (Anna Faris) leva uma vida sem preocupações, até ser despejada da Mansão Playboy. Sem ter para onde ir, ela se envolve com um grupo de universitárias excluídas socialmente que precisa encontrar novos membros, caso contrário sua casa no campus será desativada. Para atingir este objetivo Shelley decide ensinar às novas amigas todos os seus truques de maquiagem e sobre homens.', 0, 'helena', NULL, NULL),
(NULL, 900, 'A Nova Cinderela', 'A Cinderella Story', 'Estados Unidos', 'Romance', 'Mark Rosman', '15440950145c090526e24ec.jpg', 95, 2004, 'EvBAt7Fs7ak', 'Hilary Duff, Jennifer Coolidge, Chad Michael Murray, Dan Byrd', 'Sam Montgomery (Hilary Duff) é uma jovem estudante do ensino médio, que vive com sua madrasta Fiona (Jennifer Coolidge) e as filhas dela, que a tratam da pior maneira possível. Sam leva uma vida sem grandes agitações e tem planos de cursar a Universidade de Princeton. Sua vida muda quando ela conhece, através da internet, seu príncipe encantado. Porém logo Sam descobre que ele é na verdade Austin Ames (Chad Michael Murphy), um garoto popular que é também jogador de futebol americano do time de sua escola. Temendo ser rejeitada por Austin, ela passa a tentar despistá-lo de todas as formas, tentando manter em segredo a identidade da garota com quem ele conversou através da internet.', 0, 'cdoriguello', NULL, NULL),
(NULL, 901, 'Ibiza: Tudo Pelo DJ', 'Ibiza', 'Estados Unidos', 'Comédia', 'Alex Richanbach', '15440951185c09058e3097e.jpg', 94, 2018, 'qagZ6Qy9TZY', 'Gwen Elizabeth Duchon, Gillian Jacobs, Michaela Watkins, Phoebe Robinson', 'Nikki (Vanessa Bayer), Harper (Gillian Jacobs) e Leah (Phoebe Robinson) são três amigas inseparáveis que transformam uma viagem de negócios a Barcelona em uma louca aventura em Ibiza em busca de um DJ famoso.', 0, 'helena', NULL, NULL),
(NULL, 902, 'Lola', 'LOL', 'Estados Unidos', 'Comédia dramática', 'Lisa Azuelos', '15440952185c0905f26466e.jpg', 97, 2012, 'hd13lHC-3Pg', 'Jean-Luc Bilodeau, Douglas Booth, Vivian Le Borgne, Bridget Brown', 'Lola (Miley Cyrus) vive em um mundo cada vez mais conectado pelas redes sociais. Em meio aos romances e amizades de colégio, ela enfrenta dificuldades em manter uma relação saudável com sua própria mãe, Anne (Demi Moore).', 0, 'helena', NULL, NULL),
(NULL, 904, 'Música, Amigos e Festa', 'We Are Your Friends', 'Estados Unidos', 'Drama', 'Max Joseph', '15440953575c09067d0613c.jpg', 96, 2015, 'dWPg0KzUACA', 'Zac Efron, Wes Bentley, Emily Ratajkowski, Jonny Weston', 'Cole (Zac Efron) tem 23 anos e batalha para se tornar um DJ de sucesso. Apadrinhado por James (Wes Bentley), experiente profissional da área, ele aprende muito e começa a crescer, mas coloca tudo em risco ao se envolver com a jovem namorada de amigo, Sophie (Emily Ratajkowski).', 0, 'helena', NULL, NULL),
(NULL, 905, 'No Escuro da Floresta', 'Into the Forest', 'Canadá', 'Suspense', 'Patricia Rozema', '15440955705c09075234ce6.jpg', 101, 2015, 'jbHHCADl3rM', 'Ellen Page, Evan Rachel Wood, Max Minghella, Callum Keith Rennie', 'Em um futuro não muito distante, duas irmãs adolescentes vivem em uma antiga floresta para sobreviver a uma enorma queda de energia que ocorreu em todo o continente. Mas ao descobrir que o mundo a sua volta está perto do seu fim, elas terão de de lutar contra intrusos, doenças, solidão e fome.', 0, 'helena', NULL, NULL),
(NULL, 906, 'Guerra dos Mundos', 'War of the Worlds', 'Estados Unidos', 'Ficção Científica', 'Steven Spielberg', '15440957305c0907f2ac60a.jpg', 116, 2005, '9oNgmaFJXnY', 'Tom Cruise, Dakota Fanning, Miranda Otto, Justin Chatwin', 'Ray Ferrier (Tom Cruise) é um homem divorciado que trabalha nas docas. Ele não se sente à vontade no papel de pai, mas precisa cuidar de seus filhos, Robbie (Justin Chatwin) e Rachel (Dakota Fanning), quando eles lhe fazem uma de suas raras visitas. Pouco após eles chegarem Ray presencia um evento que mudará para sempre sua vida: o surgimento de uma gigantesca máquina de guerra, que emerge do chão e incinera tudo o que encontra. Trata-se do primeiro golpe de um devastador ataque alienígena à Terra, que faz com que Ray pegue seus filhos e tente protegê-los, levando-os o mais longe possível das armas extra-terrestres.', 0, 'helena', NULL, NULL),
(NULL, 907, 'Ela é o Cara', 'She', 'Estados Unidos', 'Romance', 'Andy Fickman', '15440957545c09080aeb689.jpg', 105, 2006, 'jf67WlthWXk', 'Geoffrey DeMarsh, Kat Scicluna, Richard Cunningham III, Katrina Latham', 'Viola (Amanda Bynes) é uma boa jogadora de futebol, mas sempre é impedida de jogar com os garotos de sua escola devido ao preconceito de que mulher não pode ser tão boa no esporte quanto um homem. Furiosa, Viola aproveita a viagem de seu irmão Sebastian (James Kirk) e decide se passar por ele em sua escola, jogando no time masculino de futebol. Ela tem apenas duas semanas para mostrar que sabe jogar futebol, mas acaba se apaixonando por Duke (Channing Tatum), seu companheiro de quarto, que acredita que ela é um homem.', 0, 'cdoriguello', NULL, NULL),
(NULL, 908, 'O Terminal', 'The Terminal', 'Estados Unidos', 'Comédia dramática', 'Steven Spielberg', '15440959315c0908bbdfb22.jpg', 128, 2004, '0dAortBpQb0', 'Tom Hanks, Catherine Zeta-Jones, Stanley Tucci, Chi McBride', 'Viktor Navorski (Tom Hanks) é um cidadão da Europa Oriental que viaja rumo a Nova York justamente quando seu país sofre um golpe de estado, o que faz com que seu passaporte seja invalidado. Ao chegar ao aeroporto, Viktor não consegue autorização para entrar nos Estados Unidos. Sem poder retornar à sua terra natal, já que as fronteiras foram fechadas após o golpe, Viktor passa a improvisar seus dias e noites no próprio aeroporto, à espera que a situação se resolva. Porém, com a situação se arrastando por meses, Viktor permanece no aeroporto e passa a descobrir o complexo mundo do terminal onde está preso.', 0, 'helena', NULL, NULL),
(NULL, 909, 'Julie & Julia', 'Julie & Julia', 'Estados Unidos', 'Comédia', 'Nora Ephron', '15440962645c090a080e282.jpg', 123, 2009, 'qqQICUzdKbE', 'Craig Colligan', 'Julia Child (Meryl Streep) é uma americana que passou a morar em Paris devido ao trabalho de seu marido, Paul (Stanley Tucci). Em busca de algo para se ocupar, ela se interessou por culinária e passou a apresentar um programa de TV sobre o assunto. Cinquenta anos depois, Julie Powell (Amy Adams) está prestes a completar 30 anos e está frustrada com a vida que leva. Em busca de um objetivo, ela resolve passar um ano cozinhando as 524 receitas do livro de Julia Child, \"Mastering the Art of French Cooking\". Ao longo deste período Julie escreve para um blog, onde relata suas experiências.', 0, 'helena', NULL, NULL),
(NULL, 910, 'Ela e os Caras', 'Sydney White  and the Seven Dorks', 'Estados Unidos', 'Comédia', 'Joe Nussbaum', '15440965625c090b3299aab.jpg', 108, 2007, 's_7WqERIIco', NULL, 'Sydney White (Amanda Bynes) está começando a universidade e resolve se candidatar para a fraternidade da qual sua mãe fez parte na juventude. A caloura acaba descobrindo que a irmandade das garotas não é mais como costumava ser e decide morar em uma casa com sete rapazes. Com a ajuda dos seus companheiros párias, ela vai enfrentar a rainha da faculdade e tentar transformar a injusta hierarquia da sociedade universitária.', 0, 'helena', NULL, NULL),
(NULL, 911, 'The Invitation', 'The Invitation', 'Estados Unidos', 'Terror', 'Karyn Kusama', '15440969445c090cb083106.jpg', 100, 2015, '0-mp77SZ_0M', 'Logan Marshall-Green, Tammy Blanchard, Emayatzy Corinealdi, Aiden Lovekamp', 'Uma tragédia abala o casal formado por Will e Eden. Eles perdem o filho pequeno e, desolada, Eden vai embora sem dar notícias. Dois anos mais tarde, ela volta a procurar o marido, acompanhada de outro homem, e totalmente diferente de como era antes. Durante um jantar, com Will, Eden e o novo companheiro de sua esposa, Will começa a suspeitar que os visitantes têm planos sinistros contra ele.', 0, 'helena', NULL, NULL),
(NULL, 912, 'Corrente do Mal', 'It Follows', 'Estados Unidos', 'Mistério', 'David Robert Mitchell', '15440971375c090d71b6af8.jpg', 100, 2014, '9A3yMne0hwk', 'Bailey Spry, Carollette Phillips, Loren Bass, Keir Gilchrist', 'A jovem Jay (Maika Monroe) leva uma vida tranquila entre escola, paqueras e passeios no lago. Após uma transa, o garoto com quem passou a noite explica que ele carregava no corpo uma força maligna, transmissível às pessoas apenas pelo sexo. Enquanto vive o dilema de carregar a sina ou passá-la adiante, a jovem começa a ser perseguida por figuras estranhas que tentam matá-la e não são vistas por mais ninguém.', 0, 'helena', NULL, NULL),
(NULL, 913, 'Newness', 'Newness', 'Estados Unidos', 'Drama', 'Drake Doremus', '15440973855c090e692e59e.jpg', 117, 2017, 'EtBhKTuPjEk', 'Nicholas Hoult, Laia Costa, Danny Huston, Courtney Eaton', 'Na atual Los Angeles, duas pessoas embarcam em uma trajetória emocional curiosa em rede, que acaba gerando um relacionamento que aflora neles condições emocionais e físicas extremamente intensas.', 0, 'helena', NULL, NULL),
(NULL, 914, 'Chat - A Sala Negra', 'Chatroom', 'Reino Unido', 'Suspense', 'Hideo Nakata', '15440985275c0912dfee750.jpg', 97, 2010, 'O85q8Ihef6Q', 'Aaron Taylor-Johnson, Imogen Poots, Matthew Beard, Hannah Murray', 'William, de 17 anos, criou um chat para jovens de sua idade. O intuito é simples: criar um ambiente em que todos podem falar sobre qualquer coisa, suas frustrações e traumas da juventude, sem restrições. O problema é que os planos de William ao saber daqueles segredos é sórdido, e pode ser fatal. E, caso os jovens não descubram suas intenções a tempo, será tarde demais.', 0, 'helena', NULL, NULL),
(NULL, 915, 'Lovesong', 'Lovesong', 'Estados Unidos', 'LGBT', 'So Yong Kim', '15440989785c0914a2046c1.jpg', 84, 2016, 'UqUcDru8plY', 'Riley Keough, Jessie Ok Gray, Cary Joji Fukunaga, Jena Malone', 'Entediada e negligenciada pelo marido que trabalha longe de casa, Sarah (Riley Keough) embarca em uma viagem de carro com a filha e sua melhor amiga, Mindy (Jena Malone), que há muito tempo não via. Durante a improvisada jornada a dinâmica das duas mulheres se intensifica e ganha novas camadas, mas circunstâncias acabam por separá-las. Tempos depois, Sarah e Mindy têm a chance de se reencontrar em uma cerimônia.', 0, 'helena', NULL, NULL),
(NULL, 916, 'Blue Jay', 'Blue Jay', 'Estados Unidos', 'Drama', 'Alex Lehmann', '15440991065c0915223bf9f.jpg', 80, 2016, '2htQEBF1fCc', 'Mark Duplass, Sarah Paulson, Clu Gulager, James Andrews', 'Quando estão retonando para sua pequena cidade natal na Califórnia, dois ex-namorados (Mark Duplass e Sarah Paulson) do ensino médio se encontram por um acaso. Os dois lembram do passado que compartilharam e passam a refletir sobre ele, levando em conta suas vidas atuais, que parecem não serem satisfatórias para eles.', 0, 'helena', NULL, NULL),
(NULL, 917, 'Loev', 'Loev', 'Índia', 'LGBT', 'Sudhanshu Saria', '15440992265c09159abd92c.jpg', 92, 2015, 'pDndThLxxvk', 'Dhruv Ganesh, Siddharth Menon, Shiv Pandit, Dixit', 'Negociador em Wall Street, Jai (Shiv Pandit) está com uma viagem de 48 horas marcada para Mumbai. Afim de colocar animação na sua viagem de negócios, ele convida seu amigo e produtor musical Sahil (Dhruv  Ganesh), que larga até o imprudente namorado, Alex (Siddharth Mennon), para acompanha-lo. Nas paisagens da Índia, o refúgio dos dois, eles percebem que há mais do um fuso-horário separando os dois quando a atração torna-se incontestável.', 0, 'helena', NULL, NULL),
(NULL, 918, 'Burn Burn Burn', 'Burn Burn Burn', 'Reino Unido', 'Comédia', 'Chanya Button', '15440993965c0916449eb7f.jpg', 106, 2015, '_g1hMTF2VA0', 'Laura Carmichael, Jack Farthing, Joe Dempsie, Hannah Arterton', 'Seph (Laura Carmichael) e Alex (Chloe Pirrie) são duas garotas com seus vinte e poucos anos que acabaram de perder o seu melhor amigo Dan (Jack Farthing). Ele era engraçado, charmoso e elas o amavam como um irmão. Agora, a única coisa que elas possuem é um pedido: espalhar as cinzas de Dan pelos locais que fizeram dele a pessoa que era.', 0, 'helena', NULL, NULL),
(NULL, 919, 'Ashby', 'Ashby', 'Estados Unidos', 'Comédia dramática', 'Tony McNamara', '15440995555c0916e3926ac.jpg', 100, 2015, 'lNlMsJWb1KM', 'Mickey Rourke, Nat Wolff, Emma Roberts, Sarah Silverman', 'O desajeitado Ed Wallis (Nat Wolff), 17 anos, precisa de ajuda para achar o seu lugar no mundo e faz amizade com seu vizinho Ashby Holt (Mickey Rourke) em busca de ajuda. Porém, o que ele não sabia era que Ashby é um assassino  ex-agente da CIA. Com uma doença terminal, ele está tentando fazer as pazes antes de morrer com sua vida e com Deus, mas a nova amizade pode implicar em algumas mortes.', 0, 'helena', NULL, NULL),
(NULL, 920, 'Sherlock Holmes', 'Sherlock Holmes', 'Estados Unidos', 'Suspense', 'Guy Ritchie', '15440996725c09175861e00.jpg', 128, 2009, 'https://www.youtube.com/watch?v=JLLlvgrauag', 'Robert Downey Jr., Jude Law, Rachel McAdams, Mark Strong', 'Final do século XIX. Sherlock Holmes (Robert Downey Jr.) é um detetive conhecido por usar a lógica dedutiva e o método científico para decifrar os casos nos quais trabalha. O dr. John Watson (Jude Law) é seu fiel parceiro, que sempre o acompanhou em suas aventuras. Porém esta situação está prestes a mudar, já que Watson pretende se casar com Mary Morstan (Kelly Reilly). Isto não agrada Holmes, que não deseja o afastamento do colega. O último caso da dupla envolve Lorde Blackwood (Mark Strong), por eles presos ao realizar um ritual macabro que previa o assassinato de uma jovem. Blackwood já havia matado quatro mulheres e tem fama junto a população de ser um poderoso feiticeiro. Ele é preso e depois condenado à forca, mas misteriosamente é visto deixando o túmulo onde seu caixão foi deixado. Holmes e Watson são chamados para solucionar o caso e logo ele se torna um grande desafio para o detetive, que não acredita em qualquer tipo de magia. Em meio às investigações há o retorno de Irene Adler (Rachel McAdams), uma ladra experiente por quem Holmes tem uma queda.', 0, 'cdoriguello', NULL, NULL),
(NULL, 921, 'Mary Shelley', 'Mary Shelley', 'Reino Unido', 'Drama', 'Haifaa Al-Mansour', '15440998185c0917ea60af4.jpg', 120, 2017, 'xZyn-3mD8kY', 'Elle Fanning, Bel Powley, Maisie Williams, Ben Hardy', 'A história do romance entre o carismático poeta Percy Shelley e Mary Wollstonecraft, uma jovem de 17 anos que viria a se tornar a aclamada escritora Mary Shelley.', 0, 'helena', NULL, NULL),
(NULL, 922, 'Um Sonho Possível ', 'The Blind Side', 'Estados Unidos', 'Biografia', 'John Lee Hancock', '15440999425c091866a4213.jpg', 129, 2009, 'qacQrxVl0Xo', 'Sandra Bullock, Tim McGraw, Quinton Aaron, Jae Head', 'Michael Oher (Quinton Aaron) era um jovem negro, filho de uma mãe viciada e não tinha onde morar. Com boa vocação para os esportes, um dia ele foi avistado pela família de Leigh Anne Tuohy (Sandra Bullock), andando em direção ao estádio da escola para poder dormir longe da chuva. Ao ser convidado para passar uma noite na casa dos milionários, Michael não tinha ideia que aquele dia iria mudar para sempre a sua vida, tornando-se mais tarde um astro do futebol americano.', 0, 'cdoriguello', NULL, NULL),
(NULL, 923, 'Meu Malvado Favorito', 'Despicable Me', 'Estados Unidos', 'Animação', 'Chris Renaud', '15441000035c0918a40030f.jpg', 95, 2010, '2K9bxQhPLRY', 'Steve Carell, Jason Segel, Russell Brand, Julie Andrews', 'A pirâmide de Gizé foi roubada, sendo substituída por uma imensa réplica a gás. O feito é considerado o roubo do século, o que mexe com o orgulho de Gru (Steve Carell). Desejando realizar algo ainda mais impressionante, ele planeja o roubo da Lua. Para tanto conta com a ajuda dos mínions, seres amarelados que trabalham como seus ajudantes, e do dr. Nefario (Russell Brand), um cientista. Só que para realizar o roubo terá que tomar de Vetor (Jason Segel), o ladrão da pirâmide, um raio que consegue diminuir o tamanho de tudo que atinge. Sem conseguir invadir a fortaleza de Vetor, Gru encontra o plano perfeito quando vê as três órfãs Margo (Miranda Cosgrove), Agnes (Elsie Fisher) e Edith (Dana Gaier) entrarem no local para vender biscoitos. Ele então vai ao orfanato e resolve adotá-las. Só não esperava que, aos poucos, fosse se afeiçoar às irmãs.', 0, 'mockingjay', NULL, NULL),
(NULL, 924, 'O Pai da Noiva', 'Father of the Bride', 'Estados Unidos', 'Comédia', 'Charles Shyer', '15441000615c0918dddbed2.jpg', 105, 1991, 't9IbXEy5WZ0', 'Steve Martin, Diane Keaton, Kimberly Williams-Paisley, Kieran Culkin', 'George Banks (Steve Martin) é um pai de família casado com Nina (Diane Keaton). Ele sofre uma crise de ciúmes quando descobre que sua filha Annie (Kimberly Williams) e o namorado vão se casar. Durante a festa de noivado e os preparativos para o grande dia, o homem vai criar mil e uma confusões para não perder de uma única vez a sua filha.', 0, 'helena', NULL, NULL),
(NULL, 925, 'Meu Malvado Favorito 2', 'Despicable Me 2', 'Estados Unidos', 'Animação', 'Pierre Coffin', '15441001555c09193bc659b.jpg', 98, 2013, 'gi2QWNZ9jms', 'Steve Carell, Kristen Wiig, Benjamin Bratt, Miranda Cosgrove', 'Gru (voz de Steve Carell/Leandro Hassum) mudou radicalmente sua vida e agora seu negócio é se dedicar às filhotas Agnes (Elsie Fisher), Edith (Dana Gaier) e Margo (Miranda Cosgrove), deixando de lado os tempos de vilão. Ele só não contava que seu passado de \"ladrão da Lua\" pudesse falar mais alto e ser responsável pelo seu recrutamento, através da AVL (Liga Anti-Vilões), para salvar o mundo na companhia da agente Lucy (Kristen Wiig/Maria Clara Gueiros). Juntos, eles precisam localizar o criminoso que roubou a fórmula PX41, e Gru desconfia que um antigo \"concorrente\", chamado El Macho (Beijamin Bratt/Sidney Magal), possa ser o responsável por essa maldade. Para completar os problemas, o parceiro Dr. Nefário (Russell Brand/Luiz Carlos Persy) resolveu abandoná-lo e Margo está vivendo seu primeiro amor.', 0, 'mockingjay', NULL, NULL),
(NULL, 926, 'O Pai da Noiva 2', 'Father of the Bride - Part 2', 'Estados Unidos', 'Comédia', 'Charles Shyer', '15441002495c091999896b5.jpg', 106, 1995, 'aY4mfzQxumw', NULL, 'Após superar a crise de ciúmes que teve antes do casamento de sua amada filha (Kimberly Williams), George Banks (Steve Martin) agora terá de lidar com o fato de que além de esposa, ela está prestes a se tornar mãe. Enquanto Nina (Diane Keaton) fica feliz em saber que será avó, George embarca numa crise de meia-idade.', 0, 'helena', NULL, NULL),
(NULL, 927, 'Meu Malvado Favorito 3', 'Despicable Me 3', 'Estados Unidos', 'Animação', 'Pierre Coffin', '15441002845c0919bcd8ccf.jpg', 90, 2017, '9XEHAP9UGfY', 'Steve Carell, Kristen Wiig, Trey Parker, Miranda Cosgrove', 'Nos anos 1980, Balthazar Bratt fazia muito sucesso através de sua série de TV, onde interpretava um vilão chamado EvilBratt. Entretanto, o tempo passou, ele cresceu, a voz mudou e a fama se foi. Com a série cancelada, Balthazar tornou-se uma pessoa vingativa que, nas décadas seguintes, planejou seu retorno triunfal como vingança. Gru e Lucy são chamados para enfrentá-lo logo em sua reaparição, mas acabam sendo demitidos por não terem conseguido capturá-lo. Gru então descobre que possui um irmão gêmeo, Dru, e parte com a família para encontrá-lo no país em que vive.', 0, 'mockingjay', NULL, NULL),
(NULL, 928, 'Minions', 'Minions', 'Estados Unidos', 'Animação', 'Pierre Coffin', '15441004145c091a3e09b0e.jpg', 91, 2015, '65yL42CwR8Q', 'Sandra Bullock, Jon Hamm, Michael Keaton, Allison Janney', 'Seres amarelos milenares, os minions têm uma missão: servir os maiores vilões. Em depressão desde a morte de seu antigo mestre, eles tentam encontrar um novo chefe. Três voluntários, Kevin, Stuart e Bob, vão até uma convenção de vilões nos Estados Unidos e lá se encantam com Scarlet Overkill (Sandra Bullock), que ambiciona ser a primeira mulher a dominar o mundo.', 0, 'mockingjay', NULL, NULL),
(NULL, 929, 'Procurando Dory', 'Finding Dory', 'Estados Unidos', 'Animação', 'Andrew Stanton', '15441005585c091ace9093c.jpg', 97, 2016, 'BGNvbWeASbA', 'Ellen DeGeneres, Albert Brooks, Ed O\'Neill, Kaitlin Olson', 'Um ano após ajudar Marlin (Albert Brooks) a reencontrar seu filho Nemo, Dory (Ellen DeGeneres) tem um insight e lembra de sua amada família. Com saudades, ela decide fazer de tudo para reencontrá-los e na desenfreada busca esbarra com amigos do passado e vai parar nas perigosas mãos de humanos.', 0, 'mockingjay', NULL, NULL),
(NULL, 930, 'Holding the Man', 'Holding the Man', 'Austrália', 'LGBT', 'Neil Armfield', '15441005855c091ae9db546.jpg', 127, 2015, '2YdJUorviNA', 'Ryan Corr, Sarah Snook, Francesco Ferdinandi, Craig Stott', 'Tim e John se apaixonaram ainda adolescentes quando estavam no ensino médio. John era o capitão do time de futebol, e Tim um aspirante a ator fazendo um pequeno papel na peça Romeo e Julieta. 15 anos depois, a vida os pregou algumas duras peças nos dois, passando por separações, discriminação, tentações, ciúmes e as perdas. Até que o destino acabou tomando um caminho inesperado.', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 931, 'Rush - No Limite da Emoção', 'Rush', 'Reino Unido', 'Biografia', 'Ron Howard ', '15441007395c091b83bab9b.jpg', 123, 2013, 'HNvZ-UppB4o', 'Chris Hemsworth, Daniel Brühl, Olivia Wilde, Alexandra Maria Lara', 'Anos 1970. O mundo sexy e glamouroso da Fórmula 1 é mobilizado principalmente pela rivalidade existente entre os pilotos Niki Lauda (Daniel Brühl) e James Hunt (Chris Hemsworth). Eles possuíam características bem distintas: enquanto Lauda era metódico e brilhante, Hunt adotava um estilo mais despojado, típico de um playboy. A disputa entre os dois chegou ao seu auge em 1976, quando ambos correram vários riscos dentro do cockpit para que pudessem se sagrar campeão mundial de Fórmula 1.', 0, 'mockingjay', NULL, NULL),
(NULL, 932, 'Três Vezes Amor', 'Definitely, Maybe', 'Estados Unidos', 'Comédia romântica', 'Adam Brooks', '15441007515c091b8fa4187.jpg', 112, 2008, '909qcHvwu14', 'Ryan Reynolds, An Nguyen, Matthew Mason, Rick Derby', 'Manhattan. Will Hayes (Ryan Reynolds) é o pai solteiro de Maya (Abigail Breslin), uma garota de 10 anos que sempre quis saber como ele e sua mãe se conheceram. Um dia, após muita insistência dela, Will conta que teve um relacionamento com três mulheres, Summer (Rachel Weisz), Emily (Elizabeth Banks) e April (Isla Fisher), e que uma delas é sua mãe. Decidida a fazer com que seus pais voltem a viver juntos, Maya passa a incentivar o pai a encontrar suas antigas namoradas. O problema é que todos os relacionamentos terminaram de forma abrupta, com traumas para ambos os lados.', 0, 'helena', NULL, NULL),
(NULL, 933, '2012', '2012', 'Estados Unidos', 'Ação', 'Roland Emmerich', '15441008765c091c0c85348.jpg', 158, 2009, 'v4hP3xyaM-E&t=30s', 'John Cusack, Amanda Peet, Chiwetel Ejiofor, Thandie Newton', 'Em 2008, o presidente americano (Danny Glover) convoca uma reunião de emergência com as principais potências para conversar sobre um grande perigo para a humanidade. Os anos passam e, com a proximidade de 2012, as autoridades decidem que não é mais possível conter o perigo eminente que pode significar o fim do mundo. Com isso, colocam em prática o plano iniciado anos atrás, sob o comando dos cientistas Adrian Helmsley (Chiwetel Ejiofor) e Carl Anheuser (Oliver Platt). Enquanto isso, o escritor Jackson Curtis (John Cusack) leva sua vida de marido separado, pai de dois filhos, como motorista de limusine e tendo que aturar as reclamações da ex esposa (Amanda Peet). Ao levar os filhos para passear, ele descobre os primeiros sintomas da destruição do planeta.', 0, 'cdoriguello', NULL, NULL),
(NULL, 934, 'O Virgem de 40 Anos', 'The 40-Year-Old Virgin', 'Estados Unidos', 'Comédia', 'Judd Apatow', '15441008815c091c111485c.jpg', 116, 2005, 'YnDeJn-BX5Q', 'Steve Carell, Catherine Keener, Paul Rudd, Romany Malco', 'Andy Stitzer (Steve Carell) é um homem de 40 anos que possui um bom emprego, um apartamento próprio e mantém uma coleção de bonecos e revistas em quadrinhos. Porém, apesar da idade, Andy permanece virgem. Ele nem dá muita importância para isso, mas seus amigos não se conformam. Decididos a fazer com que Andy perca a virgindade, eles tentam fazer com que Trish (Catherine Keener), uma mãe solteira que também tem 40 anos, se torne sua parceira.', 0, 'helena', NULL, NULL),
(NULL, 935, 'Anjos da Lei', '21 Jump Street', 'Estados Unidos', 'Comédia', 'Phil Lord', '15451593995c1942e7ca47d.jpg', 109, 2012, '1hxGRuQXOas', 'Jonah Hill, Channing Tatum, Brie Larson, Dave Franco', 'Jenko (Channing Tatum) e Schmidt (Jonah Hill) estudaram juntos, mas jamais foram amigos. A situação muda quando se reencontram na academia de policiais, onde passam a ajudar um ao outro. Já formados, se envolvem em uma confusão ao tentar realizar a prisão de um traficante de drogas, que atuava no parque onde trabalhavam. Remanejados para uma divisão comandada pelo capitão Walters (Ice Cube), onde jovens policiais trabalham infiltrados, eles recebem a missão de desvendar quem é o fornecedor de uma nova e perigosa droga. De volta ao ambiente escolar e atuando sob nomes falsos, Jenko e Schmidt precisam se acostumar aos novos tempos sem perder o foco na tarefa que lhes foi incumbida.', 0, 'mockingjay', NULL, NULL),
(NULL, 936, 'Ela É Demais  pra Mim', 'She\'s Out of My League', 'Estados Unidos', 'Comédia romântica', 'Jim Field Smith', '15441009965c091c84c1ab1.jpg', 104, 2010, 'Bmu0gi7gAxE', 'Jay Baruchel, Alice Eve, T.J. Miller, Mike Vogel', 'Kirk (Jay Baruchel) era motivo de piada entre os amigos quando o assunto era mulher. Até que um dia, sem querer, ele conheceu Molly (Alice Eve) e aí, o que antes era somente uma feliz coincidência virou uma grande aventura amorosa, temperada com muito humor e zoação dos colegas. Afinal de contas, como uma gata nota 10 pode ficar com um cara nota 5? ', 0, 'helena', NULL, NULL),
(NULL, 937, 'Sete Psicopatas e um Shih Tzu', 'Seven Psychopaths', 'Reino Unido', 'Comédia', 'Martin McDonagh', '15441010275c091ca3203be.jpg', 110, 2012, '508_CKi1ZlE', 'Michael Pitt, Michael Stuhlbarg, Sam Rockwell, Colin Farrell', 'Marty (Colin Farrell) é um escritor pouco experiente que não encontra inspiração para seu novo texto, chamado \"Sete Psicopatas\". Seu melhor amigo é Billy (Sam Rockwell), um ator desempregado e ladrão de cachorros que está disposto a tudo para ajudá-lo. As ideias inusitadas de Billy colocam Marty na mira de um gângster temperamental, Charlie (Woody Harrelson), que não pensaria duas vezes antes de matar qualquer pessoa que pusesse as mãos em seu cachorro.', 0, 'mockingjay', NULL, NULL),
(NULL, 938, 'O Exterminador do Futuro', 'The Terminator', 'Estados Unidos', 'Ficção Científica', 'James Cameron', '15442232035c0af9e3a77f3.jpg', 107, 1984, 'uQQDZkqJMP8', 'Arnold Schwarzenegger, Michael Biehn, Linda Hamilton, Paul Winfield', 'Num futuro próximo, a guerra entre humanos e máquinas foi deflagrada. Com a tecnologia a seu dispor, um plano inusitado é arquitetado pelas máquinas ao enviar para o passado um andróide (Arnold Schwarzenegger) com a missão de matar a mãe (Linda Hamilton) daquele que viria a se transformar num líder e seu pior inimigo. Contudo, os humanos também conseguem enviar um representante (Michael Biehn) para proteger a mulher e tentar garantir o futuro da humanidade.', 0, 'helena', NULL, NULL),
(NULL, 939, 'O Experimento de Aprisionamento de Stanford', 'The Stanford Prison Experiment', 'Estados Unidos', 'Drama', 'Kyle Patrick Alvarez', '15442234005c0afaa8748f7.jpg', 122, 2015, '-_CUZdScCD8', 'Billy Crudup, Michael Angarano, Moises Arias, Nicholas Braun', '24 estudantes do sexo masculino são selecionados para um experimento na Universidade de Stanford. No porão do campus, uma prisão simulada é construída. Tudo para provar a teoria do professor de psicologia Philip Zimbardo (Billy Crudup) de que os traços de personalidade dos prisioneiros e guardas são a principal causa de comportamentos abusivos entre eles. Por 15 doláres por dia, os jovens ganharam funções, de forma aleatória. Porém, após a rápida desistência de dois estudantes que ficaram como prisioneiros, o experimento é interrompido após seis dias. Agora, uma investigação é feita para saber as causas desse conflito.', 0, 'helena', NULL, NULL),
(NULL, 940, 'Vingadores: Ultimato', 'Vingadores: Endgame', 'Estados Unidos', 'Herói', 'Irmãos Russo', '15442945165c0c107430664.jpg', 0, 2019, 'g6ng8iy-l0U', NULL, 'Após Thanos eliminar metade das criaturas vivas, os Vingadores precisam lidar com a dor da perda de amigos e seus entes queridos. Com Tony Stark (Robert Downey Jr.) vagando perdido no espaço sem água nem comida, Steve Rogers (Chris Evans) e Natasha Romanov (Scarlett Johansson) precisam liderar a resistência contra o titã louco.', 0, 'nadalini', NULL, NULL),
(NULL, 941, 'Aquaman', 'Aquaman', 'Estados Unidos', 'Herói', 'James Wan', '15443072695c0c4245a2179.jpg', 143, 2018, 'llJsEaqhNRk', ' Jason Momoa, Amber Heard, Dolph Lundgren, Nicole Kidman, Patrick Wilson, Yahya Abdul-Mateen ll, Willem Dafoe, Temuera Morrison, Ludi Lin', 'Aquaman aprende que não pode fazer tudo sozinho quando começa uma jornada com Mera em busca de um algo muito importante para o futuro de Atlantis.\r\n', 0, 'nadalini', NULL, NULL),
(NULL, 945, 'Mogli: Entre Dois Mundos', 'Mowgli: Legend of the Jungle', 'Estados Unidos', 'Aventura', 'Andy Serkis', '15447397465c12dba28fd54.jpg', 104, 2018, 'fXE1Vv0-PJQ', ' Rohan Chand (II), Andy Serkis, Benedict Cumberbatch, Christian Bale, Cate Blanchett, Naomi Harris', 'Criado por uma alcatéia em meio às florestas da Índia, Mogli (Rohan Chand) vive com os animais da selva e conta com a amizade do urso Baloo (Andy Serkis) e da pantera Bagheera (Christian Bale). Ele é aceito por todos os animais, exceto pelo temido tigre Shere Khan (Benedict Cumberbach). Quando Mogli se defronta com suas origens humanas, perigos maiores do que a rixa com Shere Khan podem surgir.', 0, 'nadalini', NULL, NULL),
(NULL, 946, 'O Chamado 3', 'Rings', 'Estados Unidos', 'Terror', 'F. Javier Gutiérrez', '15443869495c0d79856acce.jpg', 102, 2017, 'Ea16_JgjbFI', 'Matilda Lutz, Alex Roe, Bonnie Morgan, Vincent D\'Onofrio, Aimee Teegarden.', 'Julia (Matilda Anna Ingrid Lutz) fica preocupada quando seu namorado, Holt (Alex Roe), começa a explorar a lenda urbana sobre um vídeo misterioso. Lenda esta que diz que quem assiste morre depois de sete dias. Ela se sacrifica para salvar seu namorado e acaba fazendo uma descoberta terrível: há um \"filme dentro do filme\" que ninguém nunca viu antes.', 0, 'helena', NULL, NULL),
(NULL, 947, 'O Chamado do Mal', 'Malicious ', 'Estados Unidos', 'Terror, Suspense', 'Michael Winnick', '15443872085c0d7a88d7ccf.jpg', 100, 2018, 'YzkR6SH3QVg', 'Josh Stewart, Delroy Lindo, Bojana Novakovic', 'Ao aceitar um novo emprego como professor universitário, ele e sua esposa, que está prestes a ter um bebê, serão os responsáveis por um ato com consequências horrendas: eles liberam, involuntariamente, uma entidade maligna com pretenções perigosas de uma caixa que não era para ser aberta. Juntos, o casal precisa entender o que a entidade quer para, então, tentar contê-la.', 0, 'helena', NULL, NULL),
(NULL, 948, 'Moana - Um Mar de Aventuras', 'Moana', 'Estados Unidos', 'Animação, Aventura, ', 'Ron Clements, John Musker', '15443873885c0d7b3c23001.jpg', 107, 2016, 'taDzC3g_8JU', 'Auli\'i Cravalho, Dwayne Johnson, Alan Tudyk', 'Moana Waialiki é uma corajosa jovem, filha do chefe de uma tribo na Oceania, vinda de uma longa linhagem de navegadores. Querendo descobrir mais sobre seu passado e ajudar a família, ela resolve partir em busca de seus ancestrais, habitantes de uma ilha mítica que ninguém sabe onde é. Acompanhada pelo lendário semideus Maui, Moana começa sua jornada em mar aberto, onde enfrenta terríveis criaturas marinhas e descobre histórias do submundo.', 0, 'helena', NULL, NULL),
(NULL, 949, 'Bingo - O Rei das Manhãs', 'Bingo - O Rei das Manhãs', 'Brasil', 'Biografia, Drama, Co', 'Daniel Rezende', '15443876805c0d7c60ae4ef.jpg', 113, 2017, '4xHP9tiS6NM', ' Vladimir Brichta, Leandra Leal, Augusto Madeira, Ana Lucia Torre, Emanuelle Araújo, Tainá Müller, Cauã Martins', 'Cinebiografia de Arlindo Barreto, um dos intérpretes do palhaço Bozo no programa matinal homônimo exibido pelo SBT durante a década de 1980. Barreto alcançou a fama graças ao personagem, apesar de jamais ser reconhecido pelas pessoas por sempre estar fantasiado. Esta frustração o levou a se envolver com drogas, chegando a utilizar cocaína e crack nos bastidores do programa.', 0, 'helena', NULL, NULL),
(NULL, 950, 'O Doutrinador', 'O Doutrinador', 'Brasil', 'Crime, Suspense, Açã', 'Gustavo Bonafé', '15443878565c0d7d1095a52.jpg', 108, 2018, 'KIxUQch9los', 'Kiko Pissolato, Samuel de Assis, Tainá Medina, Marília Gabriela, Eduardo Moscovis', 'Um vigilante mascarado surge para atacar a impunidade que permite que políticos e donos de empreiteiras enriqueçam às custas da miséria e do trabalho da população brasileira. A história do homem por trás do disfarce de \"Doutrinador\" envolve uma jornada pessoal de vingança na qual um agente traumatizado decide fazer justiça com as próprias mãos.', 0, 'helena', NULL, NULL),
(NULL, 953, 'Moonrise Kingdom', 'Moonrise Kingdom', 'Estados Unidos', 'Comédia, Aventura, D', 'Wes Anderson', '15443887055c0d8061635f4.jpg', 94, 2012, 'oOTg7mn8vgM', 'Bruce Willis, Edward Norton, Bill Murray, Frances McDormand, Tilda Swinton, Jason Schwartzman, Kara Hayward\r\n', 'Anos 60, em uma pequena ilha localizada na costa da Nova Inglaterra. Sam (Jared Gilman) e Suzy (Kara Hayward) sentem-se deslocados em meio às pessoas com que convivem. Após se conhecerem em uma peça teatral na qual Suzy atuava, eles passam a trocar cartas regularmente. Um dia, resolvem deixar tudo para trás e fugir juntos. O que não esperavam era que os pais de Suzy (Bill Murray e Frances McDormand), o capitão Sharp (Bruce Willis) e o escoteiro-chefe Ward (Edward Norton) fizessem todo o possível para reencontrá-los.', 0, 'helena', NULL, NULL),
(NULL, 954, 'O Sacrifício do Cervo Sagrado', 'The Killing of a Sacred Deer', 'Reino Unido', 'Drama, Fantasia, Mis', 'Yorgos Lanthimos', '15443890945c0d81e6821b2.jpg', 121, 2017, 'Gv8Cz5h22kM', 'Colin Farrell, Nicole Kidman, Barry Keoghan, Alicia Silverstone, Sunny Suljic, Bill Camp \r\n', 'Steven (Colin Farrell) é um cardiologista conceituado que é casado com Anna (Nicole Kidman), com quem tem dois filhos: Kim (Raffey Cassidy) e Bob (Sunny Suljic). Já há algum tempo ele mantém contato frequente com Martin (Barry Keoghan), um adolescente cujo pai morreu na mesa de operação, justamente quando era operado por Steven. Ele gosta bastante do garoto, tanto que lhe dá presentes e decide apresentá-lo à família. Entretanto, quando o jovem não recebe mais a atenção de antigamente, decide elaborar um plano de vingança.', 0, 'helena', NULL, NULL),
(NULL, 955, 'O Estranho que Nós Amamos', 'The Beguiled', 'Estados Unidos', 'Drama', 'Sofia Coppola', '15443894385c0d833e4e9df.jpg', 93, 2017, 'xltlCis5gGA', 'Colin Farrell, Nicole Kidman, Kirsten Dunst, Elle Fanning. Oona Laurence, Angourie Rice, Colin Farrell ', 'Virginia, 1864, três anos após o início da Guerra Civil. John McBurney (Colin Farrell) é um cabo da União que, ferido em combate, é encontrado em um bosque pela jovem Amy (Oona Laurence). Ela o leva para a casa onde mora, um internato de mulheres gerenciado por Martha Farnsworth (Nicole Kidman). Lá, elas decidem cuidá-lo para que, após se recuperar, seja entregue às autoridades. Só que, aos poucos, cada uma delas demonstra interesses e desejos pelo homem da casa, especialmente Edwina (Kirsten Dunst) e Alicia (Elle Fanning).', 0, 'helena', NULL, NULL),
(NULL, 956, 'Thelma', 'Thelma', 'Noruega', 'Ficção Científica, D', 'Joachim Trier', '15443897875c0d849bb75e4.jpg', 116, 2017, 'k7dM9adQFV4', 'Eili Harboe, Henrik Rafaelsen, Ellen Dorrit Petersen', 'Depois de se mudar para Oslo para cursar o ensino superior em Biologia e morar sozinha pela primeira vez, Thelma (Eili Harboe) passa pelos momentos mais estranhos de sua vida. Isso porque, inesperadamente, descobre que tem uma energia incontrolável que afeta não só sua saúde, mas o universo ao redor, e se vê perdidamente apaixonada por uma colega.', 0, 'helena', NULL, NULL),
(NULL, 957, 'A Morte de Stalin', 'The Death of Stalin', 'França', 'Comédia dramática, H', 'Armando Iannucci', '15443900825c0d85c2cd7fd.jpg', 107, 2017, 'RayRkMbh2gg', 'Steve Buscemi, Simon Russell Beale, Jeffrey Tambor, Jason Issacs, Andrea Riseborough', 'União Soviética, 1953. Após a inesperada morte do ícone Josef Stalin (Adrian McLoughlin), o alto escalão do comitê do Partido Comunista se vê em momentos caóticos para decidir quem será o sucessor do líder soviético e quais rumos a nação seguirá a partir de então, uma enorme disputa que envolve até os complexos herdeiros do político.', 0, 'helena', NULL, NULL),
(NULL, 959, 'Corpo e Alma', 'Teströl és Lélekröl', 'Hungria', 'Drama', 'Ildikó Enyedi', '15443905475c0d8793b0d26.jpg', 116, 2017, 'qVkbeISpqvc', 'Alexandra Borbély, Morcsányi Géza, Zoltán Schneider', 'Uma história de amor que começou em sonho, literalmente. Numa dualidade entre o dormir e o acordar, dois jovens que não se conhecem têm sonhos exatamente iguais, e acabam se encontrando diariamente todas as noites nesse mundo paralelo de fantasia. Quando chega a hora de se encontrarem de verdade, a situação se mostra ainda mais complexa.', 0, 'helena', NULL, NULL),
(NULL, 960, 'Sorry to Bother You', 'Sorry to Bother You', 'Estados Unidos', 'Comédia, Fantasia, F', 'Boots Riley', '15443908895c0d88e91382c.jpg', 111, 2018, 'tcJwyEATaNY', 'Lakeith Stanfield, Tessa Thompson, Armie Hammer, Steven Yeun, Danny Glover, Omari Hardwick ', 'Em uma versão atual alternativa de Oakland, o atendente de telemarketing Cassius Green (Lakeith Stanfield) descobre uma chave mágica para o sucesso profissional - o que o impulsiona a um universo macabro. ', 0, 'helena', NULL, NULL),
(NULL, 961, 'A Noite do Jogo', 'Game Night', 'Estados Unidos', 'Ação, Comédia', 'John Francis Daley, Jonathan Goldstein', '15443911585c0d89f6c12e0.jpg', 100, 2018, 'vTXlz_AW0ik', 'Jason Bateman, Rachel McAdams, Kyle Chandler, Jesse Plemons, Kylie Bunbury, Sharon Horgan', 'Max (Jason Bateman) e Annie (Rachel McAdams) participam de um grupo de casais que organizam noites de jogos. O irmão de Max, Brooks (Kyle Chandler), chega decidido a organizar uma festa de assassinato e mistério e acaba sequestrado, levando todos a acreditarem que o sumiço faz parte da misteriosa brincadeira. Os seis amigos competitivos precisam então resolver o caso para vencer o jogo, cujo rumo vai se tornando cada vez mais inesperado.', 0, 'helena', NULL, NULL),
(NULL, 963, 'The Ballad of Buster Scruggs', 'The Ballad of Buster Scruggs', 'Estados Unidos', 'Faroeste', 'Ethan Coen, Joel Coen', '15443918045c0d8c7cd2685.jpg', 133, 2018, 'evfMJMApl6Q', 'Tim Blake Nelson, James Franco, Liam Neeson, Zoe Kazan, Brendan Gleeson, David Krumholtz, Harry Melling', 'Os aclamados irmãos Joel e Ethan Coen idealizam uma antologia faroeste em seis segmentos focada na fronteira americana. Acompanhando pistoleiros cantores, colonizadores, mineiros, homens condenados à forca, caçadores de recompensa e todo tipo de personalidade do Velho Oeste, estes seis contos curtos vão da mais profunda reflexão até o mais completo absurdo.', 0, 'helena', NULL, NULL),
(NULL, 964, 'Buscando...', 'Searching', 'Estados Unidos', 'Suspense, Drama, Mistério', 'Aneesh Chaganty', '15443920105c0d8d4ae657f.jpg', 102, 2018, 'Ort2KqH1UjM', 'John Cho, Debra Messing, Michelle La, Joseph Lee, Sean O\'Bryan, Roy Abramsohn', 'Após uma jovem de 16 anos desaparecer, seu pai David Kim (John Cho) pede ajuda às autoridades locais. Sem sucesso, após 37 horas, David decide invadir o computador de sua filha para procurar pistas que possam levar ao seu paradeiro.', 0, 'helena', NULL, NULL),
(NULL, 966, 'Mandy', 'Mandy', 'Estados Unidos', 'Ação, Terror, Suspense', 'Panos Cosmatos', '15443924665c0d8f121309e.jpg', 121, 2018, 'BnILmhbQt90', 'Nicolas Cage, Andrea Riseborough, Linus Roache, Bill Duke, Olwen Fouéré, Ned Dennehy, Richard Brake', 'Em algum lugar no deserto primitivo perto das Montanhas das Sombras, no ano de 1983, Red Miller (Nicolas Cage) e sua esposa Mandy (Andrea Riseborough) vivem uma vida tranquila. Depois que uma seita religiosa invade o local e mata o amor de sua vida, Red vive apenas por uma coisa: caçar esses maníacos e exigir vingança.', 0, 'helena', NULL, NULL),
(NULL, 967, 'Mudo', 'Mute', 'Reino Unido', 'Mistério, Suspense', 'Duncan Jones', '15443929245c0d90dc38d87.jpg', 126, 2018, 'ksJa_KpbFp4', 'Alexander Skarsgård, Paul Rudd, Justin Theroux, Sam Rockwell, Robert Sheeran, Florence Kasumba, Noel Clarke, Seyneb Saleh', 'Berlim, 2056. Leo (Alexander Skarsgard) é um bartender mudo e completamente apaixonado pela namorada, Naadirah (Seyneb Saleh). Quando ela desaparece, Leo parte em uma jornada pelo submundo que o leva a lidar com cafetões, um médico desertor do Exército (Paul Rudd) e seu melhor amigo (Sam Rockwell), que possui uma forte tendência à pedofilia.', 0, 'helena', NULL, NULL),
(NULL, 968, 'A Madeline de Madeline', 'Madeline', 'Estados Unidos', 'Drama, Suspense', 'Josephine Decker', '15443932935c0d924d23f38.jpg', 93, 2018, 'S_ezPTjSSPw', 'Helena Howard, Miranda July, Molly Parker, Ivan Martin, Julee Cerda, Dana Eskelson', 'Madeline consegue o papel em uma peça teatral, ela irá viver a protagonista. O problema é que a personagem principal usa um suéter como o de Madeline; tem um gato como o de Madeline e segura uma barra de ferro fumegante ao lado do rosto de sua mãe, como Madeline.', 0, 'helena', NULL, NULL),
(NULL, 969, 'Sexy por Acidente', 'I Feel Pretty', 'Estados Unidos', 'Comédia', 'Abby Kohn, Marc Silverstein', '15443936035c0d9383601a2.jpg', 110, 2018, '3k3tmxxTXTk', 'Amy Schumer, Michelle Williams, Rory Scovel, Naomi Campbell, Emily Ratajkowski, Busy Philipps, Aidy Bryant, Tom Hopper', 'Renee (Amy Schumer) convive diariamente com insegurança e baixa autoestima por conta de suas formas físicas. Depois de cair e bater a cabeça numa aula de spinning, ela volta a si acreditando ter o corpo que sempre sonhou e assim começa uma nova vida cheia de confiança e sem medo de seguir seus desejos.', 0, 'helena', NULL, NULL),
(NULL, 970, 'Green Book - O Guia', 'Green Book', 'Estados Unidos', 'Biografia, Drama', 'Peter Farrelly', '15479303255c438ad52fa2e.jpg', 130, 2018, 'gSSTg8-jsbw', 'Viggo Mortensen, Mahershala Ali, Linda Cardellini, P.J. Byrne', '1962. Tony Lip (Viggo Mortensen), um dos maiores fanfarrões de Nova York, precisa de trabalho após sua discoteca, o Copacabana, fechar as portas. Ele conhece um um pianista e quer que Lip faça uma turnê com ele. Enquanto os dois se chocam no início, um vínculo finalmente cresce à medida que eles viajam.', 0, 'helena', NULL, NULL),
(NULL, 971, 'Colette', 'Colette', 'Reino Unido', 'Biografia, Drama ', 'Wash Westmoreland', '15443940515c0d9543921d1.jpg', 111, 2018, '_Aza59isZNY', 'Keira Knightley, Dominic West, Eleanor Tomlinson, Denise Gough, Rebecca Root, Fiona Shaw', 'Colette (Keira Knightley) é uma romancista francesa que sofre com o seu casamento abusivo e com o seu parceiro que tenta ganhar créditos em cima de suas obras de maneira ilegal. Para superá-lo, ela emerge como uma grande escritora no seu país e, consequentemente, como uma candidata para o Prêmio Nobel em Literatura.', 0, 'helena', NULL, NULL),
(NULL, 972, 'Beirute', 'Beirut', 'Estados Unidos', 'Suspense, Ação, Crime', 'Brad Anderson', '15443943675c0d967f845c6.jpg', 109, 2018, 'KvL08LblLOg', 'Jon Hamm, Rosamund Pike, Dean Norris, MArk Pellegrino, Douglas Hodge, Shea Whigham, Jonny Coyne', 'Mason Skiles (Jon Hamm), um dos melhores diplomatas dos EUA, deixa o Líbano na década de 1970 após um acidente e dez anos depois retorno ao local para responder um chamado da CIA, que pede seu retorno à Beirut para realizar uma missão que só ele é capaz. Enquanto Skiles não sabe quem está do seu lado, um agente da CIA infiltrado na embaixada norte-americana recebe a função de proteger o diplomata.', 0, 'helena', NULL, NULL),
(NULL, 973, 'Festa da Salsicha', 'Sausage Party', 'Estados Unidos', 'Animação, Comédia', 'Greg Tiernan, Conrad Vernon', '15443948125c0d983c33f62.jpg', 89, 2016, 'FNP0N_QcfFU', 'Guilherme Briggs, Gregório Duvivier, João Vicente de Castro', 'Dentro de um supermercado, os alimentos pensam que as pessoas são deuses. Eles sonham em serem escolhidos por elas e serem levados para suas casas, onde pensam que viverão felizes. Mas eles nem suspeitam que serão cortados, ralados, cozidos e devorados! Quando Frank, uma salsicha, descobre a terrível verdade, ele precisa convencer os outros alimentos do supermecado  e fazer com que eles lutem contra os humanos.', 0, 'helena', NULL, NULL),
(NULL, 974, 'Docinho da América', 'American Honey', 'Estados Unidos', 'Drama, Comédia, Aventura', 'Andrea Arnold', '15443950375c0d991dd7e8d.jpg', 163, 2016, 'y1SpWZm1PLc', 'Sasha Lane, Shia LaBeouf, Riley Keough, Arielle Holmes, McCaul Lombardi, Laura Kirk', 'Star (Sasha Lane), uma adolescente que busca viver aventuras, decide se juntar a um caixeiro viajante e cruzar o território do meio-oeste dos Estados Unidos vendendo assinaturas de revistas. No meio da viagem, ela entra em uma loucura de festas, crimes e amores junto com um grupo de desajustados.', 0, 'helena', NULL, NULL),
(NULL, 975, 'A Criada', 'Agassi', 'Coreia do Sul', 'Drama, Romance ', 'Park Chan-wook ', '15443953535c0d9a5919220.jpg', 144, 2016, 'jz79nU0Bhr0', 'Min-Hee Kim, Kim Tae-Ri, Ha Jung-Woo', 'Coreia do Sul, anos 1930. Durante a ocupação japonesa, a jovem Sookee (Kim Tae-ri) é contratada para trabalhar para uma herdeira nipônica, Hideko (Kim Min-Hee), que leva uma vida isolada ao lado do tio autoritário. Só que Sookee guarda um segredo: ela e um vigarista planejam desposar a herdeira, roubar sua fortuna e trancafiá-la em um sanatório. Tudo corre bem com o plano, até que Sookee aos poucos começa a compreender as motivações de Hideko.', 0, 'helena', NULL, NULL),
(NULL, 976, 'Jogo do Dinheiro', 'Money Monster', 'Estados Unidos', 'Suspense, Crime', 'Jodie Foster', '15443965455c0d9f0133c00.jpg', 98, 2016, 'hPXFSzTOBMc', 'George Clooney, Julia Roberts, Jack O\'Connell, Caitriona Balfe, Dominic West, Lenny Venito, Giancarlo Esposito, Emily Meade', 'Lee Gates (George Clooney) é o apresentador do programa de TV \"Money Monster\", onde dá dicas sobre o mercado financeiro mesclando com performances típicas de um popstar. Um dia, um desconhecido (Jack O\'Connell) invade o programa exatamente quando ele está sendo gravado e, com um revólver, obriga Lee a vestir um colete repleto de explosivos. Patty Fenn (Julia Roberts), a produtora do programa, imediatamente ordena que o mesmo saia do ar, mas o invasor exige que ele permaneça ao vivo, caso contrário matará Lee. Assim acontece e, a partir de então, tem início uma investigação incessante para descobrir quem é o sequestrador e algum meio de salvar todos os que permanecem no estúdio. Paralelamente, a audiência do programa sobe sem parar e todos passam a acompanhar o que acontecerá com o apresentador.', 0, 'helena', NULL, NULL),
(NULL, 977, 'Teenagers - As Apimentadas', 'Bring It On', 'Estados Unidos', 'Comédia romântica', 'Peyton Reed', '15444575495c0e8d4d43b3c.jpg', 98, 2000, 'Jjog9RBaFFA', 'Kirsten Dunst, Eliza Dushku, Jesse Bradford', 'O time campeão de animadoras de torcida, de bairro rico, descobre que sua capitã anterior roubou a coreografia de um time concorrente, do centro da cidade. O campeonato está chegando, e elas precisam correr para criar outra coreografia.\r\n', 0, 'iris', NULL, NULL),
(NULL, 978, 'Invencível', 'Unbroken', 'Estados Unidos', 'Biografia, Drama, Ação', 'Angelina Jolie', '15444577285c0e8e00ad598.jpg', 137, 2014, 'leTOl5DGBIg', 'Jack O\'Connell, Miyavi, Domhnall Gleeson', 'Louis Zamperini, atleta olímpico, sofre um acidente de avião e cai em pleno mar durante a Segunda Guerra Mundial. Ele passa 47 dias no oceano e, quando consegue encontrar terra firme, é capturado pelos japoneses.', 0, 'iris', NULL, NULL),
(NULL, 980, 'Mcfarland dos Estados Unidos', 'McFarland, USA', 'Finlândia', 'Biografia, Drama', 'Niki Caro', '15444582955c0e90374b699.jpg', 129, 2015, 'hSpf-XVcoz8', 'Kevin Costner, Carlos Pratts, Johnny Ortiz', 'Em uma cidadezinha da Califórnia, McFarland, Jim White (Kevin Costner), um treinador de futebol que acaba de perder o emprego, aceita a tarefa de trabalhar com um grupo de jovens esportistas e transformá-los em campeões. Lá, ele descobre alguns talentos, não para o futebol mas para o atletismo.', 0, 'iris', NULL, NULL),
(NULL, 981, 'Escritores da Liberdade', 'Freedom Writers', 'Estados Unidos', 'Biografia, Crime, Drama', 'Richard LaGravenese', '15444584745c0e90eacf0ed.jpg', 123, 2007, 'pfwzLDj0yzM', 'Hilary Swank, Patrick Dempsey, Ricardo Molina', 'Uma jovem e idealista professora chega a uma escola de um bairro pobre, que está corrompida pela agressividade e violência. Os alunos se mostram rebeldes e sem vontade de aprender, e há entre eles uma constante tensão racial. Assim, para fazer com que os alunos aprendam e também falem mais de suas complicadas vidas, a professora Gruwell (Hilary Swank) lança mão de métodos diferentes de ensino. Aos poucos, os alunos vão retomando a confiança em si mesmos, aceitando mais o conhecimento, e reconhecendo valores como a tolerânica e o respeito ao próximo.', 0, 'iris', NULL, NULL),
(NULL, 982, 'X-Men: Fênix Negra', 'Dark Phoenix', 'Estados Unidos', 'Ação, Aventura, Ficção Científica, Herói', 'Simon Kinberg', '15444780925c0edd8cf10ce.jpg', 0, 2019, 'LKegxGRTYX0', 'Sophie Turner, Jessica Chastain, Jennifer Lawrence, Nicholas Hoult, James McAvoy, Michael Fassbender, Evan Peters, Kodi Smit-McPhee, Evan Jonigkeit', 'Em ‘Fênix Negra’, os X-Men enfrentam seu inimigo mais formidável e poderoso: Jean Grey. Durante uma missão de resgate no espaço, Jean quase morre ao ser atingida por uma misteriosa força cósmica. Quando ela volta para casa, essa força não só a torna mais poderosa, mas muito mais instável. Lutando com essa entidade dentro de si, Jean libera seus poderes de uma maneiras que não pode compreender nem conter. Com Jean perdendo o controle e ferindo aqueles que ela mais ama, ela começa a devastar a própria força que une os X-Men. Agora, com essa família caindo aos pedaços, eles devem encontrar uma maneira de se unir – não apenas para salvar Jean, mas também o nosso próprio planeta, ameaçado por alienígenas que desejam usar essa força e governar a galáxia.', 0, 'nadalini', NULL, NULL),
(NULL, 983, 'Noé', 'Noah', 'Estados Unidos', 'Ação, Aventura, Épico', 'Darren Aronofsky', '15445728335c104fa1b9cbf.jpg', 138, 2014, 'jLeE9OmyBg4', ' Russell Crowe, Jennifer Connelly, Emma Watson, Douglas Booth, Logan Lerman, Anthony Hopkins, Ray Winstone', 'Noé (Russell Crowe) vive com a esposa Naameh (Jennifer Connelly) e os filhos Sem (Douglas Booth), Cam (Logan Lerman) e Jafé (Leo McHugh Carroll) em uma terra desolada, onde os homens perseguem e matam uns aos outros. Um dia, Noé recebe uma mensagem do Criador de que deve encontrar Matusalém (Anthony Hopkins). Durante o percurso ele acaba salvando a vida da jovem Ila (Emma Watson), que tem um ferimento grave na barriga. Ao encontrar Matusalém, Noé descobre que ele tem a tarefa de construir uma imensa arca, que abrigará os animais durante um dilúvio que acabará com a vida na Terra, de forma a que a visão do Criador possa ser, enfim, resgatada.', 0, 'matheus', NULL, NULL),
(NULL, 984, 'Intocáveis', 'Intouchables', 'França', 'Comédia, Drama', 'Eric Toledano, Olivier Nakache', '15445734605c105214a3636.jpg', 112, 2011, 'Fb8h4gChlU', ' François Cluzet, Omar Sy, Anne Le Ny', 'Philippe (François Cluzet) é um aristocrata rico que, após sofrer um grave acidente, fica tetraplégico. Precisando de um assistente, ele decide contratar Driss (Omar Sy), um jovem problemático que não tem a menor experiência em cuidar de pessoas no seu estado. Aos poucos ele aprende a função, apesar das diversas gafes que comete. Philippe, por sua vez, se afeiçoa cada vez mais a Driss por ele não tratá-lo como um pobre coitado. Aos poucos a amizade entre eles se estabele, com cada um conhecendo melhor o mundo do outro.', 0, 'matheus', NULL, NULL),
(NULL, 985, 'Um Estranho no Ninho', 'One Flew Over the Cuckoo', 'Estados Unidos', 'Drama', 'Milos Forman', '15445740285c10544c65d13.jpg', 133, 1975, 'o7wtoBR6Jpo', 'Michael Berryman, Jack Nicholson, Louise Fletcher', 'Randle Patrick McMurphy (Jack Nicholson), um prisioneiro, simula estar insano para não trabalhar e vai para uma instituição para doentes mentais. Lá estimula os internos a se revoltarem contra as rígidas normas impostas pela enfermeira-chefe Ratched (Louise Fletcher), mas não tem idéia do preço que irá pagar por desafiar uma clínica \"especializada\".', 0, 'matheus', NULL, NULL),
(NULL, 986, 'Onde Os Fracos Não Têm Vez', 'No Country for Old Men', 'Estados Unidos', 'Crime, Drama, Suspense, Neo Noir', 'Ethan Coen, Joel Coen', '15445743685c1055a077907.jpg', 122, 2007, 'l1DNf-pcFE8', 'Tommy Lee Jones, Javier Bardem, Josh Brolin, Woody Harrelson', 'Texas, década de 80. Um traficante de drogas é encontrado no deserto por um caçador pouco esperto, Llewelyn Moss (Josh Brolin), que pega uma valise cheia de dinheiro mesmo sabendo que em breve alguém irá procurá-lo devido a isso. Logo Anton Chigurh (Javier Bardem), um assassino psicótico sem senso de humor e piedade, é enviado em seu encalço. Porém para alcançar Moss ele precisará passar pelo xerife local, Ed Tom Bell (Tommy Lee Jones).', 0, 'matheus', NULL, NULL),
(NULL, 987, 'Caixa de Pássaros', 'Bird Box', 'Estados Unidos', 'Drama, Terror, Suspense', 'Susanne Bier', '15445748985c1057b2df2d6.jpg', 117, 2018, 'JeGdtrLQoiY', 'Sandra Bullock, Sarah Paulson, John Malkovich, Trevante Rhodes', 'Em um mundo pós-apocalíptico, Malorie (Sandra Bullock) e seus filhos precisam chegar em um refúgio para escapar do Problema, criaturas que ao serem vistas fazem pessoas se tornarem extremamente violentas. De olhos vendados para não serem afetados, a família segue o curso de um rio para chegar à segurança.', 0, 'matheus', NULL, NULL),
(NULL, 988, 'Roma', 'Roma', 'México', 'Drama', 'Alfonso Cuarón', '15448423445c146c688c64a.jpg', 135, 2018, 'ICR6YvcyyJc', 'Yalitza Aparicio, Marina de Tavira, Diego Cortina Autrey, Carlos Peralta', 'Cidade do México, 1970. A rotina de uma família de classe média é controlada de maneira silenciosa por uma mulher (Yalitza Aparicio), que trabalha como babá e empregada doméstica. Durante um ano, diversos acontecimentos inesperados começam a afetar a vida de todos os moradores da casa, dando origem a uma série de mudanças, coletivas e pessoais.', 0, 'nadalini', NULL, NULL),
(NULL, 989, 'Turma da Mônica - Laços', 'Turma da Mônica - Laços', 'Brasil', 'Aventura, Infantil', 'Daniel Rezende', '15451465625c1910c26b5f9.jpg', 0, 2019, 'Mjz_IqLtI58', 'Giulia Benite, Kevin Vechiatto, Laura Rauseo, Gabriel Moreira, Monica Iozzi, Rodrigo Santoro', 'Floquinho, o cachorro do Cebolinha, desapareceu. O menino desenvolve então um plano infalível para resgatar o cãozinho, mas para isso vai precisar da ajuda de seus fiéis amigos Mônica, Magali e Cascão. Juntos, eles irão enfrentar grandes desafios e viver grandes aventuras para levar o cão de volta para casa. ', 0, 'matheus', NULL, NULL),
(NULL, 990, 'Eu Sou Mais Eu', 'Eu Sou Mais Eu', 'Brasil', 'Comédia', 'Pedro Amorim', '15451532725c192af8bd581.jpg', 0, 2019, 'LhpJ4tNJ59M', ' Kéfera Buchmann, Giovanna Lancellotti, João Côrtes, Felipe Titto', 'Camila Mendes (Kéfera Buchmann) é uma pop star solitária, cansada da rotina de uma grande estrela, que consegue viajar no tempo e retornar ao passado para compreender melhor sua essência. Lá ela reencontra Cabelo (João Côrtes), um colega de colégio que também é músico, só que nem um pouco popular.', 0, 'matheus', NULL, NULL),
(NULL, 991, 'É Fada', 'É Fada', 'Brasil', 'Comédia', 'Cris D\'Amato', '15451535635c192c1b08811.jpg', 85, 2016, 'VM-lplfYim8', 'Kéfera Buchmann, Klara Castanho, Bruna Griphão', 'Após se dar mal em uma série de trabalhos, a fada tagarela e atrapalhada Geraldine (Kéfera Buchmann) recebe a missão de ajudar a jovem Júlia (Klara Castanho). A garota vive com o pai e acaba de trocar de colégio. Ela tem dificuldade de lidar com os novos colegas e não é nenhum pouco popular na escola. A fada tentará mudar isso, ajudando em sua vida social e amorosa.', 0, 'matheus', NULL, NULL),
(NULL, 992, 'Vice', 'Vice', 'Estados Unidos', 'Biografia, Drama', 'Adam McKay', '15479394045c43ae4c1a296.jpg', 132, 2018, 'iCdS6yVOA0w', 'Christian Bale, Amy Adams, Steve Carell, Sam Rockwell, Jesse Plemons, Eddie Marsan, Tyler Perry, Jillian Armenante', 'A história de Dick Cheney (Christian Bale), o vice-presidente mais poderoso da história, e como suas políticas mudaram o mundo.', 0, 'matheus', NULL, NULL),
(NULL, 993, 'O Retorno de Mary Poppins', 'Mary Poppins Returns', 'Estados Unidos', 'Musical, Fantasia, Comédia, Infantil', 'Rob Marshall', '15451543235c192f13202de.jpg', 130, 2018, 'doBT-eeWNHk', 'Emily Blunt, Dick Van Dyke, Meryl Streep, Angela Lansbury, Lin-Manuel Miranda, Emily Mortimer', 'Numa Londres abalada pela Grande Depressão, Mary Poppins (Emily Blunt) desce dos céus novamente com seu fiel amigo Jack (Lin-Manuel Miranda) para ajudar Michael (Ben Whishaw) e Jane Banks (Emily Mortimer), agora adultos trabalhadores, que sofreram uma perda pessoal. As crianças Annabel (Pixie Davies), Georgie (Joel Dawson) e John (Nathanael Saleh) vivem com os pais na mesma casa de 24 anos atrás e precisam da babá enigmática e o acendedor de lampiões otimista para trazer alegria e magia de volta para suas vidas.', 0, 'matheus', NULL, NULL),
(NULL, 994, 'Ilha dos Cachorros', 'Isle of Dogs', 'Alemanha', 'Animação, Aventura, Comédia, Fantasia', 'Wes Anderson', '15451546405c1930509ec57.jpg', 101, 2018, 'RQA_k97LO9E', 'Bryan Cranston, Koyu Rankin, Edward Norton, Bob Balaban, Liev Schreiber', 'Atari Kobayashi é um garoto japonês de 12 anos de idade. Ele mora na cidade de Megasaki, sob tutela do corrupto prefeito Kobayashi. O político aprova uma nova lei que proíbe os cachorros de morarem no local, fazendo com que todos os animais sejam enviados a uma ilha vizinha repleta de lixo. Como não aceita se separar do cachorro Spots, Atari convoca os amigos, rouba um jato em miniatura em parte em busca de seu fiel amigo, aventura que transforma completamente a vida da cidade.', 0, 'matheus', NULL, NULL),
(NULL, 995, 'Sala Verde', 'Green Room', 'Estados Unidos', 'Terror, Suspense, Ação', 'Jeremy Saulnier', '15451558115c1934e3731ca.jpg', 95, 2015, 'eoPOkq4adCA', 'Anton Yelchin, Imogen Poots, Patrick Stewart, Joe Cole, Alia Shawkat, Callum Turner', 'Após terminarem seu show, uma banda de rock acaba testemunhando um terrível ato de violência e um brutal assassinato. Como eles são as únicas testemunhas do crime, eles logos se tornam o principal alvo de uma gangue de skinheads. A banda, então, terá que se refugiar na \"sala verde\" se quiser sobreviver à \"queima de arquivos\" promovida pelos brutais assassinos.', 0, 'matheus', NULL, NULL),
(NULL, 996, 'High School Musical', 'High School Musical', 'Estados Unidos', 'Musical, Comédia, Infantil', 'Kenny Ortega', '15451561895c19365d561d9.jpg', 98, 2006, '3z5SbJgNlI0', 'Zac Efron, Vanessa Hudgens, Ashley Tisdale, Lucas Grabeel, Monique Coleman, Corbin Bleu', 'Troy Bolton (Zac Efron) é um garoto popular, enquanto que Gabriella Montez (Vanessa Anne Hudgens) é uma jovem estudiosa. Durante as férias eles descobrem, em um concurso de karaokê, que são apaixonados pelo canto e que possuem interesse um no outro. Eles se reencontram no início das aulas, já que por coincidência Gabriella foi matriculada exatamente na turma de Troy. Quando as audições para o musical da escola têm início eles voltam a se encontrar, desta vez por uma batalha pelos papéis principais da produção.', 0, 'matheus', NULL, NULL),
(NULL, 997, 'High School Musical 2', 'High School Musical 2', 'Estados Unidos', 'Musical, Comédia, Infantil', 'Kenny Ortega', '15451563915c1937278edb9.jpg', 104, 2007, 'LN3SacLEe7c', 'Zac Efron, Vanessa Hudgens, Ashley Tisdale, Lucas Grabeel, Monique Coleman, Corbin Bleu', 'Querendo afastar Troy Bolton (Zac Efron) de Gabriella Montez (Vanessa Anne Hudgens), Sharpay Evans (Ashley Tisdale) consegue um emprego para ele no melhor clube de Albuquerque. Só que Troy consegue empregos temporários para seus amigos, o que os reúne novamente. Sharpay usa então o prestígio de seu pai para conseguir para Troy uma bolsa de estudos na faculdade, pedindo em troca que ele a acompanhe em um show de talentos que ocorrerá no clube. Troy aceita a oferta, o que magoa Gabriella. Ela decide, juntamente com os Wildcats, participar do show por conta própria.', 0, 'matheus', NULL, NULL),
(NULL, 999, 'High School Musical 3: Ano da Formatura', 'High School Musical 3: Senior Year', 'Estados Unidos', 'Musical, Comédia, Infantil', 'Kenny Ortega', '15451566595c193833583a1.jpg', 112, 2008, '1S8RTKL5cW8', 'Zac Efron, Vanessa Hudgens, Ashley Tisdale, Lucas Grabeel, Monique Coleman, Corbin Bleu', 'Troy Bolton (Zac Efron) e Gabriella Montez (Vanessa Anne Hudgens) estão no último ano do colegial, diante da possibilidade de se separarem caso escolham faculdades diferentes. Juntamente com os demais Wildcats eles apresentam um musical de primavera, que reflete suas experiências, sensações e temores em relação ao futuro.', 0, 'matheus', NULL, NULL),
(NULL, 1000, 'Uma Noite No Museu', 'Night at the Museum', 'Estados Unidos', 'Comédia , Aventura, Fantasia', 'Shawn Levy', '15451569145c1939325055c.jpg', 108, 2006, 'qp-F_KzANjM', 'Ben Stiller, Carla Gugino, Dick Van Dyke, Mickey Rooney', 'Larry Daley (Ben Stiller) é um homem de bom coração, que arranja um emprego como segurança noturno em um museu de história natural. Logo em seu 1º turno coisas estranhas começam a acontecer: esqueletos de dinossauros e estátuas de cera começam a ganhar vida. Em meio ao caos instalado no museu, a única pessoa que pode ajudá-lo é a estátua de cera de Theodore Roosevelt (Robin Williams), que, assim como os demais, também ganhou vida.', 0, 'matheus', NULL, NULL),
(NULL, 1001, 'Uma Noite No Museu 2', 'Night at the Museum: Battle of the Smithsonian', 'Estados Unidos', 'Comédia , Aventura, Fantasia', 'Shawn Levy', '15451571365c193a10e1adf.jpg', 105, 2009, 'rjiQayo-HXM', 'Ben Stiller, Amy Adams, Owen Wilson, Hank Azaria', 'Larry Daley (Ben Stiller) deixou o posto de guarda noturno há dois anos, abrindo sua própria empresa. De vez em quando ele volta ao Museu de História Natural, onde trabalhava, para rever os amigos que, à noite, ganham vida. Só que o museu está prestes a passar por uma reforma visando sua modernização, o que fará com que vários dos bonecos de cera sejam substituídos por máquinas que permitem a interação com o público. Eles são enviados ao Instituto Smithsonian, em Washington, o maior complexo de museus do mundo. Um dia Larry recebe um telefonema desesperado de Jedediah (Owen Wilson), o caubói diminuto, pedindo sua ajuda. Larry invade o Smithsonian e descobre que o faraó Kahmunrah (Hank Azaria) despertou, tornando-se uma ameaça não apenas para seus amigos como para o planeta.', 0, 'matheus', NULL, NULL),
(NULL, 1002, 'Uma Noite No Museu 3 - O Segredo da Tumba', 'Night at the Museum: Secret of the Tomb', 'Estados Unidos', 'Comédia , Aventura, Fantasia', 'Shawn Levy', '15451573965c193b142a7e2.jpg', 98, 2014, 'c7_bamKRjlE', 'Ben Stiller, Robin Williams, Owen Wilson, Steve Coogan', 'O segurança Larry Daley (Ben Stiller) segue com seu inusitado trabalho no Museu de História Natural de Nova York. Determinado dia, descobre que a peça que faz os objetos do museu ganharem vida está sofrendo um processo de danificação. Com isso, todos dos amigos de Larry correm o risco de não ganharem mais vida. Para tentar salvar a turma, ele vai para Londres pedir a orientação do faraó (Ben Kingsley) que está em exposição no museu local.', 0, 'matheus', NULL, NULL),
(NULL, 1003, 'TRON - O Legado', 'TRON: Legacy', 'Estados Unidos', 'Ficção científica, Ação, Aventura', 'Joseph Kosinski', '15451577465c193c72aa876.jpg', 125, 2010, 'Shl6xVjnQuY', 'Jeff Bridges, Garrett Hedlund, Olivia Wilde, Bruce Boxleitner', 'Kevin Flynn (Jeff Bridges) é um gênio da informática que, um dia, desapareceu sem deixar vestígios. Seu filho Sam (Owen Best), na época com sete anos, é criado pelos avós e a empresa de Flynn, a Encom, é gerenciada pelos demais acionistas. Já com 27 anos, Sam (Garrett Hedlund) não quer assumir o controle da empresa e prefere boicotá-la uma vez por ano. Um dia o braço direito de seu pai, Alan Bradley (Bruce Boxleitner), recebe um bipe, o que faz com que Sam vá até o local onde Kevin tinha uma série de consoles de videogame. Lá Sam encontra uma passagem secreta, que o leva a uma câmara onde está o último trabalho de seu pai. Sam o aciona e é levado a outro mundo, tecnológico, habitado por programas de computação.', 0, 'matheus', NULL, NULL),
(NULL, 1004, 'Rango', 'Rango', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Faroeste', 'Gore Verbinski', '15451579345c193d2e8b4c4.jpg', 107, 2011, 'h2zR6GrgSZY', 'Johnny Depp, Isla Fisher, Abigail Breslin, Ned Beatty', '', 0, 'matheus', NULL, NULL),
(NULL, 1005, 'Megamente', 'Megamind', 'Estados Unidos', 'Animação, Comédia, Infantil', 'Tom McGrath', '15451581205c193de8b6b6a.jpg', 95, 2010, 'GTgogZbAtu8', 'Will Ferrell, Brad Pitt, Tina Fey, Jonah Hill', 'Tudo o que vilão Megamente (Will Ferrell) mais queria era eliminar seu adversário Metro Man (Brad Pitt/Thiago Lacerda) e assim dominar a cidade de Metro City. Só que para isso era necessário um plano ainda mais diabólico do que todos já tentados anteriormente. Um dia, com a ajuda de Criado (David Cross) e após sequestrar a repórter Rosane Rocha (Tina Fey), o malvado consegue o inimaginável, para ele e para todos: dar um sumiço no herói. A única coisa que ele não contava era que sua vida se tornaria tão chata a ponto de ele inventar um herói para combater.', 0, 'matheus', NULL, NULL),
(NULL, 1006, 'Se Beber, Não Case!', 'The Hangover', 'Estados Unidos', 'Comédia', 'Todd Phillips', '15451583365c193ec05d232.jpg', 100, 2009, 'Cm7eAq1PaXE', 'Bradley Cooper, Ed Helms, Zach Galifianakis, Justin Bartha', 'Doug Billings (Justin Bartha) está prestes a se casar. Stu Price (Ed Helms), um dentista que planeja pedir a namorada em casamento, Phil Wenneck (Bradley Cooper), um professor colegial entediado com o matrimônio, e Alan Garner (Zach Galifianakis), seu futuro cunhado, são seus melhores amigos. O trio organiza uma festa de despedida de solteiro para Doug, levando-o para Las Vegas. Lá eles alugam uma suíte e têm uma noite de grande badalação. Na manhã seguinte os três acordam sem ter a menor idéia do que aconteceu na noite anterior. Eles sabem apenas que Stu perdeu um dente, há um tigre no banheiro, um bebê no closet e Doug simplesmente desapareceu. Para descobrir o que ocorreu, eles tentam juntar as memórias e reconstituir os eventos do dia anterior.', 0, 'matheus', NULL, NULL),
(NULL, 1007, 'Se Beber, Não Case! Parte II', 'The Hangover Part II', 'Estados Unidos', 'Comédia', 'Todd Phillips', '15451584675c193f431cb6d.jpg', 102, 2011, 'k-EBgeqViYs', 'Bradley Cooper, Ed Helms, Zach Galifianakis, Justin Bartha', 'Depois de uma farra inesquecível em Las Vegas, Phil (Bradley Cooper), Stu (Ed Helms), Alan (Zach Galifianakis) e Doug (Justin Bartha) seguiram com suas vidas. Mas o bom e velho Stu está disposto a se casar novamente, desta vez com Lauren (Jamie Chung), e o local escolhido para a cerimônia foi a exótica Tailândia. Entretanto, o que era para ser uma simples despedida de solteiro acabou se transformando em outra aventura muito louca, só que agora num país diferente, com suas proprias regras e a promessa de ser \"marcante\".', 0, 'matheus', NULL, NULL),
(NULL, 1008, 'Se Beber, Não Case! Parte III', 'The Hangover Part III', 'Estados Unidos', 'Comédia', 'Todd Phillips', '15451586205c193fdc0ae65.jpg', 100, 2013, 'HM_JmKO7yLw', 'Bradley Cooper, Ed Helms, Zach Galifianakis, Justin Bartha', 'Alan (Zach Galifianakis) está deprimido devido à morte de seu pai. Preocupado com o cunhado, Doug (Justin Bartha) sugere que ele vá até um lugar chamado New Horizons, que pode torná-lo um novo homem. Alan apenas aceita a sugestão após Phil (Bradley Cooper) e Stu (Ed Helms) concordarem em levá-lo, juntamente com Doug. É o início de uma nova viagem do quarteto, que acaba sendo interrompida bruscamente pelos capangas de Marshall (John Goodman). O malfeitor está atrás de Chow (Ken Jeong), que lhe aplicou um golpe milionário, e acredita que os amigos ainda possuam contato com ele. Após sequestrar Doug, Marshall dá a Alan, Stu e Phil um prazo para que encontrem Chow e devolvam as barras de ouro por ele roubadas, caso contrário todos morrerão. O que o trio não esperava era que, para reencontrar Chow, teria que ir até Tijuana, no México, e também em Las Vegas.', 0, 'matheus', NULL, NULL),
(NULL, 1011, 'Anjos da Lei 2', '22 Jump Street', 'Estados Unidos', 'Comédia, Policial', 'Phil Lord, Christopher Miller', '15451594585c19432244565.jpg', 112, 2014, 'ptNV2wgG4wA', 'Jonah Hill, Channing Tatum, Peter Stormare, Wyatt Russell', 'Os oficiais Schmidt (Jonah Hill) e Jenko (Channing Tatum) têm agora uma nova missão: se infiltrar em uma faculdade local. O problema é que, em meio à investigação, Jenko conhece sua alma gêmea em plena equipe de atletismo e Schmidt, após se infiltrar no centro de arte boêmia, começa a questionar a dupla. Em meio aos inevitáveis problemas de relacionamento, eles precisam encontrar um meio de desvendar o caso que estão investigando.', 0, 'matheus', NULL, NULL),
(NULL, 1012, '007 - Operação Skyfall', 'Skyfall', 'Reino Unido', 'Ação, Espionagem, Suspense', 'Sam Mendes', '15451597125c194420be138.jpg', 143, 2012, 'CIM8bMUgOVk', 'Daniel Craig, Judi Dench, Javier Bardem, Ralph Fiennes', 'O roubo de um HD contendo informações valiosas sobre a identidade de diversos agentes, infiltrados em células terroristas espalhadas ao redor do planeta, faz com que James Bond (Daniel Craig) parta atrás do ladrão. A perseguição segue pelas ruas de uma cidade na Turquia e acaba em cima de um trem. Precisando impedir que a peça seja levada, M (Judi Dench) ordena que a agente Eve (Naomi Harris) dispare, mesmo sabendo que o tiro pode atingir Bond. É o que acontece, fazendo com que o agente 007 despenque de uma altura incrível. Considerado morto, Bond passa a levar uma vida como \"fantasma\" até assistir, pela TV, o ataque terrorista sofrido pelo MI6 em plena Londres. Disposto a mais uma vez defender seu país, ele retorna à capital inglesa e se reapresenta a M, mesmo guardando uma certa mágoa dela por ter ordenado o disparo. Logo eles descobrem que o responsável pelo roubo e o atentado é alguém que conhece muito bem o modo de funcionamento do MI6.', 0, 'matheus', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1013, 'As Aventuras de Tintim', 'The Adventures of Tintin', 'Estados Unidos', 'Aventura, Animação, Infantil', 'Steven Spielberg', '15451599705c1945229afc5.jpg', 107, 2011, 'Nq5wKa0ihmM', 'Jamie Bell, Andy Serkis, Daniel Craig, Nick Frost', 'Tintim (Jamie Bell) é um jovem repórter, que está sempre atrás de boa matéria. Um dia, ele vê à venda na rua o modelo de um galeão antigo e resolve comprá-lo. Logo dois outros interessados o abordam, querendo adquirir o objeto, mas Tintim não o vende. Ele leva o galeão à sua casa, onde o coloca em destaque. Só que a entrada de um gato faz com que Milu, seu cachorro, o persiga dentro de casa e, por acidente, derrube o galeão. Ele fica danificado e um pequeno cilindro sai de seu interior, sem que Tintim perceba. Logo Tintim e Milu vão à biblioteca, onde tentam encontrar mais informações sobre o navio retratado no modelo. Ao retornar percebem que o galeão foi roubado. Tintim vai até a mansão recentemente comprada pelo doutor Sakharine (Daniel Craig), um dos interessados em comprar o modelo, mas nada descobre. Ao retornar ele encontra o cilindro e percebe que, dentro dele, há uma pista para um tesouro perdido. É o início de uma nova aventura, onde Tintim e Milu se juntam ao capitão Haddock (Andy Serkis) na disputa contra Sakharine para encontrar o tesouro.', 0, 'matheus', NULL, NULL),
(NULL, 1014, 'Bao', 'Bao', 'Estados Unidos', 'Animação, Curta-Metragem', 'Domee Shi', '15451762475c1984b7841e7.jpg', 8, 2018, 'TU77GwVz7Us', 'Daniel Kailin, Sindy Lau', 'Depois que seus filhos saem de casa e se tornam independentes, uma mãe chinesa-canadense sofre com o seu \"ninho vazio\". Quando um dos seus bolinhos artesanais ganha vida, ela recebe uma nova oportunidade para experienciar a maternidade. No entanto, ela precisa entender que mesmo as criatura mais doces e fofas também crescem eventualmente.', 0, 'matheus', NULL, NULL),
(NULL, 1015, 'Verão em Rildas', 'Verão em Rildas', 'Brasil', 'Drama', 'Daniel Caetano', '15452712565c1af7d85679a.jpg', 71, 2018, 'vwzcmliLc6k', 'Alice Gorman, Dayane Benício, João Ribeiro, Matheus De Martini, Jards Macalé, Carol Pucu, Jorge Vasconcellos', 'Um grupo de estudantes universitários, moradores da cidade litorânea de Rio das Ostras, decide organizar um festival de artes no local. Durante a divulgação do evento nas redes sociais, eles são surpreendidos pela repercussão equivocada de um postagem, e as consequências do ato ultrapassam as barreiras do mundo online afetando suas vidas e rotinas.', 0, 'matheus', NULL, NULL),
(NULL, 1016, 'Sherlock Holmes: O Jogo de Sombras', 'Sherlock Holmes: A Game of Shadows', 'Estados Unidos', 'Ação, Aventura, Policial, Mistério', 'Guy Ritchie', '15453245505c1bc8064c78e.jpg', 129, 2011, 'z8QbU7t5cTA', 'Robert Downey Jr., Jude Law, Noomi Rapace, Rachel McAdams', 'Sherlock Holmes (Robert Downey Jr.) continua desenvolvendo novos disfarces e maneiras de ludibriar seus oponentes, enquanto seu fiel escudeiro John Watson (Jude Law) está prestes a se casar e sair numa lua de mel dos sonhos com sua amada Mary Morstan (Kelly Reilly). A única coisa que o caro Watson não contava era que seu amigo Holmes apareceria com uma nova teoria conspiratória de que o ardiloso Professor Moriarty (Jarred Harris) estaria por trás de uma série de assassinatos, que visam desestabilizar a paz mundial. Quando a amiga Irene Adler (Rachel McAdams) desaparece, depois de prestar um serviço sujo para Moriarty, Holmes descobre que a cigana Simza (Noomi Rapace) pode ser a chave para desvendar todo o mistério por trás das mortes. A questão é: conseguirá Holmes superar a esperteza do terrível Moriarty?', 0, 'matheus', NULL, NULL),
(NULL, 1017, 'MIB: Homens de Preto - Internacional', 'Men in Black: International', 'Estados Unidos', 'Ficção científica, Ação, Comédia', 'F. Gary Gray', '15453249805c1bc9b45f5e9.jpg', 0, 2019, 'o85NKqrwCKI', 'Chris Hemsworth, Tessa Thompson, Liam Neeson, Emma Thompson, Rebecca Ferguson, Kumail Nanjiani, Rafe Spall, Anatole Taubman', 'Por décadas a agência Homens de Preto protegeu a Terra da escória do universo, mas agora precisa lidar com a maior das ameaças: um traidor, justo quando a agência torna-se internacional. É neste contexto que Em (Tessa Thompson) tenta se tornar agente, já que teve uma experiência extraterrestre quando jovem e não teve sua memória apagada. Quem irá auxiliá-lo nesta jornada é o atrapalhado agente H (Chris Hemsworth).', 0, 'matheus', NULL, NULL),
(NULL, 1018, 'Kung Fu Panda', 'Kung Fu Panda', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Mark Osborne, John Stevenson', '15453252235c1bcaa737b48.jpg', 92, 2008, '0dzBQL41MOI', 'Jack Black, Dustin Hoffman, Angelina Jolie, Ian McShane', 'Po (Jack Black) é um urso panda desajeitado, que trabalha no restaurante de macarrão de sua família. Um dia ele é surpreendido ao saber que foi escolhido para cumprir uma antiga profecia, o que faz com que treine ao lado de seus ídolos no kung fu: os mestres Shifu (Dustin Hoffman), Garça (David Cross), Tigresa (Angelina Jolie), Louva-deus (Seth Rogen), Macaco (Jackie Chan) e Víbora (Lucy Liu). Quando o traiçoeiro leopardo da neve Tai Lung (Ian McShane) retorna, cabe a Po defender o Vale da Paz.', 0, 'matheus', NULL, NULL),
(NULL, 1019, 'Kung Fu Panda 2', 'Kung Fu Panda 2', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Jennifer Yuh Nelson', '15453253945c1bcb528851c.jpg', 90, 2011, '-Gi8WLRKN6Y', 'Jack Black, Angelina Jolie, Dustin Hoffman, Gary Oldman', '', 0, 'matheus', NULL, NULL),
(NULL, 1020, 'Kung Fu Panda 3', 'Kung Fu Panda 3', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Alessandro Carloni, Jennifer Yuh Nelson', '15453255665c1bcbfe6a28a.jpg', 95, 2016, 'q75bGipJzIg', 'Jack Black, Bryan Cranston, Dustin Hoffman, Angelina Jolie', 'Depois de reencontrar o pai, Po precisa treinar os moradores de um vilarejo repleto de pandas atrapalhados e ajudá-los a derrotar um perigoso e malvado vilão.', 0, 'matheus', NULL, NULL),
(NULL, 1021, 'Bolt - Supercão', 'Bolt', 'Estados Unidos', 'Animação, Comédia , Infantil, Aventura', 'Byron Howard, Chris Williams', '15453257655c1bccc59aa33.jpg', 96, 2008, 'Zwn0VuCbH-c', 'John Travolta, Miley Cyrus, Susie Essman, Mark Walton', 'Bolt (John Travolta) é um cachorro que estrela uma série de TV, na qual possui superpoderes. Sua companheira é Penny (Miley Cyrus), com quem vive diversas aventuras. Entretanto Bolt não sabe que o mundo que o cerca é falso, acreditando que realmente possui dons especiais. Quando, nas gravações de um dos episódios, Penny é sequestrada pelo dr. Calico (Malcolm McDowell), o vilão da série, ele consegue fugir do furgão em que vive e parte atrás dela. Ao lidar com a vida real é que, aos poucos, ele toma consciência de que não tem superpoderes e é um cachorro normal.', 0, 'matheus', NULL, NULL),
(NULL, 1022, 'Bee Movie - A História de Uma Abelha', 'Bee Movie', 'Estados Unidos', 'Animação, Comédia, Infantil', 'Simon J. Smith, Steve Hickner', '15453260445c1bcddc78dfa.jpg', 91, 2007, 'VONRQMx78YI', 'Jerry Seinfeld, Renée Zellweger, Matthew Broderick, Patrick Warburton', 'A recém-formada abelha Barry acha a vida de trabalhar com mel desinteressante. Ele voa fora da colmeia pela primeira vez e conversa com um humano, quebrando uma primordial regra de sua espécie. Barry descobre que humanos têm roubado e comido mel há séculos e decide processar a humanidade.', 0, 'matheus', NULL, NULL),
(NULL, 1023, 'Os Simpsons - O Filme', 'The Simpsons Movie', 'Estados Unidos', 'Animação, Comédia', 'David Silverman', '15453379505c1bfc5e7d498.jpg', 87, 2007, 'Pc8ZwPBPxNM', 'Dan Castellaneta, Julie Kavner, Nancy Cartwright, Yeardley Smith', 'Homer Simpson (Dan Castellaneta) tem um novo bicho de estimação: um porco. Devido a um silo perfurado e cheio de fezes, um desastre de grandes proporções acontece em Springfield. Isto faz com que uma multidão sedenta por vingança se reúna diante da casa dos Simpsons, querendo Homer e sua família de qualquer jeito. Eles conseguem escapar, mas a partir de então os Simpsons passam a discutir e se dividir sobre o ocorrido. Paralelamente o ocorrido chama a atenção do presidente dos Estados Unidos, Arnold Schwazenegger (Harry Shearer), e do chefe da Agência de Proteção Ambiental, Russ Cargill (Albert Brooks), que planeja realizar um plano diabólico para conter o desastre ocorrido.', 0, 'matheus', NULL, NULL),
(NULL, 1024, 'Bumblebee', 'Bumblebee', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Travis Knight', '15453381815c1bfd4556d9f.jpg', 113, 2018, 'bXZ2a1akR5Q', 'Hailee Steinfeld, Justin Theroux, Angela Bassett, Pamela Adlon', '1987. Refugiado num ferro-velho numa pequena cidade praiana da Califórnia, Bumblebee, um fusca amarelo aos pedaços, machucado e sem condição de uso, é encontrado e consertado pela jovem Charlie (Hailee Steinfeld), às vésperas de completar 18 anos. Só quando Bee ganha vida ela enfim nota que seu novo amigo é bem mais do que um simples automóvel.', 0, 'nadalini', NULL, NULL),
(NULL, 1025, 'Era uma Vez um Deadpool', 'Once Upon a Deadpool', 'Estados Unidos', 'Ação, Aventura, Comédia, Ficção Científica, Herói', 'David Leitch', '15454853845c1e3c48713a4.jpg', 119, 2018, '_SiPmxKk7pI', 'Ryan Reynolds, Josh Brolin, Morena Baccarin, Julian Dennison', 'Determinado a provar que Deadpool 2 é um filme para toda a família, Wade Wilson (Ryan Reynolds) limpa todos os palavrões e sangue da narrativa e sequestra o ator e diretor Fred Savage para reencenar A Princesa Prometida. Sem poder se desvencilhar das amarras, Savage é obrigado a ouvir o \"conto de fadas\" do Mercenário Tagarela, incluindo sua luta com Cable (Josh Brolin) e a formação da X-Force.', 0, 'nadalini', NULL, NULL),
(NULL, 1026, 'Homem Aranha: No Aranhaverso', 'Spider-Man: Into the Spider-Verse', 'Estados Unidos', 'Animação, Ação, Aventura, Ficção Científica, Herói', 'Bob Persichetti, Peter Ramsey, Rodney Rothman', '15479401015c43b10579b04.jpg', 116, 2018, 'IrQ3iLUKr0I', 'Hailee Steinfeld, Liev Schreiber, Nicolas Cage, Mahershala Ali', 'Miles Morales é um jovem negro do Brooklyn que se tornou o Homem-Aranha inspirado no legado de Peter Parker, já falecido. Entretanto, ao visitar o túmulo de seu ídolo em uma noite chuvosa, ele é surpreendido com a presença do próprio Peter, vestindo o traje do herói aracnídeo sob um sobretudo. A surpresa fica ainda maior quando Miles descobre que ele veio de uma dimensão paralela, assim como outras variações do Homem-Aranha.', 0, 'nadalini', NULL, NULL),
(NULL, 1027, 'O Culto', 'The Endless', 'Estados Unidos', 'Fantasia, Ficção Científica, Suspense', 'Justin Benson, Aaron Moorhead', '15456211695c204eb1577f6.jpg', 111, 2017, '-AIolmqStZ0', 'Aaron Moorhead, Justin Benson, Callie Hernandez, Tate Ellington', 'Dois irmãos retornam ao culto do qual fugiram anos atrás para descobrir que as crenças do grupo podem ser mais do que pensavam.', 0, 'nadalini', NULL, NULL),
(NULL, 1028, 'Truque de Mestre: O Segundo Ato', 'Now You See Me 2', 'Estados Unidos', 'Suspense, Ação, Comédia', 'Jon M. Chu', '15458483275c23c607b3cd2.jpg', 129, 2016, '3QFa2h0e22s', 'Jesse Eisenberg, Mark Ruffalo, Woody Harrelson, Dave Franco', 'Após enganarem o FBI, os cavaleiros Daniel Atlas (Jesse Eisenberg), Merritt McKinney (Woody Harrelson) e Jack Wilder (Dave Franco) estão foragidos. Eles seguem as ordens de Dylan Rhodes (Mark Ruffalo), que segue trabalhando no FBI de forma a impedir os avanços na procura dos próprios cavaleiros. Paralelamente, o grupo planeja seu novo ato: desmascarar um jovem gênio da informática, cujo novo lançamento coleta dados pessoais dos usuários. Entretanto, durante a revelação da farsa, os próprios cavaleiros são vítimas de um contragolpe, vindo de um inimigo desconhecido.', 0, 'helena', NULL, NULL),
(NULL, 1029, 'Boa Noite, Mamãe', 'Ich seh, Ich seh', 'Áustria', 'Terror, Mistério, Suspense, Fantasia', 'Severin Fiala, Veronika Franz', '15458489915c23c89f2cd9b.jpg', 99, 2014, 'QUaIWSBZwUI', 'Lukas Schwarz, Elias Schwarz, Susanne Wuest, Hans Escher', 'Uma família vive em uma residência isolada em meio a árvores e plantações de milho. Após dias afastada por conta de cirurgias plásticas, a mãe (Susanne Wuest) volta para casa e não é reconhecida pelos filhos gêmeos. As crianças, de nove anos, duvidam que a mulher de rosto coberto seja realmente sua mãe e a partir de então nada será como antes.', 0, 'helena', NULL, NULL),
(NULL, 1030, 'A Noite É Delas', 'Rough Night', 'Estados Unidos', 'Comédia, Crime', 'Lucia Aniello', '15458491875c23c963b8a30.jpg', 101, 2017, 'Qz41G5CiMXA', 'Scarlett Johansson, Jillian Bell, Zoë Kravitz, Ilana Glazer', 'Inseparáveis na juventude, Jess (Scarlett Johansson), Alice (Jillian Bell), Blair (Zoë Kravitz) e Frankie (Ilana Glazer) tomaram rumos totalmente diferentes após a formatura e se reúnem pela primeira vez em anos para a despedida de solteira de Jess. Com uma casa de praia alugada em Miami, elas - mais Pippa (Kate McKinnon), amiga australiana da noiva - planejam bebedeiras, drogas, sexo e baladas, mas acabam na verdade tendo muita dor de cabeça para ocultar o cadáver de um stripper morto acidentalmente.', 0, 'helena', NULL, NULL),
(NULL, 1031, 'Better Watch Out', 'Better Watch Out', 'Austrália', 'Suspense', 'Chris Peckover', '15458494255c23ca5113a68.jpg', 89, 2016, 'Q6R_h0fqZW4', 'Olivia DeJonge, Levi Miller, Ed Oxenbould, Aleks Mikic', 'Uma noite antes do Natal, Deandra (Virginia Madsen) e Robert (Patrick Warburton) saem e deixam seu filho de 12 anos, Luke (Levi Miller), com a jovem babá Ashley (Olivia DeJonge), afinal a casa da família fica numa rua calma de subúrbio, num bairro considerado seguro. O menino logo tenta conquistar o amor da babá até que eles se deparam com estranhos invadindo a casa. O acontecimento está longe de ser uma invasão de domicílio normal.', 0, 'helena', NULL, NULL),
(NULL, 1032, 'Nós ', 'Us ', 'Estados Unidos', 'Terror, Suspense ', 'Jordan Peele ', '15458496845c23cb544c26f.jpg', 0, 2019, 'jrWo0LEok90', ' Elisabeth Moss, Lupita Nyong\'o, Winston Duke, Tim Heidecker, Yahya Abdul-Mateen Il, Anna Diop', 'Adelaide (Lupita Nyong\'o) e Gabe (Winston Duke) decidem levar a família para passar um fim de semana na praia e descansar em uma casa de veraneio. Eles viajam com os filhos e começam a aproveitar o ensolarado local, mas a chegada de um grupo misterioso muda tudo e a família se torna refém de seus próprios duplos.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1034, 'Godzilla ll: Rei dos Monstros ', 'Godzilla: King of the Monsters', 'Estados Unidos', 'Ação, Ficção científica', 'Michael Dougherty', '15458501135c23cd0145eae.jpg', 0, 2019, 'U2IU9ty0AQ8', 'Vera Farmiga, Kyle Chandler, Millie Bobby Brown, Ken Watanabe, Sally Hawkins, Ziyi Zhang, Charles Dance, O\'Shea Jackson Jr', 'Sequência do longa-metragem lançado em 2014, que trouxe de volta o famoso monstro japonês para as telonas.', 0, 'helena', NULL, NULL),
(NULL, 1035, 'MIB - Homens de Preto', 'Men in Black', 'Estados Unidos', 'Aventura, Comédia, Ficção Científica, Ação', 'Barry Sonnenfeld', '15458501415c23cd1dacb8f.jpg', 98, 1997, 'lVlv_BReCUE', 'Tommy Lee Jones, Will Smith, Linda Fiorentino, Vincent D\'Onofrio', 'Agência secreta governamental cuida de fiscalizar os alienígenas que já vivem na Terra, sendo que alguns são vigiados em tempo integral. James Edwards (Will Smith), um novato na organização, em parceria de K (Tommy Lee Jones), um veterano agente, tenta impedir um terrorista intergalático, que planeja assassinar dois representantes de galáxias opostas e destruir o planeta Terra.', 0, 'matheus', NULL, NULL),
(NULL, 1037, 'MIB - Homens de Preto 2', 'Men in Black II', 'Estados Unidos', 'Aventura, Comédia, Ficção Científica, Ação', 'Barry Sonnenfeld', '15458504285c23ce3c7bbf7.jpg', 88, 2002, 'YR-YzvWcTAk', 'Tommy Lee Jones, Will Smith, Rip Torn, Lara Flynn Boyle', 'Com a Terra sendo ameaçada pela presença de Serleena (Lara Flynn Boyle), uma Kylothian cruel e monstruosa que está disfarçada como uma modelo terráquea, o agente J (Will Smith) resolve por pedir ajuda ao seu antigo companheiro K (Tommy Lee Jones), que teve sua memória apagada e agora trabalha nos Correios sob o nome de Kevin Brown. J precisa então restaurar a memória de K, para que possam combater juntos a ameaça.', 0, 'matheus', NULL, NULL),
(NULL, 1038, 'MIB - Homens de Preto 3', 'Men in Black III', 'Estados Unidos', 'Aventura, Comédia, Ficção Científica, Ação', 'Barry Sonnenfeld', '15458506485c23cf18817b3.jpg', 106, 2012, 'f-aoTaFkoj8', 'Will Smith, Tommy Lee Jones, Josh Brolin, Jemaine Clement', 'O terrível Boris, o Animal (Jemaine Clement) foi capturado no passado pelo agente K (Tommy Lee Jones) e na época perdeu o seu braço. Vivendo na prisão lunar de segurança máxima, o alienígena consegue bolar um plano de fuga para dar andamento ao seu objetivo de recuperar o membro de seu corpo e ainda acabar com K de uma vez por todas. Para isso, ele pretende viajar no tempo e mudar o rumo da história. Para evitar que ele triunfe em seu plano maligno, o agente J (Will Smith) também volta ao passado e lá encontrará os jovens agentes K (Josh Brolin) e O (Alice Eve), descobrindo segredos que mudarão sua vida e a amizade de ambos.', 0, 'matheus', NULL, NULL),
(NULL, 1039, 'O Lar das Crianças Peculiares', 'Miss Peregrine\'s Home For Peculiar Children', 'Estados Unidos', 'Aventura, Fantasia, Infantil', 'Tim Burton', '15458515995c23d2cfe1fc7.jpg', 127, 2016, 'DNn2F2nIky8', 'Eva Green, Asa Butterfield, Samuel L. Jackson, Judi Dench', 'Após a estranha morte de seu avô (Terence Stamp), o jovem Jake (Asa Butterfield) parte com seu pai para o País de Gales. Lá ele pretende encontrar a srta. Peregrine (Eva Green), atendendo ao último pedido do avô, que lhe disse que \"ela contará tudo\". Só que, ao chegar, descobre que o local onde ela viveria é uma mansão em ruínas, que foi atingida por um míssil durante a Segunda Guerra Mundial. Ao investigar a área, Jake descobre que lá há uma fenda temporal, onde a srta. Peregrine vive e protege várias crianças dotadas de poderes especiais.', 0, 'matheus', NULL, NULL),
(NULL, 1040, 'Zoolander ', 'Zoolander', 'Estados Unidos', 'Comédia ', 'Ben Stiller', '15458516075c23d2d727c27.jpg', 90, 2001, 'WWg1EQ3-kPU', 'Ben Stiller, Owen Wilson, Christine Taylor, Will Ferrell', 'Derek Zoolander (Ben Stiller) é um supermodelo egocêntrico em crise, já que perdeu recentemente o posto de número 1 na classificação dos modelos para seu rival Hansel (Owen Wilson). Deprimido, ele busca auxílio com Jacobim Mugatu (Will Ferrell), seu \"papa\" no mundo da moda, que tem outros planos para Zoolander. Juntamente com uma falsa agente da CIA, Mugatu realiza uma lavagem cerebral em Zoolander, a fim de transformá-lo em um assassino frio e burro ao seu dispor. O plano de Mugatu é enviar Zoolander para assassinar o Presidente da Malásia quando este estiver em sua visita a Nova York, pois com ele morto Mugaru poderá explorar o trabalho infantil no país, o que resultará em custos mais baixos para sua confecção de roupas. Até que Matilda Jeffries (Christine Taylor), uma jornalista da Time Magazine, desconfia dos planos de Mugaru e decide por evitar que Zoolander complete sua missão.', 0, 'helena', NULL, NULL),
(NULL, 1041, 'Zoolander 2', 'Zoolander 2', 'Estados Unidos', 'Comédia', 'Ben Stiller', '15458517835c23d387ae50c.jpg', 101, 2016, 'WWg1EQ3-kPU', 'Justin Bieber, Jon Daly, Penélope Cruz, Ben Stiller, Owen Wilson, Benedict Cumberbatch, Kristen Wiig, Cyrus Arnold', 'Depois que uma série de celebridades é assassinada, a agente policial e ex-modelo de biquíni Valentina Valencia (Penélope Cruz) busca o ex-supermodelo Derek Zoolander (Ben Stiller) para ajudá-la a solucionar os casos. Porém, aposentado, assim como o ex-companheiro de passarela Hansel (Owen Wilson), ele está desaparecido – e se ressente por não ter mais contato com o filho, agora adolescente. Até que a convite de Alexanya Atoz (Kristen Wiig) dona da marca mais badalada da atualidade, eles acabam topando fazer um novo desfile. Mal sabem os desmiolados, no entanto, que tudo não passa de um plano maquiavélico comandado por Mugatu (Will Ferrell).', 0, 'helena', NULL, NULL),
(NULL, 1042, 'Legalmente Loira', 'Legally Blonde', 'Estados Unidos', 'Comédia, Romance', 'Robert Luketic', '15458521525c23d4f8a11b0.jpg', 96, 2001, 'E8I-Qzmbqnc', 'Reese Witherspoon, Luke Wilson, Selma Blair, Matthew Davis', 'Elle Woods (Reese Whiterspoon) é uma garota que tem tudo que possa querer. Ela é a presidente da fraternidade de onde estuda, Miss Junho no calendário do campus e, além disso, uma loira natural. Elle ainda namora o mais bonito garoto de seu colégio, Warner Huntington III (Matthew Davis), com quem inclusive planeja se casar no futuro. Mas Elle tem um problema que incomoda Warner: ela é fútil demais! Até que, quando Warner vai estudar Direito na Universidade de Harvard, ele passa a namorar uma nova garota (Selma Blair) e decide largar Elle, que não se dá por vencida e decide estudar a fim de também passar para o curso de Direito e ainda por cima provar sua inteligência.', 0, 'helena', NULL, NULL),
(NULL, 1044, 'Legalmente Loiras', 'Legally Blondes', 'Estados Unidos', 'Comédia', 'Savage Steve Holland', '15458525705c23d69a19d1d.jpg', 86, 2009, 'X3rRd2GrI-Y', 'Milly Rosso, Becky Rosso, Christopher Cousins, Brittany Curran, Lisa Banes, Rose Abdoo, Bobby Campo', 'Quando as primas britânicas de Elle Wood se mudam para a Califórnia para estudar, eles decidem trazer tudo que uma verdadeira patricinha precisa. O problema é que, durante sua estadia em Los Angeles, Annie (Milly Rosso) e Izzy (Becky Rosso) vão perceber que na terra da prima elas não tem o mesmo glamour, e precisarão dar duro para provar que não são apenas dois rostinhos bonitos.', 0, 'helena', NULL, NULL),
(NULL, 1045, 'Legalmente Loira 2', 'Legally Blonde 2: Red, White & Blonde', 'Estados Unidos', 'Comédia', 'Charles Herman-Wurmfeld', '15458666435c240d935facf.jpg', 95, 2003, 'JuQSKKybdHs', 'Reese Witherspoon, Sally Field, Regina King, Jennifer Coolidge', 'Depois de se formar em Harvard, Elle Woods (Reese Whiterspoon) é agora uma jovem advogada que conseguiu seu primeiro emprego em um grande escritório e divide seu tempo entre a carreira e os preparativos para o casamento com Emmett Richmond (Luke Wilson). Ao descobrir que a mãe do seu adorado chihuahua, Bruiser, está sendo usada como cobaia em testes com cosméticos por um dos clientes do escritório, Elle resolve defender os direitos dos animais e é imediatamente despedida. Arrasada, mas sem deixar de ser otimista, ela vai para Washington trabalhar com a congressista Victoria Rudd (Sally Field) e resolver as coisas do seu jeito.', 0, 'helena', NULL, NULL),
(NULL, 1046, 'Anastasia', 'Anastasia', 'Estados Unidos', 'Animação', 'Don Bluth, Gary Goldman', '15458667785c240e1a2fbae.jpg', 95, 1997, 'Rf_KgX0bly0', 'Meg Ryan, John Cusack, Kelsey Grammer, Christopher Lloyd', 'Aparentemente o Czar e toda a sua família morreram durante a Revolução Russa, mas após alguns anos surge um boato de que a Princesa Anastasia teria sobrevivido. Como sua avó, a grã-duquesa imperial que vive em Paris, ofereceu uma recompensa de 10 milhões de rublos para quem encontrasse sua neta, apareceram várias \"Anastasias\" sonhando ficar com a recompensa. Em Moscou, Dimitri e Vladimir se esforçam para encontrar uma jovem que se aparente com a princesa desaparecida e, assim, possam ganhar a recompensa. Quando estão quase desistindo encontram Anya, uma jovem órfã que não se lembra do seu passado mas tem tudo para se fazer passar por Anastasia. Assim, começam a ensaiá-la e rumam para Paris, mas gradativamente Dimitri passa a acreditar que Anya é realmente a princesa desaparecida e isto lhe parece atr, pois está apaixonado por ela e sabe que nunca permitirão que um plebeu se case com alguém da realeza.\r\n\r\n', 0, 'helena', NULL, NULL),
(NULL, 1047, 'Um Homem Insignificante ', 'An Insignificant Man', 'Índia', 'Documentário, Suspense', 'Khushboo Ranka, Vinay Shukla', '15458675975c24114d88d82.jpg', 96, 2017, 'Vq646VcT72I', 'Arvind Kejriwal, Santosh Koli, Manish Sisodia, Yogendra Yadav', 'Arvind Kejriwal é um político indiano que emergiu como o líder da mais nova força política da Índia, o \"Aam Aadmi Party\" (Partido do Homem Comum). Abordando questões de necessidade básica da população, como água e energia elétrica, Kejriwal  se torna um novo representante para o futuro político da Índia, mas o caminho da revolução nunca é fácil.', 0, 'helena', NULL, NULL),
(NULL, 1048, 'Um Homem Entre Gigantes', 'Concussion', 'Estados Unidos', 'Drama, Biografia', 'Peter Landesman', '15458677405c2411dc7ca2c.jpg', 123, 2015, 'bObrtmvrdFM', 'Will Smith, Alec Baldwin, Albert Brooks, Gugu Mbatha-Raw', 'Dr. Bennet Omalu (Will Smith), neuropatologista forense, diagnostica um severo trauma cerebral em um jogador de futebol americano e, investigando o assunto, descobre se tratar de um mal comum entre os profissionais do esporte. Determinado a reverter o quadro e expôr para o mundo a grave situação, ele trava uma guerra contra a poderosa NFL.', 0, 'helena', NULL, NULL),
(NULL, 1049, 'Um Homem Comum', 'An Ordinary Man', 'Estados Unidos', 'Suspense, Drama', 'Brad Silberling', '15458681795c2413935b2b6.jpg', 90, 2017, 'QSvCZ-ov5ls', 'Ben Kingsley, Hera Hilmar, Peter Serafinowicz, Robert Blythe', 'Um conhecido criminoso de guerra (Ben Kingsley) passa sua vida fugindo das autoridades internacionais. Quando ele é deslocado para um novo esconderijo, ele começa a se relacionar com sua empregada Tanja (Hera Hilmar), e descobre que ela é, na verdade, uma agente contratada para protegê-lo. À medida em que a busca por ele é intensificada, o General percebe que ela é a única pessoa em quem pode confiar.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1050, 'O Protetor', 'The Equalizer', 'Estados Unidos', 'Ação, Policial, Suspense', 'Antoine Fuqua', '15458684245c2414882379f.jpg', 132, 2014, '-aZPYxQGViQ', 'Denzel Washington, Marton Csokas, Chloë Grace Moretz, David Harbour', 'Baseado na série de televisão \"The Equalizer\" dos anos 1980, o filme apresenta Robert McCall (Denzel Washington), um homem misterioso que costumava trabalhar como oficial da polícia. Motivado pelas injustiças sociais, ele ajuda vítimas e qualquer pessoa em perigo. A protegida da vez é Teri (Chloë Grace Moretz), jovem explorada sexualmente por mafiosos russos.', 0, 'helena', NULL, NULL),
(NULL, 1051, 'O Protetor 2', 'The Equalizer 2', 'Estados Unidos', 'Ação, Drama, Policial', 'Antoine Fuqua', '15458686335c241559d25fc.jpg', 121, 2018, 'PsYJxJu3NYk', 'Denzel Washington, Pedro Pascal, Ashton Sanders, Orson Bean, Bill Pulman, Melissa Leo, Caroline Day, Jonathan Scarfe', 'Massachusetts, Estados Unidos. Robert McCall (Denzel Washington) agora trabalha como motorista, ajudando pessoas que enfrentam dificuldades decorrentes de injustiças. Quando sua amiga Susan Plummer (Melissa Leo) é morta durante a investigação de um assassinato na Bélgica, ele decide sair do anonimato e encontrar seu antigo parceiro, Dave (Pedro Pascal), no intuito de encontrar pistas sobre o autor do crime.', 0, 'helena', NULL, NULL),
(NULL, 1052, 'Entrando Numa Fria', 'Meet the Parents', 'Estados Unidos', 'Comédia, Romance', 'Jay Roach', '15458688875c241657a8eab.jpg', 108, 2000, 'HeoB6QSoz54', 'Robert De Niro, Ben Stiller, Teri Polo, Blythe Danner, Owen Wilson, Blythe Danner, James Rebhorn', 'Completamente apaixonados, Pam (Teri Polo) resolve levar seu namorado Greg (Ben Stiller) para conhecer seus pais. Só que, ao chegar, o pai (Robert De Niro) dela não se impressiona com Greg e decide tornar seu final de semana insuportável, utilizando todos os meios possíveis de intimidação, com apenas um único objetivo: se Greg aguentar até o fim, ele o homem certo para se casar com sua filha.', 0, 'helena', NULL, NULL),
(NULL, 1053, 'Tarzan', 'Tarzan', 'Estados Unidos', 'Animação, Aventura', 'Chris Buck, Kevin Lima', '15458690335c2416e9bbc58.jpg', 88, 1999, '9ikp_fFYb-w', 'Brian Blessed, Glenn Close, Minnie Driver, Tony Goldwyn', 'Após um acidente no mar, que causa o naufrágio de um navio na costa da África, um casal inglês acha um modo de ir até a praia com o filho deles, um recém-nascido. Entretanto, os pais são mortos por um leopardo, enquanto que o bebê fica entregue a própria sorte. A criança é achada por uma gorila, Kala (Glenn Close), a companheira de Kerchak (Lance Henriksen), o líder da tribo de macacos. Kerchak é surpreendido pela criança abandonada e quer que ela seja deixada na selva. Por outro lado a natureza materna de Kala é tocada, para não mencionar as suas recordações por ter perdido a própria cria. Kala e Kerchak ficam com o bebê e lhe dão o nome de Tarzan, que é criado junto com os outros macacos. Tarzan cresce até se tornar adulto, até que sua vida é mudada para sempre com a chegada de Archimedes Q. Porter (Nigel Hawthorne), um explorador, juntamente com Jane Porter (Minnie Driver), sua filha, e Clayton (Brian Blessed), um caçador que está servindo de guia. Archimedes e Jane foram até a África para estudar a vida selvagem em seu habitat natural, embora Clayton prefira aprisionar o maior número possível de gorilas, pois cada um vale trezentas libras. Quando os exploradores encontram Tarzan eles pensam no princípio que descobriram o elo perdido, mas logo percebem que ele é tão humano quanto eles. Tarzan se vê dividido entre o desejo de estar com gente da sua espécie, além das emoções novas e pouco conhecidas que sente em relação a Jane, e a lealdade dele para a família de gorilas que o criou, especialmente quando Clayton não vê os macacos como amigos mas sim como presas.', 0, 'helena', NULL, NULL),
(NULL, 1055, 'A Lenda de Tarzan', 'The Legend of Tarzan', 'Estados Unidos', 'Aventura, Ação', 'David Yates', '15458694065c24185eda2e8.jpg', 110, 2016, 'dNzTFhkV0og', 'Alexander Skarsgård, Rory J. Saper, Christoph Waltz, Margot Robbie, Ella Purnell, Lasco Atkins, Samuel L. Jackson, Djimon Hounsou', 'Releitura da clássica lenda de Tarzan, na qual um pequeno garoto órfão é criado na selva, e mais tarde tenta se adaptar à vida entre os humanos. Na década de 30, Tarzan, aclimatado à vida em Londres em conjunto com sua esposa Jane, é chamado para retornar à selva onde passou a maior parte da sua vida onde servirá como um emissário do Parlamento Britânico.', 0, 'helena', NULL, NULL),
(NULL, 1056, 'Tarzan - A Evolução da Lenda', 'Tarzan', 'Estados Unidos', 'Animação, Aventura', 'Reinhard Klooss', '15458695745c2419060908d.jpg', 94, 2013, 'UzgUWdDuUz0', 'Kellan Lutz, Spencer Locke, Les Bubb, Joe Cappelletti', 'Após seus pais serem mortos, um bebê é criado por uma gorila, que passa a tratá-lo como se fosse seu filho. Ao crescer ele se torna Tarzan (Kellan Lutz), o rei da selva. É quando precisa enfrentar um exército de mercenários enviado à floresta por um malvado executivo da Greystoke Energies, a empresa que um dia pertenceu aos pais de Tarzan. Para enfrentá-los ele conta com a ajuda de Jane Porter (Spencer Locke), uma jovem que chega à floresta após um acidente no avião em que estava.', 0, 'helena', NULL, NULL),
(NULL, 1057, 'A Nova Onda do Imperador', 'The Emperor’s New Groove', 'Estados Unidos', 'Animação, Aventura, Musical ', 'Mark Dindal', '15458697695c2419c91bc8f.jpg', 78, 2000, 'TSOzuFetOno', 'David Spade, John Goodman, Eartha Kitt, Patrick Warburton', 'Em um reino mítico e rodeado de montanhas, o jovem e arrogante Imperador Kuzco transformado em uma lhama por sua conselheira, a poderosa bruxa Yzma. Perdido na floresta, a única chance de Kuzco recuperar seu trono é contando com a ajuda de Pacha, um simplório camponês.', 0, 'helena', NULL, NULL),
(NULL, 1058, 'Anjos da Vida - Mais Bravos que o Mar', 'The Guardian', 'Estados Unidos', 'Ação, Aventura, Drama', 'Andrew Davis', '15458699535c241a8170ae6.jpg', 139, 2006, 'nS6YrMYn_Rs', 'Kevin Costner, Ashton Kutcher, Sela Ward, Melissa Sagemiller', 'Ben Randall (Kevin Costner) é um legendário nadador de resgate que se torna o único sobrevivente de um acidente falta causado por uma forte tempestade. Ele é levado para ensinar na Escola de Elite, um programa de treinamento que visa transformar jovens recrutas destemidos nos melhores nadadores de resgate. Ainda abalado pelo fracasso no acidente, Randall decide deixar de lado o programa de treinamento e aplicar seus próprios métodos de trabalho. Ele logo se desentende com Jake Fisher (Ashton Kutcher), um arrogante campeão de natação, que está em sua turma. Randall vê potencial em Fisher para se tornar um grande nadador de resgate, caso consiga equilibrar seu talento ainda não-lapidado com o lado emocional e a dedicação que a tarefa exige. Em sua 1ª missão de resgate, nas turbulentas águas do mar de Bering, no Alasca, Fisher aprende o que é realmente arriscar tudo no trabalho.', 0, 'helena', NULL, NULL),
(NULL, 1059, 'Kick-Ass - Quebrando Tudo', 'Kick-Ass', 'Reino Unido', 'Ação, Drama, Comédia', 'Matthew Vaughn', '15458705285c241cc02065f.jpg', 117, 2010, 'dLvheMk0Rc8', 'Aaron Taylor-Johnson, Garrett M. Brown, Evan Peters, Deborah Twiss, Nicolas Cage, Chloë Grace Moretz, Mark Strong, Christopher Mintz-Plasse, Lyndsy Fonseca, Clark Duke', 'Dave (Aaron Johnson) é um adolescente viciado em quadrinhos cansado de apanhar ou ser ameaçado. Até o dia em que ele resolve virar o super herói Kick Ass e mudar esta rotina. Como? Nem ele sabia, mas ao defender fantasiado de herói (e apanhando mais ainda) um cara que levava uma surra, o vídeo com as imagens dele enfrentando os bandidos foi parar na internet e ele virou um fenômeno. Dave só não contava que a sua fama iria envolvê-lo no meio de um plano de vingança de Big Daddy (Nicolas Cage) e Hit Girl (Chloe Moretz) contra Frank D\'Amico (Mark Strong), um mafioso da cidade, vivendo uma verdadeira e violenta aventura que mudaria para sempre a sua vida.', 0, 'helena', NULL, NULL),
(NULL, 1060, 'Kick-Ass 2', 'Kick-Ass 2', 'Estados Unidos', 'Ação, Comédia', 'Jeff Wadlow', '15458707405c241d946089b.jpg', 103, 2013, 'naQWLBbQbBQ', 'Aaron Taylor-Johnson, Chloë Grace Moretz, Morris Chestnut, Clark Duke, Jim Carrey, Morris Chestnut, Claudia Lee, John Leguizamo', 'O ato insano de Dave Lizewski (Aaron Taylor-Johnson) em se vestir como o super-herói Kick-Ass e ir para as ruas combater o crime, mesmo sem ter qualquer tipo de superpoder, serviu de inspiração para dezenas de pessoas, que resolveram seguir o mesmo caminho. Mindy Macready (Chloë Moretz) deseja seguir como a super-heroína Hit-Girl, mas o sargento Marcus Williams (Morris Chestnut), que prometeu ao pai dela que iria cuidá-la em sua ausência, não quer que ela leve uma vida perigosa. Com isso, Mindy é obrigada a levar a vida de uma garota de sua idade, deixando de lado os atos heróicos, por mais que Dave insista para que ela faça o contrário. Entretanto, a carreira heróica de Dave não será solitária por muito tempo, já que não demora muito para conhecer o Coronel Estrelas e Listras (Jim Carrey), um ex-integrante da máfia que está reunindo um grupo de super-heróis sem poderes para combater o crime. Paralelamente, Chris D\'Amico (Christopher Mintz-Plasse) prepara sua vingança contra Kick-Ass, assumindo um novo codinome: Motherfucker.', 0, 'helena', NULL, NULL),
(NULL, 1061, 'Insana', 'Brain on Fire', 'Estados Unidos', 'Biography, Drama', 'Gerard Barrett', '15458710115c241ea323d78.jpg', 88, 2017, 'idAlvLKKlDQ', 'Chloë Grace Moretz, Thomas Mann, Richard Armitage, Carrie-Anne Moss, Tyler Perry, Jenny Slate, Agam Darshi, Navid Negahban', 'Susannah Cahalan, uma jovem jornalista com uma carreira promissora descobre que possui uma doença que nenhum médico consegue diagnosticar. Presa em sua própria insanidade, ela se vê em uma rotina alterada, com inexplicáveis alucinações, surtos e ataques de paranóia. Sem poder contar com si própria, ela precisará da ajuda de todos a sua volta para aprender a conviver com as suas crises, em meio a insegurança e mudanças de comportamento.', 0, 'helena', NULL, NULL),
(NULL, 1062, 'Suspiria', 'Suspiria', 'Itália', 'Terror, Suspense', 'Luca Guadagnino', '15458715195c24209fe156d.jpg', 152, 2018, 'wuPn9Ch1rwk', 'Dakota Johnson, Tilda Swinton, Doris Hick, Malgorzata Bela, Mia Goth, Chloë Grace Moretz, Jessica Harper, Ingrid Caven', 'Susie Bannion (Dakota Johnson), uma jovem bailarina americana, vai para a prestigiada Markos Tanz Company, em Berlim. Ela chega assim que Patricia (Chloë Grace Moretz) desaparece misteriosamente. Tendo um progresso extraordinário, com a orientação de Madame Blanc (Tilda Swinton), Susie acaba fazendo amizade com outra dançarina, Sara (Mia Goth), que compartilha com ela todas suas suspeitas obscuras e ameaçadoras.', 0, 'helena', NULL, NULL),
(NULL, 1063, 'Criminosos de Novembro', 'November Criminals', 'Estados Unidos', 'Suspense, Policial, Drama', 'Sacha Gervasi', '15458716835c24214347386.jpg', 107, 2017, 'Fz6nDlfjzPU', 'Ansel Elgort, Chloë Grace Moretz, David Strathairn, Catherine Keener, Cory Hardrict', 'Addison tem 18 anos de idade e está terminando o Ensino Médio. Enquanto pensa se deve entrar na universidade, ele leva uma vida cheia de conflitos, vendendo drogas aos colegas e brigando com os professores. Quando Kevin, um colega de turma, é assassinado, Addison decide fazer a sua própria investigação.', 0, 'helena', NULL, NULL),
(NULL, 1064, 'Greta', 'Greta', 'Estados Unidos', 'Suspense', 'Neil Jordan', '15458723975c24240d7d0df.jpg', 98, 2019, 'Y_ZitTNNjoc', 'Isabelle Huppert, Chloë Grace Moretz, Maika Monroe, Colm Feore, Zawe Ashton, Parker Sawyers, Jane Perry', 'Frances (Chloë Grace Moretz) é uma jovem mulher cuja mãe acabou de falecer. Acabando de se mudar para Manhattan e cheia de problemas com o pai, ela forma uma amizade improvável com Greta (Isabelle Huppert), uma viúva bem mais velha que ela. Porém, conforme as duas se tornam melhores amigas, as atenções da viúva se mostram muito mais sinistras do que ela imaginava.', 0, 'helena', NULL, NULL),
(NULL, 1065, 'Compramos um Zoológico', 'We Bought a Zoo', 'Estados Unidos', 'Comédia, Drama', 'Cameron Crowe', '15458728835c2425f30a942.jpg', 124, 2011, 'qT6g5OoyFvo', 'Matt Damon, Scarlett Johansson, Thomas Haden Church, Colin Ford, Elle Fanning, Maggie Elizabeth Jones', 'Benjamin Mee (Matt Damon) é um pai de família que decide que precisa recomeçar sua vida após o falecimento da esposa. Desta forma, ele e seus dois filhos se mudam para um zoológico em péssimo estado de conservação, onde, com a ajuda de uma equipe de funcionários, tentam fazer com que o local recupere o brilho perdido.', 0, 'helena', NULL, NULL),
(NULL, 1066, 'Galveston', 'Galveston', 'Estados Unidos', 'Policial ', 'Mélanie Laurent', '15458731935c24272974b80.jpg', 91, 2018, 'RCCSrQAZmP0', 'Ben Foster, Jeffrey Grover, Elle Fanning, Lili Reinhart, ', 'Após escapar de uma armação feita pelo seu antigo chefe, um assassino moribundo resgata uma jovem prostituta e foge com ela para Galveston, onde planeja sua vingança. Os dois precisam encontrar suas forças enquanto são perseguidos por pessoas perigosas e pela sombra de seus passados.', 0, 'helena', NULL, NULL),
(NULL, 1067, 'A Lei da Noite', 'Live by Night', 'Estados Unidos', 'Suspense, Ação, Policial', 'Ben Affleck', '15458737285c2429403677e.jpg', 129, 2016, 'SEexVO9P0Fo', 'Ben Affleck, Elle Fanning, Remo Girone, Brendan Gleeson, Zoe Saldana, Sienna Miller, Scott Eastwood, Chris Cooper, Anthony Michael Hall', 'Boston, década de 1920. Joe Coughlin (Ben Affleck), filho mais novo de um capitão de polícia, se envolve com o crime organizado. Ele aproveita seus dias rodeado de dinheiro e poder, mas suas escolhas podem levá-lo à prisão ou até mesmo à morte. Adaptação do livro escrito por Dennis Lehane.', 0, 'helena', NULL, NULL),
(NULL, 1068, 'Madagascar', 'Madagascar', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Eric Darnell, Tom McGrath', '15459432975c253901b994b.jpg', 86, 2005, 'C2oMUCAPYN8', 'Ben Stiller, Chris Rock, David Schwimmer, Jada Pinkett Smith', 'O leão Alex (Ben Stiller) é a grande atração do zoológico do Central Park, em Nova York. Ele e seus melhores amigos, a zebra Marty (Chris Rock), a girafa Melman (David Schwimmer) e a hipopótamo Gloria (Jada Pinkett Smith), sempre passaram a vida em cativeiro e desconhecem o que é morar na selva. Curioso em saber o que há por trás dos muros do zoo, Marty decide fugir e explorar o mundo. Ao perceberem, Alex, Gloria e Melman decidem partir à sua procura. O trio encontra Marty na estação Grand Central do metrô, mas antes que consigam voltar para casa são atingidos por dardos tranquilizantes e capturados. Embarcados em um navio rumo à África, eles acabam na ilha de Madagascar, onde precisam encontrar meios de sobrevivência em uma selva verdadeira.', 0, 'matheus', NULL, NULL),
(NULL, 1069, 'Madagascar 2', 'Madagascar: Escape 2 Africa', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Eric Darnell, Tom McGrath', '15459434635c2539a766dc9.jpg', 89, 2008, 'https://www.youtube.com/watch?v=VdtmjcYXBus', 'Ben Stiller, Chris Rock, David Schwimmer, Jada Pinkett Smith', 'Alex (Ben Stiller), Marty (Chris Rock), Melman (David Schwimmer), Gloria (Jada Pinkett Smith), rei Julien (Sacha Baron Cohen), Maurice (Cedric the Entertainer), os pingüins e os chimpanzés estão no longínquo litoral de Madagascar. Para deixar o local os pingüins consertam um velho avião de guerra, mas logo em seu 1º vôo ele cai. Isto faz com que os animais do zoológico de Nova York tenham que lidar, pela 1ª vez na vida, com espécies semelhantes a eles, só que habituadas à vida selvagem.', 0, 'matheus', NULL, NULL),
(NULL, 1070, 'Madagascar 3 - Os Procurados', 'Madagascar 3: Europe\'s Most Wanted', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Eric Darnell, Tom McGrath, Conrad Vernon', '15459439875c253bb362800.jpg', 93, 2012, 'kt3YDqvoWCA', 'Ben Stiller, Chris Rock, David Schwimmer, Jada Pinkett Smith', 'Os amigos Alex (Ben Stiller), Marty (Chris Rock), Melman (David Schwimmer), Gloria (Jada Pinkett Smith), rei Julien (Sacha Baron Cohen) e os pinguins deixam o continente africano rumo à Europa. Eles vão parar em Mônaco, onde passam a ser perseguidos por uma obcecada agente de controle animal (Frances McDormand). Em plena fuga, o grupo encontra abrigo em um circo em crise. Logo eles passam a ajudá-lo, iniciando um processo de revitalização que poderá levá-los a uma turnê nos Estados Unidos e, consequentemente, de volta para casa.', 0, 'matheus', NULL, NULL),
(NULL, 1071, 'Os Pinguins de Madagascar', 'The Penguins of Madagascar', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Simon J. Smith, Eric Darnell', '15459443875c253d43c5ac0.jpg', 93, 2015, '13jOLKuPrLY', 'Tom McGrath\r\nChris Miller\r\nChristopher Knights\r\nConrad Vernon\r\nJohn Malkovich\r\nBenedict Cumberbatch\r\nAnnet Mahendru\r\nKen Jeong', 'Vindos da franquia de animação Madagascar, Capitão, Kowalski, Rico e Recruta, a elite do pinguins espiões, são capturados em uma missão que tinha como objetivo presentear o integrante mais novo da tropa (Recruta) em seu aniversário. Eles caem nas garras do temido Dr. Otavius Brine, que se sentiu prejudicado pelo quarteto em um passado remoto. Agora, eles vão ter que impedir o maléfico plano do vilão de se vingar dos pinguins do mundo todo e, para isso, terão que juntar forças com uma especializada agência de espiões, a Vento do Norte, liderada pelo Agente Secreto. Enquanto isso, Recruta tenta provar seu valor como agente especial do time de pinguins.', 0, 'matheus', NULL, NULL),
(NULL, 1072, 'Todo Poderoso', 'Bruce Almighty', 'Estados Unidos', 'Comédia, Drama, Fantasia', 'Tom Shadyac', '15459445655c253df5e92fe.jpg', 101, 2003, 'XIy5wDsheqA', 'Jim Carrey, Morgan Freeman, Jennifer Aniston, Philip Baker Hall', 'Bruce Nolan (Jim Carrey) é um jornalista que tem um bom emprego na TV e uma bela namorada, Grace (Jennifer Aniston). Num acesso de fúria ele começa a xingar e questionar Deus e seu modo de fazer tudo funcionar, o que faz com que ele próprio (Morgan Freeman) resolva descer à Terra como um homem comum e lhe entregar o poder de comandar o planeta da forma como desejar durante um dia. É quando Bruce percebe o quão difícil é ser Deus e tomar conta de tudo o que ocorre no planeta.', 0, 'matheus', NULL, NULL),
(NULL, 1073, 'A Volta do Todo Poderoso', 'Evan Almighty', 'Estados Unidos', 'Comédia, Fantasia', 'Tom Shadyac', '15459447295c253e99a1a09.jpg', 96, 2007, 'bRJi7oY_-rU', 'Steve Carell, Morgan Freeman, Lauren Graham, Johnny Simmons', 'Evan Baxter (Steve Carell) é o âncora de um telejornal de Buffalo, que foi recentemente eleito para seu 1º mandato como congressista. Ele então se muda para Washington com sua esposa Joan (Lauren Graham) e os filhos Dylan (Johnny Simmons), Ryan (Jimmy Bennett) e Jordan (Graham Phillips). Porém, logo após se instalar em sua casa, Evan passa a receber estranhas encomendas, que incluem ferramentas e grandes quantidades de madeira. Logo ele se encontra com Deus (Morgan Freeman), que lhe incumbe a missão de construir uma arca, já que uma inundação está por vir. Evan descarta a idéia, mas uma série de situações ocorre de forma a prejudicar sua vida até que ele aceite a missão.', 0, 'matheus', NULL, NULL),
(NULL, 1074, 'O Espanta Tubarões', 'Shark Tale', 'Estados Unidos', 'Animação, Comédia , Aventura', 'Bibo Bergeron, Vicky Jenson, Rob Letterman', '15459451765c25405889d5e.jpg', 90, 2004, 'WFE-gYdg_3Q', 'Will Smith, Robert De Niro, Renée Zellweger, Jack Black', 'Oscar (Will Smith) é um pequeno peixe que tem sonhos grandes, que se torna um herói involuntário após pregar uma grande mentira. Após ser perseguido pelo filho do tubarão-chefe, Oscar presencia sua morte. Querendo bancar o herói, ele assume a autoria do assassinato e, com isso, se torna uma grande celebridade no mundo aquático. Porém a situação se complica quando ele é designado para repetir a façanha, eliminando outros tubarões.', 0, 'matheus', NULL, NULL),
(NULL, 1075, 'Desventuras Em Série', 'Lemony Snicket\'s A Series of Unfortunate Events', 'Estados Unidos', 'Comédia , Fantasia, Infantil, Aventura', 'Brad Silberling', '15459454455c254165a976a.jpg', 108, 2004, 'G0enad37-wU', 'Jim Carrey, Liam Aiken, Emily Browning, Kara Hoffman', 'Klaus (Liam Aiken), Violet (Emily Browning) e Sunny (Kara Hoffman e Shelby Hoffman) são três irmãos que repentinamente recebem a notícia de que seus pais morreram em um incêndio. Como são menores de idade eles não podem ainda herdar a fortuna de seus pais, o que apenas ocorrerá quando Violet, a mais velha, completar 18 anos. O trio passa então a morar com o Conde Olaf (Jim Carrey), um parente distante bastante ganancioso, que deseja tomar a fortuna das crianças para si. Para atingir sua meta Olaf não medirá consequências.', 0, 'matheus', NULL, NULL),
(NULL, 1076, 'Black Mirror: Bandersnatch', 'Black Mirror: Bandersnatch', 'Estados Unidos', 'Ficção Científica, Drama', 'David Slade', '15460016595c261cfbe2e2c.jpg', 90, 2018, 'rnrCdi53G7A', 'Fionn Whitehead, Will Poulter, Asim Chaudhry, Alice Lowe', 'Um jovem programador adapta um romance de fantasia para videogame nos anos 1980. Durante a experiência, ele começa a questionar o próprio conceito de realidade e acaba enfrentando um desafio alucinante.', 0, 'matheus', NULL, NULL),
(NULL, 1077, 'Hush - A Morte Ouve', 'Hush', 'Estados Unidos', 'Terror, Suspense', 'Mike Flanagan', '15459528285c255e3cf32e3.jpg', 82, 2016, 'Q_P8WCbhC6s', 'John Gallagher Jr., Kate Siegel, Michael Trucco, Samantha Sloyan', 'A autora Maddie Toung (Kate Siegel) vive uma vida isolada desde que perdeu sua audição quando era adolescente, se colando em um mundo de total silêncio.Porém, quando um rosto mascarado de um assassino psicótico aparece em sua janela, Maddie precisa ir além dos seus limites físicos e mentais para conseguir sobreviver.', 0, 'matheus', NULL, NULL),
(NULL, 1078, 'O Último Mestre do Ar', 'The Last Airbender', 'Estados Unidos', 'Ação, Aventura, Fantasia', 'M. Night Shyamalan', '15459543565c256434c98d4.jpg', 103, 2010, '-ufR_G7fLL4', 'Noah Ringer, Dev Patel, Nicola Peltz, Jackson Rathbone', 'A Nação do Fogo está em guerra com as nações da Água, do Ar e da Terra porque pretende dominar o mundo. O conflito já dura um século e não há a menor previsão de quando chegará ao fim. Somente o aparecimento de um Avatar, único capaz de controlar os quatro elementos, poderá ajudar a restabelecer o equilíbrio. Quando Katara (Nicola Peltz) e seu irmão Sokka (Jackson Rathbone) encontram o jovem e poderoso Aang (Noah Ringer), logo percebem que estão diante de uma possível solução e para isso partem juntos numa grande e perigosa aventura em busca da paz.', 0, 'matheus', NULL, NULL),
(NULL, 1079, 'Quase 18', 'The Edge of Seventeen', 'Estados Unidos', 'Comédia dramática, Coming of Age', 'Kelly Fremon Craig', '15459575135c257089551ce.jpg', 104, 2016, 'qWuAMx8pe9o', 'Hailee Steinfeld, Haley Lu Richardson, Blake Jenner, Kyra Sedgwick, Woody Harrelson, Alexander Calvert, Nesta Cooper, Katie Stuart', 'Crescer não é nada fácil para alguns, como para Nadine (Hailee Steinfeld), uma estudante que está enfrentando uma difícil situação desde que sua melhor amiga, Krista (Haley Lu Richardson), está namorando com o seu irmão mais velho, Darian (Blake Jenner). Nadine se sente mais sozinha do que nunca, ao menos até começar uma amizade com um jovem atencioso (Hayden Szeto).', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1080, 'A Mentira', 'Easy A', 'Estados Unidos', 'Comédia, Romance', 'Will Gluck', '15459576985c257142e95a5.jpg', 92, 2010, 'USbVnUt8t1Q', 'Emma Stone, Penn Badgley, Amanda Bynes, Dan Byrd, Alyson Michalka', 'Olive (Emma Stone) era aquele tipo de estudante cuja presença não era notada por ninguém, além de sua melhor amiga Rhiannon (Alyson Michalka). Quando ela a convida para passar um fim de semana acampando, Olive dá como desculpa que irá se encontrar com alguém. Na segunda seguinte Rhiannon lhe pergunta como foi o encontro e, para manter a história, Olive diz que perdeu a virgindade com ele. A notícia é ouvida por Marianne (Amanda Bynes), a crente da escola, que logo a espalha para os demais alunos. A situação altera o modo como as pessoas olham para Olive, o que faz com que ela se sinta dividida: ao mesmo tempo em que se sente mal por olharem para ela graças a uma mentira, ela gosta de enfim receber a atenção das pessoas. A situação potencializa ainda mais quando ela aceita a proposta feita por Brandon (Dan Byrd), seu amigo gay, de que finjam ter relações sexuais durante uma festa onde todos da escola estejam presentes. Desta forma Brandon passa a ser visto como heterossexual, deixando de ser perseguido, e Olive assume de vez a figura de vadia da escola. Só que ela não podia imaginar até onde sua fama iria levá-la.', 0, 'helena', NULL, NULL),
(NULL, 1081, 'Juno', 'Juno', 'Estados Unidos', 'Comédia dramática, Coming of Age', 'Jason Reitman', '15459578585c2571e24ae86.jpg', 96, 2007, '1oFHan8yUww', 'Ellen Page, Michael Cera, Jennifer Garner, Jason Bateman, Allison Janney', 'Juno MacGuff (Ellen Page) é uma jovem de 16 anos que acidentalmente engravidou de Paulie Bleeker (Michael Cera), um grande amigo com quem transou apenas uma vez. Inicialmente ela decide fazer um aborto, mas ao chegar na clínica muda de idéia. Junto com sua amiga Leah (Olivia Thirlby) ela passa a procurar em jornais um casal a quem possa entregar o bebê assim que ele nascer, já que não se considera em condições de criá-lo. É assim que conhece Vanessa (Jennifer Garner) e Mark (Jason Bateman), um casal com boas condições financeiras que está disposto a bancar todas as despesas médicas de Juno, além de dar-lhe uma compensação financeira caso ela queira. Juno recusa o dinheiro para si, mas decide que Vanessa e Mark ficarão com seu filho.', 0, 'helena', NULL, NULL),
(NULL, 1082, 'Garota Mimada', 'Wild Child', 'Estados Unidos', 'Comédia, Romance', 'Nick Moore', '15459580555c2572a702a35.jpg', 124, 2008, 'NdYXF6JESPc', 'Emma Roberts, Lexi Ainsworth, Juno Temple, Shelby Young, Johnny Pacar, Aidan Quinn, Natasha Richardson', 'A patricinha Poppy (Emma Roberts) leva uma vida de princesa em Malibu, litoral da California. A menina se tornou uma adolescente bonita, rica e mimada. Para combater a rebeldia da filha, o pai de Poppy (Aidan Quinn) a manda para um colégio interno na Inglaterra. Enquanto tenta lidar com as novas colegas, que não toleram arrogância, a americana terá de enfrentar a mal humorada diretora Mrs. Kingsley (Natasha Richardson).', 0, 'helena', NULL, NULL),
(NULL, 1083, 'Uma Patricinha de Outro Mundo', 'Teen Spirit', 'Estados Unidos', 'Comédia, Fantasia', 'Gil Junger', '15459582815c25738963d8e.jpg', 82, 2011, 'R1en1FUA694', 'Cassandra Scerbo, Carissa Capobianco, Gabriela Lopez, Katrina Rose Tandy, Lindsey Shaw', 'Amber (Cassie Scerbo) é uma garota muito popular no seu colégio. A adolescente é conhecida por seu comportamento egocêntrico e, por vezes, cruel com aqueles que ela considera os \"perdedores\". A única conquista social que ainda falta para ela é a coroa de rainha do baile de formatura, que se tornou seu principal objetivo. Porém, um acidente faz com que a patricinha morra prematuramente, eletrecutada. Amber, agora uma alma penada, descobre que para entrar no paraíso terá de ajudar a desajeitada e tímida Lisa Sommers (Lindsey Shaw) a se tornar a próxima rainha da festa de formatura.', 0, 'helena', NULL, NULL),
(NULL, 1084, 'A Super Agente', 'So Undercover', 'Estados Unidos', 'Comédia, Ação', 'Tom Vaughan', '15459584635c25743f8eb28.jpg', 94, 2012, '6obgyttgR-I', 'Miley Cyrus, Jeremy Piven, Mike O\'Malley, Josh Bowman, Kelly Osbourne, Lauren McKnight, Megan Park ', 'Molly Morris (Miley Cyrus) é uma detetive particular que é convocada pelo FBI para infiltrar uma irmandade de garotas em uma universidade. Ela recebe a missão de proteger a filha de um importante mafioso.', 0, 'helena', NULL, NULL),
(NULL, 1085, 'Diário de Uma Paixão', 'The Notebook', 'Estados Unidos', 'Drama, Romance', 'Nick Cassavetes', '15459587495c25755db96c3.jpg', 123, 2004, '_m_6gawr2OE', 'Ryan Gosling, Rachel McAdams, James Garner, Gena Rowlands, Joan Allen, James Marsden, Sam Shepard, David Thornton', 'Numa clínica geriátrica, Duke, um dos internos que relativamente está bem, lê para uma interna (com um quadro mais grave) a história de Allie Hamilton (Rachel McAdams) e Noah Calhoun (Ryan Gosling), dois jovens enamorados que em 1940 se conheceram num parque de diversões. Eles foram separados pelos pais dela, que nunca aprovaram o namoro, pois Noah era um trabalhador braçal e oriundo de uma família sem recursos financeiros. Para evitar qualquer aproximação, os pais de Alie a mandam para longe. Por um ano Noah escreveu para Allie todos os dias mas não obteve resposta, pois a mãe (Joan Allen) dela interceptava as cartas de Noah para a filha. Crendo que Allie não estava mais interessada nele, Noah escreveu uma carta de despedida e tentou se conformar. Alie esperava notícias de Noah, mas após 7 anos desistiu de esperar ao conhecer um charmoso oficial, Lon Hammond Jr. (James Marsden), que serviu na 2ª Grande Guerra (assim como Noah) e pertencia a uma família muito rica. Ele pede a mão de Allie, que aceita, mas o destino a faria se reencontrar com Noah. Como seu amor por ele ainda existia e era recíproco, ela precisa escolher entre o noivo e seu primeiro amor.', 0, 'helena', NULL, NULL),
(NULL, 1086, 'Confissões de uma Adolescente em Crise', 'Confessions of a Teenage Drama Queen', 'Estados Unidos', 'Comédia', 'Sara Sugarman', '15459590005c257658e30b4.jpg', 89, 2004, '1SpH1X3W_s8', 'Lindsay Lohan, Adam Garcia, Glenne Headly, Alison Pill, Megan Fox, Carol Kane', 'Lola Drew (Lindsay Lohan) é uma adolescente mimada que está acostumada a ser o centro das atenções por onde quer que passe. Após se mudar para um subúrbio em Nova Jersey, ela é obrigada a trocar de escola. Lá conhece Carla Santini (Megan Fox), a garota mais popular da escola, justamente o posto que Lola tinha em sua antiga escola. Decidida a conquistar o posto na nova escola, Lola passa a disputar popularidade com Carla, especialmente na montagem da próxima peça teatral do colégio, \"Pigmaleão\".', 0, 'helena', NULL, NULL),
(NULL, 1088, 'As Bem-Armadas', 'The Heat', 'Estados Unidos', 'Comédia, Ação, Policial', 'Paul Feig', '15459594935c25784565433.jpg', 117, 2013, 'Owza9Euh7mw', 'Sandra Bullock, Melissa McCarthy, Demián Bichir, Marlon Wayans, Michael Rapaport, Thomas F. Wilson, Jane Curtin', 'Ashburn (Sandra Bullock) é uma agente especial do FBI extremamente competente, apesar de ser mal vista pelos colegas de trabalho por ser arrogante e antipática. De olho em uma promoção no trabalho, ela pede ao seu chefe (Demian Bichir) que a encarregue da investigação de um poderoso traficante de drogas em Boston, cuja identidade é desconhecida. Entretanto, logo ao chegar Ashburn decide interrogar um pequeno traficante preso por Mullins (Melissa McCarthy), uma desbocada policial local que não aceita ordens de ninguém. Não demora muito para que as duas batam de frente, mas elas precisam encontrar um meio de trabalhar juntas.', 0, 'helena', NULL, NULL),
(NULL, 1089, 'Shiki Oriori: O Sabor da Juventude', 'Si shi qing chun', 'Japão', 'Anime', 'Haoling Li, Yoshitaka Takeuchi, Xiaoxing Yi', '15459599655c257a1d16fc3.jpg', 74, 2018, 'CIzzA4f5vHg', ' Dorothy Elias-Fahn, George Ackles, Matt Fowler', 'O cenário urbano da China traz três cidades com histórias diferentes entre si, mas interligadas pelo destino. Indagações da vida moderna, amor e alegrias: nenhum tipo de sentimento pode ser derrotado pelo fluxo do tempo.', 0, 'helena', NULL, NULL),
(NULL, 1090, 'Flor da Juventude', 'Flower', 'Estados Unidos', 'Drama, Comédia ', 'Max Winkler', '15459603245c257b8460ee8.jpg', 90, 2017, 'Kndy6AIc4lg', 'Zoey Deutch, Kathryn Hahn, Tim Heidecker, Adam Scott, Joey Morgan, Dylan Gelula, Maya Eshet, Eric Edelstein', 'Erica Vandross, uma adolescente de apenas dezessete anos, é bastante conhecida por seu comportamento astuto, muitas vezes considerada teimosia pelos mais velhos. Ela vive com a mãe e o padrasto em San Fernando Valley, na Califórnia. Quando Luke, o filho de seu padrasto, se muda para a casa onde vive, uma amizade surge entre os dois, mesmo com seus comportamentos distintos. Luke conta um segredo dramático para Érica, que decide agir em defesa do amigo agindo com as suas próprias mãos, sem saber das consequências que podem surgir em sua vida por conta dessa atitude.', 0, 'helena', NULL, NULL),
(NULL, 1091, 'Mary and the Witch\'s Flower', 'Meari To Majo No Hana', 'Japão', 'Anime', 'Hiromasa Yonebayashi, Giles New', '15459605615c257c715de8e.jpeg', 103, 2017, 'v6khFo09rPQ', 'Hana Sugisaki, Ryûnosuke Kamiki, Yûki Amami, Fumiyo Kohinata', 'Mary, uma agitada jovem japonesa, está prestes a ter sua vida alterada de maneira radical. Isso porque, depois de seguir dois estranhos gatos, ela acaba achando uma curiosa e desconhecida flor, que lhe concede extraordinários poderes mágicos. Logo em seguida, com a ajuda de um dos animais, ela encontra uma vassoura e, ao tocá-la, ela começa a voar. É aí que descobrirá que pode ter se tornado uma bruxa.', 0, 'helena', NULL, NULL),
(NULL, 1093, 'Detetives do Prédio Azul (D.P.A) - O Filme', 'Detetives do Prédio Azul (D.P.A) - O Filme', 'Brasil', 'Comédia, Família', 'André Pellenz', '15459613625c257f92db0ce.jpg', 90, 2017, '_XOnfkT1PT8', 'Letícia Braga, Anderson Lima, Pedro Henriques Motta, Tamara Taxman, Ronaldo Reis, Letícia Pedro, Cauê Campos, Caio Manhente', 'Os Detetives do Prédio Azul são confrontados com o maior caso de suas vidas: salvar o próprio edifício da destruição. Pippo (Pedro Henrique Motta), Sol (Letícia Braga) e Bento (Anderson Lima) se infiltram na festa de Dona Leocádia (Tamara Taxman), a terrível síndica que é, literalmente, uma bruxa. Lá eles presenciam um crime \"mágico\", que condena o Prédio Azul a uma demolição de emergência. Para completar, a única testemunha - o quadro falante da Vó Berta (Suely Franco) - desaparece, e Dona Leocádia é enfeitiçada para ficar boazinha. Para resolver esse caso, os detetives vão contar com a ajuda do porteiro Severino (Ronaldo Reis), que empresta sua Kombi azul novinha para ser a sede de investigação. A aventura fica completa quando Tom (Caio Manhente), Mila (Letícia Pedro) e Capim (Cauê Campos), fundadores do clubinho original, são trazidos de volta ao Rio de Janeiro para ajudar no caso.', 0, 'helena', NULL, NULL),
(NULL, 1094, 'Detetives do Prédio Azul 2 - O Mistério Italiano', 'Detetives do Prédio Azul 2 - O Mistério Italiano', 'Brasil', 'Família, Aventura', 'Vivianne Jundi', '15459616425c2580aad7c46.jpg', 129, 2018, 'SkJPGgzZUqY', 'Letícia Braga, Anderson Lima, Pedro Henriques Motta, Claudia Netto, Fabiana Karla, Ronaldo Reis, Suely Franco, Antonio Pedro', 'Durante a Expo-Bruxas, a maior feira de bruxos do mundo, Pippo (Pedro Henriques Motta), Bento (Anderson Lima) e Sol (Leticia Braga) viajam até a Itália para investigar o sumiço da feiticeira Berenice (Nicole Orsini), que foi sequestrada pelos bruxos Máximo e Mínima Buongusto. Com o trabalho em equipe e a ajuda da avó de Pipo, eles conseguirão desvendar esse mistério.', 0, 'helena', NULL, NULL),
(NULL, 1095, 'Respire', 'Respire', 'França', 'Drama', 'Mélanie Laurent', '15459633105c25872ecf3e5.jpg', 14, 2014, 'dU6qn1Bphh4', 'Joséphine Japy, Lou de Laâge, Isabelle Carré, Claire Keim, Roxane Duran, Thomas Solivérès', 'Charlie (Joséphine Japy) tem 17 anos. A idade das paixões, das emoções, das convicções. Tímida e comportada, é atraída imediatamente por Sarah (Lou de Laage), carismática e rebelde nova aluna da escola. As jovens logo passam a dividir intimidades e segredos, mas o relacionamento ganha ares estranhos quando verdades vêm à tona.', 0, 'helena', NULL, NULL),
(NULL, 1096, 'Antes de Partir', 'The Bucket List', 'Estados Unidos', 'Drama, Aventura, Comédia', 'Rob Reiner', '15459636195c258863bcc5f.jpg', 97, 2007, 'EkBG5e0XX9o', 'Jack Nicholson, Morgan Freeman, Sean Hayes, Beverly Todd, Rob Morrow, Rowena King, Ian Anthony Dale', 'Carter Chambers (Morgan Freeman) é um homem casado, que há 46 anos trabalha como mecânico. Submetido a um tratamento experimental para combater o câncer, ele se sente mal no trabalho e com isso é internado em um hospital. Logo passa a ter como companheiro de quarto Edward Cole (Jack Nicholson), um rico empresário que é dono do próprio hospital. Edward deseja ter um quarto só para si mas, como sempre pregou que em seus hospitais todo quarto precisa ter dois leitos para que seja viável financeiramente, não pode ter seu desejo atendido pois isto afetaria a imagem de seus negócios. Edward também está com câncer e, após ser operado, descobre que tem poucos meses de vida. O mesmo acontece com Carter, que decide escrever a \"lista da bota\", algo que seu professor de filosofia na faculdade passou como trabalho muitas décadas atrás. A lista consiste em desejos que Carter deseja realizar antes de morrer. Ao tomar conhecimento dela Edward propõe que eles a realizem, o que faz com que ambos viagem pelo mundo para aproveitar seus últimos meses de vida.', 0, 'helena', NULL, NULL),
(NULL, 1097, 'Medo da Verdade', 'Gone Baby Gone', 'Estados Unidos', 'Drama, Policial', 'Ben Affleck', '15459638695c25895dcb8dc.jpg', 114, 2007, 'I1vGxZ8dqps', 'Casey Affleck, Michelle Monaghan, Morgan Freeman, Ed Harris, Amy Ryan, John Ashton, Amy Madigan, Titus Melliver', 'Patrick Kenzie (Casey Affleck) e Angela Gennaro (Michelle Monaghan) são sócios em uma agência de detetives e também namorados. Um dia eles recebem a proposta de investigar o misterioso desaparecimento da pequena Amanda McCready (Madeline O\'Brien), levada quando sua mãe, Helene (Amy Ryan), a deixou sozinha em casa. A polícia também investiga o caso, sendo liderada por Jack Doyle (Morgan Freeman). Patrick conhece bastante as pessoas do bairro em que Amanda vivia e passa a conversar com as pessoas. Logo descobre que a história que Helene contou à polícia não era verdadeira. Aos poucos ele percebe que há mais mentiras vindas dos envolvidos no caso.', 0, 'helena', NULL, NULL),
(NULL, 1098, 'O Predador', 'The Predator', 'Estados Unidos', 'Ação, Ficção Científica', 'Shane Black', '15459641505c258a7687b80.jpg', 107, 2018, 'rcLNfp2wx4s', 'Boyd Holbrook, Trevante Rhodes, Jacob Tremblay, Keegan-Michael Key', 'Uma perseguição entre naves alienígenas traz à Terra um novo predador, que acaba sendo capturado por humanos. Antes disso, ele tem seu capacete e bracelete roubados por Quinn McKenna (Boyd Holbrook), um atirador de elite que estava em missão no local onde a nave caiu. A bióloga Casey Brackett (Olivia Munn) é então chamada para examinar o ser recém-descoberto, mas ele logo consegue escapar do laboratório em que é mantido cativeiro. Ao tentar recapturá-lo Casey encontra McKenna, que está em um ônibus repleto de ex-militares com problemas. Juntos, eles buscam um meio de sobreviver e, ao mesmo tempo, proteger o pequeno Rory (Jacob Tremblay), filho de McKenna, que está com os artefatos alienígenas pegos pelo pai.', 0, 'helena', NULL, NULL),
(NULL, 1099, 'Conquistar, Amar e Viver Intensamente', 'Plaire, aimer et courir vite', 'França', 'Comédia dramática, LGBT', 'Christophe Honoré', '15459645285c258bf0c076b.jpg', 132, 2018, 'eXns1g1WYL8', 'Vincent Lacoste, Pierre Deladonchamps, Denis Podalydès, Clément Métayer, Willemijn Kressenhof', 'Jacques (Pierre Deladonchamps) é um escritor e dramaturgo que vive em Paris. Arthur (Vincent Lacoste) é um jovem estudando em Rennes. Eles se encontram na esquina entre um teatro e cinema. Eles vivem uma história em um período complicado dos anos 90, onde o amor paira sobre a morte e a ternura luta contra o desespero, porém, a vida continua contra todas as probabilidades.', 0, 'helena', NULL, NULL),
(NULL, 1100, 'Ilha do Medo', 'Shutter Island', 'Estados Unidos', 'Suspense, Neo Noir', 'Martin Scorsese', '15460253025c2679567c35a.jpg', 138, 2010, 'gL4rP2prdfg', 'Leonardo DiCaprio, Mark Ruffalo, Ben Kingsley, Max von Sydow', '1954. Teddy Daniels (Leonardo DiCaprio) investiga o desaparecimento de um paciente no Shutter Island Ashecliffe Hospital, em Boston. No local, ele descobre que os médicos realizam experiências radicais com os pacientes, envolvendo métodos ilegais e anti-éticos. Teddy tenta buscar mais informações, mas enfrenta a resistência dos médicos em lhe fornecer os arquivos que possam permitir que o caso seja aberto. Quando um furacão deixa a ilha sem comunicação, diversos prisioneiros conseguem escapar e tornam a situação ainda mais perigosa.', 0, 'matheus', NULL, NULL),
(NULL, 1101, 'Drive', 'Drive', 'Estados Unidos', 'Ação, Crime, Suspense, Neo Noir', 'Nicolas Winding Refn', '15460258035c267b4bdbf05.jpg', 100, 2011, 'hMNIlPnQE5I', 'Ryan Gosling, Carey Mulligan, Bryan Cranston, Albert Brooks', 'Durante o dia um motorista (Ryan Gosling) trabalha como mecânico e dublê em filmes de Hollywood, enquanto que à noite ele presta serviços para a máfia. Ele é vizinho de Irene (Carey Mulligan), que é casada e tem um filho com Standard (Oscar Isaac). Percebendo a situação difícil de Standard, que saiu há pouco tempo da prisão, o motorista o convida para realizar um assalto. Só que o golpe dá errado, o que coloca em risco as vidas do motorista, Irene e seu filho.', 0, 'matheus', NULL, NULL),
(NULL, 1102, 'Blade Runner, o Caçador de Andróides', 'Blade Runner', 'Estados Unidos', 'Ficção Científica, Neo Noir', 'Ridley Scott', '15460262045c267cdce7ef8.jpg', 117, 1982, 'OMiCCnauM1Q', 'Harrison Ford, Rutger Hauer, Sean Young, Edward James Olmos', 'No início do século XXI, uma grande corporação desenvolve um robô que é mais forte e ágil que o ser humano e se equiparando em inteligência. São conhecidos como replicantes e utilizados como escravos na colonização e exploração de outros planetas. Mas, quando um grupo dos robôs mais evoluídos provoca um motim, em uma colônia fora da Terra, este incidente faz os replicantes serem considerados ilegais na Terra, sob pena de morte. A partir de então, policiais de um esquadrão de elite, conhecidos como Blade Runner, têm ordem de atirar para matar em replicantes encontrados na Terra, mas tal ato não é chamado de execução e sim de remoção. Até que, em novembro de 2019, em Los Angeles, quando cinco replicantes chegam à Terra, um ex-Blade Runner (Harrison Ford) é encarregado de caçá-los.', 0, 'matheus', NULL, NULL),
(NULL, 1103, 'Os Infiltrados', 'The Departed', 'Estados Unidos', 'Crime, Drama, Neo Noir', 'Martin Scorsese', '15460268335c267f512318a.jpg', 151, 2006, 'iojhqm0JTW4', 'Leonardo DiCaprio, Matt Damon, Jack Nicholson, Mark Wahlberg', 'A polícia trava uma verdadeira guerra contra o crime organizado em Boston. Billy Costigan (Leonardo DiCaprio), um jovem policial, recebe a missão de se infiltrar na máfia, mais especificamente no grupo comandado por Frank Costello (Jack Nicholson). Aos poucos Billy conquista sua confiança, ao mesmo tempo em que Colin Sullivan (Matt Damon), um criminoso que foi infiltrado na polícia como informante de Costello, também ascende dentro da corporação. Tanto Billy quanto Colin sentem-se aflitos devido à vida dupla que levam, tendo a obrigação de sempre obter informações. Porém quando a máfia e a polícia descobrem que entre eles há um espião, a vida de ambos passa a correr perigo.', 0, 'matheus', NULL, NULL),
(NULL, 1104, 'O Poderoso Chefão 2', 'The Godfather: Part II', 'Estados Unidos', 'Crime, Drama, Neo Noir', 'Francis Ford Coppola', '15460278625c268356c6f60.jpg', 202, 1974, 'mESL4ojdH5A', 'Al Pacino, Robert Duvall, Diane Keaton, Robert De Niro', 'Início do século XX. Após a máfia local matar sua família, o jovem Vito (Robert De Niro) foge da sua cidade na Sicília e vai para a América. Já adulto em Little Italy, Vito luta para ganhar a vida (legal ou ilegalmente) e manter sua esposa e filhos. Ele mata Black Hand Fanucci (Gastone Moschin), que exigia dos comerciantes uma parte dos seus ganhos. Com a morte de Fanucci, o poderio de Vito cresce muito, mas sua família é o que mais importa para ele. Um legado de família que vai até os enormes negócios que nos anos 50 são controlados pelo caçula, Michael Corleone (Al Pacino). Agora baseado em Lago Tahoe, Michael planeja fazer incursões em Las Vegas e Havana instalando negócios ligados ao lazer, mas descobre que aliados como Hyman Roth (Lee Strasberg) estão tentando matá-lo. Crescentemente paranoico, Michael também descobre que sua ambição acabou com seu casamento com Kay (Diane Keaton) e até mesmo seu irmão Fredo (John Cazale) o traiu. Escapando de uma acusação federal, Michael concentra sua atenção para lidar com os seus inimigos.', 0, 'matheus', NULL, NULL),
(NULL, 1106, 'O Poderoso Chefão 3', 'The Godfather: Part III', 'Estados Unidos', 'Crime, Drama, Neo Noir', 'Francis Ford Coppola', '15460280515c268413d5a95.jpg', 162, 1990, 'Tyl6dotq8QY', 'Al Pacino, Diane Keaton, Talia Shire, Andy Garcia', 'Nova York, 1979. A Ordem de San Sebastian, um dos maiores títulos dados pela Igreja, é dada para Michael Corleone (Al Pacino), após fazer uma doação à Igreja de US$ 100 milhões, em nome da fundação Vito Corleone, da qual Mary (Sophia Coppola), sua filha, é presidenta honorária. Michael está velho, doente e divorciado, mas faz atos de redenção para tornar aceitável o nome da família Corleone. Na comemoração pelo título recebido, após 8 anos de afastamento, Michael recebe \"Vinnie\" Mancini (Andy Garcia), seu sobrinho, que a pedido de Connie (Talia Shire) é apresentado a Michael manifestando vontade de trabalhar com o tio. Nesta tentativa de diálogo a conversa toma um rumo hostil, pois participava também da reunião Joey Zasa (Joe Mantegna), que agora mantém o domínio de uma área outrora mantida por Don Vito Corleone, o pai de Michael. Vinnie é chefiado por Zasa, mas fala que não quer continuar, principalmente pela traição de Zasa de não reconhecer o poder de Michael. Vinnie é quase morto pelos capangas de Zasa e uma guerra pelo poder tem início. Um arcebispo da Igreja solicita a Michael US$ 600 milhões, pois resolveria o déficit da Igreja, oferecendo em troca que Michael ganhe o controle majoritário da Immobiliare, antiga e respeitável empresa européia de propriedade da Igreja. Michael concorda, mas isto deixa vários membros do clero contrariados, que não o aceitam por sua vida duvidosa.', 0, 'matheus', NULL, NULL),
(NULL, 1107, 'Bonnie e Clyde - Uma Rajada de Balas', 'Bonnie and Clyde', 'Estados Unidos', 'Crime, Drama, Romance, Biografia, Neo Noir', 'Arthur Penn', '15460284575c2685a9c7693.jpg', 111, 1967, 'hZpm1zj9510', 'Warren Beatty, Faye Dunaway, Michael J. Pollard, Gene Hackman', 'Durante a Grande Depressão, Bonnie Parker (Faye Dunaway) conhece Clyde Barrow (Warren Beatty), um ex-presidiário que foi solto por bom comportamento, quando este tenta roubar o carro de sua mãe. Atraída pelo rapaz, ela o acompanha. Ambos iniciam uma carreira de crimes, assaltando bancos e roubando automóveis. Conhecem o mecânico C.W. Moss (Michael J. Pollard), que passa a ser o novo companheiro da dupla, mas durante um assalto matam uma pessoa e são caçados daí em diante como assassinos. Ao grupo une-se Buck (Gene Hackman), o irmão de Clyde recém-saído da cadeia, e Blanche (Estelle Parsons), sua mulher. Sucedem-se os assaltos e logo o quinteto ganha fama em todo o sul do país. Uma noite, são cercados por vários policiais e, obrigados a matar para fugir, são perseguidos em vários estados.', 0, 'matheus', NULL, NULL),
(NULL, 1108, 'Minha Vida em Marte', 'Minha Vida em Marte', 'Brasil', 'Comédia', 'Susana Garcia', '15460347125c269e1861069.jpg', 110, 2018, 'mEbvVIE8cQ0', 'Mônica Martelli, Paulo Gustavo, Marcos Palmeira, Marianna Santos, Gabriel Braga Nunes, Dudu Pelizzari, Lucas Capri', 'Fernanda (Monica Martelli) está casada com Tom (Marcos Palmeira), com quem tem uma filha de cinco anos, Joana (Marianna Santos). O casal está em meio ao desgaste causado pelo convívio por muitos anos, o que gera atritos constantes. Quem a ajuda a superar a crise é seu sócio Aníbal (Paulo Gustavo), parceiro inseparável durante a árdua jornada entre salvar o casamento ou pôr fim a ele.', 0, 'helena', NULL, NULL),
(NULL, 1109, 'Lizzie', 'Lizzie', 'Estados Unidos', 'Suspense, Drama', 'Craig William Macneill', '15460350615c269f753a21e.jpg', 105, 2018, 'heqY5_ahgk0', 'Kristen Stewart, Chloë Sevigny, Fiona Shaw, Kim Dickens, Denis O\'Hare, Fiona Shaw, Jamey Sheridan, Jay Huguley', '1892, em plena Era Vitoriana. Lizzie Borden (Chloë Sevigny) é uma mulher solteira que ainda vive sob a rigidez de seu pai, Andrew (Jamey Sheridan), por mais que tenha atitudes consideradas ousadas para a época. Tal situação vive provocando atritos entre pai e filha, ampliados pelo frágil estado de saúde dela. Menosprezada como filha e como mulher, Lizzie aos poucos se aproxima de Bridget Sullivan (Kristen Stewart), uma jovem criada que trabalha há pouco tempo para a família.', 0, 'helena', NULL, NULL),
(NULL, 1110, 'Christopher Robin - Um Reencontro Inesquecível', 'Christopher Robin', 'Estados Unidos', 'Animação, Família, Comédia', 'Marc Forster', '15460353505c26a09669f76.jpg', 104, 2018, '5n41dyjk9I4', 'Ewan McGregor, Hayley Atwell, Mark Gatiss, Raj Ghatak, Katy Carmichael, Adrian Scarborough, Roger Ashton-Griffiths', 'Christopher Robin (Ewan McGregor) já não é mais aquele jovem garoto que adorava embarcar em aventuras ao lado de Ursinho Pooh e outros adoráveis animais no Bosque dos 100 Acres. Agora um homem de negócios, ele cresceu e perdeu o rumo de sua vida, mas seus amigos de infância decidem entrar no mundo real para ajudá-lo a se lembrar que aquele amável e divertido menino ainda existe em algum lugar.', 0, 'helena', NULL, NULL),
(NULL, 1111, 'De Pernas pro Ar 3', 'De Pernas pro Ar 3', 'Brasil', 'Comédia', 'Julia Rezende', '15460354845c26a11cd3a42.jpg', 0, 2019, 'RsOEs6G8wHE', 'Duda Batista, Bruno Garcia, Ingrid Guimarães, Vincent Mangado', 'O sucesso da franquia Sex Delícia faz com que Alice (Ingrid Guimarães) rode o mundo, visitando os mais diversos países em uma correria interminável. Sem tempo para se dedicar à família, quem assume a casa é seu marido João (Bruno Garcia), que cuida dos filhos Paulinho (Eduardo Mello) e Clarinha (Duda Batista), de apenas seis anos. Cansada de tanta agitação, Alice decide se aposentar e entregar o comando dos negócios à sua mãe, Marion (Denise Weinberg). Porém, o surgimento de Leona (Samya Pascotto), uma jovem competidora, faz com que mude seus planos.', 0, 'helena', NULL, NULL),
(NULL, 1112, 'De Pernas pro Ar', 'De Pernas pro Ar', 'Brasil', 'Comédia', 'Roberto Santucci', '15460357475c26a22372464.jpg', 107, 2010, 'BLbxNDADgBs', 'Ingrid Guimarães, Bruno Garcia da Silva, Maria Paula, Flávia Alessandra, Rodrigo Candelot, Denise Weinberg, Cristina Pereira', 'Alice (Ingrid Guimarães) já passou dos 30, é casada com João (Bruno Garcia), tem um filho e é uma executiva bem sucedida. Na verdade, ela é uma típica workaholic, que tenta se equilibrar entre a rotina de trabalho e a família, mas perde o emprego e o marido no mesmo dia. É quando ela passa a contar com a ajuda da vizinha Marcela (Maria Paula), que mostra que é possível ser uma profissional de sucesso sem deixar os prazeres da vida de lado. Para isso, Alice vira sócia da nova amiga em um sex shop falido e descobre os prazeres dos sex toys.', 0, 'helena', NULL, NULL),
(NULL, 1113, 'De Pernas pro Ar 2', 'De Pernas pro Ar 2', 'Brasil', 'Comédia ', 'Roberto Santucci', '15460359735c26a3055dda7.jpg', 98, 2012, 'R_SIB4xLAzY', 'Ingrid Guimarães, Maria Paula, Alice Borges, Bruno Garcia da Silva, Eriberto Leão, Luis Miranda, Denise Weinberg, Cristina Pereira, Christine Fernandes', 'Alice (Ingrid Guimarães) agora é uma empresária bem-sucedida, que continua trabalhando muito mas sem deixar de lado o prazer sexual. Ela está bastante atarefada devido à abertura da primeira filial de sua sex shop em Nova York, ao lado da sócia Marcela (Maria Paula). Seu grande objetivo é levar para a América um produto erótico inédito, o que faz com que ela fique bastante estressada. Até que, durante a festa de comemoração pela 100ª loja SexDelícia no Brasil, Alice tem um surto devido ao excesso de trabalho. Ela é internada em um spa comandado pela rígida Regina (Alice Borges), onde conhece várias pessoas que buscam controlar suas obsessões e ansiedades.', 0, 'helena', NULL, NULL),
(NULL, 1114, 'O Conto', 'The Tale', 'Estados Unidos', 'Drama', 'Jennifer Fox', '15460363835c26a49fc035c.jpg', 114, 2018, 'DMHrJxilcMA', 'Elizabeth Debicki, Laura Dern, John Heard, Ellen Burstyn, Isabelle Nélisse, Jodi Long, Chelsea Alden, Jason Ritter', 'Uma mulher se vê forçada a reexaminar seu primeiro relacionamento sexual e as histórias que contou para si mesma com o intuito de sobreviver a seus traumas.', 0, 'helena', NULL, NULL),
(NULL, 1115, 'Creed: Nascido Para Lutar', 'Creed', 'Estados Unidos', 'Drama', 'Ryan Coogler', '15460367595c26a6175152f.jpg', 133, 2015, 'DaanI9vOeEk', 'Michael B. Jordan, Sylvester Stallone, Tessa Thompson, Phylicia Rashad, Wood Harris, Ritchie Coster', 'Adonis Johnson (Michael B. Jordan) nunca conheceu o pai, Apollo Creed, que faleceu antes de seu nascimento. Ainda assim, a luta está em seu sangue e ele decide entrar no mundo das competições profissionais de boxe. Após muito insistir, Adonis consegue convencer Rocky Balboa (Sylvester Stallone) a ser seu treinador e, enquanto um luta pela glória, o outro luta pela vida.', 0, 'helena', NULL, NULL),
(NULL, 1116, 'Creed ll', 'Creed ll', 'Estados Unidos', 'Drama, Ação', 'Steven Caple Jr.', '15460371775c26a7b928f99.jpg', 220, 2018, 'pdjdIAFJYVg', 'Michael B. Jordan, Sylvester Stallone, Tessa Thompson, Phylicia Rashad, Dolph Lundgren, Florian Munteanu, Wood Harris, Russell Hornsby', 'Adonis Creed (Michael B. Jordan) saiu mais forte do que nunca de sua luta contra \'Pretty\' Ricky Conlan (Tony Bellew), e segue sua trajetória rumo ao campeonato mundial de boxe, contra toda a desconfiança que acompanha a sombra de seu pai e com o apoio de Rocky (Sylvester Stallone). Sua próxima luta não será tão simples, ele precisa enfrentar um adversário que possui uma forte ligação com o passado de sua família, o que torna tudo ainda mais complexo.', 0, 'helena', NULL, NULL),
(NULL, 1117, 'Scott Pilgrim Contra o Mundo', 'Scott Pilgrim vs. the World', 'Estados Unidos', 'Aventura, Comédia, Fantasia', 'Edgar Wright', '15460383515c26ac4fd17cf.jpg', 112, 2010, 'nKsGhF31oA8', 'Michael Cera, Mary Elizabeth Winstead, Anna Kendrick, Alison Pill, Kieran Culkin, Aubrey Plaza, Chris Evans, Ellen Wong, Brandon Routh, Jason Schwartzman', 'Scott Pilgrim (Michael Cera) tem 23 anos, integra uma banda de colégio, vive trocando de emprego e tem um namoro firme. Sua vida está maravilhosa, até conhecer Ramona V. Flowers (Mary Elizabeth Winestead). Ele logo se apaixona perdidamente por ela, só que não será fácil conquistar seu amor. Para tanto ele precisa enfrentar os sete ex-namorados dela, que estão dispostos a tudo para impedir sua felicidade com outra pessoa.', 0, 'helena', NULL, NULL),
(NULL, 1118, 'Como se Tornar um Conquistador', 'How to Be a Latin Lover', 'Estados Unidos', 'Comédia, Drama', 'Ken Marino', '15460386915c26ada3cbcbd.jpg', 115, 2017, 'kv6aouiZCxE', 'Eugenio Derbez, Salma Hayek, Raphael Alejandro, Rob Lowe, Michael Cera, Rob Riggle, Kristen Bell, Raquel Welch', 'Desde criança, Maximo (Eugenio Derbez) sonhava em se tornar rico sem precisar trabalhar. Durante a juventude, ele conhece uma viúva milionária e se casa com ela. Décadas depois, vivendo numa mansão e cercado por carros de luxo, Maximo é dispensado pela esposa. Agora, sem dinheiro e sem experiência de trabalho, ele busca abrigo na casa da irmã Sara (Salma Hayek), que leva uma rotina modesta. Aos poucos, o homem aproveitador descobre novos valores de vida.', 0, 'helena', NULL, NULL),
(NULL, 1119, 'O Castelo Animado', 'Hauru no Ugoku Shiro', 'Japão', 'Anime, Aventura, Fantasia', 'Hayao Miyazaki', '15460928295c27811d59da9.jpg', 119, 2004, 'iSOvtbKnPBo', 'Chieko Baishô, Takuya Kimura, Akihiro Miwa, Tatsuya Gashûin', 'Sofia é uma jovem de 18 anos que trabalha na chapelaria de seu pai. Em uma de suas raras idas à cidade ela conhece Hauru, um mágico bastante sedutor mas de caráter duvidoso. Ao confundir a relação existente entre eles, uma feiticeira lança sobre Sofia uma maldição que faz com que ela tenha 90 anos. Desesperada, Sofia foge e termina por encontrar o Castelo Animado de Hauru. Escondendo sua identidade, ela consegue ser contratada para realizar serviços domésticos no local, se envolvendo com os demais moradores do castelo.', 0, 'matheus', NULL, NULL),
(NULL, 1120, 'Crianças Lobo', 'Ookami kodomo no Ame to Yuki', 'Japão', 'Anime, Drama', 'Mamoru Hosoda', '15460935565c2783f447e52.jpg', 0, 2012, 'ed1xwAtF728', 'Aoi Miyazaki, Haru Kuroki, Yukito Nishii, Momoka Ôno, 	Amon Kabe, Takuma Hiraoka, Megumi Hayashibara, Tadashi Nakamura', 'Hana se casou com um lobisomem e teve dois filhos, Yuki e Ame. Depois de muitos anos felizes, seu marido morre e ela percebe que as crianças têm a mesma característica do pai. Agora, os jovens devem decidir se seguem como humanos ou lobos.', 0, 'matheus', NULL, NULL),
(NULL, 1121, 'Ponyo - Uma Amizade que Veio do Mar', 'Gake no ue no Ponyo', 'Japão', 'Anime, Aventura, Comédia, Fantasia', 'Hayao Miyazaki', '15460946885c2788603592f.jpg', 101, 2008, 'WWf4lSK6rcg', 'Tomoko Yamaguchi, Kazushige Nagashima, Yûki Amami, George Tokoro', 'Sosuke (Hiroki Doi) é um garoto de cinco anos que mora em um penhasco, com vista para o Mar Interior. Um dia, ao brincar na praia, encontra Ponyo (Yuria Nara), uma peixinho dourado cuja cabeça está presa em um pote de geleia. Ele salva a peixinho e a coloca em um balde verde. Trata-se de amor à primeira vista, já que Sosuke promete que irá cuidar dela. Só que Fujimoto (Jôji Tokoro), que um dia foi humano e hoje é feiticeiro no fundo do mar, exige que Ponyo retorne às profundezas do oceano. Para ficar ao lado de Sosuke, Ponyo toma a decisão de tornar-se humana.', 0, 'matheus', NULL, NULL),
(NULL, 1122, 'Princesa Mononoke', 'Mononoke-Hime', 'Japão', 'Anime, Aventura, Fantasia', 'Hayao Miyazaki', '15460951565c278a34722e1.jpg', 134, 1997, '4OiMOHRDs14', 'Billy Crudup, Billy Bob Thornton, Minnie Driver, John DiMaggio', 'A aldeia de Ashitaka é invadida por um estranho demônio, e quem resolve enfrentá-lo é o corajoso príncipe. Ele luta com o bicho e consegue matá-lo, mas antes fica com o braço ferido e é contaminado por uma maldição. Ele irá se corroer pelo ódio até se tornar um demônio igual ao outro e morrer, a não ser que ele vá atrás da cura na floresta proibida. É aí que começa a jornada de Ashitaka, que vai enfrentar animais fantásticos, princesas amaldiçoadas e os mistérios da natureza. O príncipe vai conhecer também os homens que querem destruir a floresta e a pequena San, ou Princesa Mononoke.', 0, 'matheus', NULL, NULL),
(NULL, 1123, 'Meu Amigo Totoro', 'Tonari no Totoro', 'Japão', 'Anime, Fantasia', 'Hayao Miyazaki', '15460953775c278b11ad5a1.jpg', 86, 1988, 'tWYHKUML2kc', 'Noriko Hidaka, Chika Sakamoto, Shigesato Itoi, Sumi Shimamoto', 'Mei é uma jovem que encontra uma pequena passagem em seu quintal, que a leva a um lendário espírito da floresta, conhecido como Totoro. Sua mãe está no hospital e seu pai divide o tempo entre dar aulas na faculdade e cuidar de sua mulher doente. Quando Mei tenta visitar a mãe por conta própria, se perde na floresta, e só o grande e fofo Totoro pode ajudá-la a achar o caminho de volta para casa.', 0, 'matheus', NULL, NULL),
(NULL, 1124, 'As Memórias de Marnie', 'Omoide no Marnie', 'Japão', 'Anime, Drama', 'James Simone, Hiromasa Yonebayashi', '15460956615c278c2d17b6a.jpg', 103, 2014, 'heCzyAugkcw', 'Sara Takatsuki, Kasumi Arimura, Nanako Matsushima, Susumu Terajima', 'Anna (Hailee Steinfeld) é uma menina de 12 anos, filha de pais adotivos, sempre muito solitária e não exatamente feliz. Um belo dia, em um castelo numa ilha isolada, ela conhece Marnie (Kiernan Shipka). A menina loira de vestido branco se torna a grande e única amiga de Anna, mas ela descobrirá que Marnie não é exatamente quem parece ser.', 0, 'matheus', NULL, NULL),
(NULL, 1125, 'Vidas ao Vento', 'The Wind Rises', 'Japão', 'Anime, Biografia, Drama, Romance', 'Hayao Miyazaki', '15460960995c278de3c4695.jpg', 126, 2013, 'vufnAClphMY', 'Hideaki Anno, Hidetoshi Nishijima, Miori Takimoto, Masahiko Nishimura', 'Jiro Horikoshi, vive em uma cidade do interior do Japão. Um dia, ele tem o sonho de estar voando em um avião com formato de pássaro. A partir desse sonho, ele decide que construir um avião e colocá-lo no ar é a meta da sua vida. Durante a busca pelo seu sonho ele conhece Naoko, uma jovem encantadora por quem se apaixona. No entanto, Naoko fica profundamente doente, sem saber se sobreviverá. ', 0, 'matheus', NULL, NULL),
(NULL, 1126, 'Sussurros do Coração', 'Mimi wo sumaseba', 'Japão', 'Anime, Drama, Romance', 'Yoshifumi Kondô', '15460969925c27916013cca.jpg', 111, 1995, '0pVkiod6V0U', 'Yoko Honna, Issey Takahashi, Takashi Tachibana, Shigeru Muroi', 'Shizuku é uma jovem apaixonada por livros que leva uma vida simples. Certo dia, ela descobre que todos os livros que já pegou na livraria foram checados pela mesma pessoa, Seiji Amasawa. Ela conhece um garoto da sua idade que acha irritante, mas decobre que ele é o seu \"Príncipe dos Livros\". A medida que os dois se aproximam, ele conta que tem o sonho de fabricar violinos, o que faz Shizuku perceber que ela não tem nenhum um caminho para sua vida.', 0, 'matheus', NULL, NULL),
(NULL, 1127, 'O Nascimento de Uma Nação', 'The Birth of a Nation', 'Estados Unidos', 'Biografia, Drama, História', 'Nate Parker', '15461251465c27ff5a59541.jpg', 120, 2016, 'vE03wCMKo2M', 'Nate Parker, Armie Hammer, Penelope Ann Miller, Jackie Earle Haley', 'Nat Turner (Nate Parker), um escravo letrado e pregador, é usado pelo seu proprietário Samuel Turner (Armie Hammer) para acalmar os escravos rebeldes. Depois de testemunhar inúmeras atrocidades, no entanto, ele decide elaborar um plano e liderar o movimento de libertação do seu povo.', 0, 'iris', NULL, NULL),
(NULL, 1128, 'Taylor Swift: Reputation Stadium Tour', 'Taylor Swift: Reputation Stadium Tour', 'Estados Unidos', 'Documentário', 'Paul Dugdale', '15464455695c2ce30130ff4.jpg', 125, 2018, '-PbWzK0HNwA', 'Taylor Swift, Kristian Bush, Camila Cabello, Tiffany Haddish', 'Em 13 de dezembro de 2018, marcando seu aniversário de 29 anos, Swift anunciou o lançamento do filme oficial da turnê para 31 de dezembro seguinte através da Netflix. Intitulado Taylor Swift: Reputation Stadium Tour, o produto foi dirigido por Paul Dugdale e gravado durante os últimos shows da etapa norte-americana, realizados em 5 e 6 de outubro no AT&T Stadium em Arlington, Texas, Estados Unidos, e apresentará o espetáculo completo, além de performances realizadas com convidados em outros concertos.', 0, 'helena', NULL, NULL),
(NULL, 1129, 'Eu Não Sou uma Bruxa', 'I Am Not a Witch', 'Estados Unidos', 'Drama', 'Rungano Nyoni', '15464465395c2ce6cbe5c08.jpg', 93, 2017, 'T6F14JIBfPw', 'Margaret Mulubwa, Henry B.J. Phiri, Gloria Huwiler, Travers Merrill', 'Depois de um incidente banal em sua vila, a menina de 8 anos Shula (Maggie Mulubwa) é acusada de bruxaria. Depois de um rápido julgamento, a garota se torna culpada e é levada em custódia pelo Estado, sendo exilada para um campo de bruxas no meio do deserto. No local, ela passa por uma cerimônia de iniciação em que aprende as regras da sua nova vida como bruxa. Como as outras residentes, ela é amarrada em uma grande árvore, sendo ameaçada de ser amaldiçoada e de se transformar em uma cabra caso corte a fita.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1130, 'O Lagosta', 'The Lobster', 'Irlanda', 'Ficção Científica, Drama, Romance', 'Yorgos Lanthimos', '15464472375c2ce98567bb4.jpg', 119, 2015, 'hMcAHuC7J1I', ' Colin Farrell, Rachel Weisz, Jessica Barden, Olivia Colman, Ashley Jensen, Ariane Labed, Ben Whishaw, Léa Seydoux', 'Em um futuro próximo, uma lei proíbe que as pessoas fiquem solteiras. Qualquer homem ou mulher que não estiver em um relacionamento é preso e enviado ao Hotel, onde terá 45 dias para encontrar um(a) parceiro(a). Caso não encontrem ninguém, eles são transformados em um animal de sua preferência e soltos no meio da Floresta. Neste contexto, um homem se apaixona em plena floresta - algo proibido, de acordo com o sistema.', 0, 'helena', NULL, NULL),
(NULL, 1131, '300', '300', 'Estados Unidos', 'Ação, Épico, Fantasia', 'Zack Snyder', '15464643595c2d2c673a891.jpg', 117, 2006, 'UrIbxk7idYA', 'Gerard Butler, Lena Headey, Dominic West, David Wenham, Rodrigo Santoro', 'Grécia, 480 AC. Na Batalha de Termópilas, o rei Leônidas (Gerard Butler) e seus 300 guerreiros de Esparta lutam bravamente contra o numeroso exército do rei Xerxes (Rodrigo Santoro). Após três dias de muita luta, todos os espartanos são mortos. O sacrifício e a dedicação destes homens uniu a Grécia no combate contra o inimigo persa.', 0, 'matheus', NULL, NULL),
(NULL, 1132, '300 - A Ascensão do Império', '300: Rise of an Empire', 'Estados Unidos', 'Ação, Épico, Fantasia', 'Noam Murro', '15464646185c2d2d6a97052.jpg', 102, 2014, 'jyPKqxeTj5Q', 'Sullivan Stapleton, Eva Green, Lena Headey, Hans Matheson, Rodrigo Santoro', 'Após a morte do pai, Xerxes (Rodrigo Santoro) dá início a uma jornada de vingança e ruma em direção à Grécia, com seu exército sendo liderado por Artemisia (Eva Green). Enquanto os 300 espartanos liderados por Leonidas tantam combater o Deus-Rei, os exércitos do resto da Grécia se unem para uma batalha com as tropas de Artemisia no mar. Themistocles (Sullivan Stapleton) é o responsável por liderar os gregos.', 0, 'matheus', NULL, NULL),
(NULL, 1133, 'Gladiador', 'Gladiator', 'Estados Unidos', 'Ação, Épico, Aventura', 'Ridley Scott', '15464656465c2d316eec3a2.jpg', 155, 2000, 'AVPCzVHLAYY', 'Russell Crowe, Joaquin Phoenix, Connie Nielsen, Oliver Reed', 'Nos dias finais do reinado de Marcus Aurelius (Richard Harris), o imperador desperta a ira de seu filho Commodus (Joaquin Phoenix) ao tornar pública sua predileção em deixar o trono para Maximus (Russell Crowe), o comandante do exército romano. Sedento pelo poder, Commodus mata seu pai, assume a coroa e ordena a morte de Maximus, que consegue fugir antes de ser pego e passa a se esconder sob a identidade de um escravo e gladiador do Império Romano.', 0, 'matheus', NULL, NULL),
(NULL, 1134, 'Sieranevada', 'Sieranevada', 'Romênia', 'Drama', 'Cristi Puiu', '15464705055c2d446901dc6.jpg', 173, 2016, 'k3BjDUpHPeE&t=1s', 'Mimi Branescu, Judith State, Bogdan Dumitrache, Dana Dogaru', 'Lary (Mimi Branescu) vai com a esposa à casa da família, para a comemoração de um ano desde a morte do pai. Lá eles encontram outros familiares, das mais diversas gerações. Todos aguardam a chegada de um padre da Igreja Ortodoxa para realizar uma oração e benzer a casa. Enquanto esperam, as conversas paralelas revelam desde banalidades da vida cotidiana até conflitos entre alguns integrantes.', 0, 'helena', NULL, NULL),
(NULL, 1135, 'Jogos Mortais 2', 'Saw ll', 'Estados Unidos', 'Terror, Suspense', 'Darren Lynn Bousman', '15464773615c2d5f31093f0.jpg', 95, 2005, 'kTlLNy5wI-w', 'Tobin Bell, Shawnee Smith, Erik Knudsen, Donnie Wahlberg, Franky G., Glenn Plummer, Dina Meyer, Emmanuelle Vaugier', 'O detive Eric Matthews (Donnie Wahlberg) está investigando o caso de um sangrento assassinato, e suas suspeitas recaem sobre Jigsaw (Tobin Bell), que desapareceu. Enquanto isso, o assassino está em uma casa abandonada e prendeu 8 pessoas lá dentro para \"jogarem\" com ele. O local está cheio de um gás mortal, que não para de ser lançado, e os prisioneiros tem apenas 2 horas para se livrarem das armadilhas de Jigsaw, ou então morrerão. O que essas pessoas não sabem é que elas tem uma ligação entre si: 7 foram incriminadas por Eric Matthews e a outra vítima é o filho do detetive. No meio dessas pessoas também está Amanda Young (Shawnee Smith), sobrevivente das pegadinhas do assassino.', 0, 'helena', NULL, NULL),
(NULL, 1136, 'Jogos Mortais 3', 'Saw lll', 'Estados Unidos', 'Terror', 'Darren Lynn Bousman', '15464777385c2d60aa0df6b.jpg', 107, 2006, 'ptWqZ_zsV34', 'Tobin Bell, Shawnee Smith, Angus Macfadyen, Bahar Soomekh, Dina Meyer, Kim Roberts, J. LaRose, Alan Van Sprang', 'Dessa vez Jigsaw (Tobin Bell) tem a ajuda da sua assistente Amanda (Shawnee Smith), que passou a ser sua aliada depois de ser obrigada a participar duas vezes dos jogos mortais do assassino. Jigsaw conseguiu escapar da polícia, e enquanto foge de um grupo de detetives, ele e Amanda têm um novo alvo: A médica Lynn Denlon (Bahar Soomekh). Após uma noite de plantão, ela é sequestrada por Amanda e levada até uma casa abandonada para cuidar de Jigsaw, que está mal de saúde. Ele quer continuar vivo apenas para continuar seus jogos horrorosos com Jeff (Angus Macfadyen).', 0, 'helena', NULL, NULL),
(NULL, 1137, 'Jogos Mortais IV', 'Saw IV', 'Estados Unidos', 'Terror', 'Darren Lynn Bousman', '15464780845c2d62049fcf2.jpg', 103, 2007, 'AyiDz2TL6G0', 'Tobin Bell, Scott Patterson, Costas Mandylor, Betsy Russell, Lyriq Bent, Athena Karkanis, Shawnee Smith, Donnie Wahlberg', 'Após a notícia do assassinato do detetive Kerry, os agentes Strahm (Scott Paterson) e Perez (Athena Karkanis) chegam à delegacia de polícia, que está vazia. Strahm e Perez são oficiais veteranos do FBI, sendo especialistas em traçar perfis psicológicos de criminosos. Eles ajudam o também veterano detetive Hoffman (Costas Mandylor) a examinar o mais recente jogo de Jigsaw (Tobin Bell). Porém quando o comandante Rigg (Lyriq Bent), o último oficial ainda intocado por Jigsaw, é sequestrado, os detetives iniciam uma busca pela cidade à sua procura. Paralelamente Rigg precisa lidar com o jogo criado, tendo apenas 90 minutos para superar as armadilhas para ele criadas.', 0, 'helena', NULL, NULL),
(NULL, 1138, 'Jogos Mortais Vl', 'Saw VI', 'Estados Unidos', 'Terror, Suspense', ' Kevin Greutert', '15464785755c2d63efe3d1a.jpg', 93, 2009, 'xpKuBGcNl9U', 'Tobin Bell, Costas Mandylor, Scott Patterson, Betsy Russell, Mark Rolston, Tanedra Howard, Peter Outerbridge', 'O agente Stratham está morto. O novo responsável por espalhar o legado de Jigsaw (Tobin Bell) é o detetive Hoffman (Costas Mandylor). Quando o FBI chega perto de capturá-lo, Hoffman inicia um novo jogo. É quando o grande plano de Jigsaw é enfim revelado.', 0, 'helena', NULL, NULL),
(NULL, 1139, 'Jogos Mortais 5', 'Saw V', 'Estados Unidos', 'Terror', 'David Hackl', '15464788455c2d64fd707f5.jpg', 92, 2008, '6q7xodspJWs', 'Tobin Bell, Costas Mandylor, Scott Patterson, Betsy Russell, Scott Patterson, Julie Benz, Meagan Good, Greg Bryk, Mark Rolston, Carlo Rota', 'Mark Hoffman (Costas Mandylor) é, aparentemente, a última pessoa viva disposta a seguir o legado deixado por Jigsaw (Tobin Bell). Porém, quando seu segredo é ameaçado, ele precisa iniciar uma caçada para eliminar todos os envolvidos.', 0, 'helena', NULL, NULL),
(NULL, 1140, 'Jogos Mortais - O Final', 'Saw VII - The Traps Come Alive', 'Estados Unidos', 'Terror', ' Kevin Greutert', '15464791275c2d66174c9ff.jpg', 90, 2010, '6xe2-DhTKHQ', 'Tobin Bell, Costas Mandylor, Betsy Russell, Sean Patrcik Flanery, Cary Elwes, Chester Bennington, Chad Donella, Tanedra Howard', 'Bobby Daggen (Sean Patrcik Flanery) lança livro e DVD, explorando sua experiência de ter escapado das armadilhas de Jigsaw (Tobin Bell). Ele reúne um grupo de sobreviventes para a gravação de um programa de televisão onde todos dão depoimentos sobre os momentos terríveis que passaram. Enquanto isso, novas mortes voltam a acontecer e sentindo-se pressionada por Hoffman (Costas Mandylor), a esposa de Jigsaw, Jill (Betsy Russell), decide contar a verdade para a polícia. Mas é tarde demais. Agora, um segredo de Daggen vai desencadear uma nova onda de terror.', 0, 'helena', NULL, NULL),
(NULL, 1141, 'Jogos Mortais: Jigsaw', 'Jigsaw', 'Estados Unidos', 'Terror, Suspense', 'Michael Spierig, Peter Spierig', '15464793915c2d671fc4ddb.jpg', 92, 2017, 'IikWdXImVCM', 'Matt Passmore, Tobin Bell, Callum Keith Rennie, Hannah Anderson, Clé Bennett, Mandela Van Peebles, Laura Vandervoort, Brittany Allen', 'Depois de uma série de assassinatos, todas as pistas estão sendo levadas a John Kramer (Tobin Bell), o assassino mais conhecido como Jigsaw. À medida que a investigação avança, os policiais se encontram perseguindo o fantasma de um homem morto há mais de uma década.', 0, 'helena', NULL, NULL),
(NULL, 1142, 'Lila & Eve - Unidas Pela Vingança', 'Lila & Eve', 'Estados Unidos', 'Drama, Suspense, Crime', 'Charles Stone III', '15465262975c2e1e596a8bf.jpg', 53, 2015, 'IbC91ttpQlk', 'Viola Davis, Jennifer Lopez, Shea Whigham, Chris Chalk, Julius Tennon, Andre Royo as Detective Scaketti, Aml Ameen, Yolonda Ross, Diarra Kilpatrick', 'O filho de Lila (Viola Davis) foi assassinado em um tiroteio. Quando ela começa a frequentar um grupo de apoio, conhece Eve (Jennifer Lopez), que também perdeu a filha. Como Lila segue insatisfeita com os resultados dos trabalhos da polícia, Eve a aconselha a procurar justiça com as próprias mãos. As duas embarcam em uma jornada de vingança, que acabará por afetar a recuperação das duas.', 0, 'matheus', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1143, 'Código de Conduta', 'Law Abiding Citizen', 'Estados Unidos', 'Crime, Drama, Suspense, Ação', 'F. Gary Gray', '15465265875c2e1f7b7e3b1.jpg', 109, 2009, 'n34wVRu0-rQ', 'Jamie Foxx, Gerard Butler, Colm Meaney, Bruce McGill, Viola Davis, Leslie Bibb, Regina Hall, Gregory Itzin', 'Clyde Shelton (Gerard Butler) é um dedicado pai de família que testemunha o assassinato de sua esposa e filha. Um dos culpados pelo crime pega uma pena de apenas 5 anos graças a um acordo costurado pelo promotor Nick Rice (Jamie Foxx), que acredita que é melhor ter alguma justiça do que a chance de não obter alguma. Dez anos depois, o assassino é encontrado morto. Mesmo sem ter provas suficientes contra si, Clyde é preso pelo ocorrido. Seu grande objetivo é denunciar a incoerência do sistema judicial, que permite que assassinos sejam libertados ou obtenham penas brandas, nem que para tanto precise eliminar todos os envolvidos. Só que Nick enfrenta um problema: apesar de estar na cadeia, Clyde aparenta sempre estar um passo a frente de todos.', 0, 'matheus', NULL, NULL),
(NULL, 1144, 'Dúvida', 'Doubt', 'Estados Unidos', 'Drama, Suspense', 'John Patrick Shanley', '15465272205c2e21f4b6733.jpg', 104, 2008, 'Ad8gw-Qdjj8', 'Meryl Streep, Philip Seymour Hoffman, Amy Adams, Viola Davis, Alice Drummond, Audrie J. Neenan', '1964. O carismático padre Flynn (Philip Seymour Hoffman) tenta acabar com os rígidos costumes da escola St. Nicholas, localizada no Bronx. A diretora do local é a irmã Aloysius Beauvier (Meryl Streep), que acredita no poder do medo e da disciplina. A escola aceitou recentemente seu primeiro aluno negro, Donald Miller (Joseph Foster), devido às mudanças políticas da época. Um dia a irmã James (Amy Adams) conta à diretora suas suspeitas sobre o padre Flynn, de que esteja dando atenção demais a Donald. É o suficiente para que a irmã Aloysius inicie uma cruzada moral contra o padre, tentando a qualquer custo expulsá-lo da escola.', 0, 'matheus', NULL, NULL),
(NULL, 1145, 'Os Suspeitos', 'Prisoners', 'Estados Unidos', 'Crime, Drama, Suspense', 'Denis Villeneuve', '15465508465c2e7e3e670c9.jpg', 153, 2013, '1GwPisQUuL4', 'Hugh Jackman, Jake Gyllenhaal, Viola Davis, Maria Bello, Terrence Howard, Melissa Leo, Dylan Minnete', 'Boston, Estados Unidos. Keller Dover (Hugh Jackman) leva uma vida feliz ao lado da esposa Grace (Maria Bello) e os filhos Ralph (Dylan Minnette) e Anna (Erin Gerasimovich). Um dia, a família visita a casa de Franklin (Terrence Howard) e Nancy Birch (Viola Davis), seus grandes amigos. Sem que eles percebam, a pequena Anna e Joy (Kyla Drew Simmons), filha dos Birch, desaparecem. Desesperadas, as famílias apelam à polícia e logo o caso cai nas mãos do detetive Loki (Jake Gyllenhaal). Não demora muito para que ele prenda Alex (Paul Dano), que fica apenas 48 horas preso devido à ausência de provas contra ele. Alex na verdade tem o QI de uma criança de 10 anos e, por isso, a polícia não acredita que ele esteja envolvido com o desaparecimento. Entretanto, Keller está convicto de que ele tem culpa no cartório e resolve sequestrá-lo para arrancar a verdade dele, custe o que custar.', 0, 'matheus', NULL, NULL),
(NULL, 1146, 'Dezesseis Luas', 'Beautiful Creatures', 'Estados Unidos', 'Drama, Fantasia, Romance', 'Richard LaGravenese', '15465510095c2e7ee1dc289.jpg', 124, 2013, '', 'Alden Ehrenreich, Alice Englert, Jeremy Irons, Viola Davis, Emily Rossum, Thomas Mann', 'Cidade de Gatlin, na Carolina do Sul, Estados Unidos. Ethan Wate (Alden Ehrenreich) é um estudante do terceiro ano do colegial, que não vê a hora de sair do local. Ele considera Gatlin uma cidade pacata demais, onde nada de interessante acontece, mas se vê preso ao local por ter que cuidar de seu pai, que não deixa o quarto desde que a esposa faleceu em um acidente de carro, um ano antes. Já há alguns meses Ethan é atormentado por sonhos misteriosos, onde vê uma garota desconhecida. Um dia, ele a encontra em sua sala de aula. Trata-se de Lena Duchannes (Alice Englert), uma jovem de 15 anos que está morando com o tio, Macon Ravenwood (Jeremy Irons), descendente da família que fundou Gatlin. O problema é que Macon e seus familiares têm fama de serem satanistas, o que faz com que boa parte da população da cidade se volte contra eles. Não demora muito para que Ethan se interesse por Lena, sem saber que ela e os integrantes de sua família possuem poderes. Eles precisarão lutar pelo amor que sentem um pelo outro, especialmente devido à uma maldição que assombra a união.', 0, 'matheus', NULL, NULL),
(NULL, 1147, 'As Pontes de Madison', 'The Bridges of Madison County', 'Estados Unidos', 'Drama, Romance', 'Clint Eastwood', '15465514145c2e807634fe8.jpg', 135, 1995, 'B2QIhI4ohJ4', 'Clint Eastwood, Meryl Streep, Annie Corley, Victor Slezak, Jim Haynie', 'Após a morte de Francesca Johnson (Meryl Streep), uma proprietária rural do interior do Iowa, seus filhos descobrem, através de cartas que a mãe deixou, do forte envolvimento que ela teve com um fotógrafo (Clint Eastwood) da National Geographic, quando a família se ausentou de casa por quatro dias. Estas revelações fazem os filhos questionarem seus próprios casamentos.', 0, 'matheus', NULL, NULL),
(NULL, 1149, 'As Apimentadas - Mandando Ver', 'Bring It On: Again', 'Estados Unidos', 'Comédia', 'Damon Santostefano', '15465548605c2e8dec323db.jpg', 90, 2004, '_5CuhqucIAQ', 'Anne Judson-Yager, Bree Turner, Bethany Joy Lenz, Faune A. Chambers, Kevin Cooney, Bryce Johnson, Richard Lee Jackson, Felicia Day', 'A jovem Whittier (Anne Judson-Yager) decide retomar os tempos de líder de torcida e junta-se com sua amiga Monica (Faune A. Chambers) à equipe oficial da Universidade de Stinger. As duas esbarram na esnobe e mandona capitã Tina (Bree Turner) e resolvem criar seu próprio grupo de meninas, reunindo todas as estudantes excluídas.', 0, 'helena', NULL, NULL),
(NULL, 1150, 'As Apimentadas: Tudo ou Nada', 'Bring It On: All or Nothing', 'Estados Unidos', 'Comédia', 'Steve Rash', '15465551585c2e8f1652986.jpg', 99, 2006, 'XsE8rK5D9Kk', 'Hayden Panettiere, Jake McDorman, Solange Knowles, Francia Raisia, Emme Rylan, Rihanna, Gus Carr, Danielle Savre, Giovonnie Samuels', 'A jovem Britney Allen (Hayden Panettiere) é popular e vive o sonho de ser líder de torcida no colégio em que estuda, o Pacific Vista High School. O entusiasmo da estudante aumenta ainda mais quando ela descobre que a cantora Rihanna está realizando uma seleção de grupos de meninas para participar de seu novo videoclipe. No entanto, ela é obrigada a se mudar com a família para o bairro de Crenshaw Heights, onde não é bem recebida.', 0, 'helena', NULL, NULL),
(NULL, 1151, 'As Apimentadas: Ainda Mais Apimentadas', 'Bring It On: Fight to the Finish', 'Estados Unidos', 'Comédia', 'Bille Woodruff', '15465554415c2e9031f283d.jpg', 102, 2009, 'X6ZQltG65sI', 'Christina Milian, Vanessa Born, Gabrielle Dennis, Rachele Brooke Smith, Cody Longo, Holland Roden, David Starzyk, Nikki SooHoo, Laura Cerón', 'Catalina Cruz (Christina Milian) é uma talentosa líder de torcida que é pega de surpresa com a decisão da mãe de se casar novamente e se mudar. A família vai para o litoral de Los Angeles e Lina passa a estudar num elitista colégio cheio de dondocas. Agora para realizar seu sonho de conquistar o campeonato de torcida ela precisará enfrentar a esnobe e competitiva Avery (Rachele Brooke Smith).', 0, 'helena', NULL, NULL),
(NULL, 1152, 'As Apimentadas - Entrar para Ganhar', 'Bring It On: In It to Win It', 'Estados Unidos', 'Comédia', 'Steve Rash', '15465557115c2e913f29450.jpg', 90, 2007, 'Fp1R9hAxwMs', 'Ashley Benson, Cassie Scerbo, Noel Areizaga, Jennifer Tisdale, Ashley Tisdale, Kierstin Koppel, Michael Copon, Anniese Taylor Dendy', 'A veterana Carson (Ashley Benson) chega à principal competição de líderes de torcida determinada a vencer com sua equipe, os West High Sharks. Ela não contava com mesma ambição do time da novaiorquina Brooke (Cassie Scerbo), os East High Jets. As duas descobrem que a rivalidade não está apenas dentro de campo, mas também fora dele.', 0, 'helena', NULL, NULL),
(NULL, 1153, 'As Apimentadas: #desafiomundial', 'Bring It On: Worldwide #Cheersmack', 'Estados Unidos', 'Comédia', 'Robert Adetuyi', '15465560295c2e927d13425.jpg', 95, 2017, 'NLNIEBjK-lc', 'Vivica A. Fox, Cristine Prosperi, Jordan Rodrigues, Sophie Vavasseur, Stephan Benson, Natalie Walsh, Gia Re, Sophie De Bruyn', 'Destiny (Cristine Prosperi), a capitã da equipe tri-campeã The Rebels, é desafiada à uma competição mundial pela nova equipe The Truth. Ela descobre que todas as equipes da competição estão tentando derrubá-la, e ela vai ter que ignorar seu ego e descobrir quem são seus verdadeiros amigos para poder ganhar essa competição.', 0, 'helena', NULL, NULL),
(NULL, 1154, 'Um Cupido no Natal', 'Christmas Cupid', 'Estados Unidos', 'Comédia, Família', 'Gil Junger', '15465567715c2e956317329.jpg', 85, 2010, 'q-jmb6XB2VY', 'Chad Michael Murray, Ashley Benson, Ashley Johnson, Christina Milian, Burgess Jenkins, Jackée Harry, Ryan Sypek', 'Sloan é uma publicitária bela, elegante, e muito bem-sucedida em sua empresa de relações públicas. Mas sua vida vai tomar um rumo inesperado quando um de seus maiores clientes morre e se torna seu fantasma pessoal, e a pressiona a encontrar um amor antes do próximo Natal.', 0, 'helena', NULL, NULL),
(NULL, 1155, 'Ratter', 'Ratter', 'Estados Unidos', 'Drama, Terror, Suspense', 'Branden Kramer', '15465570155c2e9657c85e9.jpg', 80, 2015, 'sRklQ4LepbM', 'Ashley Benson, Matt McGorry, Kaili Vernoff, Rebecca Naomi Jones, Karl Glusman, Dylan Chalfy, Michael William Freeman, Alex Cranmer, Ted Koch', 'Emma (Ashley Benson) é uma universitária que vive sozinha em Nova Iorque. Ela é alvo de um perseguidor, um hacker (Dylan Chalfy) que invade todos os dispositivos tecnológicos em posse de Emma, transformando-os em janelas diretas para os momentos mais íntimos e pessoais da moça. As coisas se complicam ainda mais quando o hacker para de sentir satisfação em apenas observar e vai atrás de Emma.', 0, 'helena', NULL, NULL),
(NULL, 1156, 'Her Smell', 'Her Smell', 'Estados Unidos', 'Drama', 'Alex Ross Perry', '15465572815c2e97618264d.jpg', 134, 2018, 'RoRVcsAEt0w', 'Elisabeth Moss, Cara Delevingne, Dan Stevens, Agyness Deyn, Ashley Benson, Amber Heard, Virginia Madsen, Eric Stoltz, Dylan Gelula', 'Becky Something (Elisabeth Moss) é uma estrela do punk rock em decadência. Durante a carreira, ela desenvolveu uma série de relações problemáticas com os seus parceiros de trabalho, sua família e seus fãs. Lutando contra o alcoolismo que a assombra há anos, ela precisa recuperar sua criatividade para fazer com que sua banda volte a ter sucesso.', 0, 'helena', NULL, NULL),
(NULL, 1157, 'Chronically Metropolitan', 'Chronically Metropolitan', 'Estados Unidos', 'Comédia dramática', 'Xavier Manrique', '15465575675c2e987f3fab5.jpg', 90, 2016, 'dwphlBeazD4', 'Shiloh Fernandez, Chris Noth, Ashley Benson, Josh Peck, Addison Timlin, Sosie Bacon, Victor Cruz, Mary-Louise Parker', 'Fenton Dillane (Shiloh Fernandez) é um jovem escritor que passou algum tempo fora de casa. Certo dia e sem avisar, ele decide retornar ao seu lar em Nova Iorque com o objetivo de resolver alguns dos problemas e lembranças que continuam a complicar sua vida: os conflitos com sua família, o término com sua ex-namorada e algumas problemáticas de seus tempos de infância.', 0, 'helena', NULL, NULL),
(NULL, 1158, 'O Melhor Momento da Vida', 'Bart Got a Room', 'Estados Unidos', 'Coming of age, comédia', 'Brian Hecker', '15465579575c2e9a05611f4.jpg', 80, 2008, 'FJyNcgNlsV8', 'Steven Kaplan, William H. Macy, Cheryl Hines, Alia Shawkat, Ashley Benson, Brandon Hardesty, Kate Micucci, Jennifer Tilly', 'Danny Stein, um estudante na parte inferior da cadeia social, precisa de um encontro para o baile de formatura. A causa da ansiedade de Danny é que Bart Beeber, o mais esquisito rapaz na escola, já tem um encontro e reserva em um quarto de hotel. Paralelo a tudo isso, os pais divorciados de Danny estão ambos à procura de novos relacionamentos.', 0, 'helena', NULL, NULL),
(NULL, 1159, 'Meus 15 Anos', 'Meus 15 Anos', 'Brasil', 'Comédia dramática', 'Caroline Fioratti', '15465648315c2eb4df51f7f.jpg', 103, 2017, 'pGmyKd5APy8', 'Larissa Manoela, Rafael Infante, Daniel Botelho, Anitta, Clara Caldas, Heslaine Vieira, Priscila Marinho', 'Aos 14 anos de idade, Bia (Larissa Manoela) descobre que vai ganhar uma grande festa de 15 anos. Mas tem um problema: a garota sonhadora e apaixonada por música não tem muitos amigos para convidar ao evento, por ser pouco popular na escola. Ela conta com a ajuda do único grande amigo, Bruno (Daniel Botelho), e do pai Edu (Rafael Infante) para consertar a situação.', 0, 'helena', NULL, NULL),
(NULL, 1160, 'O Palhaço', 'O Palhaço', 'Brasil', 'Drama', 'Selton Mello ', '15465650615c2eb5c5281a5.jpg', 88, 2011, 'DzS9nGJc5Sk', 'Selton Mello, Paulo José, Tonico Pereira, Larissa Manoela, Álamo Facó, Giselle Mota, Hossen Minussi, Teuda Bara, Erom Cordeiro, Fabiana Karla', 'Benjamim (Selton Mello) trabalha no Circo Esperança junto com seu pai Valdemar (Paulo José). Juntos, eles formam a dupla de palhaços Pangaré & Puro Sangue e fazem a alegria da plateia. Mas a vida anda sem graça para Benjamin, que passa por uma crise existencial e assim, volta e meia, pensa em abandonar Lola (Giselle Mota), a mulher que cospe fogo, os irmãos Lorotta (Álamo Facó e Hossen Minussi), Dona Zaira (Teuda Bara) e o resto dos amigos da trupe. Seu pai e amigos lamentam o que está acontecendo com o companheiro, mas entendem que ele precisa encontrar seu caminho por conta própria.', 0, 'helena', NULL, NULL),
(NULL, 1161, 'Carrossel: O Filme', 'Carrossel: O Filme', 'Brasil', 'Comédia, Família', 'Alexandre Boury, Mauricio Eça', '15465653465c2eb6e2bb2d3.jpg', 83, 2015, 'geVEWfDElDA', 'Larissa Manoela, Jean Paulo Campos, Guilherme Seta, Maisa Silva, Thomaz Costa, Fernanda Concon, Gabriel Calamari, Márcia de Oliveira, Paulo Miklos', 'Em férias, os alunos da Escola Mundial viajam para o acampamento Panapaná, pertencente ao avô de Alícia. Lá eles participam de uma gincana organizada pelo senhor Campos, que faz o possível para que as crianças se divirtam a valer. Entretanto, a chegada de González agita o local, já que ele representa uma incorporadora que pretende comprar o terreno do acampamento para transformá-lo em uma fábrica poluidora. Para atingir seu objetivo, González e seu fiel parceiro Gonzalito usam de todos os artifícios possíveis, inclusive sabotar o acampamento e difamar Campos.', 0, 'helena', NULL, NULL),
(NULL, 1162, 'Carrossel 2: O Sumiço de Maria Joaquina', 'Carrossel 2: O Sumiço de Maria Joaquina', 'Brasil', 'Comédia, Família', 'Mauricio Eça', '15465656015c2eb7e1d2f1d.jpg', 93, 2016, 'J9JmjsMDIF4', 'Jean Paulo Campos, Larissa Manoela, Maisa Silva, Guilherme Seta, Miá Mello, Oscar Filho, Lucas Santos, Fernanda Concon, Matheus Ueta, Thomaz Costa', 'Famosas por conta do sucesso do clipe de PanáPaná na internet, as crianças chamam a atenção de uma estrela da música brasileira, Didi Mel (Miá Mello), que decide convidar toda a galera da escola Mundial para um de seus shows. No entanto, o que tinha tudo para ser uma ótima excursão ganha ares de filme de terror quando os vilões Gonzales (Paulo Miklos) e Gonzalito (Oscar Filho), recém-saídos da prisão, decidem sequestrar Maria Joaquina (Larissa Manoela).', 0, 'helena', NULL, NULL),
(NULL, 1163, 'Questão de Tempo', 'About Time', 'Reino Unido', 'Romance', 'Richard Curtis', '15465659185c2eb91e53e3f.jpg', 123, 2013, 'MVuESq88H4Q', 'Domhnall Gleeson, Rachel McAdams, Bill Nighy, Lydia Wilson, Margot Robbie, Vanessa Kirby, Tom Hollander, Tom Hughes, Will Merrick, Lindsay Duncan, Joshua McGuire', 'Ao completar 21 anos, Tim (Domhnall Gleeson) é surpreendido com a notícia dada por seu pai (Bill Nighy) de que pertence a uma linhagem de viajantes no tempo. Ou seja, todos os homens da família conseguem viajar para o passado, bastando apenas ir para um local escuro e pensar na época e no local para onde deseja ir. Cético a princípio, Tim logo se empolga com o dom ao ver que seu pai não está mentindo. Sua primeira decisão é usar esta capacidade para conseguir uma namorada, mas logo ele percebe que viajar no tempo e alterar o que já aconteceu pode provocar consequências inesperadas.', 0, 'helena', NULL, NULL),
(NULL, 1164, 'Desobediência', 'Disobedience', 'Estados Unidos', 'Drama, Romance', 'Sebastián Lelio', '15465661675c2eba171d27d.jpg', 114, 2017, '1AEIGqGBGno', 'Rachel Weisz, Rachel McAdams, Alessandro Nivola, Alexis Zagerman, Anton Lesser, Allan Corduner, Cara Horgan, Sophia Brown, Bernice Stegers, Liza Sadovy, Dominic Applewhite', 'A fotógrafa Ronit (Rachel Weisz) retorna para a cidade natal pela primeira vez em muitos anos em virtude da morte do pai, um respeitado rabino. Seu afastamento foi bastante abrupto e o reaparecimento é visto com desconfiança na comunidade, mas ela acaba acolhida por um amigo de infância (Alessandro Nivola), para sua surpresa atualmente casado sua paixão de juventude, Esti (Rachel McAdams).', 0, 'helena', NULL, NULL),
(NULL, 1165, 'Nocaute', 'Southpaw', 'Estados Unidos', 'Drama', 'Antoine Fuqua', '15465664835c2ebb53b207b.jpg', 124, 2015, 'fpx3onb1mWA', 'Jake Gyllenhaal, Rachel McAdams, Forest Whitaker, Oona Laurence, 50 Cent, Naomie Harris, Rita Ora, Miguel Gomez, Victor Ortiz, Tyrese Gibson', 'Billy \"The Great\" Hope (Jake Gyllenhaal), um lutador, trilha seu caminho rumo ao título de campeão enquanto enfrenta diversas tragédias em sua vida pessoal. Além das batalhas nos ringues, ele é forçado a lutar para conquistar o amor e o respeito de sua filha, em uma busca por redenção.', 0, 'helena', NULL, NULL),
(NULL, 1166, 'Penetras Bons de Bico', 'The Wedding Crashers', 'Estados Unidos', 'Comédia, Romance', 'David Dobkin', '15465669095c2ebcfd53bbb.jpg', 120, 2005, 'ssqqrGpbWnA', 'Owen Wilson, Vince Vaughn, Christopher Walken, Isla Fisher, Rachel McAdams, Bradley Cooper, Jane Seymour, Keir O\'Donell, Rebecca De Mornay', 'John (Owen Wilson) e Jeremy (Vince Vaughn) são amigos de longa data, sendo que trabalham juntos como mediadores de divórcios. A dupla tem como hobby ir a festas de casamento nos fins de semana sem serem convidados, com o objetivo de seduzir mulheres que se entusiasmam com a simples idéia de se casar. Até que conhecem Claire (Rachel McAdams), uma jovem noiva que é também filha de um influente político (Christopher Walken), que faz com que a dupla entre em sérios apuros.', 0, 'helena', NULL, NULL),
(NULL, 1167, 'Para Sempre', 'The Vow', 'Estados Unidos', 'Drama, Romance', 'Michael Sucsy', '15465671375c2ebde14c58e.jpg', 104, 2012, 'BDOIHPzVj-0', 'Rachel McAdams, Channing Tatum, Jessica Lange, Sam Neill, Scott Speedma, Wendy Crewson, Jessica McNamee, Tatiana Maslany, Lucas Bryant', 'Page (Rachel McAdams) e Leo (Channing Tatum) viviam uma linda história de amor, mas um grave acidente de carro provocou uma grande mudança em suas vidas. Afinal, mesmo estando casados, ela não consegue se recordar de nada e muito menos ter algum tipo de memória sobre o relacionamento deles. Agora, resta para Leo a missão de reconquistá-la novamente para que possam então viver o romance que sempre desejaram. Baseado em fatos reais.', 0, 'helena', NULL, NULL),
(NULL, 1168, 'Agora e para Sempre', 'Now Is Good', 'Reino Unido', 'Drama, Romance', 'Ol Parker', '15465673965c2ebee49070f.jpg', 103, 2012, 'A7GCHZw0urE', 'Dakota Fanning, Jeremy Irvine, Paddy Considine, Olivia Williams, Kaya Scodelario, Edgar Canham, Joe Cole, Rose Leslie, Julia Ford, Franz Drameh', 'Tessa Scott (Dakota Fanning) sofre de leucemia em estágio terminal e decide organizar uma lista de tudo aquilo que precisa fazer antes de morrer. Em primeiro lugar está seu principal desejo: perder a virgindade. Quando ela conhece Adam (Jeremy Irvin), encontra uma companhia e um amor com quem compartilhar seus momentos.', 0, 'helena', NULL, NULL),
(NULL, 1169, 'Te Amarei para Sempre', 'The Time Traveler', 'Estados Unidos', 'Romance, Drama, Fantasia', 'Robert Schwentke', '15465678195c2ec08b77e8b.jpg', 107, 2009, 'PXGMKzphrtI', 'Rachel McAdams, Michelle Nolden, Alex Ferris, Arliss Howard, Eric Bana, Ron Livingston, Brooklyn, Proulx, Jane McLean', 'Henry DeTamble (Eric Bana) conheceu Clare Abshire (Rachel McAdams) quando tinha apenas 6 anos, em um campo perto da casa de seus pais. Logo eles se tornaram grandes amigos, avançando para confidentes e depois amantes. Só que há um problema: o futuro de Clare é o passado de Henry. Ele é um viajante do tempo, devido a uma modificação genética rara que o faz levar a vida sem saber em que época estará. O fato de Henry conhecer o futuro sempre incomodou Clare, mas agora a situação se inverteu. Quando Henry volta no tempo para encontrar Clare aos 6 anos, é ela que, em sua fase adulta, sabe qual será o futuro de seu amado.', 0, 'helena', NULL, NULL),
(NULL, 1170, 'Sob o Mesmo Céu', 'Aloha', 'Estados Unidos', 'Comédia romântica, drama', 'Cameron Crowe', '15465684135c2ec2dd6b472.jpg', 105, 2015, 'ShetvTxA1Gw', 'Bradley Cooper, Emma Stone, Rachel McAdams, Bill Murray, Alec Baldwin, John Krasinski, Dennis Bumpy Kanahele, Danny McBride, Danielle Rose Russell', 'Após fracassar em uma missão, o militar Brian Gilcrest (Bradley Cooper) é enviado de volta para o Havaí, sua terra natal, para supervisionar o lançamento de um satélite. Lá, ele se reaproxima de um amor do passado (Rachel McAdams), ao mesmo tempo que começa a se apaixonar por uma piloto da Força Aérea (Emma Stone).', 0, 'helena', NULL, NULL),
(NULL, 1172, 'Garota Veneno', 'The Hot Chick', 'Estados Unidos', 'Comédia, Fantasia', 'Tom Brady', '15465686595c2ec3d3ae61a.jpg', 104, 2002, 'Db_pbY_e1iI', 'Rob Schneider, Anna Faris, Rachel McAdams, Matthew Lawrence, Melora Hardin, Eric Christian Olsen, Alexandra Holden, Robert Davi, Maritza Murray', 'Jessica (Rachel McAdams) é uma garota extremamente popular, bonita e também cruel, que se acha superior a todas as pessoas com as quais convive. Sua vida muda drasticamente quando, repentinamente, acorda no corpo de Clive (Rob Schneider), um frentista que tem em torno de 30 anos e é considerado por todos como sendo um grande perdedor. Desesperada para retornar à antiga forma, agora ocupada por Clive, ambos passam por estranhas situações no novo visual que agora possuem.', 0, 'helena', NULL, NULL),
(NULL, 1173, 'Uma Manhã Gloriosa', 'Morning Glory', 'Estados Unidos', 'Comédia dramática, Romance', 'Roger Michell', '15465689615c2ec50165075.jpg', 107, 2010, 'jPDWYNdInYQ', 'Rachel McAdams, Harrison Ford, Patrick Wilson, Diane Keaton, Jeff Goldblum, Patti D\'Arbanville, 50 Cent, John Pankow, Ty Burrell, Noah Bean, Matt Malloy', 'Becky Fuller (Rachel McAdams) é uma produtora de televisão que acaba demitida de seu programa de notícias, mas logo consegue uma vaga em uma nova emissora. O único problema é que para elevar a audiência ela precisa fazer muitas mudanças, entre elas convencer o premiado Mike Pomeroy (Harrison Ford) a apresentar matérias de moda e amenidades ao lado de uma ex-miss Arizona (Diane Keaton). Com pouco tempo atingir o sucesso, Becky terá que se virar para driblar o humor de seu elenco, ser reconhecida profissionalmente e ainda viver um novo amor.', 0, 'helena', NULL, NULL),
(NULL, 1174, 'Tudo em Família', 'The Family Stone', 'Estados Unidos', 'Comédia', 'Thomas Bezucha', '15465696695c2ec7c5cf77e.jpg', 103, 2005, '3lgcViU45Fs', 'Sarah Jessica Parker, Claire Danes, Diane Keaton, Rachel McAdams, Dermot Mulroney, Luke Wilson, Craig T. Nelson, Tyrone Giordano, Elizabeth Reaser, Brian J. White', 'Meredith Morton (Sarah Jessica Parker) é uma elegante executiva nova-iorquina, acostumada a enfrentar desafios. Entretanto o pior de todos está por vir, quando aceita o convite para passar o Natal junto à família do seu namorado, Everett Stone (Dermot Mulroney). Com hábitos muito diferentes dos seus, a família de Everett não causa nenhuma simpatia em Meredith. A recíproca é verdadeira, sendo que Sybil (Diane Keaton), mãe de Everett, antipatiza de cara com Meredith. Ao contrário da maior parte da família Ben (Luke Wilson), o irmão de Everett, tenta consolar Meredith de alguma forma. Diante das dificuldades, Meredith pede a sua irmã Julie (Claire Danes) que a encontre para ajudá-la a passar o Natal.', 0, 'helena', NULL, NULL),
(NULL, 1175, 'O Manicômio', 'Heilstätten', 'Alemanha', 'Terror, Suspense', 'Michael David Pate', '15466207005c2f8f1c1c3ea.jpg', 89, 2018, 'chdeEfHmwyU', 'Nilam Farooq, Farina Flebbe, Sonja Gerhardt, Maxine Kazis', 'Um grupo de youtubers entra ilegalmente na área de cirurgia (supostamente assombrada) em um manicômio abandonado para um desafio de 24 horas, com a esperança de viralizar o vídeo e conseguirem mais seguidores. Porém, não demora muito para eles descobrirem que não estão sozinhos e não são bem-vindos ali. O desafio, na verdade, é o da sobrevivência.', 0, 'matheus', NULL, NULL),
(NULL, 1176, 'WiFi Ralph - Quebrando a Internet', 'Ralph Breaks the Internet', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia', 'Phil Johnston, Rich Moore', '15466210455c2f907538d51.jpg', 112, 2018, 'E6HxOW51zIo', 'John C. Reilly, Sarah Silverman, Gal Gadot, Taraji P. Henson, Jack McBrayer, Jane Lynch, Alan Tudyk, Alfred Molina', 'Ralph, o mais famoso vilão dos videogames, e Vanellope, sua companheira atrapalhada, iniciam mais uma arriscada aventura. Após a gloriosa vitória no Fliperama Litwak, a dupla viaja para a world wide web, no universo expansivo e desconhecido da internet. Dessa vez, a missão é achar uma peça reserva para salvar o videogame Corrida Doce, de Vanellope. Para isso, eles contam com a ajuda dos \"cidadãos da Internet\" e de Yess, a alma por trás do \"Buzzztube\", um famoso website que dita tendências.', 0, 'matheus', NULL, NULL),
(NULL, 1177, 'Dragon Ball Super: Broly', 'Doragon bôru chô: Burorî', 'Japão', 'Anime, Animação, Aventura, Fantasia', 'Tatsuya Nagamine', '15466216365c2f92c4e1c1d.jpg', 100, 2019, 'P28nIuJOPoc', 'Masako Nozawa, Ryô Horikawa, Bin Shimada, Ryûsei Nakao, Banjô Ginga, Naoko Watanabe, Toshio Furukawa', 'Apesar da Terra estar em um período de calmaria, Goku se recusa a parar de treinar constantemente - ele quer estar pronto para quando uma nova ameaça surgir. O que ele não imaginava era que seu novo inimigo seria Broly, um poderoso super saiyajin sedento por vingança, que deseja destruir todos que encontrar pela frente.', 0, 'matheus', NULL, NULL),
(NULL, 1178, 'O Grande Hotel Budapeste', 'The Grand Budapest Hotel', 'Estados Unidos', 'Aventura, Comédia, Drama', 'Wes Anderson', '15466223105c2f9566db452.jpg', 99, 2014, 'sF7hAbQR7kk', 'Ralph Fiennes, F. Murray Abraham, Mathieu Amalric, Tony Revolori, Adrien Brody, Willem Dafoe, Jeff Goldblum, Harvey Keitel, Saoirse Ronan', 'No período entre as duas guerras mundiais, o famoso gerente de um hotel europeu conhece um jovem empregado e os dois tornam-se melhores amigos. Entre as aventuras vividas pelos dois, constam o roubo de um famoso quadro do Renascimento, a batalha pela grande fortuna de uma família e as transformações históricas durante a primeira metade do século XX.', 0, 'matheus', NULL, NULL),
(NULL, 1179, 'Os Excêntricos Tenenbaums', 'The Royal Tenenbaums', 'Estados Unidos', 'Comédia, Drama', 'Wes Anderson', '15466225335c2f96450f52a.jpg', 110, 2001, 'caMgokYWboU', 'Gene Hackman, Anjelica Huston, Ben Stiller, Gwyneth Paltrow', 'Royal Tenenbaum (Gene Hackman) e sua esposa Etheline Tenenbaum (Anjelica Huston) tiveram três filhos, Chas (Ben Stiller), Margot (Gwyneth Paltrow) e Richie (Luke Wilson), e logo depois resolveram se separar. Com o passar dos anos cada um dos filhos demonstrou talentos diferentes, tornando-se todos bem-sucedidos. Chas logo em sua adolescência resolveu investir em bens, demonstrando um dom natural para finanças, enquanto que Margot se tornou uma escritora de sucesso e Richie um tenista profissional de sucesso. Mas toda a história de sucesso dos três jovens Tenenbaums é esquecida quando seu pai resolve reatar os antigos laços e lutar pelo amor de Etheline, que está prestes a se casar com seu contador, Henry Sherman (Danny Glover).', 0, 'matheus', NULL, NULL),
(NULL, 1180, 'O Fantástico Sr. Raposo', 'Fantastic Mr. Fox', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil', 'Wes Anderson', '15466227915c2f9747caa28.jpg', 87, 2009, 'wZkYE0Y4MRg', 'George Clooney, Meryl Streep, Jason Schwartzman, Bill Murray', 'O Sr. Raposo (George Clooney), a Sra. Raposa (Meryl Streep) e seu filho vão morar em uma árvore, localizada em uma colina. Lá eles têm como vizinhos o Coelho (Mario Batali), o Texugo (Bill Murray) e a Doninha (Wes Anderson), entre outros animais, todos com suas respectivas famílias. O Sr. Raposo prometeu à esposa que deixaria a vida de roubos de galinhas, já que ela estava grávida. Desde então ele iniciou uma respeitável carreira de colunista de jornal. Porém, a proximidade do novo lar com as fazendas de Boggis (Brian Cox), Bunce (Hugo Guinness) e Bean (Michael Gambon) faz com que volte à velha vida, às escondidas. Só que logo o trio de fazendeiros se une para capturá-lo.', 0, 'matheus', NULL, NULL),
(NULL, 1181, 'A Vida Marinha com Steve Zissou', 'The Life Aquatic with Steve Zissou', 'Estados Unidos', 'Aventura, Comédia, Drama', 'Wes Anderson', '15466232555c2f991730413.jpg', 119, 2004, 'UpU0DZXTGA0', 'Bill Murray, Owen Wilson, Cate Blanchett, Anjelica Huston, Willem Dafoe, Jeff Goldblum, Michael Gambon, Bud Cort', 'Steve Zissou (Bill Murray) é um lendário explorador subaquático, famoso pelos seus rompantes de temperamento e também pelos documentários que faz sobre a vida no fundo dos oceanos. Entretanto os últimos dias não têm sido felizes para Zissou. Esteban (Seymour Cassel), seu melhor amigo e parceiro de longa data, foi recentemente devorado por um tubarão-jaguar. Além disto Zissou precisa lidar com os boatos de que está perdendo seu talento, sem contar o súbito aparecimento de Ned Plimpton (Owen Wilson), um co-piloto que diz ser seu filho nunca visto. Em meio a todos estes problemas Zissou se prepara para realizar seu maior épico cinematográfico, que permitirá que recupere sua nobreza, seja o pai que nunca imaginou poder ser e ainda por cima se vingue do tubarão-jaguar.', 0, 'matheus', NULL, NULL),
(NULL, 1182, 'A Viagem a Darjeeling', 'The Darjeeling Limited', 'Estados Unidos', 'Aventura, Comédia, Drama', 'Wes Anderson', '15466236425c2f9a9abb76c.jpg', 91, 2007, 'aO1bYukdvLI', 'Owen Wilson, Adrien Brody, Jason Schwartzman, Amara Karan', 'Francis (Owen Wilson), Peter (Adrien Brody) e Jack (Jason Schwartzman) são irmãos, mas não se falam há um ano. Eles, decidem realizar uma viagem de trem pela Índia, na intenção de acabar com a barreira existente entre eles e também para auto-conhecimento. Entretanto, devido a incidentes envolvendo a compra de analgésicos sem prescrição médica, o uso de xarope para tosse indiano e um spray de pimenta, a viagem logo muda de rumo e faz com que o trio fique perdido no meio do deserto, tendo apenas 11 malas, uma impressora e uma máquina plastificadora.', 0, 'matheus', NULL, NULL),
(NULL, 1183, 'A Favorita', 'The Favourite', 'Reino Unido', 'Drama, Biografia', 'Yorgos Lanthimos', '15466478915c2ff9536a39c.jpg', 119, 2018, 'et_9k6BU_is', 'Olivia Colman, Emma Stone, Rachel Weisz, Joe Alwyn, Nicholas Hoult, Mark Gatiss, Jenny Rainsford, James Smith, Timothy Innes, James Melville', 'Na Inglaterra do século XVIII, Sarah Churchill, a Duquesa de Marlborough (Rachel Weisz) exerce sua influência na corte como confidente, conselheira e amante secreta da Rainha Ana (Olivia Colman). Seu posto privilegiado, no entanto, é ameaçado pela chegada de Abigail (Emma Stone), nova criada que logo se torna a queridinha da majestade e agarra com unhas e dentes à oportunidade única.', 0, 'helena', NULL, NULL),
(NULL, 1184, 'Zumbilândia', 'Zombieland', 'Estados Unidos', 'Aventura, Comédia, Terror', 'Ruben Fleischer', '15466482585c2ffac25bc76.jpg', 88, 2009, 'IQVjPNV3I-w', 'Jesse Eisenberg, Woody Harrelson, Emma Stone, Abigail Breslin, Bill Murray, Amber Heard, Derek Graf', 'A população mundial foi dizimada devido a um vírus, variante do mal da vaca louca, que faz com que as pessoas se transformem em zumbis. Poucos são os humanos não infectados, entre eles Columbus (Jesse Eisenberg). Ele é um estudante da Univeridade do Texas, que deseja voltar para sua cidade natal na esperança de encontrar seus pais ainda vivos. Cheio de fobias, o maior medo de Columbus não são os zumbis, mas os palhaços. No caminho ele encontra Tallahassee (Woody Harrelson), que está indo para a Flórida com o objetivo de aniquilar o maior número possível de zumbis. Columbus pega uma carona com ele. Ao parar em uma mercearia, a dupla enfrenta três zumbis e encontra duas garotas, Wichita (Emma Stone) e sua irmã caçula Little Rock (Abigail Breslin). Só que Little Rock aparenta ter sido mordida por um zumbi, o que divide o grupo sobre o que fazer.', 0, 'helena', NULL, NULL),
(NULL, 1185, 'Amor a Toda Prova', 'Crazy, Stupid, Love.', 'Estados Unidos', 'Comédia romântica', 'Glenn Ficarra, John Requa', '15466485265c2ffbce6f636.jpg', 118, 2011, 'WAZOAm3aiVM', 'Steve Carell, Ryan Gosling, Julianne Moore, Emma Stone, Marisa Tomei, Analeigh Tipton, Kevin Bacon, Jonah Bobo, Josh Groban, Joey King, Liza Lapira', 'Cal Weaver (Steve Carell) tem quarenta e poucos anos e leva uma vida perfeita, com um bom emprego, filhos e um casamento com a namorada do colégio, Emily (Julianne Moore). Até que, ao descobrir que Emily o está traindo e quer o divórcio, sua vida desaba por completo. Forçado a voltar ao mundo dos solteiros, ele enfrenta as dificuldades habituais de quem não sabe mais como se portar para se aproximar de uma mulher. É quando entra em cena Jacob Palmer (Ryan Gosling), um amigo que passa a lhe dar algumas dicas.', 0, 'helena', NULL, NULL),
(NULL, 1187, 'Superbad - É Hoje', 'Superbad', 'Estados Unidos', 'Comédia', 'Greg Mottola', '15466495925c2ffff8dab8c.jpg', 113, 2007, 'HHCmi9qdvcI', 'Jonah Hill, Michael Cera, Christopher Mintz-Plasse, Bill Hader, Seth Rogen, Emma Stone, Martha MacIsaac, Dave Franco', 'Evan (Michael Cera) e Seth (Jonah Hill) são amigos inseparáveis, que estão terminando o colegial. Eles vão para faculdades diferentes e, desta forma, são obrigados a se separar. Evan é amável, esperto e normalmente aterrorizado com o que acontece à sua volta, enquanto que Seth é desbocado, frívolo e obcecado pela sexualidade. Cada um de sua forma, eles precisarão superar suas frustrações com as mulheres no fim desta fase de suas vidas.', 0, 'helena', NULL, NULL),
(NULL, 1188, 'A Guerra dos Sexos', 'Battle of the Sexes', 'Reino Unido', 'Biografia, Drama', 'Jonathan Dayton, Valerie Faris', '15466500825c3001e214eb4.jpg', 121, 2017, 'H5mP6Xp5fYs', 'Emma Stone, Steve Carell, Andrea Riseborough, Sarah Silverman, Elisabeth Shue, Alan Cumming, Austin Stowell, Bill Pullman, Eric Christian Olsen, Martha MacIsaac', 'Uma disputa de tênis entre o ex-campeão Bobby Riggs (Steve Carell) e a líder da classificação mundial Billie Jean King (Emma Stone) se torna centro de um debate global sobre igualdade de gêneros. Presos sob a atenção da mídia e com ideologias diferentes, Riggs tenta reviver as glórias do passado, enquanto King questiona sua sexualidade e luta pelos direitos das mulheres.', 0, 'helena', NULL, NULL),
(NULL, 1189, 'Amizade Colorida', 'Friends with Benefits', 'Estados Unidos', 'Comédia Romântica', 'Will Gluck', '15466511635c30061bcafd3.jpg', 109, 2011, 'y1dZgWS5jdc', 'Justin Timberlake, Mila Kunis, Patricia Clarkson, Jenna Elfman, Woody Harrelson, Emma Stone, Bryan Greenberg, Richard Jenkins, Andy Samberg', 'Jamie (Mila Kunis) é uma jovem recrutadora de Nova York que convence um cliente em potencial (Justin Timberlake) a deixar seu emprego em Los Angeles para trás e aceitar um emprego na Big Apple. Ele aceita a proposta e logo os dois se tornam bons amigos. Um dia, após assistir um filme na casa dela, surge o papo do quanto a carência sexual incomoda ambos. Eles fazem um pacto de que terão apenas sexo, sem qualquer envolvimento emocional. Só que, aos poucos, a intimidade faz com que eles se tornem cada vez mais próximos e interessados um no outro.', 0, 'helena', NULL, NULL),
(NULL, 1190, 'Magia ao Luar', 'Magic in the Moonlight', 'Estados Unidos', 'Comédia, Romance', 'Woody Allen', '15466514225c30071eb28eb.jpg', 97, 2014, 'q9PetTRAO3k', 'Emma Stone, Colin Firth, Hamish Linklater, Jacki Weaver, Simon McBurney, Eileen Atkins, Marcia Gay Harden, Erica Leerhsen, Catherine McCormack', 'Stanley (Colin Firth), um falso mágico com talento para desmascarar charlatões, é contratado para acabar com a suposta farsa de Sophie (Emma Stone), simpática jovem que afirma ser médium. Inicialmente cético, ele aos poucos começa a duvidar de suas certezas e se vê cada vez mais encantado pela moça.', 0, 'helena', NULL, NULL),
(NULL, 1191, 'Minhas Adoráveis Ex-Namoradas', 'Ghosts of Girlfriends Past', 'Estados Unidos', 'Comédia, Romance', 'Mark Waters', '15466516665c300812ac8e9.jpg', 100, 2009, '9QJrwOiJSwc', 'Matthew McConaughey, Jennifer Garner, Michael Douglas, Breckin Meyer, Lacey Chabert, Emma Stone, Robert Foster, Anne Archer, Daniel Sunjata', 'Connor Mead (Matthew McConaughey) é um fotógrafo de celebridades que coleciona ex-namoradas. Acreditando que a vida serve apenas para se divertir e namorar, Connor não entende como alguém pode ter um relacionamento duradouro. Quando seu irmão Paul (Breckin Meyer) se casa ele reencontra Jenny Perotti (Jennifer Garner), a única mulher pela qual realmente se envolveu. À noite ele recebe a visita do tio Wayne (Michael Douglas), um playboy dos anos 70, que lhe diz que receberá a visita dos fantasmas de três ex-namoradas. Através delas Connor percebe as falhas de seus relacionamentos anteriores.', 0, 'helena', NULL, NULL),
(NULL, 1192, 'O Roqueiro', 'The Rocker', 'Estados Unidos', 'Comédia, Musical', 'Peter Cattaneo', '15466518955c3008f73ab70.jpg', 102, 2008, 'MgqlNwyGJEE', 'Rainn Wilson, Bradley Cooper, Christina Applegate, Emma Stone, Teddy Geiger, Josh Gad, Jeff Garlin, Jane Lynch, Will Arnett, Jason Sudeikiss', 'Robert \"Fish\" Fishman (Rainn Wilson) é um baterista de rock que que alcançou sucesso nos anos 80 com a banda Vesuvius. Ele vivia como uma estrela, até ser expulso do grupo e cair em decadência. Vinte anos depois, Fish ganha a chance de recomeçar a vida de músico tocando com seu sobrinho e outros adolescentes.', 0, 'helena', NULL, NULL),
(NULL, 1193, 'Homem Irracional', 'Irrational Man', 'Estados Unidos', 'Drama, Romance, Suspense', 'Woody Allen', '15466522205c300a3c34be4.jpg', 95, 2015, 'BO-r4DZTT9c', 'Joaquin Phoenix, Emma Stone, Parker Posey, Tom Kemp, Jamie Blackley, Ethan Phillips, Betsy Aidem, Sophie Von Haselberg, Meredith Hagner', 'Em crise existencial, o professor de filosofia Abe Lucas (Joaquin Phoenix) chega para lecionar em uma pequena cidade dos Estados Unidos. Logo uma de suas alunas, Jill (Emma Stone), se aproxima dele devido ao fascínio que sente pelo seu intelecto, além da tristeza que sempre carrega consigo. Simultaneamente, ele é alvo de Rita (Parker Posey), uma professora casada que tenta ter um caso com ele. A vida começa a melhorar para Abe quando, numa ida à lanchonete com Jill, ouve a conversa de uma desconhecida sobre a perda da guarda do filho devido à uma decisão do juiz Spangler (Tom Kemp). Abe logo começa a idealizar o assassinato de Spangler e como, por ser um completo desconhecido, jamais seria descoberto.', 0, 'helena', NULL, NULL),
(NULL, 1194, 'Para Maiores', 'Movie 43', 'Estados Unidos', 'Comédia', 'Steven Brill, Peter Farrelly', '15466526865c300c0e8cd72.jpg', 94, 2013, 'OWjJt65_OoY', 'Elizabeth Banks, Hugh Jackman, Emma Stone, Halle Berry, Kate Winslet, Richard Gere, Gerard Butler, Chlöe Moretz, Naomi Watts, Uma Thurman, Anna Faris', 'Um adolescente de 15 anos tenta a todo custo encontrar um filme proibido, chamado \"Movie 43\". Para tanto ele conta com a ajuda de seu irmão caçula, um gênio da informática apesar de ter apenas 11 anos. Logo eles descobrem que Movie 43 é na verdade a composição de 14 curta-metragens, sendo que alguns deles são paródias dos super-heróis mais famosos da atualidade, como Super-Homem, Batman e Mulher-Maravilha.', 0, 'helena', NULL, NULL),
(NULL, 1196, 'Máquinas Mortais', 'Mortal Engines', 'Estados Unidos', 'Ação, Aventura, Fantasia, Ficção Científica', 'Christian Rivers', '15472250965c38c8080f5a3.jpg', 128, 2018, 'DRIbfiG8IkY', 'Hera Hilmar, Robert Sheehan, Hugo Weaving, Jihae, Ronan Raftery, Patrick Malahide, Stephen Lang, Frankie Adams', 'Anos depois da \"Guerra dos Sessenta Minutos\". A Terra está destruída e para sobreviver as cidades se movem em rodas gigantes, conhecidas como Cidades Tração, e lutam com outras para conseguir mais recursos naturais. Quando Londres se envolve em um ataque, Tom (Robert Sheehan) é lançado para fora da cidade junto com uma fora-da-lei e os dois juntos precisam lutar para sobreviver e ainda enfrentar uma ameaça que coloca a vida no planeta em risco.', 0, 'matheus', NULL, NULL),
(NULL, 1197, 'A Esposa', 'The Wife', 'Suécia', 'Drama, Suspense', 'Björn Runge', '15472252855c38c8c5abdfd.jpg', 100, 2017, 'ZpIWMBqVzUE', 'Glenn Close, Jonathan Pryce, Max Irons, Christian Slater, Alix Wilton Regan, Elizabeth McGovern, Karin Franz Körlof, Harry Lloyd', 'Joan Castleman (Glenn Close) é casada com um homem controlador e que não sabe como cuidar de si mesmo ou de outra pessoa. Ele é um escritor e está prestes a receber um Prêmio Nobel de literatura. Joan, que passou 40 anos ignorando seus talentos literários para valorizar a carreira do marido, decide abandoná-lo.', 0, 'matheus', NULL, NULL),
(NULL, 1198, 'Assunto de Família', 'Manbiki kazoku', 'Japão', 'Drama', 'Hirokazu Koreeda', '15472256245c38ca18c916e.jpg', 121, 2018, 'l1ezV9mvpKo', 'Lily Franky, Sakura Andô, Mayu Matsuoka, Jyo Kairi', 'Depois de uma de suas sessões de furtos, Osamu (Lily Franky) e seu filho se deparam com uma garotinha. A princípio eles relutam em abrigar a menina, mas a esposa de Osamu concorda em cuidar dela depois de saber das dificuldades que enfrenta. Embora a família seja pobre e mal ganhem dinheiro dos pequenos crimes que cometem, eles parecem viver felizes juntos até que um incidente revela segredos escondidos, testando os laços que os unem.', 0, 'matheus', NULL, NULL),
(NULL, 1199, 'Amigos Para Sempre', 'The Upside', 'Estados Unidos', 'Comédia, Drama', 'Neil Burger', '15472271615c38d0190d3c5.jpg', 125, 2019, 'bL9sBQ5WwLg', 'Nicole Kidman, Kevin Hart, Bryan Cranston, Julianna Margulies, Golshifteh Farahani, Aja Naomi King, Tate Donovan, Genevieve Angelson', 'Philip (Bryan Cranston) é um homem rico que fica tetraplégico, após sofrer um acidente. A situação o deixa desgostoso com a vida, já que está sempre rodeado de enfermeiros e pessoas para ajudá-lo. Até que um dia, durante a seleção de um assistente, ele simpatiza com Dell (Kevin Hart), um jovem com registro criminal que não tem a menor experiência na função. Philip decide contratá-lo e, ao seu lado, reencontra o prazer pela vida.', 0, 'matheus', NULL, NULL),
(NULL, 1200, 'De Volta ao Jogo', 'John Wick', 'Estados Unidos', 'Ação, Crime, Suspense', 'Chad Stahelski, David Leitch', '15474194025c3bbf0a64d9e.jpg', 101, 2014, 'rUKOAwlyNag', 'Keanu Reeves, Michael Nyqvist, Alfie Allen, Willem Dafoe, Adrianne Palicki, Bridget Moynahan, Ian McShane, John Leguizamo', 'John Wick (Keanu Reeves) já foi um dos assassinos mais temidos da cidade de Nova York, trabalhando em parceria com a máfia russa. Um dia, ele decide se aposentar, e neste período tem que lidar com a triste morte de sua esposa. Vítima de uma doença grave, ela já previa a sua própria morte, e deu de presente ao marido um cachorro para cuidar em seu período de luto. No entanto, poucos dias após o funeral, o cachorro é morto por ladrões que roubam o seu carro. John Wick parte em busca de vingança contra estes homens que ele já conhecia muito bem, e que roubaram o último símbolo da mulher que ele amava.', 0, 'matheus', NULL, NULL),
(NULL, 1201, 'John Wick: Um Novo Dia Para Matar', 'John Wick: Chapter 2', 'Estados Unidos', 'Ação, Crime, Suspense', 'Chad Stahelski', '15474183575c3bbaf5dd1a1.jpg', 122, 2017, 'REt99QNJ5Gs', 'Keanu Reeves, Riccardo Scamarcio, Ian McShane, Ruby Rose, Laurence Fishburne, Lance Reddick, Bridget Moynahan, John Leguizamo', 'Após recuperar seu carro, John Wick (Keanu Reeves) acredita que enfim poderá se aposentar. Entretanto, a reaparição de Santino D\'Antonio (Riccardo Scarmacio) atrapalha seus planos. Dono de uma promissória em nome de Wick, por ele usada para deixar o posto de assassino profissional da Alta Cúpula, Santino cobra a dívida existente e insiste para que ele mate sua própria irmã, Gianna (Claudia Gerini).', 0, 'matheus', NULL, NULL),
(NULL, 1202, 'Dumbo', 'Dumbo', 'Estados Unidos', 'Aventura, Fantasia', 'Tim Burton', '15474190645c3bbdb80b66e.jpg', 0, 2019, 'sZKXLmB_vGE', 'Alan Arkin, Eva Green, Colin Farrell, Danny DeVito, Michael Keaton, Joseph Gatt, Roshan Seth, Deobia Oparei', 'Holt Farrier (Colin Farrell) é uma ex-estrela de circo que retorna da guerra e encontra seu mundo virado de cabeça para baixo. O circo em que trabalhava está passando por grandes dificuldades, e ele fica encarregado de cuidar de um elefante recém-nascido, cujas orelhas gigantes fazem dele motivo de piada. No entanto, os filhos de Holt descobrem que o pequeno elefante é capaz de uma façanha enorme.', 0, 'matheus', NULL, NULL),
(NULL, 1203, 'Sombras da Noite', 'Dark Shadows', 'Estados Unidos', 'Comédia, Fantasia', 'Tim Burton', '15474219115c3bc8d7d40c1.jpg', 113, 2012, 'bvhQ2pbZ2fI', 'Johnny Depp, Michelle Pfeiffer, Helena Bonham Carter, Eva Green, Jackie Earle Haley, Jonny Lee Miller, Bella Heathcote, Chloë Grace Moretz', '1752. Joshua (Ivan Kaye) e Naomi Collins (Susanna Cappellaro) deixam a cidade inglesa de Liverpool juntamente com o filho, Barnabás, rumo aos Estados Unidos. A intenção deles era escapar de uma terrível maldição que atingiu a família. Vinte anos depois, Barnabás (Johnny Depp) é um playboy inveterado que tem a cidade de Collinsport aos seus pés. Após seduzir e partir o coração de Angelique Bouchard (Eva Green), sem saber que era uma bruxa, ele é transformado em vampiro e preso numa tumba por dois séculos. Quando enfim desperta, dois séculos depois, encontra sua propriedade em ruínas e os poucos familiares ainda vivos escondem segredos uns dos outros. Em meio a um mundo desconhecido, Barnabás se interessa por Victoria Winters (Bella Heathcote), a tutora do jovem David (Gulliver McGrath).', 0, 'matheus', NULL, NULL),
(NULL, 1204, 'Trapaça', 'American Hustle', 'Estados Unidos', 'Comédia dramática, suspense', 'David O. Russell', '15474241575c3bd19d59e0a.jpg', 138, 2013, 'cQP630joSO0', 'Christian Bale, Bradley Cooper, Amy Adams, Jeremy Renner, Jennifer Lawrence, Louis C. K., Robert De Niro, Alessandro Nivola, Jack Huston, Michael Penã', 'Irving Rosenfeld (Christian Bale) é um grande trapaceiro, que trabalha junto da sócia e amante Sydney Prosser (Amy Adams). Os dois são forçados a colaborar com um agente do FBI (Bradley Cooper), infiltrando o perigoso e sedutor mundo da máfia. Ao mesmo tempo, o trio se envolve na política do país, através do candidato Carmine Polito (Jeremy Renner). Os planos parecem dar certo, até a esposa de Irving, Rosalyn (Jennifer Lawrence), aparecer e mudar as regras do jogo.', 0, 'helena', NULL, NULL),
(NULL, 1205, 'O Lugar Onde Tudo Termina', 'The Place Beyond the Pines', 'Estados Unidos', 'Suspense, Drama', 'Derek Cianfrance', '15474244365c3bd2b4bb380.jpg', 140, 2012, 'C2ibMaDBcXA', 'Ryan Gosling, Bradley Cooper, Eva Mendes, Ben Mendelsohn, Dane DeHaan, Ray Liotta, Emory Cohen, Rose Byrne, Mahershala Ali, Bruce Greenwood, Olga Merediz', 'Luke (Ryan Gosling) é um motociclista misterioso, que pilota dentro de globos da morte para um circo itinerante. Quando descobre que sua ex-namorada, Romina (Eva Mendes), teve um filho seu, ele tenta se reaproximar dela. Sua intenção é mostrar-se um pai capaz de sustentar o filho e, para isso, Luke decide participar de uma série de roubos a bancos. O problema é que Luke não consegue reprimir seu lado violento, o que lhe traz problemas não apenas com Romina mas também com Robin (Ben Mendelsohn), seu parceiro de assaltos. Apesar dos vários problemas inesperados que surgem, ainda assim Luke resolve realizar sozinho um assalto a banco. Perseguido pela polícia, ele vira alvo de Avery Cross (Bradley Cooper), um policial que cumpria sua rotina fazendo a ronda diária.', 0, 'helena', NULL, NULL),
(NULL, 1206, 'Sim Senhor', 'Yes Man', 'Estados Unidos', 'Comédia romântica', 'Peyton Reed', '15474247035c3bd3bf00813.jpg', 104, 2008, 'uIARewrukBA', 'Jim Carrey, Zooey Deschanel, Bradley Cooper, Rhys Darby, Terence Stamp, Danny Masterson, John Michael Higgins, Fionnula Flanagan, Molly Sims, Sasha Alexander', 'Após o convite de um amigo, Carl Allen (Jim Carrey) decide ir em um culto de auto-ajuda, que tem por base dizer sim a qualquer coisa que lhe aconteça ou ofereçam. Ao seguir este preceito a vida de Carl começa a mudar, fazendo com que seja promovido e conheça Allison (Zooey Deschanel), por quem se apaixona. Porém ao tentar aproveitar todas as oportunidades que lhe surgem Carl começa a notar que tudo que é em excesso pode também cansar.', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1207, 'Pegando Fogo', 'Burnt', 'Estados Unidos', 'Comédia dramática', 'John Wells', '15474249935c3bd4e158031.jpg', 101, 2015, 'vRRV_99s8n4', 'Bradley Cooper, Sienna Miller, Daniel Brühl, Riccardo Scamarcio, Alicia Vikander, Lily James, Sam Keely, Uma Thurman, Omar Sy, Matthew Rhys, Emma Thompson', 'O chefe de cozinha Adam Jones (Bradley Cooper) já foi um dos mais respeitados em Paris, mas o envolvimento com álcool e drogas fez com que sua carreira fosse ladeira abaixo. Após um período de isolamento em Nova Orleans, ele parte para Londres disposto a recomeçar a carreira e conquistar a sonhada terceira estrela no badalado guia Michelin de restaurantes. Para tanto ele conta com a ajuda de Tony (Daniel Brühl), que gerencia um restaurante na capital britânica, e recruta uma equipe de velhos conhecidos.', 0, 'helena', NULL, NULL),
(NULL, 1208, 'Cães de Guerra', 'War Dogs', 'Estados Unidos', 'Comédia, Drama, Guerra', 'Todd Phillips', '15474253725c3bd65ccd27d.jpg', 114, 2016, 'RqYwugvG8Po', 'Jonah Hill, Miles Teller, Bradley Cooper, Ana de Armas, David Packouz, Kevin Pollak, J. B. Blanc, Dan Bilzerian, Shaun Toub, Barry Livingston, Eddie Jemison, Steve Lantz', 'David Packouz (Miles Teller) leva uma vida tranquila em Miami, é casado e vai ter um bebê. Efraim (Jonah Hill) tem um negócio lucrativo e, vendo que David vem passando por dificuldades financeiras, resolve chamar o amigo de infância para trabalhar com ele. Os dois, que na adolescência já foram presos fumando maconha, entram numa nova jornada juntos, descobrindo um enorme mercado de venda de armas.', 0, 'helena', NULL, NULL),
(NULL, 1209, 'As Palavras', 'The Words', 'Estados Unidos', 'Drama, Romance', 'Brian Klugman, Lee Sternthal', '15474257205c3bd7b8c0ad4.jpg', 102, 2012, '3iZlzUFH_Tw', 'Bradley Cooper, Dennis Quaid, Lee Sternthal, Zoë Saldanha, Olivia Wilde, Jeremy Irons, Nora Arnezeder, J. K. Simmons, Ben Barnes, Michael McKean', 'Rory Jansen (Bradley Cooper) é casado com Dora (Zoe Saldana) e trabalha em uma editora de livros. Ele sonha em publicar seu próprio livro, mas a cada nova tentativa se convence mais de que não é capaz de escrever algo realmente bom. Um dia, em uma pequena loja de antiguidades, ele encontra uma pasta com várias folhas amareladas. Rory começa a ler e logo não consegue tirar a história da cabeça. Logo ele resolve transcrevê-la para o computador, palavra por palavra, e a apresenta como se fosse seu livro. O texto é publicado e Rory se torna um sucesso de vendas. Entretanto, tudo muda quando ele conhece um senhor (Jeremy Irons) que lhe conta a verdade por trás do texto encontrado.', 0, 'helena', NULL, NULL),
(NULL, 1210, 'Mais Um Verão Americano', 'Wet Hot American Summer', 'Estados Unidos', 'Comédia', 'David Wain', '15474261085c3bd93c34484.jpg', 97, 2001, 'W9WoDsxmYbA', 'Michael Showalter, Paul Rudd, Amy Poehler, Bradley Cooper, David Hyde Pierce, Janeane Garofalo, Elizabeth Banks, Michael Ian Black, Marguerite Moreau, Christopher Meloni', 'No verão de 1981, um grupo de adolescentes vai para o Acampamento Firewood sob a supervisão de Beth (Janeane Garofalo). Chegando próximo do fim do encontro, os jovens decidem que vão fazer valer ao máximo o tempo que passaram juntos, e para isso precisam esclarecer situações e romances mal-resolvidos, assim, junto com os professores, aprontam muitas loucuras tentando superar a timidez, ter suas primeiras aventuras sexuais ou até mesmo chorar as mágoas do fim de um relacionamento. Enquanto isso, um astrônomo (David Hyde Pierce) aparece no local avisando que um pedaço de satélite caindo do espaço pode destruir o acampamento.', 0, 'helena', NULL, NULL),
(NULL, 1211, 'O Olho que Tudo Vê', 'My Little Eye', 'Reino Unido', 'Terror', 'Marc Evans', '15474263555c3bda33aab69.jpg', 95, 2002, 'H5cPmHO5xM4', 'Bradley Cooper, Jennifer Sky, Sean Cw Johnson, Kris Lemche, Stephen O\'Reilly, Laura Regan', 'Em troca de US$ 1 milhão cinco jovens aceitam o desafio de ter que morar em uma casa abandonada por 6 meses, sendo vigiados por câmeras de TV 24 horas por dia. Caso um deles desista do desafio e deixe a casa todos serão perdedores e ninguém ganhará o prêmio. Com o tempo as diferentes motivações para participar do desafio vêm à tona, mostrando o quão diferentes eles são. Porém as provações que cada um tem que suportar para continuar no jogo ficam tão intensas que eles passam cada vez mais a pensar se vale a pena permanecer nele.', 0, 'helena', NULL, NULL),
(NULL, 1212, 'Ele Não Está Tão A Fim de Você', 'He\'s Just Not That Into You', 'Estados Unidos', 'Comédia romântica', 'Ken Kwapis', '15474270475c3bdce78b416.jpg', 129, 2009, '_z3dftGy9lI', 'Drew Barrymore, Scarlett Johansson, Ginnifer Goodwin, Kevin Connolly, Justin Long, Bradley Cooper, Jennifer Aniston, Ben Affleck, Jennifer Connelly, Kris Kristofferson', 'Gigi (Ginnifer Goodwin) é uma romântica incurável, que um dia resolve sair com Conor (Kevin Connolly). Ela espera que ele ligue no dia seguinte, o que não acontece. Gigi resolve ir até o bar onde se conheceram, na esperança de reencontrá-lo. Lá ela conhece Alex (Justin Long), amigo de Conor. Ele tem uma visão bastante realista sobre os relacionamentos amorosos e tenta apresentá-la a Gigi, através de seu ponto de vista masculino. Por sua vez Conor é apaixonado por Anna (Scalett Johansson), uma cantora que o trata apenas como amigo e que se interessa por Ben (Bradley Cooper), casado com Janine (Jennifer Connelly). O casamento deles está em crise, o que não impede que Janine dê conselhos amorosos a Gigi, com quem trabalha. Outra colega de serviço é Beth (Jennifer Aniston), que namora Neil (Ben Affleck) há 7 anos e sonha em um dia se casar, apesar dele ser contrário à ideia.', 0, 'helena', NULL, NULL),
(NULL, 1213, 'Frozen - Uma Aventura Congelante', 'Frozen', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia, Musical', 'Chris Buck, Jennifer Lee', '15474852815c3cc061aaef6.jpg', 102, 2013, 'EBEbqLvrf7w', 'Kristen Bell, Idina Menzel, Jonathan Groff, Josh Gad, Alan Tudyk, Eva Bella, Santino Fontana, Chris Williams', 'A caçula Anna (Kristen Bell/Gabi Porto) adora sua irmã Elsa (Idina Menzel/Taryn Szpilman), mas um acidente envolvendo os poderes especiais da mais velha, durante a infância, fez com que os pais as mantivessem afastadas. Após a morte deles, as duas cresceram isoladas no castelo da família, até o dia em que Elsa deveria assumir o reinado de Arendell. Com o reencontro das duas, um novo acidente acontece e ela decide partir para sempre e se isolar do mundo, deixando todos para trás e provocando o congelamento do reino. É quando Anna decide se aventurar pelas montanhas de gelo para encontrar a irmã e acabar com o frio.', 0, 'matheus', NULL, NULL),
(NULL, 1214, 'Homem-Aranha: Longe de Casa', 'Spider-Man: Far From Home', 'Estados Unidos', 'Herói, Ação, Aventura, Comédia, Fantasia', 'Jon Watts', '15475830345c3e3e3a6b0ef.jpeg', 0, 2019, 'fxOEBm65oFo', 'Tom Holland, Zendaya, Jake Gyllenhaal, Cobie Smulders, Samuel L. Jackson, Marisa Tomei, Micheal Keaton, Cobie Smulders, Angourie Rice', 'Peter Parker (Tom Holland) está em uma viagem de duas semanas pela Europa, ao lado de seus amigos de colégio, quando é surpreendido pela visita de Nick Fury (Samuel L. Jackson). Convocado para mais uma missão heróica, ele precisa enfrentar vários vilões que surgem em cidades-símbolo do continente, como Londres, Paris e Veneza, e também a aparição do enigmático Mysterio (Jake Gyllenhaal).', 0, 'matheus', NULL, NULL),
(NULL, 1215, 'Miss Simpatia', 'Miss Congeniality', 'Estados Unidos', 'Comédia, Policial, Ação', 'Donald Petrie', '15475837465c3e410242cc0.jpg', 109, 2000, 'LwrEnPYHsyQ', 'Sandra Bullock, Michael Caine, Benjamin Bratt, Candice Bergen, Heather Burns, Melissa de Sousa', 'Durante toda sua vida Gracie Hart (Sandra Bullock) sonhou em seguir os passos de sua mãe, Emily, uma dedicada agente do FBI que morreu em serviço. Porém, o temperamento agressivo de Gracie sempre lhe trouxe problemas no FBI, fazendo com que ela tenha um único amigo, seu parceiro Eric Matthews (Benjamin Bratt). Quando chega ao FBI a informação de que um grupo terrorista pretende explodir uma bomba durante o concurso de Miss Estados Unidos, logo se decide infiltrar uma agente no concurso, para poder acompanhar de perto os passos dos terroristas. Infelizmente, a única agente disponível é exatamente Gracie Hart, que não gosta nem um pouco da história de ter que se tornar uma miss de uma hora para outra. Para ajudá-la na transformação, o FBI contrata o experiente Victor Malling (Michael Caine), um consultor obsessivo que deve transformar a agressiva Gracie em uma glamourosa candidata a miss, para que ela possa se infiltrar no concurso e descobrir os planos dos terroristas.', 0, 'matheus', NULL, NULL),
(NULL, 1216, 'Miss Simpatia 2 - Armada e Poderosa', 'Miss Congeniality 2: Armed & Fabulous', 'Estados Unidos', 'Comédia, Ação, Policial', 'John Pasquin', '15475839775c3e41e9d5985.jpg', 115, 2005, 'JYy9ncGYXsE', 'Sandra Bullock, Regina King, Enrique Murciano, William Shatner, Diedrich Bader, Heather Burns, Treat Williams, Ernie Hudson', 'Ter combatido uma ameaça em um concurso de miss nos Estados Unidos faz da policial Gracie Hart (Sandra Bullock) uma verdadeira celebridade, o que não a agrada muito, já que a fama repentina a impede de trabalhar sob disfarce. Por causa disto ela é remanejada para realizar a única função que pode fazer ter no momento dentro da corporação policial: percorrer o circuito de programas de TV e ser o \"rosto oficial do FBI\". Relutante de início, aos poucos Gracie passa a aceitar melhor a idéia e até mesmo gostar da atenção que recebe. Chamada de \"Barbie da agência\", especialmente por sua nova parceira Sam Fuller (Regina King), Gracie precisa voltar à ativa quando seus amigos Stan Fields (William Shatner), apresentador de concursos, e Cheryl Frazier (Heather Burns), a vencedora do concurso de miss que participou, são sequestrados em Las Vegas. Sem querer perder Gracie como sendo a imagem da agência, o FBI a envia para uma conferência de imprensa em Las Vegas juntamente com Sam, que tem a função de ser sua guarda-costas. Juntas elas precisam resolver o caso.', 0, 'matheus', NULL, NULL),
(NULL, 1217, 'O Chamado 2', 'Za ringu 2', 'Estados Unidos', 'Terror, Fantasia', 'Hideo Nakata', '15475922015c3e620931465.jpg', 110, 2005, 'FhInLywkYDU', 'Naomi Watts, Simon Baker, David Dorfman, Daveigh Chase, Sissy Spacek, Emily VanCamp, Kelly Stables, Elizabeth Perkins', 'Seis meses após os eventos que aterrorizaram Rachel Keller (Naomi Watts) e seu filho Aidan (David Dorfman), os dois tentam deixar para trás as lembranças de Samara (Daveigh Chase) e sua fita de vídeo amaldiçoada. Rachel e Aidan se mudam de Seattle para a pequena comunidade litorânea de Astoria, no estado de Oregon, onde pretendem recomeçar a vida. Porém, após a ocorrência de um crime local que tem uma fita de vídeo envolvida, Samara retorna para reiniciar seu ciclo de mortes.', 0, 'helena', NULL, NULL),
(NULL, 1218, 'Se a Rua Beale Falasse', 'If Beale Street Could Talk', 'Estados Unidos', 'Drama', 'Barry Jenkins', '15475925355c3e63578cfc7.jpg', 119, 2018, 'nM00AUzMycM', 'Kiki Layne, Stephan James, Regina King, Colman Domingo, Teyonah Parris, Ebony Obsidian, Brian Tyree Henry, Dave Franco, Ed Skrein, Pedro Pascal, Diego Luna', 'Baseado no célebre romance de James Baldwin, o filme acompanha Tish (Kiki Layne), uma grávida do Harlem, que luta para livrar seu marido de uma acusação criminal injusta e de subtextos racistas a tempo de tê-lo em casa para o nascimento de seu bebê.', 0, 'helena', NULL, NULL),
(NULL, 1219, 'Psicopata Americano', 'American Psycho', 'Estados Unidos', 'Suspense, Drama', 'Mary Harron', '15475929315c3e64e3ad968.jpg', 101, 2000, 'uy_IXRhcFmo', 'Christian Bale, Jared Leto, Guinevere Turner, Reese Whiterspoon, Chlöe Sevigny, Willem Dafoe, Samantha Mathis, Justin Theroux, Josh Lucas, Matt Ross, Cara Seymour, Bill Sage', 'Patrick Bateman (Christian Bale) jovem, branco, bonito e sem nada que o diferencie de seus colegas de Wall Street. Protegido pela conformidade, privilégio e riqueza, Bateman também um serial killer, que vaga livremente e sem receios em busca de uma nova vítima. Seus impulsos assassinos são abastecidos por um zeloso materialismo e uma inveja torturante quando ele encontra alguém que possui mais do que ele. Após um colega dar-lhe um cartão de visitas melhor que o seu em tinta e papel, a sede de sangue de Bateman surge e ele aumenta ainda mais suas atividades homicidas, tornando-se um perigoso e violento psicopata.', 0, 'helena', NULL, NULL),
(NULL, 1220, 'Paraísos Artificiais', 'Paraísos Artificiais', 'Brasil', 'Drama', 'Marcos Prado', '15475932135c3e65fd82738.jpg', 96, 2012, '6eCNhpqlA-Y', 'Nathalia Dill, Luca Bianchi, Lívia de Bueno, Bernardo Melo Barreto, César Cardadeiro, Emílio Orciollo Neto, Roney Villela, Divana Brandão, Cadu Fávero, Erom Cordeiro', 'Erika (Nathalia Dill) é uma DJ de relativo sucesso e muito amiga de Lara (Lívia de Bueno). Juntas, durante um festival onde Erika trabalhava, elas conheceram Nando (Luca Bianchi) e, juntos, vivem um momento intenso. Entretanto, logo em seguida o trio se separa. Anos depois Erika e Nando se reencontram em Amsterdã, onde se apaixonam. Só que apenas Erika se lembra do verdadeiro motivo pelo qual eles se afastaram pouco após se conhecerem, anos antes.', 0, 'helena', NULL, NULL),
(NULL, 1221, 'Bruna Surfistinha', 'Bruna Surfistinha', 'Brasil', 'Drama, Biografia', 'Marcus Baldini', '15475935755c3e676798d6d.jpg', 109, 2011, '6txYJMlggw', 'Deborah Secco, Fabíula Nascimento, Cássio Gabus Mendes, Drica Moraes, Cristina Lago, Guta Ruiz, Simone Iliescu, Sérgio Guizé, Clarisse Abujamra, Juliano Cazarré, Brenda Lígia ', 'Raquel (Deborah Secco) era uma jovem da classe média paulistana, que estudava num colégio tradicional da cidade. Um dia ela tomou uma decisão surpreendente: saiu de casa e resolveu virar garota de programa. Com o codinome de Bruna Surfistinha, Raquel viveu diversas experiências \"profissionais\" e ganhou destaque nacional ao contar suas aventuras sexuais e afetivas num blog, que depois acabou virando um livro e tornou-se um best seller.', 0, 'helena', NULL, NULL),
(NULL, 1222, 'Mulheres Alteradas', 'Mulheres Alteradas', 'Brasil', 'Comédia', 'Luis Pinheiro', '15475938405c3e687088ef0.jpg', 95, 2018, 'DFsUilX7Kq4', 'Deborah Secco, Maria Casadevall, Monica Iozzi, Alessandra Negrini, Daniel Boaventura, Sérgio Guizé, João Vicente de Castro, Mário Gomes, Patricya Travassos, Suely Franco', 'O cotidiano de quatro mulheres, cada uma enfrentando problemas bem particulares: Keka (Deborah Secco) enfrenta uma crise no casamento com Dudu (Sérgio Guizé), Marinati (Alessandra Negrini) é uma workaholic que repentinamente se apaixona por Christian (Daniel Boaventura), Leandra (Maria Casadevall) sente-se bastante insegura pelo fato de ainda não ter constituído família e Sônia (Monica Iozzi) está cansada da rotina doméstica e sonha com a época em que era solteira.', 0, 'helena', NULL, NULL),
(NULL, 1223, 'O Operário', 'The Machinist', 'Espanha', 'Suspense', 'Brad Anderson', '15475941165c3e6984e33f9.jpeg', 101, 2004, 'EkNF7MCIy2M', 'Christian Bale, Jennifer Jason Leigh, Aitana Sánchez-Gijón, John Sharian, Michael Ironside, Reg E. Cathey, Anna Massey, Lawrence Gilliard Jr., Craig Stevenson', 'A última vez em que Trevor Reznik (Christian Bale) dormiu foi há um ano, sendo que desde então o cansaço vem destruindo progressivamente sua saúde física e mental. Ele trabalha numa fábrica operando maquinário pesado, e faz de tudo para manter seu emprego. Envergonhado por causa de seu problema, Trevor isola-se cada vez mais, tornando-se paranóico. Depois de se envolver em um acidente no trabalho em que um homem perde um braço, Trevor começa a crer que seus colegas estão conspirando para demiti-lo. Ele precisará lutar não apenas para se manter no cargo, mas também para manter a sanidade.', 0, 'helena', NULL, NULL),
(NULL, 1224, 'O Vencedor', 'The Fighter', 'Estados Unidos', 'Biografia, Drama', 'David O. Russell', '15475943635c3e6a7bb9693.jpg', 116, 2011, 'Wbc_aeLZjCM', 'Mark Wahlberg, Christian Bale, Amy Adams, Melissa Leo, Dicky Eklund, Jack McGee, Kate B. O\'Brien, Jenna Lamia, Erica McDermott, Bianca Hunter, Frank Renzulli, Jill Quigg', 'Dicky Ecklund (Christian Bale) teve seu auge ao enfrentar o campeão mundial Sugar Ray Leonard em uma luta de boxe, colocando a pequena cidade de Lowell no mapa. Até hoje ele vive desta fama, apesar de ter desperdiçado a carreira devido às drogas. Micky Ward (Mark Wahlberg), seu irmão, tenta agora a sorte no mundo do boxe, sendo treinado por Dicky e empresariado por Alice (Melissa Leo), sua mãe. Só que a família sempre o coloca em segundo plano em relação a Dicky, o que impede que Micky consiga ascender no esporte. A situação muda quando ele passa a namorar Charlene Fleming (Amy Adams), que o incentiva a deixar a influência familiar e tratar a carreira de forma mais profissional.', 0, 'helena', NULL, NULL),
(NULL, 1225, 'Filho de Saul', 'Saul Fia', 'Hungria', 'Guerra, Drama, Suspense', 'László Nemes', '15475945875c3e6b5ba1805.jpg', 107, 2015, 'BI1UYT33txk', 'Géza Röhrig, Sándor Zsótér, Levente Molnár, Urs Rechn, Marcin Czarnik, Jerzy Walczak, Todd Charmont, Christian Harting', '1944, campo de concentração de Auschwitz, durante a Segunda Guerra Mundial. Saul (Géza Röhrig) é um judeu obrigado a trabalhar para os nazistas, sendo um dos responsáveis em limpar as câmaras de gás após dezenas de outros judeus serem mortos. Em meio à tensão do momento e às dificuldades inerentes desta tarefa, ele reconhece entre os mortos o corpo de seu próprio filho.', 0, 'helena', NULL, NULL),
(NULL, 1226, 'O Grande Truque', 'The Prestige', 'Estados Unidos', 'Suspense, Drama', 'Christopher Nolan', '15475948475c3e6c5feac59.jpg', 130, 2006, 'X_taFutSQHw', 'Hugh Jackman, Christian Bale, Michael Caine, Piper Perabo, Scarlett Johansson, David Bowie, Rebecca Hall, Andy Serkis, Samantha Mahurin, Roger Rees, Ricky Jay, Daniel Davis', 'Século XIX, Londres. Robert Angier (Hugh Jackman) e Alfred Borden (Christian Bale) se conhecem há muitos anos, desde que eram mágicos iniciantes. Desde então eles vivem competindo entre si, o que faz com que a amizade com o passar dos anos se transforme em uma grande rivalidade. Quando Alfred apresenta uma mágica revolucionária, Robert fica obcecado em descobrir como ele consegue realizá-la.', 0, 'helena', NULL, NULL),
(NULL, 1227, 'Hostiles', 'Hostiles', 'Estados Unidos', 'Faroeste, Drama', 'Scott Cooper', '15475951895c3e6db59af4c.jpg', 134, 2017, 'OxBy4qc9FPE', 'Christian Bale, Rosamund Pike, Wes Studi, Timothée Chalamet, Rory Cochrane, Q\'orianka Kilcher, Ben Foster, Ryan Bingham, Jesse Plemons, Scott Wilson, Tanaya Beatty ', 'Em 1892, duas famílias se unem ao chefe de um exército (Christian Bale) para ultrapassar as barreiras de uma guerra e voltar para suas tribos. Esta tarefa não será fácil, visto que os membros das família tem, entre si, conflitos que devem ser superados para terem sucesso em sua missão. ', 0, 'helena', NULL, NULL),
(NULL, 1228, 'Tudo por Justiça', 'Out of the Furnace', 'Estados Unidos', 'Drama, Suspense', 'Scott Cooper', '15475965365c3e72f8b1667.jpg', 116, 2013, '1rBJrWquHHQ', 'Christian Bale, Woody Harrelson, Casey Affleck, Zoë Saldaña, Forest Whitaker, Sam Shepard, Willem Dafoe, Tom Bower, Boyd Holbrook, Bingo O\'Malley, Jack Erdie', 'Russell Baze (Christian Bale) trabalha em uma usina e mora com o pai (Bingo O. Malley), que enfrenta sérios problemas de saúde, e o irmão mais novo, Rodney (Casey Affleck), que lutou na Guerra do Iraque. Um dia, Russell se envolve em um acidente de carro onde uma criança acaba falecendo, o que faz com que seja preso. Ao sair ele retoma a vida de antes, trabalhando novamente na usina. Entretanto, Rodney se recusa a levar a mesma vida do irmão e do pai. Querendo ganhar dinheiro, ele passa a fazer lutas clandestinas e acaba se envolvendo com um homem violento e bastante perigoso: Harlan DeGroat (Woody Harrelson).', 0, 'helena', NULL, NULL),
(NULL, 1229, 'O Sobrevivente', 'Rescue Dawn', 'Estados Unidos', 'Guerra, Drama', 'Werner Herzog', '15475967765c3e73e8822a0.jpg', 120, 2006, 'dRFNdk37uxU', 'Christian Bale, Zach Grenier, Marshall Bell, Toby Huss, Steve Zahn, Jeremy Davies, Pat Healy, François Chau, Teerawat Mulvilai, Craig Gellis, Yuttana Muenwaja', 'Dieter Dengler (Christian Bale) é um piloto alemão que integra a marinha americana durante a Guerra do Vietnã. Em uma de suas missões seu avião cai no Laos, o que o torna um prisioneiro de guerra. Brutalmente torturado, Dengler tenta planejar com outros prisioneiros, americanos e vietnamitas, um plano de fuga.', 0, 'helena', NULL, NULL),
(NULL, 1230, 'Tô Ryca', 'Tô Ryca!', 'Brasil', 'Comédia', 'Pedro Antônio', '15477415885c40a994608ce.jpg', 108, 2015, 'GIg8IZettZ4', 'Samantha Schmütz, Marcelo Adnet, Marília Pêra, Katiuscia Canoro, Anderson Di Rizzi, Fabiana Karla, Marcelo Melo Jr., Marcus Majella', 'Selminha (Samantha Schmütz) é uma frentista que tem a chance de deixar seus dias de pobreza para trás ao descobrir uma herança de família. Mas para conseguir colocar a mão nessa grana, ela terá que cumprir o desafio lançado por seu tio: precisa gastar R$ 30 milhões em 30 dias, sem acumular nada e nem contar para ninguém. Mas, nessa louca maratona, ela vai acabar descobrindo que tem coisas que o dinheiro não compra.', 0, 'matheus', NULL, NULL),
(NULL, 1231, 'Vidro', 'Glass', 'Estados Unidos', 'Drama, Suspense, Ficção Científica, Fantasia', 'M. Night Shyamalan', '15477420645c40ab704b0ea.jpg', 129, 2019, '6w7qWcCbkks', 'Anya Taylor-Joy, James McAvoy, Sarah Paulson, Bruce Willis, Samuel L. Jackson, Charlayne Woodard, Spencer Treat Clark, Luke Kirby', 'Após a conclusão de Fragmentado (2017), Kevin Crumb (James McAvoy), o homem com 24 personalidades diferentes, passa a ser perseguido por David Dunn (Bruce Willis), o herói de Corpo Fechado (2000). O jogo de gato e rato entre o homem inquebrável e a Fera é influenciado pela presença de Elijah Price (Samuel L. Jackson), que manipula seus encontros e guarda segredos sobre os dois.', 0, 'matheus', NULL, NULL),
(NULL, 1232, 'Como Treinar o Seu Dragão 3', 'How to Train Your Dragon: The Hidden World', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia', 'Dean DeBlois', '15477433605c40b080342ff.jpg', 94, 2019, '016gjN4alcg', 'Jay Baruchel, America Ferrera F. Murray Abraham, Cate Blanchett, Kit Harington, Craig Ferguson, Jonah Hill, Chistopher Mindz-Plasse', 'Soluço tem um grande sonho: encontrar um lar onde os dragões possam viver em paz. Mas, no meio deste plano, o perigo começa a rondar a sociedade viking quando o vilão Grimmel aparece para acabar com a liberdade dos dragões - especialmente Banguela.', 0, 'matheus', NULL, NULL),
(NULL, 1233, 'Como Treinar o Seu Dragão', 'How to Train Your Dragon', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia', 'Dean DeBlois, Chris Sanders', '15477439605c40b2d82529a.jpg', 98, 2010, 'jwuGN9v_MRQ', 'Jay Baruchel, Gerald Butler, America Ferrera, Kristen Wiig, Jonah Hill, Chistopher Mindz-Plasse, T.J. Miller, Craig Ferguson', 'Na ilha de Berk, os vikings dedicam a vida a combater e matar dragões. Soluço (Jay Baruchel), filho do chefe Stoico (Gerard Butler), não é diferente. Ele sonha em matar um dragão e provar seu valor ao pai, apesar da descrença geral. Um dia, por acaso, ele acerta um dragão que jamais foi visto, chamado Fúria da Noite. Ao procurá-lo, no dia seguinte, Soluço não consegue matá-lo e acaba soltando-o. Só que ele perdeu parte da cauda e, com isso, não consegue mais voar. Soluço passa a trabalhar em um artefato que possa substituir a parte perdida e, aos poucos, se aproxima do dragão. Só que, paralelamente, Stoico autoriza que o filho participe do treino para dragões, cuja prova final é justamente matar um dos animais.', 0, 'matheus', NULL, NULL),
(NULL, 1234, 'O Peso do Passado', 'Destroyer', 'Estados Unidos', 'Policial, Suspense, Drama', 'Karyn Kusama', '15478413635c422f537fcec.jpg', 120, 2019, '9K8yXMO6Tfw', 'Nicole Kidman, Toby Kebbell, Tatiana Maslany, Sebastian Stan, Scoot McNairy, Bradley Whitford, Toby Huss, Beau Knapp', 'Erin Bell (Nicole Kidman) é uma detetive da polícia norte-americana que aceita participar de um plano arriscado, infiltrando-se entre bandidos para obter informações. A estratégia dá errado, gerando uma tragédia que marca a sua vida para sempre. Anos mais tarde, ela reencontra pistas da gangue de antigamente, e volta a perseguir os responsáveis por seu drama pessoal.', 0, 'matheus', NULL, NULL),
(NULL, 1235, 'Terror em Amityville', 'The Amityville Horror', 'Estados Unidos', 'Drama, Terror, Mistério', 'Andrew Douglas', '15478569565c426c3c5d384.jpg', 90, 2005, 'ax3REUfu3Xw', 'Ryan Reynolds, Melissa George, Jesse James, Jimmy Bennett', 'Em 13 de novembro de 1974 a polícia do condado de Sufolk recebeu uma chamada telefônica que a levou ao endereço 112 Ocean Avenue, Amityville, Long Island. Dentro da casa a polícia encontrou um crime brutal: o assassinato de uma família inteira enquanto dormia. Poucos dias depois, Ronald Defeo Jr. (Brendan Donaldson) admitiu que usou um rifle para matar os pais e seus 4 irmãos, alegando ter ouvido vozes que vinham de dentro da casa e que o influenciaram a cometer os crimes. Um ano depois George (Ryan Reynolds) e Kathy (Melissa George) se mudam com os filhos para a antiga casa dos Defeo. Não demora muito para que estranhos eventos comecem a acontecer, afetando a vida da família e indicando que uma presença maligna está oculta na casa.', 0, 'iris', NULL, NULL),
(NULL, 1237, 'Poderia Me Perdoar?', 'Can You Ever Forgive Me?', 'Estados Unidos', 'Biografia, Comédia, Drama', 'Marielle Heller', '15479300885c4389e8bb641.jpg', 106, 2018, 'ISR_9pHqASU', 'Melissa McCarthy, Richard E. Grant, Dolly Wells, Jane Curtin, Ben Falcone, Stephen Spinella, Anna Deavere Smith, Christian Navarro, Marc Evan Jackson,', 'Passando por problemas financeiros, a jornalista Lee Israel decide forjar e vender cartas de personalidades já falecidas, um negócio criminoso que dá muito certo. Quando as primeiras suspeitas começam, para não parar de lucrar, ela modifica o esquema e passa a roubar os textos originais de arquivos e bibliotecas. Baseado em uma história real.', 0, 'matheus', NULL, NULL),
(NULL, 1238, 'Mirai', 'Mirai', 'Japão', 'Animação, Aventura, Família', 'Mamoru Hosoda', '15479508475c43daff5208b.jpg', 98, 2018, 'WjNXgMr3Q1s', 'Haru Kuroki, Moka Kamishiraishi, Gen Hoshino, Kôji Yakusho', 'Kun é um menino com uma infância feliz até a chegada de Mirai, sua irmãzinha. Com ciúmes desse bebê que monopoliza a atenção dos pais, ele vai se retraindo pouco a pouco. No fundo do seu jardim, o menino embarca em um mundo fantástico, onde o passado e o futuro se misturam. Lá, ele conhece seus parentes em diferentes idades da vida: sua mãe ainda criança, seu bisavô na juventude e sua pequena irmã na adolescência. Através dessas aventuras, Kun vai descobrir sua própria história.', 0, 'helena', NULL, NULL),
(NULL, 1239, 'Cafarnaum', 'Capernaum', 'Líbano', 'Drama', 'Nadine Labaki', '15479516895c43de497b426.jpg', 121, 2018, 'owtmu-YrfQQ', 'Zain Al Rafeea, Yordanos Shiferaw, Boluwatife Treasure Bankole, Kawthar Al Haddad, Nadine Labaki', 'Aos doze anos, Zain (Zain Al Rafeea) carrega uma série de responsabilidades: é ele quem cuida de seus irmãos no cortiço em que vive junto com os pais, que estão sempre ausentes graças ao trabalho em uma marcearia. Quando sua irmã de onze é forçada a se casar com um homem mais velho, o menino fica extremamente revoltado e decide deixar a família. Ele passa a viver nas ruas junto aos refugiados e outras crianças que, diferentemente dele, não chegaram lá por conta própria.', 0, 'helena', NULL, NULL),
(NULL, 1240, 'Girl', 'Girl', 'Bélgica', 'Drama, LGBT', 'Lukas Dhont', '15479522675c43e08bbf39c.jpg', 109, 2018, 'KF1GQAhbWqc', 'Victor Polster, Arieh Worthalter, Oliver Bodart, Tijmen Govaerts, Katelijne Damen, Valentijn Dhaenens', 'Lara (Victor Polster) é uma jovem menina de quinze anos, seu maior sonho é tornar-se uma bailarina profissional e, com a ajuda do pai, ela busca uma nova escola de dança para desenvolver sua técnica. No entanto, a menina encontra dificuldades para adaptar-se aos movimentos executados nas aulas por conta de sua estrutura óssea e muscular, já que Lara nasceu no corpo de um menino.', 0, 'helena', NULL, NULL),
(NULL, 1241, 'Guerra Fria', 'Cold War', 'Polônia', 'Drama, Romance', 'Paweł Pawlikowski', '15479526835c43e22be52ce.jpg', 88, 2018, 'xq-tu6ZbmmI', 'Joanna Kulig, Tomasz Kot, Borys Szyc, Agata Kulesza, Jeanne Balibar, Cédric Kahn, Aloïse Sauvage, Adam Woronowicz, Adam Ferency', 'Durante a Guerra Fria entre a Polônia stalinista e a Paris boêmia dos anos 50, um músico amante da liberdade e uma jovem cantora com histórias e temperamentos completamente diferentes vivem um amor impossível.', 0, 'helena', NULL, NULL),
(NULL, 1242, 'Nunca Deixe de Sonhar', 'Werk ohne Autor', 'Alemanha', 'Drama, Suspense', 'Florian Henckel von Donnersmarck', '15479533575c43e4cd565a9.jpg', 188, 2018, 'Q0LSca0ZgVw', 'Tom Schilling, Sebastian Koch, Paula Beer, Saskia Rosendahl, Lars Eidinger, Oliver Masucci, Franz Pätzold, Hanno Kloffer, Jonas Dassler, Ina Weisse', 'Kurt Barnert (Tom Schilling) é um artista alemão que conseguiu escapar da Alemanha Oriental. Agora, ele vive seus dias na Alemanha Ocidental, mas ainda assim é atormentado pelos traumas da sua infância sob o regime dos nazistas e da República Democrata Alemã (RDA).', 0, 'helena', NULL, NULL),
(NULL, 1243, 'Ayka', 'Ayka', 'Rússia', 'Drama', 'Sergei Dvortsevoy', '15479535145c43e56a54fe8.jpg', 100, 2018, 'PsKZzGWvJW4', 'Samal Yeslyamova, Aleksandr Zlatopolskiy, Polina Severnaya, Andrey Kolyadov', 'Ayka (Samal Yeslyamova) é uma jovem de origem cazaque, que vive ilegalmente em Moscou. Ela dá à luz num hospital local, mas abandona o seu filho por medo de ser descoberta e deportada. Logo depois, ela enfrenta as complicações pós-parto, a fome, a solidão, a falta de emprego e a perseguição da máfia local, a quem deve dinheiro. Um dia, os mafiosos exigem que Ayka volte ao hospital, recupere o bebê e entregue a eles.', 0, 'helena', NULL, NULL),
(NULL, 1244, 'IO', 'IO', 'Estados Unidos', 'Adventure, Drama, Romance, Sci-Fi', 'Jonathan Helpert', '15480054255c44b0312f69e.jpg', 0, 2019, 'https://www.youtube.com/watch?v=EOFSf8EQhXY', 'Anthony Mackie, Margaret Qualley, Danny Huston', 'Em uma Terra pós-apocalíptica, Sam, uma adolescente, é uma das últimas pessoas no planeta, que está sendo evacuado. Com o último transporte programado para deixar o planeta, ela precisa decidir entre se juntar ao restante da humanidade ou permanecer na Terra.', 0, 'raissa', NULL, NULL),
(NULL, 1245, 'Ícaro', 'Icarus', 'Estados Unidos', 'Documentário', 'Bryan Fogel', '15480199785c44e90ac83f8.jpg', 120, 2017, 'vYN5QM2OPjs', 'Thomas Bach, Sebastian Coe, Bryan Fogel, Nikita Kamaev, Grigory Rodchenkov, Vladimir Putin', 'Quando o ciclista amador Bryan Fogel começa a descobrir a verdade sobre o doping nos esportes, decide entrar de cabeça num experimento ousado para comprovar a incompetência do método de controle dos atletas. Sua investida, no entanto, transforma-se em algo muito maior quando o médico russo que o orienta no processo se vê no centro de um enorme escândalo que compromete os resultados das últimas Olimpíadas de verão e inverno e envolve até a temida agência russa de segurança.', 0, 'helena', NULL, NULL),
(NULL, 1246, 'Tito e os Pássaros', 'Tito e os Pássaros', 'Brasil', 'Animação', 'Gustavo Steinberg, Gabriel Bitar, André Catoto Dias', '15480203045c44ea50b5274.jpg', 73, 2018, 'b7jb5L8GoSA', 'Denise Fraga, Mateus Solano, Matheus Nachtergaele', 'O filme conta a história de um menino que é responsável, junto com seu pai, por achar a cura para uma doença que é contraída após a pessoa tomar um susto.', 0, 'helena', NULL, NULL),
(NULL, 1248, 'Best Player: Guerreiros Virtuais', 'Best Player', 'Estados Unidos', 'Comédia', 'Damon Santostefano', '15480206805c44ebc8016b0.jpg', 83, 2011, '9f0KhrzJe7A', 'Jerry Trainor, Jennette McCurdy, Amir Talai, Janet Varney, Jean-Luc Bilodeau, Nick Benson', 'Quincy (Jerry Trainor) se achava o maioral em um jogo de video game online até conhecer \"Prodigy\" (Jennette McCurdy), uma adolescente que se mostra uma adversária à altura. A rivalidade entre os dois se acirra quando uma grande quantia em dinheiro é posta à prêmio no game.', 0, 'helena', NULL, NULL),
(NULL, 1249, 'Eu Estava Justamente Pensando em Você', 'Comet', 'Estados Unidos', 'Romance, Comédia, Fantasia', 'Sam Esmail', '15480209615c44ece115158.jpg', 91, 2014, 'QFJ9rlnbflI', 'Justin Long, Kayla Servi, Eric Winter, Emmy Rossum, Lou Beatty Jr., Ben Pace, Nicole Lucas, Derrick Dean, Sheridan Stone', 'Em um universo paralelo, Kimberly (Emmy Rossum) e Dell (Justin Long) têm um encontro ao acaso enquanto estão assistindo a uma chuva de meteoros. Os dois viajam no tempo ao longo de seis anos de sua história de amor, revivendo uma relação apaixonada e complicada.', 0, 'helena', NULL, NULL),
(NULL, 1250, 'O Amor É Cego', 'Shallow Hal', 'Estados Unidos', 'Comédia', 'Bobby Farrelly, Peter Farrelly', '15480212075c44edd750927.jpg', 114, 2001, 'Lb4Apgcj2Gs', 'Gwyneth Paltrow, Jack Black, Jason Alexander, Joe Viterelli, Tony Robbins, Susan Ward, Brooke Burns, Rene Kirby, Bruce McGill, Kyle Gass, Joshua Shintani', 'Hal (Jack Black) é um homem que segue à risca o conselho de seu pai e apenas se interessa por mulheres que tenham um físico perfeito. Mas tudo muda quando ele por acaso se encontra com Anthony Robbins, um guru de auto-ajuda que o hipnotiza e faz com que ele apenas possa visualizar a beleza interior das mulheres, em detrimento de seu físico. Sem saber que está sob o efeito de hipnose, Hal então se apaixona por Rosemary (Gwyneth Paltrow), uma mulher obesa que é vista por ele como se fosse uma verdadeira deusa. Até que, após ser retirado da hipnose por seu amigo Mauricio (Jason Alexander), ele passa a ver como Rosemary é de verdade fisicamente e precisa tomar uma decisão sobre seu relacionamento com ela.', 0, 'helena', NULL, NULL),
(NULL, 1251, 'Amor', 'Amour', 'França', 'Drama, Romance', 'Michael Haneke', '15480214325c44eeb88a1b9.jpg', 127, 2012, 'ivIM6a1lnlk', 'Jean-Louis Trintignant, Emmanuelle Riva, Isabelle Huppert, Alexandre Tharaud, William Shimell, Rita Blanco, Laurent Capelluto, Ramon Agirre', 'Georges (Jean-Louis Trintignant) e Anne (Emmanuelle Riva) são um casal de aposentados apaixonados por música. Eles têm uma filha musicista que vive em outro país. Certo dia Anne sofre um derrame e fica com um lado do corpo paralisado. O casal de idosos passa por graves obstáculos que colocarão o seu amor em teste.', 0, 'helena', NULL, NULL),
(NULL, 1252, 'No Coração da Escuridão', 'First Reformed', 'Estados Unidos', 'Drama, Suspense', 'Paul Schrader', '15480217145c44efd28fc51.jpg', 113, 2018, 'TCWbBsyvPLE', 'Ethan Hawke, Amanda Seyfried, Cedric the Entertainer, Victoria Hill, Philip Ettinger, Michael Gaston, Krystina Alabado, Bill Hoag, Van Hansis, Kristin Villanueva', 'O ex-militar capelão Toller (Ethan Hawke) sofre pela perda do filho que ele encorajou a se alistar nas forças armadas. Um outro desafio começa quando ele faz amizade com a jovem paroquiana Mary (Amanda Seyfried) e seu marido, que é um ambientalista radical. Toller logo descobre segredos escondidos de sua igreja com relação a empresas inescrupulosas.', 0, 'helena', NULL, NULL),
(NULL, 1253, 'Depois da Terra', 'After Earth', 'Estados Unidos', 'Ação, Ficção Científica', 'M. Night Shyamalan', '15480221715c44f19b77fd4.jpg', 100, 2013, 'E4cG9dEcOS0', 'Jaden Smith, Will Smith, Sophie Okonedo, Zoë Kravitz, Kristofer Hivju, David Denman, Lincoln Lewis, Chris Geere, Sacha Dhawan, Glenn Morshower', 'Há 1000 anos, um cataclismo tornou a Terra um lugar hostil e forçou os humanos a se abrigarem no planeta Nova Prime, morando em naves espaciais. Depois de uma missão, o general Cypher Raige (Will Smith) retorna à sua família e ao filho de treze anos de idade (Jaden Smith). Mas pouco tempo após seu retorno, uma chuva de asteroides faz com que a nave onde moram caia na Terra. Com o pai correndo risco de morte, o jovem adolescente deverá aprender sozinho a domar este planeta, encontrando água, comida e cuidando de seu pai.', 0, 'helena', NULL, NULL),
(NULL, 1254, 'Oblivion', 'Oblivion', 'Estados Unidos', 'Ação, Ficção Científica', 'Joseph Kosinski', '15480225095c44f2ed3146e.jpg', 124, 2013, 'OoXVaWrjNjM', 'Tom Cruise, Morgan Freeman, Olga Kurylenko, Andrea Riseborough, Nikolaj Coster Waldau, Melissa Leo, Zoë Bell, Abigail Lowe, Isabelle Lowe', 'Contextualizado no ano de 2077. Jack Harper (Tom Cruise) é o responsável pela manutenção de equipamentos de segurança em um planeta Terra irreconhecível, visto que a superfície foi destruída devido a confrontos com uma raça alienígena. O que restou da humanidade vive hoje em uma colônia lunar. Jack irá para este local daqui a duas semanas, já que está perto de terminar seu trabalho na Terra. Só que, um dia, ele encontra uma espaçonave que traz uma mulher dentro. Ao conhecê-la, tudo o que Jack sabe até então é posto em dúvida. É o início de uma jornada onde ele precisará descobrir o que realmente aconteceu no passado.', 0, 'helena', NULL, NULL),
(NULL, 1255, 'Star Trek', 'Star Trek', 'Estados Unidos', 'Ficção Científica, Ação, Aventura', 'J.J. Abrams', '15480228505c44f4429b7cb.jpg', 127, 2009, 'Alx4THIhFHI', 'Chris Pine, Zachary Quinto, Leonard Nimoy, Eric Bana, Zoë Saldaña, Simon Pegg, Karl Urban, Anton Yelchin, Chris Hemsworth, John Cho, Winona Ryder, Jennifer Morrisson, Bruce Greenwood, Rachel Nichols', 'James Tiberious Kirk (Chris Pine) é um jovem rebelde inconformado com a morte de seu pai. Certo dia, recebe convite para fazer parte da formação de novos cadetes para a Frota Estelar. Uma vez lá conhece Spock (Zachary Quinto), um vulcano que optou por deixar seu planeta porque é metade humano e discordava do preconceito. Durante o treinamento, e também na primeira missão, os dois vivenciam novas experiências provocadas por seus estilos diametralmente opostos. Assim, Spock, o cerebral, e Kirk, o passional, viverão uma grande aventura ao lado de outros tradicionais integrantes da tripulação da U.S.S. Enterprise, a mais avançada nave espacial da época.', 0, 'helena', NULL, NULL),
(NULL, 1256, 'Além da Escuridão - Star Trek', 'Star Trek Into Darkness', 'Estados Unidos', 'Ficção Científica, Ação, Aventura', 'J.J. Abrams', '15480234775c44f6b57cfed.jpg', 132, 2013, 'hqk73zflryw', 'Chris Pine, Zachary Quinto, Zoë Saldaña, Karl Urban, Benedict Cumberbatch, Simon Pegg, Alice Eve, John Cho, Anton Yelchin, Bruce Greenwood, Peter Weller, Noel Clarke, Chris Hemsworth, Jennifer Morrisson, Amanda Foreman, Nazneen Contractor', 'Em sua nova missão, a tripulação da nave Enterprise é enviada para um planeta primitivo, que está prestes a ser destruído devido à erupção de um vulcão. Spock (Zachary Quinto) é enviado para dentro do vulcão, onde deve deixar um dispositivo que irá congelar a lava incandescente. Entretanto, problemas inesperados fazem com que ele fique preso dentro do vulcão, sem ter como sair. Para salvá-lo, James T. Kirk (Chris Pine) ordena que a Enterprise saia de seu esconderijo no fundo do mar, o que faz com que a nave seja vista pelos seres primitivos que habitam o planeta. Esta é uma grave violação das regras da Frota Estelar, o que faz com que Kirk perca o comando da nave para o capitão Pike (Bruce Greenwood). A situação muda por completo quando John Harrison (Benedict Cumberbatch), um renegado da Frota Estelar, coordena um ataque a uma biblioteca pública, que oculta uma importante base da organização. Não demora muito para que Kirk seja reconduzido ao posto de capitão da Enterprise e enviado para capturar Harrison em um planetóide dentro do império klingon, que está à beira de uma guerra com a Federação.', 0, 'helena', NULL, NULL),
(NULL, 1258, 'Star Trek: Sem Fronteiras', 'Star Trek: Beyond', 'Estados Unidos', 'Ficção Científica, Ação, Aventura', 'Justin Lin', '15480238255c44f811f1c92.jpg', 122, 2016, 'P2gF-i-Pw1A', 'Chris Pine, Zachary Quinto, Karl Urban, Zoë Saldaña, Idris Elba, Simon Pegg, John Cho, Anton Yelchin, Sofia Boutella, Doug Jung, Lydia Wilson, Shohreh Aghdashloo, Deep Roy, Jeff Bezos, Joe Taslim, Melissa Roxburgh', 'Desta vez, Kirk (Chris Pine), Spock (Zachary Quinto) e a tripulação da Enterprise encontram-se no terceiro ano da missão de exploração do espaço prevista para durar cinco anos. Eles recebem um pedido de socorro que acaba os ligando ao maléfico vilão Krall (Idris Elba), um insurgente anti-Frota Estelar interessado em um objeto de posse do líder da nave. A Enterprise é atacada, e eles acabam em um planeta desconhecido, onde o grupo acaba sendo dividido em duplas.', 0, 'helena', NULL, NULL),
(NULL, 1259, 'Jornada nas Estrelas V - A Fronteira Final ', 'Star Trek V: The Final Frontier', 'Estados Unidos', 'Ficção Científica, Ação', 'William Shatner', '15480243595c44fa2750139.jpg', 107, 1989, '9e7NPevM3-A', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Harve Bennett, Nichelle Nichols, Walter Koening, Laurence Luckinbill, David Warner, Cynthia Gouw', 'A tripulação da Enterprise ganha uma licença, enquanto sua nave está em reparos. De repente, ela é convocada para resgatar três reféns no planeta Nimbus III. Lá chegando, a Enterprise é seqüestrada pelo grupo revoltoso comandado pelo meio-irmão de Spock, que quer a nave para atravessar a Grande Barreira, onde acredita encontrar todas as respostas sobre as origens do Universo.', 0, 'helena', NULL, NULL),
(NULL, 1260, 'Jornada nas Estrelas VI: A Terra Desconhecida', 'Star Trek VI: The Undiscovered Country', 'Estados Unidos', 'Ficção Científica, Ação, Aventura', 'Nicholas Meyer', '15480246385c44fb3e366a3.jpg', 110, 1991, '6BeSr90LYEA', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, Walter Koenig, George Takei, Nichelle Nichols, Christopher Plummer, Kim Cattrall, David Warner, Michael Dorn, Mark Lenard, Brock Peters, Grace Lee Whitney', 'Após a explosão da lua Praxis os klingons são obrigados a propor um acordo de paz, para garantir a sobrevivência de sua espécie. A tripulação da Enterprise é convocada a escoltar a missão diplomática klingoniana até o local a reunião, mas a nave klingon é atacada e o seu chanceler acaba sendo morto. E tudo indica que o ataque partiu justamente da Enterprise.', 0, 'helena', NULL, NULL),
(NULL, 1261, 'Jornada nas Estrelas - Insurreição', 'Star Trek: Insurrection', 'Estados Unidos', 'Ficção Científica, Ação, Aventura', 'Jonathan Frakes', '15480249285c44fc60762d6.jpg', 103, 1998, 'Qf30YUW-x8A', 'Patrick Stewart, Jonathan Frakes, Brent Spiner, LeVar Burton, Marina Sirtis, Michael Dorn, Gates McFadden, Donna Murphy, F. Murray Abraham, Anthony Zerbe, Gregg Henry, Michael Welch, Stephanie Niznik', 'Durante uma missão no pacífico planeta Ba\'ku, Data (Brent Spiner) descobre algo que pode ameaçar esta civilização. Apesar da Primeira Diretiva da Federação ser clara ao dizer que nenhuma missão da Starfleet pode interferir em outras culturas, o capitão Jean-Luc Picard (Patrick Stewart) recebe ordem do almirante Matthew Dougherty (Anthony Zerbe) de não interferir no plano, que pretende remover à força os sescentos habitantes de Ba\'ku, pois lá existe uma radiação regenerativa que mantêm todos jovens. O argumento que Dougherty dá para Picard é que esta mesma radiação vai beneficiar bilhões de pessoas, e não apenas algumas poucas centenas. Ele também alega que a Primeira Diretiva não se aplica neste caso em especial, pelo fato dos habitantes de Ba\'ku serem de outra planeta. Mas estes argumentos não convencem Picard, que sabe que ao desobedecer uma ordem superior colocará em risco sua vida e sua carreira, mas, apoiado por sua tripulação, decide comandar uma revolta para preservar aquele paraíso.', 0, 'helena', NULL, NULL),
(NULL, 1262, 'Jornada nas Estrelas: Nêmesis', 'Star Trek: Nemesis', 'Estados Unidos', 'Ficção Científica  ', 'Stuart Baird', '15480252285c44fd8c567d1.jpg', 116, 2002, 'ml8ojH38xBI', 'Patrick Stewart, Jonathan Frakes, Brent Spiner, LeVar Burton, Tom Hardy, Stuart Baird, Marina Sirtis, Michael Dorn, Gates McFardden, Kate Mulgrew, Wil Wheaton, Ron Pearlman, Dina Meyer, Shannon Cochran, Alan Dale', 'O capitão Jean-Luc Picard (Patrick Stewart) e a tripulação da Enterprise são enviados em uma missão diplomática de paz rumo ao planeta Romulus. Lá eles precisam deter uma rebelião liderada por Shinzou (Tom Hardy), que ameaça destruir a Terra, bem como enfrentar uma perigosa réplica do próprio capitão Picard.', 0, 'helena', NULL, NULL),
(NULL, 1263, 'Jornada nas Estrelas - O Filme', 'Star Trek: The Motion Picture', 'Estados Unidos', 'Ficção Científica, Suspense', 'Robert Wise', '15480254985c44fe9aaf43c.jpg', 132, 1979, 'HvZ_z9cTs0w', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Walter Koenig, Nichelle Nichols, Majel Barrett-Roddenberry, Persis Khambatta, Stephen Collins, Mark Lenard, Grace Lee Whitney', 'Um fenômeno alienígena de poder e tamanho descomunal se aproxima da Terra, destruindo tudo em seu caminho. A única nave que pode enfrentar esta força letal que ameaça a Terra é a U.S.S. Enterprise. O lendário comandante James T. Kirk (William Shatner) é convocado para a missão, mas um perigo não previsto pode destruir a U.S.S. Enterprise e toda a sua tripulação.', 0, 'helena', NULL, NULL),
(NULL, 1264, 'Jornada nas Estrelas ll - A Ira de Khan', 'Star Trek II: The Wrath of Khan', 'Estados Unidos', 'Ficção Científica, Ação', 'Nicholas Meyer', '15480269425c45043e4e12c.jpg', 113, 1982, 'iKXmEjRsm7I', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, Ricardo Montalbán, Walter Koenig, George Takei, Nichelle Nichols, Bibi Besch, Merritt Butrick, Paul Winfield', 'Enquanto o almirante James T. Kirk e capitão Spock observam os cadetes da Academia da Frota Estelar, outra embarcação da Federação dos Planetas Unidos está prestes a testar o dispositivo Genesis para criar um planeta em uma parte deserta do espaço. No processo, dois dos oficiais de Kirk são capturados por Khan. Mais uma vez, Kirk assume o comando da Enterprise e encontra a nave de Khan em um confronto intergaláctico.', 0, 'helena', NULL, NULL),
(NULL, 1266, 'Jornada nas Estrelas III - À Procura de Spock', 'Star Trek III: The Search for Spock', 'Estados Unidos', 'Ficção Científica', 'Leonard Nimoy', '15480280245c450878a12c5.jpg', 105, 1984, '47X-50bf8gE', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Harve Bennett, Robin Curtis, Walter Koenig, Nichelle Nichols, Christopher Llyod, Merritt Butrick, Mark Lenard, Robert Hooks', 'O comandante James T. Kirk derrotou seu arqui-inimigo, mas a grande custo. Seu amigo Spock aparentemente foi assassinado, a USS Enterprise está sendo destruída e o Dr. Leonard McCoy ficou doente. O comportamento estranho de McCoy é uma evidência de que ele está abrigando o \"katra\" de Spock e Kirk tenta levar a Enterprise de volta ao planeta Gênesis para encontrar seu amigo. Rejeitado, Kirk toma uma decisão dramática que resulta em uma guerra mortal com os Klingons.', 0, 'helena', NULL, NULL),
(NULL, 1267, 'Jornada nas Estrelas IV - A Volta para Casa', 'Star Trek IV: The Voyage Home', 'Estados Unidos', 'Ficção Científica, Aventura', 'Leonard Nimoy', '15480283775c4509d93e0a0.jpg', 119, 1986, 'w1RHbqXuDWs', 'William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Walter Koenig, Nichelle Nichols, Catherine Hicks, Mark Lenard, Jane Wyatt, Brock Peters, Robin Curtis, John Schuck, Grace Lee Whitney', 'Vivendo exilados no planeta Vulcão, a tripulação da antiga nave USS Enterprise rouba uma nave estelar quando recebe um chamado de socorro planetário vindo da Terra, informando que uma sonda, controlada por uma entidade alienígena, entrou em órbita em volta do planeta e está evaporando os oceanos. O capitão Kirk, Spock e o resto da tripulação viajam no tempo para recuperar as baleias já extintas para elas responderem ao chamado da entidade.', 0, 'helena', NULL, NULL),
(NULL, 1268, 'Jornada nas Estrelas - Generation', 'Star Trek: Generations', 'Estados Unidos', 'Ficção Científica, Ação', 'David Carson', '15480286315c450ad7658bb.jpg', 118, 1994, 'MUieGh1fHSI', 'Patrick Stewart, Jonathan Frakes, Brent Spiner, LeVar Burton, Marina Sirtis, Michael Dorn, Gates McFadden, William Shatner, Whoopi Goldberg, James Doohan, Patti Yasutake, Malcom McDowell, Walter Koenig', 'A viagem inaugural da terceira nave Enterprise está ameaçada pelo cientista louco Soren e apenas uma pessoa pode detê-lo, mas ela está morta há 78 anos.', 0, 'helena', NULL, NULL),
(NULL, 1269, 'Jornada nas Estrelas - Primeiro Contato', 'Star Trek: First Contact', 'Estados Unidos', 'Ficção Científica, Ação', 'Jonathan Frakes', '15480289525c450c18f126b.jpg', 111, 1996, 'RmdBZqwzfpE', 'Patrick Stewart, Jonathan Frakes, Brent Spiner, LeVar Burton, Michael Dorn, Marina Sirtis, Gates McFadden, Alice Krige, James Cromwell, Alfre Woodard, Neal McDonough, Dwight Schultz, Michael Horton', 'O capitão Jean-Luc e a tripulação da Enterprise embarcam em uma nova aventura, a qual é um confronto com os Borgs, criaturas meio orgânicas e meio máquinas que formam uma comunidade que possui um único objetivo: conquistar e assimilar todas as raças. Liderados por sua sedutora e sádica rainha, os Borgs seguem para a Terra com um plano demoníaco para alterar a história. O último encontro entre Picard e os Borgs quase o matou e agora ele quer vingança.', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1270, 'Bem-Vindos à Marwen', 'Welcome to Marwen', 'Estados Unidos', 'Drama, Comédia, Fantasia', 'Robert Zemeckis', '15480296855c450ef5c6381.jpg', 116, 2018, 'c3211s3oFRw', 'Steve Carell, Falk Hentschel, Matt O\'Leary, Nikolai Witschl, Eiza González, Janelle Monáe, Leslie Mann, Diane Kruger, Merritt Wever, Leslie Harter Zemeckis, Gwendoline Christie', 'Mark Hogancamp (Steve Carell) é agredido por vários homens em um bar, e entra em coma. Quando torna-se consciente novamente, ele perdeu totalmente a memória, esquecendo a família e os amigos. Para recuperar as lembranças, Mark constrói uma maquete em miniatura de uma cidade belga chamada Marwencol, com bonecos representando os familiares e amigos próximos.', 0, 'helena', NULL, NULL),
(NULL, 1271, 'Duas Rainhas', 'Mary Queen of Scots', 'Reino Unido', 'Drama, Biografia', 'Josie Rourke', '15480316045c451674220bc.jpg', 124, 2018, 'hzWXhzM_mqg', 'Saoirse Ronan, Margot Robbie, Joe Alwyn, Gemma Chan, Jack Lowden, David Tennant, James McArdle, Brendan Coyle, Ismael Cruz Córdova, Martin Compston', 'Mary (Saoirse Ronan), ainda criança, foi prometida ao filho mais velho do rei Henrique II, Francis, e então foi levada para França. Mas logo Francis morre e Mary volta para a Escócia, na tentativa de derrubar sua prima Elizabeth I (Margot Robbie), a Rainha da Inglaterra.', 0, 'helena', NULL, NULL),
(NULL, 1272, 'Dumplin\'', 'Dumplin\'', 'Estados Unidos', 'Comédia dramática, Musical', 'Anne Fletcher', '15480320215c451815b168d.jpg', 110, 2018, 'yMuusls-26U', 'Danielle Macdonald, Jennifer Aniston, Odeya Rush, Maddie Baillio, Luke Benward, Bex Taylor-Klaus, Dove Cameron, Harold Perrineau Jr., Kathy Najimy', 'Willowdean Dickson (Danielle Macdonald), é uma jovem acima do peso e bastante confiante com o próprio corpo, apesar de não ter o respeito de sua mãe, uma ex-miss (Jennifer Aniston). Quando se apaixona pelo atleta Bo (Luke Benward) e começa a ter inseguranças. Will decide entrar num concurso de beleza como forma de protesto.', 0, 'helena', NULL, NULL),
(NULL, 1273, 'Culpa', 'The Guilty', 'Dinamarca', 'Suspense', 'Den Skyldige', '15480324005c45199091bbd.jpg', 88, 2018, '_RBlKjovJQU', 'Jakob Cedergren, Jakob Ulrik Lohmann, Laura Bro, Jessica Dinnage, Johan Olsen, Omar Shargawi, Katinka Evers-Jahnsen, Morten Suurballe, Simon Bennebjerg, Morten Thunbo', 'O policial Asger Holm (Jakob Cedergren) está acostumado a trabalhar nas ruas de Copenhaguem, mas devido a um conflito ético no trabalho, é confinado à mesa de emergências. Encarregado de receber ligações e transmitir às delegacias responsáveis, ele é surpreendido pela chamada de uma mulher desesperada, tentando comunicar o seu sequestro sem chamar a atenção do sequestrador. Infelizmente, ela precisa desligar antes de ser descoberta, de modo que Asger dispõe de poucas informações para encontrá-la. Começa a corrida contra o relógio para descobrir onde ela está, para mobilizar os policiais mais próximos e salvar a vítima antes que uma tragédia aconteça.', 0, 'helena', NULL, NULL),
(NULL, 1274, 'Querido Menino', 'Beautiful Boy', 'Estados Unidos', 'Drama', 'Felix van Groeningen', '15480328525c451b5493d4d.jpg', 120, 2018, 'ZWDQmRBLIJ0', 'Steve Carell, Timothée Chalamet, Maura Tierney, Amy Ryan, Kaitlyn Dever, Stefanie Scott, Timothy Hutton, Andre Royo, Jack Dylan Grazer, LisaGay Hamilton', 'David Sheff (Steve Carell) é um conceituado jornalista e escritor que vive com a segunda esposa e os filhos. O filho mais velho, Nic Sheff (Timothée Chalamet), é viciado em metanfetamina e abala completamente a rotina da família e daquele lar. David tenta entender o que acontece com o filho, que teve uma infância de carinho e suporte, ao mesmo tempo em que estuda a droga e sua dependência. Nic, por sua vez, passa por diversos ciclos da vida de um dependente químico, lutando para se recuperar, mas volta e meia se entregando ao vício.', 0, 'helena', NULL, NULL),
(NULL, 1275, 'Quincy', 'Quincy', 'Estados Unidos', 'Documentário', 'Alan Hicks, Rashida Jones', '15480332355c451cd3aea28.jpg', 124, 2018, 'u_TAhkXZJ4g', 'Quincy Jones, Rashida Jones, Kareem Abdul-Jabbar, Clarence Avant', 'Quincy Jones tem uma carreira invejável, suas contribuições para o jazz, o pop, o hip hop e o mundo da música em geral são incontáveis. Com 85 anos de idade, ele ainda não para. Acompanhando Quincy por três anos na estrada enquanto ele se prepara para o show de abertura do National Museum of African American History & Culture, sua filha Rashida Jones se une a Alan Hicks para dirigir um íntimo retrato e uma celebração do seu passado e do seu presente.', 0, 'helena', NULL, NULL),
(NULL, 1276, 'RBG', 'RBG', 'Estados Unidos', 'Documentário', 'Julie Cohen, Betsy West', '15480334115c451d83c3b54.jpg', 98, 2018, 'biIRlcQqmOc', 'Bill Clinton, Sharron Frontiero, James Steven Ginsburg, Jane C. Ginsburg', 'Um retrato íntimo da improvável estrela do rock, Justice Ruth Bader Ginsburg. Com acesso sem precedentes, são exploradas suas primeiras batalhas jurídicas e como elas mudaram o mundo para as mulheres.', 0, 'helena', NULL, NULL),
(NULL, 1277, 'Stan & Ollie', 'Stan & Ollie', 'Reino Unido', 'Drama, Biografia', 'Jon S. Baird', '15480337815c451ef5e33af.jpg', 97, 2018, 'F5fyuBsUeL8', 'John C. Reilly, Shirley Henderson, Steve Coogan, Nina Arianda, Danny Huston, Susy Kane, Rufus Jones', 'Conta a história real de uma das maiores duplas de comediantes de todos os tempos, Laurel e Hardy. Os dois embarcaram em uma longa jornada em sua turnê pela Grã-Bretanha, em 1953, buscando colocar suas carreiras novamente nos holofotes, mesmo com o mundo ainda abalado pelos efeitos da Segunda Guerra Mundial.', 0, 'helena', NULL, NULL),
(NULL, 1278, 'Gräns', 'Gräns', 'Suécia', 'Drama, Fantasia', 'Ali Abbasi', '15480344905c4521baa3e5b.jpg', 108, 2018, 't2rsXR4cjrw', 'Eva Melander, Eero Milonoff, Jörgen Thorsson, Viktor Akerblom, Rakel Wärmländer, Matti Boustedt', 'Tina (Eva Melander) é uma policial que trabalha no aeroporto fiscalizando bagagens e passageiros. Depois de ser atingida por um raio na infância, ela desenvolveu uma espécie de sexto sentido, fazendo com que seja capaz de “ler as pessoas” apenas pelo o olhar. Isso sempre representou uma vantagem na sua profissão, mas tudo muda quando ela identifica um criminoso em potencial e não consegue achar provas para justificar sua intuição. Após o episódio, ela passa a questionar seu dom, ao mesmo tempo em que fica obcecada em descobrir qual o verdadeiro segredo de Vore (Eero Milonoff), seu único suspeito não legitimado. ', 0, 'helena', NULL, NULL),
(NULL, 1279, 'Crime + Punishment', 'Crime + Punishment', 'Estados Unidos', 'Documentário', 'Stephen Maing', '15480347845c4522e0c108b.jpg', 112, 2018, 'n4WfaaJi_fQ', 'Manuel \'Manny\' Gomez, Sandy Gonzales, Rukia Lumumba', 'Quatro anos da história de um bravo grupo de policiais negros e latinos e um investigador privado implacável que, em meio a um processo histórico, arriscam tudo para expor práticas ilegais de cotas e seu impacto sobre as minorias jovens.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1280, 'Charm City', 'Charm City', 'Estados Unidos', 'Documentário', 'Marilyn Ness', '15480352065c45248606589.jpg', 106, 2018, 'IWDgi8nmYzo', 'Dante Barksdale, Monique Brown, Clayton Gunton, Tia Latrell', 'Durante um período de três anos de violência incoparável, a diretora Marilyn Ness acompanha alguns dos bairros mais perigosos de Baltimore, oferecendo um retrato daqueles que estão na linha de frente. Toda a fúria, garra e compaixão de moradores, policiais e governantes da cidade pintam uma imagem que pode ser considerada um microcosmo da crise de violência e falta de confiança na força policial que ocorre atualmente nos Estados Unidos.', 0, 'helena', NULL, NULL),
(NULL, 1281, 'Jurassic World: Reino Ameaçado', 'Jurassic World: Fallen Kingdom', 'Estados Unidos', 'Aventura, Ficção Científica, Ação', 'J.A. Bayona', '15480355595c4525e7de7e9.jpg', 128, 2018, 'KDvnZvKHFTM', 'Chris Pratt, Bryce Dallas Howard, Rafe Spall, Justice Smith, Jeff Goldblum, Daniella Pineda, BD Wong, Toby Jones, James Cromwell, Ted Levine, Geraldine Chaplin ', 'Três anos após o fechamento do Jurassic Park, um vulcão prestes a entrar em erupção põe em risco a vida na ilha Nublar. No local não há mais qualquer presença humana, com os dinossauros vivendo livremente. Diante da situação, é preciso tomar uma decisão: deve-se retornar à ilha para salvar os animais ou abandoná-los para uma nova extinção? Decidida a resgatá-los, Claire (Bryce Dallas Howard) convoca Owen (Chris Pratt) a retornar à ilha com ela.', 0, 'helena', NULL, NULL),
(NULL, 1282, 'On Her Shoulders', 'On Her Shoulders', 'Estados Unidos', 'Documentário', 'Alexandria Bombach', '15480361475c45283309f30.jpg', 95, 2018, '9RRE1DWK8cU', 'Nádia Murad, Murad Ismael, Amal Clooney, Ki-moon Ban', 'Aos 23 anos, Nadia Murad faz parte da comunidade étnico-religiosa curda dos Yazidi. Ela sobreviveu ao genocídio e à escravidão sexual cometida pelo Estado Islâmico do Iraque e do Levante. Essa garota comum repetiu sua história várias vezes para políticos e imprensa, se tornando porta voz do seu povo mundo afora.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1283, 'Won’t You Be My Neighbor?', 'Won’t You Be My Neighbor?', 'Estados Unidos', 'Documentário', 'Morgan Neville', '15480370395c452bafa30d5.jpg', 94, 2018, 'FhwktRDG_aQ', 'Fred Rogers, Joanne Rogers, Yo-Yo Ma, François Clemmons', 'Documentário americano de 2018, dirigido por Morgan Neville, sobre a filosofia de vida e orientação de Fred Rogers, o apresentador e criador do bairro de Mister Rogers.', 0, 'helena', NULL, NULL),
(NULL, 1284, 'Shirkers - O Filme Roubado', 'Shirkers', 'Estados Unidos', 'Documentário', 'Sandi Tan', '15480377185c452e568e11a.jpg', 96, 2018, 'Yd2pgmZRzk8', 'Sandi Tan, Kelvin Tong, Eric Khoo, Ng Yi-Sheng, Sophia Siddique Harvey, Georges Cardona, Philip Cheah', 'Em 1992 a diretora Sandi Tan filmou seu primeiro road movie em Singapura com seu enigmático mentor norte-americano, Georges, que sumiu com todas as filmagens que eles realizaram. Vinte anos depois, o projeto em 16mm foi recuperado, fazendo Tan, agora uma romancista em Los Angeles, embarcar numa odisséia pessoal para encontrar as pegadas do desaparecido Georges.', 0, 'helena', NULL, NULL),
(NULL, 1285, 'O Silêncio dos Outros', 'El Silencio de Otros', 'Espanha', 'Documentário', 'Robert Bahar, Almudena Carracedo', '15480379525c452f40af6a5.jpeg', 96, 2018, 'q7UlRNldBLc', 'María Martín, José María Galante, Carlos Slepoy, Ana Messuti', 'Documentário revoltante sobre as vítimas do ditador espanhol, o general Francisco Franco, e sua luta em curso para extrair algum tipo de retorno legal. Dirigido pela dupla vencedora do Emmy Almudena Carracedo e Robert Bahar (Made in L.A.). O filme é tecido entre as histórias individuais, principalmente trágicas, inspiradoras. Ele é editado inteligentemente, impregnado de imagens simbólicas, mostrando uma sociedade ainda dividida entre o esquecimento e o entendimento com o passado.', 0, 'helena', NULL, NULL),
(NULL, 1286, 'Three Identical Strangers', 'Three Identical Strangers', 'Reino Unido', 'Documentário, Mistério', 'Tim Wardle', '15480382225c45304ea5dfc.jpg', 96, 2018, 'c-OF0OaK3o0', 'Silvi Alzetta-Reali, Eddy Galland, Ron Guttman, Natasha Josefowitz', 'Na Nova York de 1980, três completos estranhos descobrem que são trigêmeos idênticos separados durante o nascimento. Aos 19 anos, a feliz reunião dos três os lança para uma fama internacional, mas também traz um segredo extraordinário e perturbador, capaz de transformar a compreensão da natureza humana.', 0, 'helena', NULL, NULL),
(NULL, 1287, 'Sobre Pais e Filhos', 'Of Fathers and Sons', 'Alemanha', 'Documentário', 'Talal Derki', '15480385245c45317c8da34.jpg', 99, 2018, '6i3j95bPWW8', 'Abu Osama, Ayman Osama, Osama Osama', 'Após conseguir a confiança de uma família radical islâmica, o documentário mostra o dia a dia de suas vidas ao longo de dois anos. O foco é em Osama e seu irmão mais novo, Ayman, mostrando o que significa crescer em meio a um califado islâmico.', 0, 'helena', NULL, NULL),
(NULL, 1288, 'Minding the Gap', 'Minding the Gap', 'Estados Unidos', 'Documentário', 'Bing Liu', '15480387175c45323d8c1b2.jpg', 93, 2018, 'eqtw5rek5y8', 'Kiere Johnson, Bing Liu, Zack Mulligan', 'Três jovens se juntam para conseguirem escapar de suas famílias voláteis e da cidade onde nasceram, localizada em uma parte dos EUA que passa por um declínio da indústria. Enfrentando a responsabilidade da vida adulta, revelações inesperadas ameaçam a longa amizade do grupo.', 0, 'helena', NULL, NULL),
(NULL, 1289, 'Pássaros de Verão', 'Pájaros de Verano', 'Colombia', 'Drama, Suspense', 'Cristina Gallego, Ciro Guerra', '15480389285c453310cf4f6.jpg', 125, 2018, 'htDO3BpyM-I', 'Carmiña Martínez, José Acosta, Jhon Narváez, Natalia Reyes, José Vicente (IX), Greider Meza', 'Na década de 1970, na Colômbia, uma família de nativos de Wayuu se encontra no coração da florescente venda de maconha para a juventude americana. Quando a honra da família tenta resistir à ganância humana, a guerra de clãs se torna inevitável e põe em perigo suas vidas ancestrais, cultura e tradições. ', 0, 'matheus', NULL, NULL),
(NULL, 1290, 'Hale County This Morning, This Evening', 'Hale County This Morning, This Evening', 'Estados Unidos', 'Documentário', 'RaMell Ross', '15480389135c453301df62e.jpg', 76, 2018, 'ZDyGXJY4jAs', 'Latrenda \'Boosie\' Ash, Quincy Bryant, Daniel Collins, RaMell Ross', 'Entenda as motivações, as dificuldades e os preconceitos que assombram até hoje o sul dos Estados Unidos a partir de acontecimentos diários, como a criação dos filhos e a escolha de uma faculdade.', 0, 'helena', NULL, NULL),
(NULL, 1291, 'Free Solo', 'Free Solo', 'Estados Unidos', 'Documentário', 'Jimmy Chin, Elizabeth Chai Vasarhelyi', '15480391085c4533c4b4fc2.jpg', 100, 2018, 'S4F3JK7oHn0', 'Tommy Caldwell, Jimmy Chin, Alex Honnold, Sanni McCandless', 'Aos 30 anos de idade, Alex Honnold já era um dos mais renomados alpinistas de sua geração. Porém, independente de todas as suas conquistas, ele permaneceu obcecado com um desafio que nenhum outro alpinista havia conseguido realizar: escalar sem equipamento de segurança a rocha El Capitan, no Parque Nacional de Yosemite, na Califórnia. Os diretores E. Chai Vasarhelyi e Jimmy Chin acompanham Honnold por dois anos enquanto ele testa os limites de sua ambição.', 0, 'helena', NULL, NULL),
(NULL, 1292, 'A Private War', 'A Private War', 'Estados Unidos', 'Biografia, Drama, Guerra', 'Matthew Heineman', '15480394235c4534fff3fa6.jpg', 110, 2018, 'TTf0Lc5YAcc', 'Tom Hollander, Rosamund Pike, Faye Marsay, Jamie Dornan', 'Biografia sobre a jornalista Marie Colvin (Rosamund Pike),  premiada repórter norte-americana, conhecida por cobrir zonas de conflito como Chechênia, Kosovo e Zimbábue. Durante um trabalho no Sri Lanka, ela perdeu seu olho esquerdo em 2001 e passou a usar um tapa-olho, que se tornou sua marca registrada até sua morte em 2012.', 0, 'nadalini', NULL, NULL),
(NULL, 1293, 'Dark Money', 'Dark Money', 'Estados Unidos', 'Documentário', 'Kimberly Reed', '15480394535c45351d73fc2.jpg', 99, 2018, 'K4OGlW1JJpc', 'N/A', 'As contribuições de \"dinheiro sombrio\", tornadas possíveis por decisão da Suprema Corte dos Estados Unidos, inundam as eleições americanas modernas - mas Montana está mostrando a Washington D.C. como resolver o problema do dinheiro anônimo ilimitado na política.', 0, 'helena', NULL, NULL),
(NULL, 1294, 'O Distante Latido dos Cães', 'The Distant Barking of Dogs', 'Dinamarca', 'Documentário', 'Simon Lereng Wilmont', '15480396915c45360b8866b.jpg', 90, 2017, '6dsnRsybtXM', 'Oleg Afanasyev', 'Oleg tem apenas dez anos e mora com a avó, que o criou desde a morte precoce de sua mãe. Como todo menino, ele frequenta a escola, mas as lições aprendidas nas aulas são um pouco diferentes do comum, entre elas estão como identificar uma mina terrestre ou como funciona um abrigo antiaéreo. Oleg e seus cinco primos poderiam ter uma infância normal, mas eles vivem em Donetsk, uma cidade no leste da Ucrânia, constantemente atacada pelo exército russo através de bombas e mísseis aéreos. ', 0, 'helena', NULL, NULL),
(NULL, 1295, 'Caroline', 'Caroline', 'Estados Unidos', 'Drama, Curta-Metragem', 'Celine Held, Logan George', '15480397645c453654746b1.jpeg', 12, 2018, 'A4fKPNC-vUQ', 'Celine Held, Caroline Falk, Tam Jackson, Sally Falk, Brooks Falk, Harold Presley', 'Em um dia quente de verão no Texas, uma mãe não consegue deixar seus filhos com uma babá para ir a uma entrevista de emprego. A menina Caroline, de seis anos de idade, fica encarregada de cuidar de seus dois irmãos mais novos dentro do carro da família, enquanto a mãe está fora.', 0, 'matheus', NULL, NULL),
(NULL, 1296, 'Communion Los Angeles', 'Communion Los Angeles', 'Estados Unidos', 'Documentário', 'Adam R. Levine, Peter Bo Rappmund', '15480401295c4537c12703e.jpg', 68, 2018, '2ox5SgnE-LE', 'N/A', 'Um documentário experimental que usa time-lapse para mostrar uma distópica visão do presente.', 0, 'helena', NULL, NULL),
(NULL, 1297, 'Chuchotage', 'Susotázs', 'Hungria', 'Comédia, Drama, Curta-Metragem', 'Barnabás Tóth', '15480404105c4538dab96c2.jpg', 17, 2018, 'UY-Nq08SuYg', 'Andrea Osvárt, Pál Göttinger, Géza Takács', 'Às vezes é difícil ser uma intérprete de conferência.', 0, 'matheus', NULL, NULL),
(NULL, 1298, 'Black Sheep', 'Black Sheep', 'Estados Unidos', 'Curta-metragem, Documentário', 'Ed Perkins', '15481192845c466cf4a79b7.jpg', 26, 2018, 'A-Y5zvnDxsI', 'Kai Francis Lewis, Cornelius Walker', 'Tudo mudou para Cornelius Walker em 27 de novembro de 2000, quando Damilola Taylor foi morta. Damilola tinha 11 anos, a mesma idade de Cornelius. Ele morou a cinco minutos de distância. Ele tinha a mesma cor de pele. A mãe de Cornelius, com medo da segurança do filho, mudou junto com a sua família para fora de Londres. Cornelius de repente encontrou-se vivendo em uma propriedade branca gerida por racistas. Mas em vez de lutar contra eles, Cornelius decidiu se tornar mais parecido com as pessoas que o odiavam. Eles se tornaram sua família e o mantiveram seguro. E, em troca, Cornélio ficou submerso em uma cultura de violência e ódio. Mas, à medida que a violência e o racismo contra outros negros continuavam, Cornélio lutou para casar sua verdadeira identidade com a que adquirira.', 0, 'helena', NULL, NULL),
(NULL, 1299, 'End Game', 'End Game', 'Estados Unidos', 'Curta-metragem, Documentário', 'Rob Epstein, Jeffrey Friedman', '15480409155c453ad36bad8.jpg', 40, 2018, 'FgJD6ksdkWY', 'N/A', 'Filmado e editado em estilo vérité intimista, este filme acompanha médicos visionários que trabalham na vanguarda da vida e da morte e se dedicam a mudar nosso modo de pensar sobre ambos.', 0, 'helena', NULL, NULL),
(NULL, 1300, 'Detainment', 'Detainment', 'França', 'Drama, Curta-Metragem', 'Vicent Lambe', '15480413285c453c70e4298.jpg', 30, 2018, '8eKZTtJGsi8', 'Brian Fortune, David Ryan, Ely Solan, Leon Hughes, Morgan C. Jones, Tara Breathnach, Will O\'Connell', 'Dois meninos de dez anos são detidos pela polícia sob suspeita de sequestrar e matar uma criança. Uma história verdadeira baseada em transcrições de entrevistas e registros do caso James Bulger, que chocou o mundo em 1993.', 0, 'matheus', NULL, NULL),
(NULL, 1301, 'LIFEBOAT', 'LIFEBOAT', 'Estados Unidos', 'Curta-metragem, Documentário', 'Skye Fitzgerald', '15481189345c466b96102a2.jpg', 34, 2018, 'ZASsI81eWHY', '', 'Voluntários de uma organização sem fins lucrativos alemã arriscam as ondas do Mediterrâneo para arrancar refugiados de jangadas que afundam da Líbia no meio da noite. O LIFEBOAT coloca um rosto humano em uma das maiores crises globais contemporâneas do mundo e fornece uma centelha de esperança em torno de como a sociedade civil pode intervir de maneira significativa na crise dos refugiados.', 0, 'helena', NULL, NULL),
(NULL, 1302, 'Fauve', 'Fauve', 'Canadá', 'Drama, Curta-Metragem', 'Jeremy Comte', '15480419885c453f04de2be.jpg', 17, 2018, 'o-Pp03biqjw', 'Louise Bombardier, Félix Grenier, Alexandre Perreault', 'Escrito e dirigido por Jeremy Comte, Fauve é um incrível curta-metragem sobre a inocência perdida, inspirado no sonho recorrente do autor. O filme já participou em mais de 80 festivais de cinema ao redor do mundo e conquistou mais de 40 prêmios.', 0, 'matheus', NULL, NULL),
(NULL, 1303, 'Los Comandos', 'Los Comandos', 'Estados Unidos', 'Curta-metragem, Documentário', 'Joshua Bennett, Juliana Schatz', '15480420215c453f25c3cbe.jpg', 28, 2018, 'zThI-huf5Ic', '', 'Em El Salvador, a violência de gangues invadiu o país, mirando desproporcionalmente crianças e adolescentes, e transformando-a em \"A capital do assassinato do mundo\". A unidade médica de emergência, Los Comandos de Salvamento, é uma das poucas instituições que enfrentam o reinado de terror das gangues e é um local de refúgio e comunidade para os jovens. 16 anos de idade Mimi é um Commando dedicado pego na violência. Quando sua amiga e companheira Commando, Erick Beltran, de 12 anos, é baleada enquanto atende, ela enfrenta pressão para deixar El Salvador e Los Comandos e seguir para o norte em busca de uma vida melhor.', 0, 'helena', NULL, NULL),
(NULL, 1304, 'My Dead Dad’s Porno Tapes', 'My Dead Dad’s Porno Tapes', 'Canadá', 'Curta-metragem, Documentário', 'Charlie Tyrell', '15481192365c466cc4d0665.jpg', 14, 2018, 'Lhctg8j5kI', 'David Wain', 'Um pequeno documentário que segue o diretor Charlie Tyrell, enquanto ele tenta descobrir uma melhor compreensão de seu falecido pai através dos objetos aleatórios que ele herdou, incluindo uma pilha de filmes sujos de VHS.', 0, 'helena', NULL, NULL),
(NULL, 1306, 'Icare', 'Icare', 'Bélgica', 'Drama, Comédia, Curta-Metragem', 'Nicolas Boucart', '15480424915c4540fba041c.jpg', 27, 2017, 'ZQdELGA8Tg4', 'Maxime Bessonov, Albert Chassagne-Baradat, Philippe Rebbot', 'Em uma pequena ilha cercada por penhascos íngremes, uma única casa fica de frente para o mar. Obcecado pelo sonho de que, um dia, o homem possa voar como um pássaro, um inventor experimenta máquinas neste pedaço de terra abandonado. Para este homem, apenas uma alma pura, leve e ingênua é capaz de tal façanha. Recrutado do continente, Joseph, de 11 anos, parece ser o candidato perfeito.', 0, 'matheus', NULL, NULL),
(NULL, 1307, 'Period. End of Sentence.', 'Period. End of Sentence.', 'Índia', 'Curta-metragem, Documentário', 'Rayka Zehtabchi', '15481191065c466c4265191.jpg', 26, 2018, 'Fqt4Fqv8FGA', '', 'Em uma aldeia rural nos arredores de Delhi, na Índia, as mulheres lideram uma revolução silenciosa. Eles lutam contra o estigma profundamente enraizado da menstruação.', 0, 'helena', NULL, NULL),
(NULL, 1308, 'Women of the Gulag', 'Women of the Gulag', 'Estados Unidos', 'Curta-metragem, Documentário', 'Marianna Yarovskaya', '15481195135c466dd9ab50f.jpg', 0, 2018, '', 'N/A', 'O filme conta a história do último grupo conhecido de mulheres que sobreviveram aos campos de trabalhos forçados da era soviética chamados Gulag. O Gulag foi um sistema brutal de repressão e terror que devastou a população soviética durante o regime de Joseph Stalin e foi descrito pela primeira vez por Aleksandr Solzhenitsyn em \"O Arquipélago Gulag\".', 0, 'helena', NULL, NULL),
(NULL, 1309, 'Zion', 'Zion', 'Estados Unidos', 'Curta-metragem, Documentário', 'Floyd Russ', '15480433005c454424c360c.jpg', 12, 2018, 'hr7FGrTlQWo', 'Kimberly Clark, Zion Clark, Gilbert Donahue', 'Um retrato de Zion Clark, um jovem lutador que nasceu sem pernas e cresceu em um orfanato.', 0, 'helena', NULL, NULL),
(NULL, 1310, 'Age of Sail', 'Age of Sail', 'Estados Unidos', 'Animação, Curta-Metragem, Drama', 'John Kahrs', '15480433235c45443ba9cc3.jpg', 12, 2018, 'TH3HOcRayC8', 'Lara Conrad, William Avery', 'Em alto mar nos idos de 1900, Age of Sail conta a história de William Avery (Ian McShane), um velho e solitário marinheiro que navega o Atlântico Norte.\r\nO filme foi lançado em formato 360° e VR. Confira o curta-metragem completo logo abaixo:', 0, 'nadalini', NULL, NULL),
(NULL, 1311, 'Marguerite', 'Marguerite', 'Taiwan', 'Drama, Curta-Metragem', 'Marianne Farley', '15480434905c4544e231207.jpg', 19, 2018, 'ZjTOTZ__JzM', 'Béatrice Picard, Sandrine Bisson', 'Uma mulher idosa e sua enfermeira desenvolvem uma amizade que a inspira a descobrir desejos não reconhecidos e, assim, ajudá-la a fazer as pazes com seu passado.', 0, 'matheus', NULL, NULL),
(NULL, 1312, 'May Day', 'May Day', 'Bélgica', 'Comédia, Drama, Curta-Metragem', 'Fedrik De Beul, Olivier Magis', '15480438325c4546384e791.jpg', 22, 2017, '', 'Tom Adjibi, Simon André, Viktor Biserov, Mathieu Debaty', 'Uma dúzia de candidatos a emprego desesperados encontram-se presos na entrevista de trabalho mais embaraçosa de sempre.', 0, 'matheus', NULL, NULL),
(NULL, 1313, 'Comportamento Animal', 'Animal Behaviour', 'Canadá', 'Animação, Curta-Metragem', 'David Fine, Alison Snowden', '15480442165c4547b8cfe82.jpg', 14, 2018, 'WBSJOgbnbCE', 'Ryan Beil, Leah Juel, James Kirk, Andrea Libman', 'Lidar com o que acontece naturalmente não é fácil, especialmente para os animais. Cinco animais reúnem-se regularmente numa sessão de terapia de grupo orientada por Dr. Clément, um psicoterapeuta canino. Confira o curta-metragem abaixo.', 0, 'nadalini', NULL, NULL),
(NULL, 1314, 'Bilby', 'Bilby', 'Estados Unidos', 'Animação, Curta-Metragem, Comédia', 'Pierre Perifel, JP Sans, Liron Topaz', '15480446735c45498171706.jpg', 8, 2018, 'VAaT-W06bFE', 'Dee Bradley Baker', 'Bilby, um marsupial australiano, tenta proteger um passarinho bonito.', 0, 'nadalini', NULL, NULL),
(NULL, 1315, 'Wale', 'Wale', 'Reino Unido', 'Drama, Curta-Metragem', 'Barnaby Blackburn', '15480848525c45e6741d2d5.jpg', 20, 2018, '', 'Jamie Sives, Sura Dohnke, Roger Jean Nsengiyumva, Raphel Famotibe, Clare Perkins, Jim Caesar, Richard W.H. Bray, Marcus Coombs', 'Um jovem agressor de 18 anos está tentando fazer seu próprio negócio funcionar como mecânico. Mas a empresa não é tão fácil quando se é um jovem negro com um passado criminoso. E não fica mais fácil quando você é enquadrado por um de seus novos clientes por um crime angustiante.', 0, 'matheus', NULL, NULL),
(NULL, 1316, 'Skin', 'Skin', 'Estados Unidos', 'Drama, Curta-Metragem', 'Guy Nattiv', '15480851385c45e792db595.jpg', 20, 2018, '', 'Johnse Allende Jr., Zeus Campbell, Lonnie Chavis, Jared Day', 'Um pequeno supermercado em uma cidade de colarinho azul, um homem negro sorri para um menino branco de 10 anos em todo o corredor de check-out. Este momento inócuo envia duas gangues em uma guerra implacável que termina com uma reação chocante.', 0, 'matheus', NULL, NULL),
(NULL, 1317, 'Madre', 'Madre', 'Espanha', 'Drama, Curta', 'Rodrigo Sorogoyen', '15480855165c45e90c608da.jpg', 18, 2018, '', 'Marta Nieto, Blanca Apilánez', 'Em seu apartamento com sua própria mãe na Espanha, uma mulher recebe um telefonema de seu filho de seis anos, que está de férias na França com o pai. O pesadelo de todos os pais segue.', 0, 'matheus', NULL, NULL),
(NULL, 1318, 'Bird Karma', 'Bird Karma', 'Estados Unidos', 'Animação, Curta-Metragem', 'William Salazar', '15480864705c45ecc68eac4.jpg', 5, 2018, 'Zc39IZxL56U', '', 'Um conto de viagem de uma ave de pernas longas de alegria feliz, ganância inescapável e a descoberta acidental das consequências quando muito não é suficiente', 0, 'matheus', NULL, NULL),
(NULL, 1319, 'Fim de Tarde', 'Late Afternoon', 'Irlanda', 'Animação, Curta-Metragem', 'Louise Bagnall', '15480873945c45f06232add.jpg', 10, 2017, 'BULal1RpwP4', 'Lucy O\'Connell, Louise Bagnall, Fionnula Flanagan, Michael McGrath', 'Uma mulher idosa regressa através das suas memórias. Ela existe entre dois estados, o passado e o presente.', 0, 'matheus', NULL, NULL),
(NULL, 1320, 'Lost & Found', 'Lost & Found', 'Austrália', 'Animação, Curta-Metragem, Drama', 'Andrew Goldsmith, Bradley Slabe', '15480886715c45f55f9bf59.jpg', 7, 2018, 'JEQZ5Tb-6Ps', '', 'Lost & Found é um curta Stop Motion que puxa as cordas do coração.\r\nUm dinossauro de brinquedo, feito de crochê, deve se desenrolar para salvar o amor da sua vida.', 0, 'matheus', NULL, NULL),
(NULL, 1321, 'Um Pequeno Passo', 'One Small Step', 'Estados Unidos', 'Animação, Curta-Metragem, Aventura', 'Andrew Chesworth, Bobby Pontillas', '15480889525c45f678b8fb5.jpg', 8, 2018, 'yYcpRSQ-irs', '', 'TAIKO Studios apresenta a história de Luna, uma garota chinesa americana que sonha em se tornar um astronauta.', 0, 'matheus', NULL, NULL),
(NULL, 1322, 'Pépé le morse', 'Pépé le morse', 'França', 'Fantasia, Curta-Metragem, Animação', 'Lucrèce Andreae', '15480894955c45f897af507.jpg', 15, 2017, 'C0ObdF_ZWoI', 'Romain Garance, Emilie Blon-Metzinger, Chann Aglat, Ilona Bachelier', 'Na praia ventosa e turva, a avó está rezando, mamãe está gritando, as irmãs não se importam, Lucas está sozinho. Vovô era um cara estranho, agora ele está morto.', 0, 'matheus', NULL, NULL),
(NULL, 1323, 'Weekends', 'Weekends', 'Estados Unidos', 'Drama, Curta-Metragem, Animação', 'Trevor Jimenez', '15480897315c45f9839b053.jpg', 16, 2017, 'tMWsH4ws52Y', '', '\'Weekends\' é a história de um jovem rapaz que se deslocava entre as casas de seus pais recém-divorciados. Momentos surreais de sonho misturam-se com as realidades domésticas de uma família desmembrada neste filme de animação de mão ambientado na década de 1980 em Toronto.', 0, 'matheus', NULL, NULL),
(NULL, 1324, 'No Portal da Eternidade', 'At Eternity\'s Gate', 'França', 'Biografia, Drama', 'Julian Schnabel', '15480925775c4604a14097e.jpg', 111, 2018, 'onZwywZi9hU', 'Willem Dafoe, Rupert Friend, Oscar Isaac, Mads Mikkelsen, Niels Arestrup, Emmanuelle Seigner, Stella Schnabel, Patrick Chesnais', 'Em 1888 Vincent Van Gogh (Willem Dafoe) vivia em Arles. Recluso e melancólico, ele tentava decifrar seus pensamentos enquanto pintava um dos quadros mais famosos na história da arte moderna: Quarto em Arles. A sinopse oficial ainda não foi diculgada.', 0, 'matheus', NULL, NULL),
(NULL, 1325, 'The Old Man & the Gun', 'The Old Man & the Gun', 'Estados Unidos', 'Comédia, Crime, Drama, Biografia', 'David Lowery', '15480932705c460756e2064.jpg', 93, 2018, 'oxbfOrmVkn8', 'Robert Redford, Robert Redford, Sissy Spacek, Tika Sumpter, Danny Glover, Casey Affleck, Keith Carradine, Isiah Whitlock Jr., Tom Waits', 'Preciso, gentil e carismático, Forrest Trucker (Robert Redford) domina com maestria a arte de assaltar bancos. Aos 70 anos de idade, o senhor conseguiu a façanha de escapar da prisão de San Quentin e de tantas outras, e agora segue conduzindo uma série de roubos que intriga a polícia e fascina os espectadores. No entanto, o detetive John Hunt (Casey Affleck) está na sua cola, e Trucker precisará elaborar ainda mais suas artimanhas para ter sucesso no seu último grande ato. ', 0, 'matheus', NULL, NULL),
(NULL, 1326, 'Under the Silver Lake', 'Under the Silver Lake', 'Estados Unidos', 'Suspense, Comédia', 'David Robert Mitchell', '15481051965c4635ec7cc05.jpg', 139, 2018, 'ZoZSMYFNI6I', 'Andrew Garfield, Riley Keough, Grace Van Patten, Riki Lindhome, Topher Grace, Callie Hernandez, Laura-Leigh, Sydney Sweeneyn India Menuez, Zosia Mamet, Jimmi Simpson, Patrick Fischler', 'Sam (Andrew Garfield) é um jovem meio perdido na vida, que um dia encontra a garota perfeita: sua vizinha, com quem passa uma noite. No dia seguinte, ela desaparece. Não existem mais sinais da garota, e todas as suas coisas desapareceram do apartamento onde habitava. Sam começa a investigar o caso, buscando todos os indícios possíveis: os pequenos rabiscos na parede, as mensagens escondidas em músicas. Seria tudo isso parte de uma grande conspiração, ou Sam está ficando louco?', 0, 'helena', NULL, NULL),
(NULL, 1327, 'Pit Stop', 'Pit Stop', 'Estados Unidos', 'Drama, Romance, LGBT', 'Yen Tan', '15481106815c464b5907367.jpg', 80, 2013, 'tY6yLzp9GZA', 'Bill Heck, Marcus DeAnda, Amy Seimetz, Alfredo Maduro, Bailey Bass, Corby Sullivan, John Merriman, Heather Kafka', 'Gabe (Bill Heck) acaba de terminar um relacionamento com um homem casado e tenta superar o acontecido aproveitando a companhia da ex-mulher e da filha. Em outro ponto da cidade, Ernesto (Marcus DeAnda) passa mais tempo no hospital do que em casa, acompanhando um antigo amor gravemente doente.', 0, 'helena', NULL, NULL),
(NULL, 1328, 'Transformers', 'Transformers', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Michael Bay', '15481114825c464e7a83e90.jpg', 144, 2007, 'sky3ikmlX0c', 'Shia LaBeouf, Megan Fox, Josh Duhamel, Tyrese Gibson, Rachael Taylor, Anthony Anderson, Jon Voight, John Turturro', 'Durante anos os Autobots e os Decepticons, duas raças alienígenas robóticas, duelaram em Cybertron, seu planeta natal. Esta guerra fez com que o planeta fosse destruído, resultando que os robôs se espalhassem pelo universo. Megatron (Hugo Weaving), o líder dos Decepticons, vem à Terra em busca da Allspark, um cubo de Cybertron que possibilita que qualquer aparelho eletrônico seja transformado num robô com inteligência própria. Megatron encontra a Allspark, mas fica congelado no Ártico. Décadas depois outros Decepticons chegam à Terra, numa tentativa de encontrar a Allspark. Seu surgimento logo alerta os principais países, em especial os Estados Unidos, que tem uma base militar no Qatar atacada. Enquanto o Secretário de Defesa John Keller (Jon Voight) tenta descobrir o que está havendo, reunindo todas as forças e informações possíveis, o jovem Sam Witwicky (Shia LaBeouf) tem preocupações mais simples: conseguir uma boa nota no colégio, o que lhe garantirá seu 1º carro. Mas o que ele não esperava era que o veículo escolhido, um Camaro antigo, tinha vida própria.', 0, 'matheus', NULL, NULL),
(NULL, 1329, 'Transformers: O Lado Escuro da Lua', 'Transformers: Dark of the Moon', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Michael Bay', '15481118715c464fff0db5a.jpg', 154, 2011, 'VUaEaxqY-c4', 'Shia LaBeouf, Rosie Huntington-Whiteley, Josh Duhamel, Tyrese Gibson, John Turturro, Kevin Dunn, Julie White, Patrick Dempsey', 'Os Autobots, liderados por Optimus Prime (Peter Cullen), participam de missões secretas ao lado dos humanos, onde tentam exterminar os Decepticons existentes no planeta. Um dia Optimus descobre que os humanos lhe esconderam algo ocorrido no lado oculto da Lua. Trata-se da queda de uma espaçonave vinda de Cyberton, comandada por Sentinel Prime (Leonard Nimoy), que desencadeou a corrida espacial entre Estados Unidos e União Soviética na década de 60. Os Autobots resolvem ir à Lua para resgatar o antigo líder, além das cápsulas que ainda estão no local. Paralelamente, Sam Witwicky (Shia LaBeouf) vive com sua nova namorada, Carly (Rosie Huntington-Whiteley), e está à procura de emprego. Ele sente-se diminuído, já que salvou o planeta duas vezes e ganhou uma medalha do presidente Barack Obama, mas nada disto parece ajudá-lo a se estabelecer no mercado de trabalho. Para piorar, Carly ganha bem e é assediada pelo chefe, o bilionário Dylan Gould (Patrick Dempsey). Pouco depois de enfim conseguir emprego, Sam recebe uma mensagem de Jerry (Ken Jeong), que trabalha no mesmo lugar. Jerry trabalhou na NASA durante a corrida espacial e agora é chantageado pelos Decepticons, que o matam. O fato faz com que Sam procure mais uma vez os Autobots, mas apesar de seus feitos do passado ele encontra resistência da nova comandante, Marissa Faireborn (Frances McDormand).', 0, 'matheus', NULL, NULL),
(NULL, 1330, 'Transformers: A Vingança dos Derrotados', 'Transformers: Revenge of the Fallen', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Michael Bay', '15481125155c4652839916a.jpg', 150, 2009, '_oz4imdUkJc', 'Shia LaBeouf, Megan Fox, Josh Duhamel, Tyrese Gibson, John Benjamin Hickey, Anthony Anderson, Jon Voight, John Turturro', 'Dois anos após a batalha entre os Autobots e os Decepticons, Sam Witwicky (Shia LaBeouf) enfrenta a ansiedade de entrar na faculdade. Isto significa que ele terá que morar separado de seus pais, Judy (Julie White) e Ron (Kevin Dunn), deixar a namorada Mikaela Banes (Megan Fox) e ainda explicar a situação ao seu amigo e protetor Bumblebee, já que pretende levar uma vida normal de agora em diante. Paralelamente o governo desativa o Setor 7, resultando na demissão do agente Simmons (John Turturro). Em seu lugar é criada a NEST, uma agência comandada pelo capitão Lennox (Josh Duhamel) e o sargento Epps (Tyrese Gibson), que trabalha em conjunto com os Autobots. Porém a NEST enfrenta a resistência de Theodore Galloway (John Benjamin Hickey), o consultor da segurança nacional, que a considera supérflua.', 0, 'matheus', NULL, NULL),
(NULL, 1331, 'Transformers: A Era da Extinção', 'Transformers: Age of Extinction', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Michael Bay', '15481127975c46539d50786.jpg', 165, 2014, 'uhODfXyOX-E', 'Mark Wahlberg, Stanley Tucci, Nicola Peltz, Jack Reynor, Kelsey Grammer, Titus Welliver, Sophia Myles, Bingbing Li', 'Alguns anos após o grande confronto entre Autobots e Decepticons em Chicago, os gigantescos robôs alienígenas desapareceram. Eles são atualmente caçados pelos humanos, que não desejam passar por apuros novamente. Quando Cade (Mark Wahlberg) encontra um caminhão abandonado, ele jamais poderia imaginar que o veículo é na verdade Optimus Prime, o líder dos Autobots. Muito menos que, ao ajudar a trazê-lo de volta à vida, Cade e sua filha Tessa (Nicola Peltz) entrariam na mira das autoridades americanas.', 0, 'matheus', NULL, NULL),
(NULL, 1332, ' Transformers: O Último Cavaleiro', 'Transformers: The Last Knight', 'Estados Unidos', 'Ação, Aventura, Ficção Científica', 'Michael Bay', '15481130825c4654ba727f7.jpg', 154, 2017, '0NZCYgehx4s', 'Mark Wahlberg, Anthony Hopkins, Josh Duhamel, Laura Haddock', 'Os humanos estão em guerra com os Transformers, que precisam se esconder na medida do possível. Cade Yeager (Mark Wahlberg) é um de seus protetores, liderando um núcleo de resistência situado em um ferro-velho. É lá que conhece Izabella (Isabela Moner), uma garota de 15 anos que luta para proteger um pequeno robô defeituoso. Paralelamente, Optimus Prime viaja pelo universo rumo a Cybertron, seu planeta-natal, de forma a entender o porquê dele ter sido destruído. Só que, na Terra, Megatron se prepara para um novo retorno, mais uma vez disposto a tornar os Decepticons os novos soberanos do planeta.', 0, 'matheus', NULL, NULL),
(NULL, 1333, 'Caçada ao Presidente', 'Big Game', 'Finlândia', 'Ação, Aventura', 'Jalmari Helander', '15481135825c4656aed3605.jpg', 110, 2014, '52F38pjwaYI', 'Samuel L. Jackson, Onni Tommila, Ray Stevenson, Felicity Huffman, Ted Levine, Jim Broadbent, Mehmet Kurtuluş, Victor Garber', 'Após o avião em que estava ter sido abatido por terroristas, o presidente dos Estados Unidos (Samuel L. Jackson) está ferido e perdido no meio de uma zona rural finlandesa. E sua vida agora está nas mãos de Oskari (Onni Tommila), um tímido jovem de treze anos de idade que embarcou em uma viagem para provar sua maturidade a si mesmo e sua família, passando 24 horas sozinho na selva, armado apenas com um arco e flecha. Essa improvável dupla terá que se unir para sobreviver aos criminosos que seguem atrás do presidente.', 0, 'matheus', NULL, NULL),
(NULL, 1334, 'Família do Bagulho', 'We\'re the Millers', 'Estados Unidos', 'Comédia, Crime', 'Rawson Marshall Thurber', '15481142725c46596097338.jpg', 110, 2013, 'SgIs2Cskut4', 'Jennifer Aniston, Jason Sudeikis, Emma Roberts, Will Poulter, Ed Helms, Nick Offerman, Rawson Marshall Thurber, Kathryn Hahn, Molly Quinn', 'Após ser roubado, o traficante de meia tigela David Clark (Jason Sudeikis) é obrigado por seu chefe, Brad Gurdlinger (Ed Helms), a viajar até o México para fechar uma negociação envolvendo um grande carregamento de maconha. Para tanto David precisa formar uma família de mentira e com isso convida a stripper Rose O\'Reilly (Jennifer Aniston) para ser sua falsa esposa. A delinquente Casey (Emma Roberts) e o virgem Kenny (Will Poulter) logo entram no plano e juntos eles formam os Miller, que aparentemente estariam fazendo uma pacata viagem rumo ao México a bordo do trailer da família. Entretanto, ao longo do caminho os antigos hábitos voltam à tona e nem tudo sai como o planejado.', 0, 'helena', NULL, NULL),
(NULL, 1335, 'Avalon High', 'Avalon High', 'Estados Unidos', 'Fantasia, Família, Drama', 'Stuart Gillard', '15481154055c465dcd7bfd5.jpg', 90, 2010, 'RQQqNyXQXgY', 'Britt Robertson, Samuel Levi, Gregg Sulkin, Joey Pollari, Molly Quinn, Devon Graye, Steve Valentine, Christopher Tavarez, Craig Hall, Ingrid Park, Don Lake, Anthony Ingruber', 'Allie Pennington (Britt Robertson) começa a estudar na escola Avalon High e logo descobre a profecia da reencarnação do Rei Arthur, aguardada pelos membros de uma antiga sociedade secreta. Aos poucos, a jovem se envolve com Will (Gregg Sulkin) e Miles (Joey Pollari), dois rapazes que, de alguma forma, também fazem parte dessa misteriosa lenda.', 0, 'helena', NULL, NULL),
(NULL, 1336, 'Não Desligue', 'Don\'t Hang Up', 'Reino Unido', 'Terror, Suspense', 'Damien Macé, Alexis Wajsbrot', '15481159445c465fe815ef9.jpg', 83, 2016, 'pjZfqWbhOO4', 'Gregg Sulkin, Garrett Clayton, Bella Dayne, Sienna Guillory, Parker Sawyers, Jack Brett Anderson, Robert Goodman, Edward Killingback, Chris Wilson, Alex Dee', 'Sam (Gregg Sulkin) e Brady (Garrett Clayton) são adolescentes que, junto com outros amigos, fazem parte de um canal de trotes no Youtube. Em uma noite de festa, os dois ficam bêbados, decidem ligar para alguém e fazer uma pegadinha. Mas o que era brincadeira se torna pesadelo, quando um estranho transforma o jogo contra eles.', 0, 'helena', NULL, NULL),
(NULL, 1337, 'Teen Beach Movie', 'Teen Beach Movie', 'Estados Unidos', 'Família, Musical', 'Jeffrey Hornaday', '15481166205c46628c155ca.jpg', 110, 2013, 'qaADL9KbXyM ', 'Ross Lynch, Maia Mitchell, Grace Phipps, Garrett Clayton, John DeLuca, Jordan Fisher, Chrissie Fit, Mollee Gray, Kent Boyd, Jessica Lee Keller', 'Brady (Ross Lynch) e Mack (Maia Mitchell) são dois jovens surfistas que, após serem encobertos por uma onda, vão parar em uma praia distante, cenário do musical favorito de Brady: \"Onda, Sublime Onda\" (1960). Agora o casal terá que descobrir como voltar ao seu tempo, mas não sem antes modificar o curso original da história.', 0, 'helena', NULL, NULL),
(NULL, 1338, 'Teen Beach 2', 'Teen Beach 2', 'Estados Unidos', 'Família, Musical, Aventura', 'Jeffrey Hornaday', '15481168295c46635d0b7a6.jpg', 104, 2015, '4nIecD-9S-w', 'Ross Lynch, Maia Mitchell, Grace Phipps, Garrett Clayton, John DeLuca, Jordan Fisher, Chrissie Fit, Kent Boyd, Mollee Gray, Jessica Lee Keller, Piper Curda, Ross Butler', 'Três meses após Brady (Ross Lynch) e Mack (Maia Mitchell) retornarem ao mundo real, é a vez dos surfistas e motoqueiros deixarem \"Onda, Sublime Onda\" em direção ao \"futuro\". Agora, eles precisaram aprender a comportar-se nesta nova cultura, e como voltar a sua realidade.', 0, 'helena', NULL, NULL),
(NULL, 1339, 'Malcom X', 'Malcom X', 'Estados Unidos', 'Biografia, Drama', 'Spike Lee', '15481250565c468380dd156.jpg', 201, 1992, 'IuOq71J02Ho', 'Ossie Davis, Denzel Washington, Albert Hall, Spike Lee, Angela Bassett, Delroy Lindo, Al Freeman, Theresa Randle, Lonette McKee, Kate Vernon', 'Biografia do famoso líder afro-americano (Denzel Washington) que teve o pai, um pastor, assassinado pela Klu Klux Klan e sua mãe internada por insanidade. Ele foi um malandro de rua e enquanto esteve preso descobriu o islamismo. Malcolm faz sua conversão religiosa como um discípulo messiânico de Elijah Mohammed (Al Freeman Jr.). Ele se torna um fervoroso orador do movimento e se casa com Betty Shabazz (Angela Bassett). Malcolm X ora uma doutrina de ódio contra o homem branco até que, anos mais tarde, quando fez uma peregrinação à Meca abranda suas convicções. Foi nesta época que se converteu ao original islamismo e se tornou um \"Sunni Muslim\", mudando o nome para El-Hajj Malik Al-Shabazz, mas o esforço de quebrar o rígido dogma da Nação Islã teve trágicos resultados.', 0, 'helena', NULL, NULL),
(NULL, 1340, 'O Plano Perfeito', 'Inside Man', 'Estados Unidos', 'Policial, Suspense', 'Spike Lee', '15481256915c4685fbe3400.jpg', 129, 2006, '8L2gh6S91P0', 'Denzel Washington, Clive Owen, Jodie Foster, Christopher Plummer, Chiwetel Ejiofor, Willem Dafoe, Kim Director, James Ransone, Cassandra Freeman', 'Assaltantes invadem um banco em Nova York e fazem reféns. A polícia chega ao local esperando resolver a situação rapidamente, mas os detetives Frazier e Mitchell se surpreendem com a inteligência e a frieza do líder dos bandidos, Dalton Russell. Quando a capacidade de Frazier começa a ser questionada, surge uma enigmática jogadora de pôquer e solicita um encontro a sós com Russell.', 0, 'helena', NULL, NULL),
(NULL, 1341, 'Chi-Raq', 'Chi-Raq', 'Estados Unidos', 'Drama', 'Spike Lee', '15481262405c468820d507e.jpg', 122, 2016, 'KHdjX9D4_RU', 'Nick Cannon, Teyonah Parris, Samuel L. Jackson, John Cusack, Wesley Snipes, Jennifer Hudson, Dave Chappelle, La La Anthony, Michelle Mitchenor, Angela Bassett', 'A cidade de Chicago está tomada pela violência e pelas brigas entre gangues rivais. Quando uma criança é morta por uma bala perdida, as mulheres se reúnem e decidem tomar uma atitude drástica: iniciar uma greve de sexo até que os homens concordem em abandonar as armas. Mas os maridos e namorados não vão aceitar essas novas regras com facilidade. Adaptado da peça de teatro grega \"Lysistrata\".\r\n', 0, 'helena', NULL, NULL),
(NULL, 1342, 'Jogada Decisiva', 'He Got Game', 'Estados Unidos', 'Drama', 'Spike Lee', '15481264885c4689180291a.jpg', 136, 1998, 'ilmrv1dpK4', 'Denzel Washington, Ray Allen, Milla Jovovich, Rosario Dawson, Hill Harper, Zelda Harris, Michael Jordan, John Turturro, Ned Beatty, Bill Nunn, Jim Brown, Lonette McKee', 'Presidiário pode conseguir reduzir sua pena caso convença o filho, um astro em ascensão no basquete, a estudar e jogar na Universidade do Estado. A tarefa não será fácil, já que o pai está preso por ter matado a mãe do garoto.', 0, 'helena', NULL, NULL),
(NULL, 1343, 'A Hora do Show', 'Bamboozled', 'Estados Unidos', 'Comédia dramática, Musical', 'Spike Lee', '15481271135c468b89726bb.jpg', 135, 2000, 'g8V5pvduhsg', 'Thomas Jefferson Byrd, Sarah Jones, Michael Rapaport, Damon Wayans, Jada Pinkett Smith, Savion Glover, Tommy Davidson, Mos Def, Paul Mooney', 'Pierre Delacroix (Damon Wayans) um escritor de séries de TV que não aguenta mais a tirania de seu chefe. Sendo o único empregado negro da companhia, Delacroix resolve propôr a idéia mais absurda que conseguira imaginar, um programa de TV estrelado por dois mendigos negros que denunciariam o estereótipo e o preconeceito do negro na televisão americana, exatamente no intuito de ser demitido. Mas a surpresa que o programa em questão não apenas se torna realidade como passa a ser um grande sucesso entre o público americano.', 0, 'helena', NULL, NULL),
(NULL, 1344, 'Gotti: Um Verdadeiro Padrinho Americano', 'Gotti', 'Estados Unidos', 'Biografia, Policial, Drama', 'Kevin Connolly', '15481276365c468d946cba0.jpg', 112, 2018, 'rgHUYUDaH8E', 'John Travolta, Spencer Lofranco, Kelly Preston, Pruitt Taylor Vince, Leo Rossi, William DeMeo, Ella Bleu Travolta, Megan Leonard, Tyler J. Olson, Jordan Trovillion, Lydia Hull', 'História do mafioso John Gotti, chefão da Família Gambino que liderava o crime organizado em Nova York durante muitos anos e falecido em 2002, enquanto cumpria pena de prisão perpétua.', 0, 'helena', NULL, NULL),
(NULL, 1345, 'Crimes em Happytime', 'The Happytime Murders', 'Estados Unidos', 'Comédia', 'Brian Henson', '15481278635c468e774066c.jpg', 91, 2018, 'BsWm2hrUH_E', 'Melissa McCarthy, Elizabeth Banks, Maya Rudolph, Leslie David Baker, Joel McHale, Bill Barretta, Ben Falcone, Dorien Davies, Cynthy Wu, Mitch Silpa, Michael McDonald', 'Phil Phillips é um ex-policial que agora trabalha como detetive particular. Após seu irmão ser assassinado, ele descobre que o responsável é um serial killer que pretende eliminar todos os integrantes do \"The Happytime Gang\", série de TV de grande sucesso nos anos 1980. Para investigar o caso, Phil é obrigado a trabalhar com sua ex-parceira Connie Edwards (Melissa McCarthy), responsável por sua expulsão da polícia, anos atrás.', 0, 'helena', NULL, NULL),
(NULL, 1346, 'Holmes & Watson', 'Holmes & Watson', 'Estados Unidos', 'Comédia, Policial', 'Etan Cohen', '15481281615c468fa1cde2f.jpg', 129, 2018, 'URwFmHj73Bw', 'Will Ferrel, John C. Reilly, Rebecca Hall, Kelly Macdonald, Ralph Fiennes, Hugh Laurie, Bella Ramsey, Rob Brydon, Paul Easter, Pam Ferris, Steve Coogan', 'Sherlock Holmes (Will Ferrell) e seu fiel parceiro Watson (John C.Reilly) precisam impedir o maior dos planos malignos de Moriarty (Ralph Fiennes): assassinar a rainha da Inglaterra.', 0, 'helena', NULL, NULL),
(NULL, 1347, 'Alma da Festa', 'Life of the Party', 'Estados Unidos', 'Comédia', 'Ben Falcone', '15481284445c4690bc2196b.jpg', 105, 2018, '500kFq5uei0', 'Melissa McCarthy, Luke Benward, Debby Ryan, Gillian Jacobs, Ben Falcone, Heidi Gardner, Molly Gordon, Adria Arjona, Maya Rudolph, Jacki Weaver, Julie Bowen, Jessie Ennis', 'Em choque após ser inesperadamente abandonada pelo marido de anos, Deanna (Melissa McCarthy) decide mudar completamente de vida largando a dedicação exclusiva aos afazeres domésticos para entrar na universidade. Matriculada na mesma turma da filha, que odeia a ideia, ela muda o nome para Dee Rock, diverte-se como nunca, conhece o estranho mundo das fraternidades, estuda um pouco e finalmente sente-se livre.', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1348, 'London Fields', 'London Fields', 'Estados Unidos', 'Suspense', 'Mathew Cullen', '15481286915c4691b3cb77c.jpg', 118, 2018, 'qLVZ8GFH3CQ', 'Amber Heard, Gemma Chan, Billy Bob Thornton, Theo James, Jim Sturgess, Cara Delevigne, Jason Isaacs, Jaimie Alexander, Lily Cole, Craig Garner', 'Nicola Six (Amber Heard) é clarividente e convive diariamente com a vívida premonição de seu próprio assassinato. Na contagem regressiva para a morte, ela se envolve romanticamente com três homens diametralmente distintos, um dos quais será seu algoz.', 0, 'helena', NULL, NULL),
(NULL, 1349, 'Death of a Nation', 'Death of a Nation', 'Estados Unidos', 'Documentário', 'Dinesh D\'Souza', '15481289895c4692dd20411.jpg', 108, 2018, 'UXPhLXuJ90I', 'Dinesh D\'Souza, Victoria Chilap, Pavel Kríz, Rafael Prazák, Donald Trump, Richard Spencer, Robert O. Paxton', 'Morte de uma nação: podemos salvar a América uma segunda vez? é um documentário político americano de 2018 do comentarista político conservador americano Dinesh D\'Souza. No documentário, D\'Souza compara o clima político em torno do 45º Presidente dos Estados Unidos, Donald Trump, ao do 16º Presidente, Abraham Lincoln.', 0, 'helena', NULL, NULL),
(NULL, 1350, 'Espectador Profissional', 'The Clapper', 'Estados Unidos', 'Comédia', 'Dito Montiel', '15481292005c4693b07155e.jpg', 89, 2018, '1tHDMEwNHNw', 'Amanda Seyfried, Leah Remini, Ed Helms, Brenda Vaccaro, Mark Cuban, Adam Levine Ranter, Tracy Morgan', 'Eddie Krumble (Ed Helms) tem o sonho de atuar profissionalmente, e, enquanto não tem sua grande chance, trabalha como \"espectador profissional\" de programas de auditório. Sua vida muda drasticamente quando um apresentador nota sua presença em todos os programas, e lança uma campanha para acharem tal figura oniprosente na televisão. A fama de Eddie começa a tomar proporções assustadoras, impactando diversas esferas de sua vida. ', 0, 'helena', NULL, NULL),
(NULL, 1351, 'A Justiceira', 'Peppermint', 'Estados Unidos', 'Suspense, Ação', 'Pierre Morel', '15481294155c46948726cf5.jpg', 101, 2018, 'w0WL_JmmRYQ', 'Jennifer Garner, John Gallagher Jr., John Ortiz, Juan Pablo Raba, Tyson Ritter, Cailey Fleming, Jeff Hephner, Richard Cabral, Pell James, Chris J. Johnson, Michael Mosley', 'Quando o marido e a filha são mortos a tiros diante de um parque de diversões, Riley (Jennifer Garner) acorda de um coma e passa os anos seguintes aprendendo a se tornar uma máquina de matar. No quinto aniversário da morte de sua família, ela tem como alvo todos os responsáveis: a gangue que cometeu o crime, os advogados que os libertaram e os policiais corruptos que permitiram que tudo acontecesse.', 0, 'helena', NULL, NULL),
(NULL, 1352, 'Malasartes e o Duelo com a Morte	', 'Malasartes e o Duelo com a Morte', 'Brasil', 'Fantasia, Comédia', 'Paulo Morelli', '15488697185c51e0563fb8a.jpg', 110, 2017, 's_qtWlhxhlA', 'Júlio Andrade, Jesuíta Barbosa, Milhem Cortaz, Ísis Valverde, Vera Holtz, Luciana Paes, Julia Ianina, Leandro Hassum', 'Pedro Malasartes (Jesuíta Barbosa) é um malandro que, por mais que seja apaixonado por Áurea (Ísis Valverde), não resiste a um rabo de saia. Devendo muito dinheiro a Próspero (Milhem Cortaz), irmão de sua amada, Malasartes precisa escapar dele ao mesmo tempo em que prega peças, sempre usando a inteligência, de forma a conseguir alguns trocados. Só que seu padrinho, a Morte (Julio Andrade) em pessoa, tem outros planos para ele.', 0, 'matheus', NULL, NULL),
(NULL, 1353, 'O Menino que Queria Ser Rei', 'The Kid Who Would Be King', 'Reino Unido', 'Aventura, Infantil, Fantasia', 'Joe Cornish', '15489420395c52fad709974.jpg', 0, 2019, 'B8nX_C36084', 'Rebecca Ferguson, Tom Taylor, Patrick Stewart, Rhianna Dorris, Louis Serkis, Dean Chaumoo, Angus Imrie, Denise Gough', 'Alex (Louis Serkis) é um garoto que enfrenta problemas no colégio, por sempre defender o amigo Bedders (Dean Chaumoo) dos valentões Lance (Tom Taylor) e Kaye (Rhianna Dorris). Um dia, ao fugir da dupla, ele se esconde em um canteiro de obras abandonado. Lá encontra uma espada encravada em uma pedra, da qual retira com grande facilidade. O que Alex não sabia era que a espada era a lendária Excalibur e que, como seu novo portador, precisa agora enfrentar a meia-irmã do rei Arthur, Morgana (Rebecca Ferguson), que está prestes a retomar seu poder. Para tanto, ele conta com a ajuda do mago Merlin (Angus Imrie), transformado em uma versão bem mais jovem.', 0, 'matheus', NULL, NULL),
(NULL, 1354, 'A Sereia - O Lago dos Mortos', 'Rusalka: Ozero myortvykh', 'Rússia', 'Fantasia, Terror, Romance', 'Svyatoslav Podgaevskiy', '15489423875c52fc33bd4f1.jpg', 90, 2018, 'https://www.youtube.com/watch?v=RUjyF3olqgU', 'Viktoriya Agalakova, Efim Petrunin, Sofia Shidlovskaya, Nikita Elenev, Sesil Plezhe, Igor Khripunov, Evgeniy Koryakovskiy, Koryakovskiy, Nadezhda Igoshina', 'Uma sereia malvada se apaixona por Roman, noivo de Marina, e tenta mantê-lo longe dela em seu Reino submerso. Marina terá apenas uma semana para superar o medo do oceano, lutar com monstros e se manter viva e na forma humana.', 0, 'matheus', NULL, NULL),
(NULL, 1355, 'Uma Nova Chance', 'Second Act', 'Estados Unidos', 'Comédia, Romance', 'Peter Segal', '15489426655c52fd49a054b.jpg', 103, 2018, 'stj3nJAtkiU', 'Jennifer Lopez, Vanessa Hudgens, Leah Remini, Treat Williams, Milo Ventimiglia, Annaleigh Ashford, Charlyne Yi, Alan Aisenberg', 'Maya (Jennifer Lopez) é uma caixa de supermercado insatisfeita com sua vida profissional. Porém, tudo muda com uma pequena alteração em seu currículo e suas redes sociais. Com sua experiência das ruas, habilidades excepcionais e a ajuda de seus amigos, ela se reinventa e se torna uma executiva de sucesso.', 0, 'matheus', NULL, NULL),
(NULL, 1356, 'Ultraje', 'Ultraje', 'Brasil', 'Documentário', 'Marc Dourdin', '15489431365c52ff201f666.jpg', 92, 2018, 'iLGBYjY0fy0', 'Roger Moreira, Edgard Scandurra, Maurício Defendi, André Midani', 'Uma das bandas mais reconhecidas do cenário musical brasileiro das últimas décadas, o Ultraje a Rigor invadiu os rádios e TVs na década de 1980. No fim da Ditadura Militar a banda estava por toda parte no dia a dia dos brasileiros. É assim que começa a trajetória do grupo, que tem sua carreira e a vida de seus membros, especialmente o líder, Roger, expostas nesse documentário.', 0, 'matheus', NULL, NULL),
(NULL, 1357, 'Climax', 'Climax', 'França', 'Drama, Suspense', 'Gaspar Noé', '15489436305c53010e387aa.jpg', 95, 2018, 'lq05aIRMsZ0', 'Sofia Boutella, Romain Guillermic, Souheila Yacoub, Kiddy Smile, Claude Gajan Maull, Giselle Palmer', 'Nos anos 90, um grupo de dançarinos urbanos se reúnem em um isolado internato, localizado no coração de uma floresta, para um importante ensaio. Ao fazerem uma última festa de comemoração, eles notam a atmosfera mudando e percebem que foram drogados quando uma estranha loucura toma conta deles. Sem saberem o por quê ou por quem, os jovens mergulham num turbilhão de paranoia e psicose. Enquanto para uns, parece o paraíso, para outros parece uma descida ao inferno.', 0, 'matheus', NULL, NULL),
(NULL, 1358, 'Fevereiros', 'Fevereiros', 'Brasil', 'Documentário', 'Marcio Debellian', '15489438125c5301c49a593.jpg', 75, 2019, '22RpBRBwtfM', 'Maria Bethânia, Caetano Veloso, Chico Buarque, Leandro Vieira', 'O documentário foi responsável por registrar a vitória da escola de samba carioca Estação Primeira de Mangueira em 2016, que teve um enredo homenageando a cantora baiana Maria Bethânia. Além de filmar a escola e os preparativos do barracão, a produção ainda acompanhou a cantora nas festas da Nossa Senhora da Purificação, na Bahia.', 0, 'matheus', NULL, NULL),
(NULL, 1359, 'Alita - Anjo de Combate', 'Alita: Battle Angel', 'Estados Unidos', 'Ação, Aventura, Ficção Científica, Romance', 'Robert Rodriguez', '15489449595c53063f523f8.jpg', 122, 2019, 'bF6wNMjPwJY', 'Rosa Salazar, Christoph Waltz, Jennifer Connelly, Mahershala Ali, Ed Skrein, Jackie Earle Haley, Keean Johnson, Eiza Gonzalez', 'Uma ciborgue é descoberta por um cientista. Ela não tem memórias de sua criação, mas possui grande conhecimento de artes marciais. Enquanto busca informações sobre seu passado, trabalha como caçadora de recompensas e descobre um interesse amoroso.', 0, 'matheus', NULL, NULL),
(NULL, 1360, 'O Roubo da Taça', 'O Roubo da Taça', 'Brasil', 'Comédia, Biografia', 'Caíto Ortiz', '15492296165c575e3048089.jpg', 85, 2016, '3YqTekc1z-c', 'Taís Araújo, Paulo Tiefenthaler, Mr. Catra, Stepan Nercessian, Milhem Cortaz, Charles Paraventi, Gustavo Novaes,Otto Jr., Danilo Grangheia, Hamilton Vaz Pereira, Pedro Wagner', 'Peralta é um simples corretor de seguros que começa a sofrer pressões de todos os lados. Em casa, sua namorada Dolores dá um ultimato: é casamento ou fim de papo. Por outro lado, suas dívidas que se amontoaram rapidamente, começam a ser cobradas. Quando tudo parece perdido, uma brilhante ideia cruza a cabeça de Peralta: um plano que vai resolver todos os seus problemas. Com a ajuda de seu amigo Borracha, um sujeito nada inteligente, Peralta decide roubar a Taça Jules Rimet de dentro dos cofres da CBF (Confederação Brasileira de Futebol). Baseado num caso real.', 0, 'helena', NULL, NULL),
(NULL, 1361, 'VIPs', 'VIPs', 'Brasil', 'Drama, Biografia', 'Toniko Melo', '15492299725c575f9434fc8.jpg', 95, 2010, 'ROOK2BBIwpA', 'Wagner Moura, Gisele Fróes, Emiliano Ruschel, Marcela Falci, Amaury Jr., Roger Gobeth, Juliano Cazarré, Arieta Corrêa, Norival Rizzo, Milhem Cortaz, Augusto Madeira', 'Marcelo (Wagner Moura) não consegue conviver com sua própria identidade, o que faz com que assuma a dos outros. Isto faz com que passe a ter diversos nomes, nos mais variados meios. Sonhando em ser um piloto de avião como o pai, aplica seguidos golpes e se envolve em inúmeras aventuras. Uma dos mais conhecidas é quando finge ser Henrique Constantino, filho do dono da companhia aérea Gol, durante um Carnaval no Recife. Inspirado na história real de Marcelo Nascimento da Rocha.', 0, 'helena', NULL, NULL),
(NULL, 1362, 'Marshall: Igualdade e Justiça ', 'Marshall', 'Estados Unidos', 'Drama, Biografia', 'Reginald Hudlin', '15492308395c5762f705532.jpg', 118, 2017, 'AcgYnSXxcvc', 'Chadwick Boseman, Josh Gad, Kate Hudson, Sterling K. Brown, Dan Stevens, James Cromwell, Jussie Smollett, Keesha Sharp, Sophia Bush, Rozonda Thomas', 'Antes de se tornar o primeiro juiz afro-descendente da Corte Suprema Americana, Thurgood Marshall (Chadwick Boseman) deve lutar num caso pode definir sua carreira: defender Josepho Spell (Sterling K. Brown), um homem negro que está sendo acusado de atacar uma socialite branca em seu quarto, mas que jura não ser o culpado do crime.', 0, 'helena', NULL, NULL),
(NULL, 1364, 'Saneamento Básico, O Filme', 'Saneamento Básico, O Filme', 'Brasil', 'Comédia', 'Jorge Furtado', '15492311245c57641435ff3.jpg', 112, 2007, 'buZmu3T8M9k', 'Wagner Moura, Fernanda Torres, Camila Pitanga, Lázaro Ramos, Bruno Garcia, Paulo José, Tonico Pereira, Lúcio Mauro Filho, Sandra Possani ', 'Os moradores de Linha Cristal, uma pequena vila de descendentes de colonos italianos localizada na serra gaúcha, reúnem-se para tomar providências a respeito da construção de uma fossa para o tratamento do esgoto. Eles elegem uma comissão, que é responsável por fazer o pedido junto à sub-prefeitura. A secretária da prefeitura reconhece a necessidade da obra, mas informa que não terá verba para realizá-la até o final do ano. Entretanto, a prefeitura dispõe de quase R$ 10 mil para a produção de um vídeo. Este dinheiro foi dado pelo governo federal e, se não for usado, será devolvido em breve. Surge então a idéia de usar a quantia para realizar a obra e rodar um vídeo sobre a própria obra, que teria o apoio da prefeitura. Porém a retirada da quantia depende da apresentação de um roteiro e de um projeto do vídeo, além de haver a exigência que ele seja de ficção. Desta forma os moradores se reúnem para elaborar um filme, que seria estrelado por um mostro que vive nas obras de construção de uma fossa.', 0, 'helena', NULL, NULL),
(NULL, 1365, 'Percy Jackson e o Ladrão de Raios', 'Percy Jackson & The Lightning Thief', 'Estados Unidos', 'Aventura, Fantasia', 'Chris Columbus', '15492312875c5764b7920d2.jpg', 118, 2010, 'KKmBd3PJ8CE', 'Logan Lerman, Brandon T. Jackson, Alexandra Daddario, Pierce Brosnan, Uma Thurman, Sean Bean, Melina Kanakaredes, Catherine Keener, Rosario Dawson', 'Percy Jackson (Logan Lerman) é um jovem que enfrenta problemas na escola, devido ao que acredita ser dislexia e déficit de atenção. Ele foi criado por sua mãe, Sally (Catherine Keener), e vive com Gabe Ugliano (Joe Pantoliano), seu padrasto, que odeia. Após ser atacado em plena excursão escolar, é revelado a Percy que ele é um semideus, ou seja, filho do deus Poseidon (Kevin McKidd) com uma humana, e possui poderes. Protegido por Grover Underwood (Brandon T. Jackson), ele é levado ao acampamento dos meio sangue, onde está em segurança. Lá ele tem Chiron (Pierce Brosnan) como tutor e passa a treinar para se tornar um grande guerreiro. Só que Percy é acusado de ter roubado o raio de Zeus (Sean Bean), uma poderosa arma de destruição que pode fazer com que os deuses entrem em guerra. É quando Hades (Steve Coogan) visita o acampamento e oferece a Percy uma troca: que ele entregue o raio, o qual não possui, em troca da devolução de sua mãe, que faleceu em meio à fuga. Ele então parte para chegar ao Mundo Inferior, onde vivem Hades e Perséfone (Rosario Dawson), juntamente com Grover e Annabeth Chase (Alexandra Daddario), uma poderosa guerreira que conheceu no acampamento.', 0, 'matheus', NULL, NULL),
(NULL, 1366, 'O Céu de Outubro', 'October Sky', 'Estados Unidos', 'Drama, Biografia', 'Joe Johnston', '15492315815c5765dd5fb75.jpg', 108, 1999, '8u_t2-UIckQ', 'Jake Gyllenhaal, Chris Cooper, Laura Dern, Chris Owen, Chad Lindberg, Natalie Canerday, William Lee Scott, Chris Ellis, Scott Miles', 'No final dos anos 50, o adolescente Homer Hickam (Jake Gyllenhaal) vive em uma cidade onde a mineração é a maior empregadora local. Ao saber que os russos colocaram o satélite Sputnik em órbita, Homer começa a sonhar em também colocar um foguete seu em órbita. Logo ele convence alguns amigos a participarem do projeto e, com o apoio de uma professora, dá início ao projeto que irá mudar sua vida para sempre.', 0, 'helena', NULL, NULL),
(NULL, 1367, 'Percy Jackson e o Mar de Monstros', 'Percy Jackson: Sea of Monsters', 'Estados Unidos', 'Aventura, Fantasia', 'Thor Freudenthal', '15492317245c57666cc7f4b.jpg', 106, 2013, 'MxCm6GbaqaU', 'Logan Lerman, Brandon T. Jackson, Alexandra Daddario, Jake Abel, Douglas Smith, Stanley Tucci, Leven Rambin, Nathan Fillion', 'Percy Jackson (Logan Lerman) e seus amigos Annabeth (Alexandra Daddario) e Grover (Brandon T. Jackson) levam uma vida normal no Acampamento Meio-Sangue, apesar de Percy sentir falta do pai, Poseidon, que nunca mais manteve contato. Um dia, o local é atacado por um monstro enviado por Luke (Jake Abel), que consegue romper a proteção mágica do acampamento. Com o local em perigo, Percy e os amigos partem em uma aventura em busca do velocino de ouro, um objeto místico que pode revitalizar a árvore mágica responsável pela proteção do acampamento. O que eles não esperavam era que Luke estaria atrás do mesmo objeto, já que deseja trazer à vida o poderoso Cronos, derrotado por Zeus, Poseidon e Hades há milênios atrás.', 0, 'matheus', NULL, NULL),
(NULL, 1368, 'Fúria de Titãs', 'Clash of the Titans', 'Estados Unidos', 'Ação, Aventura, Fantasia, Épico', 'Louis Leterrier', '15492320665c5767c240657.jpg', 106, 2010, 'RGeD4joet_Y', 'Sam Worthington, Liam Neeson, Ralph Fiennes, Gemma Arterton, Jason Flemyng, Mads Mikkelsen, Nicholas Hoult, Danny Huston', 'Perseu (Sam Worthington) descobre que é o filho mortal de Zeus (Liam Neeson), mas recusa-se a aceitar tal condição. Contudo, para salvar a cidade de Argos da fúria dos deuses do olimpo e da vingança de seu tio Hades (Ralph Fiennes), ele vai ter que enfrentar uma perigosa jornada contra terríveis criaturas como a Medusa para salvar os simples mortais e a bela Andrômeda (Alexa Davalos) do sacrifício para o monstro Kraken.', 0, 'matheus', NULL, NULL),
(NULL, 1369, 'Legalize Já - Amizade Nunca Morre', 'Legalize Já - Amizade Nunca Morre', 'Brasil', 'Biografia, Drama', 'Johnny Araújo, Gustavo Bonafé', '15492321665c576826f2d4e.jpg', 90, 2018, 'kmzZsvQtPlE', 'Renato Góes, Ícaro Silva, Ernesto Alterio, Rafaela Mandelli, Stepan Nercessian', 'Skunk (Ícaro Silva) é um jovem músico, revoltado com a opressão e o preconceito diários sofrido pelas comunidades de baixa renda, que busca expor sua insatisfação através da música. Um dia, ao fugir da polícia, ele literalmente esbarra em Marcelo (Renato Góes), um vendedor de camisas de bandas de heavy metal. O gosto pelo mesmo estilo musical os aproxima, assim como a habilidade de Marcelo em compor letras de forte cunho social e questionador. Impulsionado por Skunk, ele adentra o universo da música e, juntos, formam a banda Planet Hemp.', 0, 'helena', NULL, NULL),
(NULL, 1370, 'Punhos de Sangue', 'Chuck', 'Estados Unidos', 'Drama, Biografia', 'Philippe Falardeau', '15492324265c57692a457da.jpg', 98, 2017, 'kmzZsvQtPlE', 'Liev Schreiber, Elisabeth Moss, Ron Perlman, Naomi Watts, Jim Caffigan, Pooch Hall, Morgan Spector, Michael Rapaport, Sadie Sink, Jason Jones ', 'A história real de Chuck Wepner (Liev Schreiber), vendedor de bebidas na cidade de Nova Jersey e boxeador peso-pesado que inspirou a saga \"Rocky\" ao ir até o 15º round lutando contra o então maior pugilista do mundo, Muhammad Ali.', 0, 'helena', NULL, NULL),
(NULL, 1371, 'Fúria de Titãs 2', 'Wrath of the Titans', 'Estados Unidos', 'Ação, Aventura, Fantasia, Épico', 'Jonathan Liebesman', '15492325425c57699e69996.jpg', 99, 2012, 'jrDOQt5lesc', 'Sam Worthington, Liam Neeson, Ralph Fiennes, Édgar Ramírez, Toby Kebbell, Rosamund Pike, Bill Nighy, Danny Huston', 'Dez anos depois, o semideus Perseus (Sam Worthington) leva uma vida pacata de pescador enquanto cria seu filho, Hélio (John Bell). Os deuses estão enfraquecidos, já que os humanos não estão mais rezando para eles. Esta situação permite que Hades (Ralph Fiennes) e Ares (Édgar Ramírez) elaborem um plano para libertar Cronos, o pai de Hades, Zeus (Liam Neeson) e Poseidon (Danny Huston), que está aprisionado no tártaro. Para que o plano funcione Hades e Ares capturam Zeus, o que faz com que Perseus parta para salvá-lo.', 0, 'matheus', NULL, NULL),
(NULL, 1372, 'O Dono do Jogo', 'Pawn Sacrifice', 'Estados Unidos', 'Biografia, Drama', 'Edward Zwick', '15492327705c576a82de6bd.jpg', 115, 2014, '0MMIhrYkvjQ', 'Tobey Maguire, Liev Schreiber, Michael Stuhlbarg, Peter Sarsgaard, Lily Rabe, Robin Weigert, Aiden Lovekamp, Sophie Nélisse  ', 'Os soviéticos eram considerados os reis do xadrez e Boris Spassky (Liev Schreiber) era tido como invencível. Mas eis que Bobby Fischer (Tobey Maguire), jovem fenômeno norte-americano, o desafia no Campeonato Mundial de 1972, em plena Guerra Fria. EUA e URSS se enfrentam no tabuleiro em Reykjavík, capital da Islândia, e apenas um enxadrista sairá vencedor.', 0, 'helena', NULL, NULL),
(NULL, 1373, 'Imortais', 'Immortals', 'Estados Unidos', 'Ação, Épico, Drama, Fantasia, Romance', 'Tarsem Singh', '15492330365c576b8c4a7fe.jpg', 110, 2011, '2IG3iT0sVGk', 'Henry Cavill, Mickey Rourke, Luke Evans, Stephen Dorff, Freida Pinto, John Hurt, Isabel Lucas, Kellan Lutz', 'Grécia, 1228 A.C. O rei Hiperion (Mickey Rourke) está em busca do arco de Épiro, uma poderosa arma que pode matar até mesmo deuses. Para encontrá-lo ele conduz seu exército a todos os vilarejos, deixando um rastro de destruição. Theseus (Henry Cavill) vive tranquilamente em uma pequena vila encravada na montanha, ao lado da mãe e de um senhor (John Hurt) que é seu tutor desde quando era criança. O que Theseus não sabia era que o velho na verdade era Zeus (Luke Evans), o rei dos deuses, que vinha à Terra sob a forma humana por acreditar em seu potencial. Quando as tropas de Hiperion chegam à vila elas matam a mãe de Theseus e o capturam. No cativeiro ele está entregue à morte, mas recebe apoio de Phaedra (Freida Pinto), uma vidente que também está presa e teve uma visão em que Theseus empunha o cobiçado arco de Épiro.', 0, 'matheus', NULL, NULL),
(NULL, 1374, 'A Colônia', 'The Colony', 'Estados Unidos', 'Ação, Suspense, Ficção Científica', 'Jeff Renfroe', '15492338605c576ec40b8dc.jpg', 95, 2013, 'ZENI7UC3WQo', 'Laurence Fishburne, Kevin Zegers, Bill Paxton, Charlotte Sullivan, John Tench, Atticus Dean Mitchell, Dru Viergever, Romano Orzari', 'No futuro, uma nova Era do Gelo afeta a Terra, destruindo quase toda a população do planeta. Os raros sobreviventes encontram abrigos subterrâneos, onde a vida é precária. Mas logo um pequeno grupo de resistentes vai descobrir uma ameaça ainda mais perigosa do que o clima hostil.', 0, 'matheus', NULL, NULL),
(NULL, 1375, 'Amor e Revolução', 'Colonia', 'Alemanha', 'Drama, Histórico, Romance', 'Florian Gallenberger', '15492342595c577053ecadf.jpg', 106, 2016, '7Igi-9H68Ls', 'Emma Watson, Daniel Brühl, Michael Nyqvist, Vicky Krieps, Julian Ovenden, César Bordón, Nicolás Barsoff', 'Chile, 1973. Em meio ao golpe de estado que derrubou o presidente eleito Salvador Allende e possibilitou a ascensão do ditador Augusto Pinochet, as massas estão nas ruas protestando, entre eles um casal alemão, Lena (Emma Watson) e Daniel (Daniel Brühl). Quando o rapaz é levado pela polícia secreta de Pinochet, Lena procura por ele e descobre que seu amado está em um lugar chamado Colonia Dignidad, uma suposta missão de caridade dirigida por um pregador (Michael Nyqvist), só que na verdade é uma prisão de onde ninguém nunca escapou. A fim de encontrar Daniel, a moça decide se juntar ao culto religioso da Colonia.', 0, 'matheus', NULL, NULL),
(NULL, 1376, 'Escape Room', 'Escape Room', 'Estados Unidos', 'Suspense', 'Adam Robitel', '15497293855c5efe69c27d7.jpg', 99, 2019, 'CpzgveGfTJ4', 'Taylor Russell, Logan Miller, Jay Ellis, Tyler Labine, Deborah Ann Woll, Adam Robitel, Nik Dodani, Tyler Labine, Jessica Sutton', 'Passando por momentos complicados em suas respectivas vidas, seis estranhos acabam sendo misteriosamente convidados para um experimento inusitado: trancados em uma imersiva sala enigmática cheia de armadilhas, eles ganharão um milhão de dólares caso consigam sair. Mas quando percebem que os perigos são mais letais do que imaginavam, precisam agir rápido para desvendar as pistas que lhes são dadas.', 0, 'helena', NULL, NULL),
(NULL, 1377, 'A Corrente do Bem ', 'Pay It Forward', 'Estados Unidos', 'Comédia dramática', 'Mimi Leder', '15497296575c5eff79073b0.jpg', 123, 2000, 'vBijLsUiVTU', 'Kevin Spacey, Helen Hunt, Haley Joel Osment, Jay Mohr, Jon Bon Jovi, James Caviezel, Angie Dickinson, David Ramsey', 'Eugene Simonet (Kevin Spacey), um professor de Estudos Sociais, faz um desafio aos seus alunos em uma de suas aulas: que eles criem algo que possa mudar o mundo. Trevor McKinney (Haley Joel Osment), um de seus alunos e incentivado pelo desafio do professor, cria um novo jogo, chamado \"pay it forward\", em que a cada favor que recebe você retribui a três outras pessoas. Surpreendentemente, a idéia funciona, ajudando o próprio Eugene a se desvencilhar de segredos do passado e também a mãe de Trevor, Arlene (Helen Hunt), a encontrar um novo sentido em sua vida.', 0, 'helena', NULL, NULL),
(NULL, 1378, '22 de Julho', '22 July', 'Noruega', 'Drama, Suspense, Biografia', 'Paul Greengrass', '15497300525c5f0104f3dc3.jpg', 143, 2018, '3L-aNH8Yyxw', 'Anders Danielsen Lie, Jonas Strand Gravli, Jon Øigarden, Maria Bock, Thorbjørn Harr, Turid Gunnes', 'Noruega, 2011. Anders Behring Breivik, consumido pelos seus ideias fundamentalistas cristãos e anti-islâmicos, mata 75 pessoas a tiros em um acampamento na Ilha de Utoya. Os sobreviventes do ataque pedem justiça ao governo Norueguês, enquanto os advogados do terrorista condenado se mobilizam para defendê-lo perante a lei.\r\n', 0, 'helena', NULL, NULL),
(NULL, 1379, 'Apóstolo', 'Apostle', 'Estados Unidos', 'Suspense', 'Gareth Evans', '15497305535c5f02f95e381.jpg', 130, 2018, 'K6p3Yv_a1d4', 'Dan Stevens, Lucy Boynton, Kristine Froseth, Michael Sheen, Bill Milner, Annes Elwy, Elen Rhys, Mark Lewis Jones', 'No ano de 1905, Thomas Richardson (Dan Stevens) viaja para uma ilha remota em busca de sua irmã. Um misterioso culto religioso a raptou e agora pede uma grande quantia de dinheiro por seu resgate. Porém, eles logo percebem que mexer com Thomas foi um erro e ele torna sua missão desencavar todas as mentiras sob as quais o culto foi construído.', 0, 'helena', NULL, NULL),
(NULL, 1380, 'Uma Aventura Lego', 'The Lego Movie', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia', 'Phil Lord, Christopher Miller', '15499053875c61adebd5c12.jpg', 100, 2014, '5iWzrFGziA4', 'Chris Pratt, Will Ferrell, Will Arnett, Elizabeth Banks, Morgan Freeman, Craig Berry, Alison Brie, Liam Neeson, Channing Tatum, Nick Offerman', 'Emmet (Chris Pratt) é um Lego comum, até o dia em que é confundido com o Master Builder, o grande criador deste mundo de brinquedo, por ter encontrado a famosa peça de resistência. Este peça, procurada por todos há séculos, seria capaz de desarmar uma poderosa máquina criada pelo presidente do país, o perverso Sr. Negócios, que pretende colar todas as peças e impedir as mudanças no sistema. Mesmo sem ter grandes habilidades como criador, Emmet gosta de ser considerado um Lego especial, e faz de tudo para merecer a confiança de seus amigos, que incluem a rebelde Mega Estilo, o sábio Vitrúvius, e o gato-unicórnio UniKitty.', 0, 'matheus', NULL, NULL),
(NULL, 1381, 'Uma Aventura Lego 2', 'The Lego Movie 2: The Second Part', 'Estados Unidos', 'Animação, Aventura, Comédia, Infantil, Fantasia', 'Mike Mitchell, Trisha Gum', '15499057455c61af518f76a.jpg', 108, 2019, 'HIAkJh7UDX0', 'Chris Pratt, Will Ferrell, Will Arnett, Elizabeth Banks, Jason Momoa, Tiffany Haddish, Alison Brie, Stephanie Beatriz, Channing Tatum, Nick Offerman, Charlie Day', 'Cinco anos após os eventos do primeiro filme, a batalha contra inimigos alienígenas faz com que a cidade Lego torne-se Apocalipsópolis, em um futuro distópico onde nada mais é incrível. Neste contexto, Emmet constrói uma casa para que possa viver ao lado de Lucy, mas ela ainda o considera ingênuo demais. Quando um novo ataque captura não apenas Lucy, mas também Batman, Astronauta, UniKitty e o pirata, levando-os ao sistema planetário de Manar, cabe a Emmet construir uma espaçonave e partir em seu encalço. No caminho ele encontra Rex Perigoso, um navegante solitário que decide ajudá-lo em sua jornada.', 0, 'matheus', NULL, NULL),
(NULL, 1382, 'LEGO Batoman: O Filme', 'The Lego Batman Movie', 'Estados Unidos', 'Animation, Action, Comedy, Family', 'Chris McKay', '15499060785c61b09e3391e.jpg', 104, 2017, 'wGxYas0-QPY', 'Will Arnett, Zach Galifianakis, Michael Cera, Rosario Dawson, Ralph Fiennes, Billy Dee Williams, Jenny Slate, Mariah Carey, Chaning Tatum, Zoë Kravits, Conan O\'Brien, Jonah Hill, Adam Devine', 'Extremamente egocêntrico, Batman leva uma vida solitária como o herói de Gotham City. Apesar disto, ele curte bastante o posto de celebridade e o fato de sempre ser chamado pela polícia quando surge algum problema - que ele, inevitavelmente, resolve. Quando o comissário Gordon se aposenta, quem assume em seu lugar é sua filha Barbara Gordon, que deseja implementar alguns métodos de eficiência de forma que a polícia não seja tão dependente do Batman. O herói, é claro, não gosta da ideia, por mais que sinta uma forte atração por Barbara. Paralelamente, o Coringa elabora um plano contra o Homem-Morcego motivado pelo fato de que ele não o reconhece como seu maior arqui-inimigo.', 0, 'matheus', NULL, NULL),
(NULL, 1383, 'O Galã', 'O Galã', 'Brasil', 'Comédia', 'Francisco Ramalho Jr.', '15499065765c61b2905646f.jpg', 97, 2019, 'ZLDOOIAPRQ8', 'Thiago Fragoso, Christine Fernandes, Fiuk, Thiago Fragoso, Luiz Henrique Nogueira, Christiana Ubach', 'Júlio (Thiago Fragoso) aspira se tornar um grande ator, mas a grande maioria de suas empreitadas nas telas costumam dar errado. Quando o dinheiro aperta, ele resolve recorrer ao seu meio irmão Beto (Luiz Henrique Nogueira), um obcecado roteirista de novelas que vive em reclusão, com quem ele não tem muito contato. O ator acredita que sua grande chance será concedida pelo irmão, mas a relação entre os dois se torna a cada dia mais insustentável. ', 0, 'matheus', NULL, NULL),
(NULL, 1384, 'Army of One', 'Army of One', 'Estados Unidos', 'Aventura, Biografia, Ação', 'Larry Charles', '15502718305c6745569b4f2.jpg', 92, 2016, '7qA-kuEdlXk', 'Nicolas Cage, Russell Brand, Wendi McLendon-Covey, Amer Chadha-Patel, Rainn Wilson, Paul Scheer, Denis O\'Hare, Will Sasso, Zakaria Atifi', 'Gary Faulkner acredita ter recebido uma missão diretamente de Deus: deve encontrar Bin Laden e assassiná-lo sozinho. Assim, esse homem parte para o Paquistão, sem experiência e sem armas, para encontrar o seu inimigo.', 0, 'helena', NULL, NULL),
(NULL, 1385, 'O Homem Mais Procurado', 'A Most Wanted Man', 'Reino Unido', 'Crime, Drama, Suspense', 'Anton Corbijn', '15502722325c6746e827cb0.jpg', 122, 2014, 'KD39uaSK1Rs', 'Grigoriy Dobrygin, Philip Seymour Hoffman, Homayoun Ershadi, Mehdi Dehbi, Rachel McAdams, Willem Dafoe, Robin Wright, Nina Hoss, Daniel Brühl, Vicky Krieps', 'Depois de ser brutalmente torturado, um imigrante de origem chechena e russa faz uma viagem à comunidade islâmica de Hamburgo, tentando resgatar a grande herança que seu pai teria lhe deixado. A chegada deste homem desperta a curiosidade das polícias secretas alemã e americana, que passam a acompanhar seus passos. Enquanto a investigação avança, todos fazem a mesma pergunta sobre o imigrante: seria ele apenas uma vítima ou um extremista com um plano muito bem elaborado?', 0, 'helena', NULL, NULL),
(NULL, 1387, 'Caçada', 'Manhunt: The Inside Story of the Hunt for Bin Laden', 'Estados Unidos', 'Documentário', 'Greg Barker', '15502728735c674969ce2f8.jpg', 102, 2013, 'w06I6_aTuHc', 'Nada Bakos', 'Um fascinante e profundo relato sobre a caçada a Osama bin Laden, com depoimentos de analistas e agentes da CIA, que o seguiram por quase duas décadas.', 0, 'helena', NULL, NULL),
(NULL, 1388, 'Osama', 'Osama', 'Afeganistão', 'Drama', 'Siddiq Barmak', '15502740165c674de0381fd.jpg', 83, 2003, 'B45o08SssgA', 'Marina Golbahari, Khwaja Nader, Mohammad Arif Herati, Zubaida Sahar', 'Em pleno regime Talibã no Afeganistão uma menina é obrigada a cortar o cabelo e se vestir como se fosse um menino para ajudar sua família, que é composta apenas de mulheres. A farsa é descoberta na escola, quando um garoto percebe que ela está sangrando por entre as pernas.', 0, 'helena', NULL, NULL),
(NULL, 1389, 'O Óleo de Lorenzo', 'Lorenzo\'s Oil', 'Estados Unidos', 'Drama', 'George Miller', '15502760095c6755a9c038e.jpg', 129, 1992, '81YZS7IeDHA', 'Nick Nolte, Susan Sarandon, Peter Ustinov, Kathleen Wilhoite, Zack O\'Malley Greenburg, Kathleen Willhoite, Margo Martindale, Gerry Bamman, Ann Dowd, Maduka Steady', 'Um garoto levava uma vida normal até que, quando tinha seis anos, estranhas coisas aconteceram, pois ele passou a ter diversos problemas de ordem mental que foram diagnosticados como ALD, uma doença extremamente rara que provoca uma incurável degeneração no cérebro, levando o paciente à morte em no máximo dois anos. Os pais do menino ficam frustrados com o fracasso dos médicos e a falta de medicamento para uma doença desta natureza. Assim, começam a estudar e a pesquisar sozinhos, na esperança de descobrir algo que possa deter o avanço da doença.', 0, 'helena', NULL, NULL),
(NULL, 1390, 'Sing - Quem Canta Seus Males Espanta', 'Sing', 'Estados Unidos', 'Comédia musical, Animação', 'Garth Jennings', '15502763505c6756fe8e271.jpg', 108, 2016, 'F1zyebZx22g', 'Matthew McConaughey, Reese Witherspoon, Seth MacFarlane, Scarlett Johansson, Tori Kelly, Taron Egerton, Nick Offerman, Jennifer Hudson, John C. Reilly, Garth Jennings', 'Um empolgado coala chamado Buster decide criar uma competição de canto para aumentar os rendimentos de seu antigo teatro. A disputa movimenta o mundo animal e promove a revelação de diversos talentos da cidade, todos de olho nos 15 minutos de fama e US$ 100 mil dólares de prêmio.', 0, 'helena', NULL, NULL),
(NULL, 1391, 'Quatro Vidas de um Cachorro', 'A Dog\'s Purpose', 'Estados Unidos', 'Aventura, Comédia dramática, Família', 'Lasse Hallström', '15502766745c6758426b4ce.jpg', 100, 2017, 'ZGkOik10Itg', 'Josh Gad, Dennis Quaid, Peggy Lipton, Bryce Gheisar, KJ Apa, Britt Robertson, Juliet Rylance, Luke Kirby, Pooch Hall, John Ortiz', 'Um cachorro morre e reencarna várias vezes na Terra. Embora encontre novas pessoas e viva muitas aventuras, ele mantém sempre o sonho de reencontrar o seu primeiro dono, Ethan, seu maior amigo e o grande amor de sua vida.', 0, 'helena', NULL, NULL),
(NULL, 1392, 'Serra Pelada', 'Serra Pelada', 'Brasil', 'Drama', 'Heitor Dhalia', '15502770435c6759b3e3b44.jpg', 102, 2013, 'NqOE6eUeND8', 'Juliano Cazarré, Júlio Andrade, Wagner Moura, Sophie Charlotte, Matheus Nachtergaele, Jesuíta Barbosa, Eline Porto, Demick Lopes, Silvero Pereira, Lyu Arisson, Adriano Barroso', 'Juliano (Juliano Cazarré) e Joaquim (Júlio Andrade) são grandes amigos que ficam empolgados ao tomar conhecimento de Serra Pelada, o maior garimpo a céu aberto do mundo, localizado no estado do Pará. A dupla resolve deixar São Paulo e partir para o local, sonhando com a riqueza. Só que, pouco após chegarem, tudo muda na vida deles: Juliano se torna um gângster, enquanto que Joaquim deixa para trás os valores que sempre prezou.', 0, 'helena', NULL, NULL),
(NULL, 1393, 'Réquiem para um Sonho', 'Requiem for a Dream', 'Estados Unidos', 'Drama', 'Darren Aronofsky', '15502774625c675b5604e3b.jpg', 102, 2000, '6bz4hEsQZnY', 'Ellen Burstyn, Jared Leto, Jennifer Connelly, Marlon Wayans, Christopher McDonald, Hubert Selby Jr., Louise Lasser, Keith David, Marcia Jean Kurtz', 'Uma visão frenética, perturbada e única sobre pessoas que vivem em desespero e ao mesmo tempo cheio de sonhos. Harry Goldfarb (Jared Leto) e Marion Silver (Jennifer Connelly) formam um casal apaixonado, que tem como sonho montar um pequeno negócio e viverem felizes para sempre. Porém, ambos são viciados em heroína, o que faz com que repetidamente Harry penhore a televisão de sua mãe (Ellen Burstyn), para conseguir dinheiro. Já Sara, mãe de Harry, viciada em assistir programas de TV. Até que um dia recebe um convite para participar do seu show favorito, o \"Tappy Tibbons Show\", que transmitido para todo o país. Para poder vestir seu vestido predileto, Sara começa a tomar pílulas de emagrecimento, receitadas por seu médico. Só que, aos poucos, Sara começa a tomar cada vez mais pílulas até se tornar uma viciada neste medicamento.', 0, 'helena', NULL, NULL),
(NULL, 1394, 'O Quarto do Suicídio', 'Suicide Room', 'Polônia', 'Drama, Suspense', 'Jan Komasa', '15502779375c675d3104313.jpg', 110, 2011, 'emxcY2f8KBg', 'Jakub Gierszal, Roma Gasiorowska, Agata Kulesza, Krzysztof Pieczynski', 'Dominik é um garoto comum. Ele tem um monte de amigos, pais ricos e dinheiro para gastar em roupas de marca. Mas um beijo inocente com um colega muda tudo. Ele sofre bullying e começa a isolar-se do mundo exterior, vivendo todo o seu tempo em seu computador. Ele conhece uma garota anônima que lhe apresenta a “sala suicida”, um lugar do qual não há escapatória. Pego em uma armadilha tecida por suas próprias emoções, Dominik torna-se enredado numa teia de intrigas e gradualmente perde o que ele mais aprecia.', 0, 'helena', NULL, NULL),
(NULL, 1395, 'IO', 'IO', 'Estados Unidos', 'Ficção Científica', 'Jonathan Helpert', '15502782025c675e3a63eeb.jpg', 96, 2019, 'gROwjIPXU1k', 'Margaret Qualley, Anthony Mackie, Danny Huston, Tom Payne', 'Em uma Terra pós-apocalíptica, Sam, uma adolescente, é uma das últimas pessoas no planeta, que está sendo evacuado. Com o último transporte programado para deixar o planeta, ela precisa decidir entre se juntar ao restante da humanidade ou permanecer na Terra.', 0, 'helena', NULL, NULL),
(NULL, 1396, 'O Homem que Copiava', 'O Homem que Copiava', 'Brasil', 'Drama, Comédia', 'Jorge Furtado', '15502785145c675f72df368.jpg', 123, 2003, 'AdFru6F7FvM', 'Lázaro Ramos, Leandra Leal, Luana Piovani, Pedro Cardoso, Carlos Cunha Filho, Sheron Menezzes, Renata de Lélis, Paulo José, Júlio Andrade', 'André (Lázaro Ramos) é um jovem de 20 anos que trabalha na fotocopiadora da papelaria Gomide, localizada em Porto Alegre. André mora com a mãe e tem uma vida comum, basicamente vivendo de casa para o trabalho e realizando sempre as mesmas atividades. Num dia André se apaixona por Sílvia (Leandra Leal), uma vizinha, a qual passa a observar com os binóculos em seu quarto. Decidido a conhecê-la melhor, André descobre que ela trabalha em uma loja de roupas e, para conseguir uma aproximação, tenta de todas as formas conseguir 38 reais para comprar um suposto presente para sua mãe.', 0, 'helena', NULL, NULL),
(NULL, 1397, 'Madame Satã', 'Madame Satã', 'Brasil', 'Biografia, Drama', 'Karim Aïnouz', '15502788245c6760a88dc77.jpg', 105, 2002, 'U2oqh0DqCas', 'Lázaro Ramos, Marcélia Cartaxo, Flavio Bauraqui, Fellipe Marques, Renata Sorrah, Emiliano Queiroz, Sacha Ambak, Ricardo Blat, Gero Camilo', 'Rio de Janeiro, 1932. No bairro da Lapa vive encarcerado na prisão João Francisco (Lázaro Ramos), artista transformista que sonha em se tornar um grande astro dos palcos. Após deixar o cárcere, João passa a viver com Laurita (Marcélia Cartaxo), prostituta e sua \"esposa\"; Firmina, a filha de Laurita; Tabu (Flávio Bauraqui), seu cúmplice; Renatinho (Felippe Marques), sem amante e também traidor; e ainda Amador (Emiliano Queiroz), dono do bar Danúbio Azul. É neste ambiente que João Francisco irá se transformar no mito Madame Satã, nome retirado do filme Madame Satã (1932), dirigido por Cecil B. deMille, que João Francisco viu e adorou.', 0, 'helena', NULL, NULL),
(NULL, 1398, 'Ó Pai, Ó', 'Ó Pai, Ó', 'Brasil', 'Comédia musical', 'Monique Gardenberg', '15502791265c6761d621725.jpg', 96, 2007, 'le33s_JZhLQ', 'Lázaro Ramos, Dira Paes, Wagner Moura, Stênio Garcia, Emanuelle Araújo, Lyu Arisson, Érico Brás, Luciana Souza, Edvana Carvalho, Tânia Tôko, Rejane Maia, Auristela Sá, Valdinéia Soriano', 'Em um animado cortiço do centro histórico do Pelourinho, em Salvador, tudo é compartilhado pelos seus moradores, especialmente a paixão pelo Carnaval e a antipatia pela síndica do prédio, Dona Joana (Luciana Souza). Todos tentam encontrar um lugar nos últimos dias do Carnaval, seja trabalhando ou brincando. Incomodada com a farra dos condôminos, Dona Joana decide puni-los, cortando o fornecimento de água do prédio. A falta d\'água faz com que o aspirante a cantor Roque (Lázaro Ramos); o motorista de táxi Reginaldo (Érico Brás) e sua esposa Maria (Valdinéia Soriano); o travesti Yolanda (Lyu Arisson), amante de Reginaldo; a jogadora de búzios Raimunda (Cássia Vale); o homossexual dono de bar Neuzão (Tânia Tôko) e sua sensual sobrinha Rosa (Emanuelle Araújo); Carmen (Auristela Sá), que realiza abortos clandestinos e ao mesmo tempo mantém um pequeno orfanato em seu apartamento; Psilene (Dira Paes), irmã de Carmen que está fazendo uma visita após um período na Europa; e a Baiana (Rejane Maia), de quem todos são fregueses; se confrontem e se solidarizem perante o problema.', 0, 'helena', NULL, NULL),
(NULL, 1399, 'Aquamarine', 'Aquamarine', 'Estados Unidos', 'Comédia, Fantasia, Família', 'Elizabeth Allen Rosenbaum', '15502794245c6763009fe1b.jpg', 104, 2006, 'CIavKkromVc', 'Emma Roberts, JoJo, Sara Paxton, Jake McDorman, Arielle Kebbel, Tammin Sursok, Claudia Karvan, Lincoln Lewis', 'Claire (Emma Roberts) e Hailey (JoJo) são grandes amigas, que se envolvem em uma aventura após encontrarem uma sereia chamada Aquamarine (Sara Paxton) em uma piscina, após uma forte tempestade. Aquamarine fugiu de casa devido a um casamento prometido e está disposta a encontrar seu grande amor. Ela recebe a ajuda de Claire e Hailey, até que se apaixona por um salva-vidas chamado Raymond (Jake McDorman).', 0, 'helena', NULL, NULL),
(NULL, 1400, 'H2O: Meninas Sereias', 'H2O: Just Add Water', 'Austrália', 'Aventura, Fantasia, Comédia', 'Colin Budds, Jeffrey Walker', '15502802765c676654adf06.jpg', 23, 2006, 'x0uy1t5Y6zU', 'Cariba Heine, Phoebe Tonkin, Angus McLaren, Burgess Abernethy, Claire Holt, Indiana Evans, Cleo Massey, Luke Mitchell, Alan David Lee', 'Após entrarem numa estranha caverna, as amigas Cleo (Phoebe Tonkin), Emma (Claire Holt) e Rikki (Cariba Heine) se transformam em poderosas sereias. Enquanto aprende a lidar com a radical mudança, o trio tenta manter segredo sobre o acontecido e se envolve em muitas aventuras.', 0, 'helena', NULL, NULL),
(NULL, 1401, 'Era Uma Vez...', 'Era Uma Vez...', 'Brasil', 'Breno Silveira', 'Drama, Romance', '15502814855c676b0d6bdc5.jpg', 116, 2008, 'JCQqaCXyvPM', 'Thiago Martins, Cyria Coentro, Rocco Pitanga, Vitória Frate, Luana Schneider, Paulo César Grande, Marcos Pitombo, Rodrigo Costa, Marcos Junqueira', 'Dé (Thiago Martins) mora na favela do Cantagalo, em Ipanema. Filho da empregada doméstica Bernadete (Cyria Coentro) e abandonado pelo pai, Dé viu seu irmão Beto ser assassinado por um traficante e seu outro irmão, Carlão (Rocco Pitanga), ser exilado da favela pelos bandidos. Decidido a não seguir o caminho do crime, Dé trabalha vendendo cachorro-quente num quiosque da praia. De lá ele observa Nina (Vitória Frate), filha única de uma família rica que mora na Vieira Souto, avenida em frente à praia. Os dois se conhecem e acabam se apaixonando, porém as diferenças entre seus mundos geram diversas críticas e preconceitos velados.', 0, 'helena', NULL, NULL),
(NULL, 1402, '2 Filhos de Francisco', '2 Filhos de Francisco', 'Brasil', 'Drama, Biografia', 'Breno Silveira', '15502819085c676cb49b85d.jpg', 132, 2005, 'M1vzU3kCcaU', 'Ângelo Antônio, Dira Paes, Dáblio Moreira, Marcos Henrique, José Dumont, Márcio Kieling, Thiago Mendonça, Paloma Duarte, Natália Lage, Jackson Antunes, Maria Flor, Zezé di Camargo, Luciano Camargo', 'Francisco Camargo (Ângelo Antônio) é um lavrador que quer transformar dois de seus nove filhos em uma dupla sertaneja. Ele inicialmente deposita sua esperança no mais velho, Mirosmar (Dablio Moreira), e resolve lhe dar um acordeão quando completa 11 anos. Mirosmar e o irmão Emival (Marco Henrique), que toca violão, se apresentam com sucesso nas festas da vila onde moram. Mirosmar e Emival começam então a tocar na rodoviária de Goiânia, quando se mudam para lá, na intenção de conseguir algum dinheiro para ajudar em casa. Os garotos onhecem Miranda (José Dumont), empresário de duplas caipiras, que viaja com eles por mais de 4 meses. Os irmãos novamente fazem sucesso, mas um acidente encerra prematuramente a carreira da dupla. Após quase desistir da carreira artística, Mirosmar decide voltar a cantar, agora usando o nome artístico de Zezé di Camargo (Márcio Kieling). Ele grava um disco solo, mas não obtém sucesso. Já casado e com duas filhas pequenas, Zezé tem dificuldades em sustentar a família e o máximo que consegue é que outras duplas cantem composições suas. É quando ele encontra em seu irmão Welson (Thiago Mendonça), que passa a usar o nome artístico de Luciano, o parceiro ideal para levar adiante sua carreira musical.', 0, 'helena', NULL, NULL),
(NULL, 1403, 'Chico Xavier - O Filme', 'Chico Xavier', 'Brasil', 'Biografia', 'Daniel Filho', '15502822815c676e298cdca.jpg', 125, 2010, 'bUYSxxdXgUk', 'Matheus Costa, Ângelo Antônio, Cássio Gabus Mendes, Nelson Xavier, Christiane Torloni, Tony Ramos, Giovanna Antonelli, Pedro Paulo Rangel, Luís Melo', 'Desde criança, Chico Xavier (Matheus Costa) ouvia vozes e via pessoas que já tinham falecido. Seus relatos eram sempre desacreditados, sob a justificativa que eram sua imaginação ou obra do demônio. Ao crescer, ele (Angelo Antônio) passa a usar seu dom para psicografar cartas. Logo se torna um ícone em sua cidade natal, despertando a ira do novo padre (Cássio Gabus Mendes) e acusações de ser uma fraude, já que publica livros de pessoas famosas que já tinham morrido. Já envelhecido, Chico (Nélson Xavier) participa do programa de TV \"Pinga-Fogo\", onde fala sobre sua trajetória de vida e questões do espiritismo. Através dele conhece Orlando (Tony Ramos), diretor de imagem do programa, que é ateu. Ele e sua esposa Glória (Christiane Torloni) sofrem devido a perda do filho, Tomás, morto quando ele e um amigo brincavam com uma arma encontrada. Agora o casal precisa decidir se irá agir no processo que pode condenar o responsável pela morte de Tomás.', 0, 'helena', NULL, NULL),
(NULL, 1404, 'Sabor da Paixão', 'Woman on Top', 'Estados Unidos', 'Comédia, Romance', 'Fina Torres', '15502826335c676f8954e87.jpg', 92, 2000, '1zdcrAqsa-4', 'Penélope Cruz, Murilo Benício, Harold Perrineau, Mark Feuerstein, John de Larice, Wagner Moura, Ana Gasteyer, Lázaro Ramos, Daniele Suzuki, Eliana Guttman, June Carryl', 'Dona de um restaurante na Bahia, a vida de Isabella (Penelope Cruz) muda radicalmente quando ela descobre a traição de seu marido, Toninho (Murilo Benício). Decidida em se divorciar, ela parte para San Francisco, onde busca dar a volta por cima e assume o comando de um programa sobre culinária.', 0, 'helena', NULL, NULL),
(NULL, 1405, 'Rocketman', 'Rocketman', 'Estados Unidos', 'Biografia, Drama, Fantasia, Musical', 'Dexter Fletcher', '15531303135c92e349ad2da.jpg', 0, 2019, 'tm9EjFLdoh8', 'Bryce Dallas Howard, Richard Madden, Taron Egerton, Jamie Bell', 'Cinebiografia do cantor e compositor Elton John, acompanhando desde quando era uma criança prodígio até se tornar um astro da música.', 0, 'nadalini', NULL, NULL),
(NULL, 1406, 'Era uma Vez em... Hollywood', 'Once Upon a Time ... in Hollywood', 'Estados Unidos', 'Comédia, Drama', 'Quentin Tarantino', '15669489615d65be61b0a0c.jpg', 161, 2019, 'jPDBoBYdf6g', 'Maya Hawke, Austin Butler, Margot Robbie, Sydney Sweeney', 'Los Angeles, 1969. Rick Dalton (Leonardo DiCaprio) é um ator de TV que, juntamente com seu dublê, está decidido a fazer o nome em Hollywood. Para tanto, ele conhece muitas pessoas influentes na indústria cinematográfica, o que os acaba levando aos assassinatos realizados por Charles Manson na época, entre eles o da atriz Sharon Tate (Margot Robbie), que na época estava grávida do diretor Roman Polanski (Rafal Zawierucha).', 1, 'nadalini', NULL, NULL),
(NULL, 1407, 'Star Wars: Episódio IX – A Ascensão Skywalker', 'Star Wars: The Rise of Skywalker', 'Estados Unidos', 'Ação, Aventura, Fantasia, Ficção Científica ', 'J.J. Abrams', '15670054595d669b13a019a.jpg', 0, 2019, 'SVl0fGu6obE', 'Domhnall Gleeson, Lupita Nyong\'o, Daisy Ridley, Oscar Isaac', 'Término da nova trilogia Star Wars, concluindo as tramas de O Despertar da Força (2015) e Os Últimos Jedi (2017).', 2, 'nadalini', NULL, NULL),
(NULL, 1408, 'A Babá', 'The Babysitter', 'Estados Unidos', 'Comédia, Terror', 'McG', '15677093735d7158bdeec84.jpg', 85, 2017, 'DzhCy1AAxik', 'Judah Lewis, Samara Weaving, Robbie Amell, Hana Mae Lee, Bella Thorne, Leslie Bibb, Andrew Bachelor, Emily Alyn Lind', 'Cole (Judah Lewis) é loucamente apaixonado por Bee (Samara Weaving), sua babá. Até que o garoto acaba descobrindo que ela na verdade é uma assassina adoradora do Diabo. Com isso, para que não revele o segredo, Cole está na mira da babá e seus amigos.', 0, 'helena', NULL, NULL),
(NULL, 1409, 'A Chave Mestra', 'The Skeleton Key', 'Estados Unidos', 'Terror, Suspense', 'Iain Softley', '15677095865d7159922b922.jpg', 104, 2005, 'MM9PJ5DvKys', 'Kate Hudson, Gena Rowlands, John Hurt, Peter Sarsgaard, Joy Bryant, Forrest Landis', 'Caroline Ellis (Kate Hudson) é uma jovem que acompanha doentes terminais, com o objetivo de juntar dinheiro para poder cursar a escola de enfermagem. Em um de seus trabalhos ela aceita acompanhar um senhor inválido, Ben Devereaux (John Hurt), que mora com sua esposa Violet (Gena Rowlands) em um terreno isolado na cidade de Nova Orleans. O local é famoso pela quantidade de cerimônias místicas lá realizadas, mas Caroline não acredita nestas crendices. Ben sofreu um derrame recentemente, que o deixou praticamente paralisado e mudo. Para que Caroline possa percorrer a casa à vontade, Violet lhe entrega uma chave mestra que abre todas as portas.', 0, 'helena', NULL, NULL),
(NULL, 1410, '7 Desejos', 'Wish Upon', 'Estados Unidos', 'Terror, Suspense, Fantasia', 'John R. Leonetti', '15677098565d715aa0606d8.jpg', 90, 2017, 'Q0ipNmPQeX4', 'Joey King, Ryan Phillippe, Ki Hong Lee, Sydney Park, Shanon Purser, Elisabeth Röhm, Sherilyn Fenn\r\n\r\n\r\n', 'A adolescente Claire (Joey King) descobre uma caixa mágica, que lhe concede sete desejos. Claire acaba fazendo apenas desejos pessoais e coisas ruins começam a acontecer. Com isso ela descobre que dentro da caixa vive uma entidade malvada, que pode estar causando esses acontecimentos terríveis.', 0, 'helena', NULL, NULL),
(NULL, 1411, 'A Maldição da Chorona', 'The Curse of La Llorona', 'Estados Unidos', 'Terror, Suspense', 'Michael Chaves', '15677100745d715b7a1ca4d.jpg', 93, 2019, '6Y3QdYdobFw', 'Linda Cardellini, Roman Christou, Jaynee-Lynne Kinchen, Raymond Cruz, Patricia Velasquez, Sean Patrick Thomas, Tony Amendola, Aiden Lewandowski', 'Na Los Angeles da década de 1970, uma assistente social criando seus dois filhos sozinha depois de ser deixada viúva começa a ver semelhanças entre um caso que está investigando e a entidade sobrenatural La Llorona. A lenda conta que, em vida, La Llorona afogou seus filhos e depois se jogou no rio, se debulhando em lágrimas. Agora ela chora eternamente, capturando outras crianças para substituir os filhos.', 0, 'helena', NULL, NULL);
INSERT INTO `movie` (`register_date`, `id`, `title`, `original_title`, `movieCountry`, `movieGenre`, `movieDirector`, `moviePoster`, `runtime`, `year`, `trailer`, `movie_cast`, `plot`, `movie_release`, `user_account`, `dystopia`, `summer`) VALUES
(NULL, 1412, 'A Casa dos Mortos', 'Demonic', 'Estados Unidos', 'Terror, Suspense', 'Will Canon', '15677102565d715c304da6d.jpg', 83, 2015, 'hUSzCqsbhQ4', 'Maria Bello, Frank Grillo, Cody Horn, Dustin Milligan, Megan Park, Soctt Mechlowicz, Aaron Yoo, Ashton Leigh', 'Um massacre acontece numa casa abandonada deixando cinco estudantes mortos. Um policial (Frank Grillo) e uma psicóloga (Maria Bello) vão investigar o caso, que ocorreu enquanto os jovens tentavam evocar fantasmas.', 0, 'helena', NULL, NULL),
(NULL, 1413, 'A Possessão do Mal', 'The Possession of Michael King', 'Estados Unidos', 'Terror', 'David Jung', '15677104555d715cf73d194.jpg', 83, 2014, 'S-TI8pppi5g', 'Shane Johnson, Ella Anderson, Cara Pifko, Tomas Arana, Luke Baines, Dale Dickey, Michael Ray Escamilla, Cullen Douglas', 'Michael King (Shane Johnson) não acredita em religião, espiritismo ou fatos paranormais. Enfrentando a morte da esposa, ele decide fazer seu próximo filme ligado à busca da existência de forças sobrenaturais. Michael permite que vários praticantes de artes ocultas testem os rituais mais pesados nele na intenção de provar que tudo é um mito. Porém, algo acontece.', 0, 'helena', NULL, NULL),
(NULL, 1414, 'Arraste-me para o Inferno', 'Drag Me to Hell', 'Estados Unidos', 'Terror', 'Sam Raimi', '15677106925d715de477f25.jpg', 99, 2009, '16jY86Nr3Us', 'Alison Lohman, Justin Long, Lorna Raver, Fernanda Romero, David Oaymer, Bojana Novakovci, Joanne Baron, Bonnie Aarons', 'Christine Brown (Alison Lohman) trabalha como analista de crédito e vive com seu namorado, o professor Clay Dalton (Justin Long). Um dia, para impressionar seu chefe, ela recusa o pedido de uma senhora (Lorna Raver) para conseguir um acréscimo em seu empréstimo, de forma que possa pagar sua casa. Como vingança ela joga uma maldição sobrenatural na vida de Christine.', 0, 'helena', NULL, NULL),
(NULL, 1415, 'O Caseiro', 'O Caseiro', 'Brasil', 'Terror', 'Julio Santi', '15677109175d715ec5a24e5.jpg', 89, 2016, 'u6aBW2VaBh8', 'Bruno Garcia, Malu Rodrigues, Leopoldo Pacheco, Julio Santi, Denise Weinberg, Pedro Bosnich', 'Davi, um cético professor de psicologia, é famoso por escrever um livro que explica aparições sobrenaturais através da psicanálise. Após anos sem atender pacientes, ele viaja para o interior buscando investigar o caso de um homem que acredita que sua filha vem sendo assombrada pelo fantasma do antigo caseiro de sua propriedade, que se suicidou.', 0, 'helena', NULL, NULL),
(NULL, 1416, 'O Rastro', 'O Rastro', 'Brasil', 'Terror, Suspense', 'J. C. Feyer', '15677111215d715f9146298.jpg', 110, 2017, 'gJA9Wbaeq1U', 'Rafael Cardoso, Leandra Leal, Natália Guedes, Claudia Abreu, Felipe Camargo, Jonas Bloch, Alice Wegmann, Érico Brás', 'João Rocha (Rafael Cardoso), um jovem e talentoso médico em ascensão, acaba encarregado de uma tarefa ingrata: supervisionar a transferência de pacientes quando um hospital público da cidade do Rio de Janeiro é fechado por falta de verba. Quando tudo parece correr dentro da normalidade, uma das pacientes, criança, desaparece no meio da noite, levando João para uma jornada num mundo obscuro e perigoso.', 0, 'helena', NULL, NULL),
(NULL, 1417, 'O Sono da Morte', 'Before I Wake', 'Estados Unidos', 'Terror, Suspense, Drama', 'Mike Flanagan', '15677112975d7160410ef53.jpg', 97, 2016, 'wUcQ1AUH_6s', 'Kate Bosworth, Thomas Jane, Jacob Tremblay, Annabeth Gish, Dash Mihok, Jay Karnes, Kyla Deaver', 'Logo após perder o filho pequeno, o casal Jessie (Kate Bosworth) e Mark (Thomas Jane) aceita adotar Cody (Jacob Tremblay), um garoto da mesma idade. O filho adotivo se adapta bem à nova família, mas ele tem um problema: os seus sonhos se tornam realidade, e os pesadelos, especialmente, podem ser mortais. Quando Jessie e Mark investigam o passado do garoto, descobrem histórias sinistras.', 0, 'helena', NULL, NULL),
(NULL, 1418, 'Selfie Para o Inferno', 'Selfie from Hell', 'Canadá', 'Terror, Mistério', 'Erdal Ceylan', '15677114845d7160fc9e3f3.jpg', 73, 2018, 'A3-MjPjQUZM', 'Alyson Walker, Tony Giroux, Meelah Adams, Ian Butcher', 'Julia é uma vlogueira canadense totalmente conectada e habituada a compartilhar sua rotina com os seguidores, famosa especialmente pelas selfies que faz com frequência. Sua vida, no entanto, toma um rumo obscuro quando, ao visitar sua prima Hanna nos Estados Unidos, cai gravemente doente e coisas muito sinistras passam a acontecer envolvendo seu smartphone.', 0, 'helena', NULL, NULL),
(NULL, 1419, 'Sono Mortal', 'Dead Awake', 'Estados Unidos', 'Terror', 'Phillip Guzman', '15677116705d7161b61dac8.jpg', 99, 2016, 'GG5IZ72vN4k', 'Jocelin Donahue, Jesse Bradford, Jesse Borrego, Lori Petty, Brea Grant, Mona Lee Fultz', 'Kate Bowman (Jocelin Donahue) é uma assistente social que está investigando uma misteriosa série de casos em que as pessoas morreram enquanto dormiam. Pouco antes das mortes, as vítimas relataram que uma força sobrenatural apareceu enquanto sofrem paralisia do sono. A medida que se aprofunda no caso, Kate abre espaço para a fúria da criatura, fazendo com ela e sua família sofram com um antigo mal.', 0, 'helena', NULL, NULL),
(NULL, 1420, 'Terror na Ilha', 'Black Rock', 'Estados Unidos', 'Suspense, Terror', 'Katie Aselton', '15677118415d716261f2782.jpg', 83, 2012, 'e1mh1gBn0Yk', 'Katie Aselton, Lake Bell, Kate Bosworth, Will Bouvier', 'Três amigas de infância decidem esquecer pequenos problemas entre elas e fazer uma viagem juntas em uma ilha, na costa leste americana. No local, elas descobrem a presença de três garotos, que logo se tornam amigos e propõem passar a noite com elas. Mas um grave incidente faz com que a vida das amigas esteja em perigo. Logo, elas conhecem as verdadeiras intenções destes homens. O trio precisará mostrar sua força e o quanto se importam umas com as outras para sobreviver a este final de semana trágico.', 0, 'helena', NULL, NULL),
(NULL, 1421, 'Turistas', 'Turistas', 'Estados Unidos', 'Terror, Suspense ', 'John Stockwell', '15677121405d71638c80b4d.jpg', 93, 2006, '9B6KGqtJyDI', 'Josh Duhamel, Melissa George, Max Brown, Desmond Askew, Beau Garrett, John Stockwell, Miguel Lunardi', 'Os irmãos Alex (Josh Duhamel) e Bea (Olivia Wilde), ambos americanos, estão entre os passageiros de um ônibus brasileiro, que carrega turistas e brasileiros. Eles estão com Amy (Beau Garrett), a melhor amiga de Bea, com todos decididos a aproveitar da melhor maneira possível os encantos do Brasil. Porém o motorista perde o controle do ônibus e o trio por pouco não consegue escapar do acidente, antes que o ônibus caísse em um penhasco. O trio se junta à australiana Pru (Melissa George) e aos britânicos Finn (Desmond Askew) e Liam (Max Brown), que também sobreviveram ao acidente. O grupo decide ir até a praia para encontrar um bar que Finn e Liam ouviram falar, ao invés de esperar com os moradores locais por um novo ônibus. Lá, eles encontram bebidas exóticas e pessoas dançando, o que faz com que todos se divirtam. Porém logo eles começam a se sentir mal e desmaiam, acordando horas depois sozinhos na praia.', 0, 'helena', NULL, NULL),
(NULL, 1422, 'O Exorcismo de Emily Rose', 'The Exorcism of Emily Rose', 'Estados Unidos', 'Suspense, Terror', 'Scott Derrickson', '15680700185d76d982af19d.jpg', 119, 2005, 'sCZIT0aKPb8', 'Laura Linney, Tom Wilkinson, Campbell Scott, Jennifer Carpenter', 'Emily Rose (Jennifer Carpenter) é uma jovem que deixou sua casa em uma região rural para cursar a faculdade. Um dia, sozinha em seu quarto no alojamento, ela tem uma alucinação assustadora, perdendo a consciência logo em seguida. Como seus surtos ficam cada vez mais frequentes, Emily, que é católica praticante, aceita ser submetida a uma sessão de exorcismo. Quem realiza a sessão é o sacerdote de sua paróquia, o padre Richard Moore (Tom Wilkinson). Erin Bruner (Laura Linney), uma advogada famosa, aceita pegar a defesa do padre Moore em troca da garantia de sociedade em uma banca de advocacia. À medida que o processo transcorre o cinismo e o ateísmo de Erin são desafiados pela fé do padre Moore e também pelos eventos inexplicáveis em torno do caso.', 0, 'helena', NULL, NULL),
(NULL, 1423, 'It - Capítulo 2', 'It Chapter Two', 'Estados Unidos', 'Terror', 'Andy Muschietti', '15680705865d76dbbaaffaa.jpg', 169, 2019, 'Zs0hLEHAoSs', 'Bill Skarsgård, Finn Wolfhard, Jessica Chastain, James McAvoy, Isaiah Mustafa, Bill Hader, Jay Ryan, James Ransone, Andy Bean', '27 anos depois dos eventos de \"It - A Coisa\", Mike (Isaiah Mustafa) percebe que o palhaço Pennywise (Bill Skarsgard) está de volta à cidade de Derry. Ele convoca os antigos amigos do Clube dos Otários para honrar a promessa de infância e acabar com o inimigo de uma vez por todas. Mas quando Bill (James McAvoy), Beverly (Jessica Chastain), Ritchie (Bill Hader), Ben (Jay Ryan) e Eddie (James Ransone) retornam às suas origens, eles precisam se confrontar a traumas nunca resolvidos de suas infâncias, e que repercutem até hoje na vida adulta.', 1, 'helena', NULL, NULL),
(NULL, 1424, 'Pacto Secreto', 'Sorority Row', 'Estados Unidos', 'Terror, Mistério', 'Stewart Hendler', '15680708335d76dcb120298.jpg', 101, 2009, 'aDlTi6tInvg', 'Briana Evigan, Rumer Willis, Audrina Patridge, Leah Pipes, Jamie Chung, Margo Harshman, Julian Morris, Carrie Fisher, Matt O\'Leary', 'Cassidy (Briana Evigan), Ellie (Rumer Willis), Megan (Audrina Patridge), Jessica (Leah Pipes) e Claire (Jamie Chung) são irmãs de fraternidade em uma faculdade. Elas juraram manter entre elas sigilo, companheirismo e solidariedade, independente do que aconteça. A lealdade entre elas é testada quando uma brincadeira dá errado e Megan é brutalmente assassinada. Com medo de que seus futuros sejam destruídos, elas decidem não confessar o crime e esconder o cadáver. Um ano depois, na época da formatura, as amigas decidem realizar uma festa de despedida na casa da fraternidade. No decorrer da festa as garotas recebem vídeos no celular, com cenas da noite do assassinato de Megan, enviadas por um remetente anônimo.', 0, 'helena', NULL, NULL),
(NULL, 1425, 'Cadáver', 'The Possession of Hannah Grace', 'Estados Unidos', 'Terror', 'Diederik Van Rooijen', '15680711035d76ddbf3ccdd.jpg', 86, 2018, 'LIV4-u8P8Pk', 'Shay Mitchell, Grey Damon, Stana Katic, Nick Thune, Jacob Ming-Trent, Louis Herthum', 'Megan Reed (Shay Mitchell) é uma policial reformada que tem lutado contra os vícios. Ela está prestando serviços comunitários em um hospital, como um pagamento para o tratamento que a deixou sóbria. Tudo, entretanto, torna a história muito mais macabra depois que um cadáver misterioso é encontrado no local.', 0, 'helena', NULL, NULL),
(NULL, 1426, 'A Morte do Demônio', 'Evil Dead', 'Estados Unidos', 'Terror', 'Fede Alvarez', '15680713775d76ded1eb667.jpg', 91, 2013, 'od5DvyqkLFk', 'Jane Levy, Shiloh Fernandez, Lou Taylor Pucci, Jessica Lucas, Elizabeth Blackmore', 'Mia (Jane Levy) é uma garota viciada em drogas. Ela é levada pelos amigos Olivia (Jessica Lucas) e Eric (Lou Taylor Pucci) para uma cabana isolada na floresta, no intuito de realizarem uma longa cura de desintoxicação. Para a surpresa de todos, o irmão de Mia, David (Shiloh Fernandez), rapaz afastado dos amigos e familiares há tempos, também aparece, junto de sua namorada, Natalie (Elizabeth Blackmore). Entretanto, eles são surpreendidos ao descobrirem que a cabana havia sido invadida, e que o porão parece uma espécie de altar grotesco, repleto de animais mortos. Lá eles encontram um livro antigo, trancado. Atraído, Eric resolve abri-lo e lê-lo em voz alta, sem imaginar as consequências de seus atos.', 0, 'helena', NULL, NULL),
(NULL, 1427, 'O Enigma das Cartas', 'House of Cards', 'Estados Unidos', 'Drama', 'Michael Lessac', '15680719095d76e0e533ecf.jpg', 109, 1993, '1QmbeOvSnUI', 'Kathleen Turner, Tommy Lee Jones, Asha Menina, Shiloh Strong, Joaquín Martínez', 'Quando o marido de Ruth Matthews (Kathleen Turner) morre em uma queda, quando à noite fazia escavações arqueológicas em umas ruínas maias, a caçula do casal, Sally (Asha Menina), reage à morte do pai de maneira muito estranha, pois ao voltar para sua casa não profere uma só palavra. Quando o comportamento de Sally piora, Ruth se vê obrigada a deixar que Jacob T. Beerlander (Tommy Lee Jones), um especialista em crianças autistas, examine sua filha. Jacob tenta tirar Sally da sua desordem mental por métodos tradicionais, mas Ruth tenta de outra maneira, ao reproduzir em grande escala um castelo de cartas que sua filha tinha construído. Por mais estranho que seja, Ruth crê que só assim terá Sally de volta.', 0, 'helena', NULL, NULL),
(NULL, 1428, 'O Enigma de Kaspar Houser', 'Jeder für sich und Gott gegen alle', 'Alemanha', 'Drama', 'Werner Herzog', '15680721215d76e1b94ef98.jpg', 110, 1974, 'R9qxbd3uR48', 'Bruno S., Walter Ladengast, Brigitte Mira', 'Um homem jovem chamado Kaspar Hauser (Bruno S.) aparece de repente na cidade de Nuremberg em 1828, e mal consegue falar ou andar, além de portar um estranho bilhete. Logo é descoberto que sua aparição misteriosa se deve ao fato de que ele ficou trancado toda sua vida em um cativeiro, desconhecendo toda a existência exterior. Quando ele é solto nas ruas sem motivo, muitas pessoas decidem ajudá-lo a se integrar na sociedade, mas rapidamente Kaspar se transforma em uma atração popular.', 0, 'helena', NULL, NULL),
(NULL, 1429, 'O Senhor das Moscas', 'Lord of the Flies', 'Estados Unidos', 'Aventura, Drama', 'Harry Hook', '15680723915d76e2c72f66d.jpg', 90, 1990, 'AnIXPoTY2LQ', 'Balthazar Getty, Chris Furrh, Danuel Pipoly, James Badge Dale, Edward Taft, Andrew Taft', 'Isolados em uma ilha deserta e tendo que lutar para sobreviver, um grupo de jovens estudantes acabou se dividindo em dois grupos: um deles marcado pela organização e disciplina e o outro tomado pela selvageria e que usa o medo como forma de poder. Mas as disputas de poder poderão colocar a vida de todos em risco.', 0, 'helena', NULL, NULL),
(NULL, 1430, 'Dente Canino', 'Dogtooth', 'Grécia', 'Drama, Suspense', 'Yorgos Lanthimos', '15680726985d76e3faddbf2.jpg', 97, 2009, 'QoFHYOn8oRQ', 'Christos Stergioglou, Michele Valley, Angeliki Papoulia, Hristos Passalis', 'Pai, mãe e três filhos vivem nos arredores de uma cidade. A casa é isolada por uma alta cerca que os filhos nunca puderam ultrapassar. Eles são educados, entediados e exercitados da maneira que seus pais acham correto, sem nenhuma interferência do mundo externo. Acreditam que o avião que veem passando ao longe no céu é um simples brinquedo, e zumbis são flores pequenas e amarelas. A única pessoa autorizada a entrar na casa é Christina, que trabalha no escritório do pai e visita o filho a fim de satisfazer suas necessidades sexuais. Toda a família gosta dela, em especial a filha mais velha. Um dia, Christina dá a ela uma bandana que brilha no escuro e pede uma outra coisa em troca.', 0, 'helena', NULL, NULL);
